INSERT INTO `recipe_translation` (`rt_id`, `rt_recipe_id`, `rt_lang_id`, `rt_recipe_name`, `rt_recipe_text`, `rt_recipe_ingredients_full`, `rt_recipe_image`, `rt_recipe_link`, `rt_recipe_prep`, `rt_recipe_duration`, `rt_recipe_calories`, `rt_recipe_nutrients`, `rt_recipe_claims`, `rt_created`) VALUES
(1, 1, 1, 'Curried Trout', 'Evenly coat the fillet(s) with the curry (slightly less on the skin side). Heat the butter and oil in a frying pan, taking care not to let them burn. When the pan is hot, add the fillet(s), skin side down. Sauté 4-5 min, then lower the heat, turn the fillet(s) and continue to cook 3-4 min until the flesh is tender and opaque. Check with a fork to see if it is cooked through Peel and discard the skin off the top of the fillet(s). Add salt and pepper to taste then serve on the warmed plates.', '[\"trout fillets\",\"curry powder\",\"butter, unsalted\",\"olive oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1109.jpg', 'https://www.soscuisine.com//recipe/curried-trout', 'Keep the serving plates in the oven at the lowest setting so they are warm when you serve.', '15 min', '320 kcal', '{\"calories\":\"320\",\"fat\":\"17 g\",\"cholesterol\":\"110 mg\",\"protein\":\"38 g\"}', '{\"free\":\"Sugar\",\"excellent_source_of\":\"Iron, Manganese, Niacin, Pantothenic Acid, Phosphorus, Potassium, Selenium, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin D\",\"good_source_of\":\"Copper, Magnesium, Vitamin B6, Vitamin E\",\"source_of\":\"Calcium, Folacin, Omega-3, Vitamin K, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:09:18'),
(2, 2, 1, 'Almond Sole Fillets', 'Heat the butter and oil in a frying pan, paying attention not to let them burn. Add the slivered almonds then cook them over medium heat until they are golden, 2-3 min. Remove the almonds from the pan and keep them warm on a small plate in the oven. Cook the sole fillets over fairly high heat, 2-3 min each side. Add the lemon juice, lower the heat, cover and cook an additional 5 min, depending on the thickness of the fillets, until the fish is tender and the flesh opaque. Check with a fork to see if it is cooked through Add salt and pepper to taste. Cover the fish with the almonds and serve on the warmed plates.', '[\"sole fillets, or haddock\",\"flaked almonds\",\"lemon juice, freshly squeezed\",\"butter, unsalted\",\"olive oil\",\"ground pepper to taste\",\"[optional]\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/665.jpg', 'https://www.soscuisine.com//recipe/almond-sole-fillets', 'Keep the serving plates in the oven at the lowest setting so they are warm when you serve.', '15 min', '310 kcal', '{\"calories\":\"310\",\"fat\":\"20 g\",\"cholesterol\":\"110 mg\",\"protein\":\"30 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Magnesium, Niacin, Phosphorus, Selenium, Vitamin B12, Vitamin D, Vitamin E\",\"good_source_of\":\"Potassium, Vitamin B6\",\"source_of\":\"Copper, Folacin, Iron, Manganese, Omega-3, Pantothenic Acid, Vitamin A, Vitamin B1, Vitamin B2, Vitamin C, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:09:19'),
(3, 3, 1, 'Chicken Shepherd\'s Pie', 'Preheat the oven to 205°C/400°F. Prepare the vegetables : finely chop the onion; thinly slice the mushrooms; peel the potatoes, cut them in half then them 20-25 min until very tender. Drain them well and set aside. Heat the oil in a pan over medium-high heat. Add the ground chicken and it until it looses its pink colour, about 7-8 min. When the chicken is golden-coloured, add the chopped onion then cook 2 min with stirring in the diced tomatoes, mushrooms, tomato paste, Worcestershire sauce, and . Add the frozen peas and continue cooking until heated through, about 4-5 min. Add salt and pepper. Remove the pan from the heat and tranfer the contents to a large baking dish, or distribute into individual baking dishes. Pour the milk into a large microwave-safe bowl. Add the butter and microwave on medium-high a few minutes, uncovered, until very hot. Add the cooked potatoes and mash until creamy. Add salt and pepper to taste. Place a spoonful of the potato mixture on top of the chicken mixture, then gently spread it with a spoon to cover evenly. Bake in the middle of the oven until the top is golden-brown, about 30 min. Serve.', '[\"potatoes\",\"onions, finely chopped\",\"button (white) mushrooms, thinly sliced\",\"olive oil\",\"ground chicken, or ground turkey\",\"canned tomatoes (diced)\",\"tomato paste\",\"Worcestershire sauce\",\"chicken broth\",\"frozen peas\",\"milk, partly skimmed, 2%\",\"butter, unsalted\",\"ground pepper to taste\",\"[optional]\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/864.jpg', 'https://www.soscuisine.com//recipe/chicken-shepherd-pie', 'For individual pies, choose baking dishes which contain about 375 ml or 1 ½ cups when 3/4 full.', '55 min', '410 kcal', '{\"calories\":\"410\",\"fat\":\"17 g\",\"cholesterol\":\"70 mg\",\"protein\":\"23 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Phosphorus, Potassium, Vitamin A, Vitamin B6\",\"good_source_of\":\"Copper, Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Pantothenic Acid, Selenium, Vitamin B1, Vitamin B2, Vitamin C\",\"source_of\":\"Calcium, Vitamin B12, Vitamin D, Vitamin E, Vitamin K, Zinc\",\"low\":\"Calories, Cholesterol, Saturated Fat, Sodium\"}', '2021-06-18 14:09:19'),
(4, 4, 1, 'Quick Berry Sorbet', 'Put the frozen berries in a blender . Add the lemon juice and icing sugar, then mix at maximum speed. With the blender running, pour in the egg whites and continue to mix until homogeneous. Transfer the mixture to a container, cover and chill in the freezer for at least 1 h before serving. Garnish with a few berries and serve.', '[\"berry mix, frozen\",\"lemon juice, freshly squeezed\",\"icing\\/confectioners\' sugar\",\"egg whites\"]', 'https://media.soscuisine.com/images/recettes/273.jpg', 'https://www.soscuisine.com//recipe/quick-berry-sorbet', 'will be very useful for this recipe.', '15 min', '100 kcal', '{\"calories\":\"100\",\"fat\":\"0 g\",\"cholesterol\":\"0 mg\",\"protein\":\"2 g\"}', '{\"diet-related_health_claims\":\"Artery-healthy\",\"excellent_source_of\":\"Manganese\",\"good_source_of\":\"Vitamin K\",\"source_of\":\"Fibre, Folacin, Magnesium, Niacin, Vitamin E\",\"low\":\"Sodium\",\"free\":\"Cholesterol, Fat, Saturated Fat, Trans Fat\"}', '2021-06-18 14:09:20'),
(5, 5, 1, 'Quick Chickpea Soup', 'Heat the oil in a saucepan over medium-low heat. Add the finely chopped garlic and onion then sauté 2-3 min until translucent, taking care not to let them burn. Drain and rinse the chickpeas, then add them to the saucepan. in the spices, tomatoes, and water. Bring to a boil, then lower the heat and cook 7-8 min. Add salt and pepper to taste. Purée the soup in a blender , then ladle it into bowls and serve.', '[\"canola oil\",\"garlic, minced\",\"onions, finely chopped\",\"ground cumin\",\"turmeric\",\"chickpeas\\/garbanzo beans (canned), drained and rinsed\",\"canned tomatoes (diced)\",\"chicken broth\",\"water\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1420.jpg', 'https://www.soscuisine.com//recipe/quick-chickpea-soup', 'will be very useful to purée the soup.', '15 min', '220 kcal', '{\"calories\":\"220\",\"fat\":\"5 g\",\"cholesterol\":\"0 mg\",\"protein\":\"8 g\"}', '{\"excellent_source_of\":\"Fibre, Folacin, Manganese, Vitamin B6\",\"good_source_of\":\"Copper, Iron, Magnesium, Potassium, Vitamin A, Zinc\",\"source_of\":\"Calcium, Niacin, Pantothenic Acid, Phosphorus, Selenium, Vitamin B1, Vitamin B2, Vitamin C, Vitamin E, Vitamin K\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:09:20'),
(6, 6, 1, 'Quick Chocolate Fudge', 'Line the bottom of an 8-inch square baking dish (20 x 20 cm) with parchment paper (which will make the fudge easier to unmold). Warm up the milk in a saucepan over low heat, taking care not to let it get so hot that it sticks to the bottom of the pan. When the milk is warm, take the pan off the heat, then in the chocolate. Let the mixture cool down 4-5 min, then it using a to make it smooth. Stir in the nuts (optional). Pour the mixture into the prepared baking dish then refrigerate until firm, about 1 hour. Invert the fudge onto a work surface, remove the parchment, then cut the fudge into 3 cm squares or diamond shaped pieces. The recipe makes about 40-42 pieces.', '[\"parchment paper\",\"sweetened condensed milk\",\"unsweetened (dark) chocolate, finely chopped\",\"walnuts, chopped\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1132.jpg', 'https://www.soscuisine.com//recipe/quick-chocolate-fudge', '', '15 min', '90 kcal', '{\"calories\":\"90\",\"fat\":\"4 g\",\"cholesterol\":\"0 mg\",\"protein\":\"1 g\"}', '{\"source_of\":\"Iron\",\"low\":\"Sodium\"}', '2021-06-18 14:09:20'),
(7, 7, 1, 'Quick Edge Couscous', 'In a bowl, mix all the dry ingredients and transfer to a plastic bag.', '[\"couscous, whole wheat, whole wheat\",\"chicken stock powder\",\"evaporated milk powder\",\"dried apricots\",\"flaked almonds\",\"water\"]', 'https://media.soscuisine.com/images/recettes/3313.jpg', 'https://www.soscuisine.com//recipe/quick-edge-couscous', '', '7 min', '400 kcal', '', '{\"diet_related_health_claims\":\"Bone-healthy, Heart-healthy\",\"excellent_source_of\":\"Fibre, Magnesium, Niacin, Potassium, Selenium, Vitamin A, Vitamin B12, Vitamin D, Vitamin E\",\"good_source_of\":\"Calcium, Copper, Folacin, Iron, Manganese, Pantothenic Acid, Phosphorus, Vitamin B2, Vitamin C, Zinc\",\"source_of\":\"Vitamin B1, Vitamin B6\",\"low\":\"Cholesterol, Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:09:21'),
(8, 8, 1, 'Quick Edge Muffins', 'In a bowl, mix all the dry ingredients and transfer to a plastic bag.', '[\"rolled oats\",\"wheat germ\",\"white flour (all purpose)\",\"baking soda\",\"raisins\",\"brown sugar\",\"ground cinnamon\",\"evaporated milk powder, skim\",\"walnuts\",\"fruit applesauce\",\"vegetable oil spray\"]', 'https://media.soscuisine.com/images/recettes/3308.jpg', 'https://www.soscuisine.com//recipe/quick-edge-muffins', '', '6 min', '210 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Folacin, Manganese, Selenium, Vitamin B1\",\"good_source_of\":\"Iron, Magnesium, Phosphorus, Zinc\",\"source_of\":\"Calcium, Copper, Fibre, Niacin, Omega-3, Omega-6, Pantothenic Acid, Potassium, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin D\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Cholesterol, Trans Fat\"}', '2021-06-18 14:09:21'),
(9, 9, 1, 'Quick Green Flageolet Bean Soup', 'Melt the butter in a saucepan over medium-low heat. Add the finely chopped shallot and sauté 2-3 min until translucent, taking care not to let it burn. Drain and rinse the flageolet beans, then add them to the saucepan. in the curry powder, and water. Bring to a boil, cover, and cook 2-3 min. Add salt and pepper to taste. Purée the soup in a blender , then ladle it into bowls and serve. If desired, garnish each bowl with a dollop of cream.', '[\"butter, unsalted\",\"shallots, finely chopped\",\"green kidney \\/ flageolet beans (canned), drained and rinsed\",\"curry powder\",\"chicken broth\",\"water\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"cream 15%\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/420.jpg', 'https://www.soscuisine.com//recipe/quick-green-flageolet-bean-soup', 'will be very useful to purée the soup.', '10 min', '160 kcal', '{\"calories\":\"160\",\"fat\":\"4 g\",\"cholesterol\":\"10 mg\",\"protein\":\"9 g\"}', '{\"free\":\"Sugar\",\"excellent_source_of\":\"Folacin\",\"source_of\":\"Calcium, Fibre, Iron, Manganese, Phosphorus, Vitamin E\"}', '2021-06-18 14:09:22'),
(10, 10, 1, 'Quick Lentil and Tomato Soup', 'Heat the oil in a saucepan over medium-low heat. Add the parsley and garlic base sauté 2-3 min, with stirring Add the tomatoes and minced chili pepper . Cook 2-3 min with occasional stirring . Add the lentils and water. Bring to a boil, then lower the heat and cook 15 min until the\r\nsoup has thickened. Add salt and pepper to taste. Ladle the soupe into bowls and serve.', '[\"olive oil\",\"Parsley and Garlic Base\",\"dried chili peppers, finely chopped\",\"canned tomatoes (diced)\",\"lentils (canned), drained and rinsed\",\"water\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/4409.jpg', 'https://www.soscuisine.com//recipe/quick-lentil-tomato-soup', '', '25 min', '220 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Folacin, Iron, Manganese, Potassium, Vitamin K\",\"good_source_of\":\"Copper, Fibre, Magnesium, Phosphorus, Vitamin A, Vitamin B1, Vitamin E, Zinc\",\"source_of\":\"Niacin, Pantothenic Acid, Selenium, Vitamin B2, Vitamin B6, Vitamin C\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:09:22'),
(11, 11, 1, 'Quick Melba', 'Peel the peaches, split them in half, then pull apart and remove their pits (if the peaches are not fully ripe, peeling may be easier if they are blanched for 30 sec). Set aside. In a saucepan, heat the raspberries and sugar over low heat. Cook 2-3 min, then mash the raspberries with a fork. In a small bowl, dilute the cornstarch with the apple juice. Add the slurry to the warm raspberries and cook over low heat, with stirring , about 2 min until the mixture thickens. Pass the thickened raspberries through a fine sieve and using a rubber spatula, press on the raspberries to extract as much juice as possible. Discard the seeds. Drizzle the peaches with the strained raspberry sauce and serve. Garnish with vanilla ice cream, if desired.', '[\"peaches, yellow, ripe, \\\"freestone\\\" type\",\"raspberries\",\"sugar\",\"apple juice\",\"cornstarch\",\"vanilla ice cream\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/187.jpg', 'https://www.soscuisine.com//recipe/quick-melba', 'The traditional recipe calls for poaching the peaches in a syrup. This step can be eliminated if ripe peaches are used.', '15 min', '150 kcal', '{\"calories\":\"150\",\"fat\":\"1 g\",\"cholesterol\":\"0 mg\",\"protein\":\"2 g\"}', '{\"diet-related_health_claims\":\"Artery-healthy\",\"excellent_source_of\":\"Fibre, Manganese\",\"good_source_of\":\"Potassium, Vitamin C, Vitamin E\",\"source_of\":\"Copper, Folacin, Iron, Magnesium, Niacin, Pantothenic Acid, Vitamin A, Vitamin K, Zinc\",\"low\":\"Fat\",\"free\":\"Cholesterol, Saturated Fat, Sodium, Trans Fat\"}', '2021-06-18 14:09:23'),
(12, 12, 1, 'Quick \"Semifreddo\" with Macaroons', 'Prepare a muffin tin by lining it with the paper cups. In a bowl, the cream until slightly stiff, then add the sugar and vanilla. Continue to until the cream forms stiff peaks . Finely crush the macaroons and fold them in. In another bowl, the egg whites until stiff\r\npeaks form. Gently fold the egg whites into the cream mixture. Spoon evenly into the paper liners. Cover the muffin tin with plastic wrap, then wrap with aluminum foil. Freeze at least 2 hours, or overnight. About 15 min before you are ready to serve, unmold the «cakes» onto individual serving plates,\r\ngarnish with a few berries, and let them sit for 15 min at room temperature before serving so that they will not be too cold and hard.', '[\"whipping cream 35%\",\"icing\\/confectioners\' sugar\",\"vanilla extract\",\"amaretti (dry almond macaroons)\",\"egg whites\",\"raspberries, or blackberries\",\"muffin paper cups\",\"plastic wrap\",\"aluminum foil\"]', 'https://media.soscuisine.com/images/recettes/487.jpg', 'https://www.soscuisine.com//recipe/quick-semifreddo-macaroons-alcohol-free', '', '15 min', '180 kcal', '{\"calories\":\"180\",\"fat\":\"15 g\",\"cholesterol\":\"50 mg\",\"protein\":\"2 g\"}', '{\"good_source_of\":\"Vitamin A\",\"source_of\":\"Vitamin D, Vitamin E\",\"low\":\"Sodium\"}', '2021-06-18 14:09:23'),
(13, 13, 1, 'Quinoa Pudding', 'quinoa in a bowl, then drain well. Bring quinoa and 2 cups of water to a boil in a large saucepan. Then reduce heat and simmer , uncovered, until grains are translucent, 13-15. Drain well in a sieve. Set aside. Preheat the oven to 175°C/350°F. Butter a 9-inch (23 cm) square metal baking pan. In a large bowl, together the eggs, milk, vanilla, sugar (but one tablespoon) and salt until just combined. in the cooked quinoa, nuts, and raisins. Pour the mixture into the buttered pan. In a small bowl, mix together the cinnamon and remaining sugar then sprinkle on top of the pudding. Bake in middle of oven for about 40 min, or until a knife inserted in the center comes out clean. Serve warm or at room temperature with optional maple syrup on the side.', '[\"butter, unsalted, for the pan\",\"quinoa\",\"eggs size large\",\"milk, partly skimmed, 2%\",\"vanilla extract\",\"sugar\",\"salt\",\"walnuts, chopped\",\"raisins\",\"ground cinnamon\",\"maple syrup\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1050.jpg', 'https://www.soscuisine.com//recipe/quinoa-pudding', '', '75 min', '290 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Magnesium, Manganese, Vitamin B12\",\"good_source_of\":\"Copper, Iron, Phosphorus, Selenium, Vitamin B2, Zinc\",\"source_of\":\"Calcium, Fibre, Folacin, Niacin, Pantothenic Acid, Potassium, Vitamin A, Vitamin B1, Vitamin B6, Vitamin D\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Trans Fat\"}', '2021-06-18 14:09:24'),
(14, 14, 1, 'Quinoa Salad with Asparagus', 'Prepare the asparagus blanch them about 10 min in a pot of boiling salted water. Make sure you cook them al dente. Take the asparagus out of the pot using tongs or a slotted spoon because the spears are too delicate to be drained directly in a colander .\r\nRinse the asparagus in cold water to stop the cooking and fix the colour. Set aside. Cook the quinoa in the water. Put the radish, green onions, spinach, and mint in a salad bowl. Pour the oil and lemon juice in a small bowl, add salt and pepper, then using a fork until the mixture is well emulsified. Cut the asparagus into bite-size pieces, then add them to the salad bowl. Add quinoa. Pour the vinaigrette over the salad then well. Add the feta cheese and pecans, adjust the seasoning , then serve.', '[\"quinoa\",\"water\",\"asparagus, average size\",\"radishes, thinly sliced\",\"green onions\\/scallions, minced\",\"baby spinach\",\"fresh mint, coarsely chopped\",\"extra virgin olive oil\",\"lemon juice, freshly squeezed\",\"feta cheese, light, crumbled\",\"pecans\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/3158.jpg', 'https://www.soscuisine.com//recipe/quinoa-asparagus-salad', 'You may serve this salad warm or at room temperature.', '30 min', '340 kcal', '{\"calories\":\"340\",\"fat\":\"22 g\",\"cholesterol\":\"10 mg\",\"protein\":\"10 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Iron, Magnesium, Manganese, Vitamin E, Vitamin K\",\"good_source_of\":\"Copper, Fibre, Phosphorus, Potassium, Vitamin A, Vitamin B1, Vitamin B2, Zinc\",\"source_of\":\"Calcium, Niacin, Pantothenic Acid, Selenium, Vitamin B6, Vitamin C\"}', '2021-06-18 14:09:24'),
(15, 15, 1, 'Quinoa, Pecan and Cranberry Salad', 'Place the quinoa in a fine strainer and hold it under cold running water until the water runs clear, then drain well. Put it in a saucepan with the water and a pinch of salt. Bring to a rolling boil. Reduce the heat, cover, then simmer until the grains are translucent and the germ has spiralled out from each grain, about 15 minutes. Place the quinoa in a bowl, then let it cool down about 1 h at room temperature. Add the pecans, cranberries, zest and juice of the orange, oil, balsamic vinegar, thyme and salt. Mix well. Chill in the refrigerator for about 1 h to allow the flavours to meld. Adjust the seasoning then serve.', '[\"quinoa\",\"water\",\"pecans, coarsely chopped\",\"dried cranberries\",\"oranges, juice and peel\",\"canola oil\",\"fresh thyme, finely chopped\",\"balsamic vinegar\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2562.jpg', 'https://www.soscuisine.com//recipe/quinoa-pecan-cranberry-salad', '', '25 min', '370 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Iron, Magnesium, Manganese\",\"good_source_of\":\"Copper, Fibre, Phosphorus, Potassium, Vitamin E, Vitamin K, Zinc\",\"source_of\":\"Folacin, Niacin, Omega-3, Omega-6, Pantothenic Acid, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin C\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol\"}', '2021-06-18 14:09:24'),
(16, 16, 1, 'Chicken Stroganoff', 'Cut the chicken meat into 1 X 5 cm strips. with flour. Heat the oil in a frying pan over medium heat. Sauté the finely chopped onion a few minutes until traslucent, then take it out of the pan and set aside on a small plate. Turn the heat up high, add the butter, and the pieces of chicken in the same pan. Add the warm deglaze the pan. Put the onion back in. Season with salt and pepper. Start cooking gently, covered. While the meat cooks, prepare the mushrooms , slice them finely and add them to the pan after the chicken has cooked 20-25 min. Cook an additional 10-12 min. In a small bowl, mix the tomato paste with the cream and Worcestershire sauce. Add to the\r\npan and cook over very low heat for 3-5 min, taking care not to let it boil. Serve on the warmed plates.', '[\"chicken breasts, boneless, skinless, cut into 1x5 cm strips\",\"white flour (all purpose)\",\"canola oil\",\"onions, finely chopped\",\"butter, unsalted\",\"chicken broth\",\"button (white) mushrooms, thinly sliced\",\"tomato paste\",\"whipping cream 35%\",\"Worcestershire sauce\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/815.jpg', 'https://www.soscuisine.com//recipe/chicken-stroganoff', '', '55 min', '310 kcal', '{\"calories\":\"310\",\"fat\":\"16 g\",\"cholesterol\":\"90 mg\",\"protein\":\"26 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Niacin, Potassium, Selenium, Vitamin A, Vitamin B2, Vitamin B6\",\"good_source_of\":\"Copper, Pantothenic Acid, Phosphorus, Vitamin B12, Vitamin E, Zinc\",\"source_of\":\"Folacin, Iron, Magnesium, Manganese, Vitamin B1, Vitamin C, Vitamin D, Vitamin K\",\"low\":\"Calories, Sodium\"}', '2021-06-18 14:09:25'),
(17, 17, 1, 'Red Cabbage and Leek Soup', 'Prepare the vegetables : Chop the leek, garlic, and cabbage. Heat the oil in a saucepan over medium heat. Add the leek and garlic, then sauté 3-4 min until softened. Grate the ginger and add it to the pan. in the curry and cook 1 min with stirring . Lower to heat, then add the cabbage and cook 10 min with occasional stirring Pour in the , bring it to a boil, cover and simmer until the cabbage is fully cooked, about 15 min. Add salt and pepper to taste. Take the pan off the heat, let it cool down a few minutes then purée the soup in a blender food processor Adjust the seasoning , then ladle the soup into bowls. Garnish with sour cream and chopped scallions, then serve (warm or at room temperature).', '[\"canola oil\",\"red cabbage, finely chopped\",\"leeks, finely chopped\",\"garlic, minced\",\"curry powder\",\"gingerroot, grated\",\"chicken broth\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"sour cream\",\"[optional]\",\"green onions\\/scallions, finely chopped\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2549.jpg', 'https://www.soscuisine.com//recipe/red-cabbage-leek-soup', 'will be very useful to purée the soup.', '35 min', '70 kcal', '{\"calories\":\"70\",\"fat\":\"2 g\",\"cholesterol\":\"0 mg\",\"protein\":\"3 g\"}', '{\"excellent_source_of\":\"Vitamin K\",\"good_source_of\":\"Folacin, Manganese, Potassium, Vitamin B6\",\"source_of\":\"Calcium, Fibre, Iron, Magnesium, Niacin, Phosphorus, Selenium, Vitamin B1, Vitamin B2, Vitamin C, Vitamin E\",\"low\":\"Fat, Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:09:26'),
(18, 18, 1, 'Red Cabbage Salad with Scallions', 'Thinly slice the cabbage and green onions, then add them to a salad bowl with the chopped dill. Pour the Classic Vinaigrette over the salad. Add salt and pepper to taste. and serve.', '[\"red cabbage, thinly sliced\",\"green onions\\/scallions, thinly sliced\",\"fresh dill, finely chopped\",\"Classic Vinaigrette\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/4336.jpg', 'https://www.soscuisine.com//recipe/red-cabbage-salad-scallions', '', '10 min', '170 kcal', '{\"calories\":\"170\",\"fat\":\"17 g\",\"cholesterol\":\"0 mg\",\"protein\":\"1 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Vitamin C, Vitamin K\",\"good_source_of\":\"Vitamin E\",\"source_of\":\"Folacin, Iron, Manganese, Vitamin A, Vitamin B6\",\"low\":\"Sodium\"}', '2021-06-18 14:09:28'),
(19, 19, 1, 'Red Pepper Ratatouille', 'Heat the oil in a saucepan over medium heat. Cook the garlic and onion 4-5 min until lightly coloured and soft, paying attention not to let them burn. Prepare the peppers : Cut them lengthwise into 2 cm strips. Sauté 4-5 min, then add the tomatoes. Cook over low heat, covered, 15-20 min until the peppers are soft. Add salt and pepper to taste. Serve.', '[\"yellow or red sweet peppers, cut into 2 cm-wide strips\",\"garlic, minced\",\"onions, finely chopped\",\"canned tomatoes (diced)\",\"olive oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/113.jpg', 'https://www.soscuisine.com//recipe/red-pepper-ratatouille', '', '30 min', '120 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Vitamin A, Vitamin C, Vitamin E\",\"good_source_of\":\"Potassium, Vitamin B6\",\"source_of\":\"Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Pantothenic Acid, Vitamin B1, Vitamin B2, Vitamin K\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:09:29'),
(20, 20, 1, 'Red Smoothie', 'Prepare the beets boil or steam them about 25-30 min. Let the beets cool down a few minutes, then peel them and dice into 1,5 cm pieces. Place the all the ingredients in a food processor blender Process on the highest speed until a well-blended purée forms, about 1-2 min, stopping to scrape down the sides of the container once or twice. Serve.', '[\"beetroots\",\"avocados, mashed\",\"celery, cut into 3 cm pieces\",\"pitted dates\",\"coconut oil\",\"apples, green, Granny Smith type, peeled, cored, then cut into segments\",\"flax seeds, ground\",\"silken tofu\",\"strawberries\",\"lemon juice, freshly squeezed\",\"coconut water\",\"water\"]', 'https://media.soscuisine.com/images/recettes/3086.jpg', 'https://www.soscuisine.com//recipe/red-smoothie', 'will be very useful for this recipe.', '35 min', '220 kcal', '{\"calories\":\"220\",\"fat\":\"7 g\",\"cholesterol\":\"0 mg\",\"protein\":\"5 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Fibre, Folacin, Magnesium, Manganese, Potassium, Vitamin C\",\"good_source_of\":\"Copper, Vitamin B6, Vitamin K\",\"source_of\":\"Calcium, Iron, Niacin, Omega-3, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin B2, Vitamin E, Zinc\"}', '2021-06-18 14:09:29'),
(21, 21, 1, 'Rhubarb and Strawberry Sorbet', 'Put a metal or glass bowl (or tray) into the freezer so that it will be cold when filling it with the sorbet mixture. Wash the rhubarb stalks briefly. If necessary, the fibrous strings can be removed by pulling them as with celery .\r\nCut them crosswise into approximately 1,5 cm pieces and place them in a saucepan. in the sugar, lemon juice, and water. Bring to a boil, then lower the heat, cover and simmer 8-10 min. Take the saucepan off the heat. Hull the strawberries and halve them lengthwise, then add them to the rhubarb. Transfer the mixture to a blender and process until smooth. With the blender running, pour in the egg white(s) and continue to mix until homogeneous.\r\nYou may also the egg white(s) in a separate bowl using an electric mixer ,\r\nthen add them to the fruit purée and mix well. Let the mixture cool down about 10 min in the refrigerator, then pour it into the prepared container, cover and chill in the freezer. After about 3 h, take the mixture out of the freezer and it using a whisk. Return it to the freezer and repeat the same stirring operation after an additional 2 h. In order to reduce the standing times between the stirring operations, you may distribute the mixture into 2 smaller containers, rather than just pouring it into 1, so\r\nthat it will freeze more rapidly. This is particularly useful when preparing larger amounts. Take the sorbet out of the freezer at least 15 min before serving, so that it will soften slightly.', '[\"rhubarb\",\"sugar\",\"lemon juice, freshly squeezed\",\"water\",\"strawberries\",\"egg whites\"]', 'https://media.soscuisine.com/images/recettes/556.jpg', 'https://www.soscuisine.com//recipe/rhubarb-strawberry-sorbet', '', '20 min', '100 kcal', '{\"calories\":\"100\",\"fat\":\"0 g\",\"cholesterol\":\"0 mg\",\"protein\":\"1 g\"}', '{\"diet-related_health_claims\":\"Artery-healthy\",\"good_source_of\":\"Vitamin C\",\"source_of\":\"Manganese, Vitamin K\",\"low\":\"Sodium\",\"free\":\"Cholesterol, Fat, Saturated Fat, Trans Fat\"}', '2021-06-18 14:09:30'),
(22, 22, 1, 'Rhubarb Compote', 'Wash the stalks briefly. If necessary, the fibrous strings can be removed by pulling them as with celery .\r\nCut them crosswise into approximately 1,5 cm pieces and place them in a bowl with the sugar. Chill for about 12 hours in the refrigerator. Transfer the rhubarb with all the juice into a saucepan. Pour in the water, cover, and cook over medium-low heat for about 20 min, with occasional stirring ,\r\nuntil the rhubarb has softened completely. Let it cool down and serve it cold or at room temperature.', '[\"rhubarb, cut into 1.5 cm pieces\",\"sugar\",\"water\"]', 'https://media.soscuisine.com/images/recettes/164.jpg', 'https://www.soscuisine.com//recipe/rhubarb-compote', 'This recipe calls for a minimum amount of sugar. Add more if you wish to compensate for rhubarb\'s intense tartness.', '30 min', '50 kcal', '{\"calories\":\"50\",\"fat\":\"0 g\",\"cholesterol\":\"0 mg\",\"protein\":\"1 g\"}', '{\"diet-related_health_claims\":\"Artery-healthy\",\"excellent_source_of\":\"Vitamin K\",\"source_of\":\"Calcium, Manganese, Potassium, Vitamin C\",\"low\":\"Sodium\",\"free\":\"Cholesterol, Fat, Saturated Fat, Trans Fat\"}', '2021-06-18 14:09:31'),
(23, 23, 1, 'Rice with Vegetables', 'Preheat the oven to 375°F (190°C). Wash and finely chop the vegetables. Sauté lightly in oil. Pour the uncooked rice on the vegetables. Add the , garlic, bay leaf and clove. Bake in the oven for 25 minutes in a covered Pyrex dish.', '[\"onions\",\"green onions\\/scallions\",\"celery\",\"olive oil, or coconut oil\",\"arborio rice\",\"chicken broth, low-sodium\",\"garlic, minced\",\"bay leaf\",\"cloves\"]', 'https://media.soscuisine.com/images/recettes/2218.jpg', 'https://www.soscuisine.com//recipe/rice-vegetables', '', '35 min', '190 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Vitamin K\",\"source_of\":\"Copper, Folacin, Magnesium, Manganese, Selenium, Vitamin B1, Vitamin B6, Vitamin E, Zinc\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:09:32'),
(24, 24, 1, 'Rice, Spinach and Cashew Salad', 'Cook the rice , then put it in a large bowl (to allow enough room for the spinach) and let cool down about 10 min Add the nuts, mushrooms, spinach, raisins, scallions and celery. In a small bowl, combine the oil, soy sauce, and lemon juice. Season with pepper to taste then pour over the salad. and let stand in the refrigerator at least 1 h. Serve.', '[\"basmati rice\",\"cashews, unsalted\",\"button (white) mushrooms, thinly sliced\",\"baby spinach\",\"raisins\",\"green onions\\/scallions, thinly sliced\",\"celery, thinly sliced\",\"canola oil\",\"soy sauce\",\"lemon, freshly squeezed\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2570.jpg', 'https://www.soscuisine.com//recipe/rice-spinach-cashew-salad', 'This salad is a meal in itself. Ideal for pot-lucks and pic-nics.', '25 min', '470 kcal', '{\"calories\":\"470\",\"fat\":\"31 g\",\"cholesterol\":\"0 mg\",\"protein\":\"11 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Copper, Folacin, Iron, Magnesium, Manganese, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin E, Vitamin K, Zinc\",\"good_source_of\":\"Niacin, Pantothenic Acid, Vitamin B1, Vitamin B2, Vitamin B6\",\"source_of\":\"Calcium, Fibre, Omega-3, Omega-6, Vitamin C\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Cholesterol\"}', '2021-06-18 14:09:32'),
(25, 25, 1, 'Risotto Milanese', 'Finely chop the onion. Heat the in a small saucepan on the stove or in a microwave oven. Keep it warm while cooking the risotto (which will take about 20 min). Melt the oil and butter in a saucepan. Add the onion then sauté 2-3 min, until it becomes translucent. Add the rice and toast the grains 1-2 min (until translucent), with constant stirring , then add the saffron. Cook the risotto until the rice is creamy but still al dente , about 20 min. in the grated Parmesan cheese, then let the risotto stand for 2 min. Season with salt (not much if the broth is salty) and pepper to taste, then serve.', '[\"onions, finely chopped\",\"beef broth, or chicken\",\"butter, unsalted\",\"olive oil\",\"arborio rice\",\"saffron powder\",\"Parmesan cheese, grated\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/830.jpg', 'https://www.soscuisine.com//recipe/risotto-milanese', '.', '25 min', '210 kcal', '{\"calories\":\"210\",\"fat\":\"5 g\",\"cholesterol\":\"10 mg\",\"protein\":\"4 g\"}', '{\"free\":\"Added Sugar\",\"source_of\":\"Calcium, Copper, Magnesium, Phosphorus, Selenium, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:09:33'),
(26, 26, 1, 'Roasted Asparagus with Oranges', 'Preheat the oven to 230ºC/450ºF. Prepare the asparagus . Peel the oranges with a small paring knife, removing all the pith. Slice the oranges into rounds, reserving any juice that runs out. Lay the asparagus on an oiled baking tray. Coat thoroughly with oil, then add salt. Cook until the asparagus change colour, about 8-10 min, depending on their size. Shake the tray a couple times during\r\ncooking, so that the asparagus will grill evenly. Arrange the asparagus on a serving plate. Add the orange rounds, reserved juice, and the oil left over from the cooking tray. Sprinkle with few drops of balsamic vinegar. Serve.', '[\"asparagus, average size\",\"oranges, cut into rounds\",\"olive oil\",\"balsamic vinegar\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/44.jpg', 'https://www.soscuisine.com//recipe/roasted-asparagus-oranges', '', '20 min', '180 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Folacin, Iron, Potassium, Vitamin A, Vitamin B1, Vitamin C, Vitamin E, Vitamin K\",\"good_source_of\":\"Copper, Fibre, Vitamin B2\",\"source_of\":\"Calcium, Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Selenium, Vitamin B6, Zinc\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Sodium, Trans Fat\"}', '2021-06-18 14:09:34'),
(27, 27, 1, 'Roasted Fennel', 'Preheat the oven to 215°C/425°F. Remove the fennel stalks and the feathery leaves. Slice the bulb lengthwise into 1/2-inch-thick pieces. Lay the fennel slices in one layer on a generously oiled dish and coat thoroughly with the oil. Season with salt and pepper. Roast in the middle of the oven for about 20 min until the pieces are soft and golden-brown. Turn them once during cooking. Take out of the oven, sprinkle with lemon juice then serve.', '[\"fennels\",\"olive oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"lemonjuice, freshly squeezed\"]', 'https://media.soscuisine.com/images/recettes/4197.jpg', 'https://www.soscuisine.com//recipe/roasted-fennel', '', '25 min', '70 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"good_source_of\":\"Potassium\",\"source_of\":\"Fibre, Folacin, Magnesium, Manganese, Vitamin C, Vitamin E\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Cholesterol, Sugar, Trans Fat\"}', '2021-06-18 14:09:34'),
(28, 28, 1, 'Chicken Tikka', 'In a bowl, all the ingredients together, except the chicken and oil. Add the chicken pieces, stirring to coat well. Let sit, covered, 30 min to 1 hour in the refrigerator. When ready to cook, thread the chicken pieces onto the skewers, leaving a little space between the pieces. Cook on a medium-hot, oiled grill, turning occasionally until the chicken is nicely coloured and just cooked through, about 5-7 min. If an outdoor grill is not available, the chicken pieces may be cooked in a well-oiled, well-seasoned, ridged pan or they may be broiled in an oven. Serve.', '[\"yogurt, plain, 2%\",\"lime juice, freshly squeezed\",\"gingerroot, finely grated\",\"garlic, minced\",\"curry powder\",\"cayenne pepper\",\"paprika\",\"salt\",\"chicken thighs, boneless, skinless, cut into 2 cm cubes\",\"olive oil\",\"bamboo or wooden skewers\"]', 'https://media.soscuisine.com/images/recettes/1068.jpg', 'https://www.soscuisine.com//recipe/chicken-tikka', 'If the chicken pieces will be cooked using an outdoor grill, you will first need to soak the wooden skewers for about 15-30 min in warm water.', '20 min', '200 kcal', '{\"calories\":\"200\",\"fat\":\"10 g\",\"cholesterol\":\"70 mg\",\"protein\":\"23 g\"}', '{\"source_of\":\"Calcium, Vitamin B12, Vitamin B2, Vitamin E\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:09:35'),
(29, 29, 1, 'Roasted Pineapple Cream', 'Peel the pineapple, remove the core and cut into thin slices (about 7 mm). Slit the vanilla bean lengthwise down the centre, scrape out some of the seeds and put them along with the scraped bean in a bowl. Add the cinnamon, sugar and pineapple juice, then mix well. Put the pineapple slices into the bowl to macerate for at least 2 h at room temperature or in the refrigerator overnight. Melt the butter in a pan over medium heat. Add the drained pineapple slices and for a few minutes, until golden. Add the marinade (without the vanilla bean*) and cook about 10 min over low heat. Tranfer the pan contents to a blender and purée. in the cream, mix well and portion out the mixture into individual cups or goblets. Chill in the refrigerator for at least 2 h before serving.', '[\"pineapple\",\"vanilla beans\",\"ground cinnamon\",\"sugar\",\"pineapple juice\",\"butter, unsalted\",\"whipping cream 35%\"]', 'https://media.soscuisine.com/images/recettes/295.jpg', 'https://www.soscuisine.com//recipe/roasted-pineapple-cream-alcohol-free', 'will be very useful for this recipe.', '30 min', '180 kcal', '{\"calories\":\"180\",\"fat\":\"7 g\",\"cholesterol\":\"20 mg\",\"protein\":\"1 g\"}', '{\"excellent_source_of\":\"Manganese, Vitamin C\",\"source_of\":\"Copper, Fibre, Folacin, Iron, Magnesium, Pantothenic Acid, Potassium, Vitamin A, Vitamin B1, Vitamin B6\",\"low\":\"Sodium\"}', '2021-06-18 14:09:36'),
(30, 30, 1, 'Roasted Vegetables', 'Preheat the oven to 190°C/375°F. Generously oil a baking sheet. Prepare the vegetables then cut them into uniform pieces approximately 1,5 cm thick. Lay them out on the sheet in one layer and coat thoroughly with the oil. Add the unpeeled garlic, crushed with the broad side of a knife blade, along with the rosemary leaves and salt. Roast in the middle of the oven for about 35-40 min until the vegetables are soft and golden-coloured. Turn them twice during cooking. Serve.', '[\"potatoes, cut into 1,5 cm pieces\",\"carrots, cut into 1,5 cm pieces\",\"onions, cut into 1,5 cm pieces\",\"turnips, or rutabagas, cut into 1,5 cm pieces\",\"garlic, unpeeled and crushed\",\"rosemary, fresh\",\"olive oil\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/116.jpg', 'https://www.soscuisine.com//recipe/roasted-vegetables', '', '55 min', '160 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Potassium, Vitamin A\",\"good_source_of\":\"Fibre, Folacin, Manganese, Vitamin B6, Vitamin C\",\"source_of\":\"Copper, Iron, Magnesium, Niacin, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin B2, Vitamin E, Vitamin K, Zinc\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:09:36'),
(31, 31, 1, 'RoastedJerusalem Artichokes', 'Preheat the oven to 190°C/375°F. Generously oil an ovenproof dish or baking sheet. Cut the Jerusalem artichokes in half if they are medium to large size or keep whole if they are the size of baby potatoes. Lay them out on the sheet with the unpeeled garlic cloves. Coat thoroughly with the oil. Season with salt and pepper to taste. Roast in the middle of the oven, stirring occasionally, for about 45 min until the Jerusalem artichokes are soft and golden-coloured. Take the dish out of the oven. Unpeel the garlic then toss it with the Jersualem artichokes. Sprinkle with parsley then serve.', '[\"olive oil\",\"jerusalem artichokes, peeled\",\"garlic\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"Italian parsley, fresh, chopped\"]', 'https://media.soscuisine.com/images/recettes/4411.jpg', 'https://www.soscuisine.com//recipe/roasted-jerusalem-artichokes', '', '55 min', '160 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Iron, Potassium, Vitamin K\",\"good_source_of\":\"Vitamin B1\",\"source_of\":\"Copper, Fibre, Folacin, Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Vitamin B2, Vitamin B6, Vitamin C, Vitamin E\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:09:38'),
(32, 32, 1, 'Rosemary Potatoes', 'Prepare the potatoes . Peel, then dice them into 1,5 cm pieces. Heat the butter and oil in a pan over medium heat, taking care not to let the butter burn. Add the rosemary sprig and diced potatoes. Sauté about 5 min, with frequent stirring , until the potatoes are a light golden colour. Add salt, remove the rosemary sprig, cover and cook over low heat about 15-20 min, or until the potatoes are soft.', '[\"potatoes, peeled and cut into 1,5 cm pieces\",\"butter, unsalted\",\"canola oil\",\"rosemary, fresh\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/366.jpg', 'https://www.soscuisine.com//recipe/rosemary-potatoes', '', '25 min', '200 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"free\":\"Added Sugar\",\"excellent_source_of\":\"Potassium, Vitamin B6\",\"good_source_of\":\"Copper, Magnesium, Vitamin C\",\"source_of\":\"Fibre, Folacin, Manganese, Niacin, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin E, Vitamin K\",\"low\":\"Cholesterol, Saturated Fat, Sodium\"}', '2021-06-18 14:09:39'),
(33, 33, 1, '\"RÃÂ¶sti\"', 'Peel the potatoes and grate them on a large holed grater, without rinsing (the starch keeps the pancake together). Add salt. Heat the butter and oil in a non-stick sauté pan over medium heat. Put one handful of the grated potatoes in the pan and press it with a spatula to a thin layer, about 7 millimeters. Continue to press while the rösti cooks so that it will stick together. for 4-5 min until crisp on one side, then turn it over and an additional 4-5 min, until crisp on the other side. You may need to add some more oil to the pan. When ready, set aside on a plate in a warm oven. Repeat the above steps for the remaining potato mixture. Serve.', '[\"potatoes, Yukon Gold (yellow flesh), peeled, then grated\",\"butter, unsalted\",\"olive oil\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/209.jpg', 'https://www.soscuisine.com//recipe/rosti', '', '15 min', '270 kcal', '{\"calories\":\"270\",\"fat\":\"15 g\",\"cholesterol\":\"20 mg\",\"protein\":\"3 g\"}', '{\"free\":\"Sugar\",\"excellent_source_of\":\"Potassium, Vitamin B6\",\"good_source_of\":\"Copper, Vitamin C\",\"source_of\":\"Fibre, Folacin, Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Vitamin A, Vitamin B1, Vitamin E, Vitamin K, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:09:41'),
(34, 34, 1, 'Rosy-red Pasta Sauce', 'Heat the oil in saucepan over medium heat. Add the chopped onion and minced or pressed garlic, then sauté 5 min until translucent. Add the strained tomatoes, salt, and pepper. Cook 15 min over medium-low heat, with occasional stirring Remove the pan from the heat, then in the cream. Mix well then purée in a blender', '[\"olive oil\",\"onions, finely chopped\",\"garlic, pressed or minced\",\"strained tomatoes\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"whipping cream 35%\"]', 'https://media.soscuisine.com/images/recettes/633.jpg', 'https://www.soscuisine.com//recipe/rosy-red-pasta-sauce-alcohol-free', 'will be very useful to purée the sauce.', '25 min', '270 kcal', '', '', '2021-06-18 14:09:41'),
(35, 35, 1, 'Chicken under a Brick', 'Baste the chicken with the oil. Season with salt and pepper. Wrap the bricks in aluminum foil. Heat  a thick-bottom pan. When the pan is hot, add the chicken, breast side down. Cover the chicken loosely with aluminum foil. Place the wrapped bricks on the chicken (the basic idea is to flatten the chicken by applying a fair amount of weight evenly over its surface). Cook about 15 min, occasionally checking that the skin becomes golden coloured and adjusting the heat accordingly. Remove the weights and foil cover, then turn the chicken using a spatula to loosen the skin from the bottom of the pan. Place the foil cover and weights back on top of the chicken then continue to cook until a thermometer inserted into the leg reaches 75°C/165°F, about 20 min (large chickens may take an additional 5 min or so). As an alternative, the chicken may be cooked using an outdoor grill. The bird must be weighted down with the bricks, and covered. Remove the bricks and cover, then pour the lemon juice over the chicken while it is still hot. Let the chicken stand 10 min, then serve.', '[\"aluminum foil\",\"olive oil\",\"chicken, whole, butterflied, trimmed of excess skin and fat\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"lemon juice, freshly squeezed\"]', 'https://media.soscuisine.com/images/recettes/1183.jpg', 'https://www.soscuisine.com//recipe/chicken-under-brick', '', '45 min', '250 kcal', '{\"calories\":\"250\",\"fat\":\"11 g\",\"cholesterol\":\"100 mg\",\"protein\":\"34 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Niacin, Selenium, Vitamin B6\",\"good_source_of\":\"Pantothenic Acid, Phosphorus, Vitamin B12, Zinc\",\"source_of\":\"Iron, Magnesium, Potassium, Vitamin B1, Vitamin B2, Vitamin C, Vitamin D, Vitamin E\",\"low\":\"Sodium\"}', '2021-06-18 14:09:43'),
(37, 37, 1, 'Salmon Tartare', 'Finely chop the shallots, capers, tarragon , then put them\r\nin a bowl. Pour in the olive oil, lemon juice, balsamic vinegar and Tabasco sauce Using a knife, chop the salmon into small pieces until the desired consistency is obtained, then add the pieces to the bowl with the other ingredients. Add salt and pepper. Form the mixture into flattened mounds and place one mound onto each individual serving plate. Garnish with a few dill sprigs and serve.', '[\"shallots, finely chopped\",\"capers, finely chopped\",\"fresh dill, finely chopped\",\"fresh tarragon, finely chopped\",\"[optional]\",\"olive oil\",\"lemon juice, freshly squeezed\",\"balsamic vinegar\",\"Tabasco sauce\",\"salmon fillet, chopped into small pieces\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/676.jpg', 'https://www.soscuisine.com//recipe/salmon-tartare', 'It is recommended to freeze the salmon for about 1 h before using it in order to reduce the number of microorganisms that could contain the flesh.', '15 min', '230 kcal', '{\"calories\":\"230\",\"fat\":\"17 g\",\"cholesterol\":\"30 mg\",\"protein\":\"18 g\"}', '{\"free\":\"Sugar\",\"excellent_source_of\":\"Niacin, Phosphorus, Selenium, Vitamin B12, Vitamin B6, Vitamin D, Vitamin E\",\"source_of\":\"Iron, Magnesium, Omega-3, Pantothenic Acid, Potassium, Vitamin B1, Vitamin B2, Vitamin K, Zinc\"}', '2021-06-18 14:09:45');
INSERT INTO `recipe_translation` (`rt_id`, `rt_recipe_id`, `rt_lang_id`, `rt_recipe_name`, `rt_recipe_text`, `rt_recipe_ingredients_full`, `rt_recipe_image`, `rt_recipe_link`, `rt_recipe_prep`, `rt_recipe_duration`, `rt_recipe_calories`, `rt_recipe_nutrients`, `rt_recipe_claims`, `rt_created`) VALUES
(39, 39, 1, 'SautÃÂ©ed Artichokes', 'Prepare the artichokes , then cut them into quarters. Blanch them 4 min in a large pot of salted boiling water. Take the artichokes out of the water using a slotted spoon, then plunge them into a bowl of cold water to stop the cooking and keep the colour green. Drain the artichokes. Meanwhile, heat the oil in a skillet over medium-high heat. Add the artichokes, Parsley and Garlic Base , and water. Season with salt and pepper. Cover and cook over low heat until the \r\nartichokes are tender, about 30 min. Adjust the seasoning then serve.', '[\"artichokes\",\"olive oil\",\"Parsley and Garlic Base\",\"water\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1095.jpg', 'https://www.soscuisine.com//recipe/sauteed-artichokes', '', '50 min', '120 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Folacin, Vitamin K\",\"good_source_of\":\"Fibre, Magnesium, Potassium\",\"source_of\":\"Copper, Iron, Manganese, Niacin, Pantothenic Acid, Phosphorus, Vitamin A, Vitamin B1, Vitamin B6, Vitamin C, Vitamin E, Zinc\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:09:45'),
(41, 41, 1, 'SautÃÂ©ed Japanese Mushrooms', 'Cut off the stems of shiitake and eryngii then cut them into halves. Cut and discard the bottom of shimeji then separate them into pieces by hand. Heat the oil in a frying pan at high heat. Add the mushrooms and stir-fry for a couple of minutes until softened. Add the garlic and cook one minute with stirring Stir in the butter and soy sauce, then season with salt and pepper to taste. Stir for a few seconds, sprinkle chopped green onions then serve.', '[\"olive oil\",\"shiitake mushrooms\",\"eryngii mushrooms (king oyster)\",\"shimeji mushrooms\",\"garlic, minced\",\"butter, unsalted\",\"soy sauce\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"green onions\\/scallions\"]', 'https://media.soscuisine.com/images/recettes/4098.jpg', 'https://www.soscuisine.com//recipe/sauteed-japanese-mushrooms', 'If you cant\'find these specific mushroom types, replace them with any other.', '18 min', '80 kcal', '{\"calories\":\"80\",\"fat\":\"6 g\",\"cholesterol\":\"10 mg\",\"protein\":\"2 g\"}', '{\"free\":\"Added Sugar\",\"source_of\":\"Copper, Pantothenic Acid, Selenium, Vitamin D, Vitamin E, Vitamin K\",\"low\":\"Sodium\"}', '2021-06-18 14:09:46'),
(42, 42, 1, 'Sauteed Kale with Garlic', 'Heat oil in a large non-stick skillet over high heat. Add the garlic and chili pepper sauté about 1 min with stirring , taking care not to burn the garlic. Add the kale and cook for 3-4 min with some stirring . Lower the heat, cover and cook until al dente , about 2 min. Season with salt and pepper and toss to combine. Serve.', '[\"olive oil\",\"garlic\",\"dried chili peppers, minced\",\"kale, stems removed, thinly sliced\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/4130.jpg', 'https://www.soscuisine.com//recipe/sauteed-kale-garlic', '', '15 min', '60 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Vitamin A, Vitamin C, Vitamin K\",\"good_source_of\":\"Manganese\",\"source_of\":\"Calcium, Copper, Folacin, Iron, Magnesium, Vitamin B6, Vitamin E\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Cholesterol, Sugar, Trans Fat\"}', '2021-06-18 14:09:47'),
(43, 43, 1, 'SautÃÂ©ed Mushrooms', 'Clean the mushrooms and finely chop the shallot. Heat the oil in a saucepan over medium heat. Add the mushrooms and shallot, then sauté 3-4 min with stirring Add the Parsley and Garlic Base then cook 1 min with stirring. Lower the heat to medium-low, season with salt and pepper to taste, then cover and cook 3 additional min. Serve.', '[\"olive oil\",\"shallots, finely chopped\",\"oyster mushrooms, trimmed and halved lengthwise if large\",\"Parsley and Garlic Base\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1170.jpg', 'https://www.soscuisine.com//recipe/sauteed-mushrooms', '', '13 min', '90 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Vitamin K\",\"good_source_of\":\"Niacin\",\"source_of\":\"Copper, Folacin, Iron, Magnesium, Manganese, Pantothenic Acid, Phosphorus, Potassium, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin E, Zinc\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:09:48'),
(44, 44, 1, 'SautÃÂ©ed Mushrooms with Shallot', 'Clean the mushrooms and finely chop the shallot. Heat the oil in a saucepan over medium heat. Add the mushrooms and sauté , with stirring , until the mushrooms are browned and any liquid they give off has evaporated, 3-4 min. Lower the heat to medium-low, then in the shallot and sauté until translucent, 2-3 min. Season with salt and pepper to taste, then serve.', '[\"olive oil\",\"shallots, finely chopped\",\"button (white) mushrooms, cut in quarters\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1169.jpg', 'https://www.soscuisine.com//recipe/sauteed-mushrooms-shallot', '', '10 min', '60 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Selenium\",\"good_source_of\":\"Copper, Vitamin B2\",\"source_of\":\"Folacin, Manganese, Niacin, Pantothenic Acid, Phosphorus, Potassium, Vitamin B1, Vitamin B6, Vitamin E, Zinc\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:09:49'),
(45, 45, 1, 'Scallop Ceviche', 'all the ingredients together, except the cilantro . Let sit 15 min at room temperature, or up to 2 hours in the refrigerator. Taste, adjust the seasoning , garnish with the cilantro and serve into transparent cups.', '[\"scallops, medium size, fresh, cut into 1 cm cubes\",\"red onions, finely chopped\",\"mini-tomatoes (cherry, miniature or grape), halved\",\"lime juice, freshly squeezed\",\"dried chili peppers, minced\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"fresh cilantro, finely chopped\"]', 'https://media.soscuisine.com/images/recettes/1067.jpg', 'https://www.soscuisine.com//recipe/scallop-ceviche', 'with olive oil, cover and refrigerate until ready to marinate.', '10 min', '100 kcal', '{\"calories\":\"100\",\"fat\":\"1 g\",\"cholesterol\":\"30 mg\",\"protein\":\"17 g\"}', '{\"excellent_source_of\":\"Selenium, Vitamin B12\",\"good_source_of\":\"Magnesium, Niacin, Phosphorus, Potassium\",\"source_of\":\"Folacin, Manganese, Vitamin A, Vitamin B6, Vitamin C, Vitamin K, Zinc\",\"low\":\"Fat\",\"free\":\"Added Sugar, Saturated Fat, Trans Fat\"}', '2021-06-18 14:09:50'),
(46, 46, 1, 'Scalloped Potatoes', 'Preheat the oven to 175ºC/350ºF. Peel the potatoes and slice them thinly (6-7 mm), then put the slices in a nonstick pan (just large enough to hold the potatoes in one layer). Pour in the milk (add enough to cover the potatoes), then add the bay leaf and pressed garlic. Season the potatoes generously with salt. Bring to a boil over medium heat, with some stirring to prevent the potatoes from sticking to the bottom of the pan and scorching. Lower the heat and cook 15-20 min with occasional stirring until the potatoes are soft but not falling apart. Arrange the potato slices with any remaining cooking milk in a baking dish and cover them with the cream. Sprinkle with the nutmeg and ground pepper. Bake in the middle of the oven about 35 min, until the potatoes are golden and crusty. Serve.', '[\"potatoes, peeled and thinly sliced\",\"milk, partly skimmed, 2%, enough to cover the potatoes\",\"bay leaf\",\"garlic, pressed\",\"salt\",\"[optional]\",\"whipping cream 35%, enough to cover the potatoes\",\"nutmeg\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1138.jpg', 'https://www.soscuisine.com//recipe/scalloped-potatoes', 'will make slicing the potatoes easier.', '60 min', '280 kcal', '{\"calories\":\"280\",\"fat\":\"11 g\",\"cholesterol\":\"40 mg\",\"protein\":\"8 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Potassium, Vitamin B12, Vitamin B6, Vitamin D\",\"good_source_of\":\"Calcium, Magnesium, Niacin, Pantothenic Acid, Phosphorus, Vitamin A, Vitamin B1, Vitamin B2\",\"source_of\":\"Copper, Fibre, Folacin, Manganese, Selenium, Vitamin C, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:09:51'),
(47, 47, 1, 'Short Cut Pasta (side dish)', 'Cook the pasta Drain the pasta then put it immediately back in the pasta cooking pot with the butter. Add salt and pepper to taste. Mix well and serve on the warmed plates.', '[\"mezze penne, or other short cut pasta\",\"butter, unsalted\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1087.jpg', 'https://www.soscuisine.com//recipe/short-cut-pasta-side-dish', '', '7 min', '210 kcal', '{\"calories\":\"210\",\"fat\":\"4 g\",\"cholesterol\":\"10 mg\",\"protein\":\"6 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Selenium\",\"good_source_of\":\"Manganese\",\"source_of\":\"Copper, Fibre, Magnesium, Niacin, Phosphorus, Zinc\"}', '2021-06-18 14:09:52'),
(48, 48, 1, 'Silky Fennel Soup', 'Prepare the vegetables . Thinly slice the leeks crosswise. Remove the stalks and the feathery leaves from the fennel, setting some of the leaves aside for a final garnish, then slice the bulbs crosswise into coarse 1 cm thick sections. Peel the potatoes then coarsely cut them into 3 cm chunks. Heat the oil and butter in a saucepan over medium heat. Add the leeks then sauté with occasional stirring , until they are just softened, about 2-3 min. Add the potatoes and fennel, then cook 2-3 min. Pour in the , then season with salt and pepper. Bring to a boil, then reduce the heat and simmer , uncovered, until the vegetables are soft, about 20 min. Let the soup cool down a few minutes, then purée it in a blender food processor Ladle the soup into bowls, then garnish each bowl with a dollop of sour cream and the reserved fennel leaves. Serve.', '[\"leeks, thinly sliced crosswise\",\"fennels, coarsely sliced\",\"potatoes, peeled and cut into large pieces\",\"canola oil\",\"butter, unsalted\",\"chicken broth\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"sour cream\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/806.jpg', 'https://www.soscuisine.com//recipe/silky-fennel-soup', 'will be very useful to purée the soup.', '35 min', '170 kcal', '{\"calories\":\"170\",\"fat\":\"6 g\",\"cholesterol\":\"10 mg\",\"protein\":\"4 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Potassium, Vitamin K\",\"good_source_of\":\"Fibre, Magnesium, Manganese, Vitamin B6, Vitamin C\",\"source_of\":\"Calcium, Copper, Iron, Niacin, Pantothenic Acid, Phosphorus, Vitamin A, Vitamin B1, Vitamin E, Zinc\"}', '2021-06-18 14:09:53'),
(49, 49, 1, 'Chicken with Dried Fruits', 'Preheat the oven to 175 °C /350 °F. Line a baking sheet with aluminum foil. In a small bowl, start macerating the apricots and prunes in the water before continuing with the recipe. Heat half of the oil in a pan over medium heat. Add the onion and sauté until it is softened and slightly golden-coloured, about 5 min. Transfer the onion to a large bowl and set aside. Pour the remaining oil into the pan. Sprinkle the chicken legs with the turmeric then put them in the pan and season with salt and pepper. Sauté the chicken until it is slightly golden-coloured, 7-8 min. Transfer the chicken to the bowl with the cooked onions. Mix in the macerated fruits, with the juice and cinnamon. Mix well, then spread the coated chicken mixture evenly onto the prepared sheet. Cook in the middle of the oven until the chicken is golden-brown, 45-50 min. Add a little water if needed to make sure that the environment remains moist throughout the cooking. Sprinkle with almonds (optional) and serve.', '[\"aluminum foil\",\"dried apricots\",\"pitted prunes\",\"water\",\"olive oil\",\"onions, finely chopped\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"ground cinnamon\",\"chicken drumsticks, skin removed\",\"turmeric\",\"flaked almonds\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1157.jpg', 'https://www.soscuisine.com//recipe/chicken-dried-fruits-alcohol-free', 'Keep the serving plates warm on the stove while you\'re preparing the dish.', '65 min', '260 kcal', '{\"calories\":\"260\",\"fat\":\"11 g\",\"cholesterol\":\"70 mg\",\"protein\":\"24 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"source_of\":\"Fibre, Iron, Manganese, Potassium, Vitamin A, Vitamin B6, Vitamin D, Vitamin E, Vitamin K\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Sodium, Trans Fat\"}', '2021-06-18 14:09:54'),
(50, 50, 1, 'Silky Garlic Soup', 'Prepare the vegetables : Coarsely chop the onion. Halve the leek lengthwise and cut each half crosswise into 2 cm pieces. Crush the garlic cloves. Peel and cut the potatoes into 4 cm chunks. Heat the oil in a saucepan over medium heat. Add the onion, leek, and garlic, then cook with occasional stirring , until the vegetables are just softened, 2-3 min. Add the and potatoes, then season with the salt and pepper. Bring to a boil over high heat, then reduce to low, cover, and simmer about 20 min until the potatoes are tender. In the meantime, prepare the croutons Purée the soup in a blender food processor . Pour the soup back into the saucepan, add the milk, stir, and reheat over moderately high heat a couple of minutes. Adjust the seasoning Garnish each bowl with the chopped chives and croutons . Serve.', '[\"garlic, crushed\",\"potatoes, peeled then cut into large pieces\",\"onions, coarsely chopped\",\"leeks, cut into 2 cm pieces\",\"canola oil\",\"chicken broth\",\"milk, partly skimmed, 2%\",\"bread, whole wheat, for the croutons\",\"olive oil, for the croutons\",\"chives, fresh, chopped\",\"salt\",\"ground pepper\"]', 'https://media.soscuisine.com/images/recettes/83.jpg', 'https://www.soscuisine.com//recipe/silky-garlic-soup', 'will be very useful to purée the soup.', '45 min', '310 kcal', '{\"calories\":\"310\",\"fat\":\"11 g\",\"cholesterol\":\"0 mg\",\"protein\":\"8 g\"}', '{\"excellent_source_of\":\"Folacin, Magnesium, Manganese, Potassium, Selenium, Vitamin B6, Vitamin K\",\"good_source_of\":\"Copper, Fibre, Iron, Niacin, Phosphorus, Vitamin B1, Vitamin C, Vitamin E\",\"source_of\":\"Calcium, Pantothenic Acid, Vitamin A, Vitamin B12, Vitamin B2, Vitamin D, Zinc\",\"low\":\"Cholesterol, Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:09:54'),
(51, 51, 1, 'Silky Onion Soup', 'Melt the butter in a pot over medium-low heat. Add the onions, then cook 6-7 min with occasional stirring . Sprinkle the onions with the flour and cook the mixture, with stirring, for 3 min. Add the and the bay leaf, bring the soup to a boil, then simmer it, covered, for 20 min, until the onions are tender. Season the soup with salt and pepper to taste. Let the soup cool down a few minutes, then purée it in a blender until smooth. Ladle the soup into bowls. Sprinkle each bowl with grated cheese then serve.', '[\"onions, thinly sliced\",\"butter, unsalted\",\"white flour (all purpose)\",\"chicken broth\",\"bay leaf\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"Cheddar cheese, grated\"]', 'https://media.soscuisine.com/images/recettes/826.jpg', 'https://www.soscuisine.com//recipe/silky-onion-soup', 'will be very useful to purée the soup.', '40 min', '150 kcal', '{\"calories\":\"150\",\"fat\":\"8 g\",\"cholesterol\":\"20 mg\",\"protein\":\"4 g\"}', '{\"free\":\"Added Sugar\",\"good_source_of\":\"Folacin\",\"source_of\":\"Calcium, Fibre, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin C\"}', '2021-06-18 14:09:55'),
(52, 52, 1, 'Silky Smooth Roasted Pepper Soup', 'Preheat the oven to 205°C/400°F. Peel the potatoes, then put them in a pot. Pour in the . \r\nBring to a boil, then lower the heat and simmer until the potatoes are soft, about 15 min. Meanwhile, cut the peppers in half, removing the seeds and the stalks, then put them on an oiled baking sheet, cut side down. Cut the onions into 1 cm slices then add them to the sheet. Add the garlic cloves, unpeeled. Cook in the middle of the oven  until the vegetables are soft, about 15 min. Turn them once halfway through cooking. Alternatively, grill the vegetables on an outdoor grill. Remove the vegetables from the oven, cover the peppers then let them cool down about 10 min. Peel the peppers and garlic then add them to the pot along with the onions. Cook a couple of minutes. Add salt and pepper to taste. Purée the soup in a blender until a creamy consistency is obtained. Serve.', '[\"potatoes\",\"chicken broth\",\"yellow or red sweet peppers\",\"red onions\",\"garlic\",\"olive oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1208.jpg', 'https://www.soscuisine.com//recipe/silky-smooth-roasted-pepper-soup', 'will be very useful to purée the soup.', '45 min', '170 kcal', '{\"calories\":\"170\",\"fat\":\"8 g\",\"cholesterol\":\"0 mg\",\"protein\":\"3 g\"}', '{\"excellent_source_of\":\"Vitamin B6, Vitamin C\",\"good_source_of\":\"Potassium, Vitamin A, Vitamin E\",\"source_of\":\"Copper, Fibre, Folacin, Magnesium, Manganese, Niacin, Omega-3, Omega-6, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin B2, Vitamin K\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:09:56'),
(53, 53, 1, 'Skillet Sweet Potatoes', 'Prepare the sweet potatoes . Peel, then dice them into 1,5 cm pieces. Heat oil in a pan over medium heat, then add the diced potatoes. Sauté about 5 min, with frequent stirring , until the potatoes are a light golden colour. Add salt and pepper to taste, cover and cook over low heat about 15 min, or until the potatoes are soft.', '[\"sweet potatoes, peeled and cut into 1,5 cm pieces\",\"canola oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2123.jpg', 'https://www.soscuisine.com//recipe/skillet-sweet-potatoes', '', '20 min', '160 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Manganese, Potassium, Vitamin A\",\"good_source_of\":\"Fibre, Pantothenic Acid, Vitamin B6, Vitamin C, Vitamin E\",\"source_of\":\"Copper, Iron, Magnesium, Niacin, Phosphorus, Vitamin B1, Vitamin B2, Vitamin K\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:09:57'),
(54, 54, 1, 'Smoked Salmon Spread', 'Put shallots and capers in the food processor and grind. Cut the (half thawed) smoked salmon into pieces and grind in the processor. Add oil and lemon juice. Season with pepper and pulse until smooth. Spread on rice crackers or bread slices made of buckwheat, quinoa or chestnut grains.', '[\"shallots\",\"capers\",\"smoked salmon, frozen, in thin slices\",\"extra virgin olive oil\",\"lemon juice, freshly squeezed\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2291.jpg', 'https://www.soscuisine.com//recipe/smoked-salmon-spread', '', '15 min', '100 kcal', '{\"calories\":\"100\",\"fat\":\"8 g\",\"cholesterol\":\"10 mg\",\"protein\":\"4 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Vitamin B12, Vitamin D\",\"source_of\":\"Niacin, Selenium, Vitamin B6, Vitamin E, Vitamin K\",\"low\":\"Cholesterol, Saturated Fat\",\"free\":\"Sugar, Trans Fat\"}', '2021-06-18 14:09:58'),
(55, 55, 1, 'Spaghetti with Citrus Pesto', 'Cook the pasta While the pasta is cooking, put the Citrus Pesto in a small bowl, then add the specified amount of pasta cooking water, which will warm up the sauce and will dilute it a bit. Put the drained spaghetti back into the pasta cooking pot, add the pesto sauce, then mix well. Serve in the warmed dishes.', '[\"spaghetti\",\"Citrus Pesto\",\"pasta cooking water\"]', 'https://media.soscuisine.com/images/recettes/3018.jpg', 'https://www.soscuisine.com//recipe/spaghetti-citrus-pesto', '', '15 min', '540 kcal', '{\"calories\":\"540\",\"fat\":\"23 g\",\"cholesterol\":\"10 mg\",\"protein\":\"15 g\"}', '{\"excellent_source_of\":\"Magnesium, Manganese, Niacin, Selenium, Vitamin E\",\"good_source_of\":\"Copper, Fibre, Iron, Phosphorus, Vitamin C, Vitamin K, Zinc\",\"source_of\":\"Calcium, Folacin, Pantothenic Acid, Potassium, Vitamin B1, Vitamin B2, Vitamin B6\"}', '2021-06-18 14:09:59'),
(56, 56, 1, 'Spiced Carrot Soup', 'Prepare the carrots : slice them into thin rounds, finely chop the onion and garlic. In a pot, the onion and garlic in butter over medium heat for about 3-4 min. Add the carrots and sauté a few minutes. Add the curry and cook 1 min with stirring . Add salt and pepper. Pour in the and water. Bring to a boil, lower the heat, cover and simmer until the carrots are tender, about 20 min. Purée the soup in a blender processor , then pour it back into the pot. in the cream and just warm the soup a few minutes. Adjust the seasoning and serve.', '[\"carrots, cut into thin rounds\",\"onions, finely chopped\",\"garlic, finely chopped\",\"butter, unsalted\",\"curry powder\",\"chicken broth\",\"water\",\"cream 15%\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/288.jpg', 'https://www.soscuisine.com//recipe/spiced-carrot-soup', '', '35 min', '100 kcal', '{\"calories\":\"100\",\"fat\":\"5 g\",\"cholesterol\":\"10 mg\",\"protein\":\"2 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Vitamin A\",\"good_source_of\":\"Potassium, Vitamin K\",\"source_of\":\"Calcium, Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin C, Vitamin E\"}', '2021-06-18 14:10:00'),
(57, 57, 1, 'Spiced Pumpkin Soup', 'Preheat the oven to 175°C/375°F. Put the pumpkin, whole, on a baking sheet and bake for about 1 h until soft. Let it cool down, remove the seeds, carve out the pulp and dice it into 1,5 cm cubes. Take the required quantity and put the rest in the refrigerator or in the freezer for future use in another recipe. Finely chop the onion, carrot, celery, and garlic. Heat the oil in a pot over medium heat, then add the chopped vegetables. Sauté until soft, about 8 min. Add the clove and bay leaf, then the banana and cook an additional 2 min. in the pumpkin cubes, , coconut milk, cumin, curry, cinnamon, turmeric, and ground nutmeg. Bring to a boil, then lower the heat, cover and cook over medium heat about 15 min to blend the flavours. Cool slightly, discard the bay leaf and the clove, then purée the soup in a blender Adjust the\r\nseasoning and add more if the soup is too thick. Ladle soup into serving bowls, garnish with fresh cilantro leaves then serve.', '[\"pumpkin, cut into 1,5 cm cubes\",\"onions, finely chopped\",\"carrots, finely chopped\",\"garlic, finely chopped\",\"celery, finely chopped\",\"canola oil\",\"cloves\",\"bay leaf\",\"bananas, small, sliced into rounds\",\"chicken broth\",\"unsweetened coconut milk\",\"ground cumin\",\"curry powder\",\"ground cinnamon\",\"nutmeg\",\"turmeric\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"fresh cilantro\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/218.jpg', 'https://www.soscuisine.com//recipe/spiced-pumpkin-soup', 'will be very useful to purée the soup.', '95 min', '190 kcal', '{\"calories\":\"190\",\"fat\":\"12 g\",\"cholesterol\":\"0 mg\",\"protein\":\"4 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Manganese, Potassium, Vitamin A\",\"good_source_of\":\"Folacin, Iron, Magnesium, Vitamin E\",\"source_of\":\"Calcium, Copper, Fibre, Niacin, Pantothenic Acid, Phosphorus, Selenium, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin C, Vitamin K, Zinc\"}', '2021-06-18 14:10:01'),
(58, 58, 1, 'Spicy Butternut Squash Soup', 'Preheat the oven to 190°C/375°F. Cut the squash in half lengthwise, remove the seeds and strings, and brush the halves with the oil. Add salt and pepper then place them on a baking sheet, cut side down. Put the unpeeled garlic cloves under the halves. Bake about 45-50 min until soft. Let the squash cool down then peel the skin and dice the pulp into 1,5 cm cubes. Peel the garlic and set aside with the squash. Heat the butter in a pot over medium heat. Chop the onion, add it to the pot and sauté 5 min, until translucent, with occasional stirring . Add the grated ginger and curry powder. Cook 1 min with stirring . Add the squash, garlic, and . Bring to a boil, lower the heat and simmer , uncovered, for 10 min. Let the soup cool down and purée it until smooth. If the soup is too thick, it may be thinned with additional Ladle the soup into bowls and serve.', '[\"butternut squash\",\"garlic, unpeeled\",\"butter, unsalted\",\"onions, finely chopped\",\"gingerroot, grated\",\"curry powder\",\"chicken broth\"]', 'https://media.soscuisine.com/images/recettes/228.jpg', 'https://www.soscuisine.com//recipe/spicy-butternut-squash-soup', 'will be very useful to purée the soup.', '80 min', '90 kcal', '{\"calories\":\"90\",\"fat\":\"2 g\",\"cholesterol\":\"10 mg\",\"protein\":\"2 g\"}', '{\"excellent_source_of\":\"Vitamin A\",\"good_source_of\":\"Magnesium, Manganese, Potassium, Vitamin C, Vitamin E\",\"source_of\":\"Calcium, Copper, Fibre, Folacin, Iron, Niacin, Pantothenic Acid, Vitamin B1, Vitamin B6\",\"low\":\"Cholesterol, Fat, Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:10:02'),
(59, 59, 1, 'Spicy Grilled Chicken Breast', 'Preheat the grill or the oven broiler. In a bowl, mix well the yogurt, lemon juice and sriracha. Brush the chicken breasts with this mixture. Grill or broil 10 cm from the heat. Cook for about 10-12 min, turning the pieces once. They are ready\r\nwhen the meat loses its pink colour. Take out of the oven, add salt and pepper, then slice into strips.', '[\"chicken breasts, boneless, skinless\",\"sriracha (hot chili sauce)\",\"Greek yogurt, plain, 2% M.F.\",\"lemon\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/notAvailable.jpg', 'https://www.soscuisine.com//recipe/spicy-grilled-chicken-breast', 'The chicken can be kept in the fridge for up to 4 days.', '15 min', '120 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Niacin\",\"good_source_of\":\"Vitamin B6\",\"source_of\":\"Iron, Magnesium, Pantothenic Acid, Phosphorus, Vitamin B12, Zinc\",\"low\":\"Fat, Saturated Fat, Sodium\",\"free\":\"Sugar, Trans Fat\"}', '2021-06-18 14:10:03'),
(60, 60, 1, 'Spicy Red Lentil Soup', 'Rinse the lentils well under cold water and drain. Heat the oil in a pot over medium heat. Finely chop the onion, add it to the pot, and sauté with occasional stirring 4-5 min until translucent. Add the minced or pressed garlic, grated ginger and spices. Cook 1 min with stirring . Add the lentils, , diced tomatoes, salt, and pepper. Bring to a boil then reduce the heat and simmer , uncovered, 15-20 min until the lentils become very soft. Pour in the coconut milk (optional) and lime juice. Adjust the seasoning Serve in bowls and garnish with fresh cilantro leaves (optional).', '[\"red-orange lentils (dried), rinsed and drained\",\"canola oil\",\"red onions, finely chopped\",\"garlic, pressed or minced\",\"gingerroot, grated\",\"turmeric\",\"ground cumin\",\"curry powder\",\"ground cinnamon\",\"cayenne pepper\",\"chicken broth\",\"canned tomatoes (diced)\",\"unsweetened coconut milk\",\"[optional]\",\"lime juice, freshly squeezed\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"fresh cilantro\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/249.jpg', 'https://www.soscuisine.com//recipe/spicy-red-lentil-soup', 'It is not necessary to soak the lentils in advance.', '35 min', '140 kcal', '{\"calories\":\"140\",\"fat\":\"3 g\",\"cholesterol\":\"0 mg\",\"protein\":\"8 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Folacin, Manganese\",\"good_source_of\":\"Copper, Iron, Pantothenic Acid\",\"source_of\":\"Fibre, Magnesium, Niacin, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B1, Vitamin B6, Vitamin C, Vitamin E, Zinc\",\"low\":\"Fat, Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:10:04'),
(61, 61, 1, 'Spicy Sweet Potato Soup', 'Prepare the sweet potatoes : peel and coarsely chop them into 2 cm pieces. Finely chop the onion and garlic. Melt the butter in a pot over medium heat. Add the onion and garlic. Cook 4-5 min, taking care not to let them burn. Add the sweet potatoes, grated ginger, cumin, Cayenne pepper . Bring to a boil while stirring often. Lower the heat then cook 15 min, covered, until the potatoes are soft. Purée the soup in a blender food processor . Put the soup back in the pot on the stove. Add the peanut butter and reheat for a few minutes. Pour in the lime juice. Adjust the seasoning If desired, you may garnish each bowl with a dollop of sour cream, diced tomato, and fresh cilantro leaves. Serve.', '[\"sweet potatoes, peeled, then cut into 2 cm pieces\",\"onions, finely chopped\",\"chicken broth\",\"garlic, finely chopped\",\"gingerroot, grated\",\"peanut butter, natural\",\"lime juice, freshly squeezed\",\"butter, unsalted\",\"ground cumin\",\"cayenne pepper\",\"sour cream\",\"[optional]\",\"tomatoes\",\"[optional]\",\"fresh cilantro\",\"[optional]\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/13.jpg', 'https://www.soscuisine.com//recipe/spicy-sweet-potato-soup', 'will be very useful to purée the soup.', '35 min', '180 kcal', '{\"calories\":\"180\",\"fat\":\"5 g\",\"cholesterol\":\"10 mg\",\"protein\":\"5 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Vitamin A\",\"good_source_of\":\"Fibre, Magnesium, Manganese, Potassium, Vitamin B6, Vitamin C, Vitamin E\",\"source_of\":\"Calcium, Copper, Folacin, Iron, Niacin, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin B2, Zinc\"}', '2021-06-18 14:10:06'),
(62, 62, 1, 'Spinach and Asparagus Salad', 'Vinaigrette: in a medium-sized bowl, add green onions to the orange juice concentrate. Season with salt and pepper. Pour in the oil gradually and whisk until emulsified. Salad: fill a pot with water and bring to a boil over high heat. Remove the hard parts of the asparagus. Plunge asparagus tips in boiling water. Boil until cooked but still slightly crunchy, for 2 to 5 minutes if they are very thin or for 7 to 10 minutes if they have a diameter the size of a finger. Drain the asparagus and immediately plunge them into icy water. Once they are cold, pat them dry with paper towels. Keep aside. Put the spinach in a large salad bowl. Add the asparagus cut into bite-sized pieces.  Mix. Add dill, drizzle with vinaigrette and toss. Top with grated hard-boiled eggs.', '[\"asparagus, average size\",\"baby spinach\",\"fresh dill, finely chopped\",\"eggs size large, boiled, and finely grated\",\"green onions\\/scallions, finely chopped\",\"orange juice, concentrated\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"extra virgin olive oil\"]', 'https://media.soscuisine.com/images/recettes/2257.jpg', 'https://www.soscuisine.com//recipe/spinach-asparagus-salad', '', '25 min', '140 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Folacin, Vitamin A, Vitamin E, Vitamin K\",\"good_source_of\":\"Manganese, Selenium\",\"source_of\":\"Copper, Iron, Magnesium, Niacin, Pantothenic Acid, Phosphorus, Potassium, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin C, Zinc\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:10:07'),
(63, 63, 1, 'Spinach and Mushroom Salad', 'Prepare the spinach and\r\nput it in a large bowl. Set aside. Prepare the mushrooms : thinly slice them, then transfer to a small bowl. Season with salt and pepper,and pour in half of the lemon juice. Set aside. Grate half of the orange(s) to obtain the , then juice them. Put the zest and juice into a small bowl. Pour in the remaining lemon juice, mustard, and oil. Add salt and pepper to taste, then well using a fork, until the vinaigrette is emulsified. Pour the vinaigrette over the\r\nspinach. Peel the remaining orange(s), cut them into small pieces and add them to the spinach. Add the mushrooms and Serve.', '[\"baby spinach\",\"button (white) mushrooms, thinly sliced\",\"lemon, freshly squeezed\",\"oranges, pressed and zested\",\"Dijon mustard\",\"extra virgin olive oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/537.jpg', 'https://www.soscuisine.com//recipe/spinach-mushroom-salad', '', '15 min', '160 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Folacin, Vitamin A, Vitamin C, Vitamin E, Vitamin K\",\"good_source_of\":\"Magnesium, Manganese, Potassium, Selenium, Vitamin B2\",\"source_of\":\"Calcium, Copper, Iron, Niacin, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin B6, Zinc\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:10:08'),
(64, 64, 1, 'Spinach Salad with Apricots', 'In a small bowl, macerate the apricots in water for at least 20 min. Drain the apricots, slice them into bite size pieces and put them in a salad bowl. Wash the baby spinach and spin dry, then add it to the salad bowl. Set aside. Mix the oil, vinegar, honey, salt and pepper. the mixture using a fork until well emulsified. Pour the vinaigrette over the spinach and apricots then gently. Add the walnuts (optional) and serve.', '[\"dried apricots\",\"water\",\"baby spinach\",\"canola oil\",\"apple cider vinegar\",\"honey\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"walnuts\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/388.jpg', 'https://www.soscuisine.com//recipe/spinach-salad-apricots-alcohol-free', '', '10 min', '180 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Folacin, Vitamin A, Vitamin E, Vitamin K\",\"good_source_of\":\"Manganese, Potassium\",\"source_of\":\"Copper, Fibre, Iron, Magnesium, Omega-3, Omega-6, Vitamin C\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Cholesterol\"}', '2021-06-18 14:10:09'),
(65, 65, 1, 'Spinach Soup with Shallots', 'Prepare the spinach : Wash and drain it briefly then transfer it to a pot or saucepan without adding any water. The water trapped in the leaves after gentle shaking is enough to cook them. Add salt, then cover and cook over high heat 3-4 min until the leaves wilt and turn very deep green. Avoid overcooking , otherwise the spinach will become brownish. Transfer the spinach to a colander ,\r\npress to remove excess water, then set aside. While the spinach is cooking, heat the oil and butter in another saucepan over medium heat. Finely chop the shallots, then add them to the saucepan and sauté 2-3 min until they become translucent. Add the flour, then cook 1 min with stirring . Gradually in the milk. Bring the mixture to a boil with constant whisking, then cook until it thickens, about 4 min. Remove the saucepan from the heat. Add the spinach to the milk mixture. Let the mixture cool down a few minutes, then purée it in a blender . Return the soup to the same saucepan and rewarm\r\nover low heat. Season with the grated nutmeg, salt and pepper to taste. Ladle the soup into bowls, sprinkle with the sliced almonds (optional) and serve.', '[\"spinach\",\"canola oil\",\"butter, unsalted\",\"shallots\",\"white flour (all purpose)\",\"milk, partly skimmed, 2%\",\"nutmeg to taste\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"flaked almonds\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/832.jpg', 'https://www.soscuisine.com//recipe/spinach-soup-shallots', 'will be very useful to purée the soup.', '20 min', '240 kcal', '{\"calories\":\"240\",\"fat\":\"13 g\",\"cholesterol\":\"30 mg\",\"protein\":\"10 g\"}', '{\"diet-related_health_claims\":\"Bone-healthy\",\"free\":\"Added Sugar\",\"excellent_source_of\":\"Calcium, Folacin, Magnesium, Manganese, Potassium, Vitamin A, Vitamin B12, Vitamin B2, Vitamin D, Vitamin K\",\"good_source_of\":\"Iron, Phosphorus, Selenium, Vitamin B1, Vitamin C, Vitamin E, Zinc\",\"source_of\":\"Copper, Niacin, Pantothenic Acid, Vitamin B6\"}', '2021-06-18 14:10:10'),
(66, 66, 1, 'Split Pea Soup', 'Rinse the split peas well under cold water and drain. Prepare the vegetables : finely chop the onion, leek, carrot, and celery; mince or the garlic. Heat the oil in a pot over medium heat. Add the onion and leek, then sauté with occasional stirring 4-5 min until they become translucent. Add the carrot, garlic, celery, savory, and bay leaves. Cook 5 min with occasional stirring . Add the\r\npeas, , water, salt, and pepper. Bring to a boil then reduce the heat and simmer , uncovered, until the peas become very soft, about 60 min or longer. Add more water if the soup is too thick or cook it longer to evaporate the extra liquid if the soup is too thin. Ladle the soup into bowls and serve.', '[\"green split peas (dried), rinsed and drained\",\"onions, finely chopped\",\"leeks, finely chopped\",\"carrots, finely chopped\",\"celery, finely chopped\",\"garlic, minced or pressed\",\"olive oil\",\"dried savory\",\"bay leaf\",\"chicken broth\",\"water\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/799.jpg', 'https://www.soscuisine.com//recipe/split-pea-soup', 'Split peas do not require presoaking before cooking.', '85 min', '240 kcal', '{\"calories\":\"240\",\"fat\":\"4 g\",\"cholesterol\":\"0 mg\",\"protein\":\"14 g\"}', '{\"excellent_source_of\":\"Folacin, Magnesium, Manganese, Potassium, Vitamin A, Vitamin B1, Vitamin K\",\"good_source_of\":\"Copper, Fibre, Iron, Niacin, Phosphorus, Zinc\",\"source_of\":\"Calcium, Pantothenic Acid, Vitamin B2, Vitamin B6, Vitamin C, Vitamin E\",\"low\":\"Calories, Fat, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:10:11'),
(67, 67, 1, 'Sprouted-Quinoa Tabbouleh Salad', 'Place the quinoa in a fine strainer and hold it under cold running water until the water runs clear. Transfer to a bowl and cover with water. Let soak overnight, or about 8-12 h. The next morning, rinse the quinoa using a strainer. Leave it in the strainer and let rest in a dark place all day, about 8 h. Once the quinoa has sprouted, rinse it once again. The sprouted quinoa is now ready to be used. Wash, spin-dry, and finely chop the cilantro, parsley and mint leaves discarding the larger stems. Transfer to a salad bowl along with the finely chopped green onions, then In a small bowl, together the oil, lemon juice, and salt. the dressing until it is emulsified. Adjust the seasoning . Pour into the salad bowl, add the sprouted quinoa then well.\r\n    Let the salad stand 10 min. Dice the tomatoes and cucumber, discarding the seeds, then add them to the salad, . Sprinkle with sunflower seeds then serve.', '[\"quinoa\",\"fresh cilantro, finely chopped\",\"Italian parsley, fresh, finely chopped\",\"fresh mint, finely chopped\",\"green onions\\/scallions, finely chopped\",\"tomatoes, deseeded and diced\",\"cucumbers, medium size, diced\",\"lemon juice, freshly squeezed\",\"extra virgin olive oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"sunflower seeds\"]', 'https://media.soscuisine.com/images/recettes/3450.jpg', 'https://www.soscuisine.com//recipe/sprouted-quinoa-tabbouleh-salad', '', '10 min', '360 kcal', '{\"calories\":\"360\",\"fat\":\"27 g\",\"cholesterol\":\"0 mg\",\"protein\":\"7 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Iron, Magnesium, Manganese, Potassium, Vitamin A, Vitamin C, Vitamin E, Vitamin K\",\"good_source_of\":\"Copper, Fibre, Niacin, Pantothenic Acid, Phosphorus, Vitamin B1, Zinc\",\"source_of\":\"Calcium, Selenium, Vitamin B2, Vitamin B6\",\"low\":\"Sodium\"}', '2021-06-18 14:10:12'),
(68, 68, 1, 'Squash and Leek Soup', 'Preheat the oven to 190°C/375°F. Cut the squash in half lengthwise, remove but keep the seeds. Place the halves on a baking sheet, cut side down. Bake about 45-50 min until soft. Alternatively, cook each halve separately in a microwave oven: Place each halve in a bowl, partially covered, then cook at high intensity about 8 min for each halve. Let the halves cool down, carve out the pulp and dice it into 1,5 cm cubes. Set the cubes aside. Clean the seeds by removing the threads, dry them with a paper towel and place them on a baking sheet.  Add the oil and salt, mix well and bake until golden, about 20 min, with occasional stirring In the meantime, prepare the leek . Keep the white and light green parts only, then slice them thin. Mince the garlic. Heat the butter in a pot over medium heat. Sauté the leek and garlic 4-5 min until translucent. Add the squash cubes and cook 2-3 min with stirring . Add the . Bring to a boil, reduce the heat and simmer about 20 min uncovered. Purée the soup in a blender Adjust the\r\nseasoning Pour the soup into serving bowls, add the baked seeds and serve.', '[\"butternut squash\",\"canola oil, to toast the seeds\",\"leeks, white and light green parts only\",\"garlic, minced\",\"butter, unsalted\",\"chicken broth\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/217.jpg', 'https://www.soscuisine.com//recipe/squash-leek-soup', 'will be very useful to purée the soup.', '80 min', '100 kcal', '{\"calories\":\"100\",\"fat\":\"4 g\",\"cholesterol\":\"10 mg\",\"protein\":\"2 g\"}', '{\"excellent_source_of\":\"Vitamin A\",\"good_source_of\":\"Magnesium, Manganese, Potassium, Vitamin C, Vitamin E\",\"source_of\":\"Calcium, Fibre, Folacin, Iron, Niacin, Pantothenic Acid, Vitamin B1, Vitamin B6\",\"low\":\"Cholesterol, Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:10:13'),
(69, 69, 1, 'Strawberry and Banana Salad with Mint Sugar', 'Hull the strawberries, halve them lengthwise, then put them in a bowl. Cut the bananas into small rounds, then add them to the bowl. Pulse the and sugar together in a food processor until finely ground. Sprinkle the mint sugar over the fruit and gently to combine. Let the fruit stand a few minutes before serving into cups.', '[\"strawberries\",\"bananas, small\",\"fresh mint\",\"sugar\"]', 'https://media.soscuisine.com/images/recettes/719.jpg', 'https://www.soscuisine.com//recipe/strawberry-banana-salad-mint-sugar', 'will be very useful to make the mint sugar.', '10 min', '90 kcal', '{\"calories\":\"90\",\"fat\":\"0 g\",\"cholesterol\":\"0 mg\",\"protein\":\"1 g\"}', '{\"excellent_source_of\":\"Vitamin C\",\"good_source_of\":\"Manganese\",\"source_of\":\"Fibre, Folacin, Magnesium, Potassium, Vitamin B6\",\"free\":\"Cholesterol, Fat, Saturated Fat, Sodium, Trans Fat\"}', '2021-06-18 14:10:14'),
(70, 70, 1, 'Strawberry and Chia Pudding', 'In a bowl, mix the chia seeds and soy beverage. Chill for at least 30 min, or until a pudding consistency is obtained. Mix a few times, to prevent chia seeds from sticking together. Alternatively, if you prefer a smooth consistency, blend together the chia seeds and soy beverage using a food processor then chill. Meanwhile, thinly slice the strawberries lengthwise. Set aside. Pour the chia seeds pudding into glasses, alternating with the strawberries. Serve.', '[\"chia seeds\",\"soy beverage, unsweetened, fortified\",\"strawberries, thinly sliced\"]', 'https://media.soscuisine.com/images/recettes/3451.jpg', 'https://www.soscuisine.com//recipe/strawberry-chia-pudding', 'The chia seeds pudding can be kept in the fridge for 2-3 days.', '10 min', '160 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Bone-healthy, Heart-healthy\",\"excellent_source_of\":\"Fibre, Manganese, Vitamin B12, Vitamin C\",\"good_source_of\":\"Calcium, Folacin, Magnesium, Phosphorus, Vitamin D, Vitamin E\",\"source_of\":\"Copper, Iron, Niacin, Omega-3, Pantothenic Acid, Potassium, Selenium, Vitamin A, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin K, Zinc\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:10:15'),
(71, 71, 1, 'Chili con Carne', 'Prepare the vegetables . Finely chop the onion, mince the garlic and chili pepper , and finely dice the bell pepper. Heat half of the oil in a skillet or a pan over medium heat. Cook the onion and garlic about 3 min until the onion is soft and translucent, with occasional stirring , paying attention not to let them burn. Remove from pan and set aside. Pour the remaining oil into the same pan, heat over medium heat, and add the ground meat. Cook about 5 min, stirring occasionally with a wooden spoon, until the meat loses its pink colour. Put the cooked onion and garlic back into the pan. Add the diced tomatoes, tomato paste, diced bell pepper, minced chili pepper , cumin, and brown sugar. Pour in the warm . Cover and cook over very low heat 1 ½ h, checking occasionally that the mixture stays moist. Add water if necessary. Drain the beans, rinse them and drain again. Add them to the pan, mix well, and cook an additional 8-10 min. Add salt and pepper to taste. Sprinkle with freshly chopped cilantro leaves, garnish with lime wedges, then serve.', '[\"onions, finely chopped\",\"garlic, minced\",\"dried chili peppers, minced\",\"green peppers, diced\",\"canola oil\",\"ground beef, extra-lean, or lean\",\"canned tomatoes (diced)\",\"tomato paste\",\"ground pepper to taste\",\"[optional]\",\"ground cumin\",\"brown sugar\",\"beef broth\",\"water, if necessary\",\"red beans (canned)\",\"salt\",\"[optional]\",\"fresh cilantro, chopped\",\"[optional]\",\"limes\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/306.jpg', 'https://www.soscuisine.com//recipe/chili-con-carne', '.', '120 min', '380 kcal', '{\"calories\":\"380\",\"fat\":\"14 g\",\"cholesterol\":\"50 mg\",\"protein\":\"29 g\"}', '{\"excellent_source_of\":\"Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Vitamin A, Vitamin B12, Vitamin B2, Vitamin C, Vitamin E, Zinc\",\"good_source_of\":\"Copper, Vitamin B1, Vitamin B6, Vitamin K\",\"source_of\":\"Calcium, Pantothenic Acid, Selenium, Vitamin D\",\"low\":\"Calories, Cholesterol, Saturated Fat, Sodium\"}', '2021-06-18 14:10:16'),
(72, 72, 1, 'Strawberry Ice Cream', 'Prepare the mould by lining it with aluminum foil. Let some foil protrude over the edge to help\r\nunmould the ice cream «block» when ready. Hull the strawberries, halve them lengthwise, then put them in a blender .\r\nAdd the strawberry jam and mix at maximum speed until a smooth consistency is obtained. Transfer the mixture to a large bowl and set aside. In another bowl, using an electric mixer the cream until stiff peaks form. Add the whipped cream to the large bowl and fold it into the strawberry mixture\r\nusing a spatula. Pour the cream-strawberry mixture into the prepared mould. Wrap it with aluminum foil and freeze for at least 6 hours or overnight. About 20-30 min before you are ready to serve, unmold the whole ice cream onto a plate and let it sit for a while at room temperature to allow the ice cream to be softer and tastier when serving. Alternatively, cut out the slices and put them onto individual plates. Return any unused part back into the freezer and let the individual slices sit in the refrigerator for a while (not at room temperature since they will melt faster than the whole block). If desired, you may garnish the ice cream with a few berries.', '[\"strawberries\",\"strawberry jam\",\"whipping cream 35%\"]', 'https://media.soscuisine.com/images/recettes/588.jpg', 'https://www.soscuisine.com//recipe/strawberry-ice-cream', 'will be very useful for this recipe.', '15 min', '130 kcal', '{\"calories\":\"130\",\"fat\":\"9 g\",\"cholesterol\":\"30 mg\",\"protein\":\"1 g\"}', '{\"source_of\":\"Folacin, Vitamin A, Vitamin C\",\"low\":\"Sodium\"}', '2021-06-18 14:10:18');
INSERT INTO `recipe_translation` (`rt_id`, `rt_recipe_id`, `rt_lang_id`, `rt_recipe_name`, `rt_recipe_text`, `rt_recipe_ingredients_full`, `rt_recipe_image`, `rt_recipe_link`, `rt_recipe_prep`, `rt_recipe_duration`, `rt_recipe_calories`, `rt_recipe_nutrients`, `rt_recipe_claims`, `rt_created`) VALUES
(73, 73, 1, 'Strawberry Smoothie Bowl', 'Place the banana pieces and strawberries in a food processor blender . Add the kefir. Process on the highest speed until a well-blended purée forms, about 15 seconds, stopping to scrape down the sides of the container once or twice. Incorporate the tofu then pour into bowls. Garnish with the remaining ingredients then serve.', '[\"bananas, small, ripe, chunks\",\"strawberries\",\"kefir\",\"soft tofu\",\"pumpkin seeds\",\"chia seeds\",\"sunflower seeds\",\"dried goji berries\",\"blackberries\"]', 'https://media.soscuisine.com/images/recettes/4105.jpg', 'https://www.soscuisine.com//recipe/strawberry-smoothie-bowl', 'will be very useful for this recipe.', '15 min', '350 kcal', '{\"calories\":\"350\",\"fat\":\"16 g\",\"cholesterol\":\"20 mg\",\"protein\":\"18 g\"}', '{\"diet-related_health_claims\":\"Bone-healthy\",\"excellent_source_of\":\"Calcium, Fibre, Folacin, Magnesium, Manganese, Phosphorus, Potassium, Vitamin C, Vitamin E, Zinc\",\"good_source_of\":\"Iron, Selenium, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin B6\",\"source_of\":\"Copper, Niacin, Omega-3, Pantothenic Acid, Vitamin K\",\"low\":\"Calories, Cholesterol, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:10:18'),
(74, 74, 1, 'Strawberry-Banana Smoothie with Tofu', 'Place the banana pieces and strawberries in a food processor blender . Add the milk. Process on the highest speed until a well-blended purée forms, about 15 seconds, stopping to scrape down the sides of the container once or twice. Incorporate the tofu then serve. For a denser smoothie, increase the amount of fruit and tofu and reduce the kefir.', '[\"bananas, small, firm, chunks\",\"strawberries\",\"kefir\",\"soft tofu\"]', 'https://media.soscuisine.com/images/recettes/3589.jpg', 'https://www.soscuisine.com//recipe/strawberry-banana-smoothie-tofu', 'will be very useful for this recipe.', '10 min', '180 kcal', '{\"calories\":\"180\",\"fat\":\"5 g\",\"cholesterol\":\"20 mg\",\"protein\":\"12 g\"}', '{\"diet-related_health_claims\":\"Bone-healthy\",\"excellent_source_of\":\"Calcium, Potassium, Vitamin C\",\"good_source_of\":\"Folacin, Magnesium, Manganese, Phosphorus, Vitamin B12, Vitamin B2\",\"source_of\":\"Fibre, Iron, Selenium, Vitamin B6, Zinc\",\"low\":\"Calories, Cholesterol, Fat, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:10:19'),
(75, 75, 1, 'Chili con Carne (from dried beans)', 'Cook the dried beans either 15 min in a pressure cooker or about 1 h, \r\ncovered, in a pot with salted water. While the beans cook, prepare the \r\nvegetables . Finely chop the onion, mince the garlic and chili pepper , and finely dice the bell pepper. Heat half of the oil in a pan over medium heat. Cook the onion and garlic about 3 min until the onion is soft and translucent, with occasional stirring , paying attention not to let them burn. Remove from pan and set aside. Pour the remaining oil into the same pan, heat over medium heat, and add the ground meat. Cook about 5 min, stirring occasionally with a wooden spoon, until the meat loses its pink colour. Put the cooked onion and garlic back into the pan. Add the diced tomatoes, tomato paste, diced bell pepper, minced chili pepper , cumin, and brown sugar. Pour in the warm . Cover and cook over very low heat 1 ½ h, checking occasionally that the mixture stays moist. Add water if necessary. Add the beans to the pan, mix well, then cook an additional 8-10 min. Add salt and pepper to taste. Sprinkle with freshly chopped cilantro leaves, garnish with lime wedges, then serve.', '[\"ground beef, extra-lean, or lean\",\"black beans (dried)\",\"canned tomatoes (diced)\",\"tomato paste\",\"onions, finely chopped\",\"garlic, minced\",\"green peppers, diced\",\"brown sugar\",\"beef broth\",\"canola oil\",\"ground cumin\",\"dried chili peppers, minced\",\"limes\",\"[optional]\",\"fresh cilantro, chopped\",\"[optional]\",\"water, if necessary\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/102.jpg', 'https://www.soscuisine.com//recipe/chili-con-carne-from-dried-beans', '', '120 min', '400 kcal', '{\"calories\":\"400\",\"fat\":\"13 g\",\"cholesterol\":\"50 mg\",\"protein\":\"32 g\"}', '{\"excellent_source_of\":\"Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Vitamin A, Vitamin B1, Vitamin B12, Vitamin B6, Vitamin C, Zinc\",\"good_source_of\":\"Copper, Vitamin B2, Vitamin E\",\"source_of\":\"Calcium, Pantothenic Acid, Selenium, Vitamin D, Vitamin K\",\"low\":\"Calories, Cholesterol, Saturated Fat, Sodium\"}', '2021-06-18 14:10:20'),
(76, 76, 1, 'Sunny Salad with Hearts of Palm', 'Using a sharp knife, remove the peel and pith from the grapefruit and, working over a salad bowl to catch the juices, cut out the segments. Squeeze any remaining juice from unused pulp into the bowl. Alternatively, peel the grapefruit, remove the white membrane then cut the fruit into bite-size pieces. Add to the salad bowl. Cut the avocados in half lengthwise, working around the seed. Twist to open, remove the seed, then peel. Cut the avocados into bite-size pieces, then add them to the bowl. Cut the tomatoes into bite-size pieces, discarding the seeds. Add the pieces to the bowl. Drain the hearts of palm, cut them into small rounds, then add them to the bowl. Pour the oil and lemon juice into a small bowl. Season with salt and pepper. Using a fork, the dressing until it is emulsified, then pour it over the salad. well and serve.', '[\"grapefruits, or tangelo\",\"avocados\",\"tomatoes, Roma type\",\"hearts of palm\",\"olive oil\",\"lemon juice, freshly squeezed\",\"ground pepper to taste\",\"[optional]\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1142.jpg', 'https://www.soscuisine.com//recipe/sunny-salad-hearts-palm', 'Canned hearts of palm can be found in gourmet markets and many large supermarkets.', '15 min', '220 kcal', '{\"calories\":\"220\",\"fat\":\"20 g\",\"cholesterol\":\"0 mg\",\"protein\":\"3 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Manganese, Vitamin E\",\"good_source_of\":\"Fibre, Iron, Magnesium, Potassium, Vitamin A, Vitamin C, Vitamin K\",\"source_of\":\"Copper, Niacin, Pantothenic Acid, Phosphorus, Vitamin B2, Vitamin B6, Zinc\"}', '2021-06-18 14:10:20'),
(77, 77, 1, 'Super-Quick Lentil Salad', 'Coarsely chop the celery, finely chop the scallion, then add them to a salad bowl. Pour the oil and lemon juice then season with salt and pepper. Rince and drain the lentils, then add them to the bowl. well and adjust\r\nthe seasoning . Stir in the chopped cilantro (optional), then serve.', '[\"celery, chopped\",\"green onions\\/scallions, finely chopped\",\"extra virgin olive oil\",\"lemonjuice, freshly squeezed\",\"lentils (canned), rinsed and drained\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"fresh cilantro, finely chopped\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1955.jpg', 'https://www.soscuisine.com//recipe/super-quick-lentil-salad', '', '5 min', '290 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Fibre, Folacin, Iron, Magnesium, Manganese, Phosphorus, Potassium, Vitamin K\",\"good_source_of\":\"Copper, Niacin, Pantothenic Acid, Vitamin B1, Vitamin B6, Vitamin E, Zinc\",\"source_of\":\"Selenium, Vitamin B2, Vitamin C\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:10:21'),
(78, 78, 1, 'Swedish-Style Apples with Almonds', 'Preheat the oven to 205°C/400°F. Butter a baking dish. Peel and core the apples then cut them in half. Blanch them 4 min in a pot of boiling water. Drain well and transfer to the prepared baking dish. Set aside. Mix the butter and sugar in a bowl. Set aside. Separate the egg whites from the yolks: add the yolks to the butter-sugar mixture, incorporating them well; add the whites to another bowl. the almonds in a food processor until finely ground, then add them to the mixture. the egg whites to form stiff peaks using a , then fold them into the mixture, blending gently with a spatule. Pour the mixture over the apples in the baking dish and bake in the middle of the oven 20 min. Let the apples cool down, then serve them with the light crème anglaise , if desired.', '[\"apples\",\"butter, unsalted\",\"sugar\",\"eggs size large\",\"almonds, blanched\",\"\\\"Cr\\u00c3\\u00a8me Anglaise\\\" [optional]\"]', 'https://media.soscuisine.com/images/recettes/240.jpg', 'https://www.soscuisine.com//recipe/swedish-style-apples-almonds', '', '40 min', '490 kcal', '{\"calories\":\"490\",\"fat\":\"28 g\",\"cholesterol\":\"100 mg\",\"protein\":\"8 g\"}', '{\"excellent_source_of\":\"Fibre, Magnesium, Manganese, Vitamin E\",\"good_source_of\":\"Copper, Vitamin B2\",\"source_of\":\"Calcium, Folacin, Iron, Niacin, Pantothenic Acid, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B1, Vitamin B12, Vitamin B6, Vitamin D, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:10:23'),
(79, 79, 1, 'Tabbouleh Salad', 'Soak the bulghur 10 min in warm water, making sure it remains covered with the water until the end. Drain and put into a salad bowl. Wash, spin-dry, and finely chop the parsley and mint leaves discarding the larger stems. Add to the salad bowl along with the finely chopped green onions, then In a small bowl, together the oil, lemon juice, and salt. the dressing until it is emulsified. Adjust the seasoning , pour into the salad bowl then well. Let stand 10 min. Dice the tomatoes discarding the seeds. Add to the salad, , and serve.', '[\"bulghur\",\"Italian parsley, fresh, finely chopped\",\"fresh mint, finely chopped\",\"green onions\\/scallions, finely chopped\",\"tomatoes, deseeded and diced\",\"lemon juice, freshly squeezed\",\"extra virgin olive oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/62.jpg', 'https://www.soscuisine.com//recipe/tabbouleh-salad', '', '10 min', '190 kcal', '{\"calories\":\"190\",\"fat\":\"15 g\",\"cholesterol\":\"0 mg\",\"protein\":\"3 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Iron, Vitamin A, Vitamin C, Vitamin E, Vitamin K\",\"good_source_of\":\"Magnesium, Manganese, Potassium\",\"source_of\":\"Calcium, Copper, Fibre, Niacin, Phosphorus, Vitamin B1, Vitamin B6, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:10:24'),
(80, 80, 1, 'Tahini Bars', 'Preheat the oven to 175°C/350°F. Line a 20 cm (8 in) square baking pan with parchment\r\npaper . Grind the flax seeds, then set aside. Using a food processor , cream the tahini, banana, egg and maple syrup together. Stop the food processor then add the remaining ingredients and mix well. Transfer the mixture into the prepared baking pan. Bake in the middle of the oven for about 25-30 min. Take the pan out of the oven, then let cool at least 30 min. Cut into 12 bars and serve.', '[\"Tahini paste\",\"bananas, small, ripe\",\"eggs size large\",\"maple syrup\",\"rolled oats\",\"unsweetened coconut flakes\",\"flax seeds, ground\"]', 'https://media.soscuisine.com/images/recettes/3454.jpg', 'https://www.soscuisine.com//recipe/tahini-bars', 'will be very useful to grind the flax seeds.', '40 min', '190 kcal', '{\"calories\":\"190\",\"fat\":\"12 g\",\"cholesterol\":\"20 mg\",\"protein\":\"5 g\"}', '{\"excellent_source_of\":\"Magnesium, Manganese\",\"good_source_of\":\"Copper, Fibre, Phosphorus, Vitamin B1, Zinc\",\"source_of\":\"Folacin, Iron, Niacin, Omega-3, Omega-6, Pantothenic Acid, Selenium, Vitamin B2, Vitamin B6\",\"low\":\"Sodium\"}', '2021-06-18 14:10:25'),
(81, 81, 1, 'Thai Coconut Rice', 'Lightly oil the bottom and sides of a deep-sided pot. Place the rice, coconut milk, water, shredded coconut, and salt in the pot. Set the pot over medium-high to high heat. occasionally to keep the rice from sticking to the bottom of the pot and burning. After the coconut-water has begun to gently bubble, stop stirring and reduce the heat to \'low\'. Cover tightly with a lid and let simmer until most of the liquid has been absorbed by the rice, about 20 min. Serve.', '[\"vegetable oil spray\",\"jasmine rice\",\"unsweetened coconut milk\",\"water\",\"grated coconut\",\"salt\"]', 'https://media.soscuisine.com/images/recettes/2557.jpg', 'https://www.soscuisine.com//recipe/thai-coconut-rice', 'A tight-fitting lid is needed for this recipe.', '25 min', '330 kcal', '{\"calories\":\"330\",\"fat\":\"16 g\",\"cholesterol\":\"0 mg\",\"protein\":\"5 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Manganese, Selenium\",\"good_source_of\":\"Magnesium\",\"source_of\":\"Copper, Folacin, Iron, Niacin, Pantothenic Acid, Phosphorus, Potassium, Vitamin B6, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:10:26'),
(82, 82, 1, 'Thick Cashew Cream', 'Powder the cashew nuts in the food processor. Add the lemon juice, tahini and non-dairy milk. Mix until well blended.', '[\"cashews\",\"lemon juice, freshly squeezed\",\"Tahini paste\",\"almond beverage, unsweetened, fortified, rice, or  soy\"]', 'https://media.soscuisine.com/images/recettes/2243.jpg', 'https://www.soscuisine.com//recipe/thick-cashew-cream', '', '10 min', '100 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Vitamin D\",\"good_source_of\":\"Copper, Magnesium\",\"source_of\":\"Iron, Manganese, Niacin, Omega-6, Phosphorus, Vitamin B1, Zinc\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:10:28'),
(83, 83, 1, '\"Three P\" Soup', 'Preheat the oven to 205°C/400°F. Generously oil a baking sheet. Prepare the vegetables : peel and cut into large chunks. Peel and cut the pear also into large chunks, discarding the core. Lay the vegetables and pear out on the sheet in a single layer and coat them thoroughly with the oil. Roast in the middle of the oven 35-40 min, until the vegetables are softened and lightly browned. During cooking, turn them a couple times using a spatula to coat them with the oil on the\r\nsheet. Heat the in a saucepan over medium heat. in the roasted vegetables and pear. Add salt and pepper then simmer 15 min. Purée the soup in a blender food processor adding more if the soup is too thick. Add the oregano, adjust the seasoning then serve the soup into bowls.', '[\"parsnips, peeled and cut into chunks\",\"potatoes, peeled and cut into chunks\",\"pears, peeled and cut into chunks\",\"olive oil\",\"chicken broth\",\"dried oregano\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/256.jpg', 'https://www.soscuisine.com//recipe/three-p-soup', 'will be very useful to purée the soup.', '60 min', '140 kcal', '{\"calories\":\"140\",\"fat\":\"4 g\",\"cholesterol\":\"0 mg\",\"protein\":\"2 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"good_source_of\":\"Folacin, Manganese, Potassium, Vitamin K\",\"source_of\":\"Copper, Fibre, Iron, Magnesium, Niacin, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin B6, Vitamin C, Vitamin E, Zinc\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:10:30'),
(85, 85, 1, 'Tofu Chocolate Mousse', 'Coarsely chop the chocolate then put the pieces in the upper part of a bain-marie . Let the chocolate melt. Pour the molten chocolate into a blender , with the cream, tofu, and sugar (optional). Mix at maximum speed until a creamy consistency is obtained, about 2 min. Pour the mixture into individual bowls. Chill the mousse in the refrigerator for about 1 h until serving. Throw some berries on top, if you like, then serve.', '[\"unsweetened (dark) chocolate\",\"silken tofu\",\"whipping cream 35%\",\"sugar\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1479.jpg', 'https://www.soscuisine.com//recipe/tofu-chocolate-mousse', 'will be very useful to blend the tofu and chocolate.', '15 min', '240 kcal', '{\"calories\":\"240\",\"fat\":\"17 g\",\"cholesterol\":\"30 mg\",\"protein\":\"6 g\"}', '{\"good_source_of\":\"Iron\",\"source_of\":\"Calcium, Copper, Magnesium, Niacin, Phosphorus, Vitamin A, Vitamin B1\",\"low\":\"Sodium\"}', '2021-06-18 14:10:33'),
(86, 86, 1, 'Tofu Mayonnaise', 'Place all the ingredients, except fresh herbs, in a blender food\r\nprocessor . Blend until a smooth consistency is reached. The mixture being quite thick, push the ingredients into the blades using a spatula. Transfer the mixture to a small bowl and add the fresh herbs. Mix well then serve.', '[\"silken tofu\",\"lemon, freshly squeezed\",\"olive oil\",\"water\",\"salt\",\"Dijon mustard\",\"garlic\",\"[optional]\",\"honey\",\"[optional]\",\"chives, fresh, chopped\",\"Italian parsley, fresh, chopped\",\"marjoram, fresh, chopped\"]', 'https://media.soscuisine.com/images/recettes/2766.jpg', 'https://www.soscuisine.com//recipe/tofu-mayonnaise', 'will be very useful for this recipe.', '10 min', '50 kcal', '{\"calories\":\"50\",\"fat\":\"3 g\",\"cholesterol\":\"0 mg\",\"protein\":\"2 g\"}', '{\"source_of\":\"Magnesium, Vitamin K\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Cholesterol, Trans Fat\"}', '2021-06-18 14:10:34'),
(87, 87, 1, 'Tofu Mousse with Peanut Butter', 'Put the tofu in a blender . Add the peanut butter, syrup and vanille. Mix at maximum speed about 2 min until a creamy consistency is obtained. Pour the mixture into individual bowls, then serve.', '[\"soft tofu\",\"peanut butter, natural\",\"maple syrup, or more to taste\",\"vanilla extract\"]', 'https://media.soscuisine.com/images/recettes/2642.jpg', 'https://www.soscuisine.com//recipe/tofu-mousse-peanut-butter', 'will be very useful to blend the tofu and peanut butter.', '5 min', '300 kcal', '{\"calories\":\"300\",\"fat\":\"16 g\",\"cholesterol\":\"0 mg\",\"protein\":\"19 g\"}', '{\"diet-related_health_claims\":\"Bone-healthy\",\"excellent_source_of\":\"Niacin\",\"good_source_of\":\"Calcium, Iron, Magnesium, Manganese, Vitamin B2, Vitamin E\",\"source_of\":\"Copper, Fibre, Folacin, Phosphorus, Potassium, Vitamin B1, Vitamin B6, Zinc\"}', '2021-06-18 14:10:35'),
(88, 88, 1, 'Tofu Salad Wrap', 'Crumble the tofu into a bowl. Add the rest of the ingredients, except spinach and tortilla, and mix well. Let mixture rest in the fridge for at least 30 min, to let flavours develop. Put the tortillas on a working surface. Spread tofu mixture onto each tortilla. Add spinach, roll each tortilla into a wrap and serve.', '[\"firm regular tofu\",\"canola oil\",\"lemon juice, freshly squeezed\",\"nutritional yeast\",\"Dijon mustard\",\"cayenne pepper\",\"turmeric\",\"Italian parsley, fresh, finely chopped\",\"fresh dill, finely chopped\",\"green onions\\/scallions, green tops only, chopped\",\"baby spinach, or lettuce leave\",\"[optional]\",\"corn tortillas\"]', 'https://media.soscuisine.com/images/recettes/3533.jpg', 'https://www.soscuisine.com//recipe/tofu-salad-wrap-gluten-free', 'It\'s important to remove as much water as possible from the tofu, in order for it to absorb flavour. To do so, either drain well, or freeze the tofu block in a plastic bag, then thaw in a sieve over a bowl in the fridge before using.', '10 min', '380 kcal', '{\"calories\":\"380\",\"fat\":\"24 g\",\"cholesterol\":\"0 mg\",\"protein\":\"19 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Magnesium, Manganese, Niacin, Phosphorus, Vitamin B2, Vitamin E, Vitamin K\",\"good_source_of\":\"Calcium, Copper, Iron, Selenium, Vitamin B1, Vitamin B12, Zinc\",\"source_of\":\"Fibre, Omega-3, Omega-6, Potassium, Vitamin A, Vitamin B6, Vitamin C\"}', '2021-06-18 14:10:36'),
(89, 89, 1, 'Tomato & Cheese Cauliflower Pizza', 'Preheat the oven to 205°C/400°F. Line a large baking sheet with parchment\r\npaper Prepare the cauliflower : Cut into florets then transfer to a food processor . Pulse until it is finely chopped. Transfer to a large bowl. Add the eggs, salt, and minced garlic. Mix well then transfer the mixture to the prepared baking sheet. Use your hands to form it into a pizza crust. Bake in the middle of the oven until lightly golden, about 20 min. Take out of the oven then top the crust with the tomato sauce, anchovies, and cheese. Bake for an additional 10-15 min. Garnish with basil leaves then serve.', '[\"cauliflower\",\"garlic, minced\",\"eggs size large\",\"salt\",\"My Mother\'s Tomato Sauce\",\"anchovy fillets\",\"bocconcini \\/ fresh mozzarella\",\"ground pepper to taste\",\"[optional]\",\"fresh basil\"]', 'https://media.soscuisine.com/images/recettes/4215.jpg', 'https://www.soscuisine.com//recipe/tomato-cheese-cauliflower-pizza', 'will be very useful.', '40 min', '150 kcal', '{\"calories\":\"150\",\"fat\":\"9 g\",\"cholesterol\":\"110 mg\",\"protein\":\"11 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Vitamin C, Vitamin K\",\"good_source_of\":\"Pantothenic Acid, Phosphorus, Potassium, Selenium, Vitamin B12, Vitamin B6\",\"source_of\":\"Calcium, Fibre, Iron, Magnesium, Manganese, Niacin, Vitamin A, Vitamin B1, Vitamin B2, Vitamin D, Vitamin E, Zinc\"}', '2021-06-18 14:10:37'),
(90, 90, 1, 'Tomato and Cucumber Salsa', 'Dice the tomatoes discarding the seeds. Put them in a salad bowl. Prepare the cucumbers : sprinkle them with salt and let drain about 15 min. Dice the cucumbers and add them to the bowl. In a small bowl, the oil and vinegar, using a fork, until well emulsified. Add salt and pepper. Add the Worcestershire sauce to taste. For a more exotic flavour, add a few chopped cilantro leaves, but be careful with the amount since it may be overpowering. Let stand a few minutes before serving.', '[\"tomatoes, Roma type, diced\",\"cucumbers, medium size, diced\",\"olive oil\",\"wine vinegar\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"Worcestershire sauce, to taste\",\"fresh cilantro\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/429.jpg', 'https://www.soscuisine.com//recipe/tomato-cucumber-salsa', '', '10 min', '120 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Vitamin K\",\"good_source_of\":\"Vitamin A, Vitamin E\",\"source_of\":\"Folacin, Iron, Magnesium, Manganese, Potassium, Vitamin C\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:10:38'),
(91, 91, 1, 'Chinese Fondue', 'Prepare the vegetables : detach the cabbage leaves, leaving them whole, and slice the other vegetables into thin strips. Place and arrange them nicely on a serving platter. If you do not like crunchy\r\nvegetables, you may blanch them a few minutes before placing them on the serving platter. Lay the beef slices on a separate\r\nplatter. Set aside. To prepare the dipping sauce, pour the lemon juice and soy sauce into a bowl. Grind or pound the sesame seeds and add them to the bowl. Set aside. Combine the water and beef in a\r\nsaucepan, bring the liquid to a boil, then transfer enough so that the fondue pot is approximately 2/3 to 3/4 full (how much you will need will depend on the size of the fondue pot). Draw about 3 tablespoons of per serving and add it to the dipping sauce bowl, mix well, then portion out the sauce into small individual serving bowls. Place the fondue pot on top of the burner in the centre of the table, and keep it simmering throughout the meal. Keep any remaining warm on the stovetop. To serve, each guest spears one of the meat or vegetable pieces with a dipping fork, immerses it\r\nbriefly in the until cooked to their liking, then dips it into the sauce as desired. After the food is cooked, the rich is\r\ndistributed to whomever has enough room for it. As an option, one egg may be added to the . Cook 1-2 min with stirring , then ladle the into bowls.', '[\"Napa cabbage\",\"zucchini\",\"leeks\",\"soybean sprouts\",\"button (white) mushrooms\",\"beef for Chinese fondue\",\"lemon juice, freshly squeezed\",\"soy sauce\",\"sesame seeds\",\"water, approximately\",\"beef broth, approximately\",\"eggs size large\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/470.jpg', 'https://www.soscuisine.com//recipe/chinese-fondue', 'A fondue pot and a burner are needed for this recipe. Each guest should have a dipping fork (colour-coded if possible) and a small plate or bowl for the cooked food.', '15 min', '420 kcal', '{\"calories\":\"420\",\"fat\":\"17 g\",\"cholesterol\":\"60 mg\",\"protein\":\"43 g\"}', '{\"excellent_source_of\":\"Copper, Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin C, Vitamin K, Zinc\",\"good_source_of\":\"Calcium\",\"source_of\":\"Vitamin D, Vitamin E\",\"low\":\"Calories, Cholesterol, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:10:38'),
(93, 93, 1, 'Tomatoes with \"Salsa Verde\"', 'Wash the tomatoes and wipe dry. Cut them in half crosswise, remove the seeds, then place the halves on a serving plate. Put the Parsley and Garlic base , capers and olive oil in a small bowl, then mix well. Distribute the mixture on top   of each tomato half. Add a little salt, then serve.', '[\"tomatoes, large, ripe\",\"Parsley and Garlic Base\",\"extra virgin olive oil\",\"capers, finely chopped\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1111.jpg', 'https://www.soscuisine.com//recipe/tomatoes-salsa-verde', 'For good results, use only locally-grown, sun-ripened field tomatoes.', '10 min', '170 kcal', '{\"calories\":\"170\",\"fat\":\"15 g\",\"cholesterol\":\"0 mg\",\"protein\":\"2 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Vitamin A, Vitamin C, Vitamin E, Vitamin K\",\"good_source_of\":\"Folacin, Potassium\",\"source_of\":\"Copper, Fibre, Iron, Magnesium, Manganese, Niacin, Vitamin B1, Vitamin B6\",\"low\":\"Sodium\"}', '2021-06-18 14:10:41'),
(94, 94, 1, '\"Travel Pro\" Parfait', 'Put the tofu in a blender . Add the peanut butter and syrup. Mix at maximum speed about 2 min until a creamy consistency is obtained. Pour the mixture into individual jars. Add the Granola , then serve.', '[\"silken tofu\",\"peanut butter, natural\",\"maple syrup, or more to taste\",\"Homemade Granola\"]', 'https://media.soscuisine.com/images/recettes/3273.jpg', 'https://www.soscuisine.com//recipe/travel-pro-parfait', 'For best results, use ONLY silken tofu.', '5 min', '610 kcal', '{\"calories\":\"610\",\"fat\":\"28 g\",\"cholesterol\":\"0 mg\",\"protein\":\"24 g\"}', '{\"excellent_source_of\":\"Copper, Fibre, Iron, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Vitamin B1, Vitamin B2, Vitamin E\",\"good_source_of\":\"Folacin, Selenium, Zinc\",\"source_of\":\"Calcium, Pantothenic Acid, Vitamin B6, Vitamin K\",\"low\":\"Sodium\"}', '2021-06-18 14:10:43'),
(95, 95, 1, 'Tropical Smoothie Bowl', 'Place the mango and pineapple in a food processor blender , setting aside a few pieces of mango for decorating. Add the soy beverage, half of the chia seeds and turmeric to the blender. Process on the highest speed until a well-blended purée forms, about 15 seconds, stopping to scrape down the sides of the container once or twice. Pour the smoothie into bowls then garnish with the remaining ingredients.', '[\"mangoes, chunks\",\"pineapple\",\"soy beverage, unsweetened, fortified\",\"chia seeds\",\"turmeric\",\"unsweetened coconut flakes\",\"kiwis, cut into small cubes\",\"walnuts, chopped\"]', 'https://media.soscuisine.com/images/recettes/4106.jpg', 'https://www.soscuisine.com//recipe/tropical-smoothie-bowl', 'will be very useful for this recipe.', '10 min', '400 kcal', '{\"calories\":\"400\",\"fat\":\"16 g\",\"cholesterol\":\"0 mg\",\"protein\":\"15 g\"}', '{\"diet-related_health_claims\":\"Bone-healthy\",\"free\":\"Added Sugar\",\"excellent_source_of\":\"Calcium, Copper, Fibre, Folacin, Iron, Magnesium, Manganese, Pantothenic Acid, Phosphorus, Potassium, Selenium, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin C, Vitamin D, Vitamin E, Vitamin K\",\"good_source_of\":\"Niacin, Vitamin A, Zinc\",\"source_of\":\"Omega-3, Omega-6\"}', '2021-06-18 14:10:43'),
(96, 96, 1, 'Tsatsiki Sauce', 'Peel, cut in half and seed the cucumber. Keep half the skin aside. Grate the cucumber coarsely and place the pieces in a sieve, add salt, and let drain about 30 min. Squeeze the pulp to extract liquid and wrap in paper towels to dry. In the meantime, pour the yogurt into a fine-screen colander . Let drain 30 min. Place the cucumber pulp in a bowl, add the drained yogurt, vinegar, oil, and a pinch of salt. well. Press and\r\nmince the garlic, chop the mint and cucumber skin, then add them to the bowl and mix. Chill, covered, a least 1 h before serving.', '[\"cucumbers, medium size\",\"yogurt, plain, 2%\",\"wine vinegar\",\"olive oil\",\"salt\",\"[optional]\",\"garlic\",\"fresh mint, chopped\",\"paper towels\"]', 'https://media.soscuisine.com/images/recettes/194.jpg', 'https://www.soscuisine.com//recipe/tsatsiki-sauce', '(pronounced tzah-ZEE-kee) is easy to make, but it is important to use fresh ingredients and combining them to reach the correct balance between the rich but not sweet taste of a good Greek style yogurt, the freshness of cucumber and the pungency of garlic. You can vary its thickness as you like, but remember: you should eat it with a fork!', '10 min', '150 kcal', '{\"calories\":\"150\",\"fat\":\"9 g\",\"cholesterol\":\"10 mg\",\"protein\":\"7 g\"}', '{\"diet-related_health_claims\":\"Bone-healthy\",\"free\":\"Added Sugar\",\"excellent_source_of\":\"Vitamin B12\",\"good_source_of\":\"Calcium, Phosphorus, Potassium, Vitamin B2, Vitamin K\",\"source_of\":\"Folacin, Magnesium, Pantothenic Acid, Selenium, Vitamin B1, Vitamin B6, Vitamin E, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:10:45'),
(97, 97, 1, 'Chinese Fondue with Chicken', 'Prepare the vegetables : detach the cabbage leaves, leaving them whole, and slice the other vegetables into thin strips. Place and arrange them nicely on a serving platter. If you do not like crunchy\r\nvegetables, you may blanch them a few minutes before placing them on the serving platter. Lay the chicken slices on a separate\r\nplatter. Set aside. To prepare the dipping sauce, pour the lemon juice and soy sauce into a bowl. Grind or pound the sesame seeds and add them to the bowl. Set aside. Combine the water and chicken in a\r\nsaucepan, bring the liquid to a boil, then transfer enough so that the fondue pot is approximately 2/3 to 3/4 full (how much you will need will depend on the size of the fondue pot). Draw about 3 tablespoons of per serving and add it to the dipping sauce bowl, mix well, then portion out the sauce into small individual serving bowls. Place the fondue pot on top of the burner in the centre of the table, and keep it simmering throughout the meal. Keep any remaining warm on the stovetop. To serve, each guest spears one of the meat or vegetable pieces with a dipping fork, immerses it\r\nbriefly in the until cooked to their liking, then dips it into the sauce as desired. After the food is cooked, the rich is\r\ndistributed to whomever has enough room for it. As an option, one egg may be added to the . Cook 1-2 min with stirring , then ladle the into bowls.', '[\"Napa cabbage\",\"zucchini\",\"leeks\",\"soybean sprouts\",\"button (white) mushrooms\",\"chicken for Chinese fondue\",\"lemon juice, freshly squeezed\",\"soy sauce\",\"sesame seeds\",\"water, approximately\",\"chicken broth, approximately\",\"eggs size large\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/475.jpg', 'https://www.soscuisine.com//recipe/chinese-fondue-chicken', 'A fondue pot and a burner are needed for this recipe. Each guest should have a dipping fork (colour-coded if possible) and a small plate or bowl for the cooked food.', '15 min', '380 kcal', '{\"calories\":\"380\",\"fat\":\"16 g\",\"cholesterol\":\"50 mg\",\"protein\":\"36 g\"}', '{\"excellent_source_of\":\"Copper, Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin C, Vitamin K, Zinc\",\"good_source_of\":\"Calcium, Vitamin B12\",\"source_of\":\"Vitamin E\",\"low\":\"Calories, Cholesterol, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:10:45'),
(98, 98, 1, 'Tuscan Bread and Cabbage Soup', 'Preheat the oven to 150°C/300°F. Tear the bread into 1,5 cm pieces and spread them in a single layer on a baking sheet. Bake about 15 min, until the pieces are dry. Remove the bread from the oven and set aside. Prepare the vegetables : cut the onion, carrots, and celery into small 0,7 cm pieces. Mince or the garlic cloves. Slice the cabbage thinly and set\r\naside. Heat the oil in a pot over medium-high heat. Add the onion, carrots, celery, and garlic. Cook, stirring occasionally, until the vegetables are softened, about 10 min. in the tomato paste and cook, with stirring , 1 min. Add the sliced cabbage, , and toasted bread. Season with salt and pepper. Cover and simmer over medium heat until the soup is thickened, about 15 min. Serve into bowls. in the parsley leaves and grate Parmesan over the top of each serving.', '[\"bread, whole wheat, coarsely cut into 1,5 cm pieces\",\"onions, cut into small pieces\",\"carrots, cut into small pieces\",\"celery, cut into small pieces\",\"garlic, minced or pressed\",\"green cabbage, or green cabbage, thinly sliced\",\"olive oil\",\"tomato paste\",\"beef broth\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"Parmesan cheese, grated\",\"Italian parsley, fresh\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/247.jpg', 'https://www.soscuisine.com//recipe/tuscan-bread-cabbage-soup', 'will make slicing the cabbage easier.', '45 min', '180 kcal', '{\"calories\":\"180\",\"fat\":\"6 g\",\"cholesterol\":\"0 mg\",\"protein\":\"9 g\"}', '{\"excellent_source_of\":\"Folacin, Manganese, Selenium, Vitamin A, Vitamin K\",\"good_source_of\":\"Fibre, Magnesium, Niacin, Phosphorus, Potassium, Vitamin B6, Vitamin C\",\"source_of\":\"Calcium, Copper, Iron, Pantothenic Acid, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin E, Zinc\",\"low\":\"Cholesterol, Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:10:47'),
(99, 99, 1, 'Unsweetened Applesauce', 'Cut the apples into quarters without peeling them. Put them in a saucepan. Pour about 1-2 cm of water in the bottom of the saucepan, cover and cook over low heat about 10 min, until the apples are softened completely. Purée the apples using a food mill . Let the purée cool down and serve cold or at room temperature.', '[\"apples\",\"water, approximately\"]', 'https://media.soscuisine.com/images/recettes/1954.jpg', 'https://www.soscuisine.com//recipe/applesauce', 'will be very useful to purée the apples, without having to peel them first.', '25 min', '60 kcal', '', '', '2021-06-18 14:10:48'),
(100, 100, 1, 'Vanilla Ice Cream', 'Put a metal or glass bowl into the freezer so that it will be cold when filling it with the cream mixture. Separate the egg whites and yolks : Put the yolks in one bowl and the egg whites in another bowl. the whites using a mixer until stiff\r\npeaks are formed. Set aside. Pour the cream in a third bowl, then using the electric mixer, the cream until stiff peaks are formed. Set aside. Add the sugar to the yolks, then well using the mixer until the mixture is pale and fluffy, about 2 min. Pour in the milk and vanilla. Incorporate the egg whites and the whipped cream into the mixture, blending gently with a spatula. Transfer the mixture to the prepared bowl, cover and put it in the freezer. After about 1 h, take the bowl out of the freezer, the mixture using a whisk, then return the bowl to the freezer. Repeat the same stirring operation after one additional hour in the freezer. It normally takes 3-4 hours until the ice cream is ready.', '[\"eggs size large\",\"whipping cream 35%\",\"icing\\/confectioners\' sugar\",\"milk, partly skimmed, 2%\",\"vanilla extract\"]', 'https://media.soscuisine.com/images/recettes/843.jpg', 'https://www.soscuisine.com//recipe/vanilla-ice-cream', '', '15 min', '220 kcal', '{\"calories\":\"220\",\"fat\":\"14 g\",\"cholesterol\":\"140 mg\",\"protein\":\"4 g\"}', '{\"good_source_of\":\"Selenium, Vitamin A, Vitamin B12\",\"source_of\":\"Folacin, Pantothenic Acid, Phosphorus, Vitamin B2, Vitamin D, Vitamin E\",\"low\":\"Sodium\"}', '2021-06-18 14:10:48'),
(101, 101, 1, 'Vanilla-Scented Quinoa', 'Place the quinoa in a fine strainer and hold it under cold running water until the water runs clear, then drain well. Slit the vanilla bean lengthwise down the centre, scrape out some of the seeds, then add them along with the scraped bean to the saucepan. Add the quinoa and water,with salt to taste. Bring to a boil, then reduce to a simmer . Cover and cook until the grains are translucent and the germ has spiralled out from each grain, about 15 min. Remove pan from heat and let stand, covered, 5 min. Fluff with a fork then portion out to bowls. Add the maple syrup, and milk, then serve.', '[\"quinoa\",\"water\",\"vanilla beans\",\"salt\",\"[optional]\",\"maple syrup\",\"milk, skimmed, 0%\"]', 'https://media.soscuisine.com/images/recettes/3208.jpg', 'https://www.soscuisine.com//recipe/vanilla-scented-quinoa', '* The used vanilla bean may be rinsed, dried and stored for reuse.', '20 min', '210 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Magnesium, Manganese, Vitamin B2\",\"good_source_of\":\"Copper, Iron, Phosphorus, Potassium, Vitamin B12, Zinc\",\"source_of\":\"Calcium, Fibre, Folacin, Niacin, Pantothenic Acid, Vitamin B1, Vitamin B6, Vitamin D\",\"low\":\"Fat, Saturated Fat, Sodium\",\"free\":\"Cholesterol, Trans Fat\"}', '2021-06-18 14:10:49'),
(102, 102, 1, 'Vegan Chocolate Cake', 'Preheat the oven to 175°C/350°F. Line with parchment paper the base of a 25cm springform cake pan and lightly grease its sides with a little bit of oil. In a large bowl, mix together the flour, sugar, salt baking soda and cocoa powder. Set aside. In another bowl, mix the canola oil and soy beverage. Add to the dry mixture then mix well. Pour in the vinegar then blend well using a until the mixture is homogenous, about 1 min. Do not over mix. Pour the mixture into the prepared cake pan and bake in the center of the oven for about 45-50 min. Check the cake with a toothpick or knife to see if it is cooked through. When done, pull the cake out of the oven then\r\n    let it cool down in its pan for at least 30 min before unmolding. Meanwhile, prepare the icing: In a bowl, mix together the coconut oil, vanilla, icing sugar, cocoa powder and soy beverage. Pour the icing mixture on top of the cooled cake. Decorate with berries then serve.', '[\"white flour (all purpose)\",\"sugar\",\"salt\",\"baking soda\",\"cocoa powder\",\"canola oil\",\"soy beverage, unsweetened, fortified, vanilla flavoured\",\"apple cider vinegar\",\"coconut oil melted, for the icing\",\"vanilla extract, for the icing\",\"icing\\/confectioners\' sugar, for the icing\",\"cocoa powder, for the icing\",\"soy beverage, unsweetened, fortified, vanilla flavoured, for the icing\",\"blueberries, or other berries, for decoration\"]', 'https://media.soscuisine.com/images/recettes/3863.jpg', 'https://www.soscuisine.com//recipe/vegan-chocolate-cake', '', '60 min', '460 kcal', '{\"calories\":\"460\",\"fat\":\"22 g\",\"cholesterol\":\"0 mg\",\"protein\":\"6 g\"}', '{\"excellent_source_of\":\"Folacin, Selenium, Vitamin E, Vitamin K\",\"good_source_of\":\"Iron, Manganese, Niacin, Vitamin B1, Vitamin B2\",\"source_of\":\"Copper, Fibre, Magnesium, Omega-3, Omega-6, Phosphorus, Vitamin B12, Vitamin D, Zinc\"}', '2021-06-18 14:10:50'),
(103, 103, 1, 'Vegan Date Cookies', 'Preheat the oven to 190°C/375°F. Line a baking sheet with parchment paper Soak the dates in boiling water for 5 min, then drain them and transfer to a blender in the syrup and oil, then mix well. Add the oats, flour, salt, grated ginger, and cinnamon, then process until a well-blended purée forms. Using an ice cream scoop, form 12 balls then transfer to the prepared baking sheet. Using a fork, press lightly on each ball to flatten it. Bake the cookies in the middle of the oven until they turn light brown, about 12-15 min. Let the cookies cool on the sheet for 20 min. before serving.', '[\"pitted dates\",\"canola oil\",\"maple syrup\",\"white flour (all purpose)\",\"rolled oats\",\"salt\",\"[optional]\",\"gingerroot, grated\",\"ground cinnamon\"]', 'https://media.soscuisine.com/images/recettes/4363.jpg', 'https://www.soscuisine.com//recipe/vegan-date-cookies', 'will be very useful for this recipe.', '30 min', '200 kcal', '{\"calories\":\"200\",\"fat\":\"6 g\",\"cholesterol\":\"0 mg\",\"protein\":\"3 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"good_source_of\":\"Folacin\",\"source_of\":\"Fibre, Iron, Magnesium, Manganese, Niacin, Omega-3, Phosphorus, Selenium, Vitamin B1, Vitamin B2, Vitamin E, Vitamin K\",\"low\":\"Saturated Fat\",\"free\":\"Cholesterol, Sodium, Trans Fat\"}', '2021-06-18 14:10:52'),
(104, 104, 1, 'Chinese-Style Beef with Snow Peas', 'Slice the meat into strips ½ to 1 cm wide and about 5 cm long. Mix with the soy sauce, cornstarch, sugar, and 2-3 slices of ginger. Chill for at least an hour in the refrigerator. Preheat the oven to the lowest setting. Prepare the vegetables . Coarsely chop the onion, thinly slice the pepper, and mince or press the garlic. Keep the snow peas whole. Cut 2-3 more slices of ginger. Heat ½ to 1 tablespoon of oil in a frying-pan or . Add the garlic, onion, and bell pepper, cook 2-3 min until they start to soften, then set aside on the warmed serving plate in the oven. Turn up the heat and add ½ to 1 tablespoon of oil. First add some salt, then immediately add the snow peas. constantly for 2-3 min since they cook very quickly (the colour should stay dark green). Put the snow peas on the plate with the other vegetables. Keep the plate warm. In the same , add the remaining oil and the marinated meat. Reserve the remaining marinade. constantly over medium heat 5-7 min until the meat is almost cooked. Put the vegetables back into the , add the new slices of ginger plus the reserved marinade. Cook another 2 min. Add salt and pepper to taste. Serve.', '[\"beef strip loin, or rib eye, cut into 1 cm strips\",\"soy sauce\",\"cornstarch\",\"sugar\",\"gingerroot, cut into thin slices\",\"onions, coarsely chopped\",\"green peppers, cut into thin strips\",\"garlic, minced or pressed\",\"snow peas\",\"canola oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1869.jpg', 'https://www.soscuisine.com//recipe/chinese-style-beef-snow-peas-alcool-free', '', '30 min', '370 kcal', '{\"calories\":\"370\",\"fat\":\"19 g\",\"cholesterol\":\"40 mg\",\"protein\":\"23 g\"}', '{\"excellent_source_of\":\"Iron, Niacin, Potassium, Selenium, Vitamin B12, Vitamin B6, Vitamin C, Vitamin E, Vitamin K, Zinc\",\"good_source_of\":\"Folacin, Magnesium, Manganese, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin B2\",\"source_of\":\"Calcium, Copper, Fibre, Omega-3, Omega-6, Vitamin A, Vitamin D\"}', '2021-06-18 14:10:52'),
(105, 105, 1, 'Vegan Stuffed Squash', 'Preheat the oven to 175°C/350°F. Cut the squash in half lengthwise and scoop out the seeds. Place the squash halves cut-side-down in a baking dish. Roast until very soft and tender when poked with a fork, 30 to 45 min, depending on the size and variety of the squash. Meanwhile place the quinoa in a fine strainer and hold it under cold running water until the water runs clear, then drain well. Put it in a saucepan with the water and a pinch of salt. Bring to a rolling boil. Reduce the heat, cover, then simmer until the grains are translucent and the germ has spiraled out from each grain, about 15 minutes. Add a little more water if it looks too dry. Drain if there is too much water. Set aside. Heat the oil in a large pan over medium heat. Add the onion and sauté until it is softened, 2-3 min. Add the garlic and sauté with constant stirring , paying attention not to let it burn. Add the mushrooms and cook until colored, with occasional stirring . Add a pinch of salt. Reduce the heat, then in the cranberries, nuts, cooked quinoa, and lentils. Stir to combine. Add the spices then adjust the seasoning Remove the squash halves from the oven, leaving the oven on. Fill the halves with the quinoa mixture, pressing lightly to pack them full and mounding them slightly. Sprinkle yeast on top of each squash. Return to the oven to heat everything through, about 10 min. Serve hot. If you have some stuffing left over, you can serve it on the side in a bowl.', '[\"acorn squash, cut in half lengthwise\",\"quinoa\",\"olive oil\",\"onions, finely chopped\",\"garlic, minced\",\"button (white) mushrooms, thinly sliced\",\"dried cranberries\",\"walnuts, chopped\",\"lentils (canned), rinsed and drained\",\"cayenne pepper\",\"paprika\",\"ground pepper to taste\",\"[optional]\",\"salt\",\"[optional]\",\"nutritional yeast\"]', 'https://media.soscuisine.com/images/recettes/4407.jpg', 'https://www.soscuisine.com//recipe/vegan-stuffed-squash', 'The squash can be roasted and the filling made a day or two in advance. To serve, reheat the squash in a 175°C/350°F oven and the filling in a pan on the stove. Stuff the squash and return to the oven to finish.', '80 min', '360 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Copper, Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Potassium, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin B6, Zinc\",\"good_source_of\":\"Selenium, Vitamin C\",\"source_of\":\"Calcium, Vitamin A, Vitamin E, Vitamin K\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:10:54'),
(106, 106, 1, 'Vegan Sweet Potato Gratin', 'Preheat the oven to 205°C/400°F. Prepare the vegetables: Slice the onion into thin rounds; mince the garlic; peel the potatoes then cut them into thin slices, about 0,5 cm. Heat the oil in a pan over medium heat, then sauté the onion and garlic for about 7 min, until softened and fragrant. in the cinnamon, season with salt and pepper to taste. Remove from heat and set aside. food processor , blend the cashews, nutritional yeast and a few tablespoons of the coconut milk. Blend until smooth and creamy, about 3 min. Layer the ingredients in an oven proof dish in the following order: Sweet potatoes, onion mixture, cashew cream. Repeat until the gratin has been assembled. In a bowl, mix the remaining coconut milk with the soy milk and oregano, then pour over the gratin Cook in the middle of the oven until it is golden-coloured, about 30-35 min. For a nice crust, turn on the top broiler for the last 2 minutes. Let the gratin stand 10 min before cutting and serving it.', '[\"sweet potatoes, peeled and thinly sliced\",\"onions, thinly sliced\",\"garlic, minced\",\"canola oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"ground cinnamon\",\"cashews, raw, soaked overnight and drained\",\"nutritional yeast\",\"unsweetened coconut milk\",\"soy beverage, unsweetened, fortified\",\"dried oregano\"]', 'https://media.soscuisine.com/images/recettes/2476.jpg', 'https://www.soscuisine.com//recipe/vegan-sweet-potato-gratin', 'will be very useful to grind the cashews. Cashews need to be soaked 8 h, to form a creamy paste.', '45 min', '250 kcal', '{\"calories\":\"250\",\"fat\":\"13 g\",\"cholesterol\":\"0 mg\",\"protein\":\"10 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Magnesium, Manganese, Niacin, Potassium, Vitamin A, Vitamin B1, Vitamin B12, Vitamin B2\",\"good_source_of\":\"Copper, Fibre, Iron, Pantothenic Acid, Vitamin B6, Vitamin C, Vitamin E\",\"source_of\":\"Calcium, Phosphorus, Selenium, Vitamin D, Vitamin K, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:10:54');
INSERT INTO `recipe_translation` (`rt_id`, `rt_recipe_id`, `rt_lang_id`, `rt_recipe_name`, `rt_recipe_text`, `rt_recipe_ingredients_full`, `rt_recipe_image`, `rt_recipe_link`, `rt_recipe_prep`, `rt_recipe_duration`, `rt_recipe_calories`, `rt_recipe_nutrients`, `rt_recipe_claims`, `rt_created`) VALUES
(107, 107, 1, 'Vegetable Fritters', 'Preheat the oven to 205°C/400°F. Line one or more large baking sheets with parchment\r\npaper Prepare the vegetables : Coarsely grate the carrots, zucchini, and sweet potatoes; finely chop the green onions. Put all the vegetables in a bowl, then in the Parmesan cheese. Add the egg(s), Cayenne pepper , oil, a little salt, and pepper to taste. Mix well, then portion out the mixture onto the prepared baking sheet(s), forming rounds with a diameter of about 10 cm (about 4 per serving). Cook in the middle of the oven 12 min, then delicately turn over the fritters and continue to cook until they are golden-coloured, about 12 additional minutes. Serve.', '[\"parchment paper\",\"carrots, coarsely grated\",\"zucchini, coarsely grated\",\"sweet potatoes, coarsely grated\",\"green onions\\/scallions, finely chopped\",\"olive oil\",\"cayenne pepper\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"eggs size large\",\"Parmesan cheese, grated\"]', 'https://media.soscuisine.com/images/recettes/1161.jpg', 'https://www.soscuisine.com//recipe/vegetable-fritters', 'The quantities given here are based on this recipe served as a starter. If serving as a side dish, divide the quantities by two.', '35 min', '230 kcal', '{\"calories\":\"230\",\"fat\":\"11 g\",\"cholesterol\":\"110 mg\",\"protein\":\"11 g\"}', '{\"diet-related_health_claims\":\"Bone-healthy\",\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Manganese, Potassium, Vitamin A, Vitamin K\",\"good_source_of\":\"Calcium, Fibre, Magnesium, Niacin, Pantothenic Acid, Phosphorus, Selenium, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin C, Vitamin E\",\"source_of\":\"Copper, Iron, Vitamin B1, Vitamin D, Zinc\"}', '2021-06-18 14:10:55'),
(110, 110, 1, 'Chinese-Style Chicken with Snow Peas', 'Slice the chicken breast into strips ½ to 1 cm wide and about 5 cm long. Mix with the soy sauce, cornstarch, sugar, and 2-3 slices of ginger. Chill for at least an hour in the refrigerator. Preheat the oven to the lowest setting. Prepare the vegetables . Coarsely chop the onion, thinly slice the pepper, and mince or press the garlic. Keep the snow peas whole. Cut 2-3 more slices of ginger. Heat ½ to 1 tablespoon of oil in a frying-pan or . Add the garlic, onion, and bell pepper, cook 2-3 min until they start to soften, then set aside on the warmed serving plate in the oven. Turn up the heat and add ½ to 1 tablespoon of oil. First add some salt, then immediately add the snow peas. constantly for 2-3 min since they cook very quickly (the colour should stay dark green). Put the snow peas on the plate with the other vegetables. Keep the plate warm. In the same , add the remaining oil and the marinated chicken. Reserve the remaining marinade. constantly over medium heat 7-8 min until the meat is almost cooked. Then put the vegetables back into the , add the new slices of ginger plus the reserved marinade. Cook another 2 min. Add salt and pepper to taste then serve.', '[\"chicken breasts, boneless, skinless, cut into 1x5 cm strips\",\"snow peas\",\"green peppers, cut into thin strips\",\"onions, coarsely chopped\",\"garlic, minced or pressed\",\"cornstarch\",\"soy sauce\",\"sugar\",\"gingerroot, cut into thin slices\",\"canola oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1876.jpg', 'https://www.soscuisine.com//recipe/chinese-style-chicken-snow-peas-alcohol-free', '', '25 min', '310 kcal', '{\"calories\":\"310\",\"fat\":\"14 g\",\"cholesterol\":\"60 mg\",\"protein\":\"26 g\"}', '{\"excellent_source_of\":\"Niacin, Vitamin B6, Vitamin C, Vitamin K\",\"good_source_of\":\"Folacin, Iron, Magnesium, Pantothenic Acid, Phosphorus, Potassium, Vitamin E\",\"source_of\":\"Calcium, Copper, Fibre, Manganese, Omega-3, Vitamin A, Vitamin B1, Vitamin B12, Vitamin B2, Zinc\",\"low\":\"Calories, Saturated Fat, Sodium\"}', '2021-06-18 14:10:58'),
(111, 111, 1, 'Veggie Pasta Sauce', 'Finely chop the garlic, mushrooms, basil, leek, onion and zucchini. Keep them separate, since you will need to add them to the pot at different times. Heat the oil in a saucepan over low heat. Add the mushrooms. Cook 4-5 min, stirring often, until browned.  Add the onion, leeks and garlic and cook for another 3-4 minutes until translucent. Then add the zucchini and red pepper and cook for another 3-4 minutes until soft. Add the crushed tomatoes, sugar, optional hot sauce, and oregano.  Cook 5 min with frequent stirring . If in a hurry, cooking can be stopped here and the sauce puréed at this point. For improved taste, cover and simmer for about 45 min. Blend sauce in a blender with the basil until puréed.', '[\"canned tomatoes (diced)\",\"sugar, or brown sugar\",\"garlic, finely chopped\",\"button (white) mushrooms, finely chopped\",\"leeks\",\"red onions, diced\",\"zucchini\",\"yellow or red sweet peppers\",\"dried oregano\",\"olive oil\",\"sriracha (hot chili sauce)\",\"[optional]\",\"fresh basil, finely chopped\"]', 'https://media.soscuisine.com/images/recettes/3499.jpg', 'https://www.soscuisine.com//recipe/veggie-pasta-sauce', 'will be very useful to purée the sauce.', '75 min', '570 kcal', '{\"calories\":\"30\",\"fat\":\"1 g\",\"cholesterol\":\"0 mg\",\"protein\":\"1 g\"}', '{\"low\":\"Calories, Sodium\",\"free\":\"Cholesterol, Fat, Saturated Fat, Trans Fat\"}', '2021-06-18 14:10:59'),
(112, 112, 1, 'Veggie PÃÂ¢tÃÂ©', 'Preheat the oven to 180°C/350°F. Grease a loaf pan. Heat the oil in a pan over medium heat. Add the onion and garlic, the sauté until softened. Stir in the sunflower seeds, walnuts and cumin. Cook for 1-2 min. Add the chickpeas and soy sauce then cook an additional 2-3 min. Transfer to the prepared loaf pan. Cover with the cheese then cook in the middle of the oven for 30 min. Remove from the oven and let cool for at least 10 min. Put the mixture in a food processor and purée. Put into air-tight container(s), then refrigerate.', '[\"canola oil\",\"onions, finely chopped\",\"garlic, chopped\",\"sunflower seeds\",\"walnuts, coarsely chopped\",\"ground cumin\",\"chickpeas\\/garbanzo beans (canned), rinsed and drained\",\"soy sauce\",\"Cheddar cheese, grated\"]', 'https://media.soscuisine.com/images/recettes/4239.jpg', 'https://www.soscuisine.com//recipe/veggie-pate', 'will be very useful.', '50 min', '110 kcal', '{\"calories\":\"110\",\"fat\":\"7 g\",\"cholesterol\":\"10 mg\",\"protein\":\"4 g\"}', '{\"free\":\"Added Sugar\",\"good_source_of\":\"Manganese\",\"source_of\":\"Calcium, Copper, Folacin, Iron, Magnesium, Niacin, Omega-3, Omega-6, Phosphorus, Selenium, Vitamin B1, Vitamin B6, Vitamin E, Zinc\"}', '2021-06-18 14:10:59'),
(113, 113, 1, 'Vichyssoise', 'Prepare the vegetables : finely chop the leeks and onions; peel the potatoes then cut them into 1 cm pieces. Heat the butter and oil in a saucepan. Add the chopped onions and leeks, cover, and cook over low heat about 10 min until softened. Add the potatoes, , salt and pepper. Simmer , covered, about 25-30 min until the potatoes are softened. Purée the soup in a blender food processor . Pour in the milk then mix well. Cover and chill thoroughly (about 2 hours). Garnish each bowl with minced chives, then serve.', '[\"leeks, finely chopped\",\"onions, finely chopped\",\"potatoes, cut into 1 cm pieces\",\"butter, unsalted\",\"canola oil\",\"chicken broth\",\"milk, partly skimmed, 2%\",\"chives, fresh\",\"[optional]\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/77.jpg', 'https://www.soscuisine.com//recipe/vichyssoise', 'will be very useful to purée the soup.', '55 min', '290 kcal', '{\"calories\":\"290\",\"fat\":\"6 g\",\"cholesterol\":\"10 mg\",\"protein\":\"8 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Fibre, Folacin, Magnesium, Manganese, Potassium, Vitamin A, Vitamin B6, Vitamin C, Vitamin K\",\"good_source_of\":\"Calcium, Copper, Iron, Niacin, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin B12, Vitamin E\",\"source_of\":\"Selenium, Vitamin B2, Vitamin D, Zinc\"}', '2021-06-18 14:11:00'),
(114, 114, 1, 'Walnut Oatmeal with raisins', 'Put the oats and milk in a saucepan. Bring it all to a boil, stirring, then remove from heat, cover and let sit for about 5 or 7 min, so that there will be some \'chew\' to it. Alternatively, cook in the microwave 2 min, making sure not to let it boil over. Mix in the yogourt, to give the oats a creamy texture and serve with toppings.', '[\"rolled oats\",\"milk, partly skimmed, 2%\",\"Greek yogurt, plain, 2% M.F.\",\"walnuts\",\"flax seeds, ground\",\"brown sugar\",\"ground cinnamon\",\"raisins\"]', 'https://media.soscuisine.com/images/recettes/3265.jpg', 'https://www.soscuisine.com//recipe/walnut-oatmeal-raisins', '', '15 min', '590 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Bone-healthy, Bone-healthy, Heart-healthy\",\"excellent_source_of\":\"Calcium, Fibre, Folacin, Iron, Magnesium, Manganese, Phosphorus, Potassium, Selenium, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin D\",\"good_source_of\":\"Copper, Niacin, Pantothenic Acid, Vitamin A, Vitamin B6, Zinc\",\"source_of\":\"Omega-3\",\"low\":\"Cholesterol, Saturated Fat, Sodium\"}', '2021-06-18 14:11:00'),
(115, 115, 1, 'Warm Broccoli Rabe Salad', 'Prepare the broccoli rabe : remove any tough portions of the stalks and wash well. Blanch in a pot with plenty of salted water until al dente , about 3 min. Meanwhile, pour the oil and lemon juice into a salad bowl, then , using a fork, until the vinaigrette is emulsified. Drain the broccoli rabe, then transfer it to the bowl. well, then serve.', '[\"broccoli rabe\",\"extra virgin olive oil\",\"lemon juice, freshly squeezed\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/857.jpg', 'https://www.soscuisine.com//recipe/warm-broccoli-rabe-salad', '', '10 min', '130 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Folacin, Vitamin A, Vitamin C, Vitamin E, Vitamin K\",\"good_source_of\":\"Manganese, Potassium, Vitamin B1\",\"source_of\":\"Calcium, Fibre, Iron, Magnesium, Niacin, Pantothenic Acid, Phosphorus, Vitamin B2, Vitamin B6, Zinc\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:11:01'),
(116, 116, 1, 'Warm Cauliflower Salad', 'Prepare the cauliflower : Cut it into equal-size florets, then blanch them in a pot of salted boiling water until they are crisp-tender, about 5-6 min. Pour the oil and lemon juice into a salad bowl, then , using a fork, until the vinaigrette is emulsified. Drain the cauliflower, then transfer it to the bowl. well, then serve.', '[\"cauliflower, cut into florets\",\"extra virgin olive oil\",\"lemon juice, freshly squeezed\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/834.jpg', 'https://www.soscuisine.com//recipe/warm-cauliflower-salad', '', '15 min', '140 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Fibre, Folacin, Vitamin C, Vitamin K\",\"good_source_of\":\"Manganese, Pantothenic Acid, Vitamin B6, Vitamin E\",\"source_of\":\"Iron, Magnesium, Niacin, Phosphorus, Potassium, Vitamin B1, Vitamin B2\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:11:02'),
(117, 117, 1, 'Chutney Chicken', 'Preheat the oven to 190°C/375°F. In a bowl, combine the yogurt, mustard, chutney, and cayenne pepper Butterfly the chicken breasts by splitting the thickness in half with a cut starting on one side and slicing to almost, but not completely through to the other side.  Lay the chicken breasts in an ovenproof dish, then spread he mixture over the top. Bake, uncovered, in the upper third of the oven for about 25 min, until the chicken is cooked and lightly coloured. Serve on the warmed plates.', '[\"yogurt, plain, 2%\",\"Dijon mustard\",\"mango chutney\",\"cayenne pepper\",\"chicken breasts, boneless, skinless, butterflied\"]', 'https://media.soscuisine.com/images/recettes/2548.jpg', 'https://www.soscuisine.com//recipe/chutney-chicken', 'Keep the serving plates warm on the stove while you\'re preparing the dish.', '30 min', '240 kcal', '{\"calories\":\"240\",\"fat\":\"3 g\",\"cholesterol\":\"90 mg\",\"protein\":\"36 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Niacin, Phosphorus, Vitamin B12, Vitamin B6\",\"good_source_of\":\"Pantothenic Acid, Potassium\",\"source_of\":\"Calcium, Iron, Magnesium, Vitamin B1, Vitamin B2, Zinc\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:11:02'),
(118, 118, 1, 'Watercress and Orange Salad', 'In a small bowl, soak the thinly sliced onion in water with few drops of vinegar for about 1/2 h. You can also leave it overnight in the refrigerator. This makes the raw onion easier to digest and crispier. Wash, rinse, and dry the orange, then remove the with a grater and put it in a small bowl. Pour in the oil, vinegar, and mustard, then well until the vinaigrette is emulsified. Add salt and pepper and set aside. Rinse and spin-dry the watercress, then arrange the leaves on the serving plates. Drain and add the presoaked onion. Using a small sharp knife, cut off the peel and white pith from the orange(s), then cut between the membranes to separate the segments and place them on the plates. Drizzle the vinaigrette over the salad, garnish with the pink peppercorns (optional) then serve.', '[\"watercress, rinsed and spin-dried\",\"red onions, thinly sliced\",\"oranges\",\"extra virgin olive oil\",\"white vinegar\",\"Dijon mustard\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"pink peppercorns\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/153.jpg', 'https://www.soscuisine.com//recipe/watercress-orange-salad', '', '10 min', '180 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Vitamin A, Vitamin C, Vitamin E, Vitamin K\",\"good_source_of\":\"Potassium\",\"source_of\":\"Calcium, Folacin, Magnesium, Manganese, Pantothenic Acid, Vitamin B1, Vitamin B2, Vitamin B6\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:11:03'),
(119, 119, 1, 'Watercress Soup', 'Rinse the watercress carefully, without soaking it, to remove any sand. Chop most of it reserving some leaves with some stems for decoration. Prepare the onions and potatoes . Coarsely chop the onions; peel and dice the potatoes into 1 cm cubes. Melt the butter in a saucepan over medium heat. Add the chopped onions and sauté 3 min, then add the diced potatoes and watercress. Continue to cook for about 4 min, with gentle stirring . Add the and milk, bring to a boil, then lower the heat. Cover and simmer about 15 min, until the vegetables are soft. Purée in a blender until smooth. Adjust the seasoning Garnish with the reserved watercress leaves, then serve.', '[\"watercress\",\"onions, coarsely chopped\",\"potatoes, peeled and cut into small pieces\",\"butter, unsalted\",\"chicken broth\",\"milk, partly skimmed, 2%\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/215.jpg', 'https://www.soscuisine.com//recipe/watercress-soup', 'will be very useful to purée the soup.', '30 min', '150 kcal', '{\"calories\":\"150\",\"fat\":\"5 g\",\"cholesterol\":\"10 mg\",\"protein\":\"5 g\"}', '{\"diet-related_health_claims\":\"Bone-healthy\",\"free\":\"Added Sugar\",\"excellent_source_of\":\"Vitamin A, Vitamin K\",\"good_source_of\":\"Calcium, Potassium, Vitamin B12, Vitamin B6, Vitamin C, Vitamin D\",\"source_of\":\"Copper, Folacin, Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Selenium, Vitamin B1, Vitamin B2, Zinc\"}', '2021-06-18 14:11:04'),
(120, 120, 1, 'Watercress, Fig, and Orange Salad', 'Rinse and spin-dry the watercress, then arrange the leaves on the serving plates. Peel the oranges with a sharp knife, removing all the white pith from the flesh and saving the juice, if any. Cut the oranges into 7 mm-thick rounds and arrange them on the individual plates, on top of the watercress. In a small bowl, mix the extra virgin olive oil, reserved orange juice, lemon juice, salt, and pepper. well\r\nusing a fork until the vinaigrette is emulsified. Pour it over the plates. Garnish each plate with walnuts (optional) and chopped figs, then serve.', '[\"watercress, rinsed and spin-dry\",\"oranges, cut into rounds\",\"extra virgin olive oil\",\"lemon juice, freshly squeezed\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"walnuts\",\"[optional]\",\"dried figs, chopped\"]', 'https://media.soscuisine.com/images/recettes/282.jpg', 'https://www.soscuisine.com//recipe/watercress-fig-orange-salad', '', '10 min', '180 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Vitamin A, Vitamin C, Vitamin K\",\"good_source_of\":\"Potassium, Vitamin E\",\"source_of\":\"Calcium, Copper, Fibre, Folacin, Magnesium, Manganese, Pantothenic Acid, Vitamin B1, Vitamin B2, Vitamin B6\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:11:05'),
(121, 121, 1, 'Watermelon-flavoured Sport-Gel', 'Cut the water melon into bite-size pieces. blender , transfer the watermelon and run until a runny puree forms. Filter the mixture through a fine strained to extract only the juice. Put sugar, watermelon juice, agar-agar, and salt in a pot. Bring to a boil on medium-high heat, whisking from time to time. Pour the liquid mixture into a pan or bowl and let sit in the fridge for 2 h, or until gelled. Transfer the mixture to snacks pouches and keep in the fridge until ready to use.', '[\"watermelon, cubed\",\"sugar\",\"agar agar (powder)\",\"salt\"]', 'https://media.soscuisine.com/images/recettes/3638.jpg', 'https://www.soscuisine.com//recipe/watermelon-sport-gel', 'will be very useful to juice the watermelon.', '20 min', '120 kcal', '{\"calories\":\"120\",\"fat\":\"0 g\",\"cholesterol\":\"0 mg\",\"protein\":\"1 g\"}', '{\"excellent_source_of\":\"Vitamin A\",\"source_of\":\"Folacin, Iron, Magnesium, Manganese, Pantothenic Acid, Potassium, Vitamin C\",\"low\":\"Calories, Sodium\",\"free\":\"Cholesterol, Fat, Saturated Fat, Trans Fat\"}', '2021-06-18 14:11:06'),
(122, 122, 1, 'Whipped Coconut Milk', 'Put a bowl in the freezer for about 5 min. Meanwhile, remove the coconut milk can from the refrigerator and place it upside down to ease to extraction of the milk from the top. Open the can then pour the milk into a glass jar with lid to be kept in the refrigerator or freezer for future use in other recipes. Place the fat in the cooled bowl. Using an electric , whisk the coconut faut until creamy and light, about 2 min. Add the vanilla and, if desired, the sweetener of your choice, then whisk to combine.', '[\"unsweetened coconut milk\",\"vanilla extract\"]', 'https://media.soscuisine.com/images/recettes/2349.jpg', 'https://www.soscuisine.com//recipe/whipped-coconut-cream', '', '10 min', '80 kcal', '{\"calories\":\"80\",\"fat\":\"8 g\",\"cholesterol\":\"0 mg\",\"protein\":\"1 g\"}', '{\"free\":\"Added Sugar\",\"good_source_of\":\"Manganese\",\"source_of\":\"Magnesium\",\"low\":\"Sodium\"}', '2021-06-18 14:11:06'),
(123, 123, 1, 'Asparagus Risotto', 'Finely chop the onion. Clean the asparagus then cut it into small pieces (about 1 cm). Heat the in a small saucepan on the stove or in a microwave oven. Keep it warm while cooking the risotto (about 20 min). Heat the butter and oil in a large skillet or saucepan. Sauté the onion 2-3 min, until it becomes translucent. Add the rice and asparagus. Cook 1-2 min, with constant stirring , until the rice grains are well toasted and translucent. Cook the risotto , using the warmed until the rice is creamy but still al dente . Remove from the heat and let stand for 2 min. Season with salt (not much if the is salty) and pepper to taste. Sprinkle with grated Parmesan\r\ncheese, then serve.', '[\"onions, finely chopped\",\"asparagus, average size, cut into 1 cm pieces\",\"chicken broth\",\"butter, unsalted\",\"olive oil\",\"arborio rice\",\"Parmesan cheese, grated\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/146.jpg', 'https://www.soscuisine.com//recipe/asparagus-risotto', '.', '30 min', '390 kcal', '{\"calories\":\"390\",\"fat\":\"10 g\",\"cholesterol\":\"10 mg\",\"protein\":\"9 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Vitamin K\",\"good_source_of\":\"Copper, Iron, Potassium, Selenium, Vitamin B1, Vitamin E, Zinc\",\"source_of\":\"Calcium, Fibre, Magnesium, Manganese, Niacin, Phosphorus, Vitamin A, Vitamin B2, Vitamin B6, Vitamin C\",\"low\":\"Sodium\"}', '2021-06-18 14:11:07'),
(124, 124, 1, 'Cinzia\'s Shepherd\'s Pie', 'Preheat the oven to 205°C/400°F. Prepare the vegetables : finely chop the onion; thinly slice the mushrooms; peel the potatoes, cut them in half then them 20-25 min until very tender. Drain them well and set aside. Heat the oil in a pan over medium-high heat. Add the ground meat and it until it looses its red colour, about 4-5 min, then break it up with a fork. In order to the meat, it is important not to it at the beginning, otherwise it will release its juices and will «boil» rather than When the meat is golden-coloured, add the chopped onion then cook 2 min with stirring in the diced tomatoes, mushrooms, tomato paste, Worcestershire sauce, and . Add the frozen peas and continue cooking until heated through, about 4-5 min. Add salt and pepper. Remove the pan from the heat and transfer the contents to one large baking dish, or distribute it into individual baking dishes. Pour the milk into a large microwave-safe bowl. Add the butter and microwave on medium-high a few minutes, uncovered, until very hot. Add the cooked potatoes and mash the mixture until it is creamy. Add salt and pepper to taste. Place a spoonful of the potato mixture on top of the beef mixture, then gently spread it with a spoon to cover evenly. Bake in the middle of the oven until the top is golden-brown, about 30 min. Serve.', '[\"potatoes, peeled then halved\",\"onions, finely chopped\",\"button (white) mushrooms, thinly sliced\",\"olive oil\",\"ground beef, extra-lean, or lean\",\"canned tomatoes (diced)\",\"tomato paste\",\"Worcestershire sauce\",\"beef broth\",\"frozen peas\",\"milk, partly skimmed, 2%\",\"butter, unsalted\",\"ground pepper to taste\",\"[optional]\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/233.jpg', 'https://www.soscuisine.com//recipe/cinzia-shepherd-pie', 'For individual pies, choose baking dishes which contain about 375 ml or 1 ½ cups when 3/4 full.', '55 min', '380 kcal', '{\"calories\":\"380\",\"fat\":\"14 g\",\"cholesterol\":\"60 mg\",\"protein\":\"24 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Copper, Magnesium, Niacin, Pantothenic Acid, Phosphorus, Potassium, Vitamin A, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin B6, Zinc\",\"good_source_of\":\"Fibre, Folacin, Iron, Manganese, Selenium, Vitamin C\",\"source_of\":\"Calcium, Vitamin D, Vitamin E, Vitamin K\"}', '2021-06-18 14:11:08'),
(125, 125, 1, 'Winter Salad with Creamy Dressing', 'Prepare the vegetables : Thinly slice the cabbage, celery and green onions. Peel and grate the carrots. Put all the vegetables in a bowl with the celery seeds then toss well. In another bowl, mix the dressing ingredients with a whisk then pour over the salad. Refrigerate for at least 4 hours before serving.', '[\"green cabbage, minced\",\"carrots, grated\",\"celery, finely minced\",\"green onions\\/scallions, minced\",\"celery seeds\",\"mayonnaise\",\"apple cider vinegar\",\"Tabasco sauce\",\"salt\",\"ground pepper\"]', 'https://media.soscuisine.com/images/recettes/4227.jpg', 'https://www.soscuisine.com//recipe/wonter-salad-creamy-dressing', '', '15 min', '170 kcal', '{\"calories\":\"170\",\"fat\":\"16 g\",\"cholesterol\":\"10 mg\",\"protein\":\"2 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Vitamin K\",\"good_source_of\":\"Vitamin A, Vitamin B6, Vitamin C\",\"source_of\":\"Calcium, Fibre, Iron, Magnesium, Manganese, Omega-3, Omega-6, Potassium, Vitamin E\"}', '2021-06-18 14:11:09'),
(126, 126, 1, 'Winter Vegetable Soup', 'Prepare the vegetables : Peel the potatoes, parsnip, carrots, and turnips. Coarsely cut all the vegetables into uniform 3 cm pieces. Heat the oil in a saucepan over medium heat. Add all the vegetables and cook over medium heat for about 10 min with occasional stirring. Season with salt, pepper, and a pinch of Cayenne pepper , if desired. Pour in the warm and water. Cook, uncovered, until the potatoes are cooked and fork-tender, about 20 min. Purée the soup in a blender Adjust the seasoning . Add the milk, then warm up and serve.', '[\"potatoes, coarsely cut into 3 cm pieces\",\"parsnips, coarsely cut into 3 cm pieces\",\"carrots, coarsely chopped into 3 cm pieces\",\"turnips, coarsely cut into 3 cm pieces\",\"celery, coarsely chopped into 3 cm pieces\",\"onions, coarsely cut into 3 cm pieces\",\"leeks, coarsely cut into 3 cm pieces\",\"olive oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"cayenne pepper\",\"[optional]\",\"chicken broth, warm\",\"water, warm\",\"milk, partly skimmed, 2%\"]', 'https://media.soscuisine.com/images/recettes/1260.jpg', 'https://www.soscuisine.com//recipe/winter-vegetable-soup', 'will be very useful to purée the soup.', '40 min', '160 kcal', '{\"calories\":\"160\",\"fat\":\"4 g\",\"cholesterol\":\"0 mg\",\"protein\":\"4 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Folacin, Potassium, Vitamin A, Vitamin K\",\"good_source_of\":\"Fibre, Magnesium, Manganese, Vitamin B6, Vitamin C\",\"source_of\":\"Calcium, Copper, Iron, Niacin, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin D, Vitamin E, Zinc\",\"low\":\"Cholesterol, Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:11:09'),
(127, 127, 1, 'Zucchini Noodles', 'Spiralize the zucchini and set aside. Heat the oil in a pan over medium-high heat. Add the zucchini and cook 2-3 min, until softened. Sprinkle with Parmesan cheese and serve.', '[\"olive oil\",\"zucchini, spiralized\",\"Parmesan cheese\"]', 'https://media.soscuisine.com/images/recettes/4185.jpg', 'https://www.soscuisine.com//recipe/zucchini-noodles', '', '20 min', '90 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"good_source_of\":\"Folacin, Vitamin A, Vitamin C\",\"source_of\":\"Magnesium, Manganese, Phosphorus, Potassium, Vitamin B2, Vitamin B6, Vitamin E, Vitamin K\",\"low\":\"Cholesterol, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:11:10'),
(128, 128, 1, 'Clam Chowder... with mussels!', 'Prepare the potatoes , with the skin on, boil or steam about 12 min, without overcooking, since they will continue to cook in another step. Peel the potatoes then cut them into ½ cm thick slices.', '[\"paper towels\",\"mussels\",\"potatoes\",\"onions, finely chopped\",\"olive oil\",\"butter, unsalted\",\"milk, partly skimmed, 2%\",\"white flour (all purpose)\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/454.jpg', 'https://www.soscuisine.com//recipe/clam-chowder-mussels-pesco-vegetarian', '', '40 min', '350 kcal', '{\"calories\":\"350\",\"fat\":\"13 g\",\"cholesterol\":\"60 mg\",\"protein\":\"21 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Iron, Manganese, Niacin, Phosphorus, Potassium, Selenium, Vitamin B1, Vitamin B12, Vitamin B2, Zinc\",\"good_source_of\":\"Copper, Magnesium, Pantothenic Acid, Vitamin B6, Vitamin C, Vitamin D\",\"source_of\":\"Calcium, Fibre, Omega-3, Vitamin A, Vitamin E\"}', '2021-06-18 14:11:10'),
(129, 129, 1, 'Coconut-flavoured Chicken and Shrimp Soup', 'Pour the and water into a saucepan. Add the fish sauce, coconut milk, zest and lime juice, then bring to a boil. Add the bok choy and chili pepper . Set aside over low heat. Meanwhile, cook the rice sticks for about 4 min in a large pot of salted boiling water. Drain in a colander , then rinse and drain again. Set aside. Heat the oil in a pan over medium-high heat. Add the chicken strips, then sauté 1 min per side. Add the shrimp and curry powder. Sauté with stirring until the shrimp turn pink in colour, 3-4 min. Season with salt and pepper. Portion out the rice sticks, meat, and shrimp into individual serving bowls. Pour in the broth, then add the grated carrots and chopped green onions. Serve.', '[\"chicken broth\",\"water\",\"fish sauce (nam pla)\",\"unsweetened coconut milk\",\"limes, juice and zest\",\"small bok choy\",\"dried chili peppers, minced\",\"rice sticks (noodles)\",\"canola oil\",\"chicken strips\",\"shrimp, medium-large, peeled\",\"curry powder\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"carrots, finely grated\",\"green onions\\/scallions, chopped\"]', 'https://media.soscuisine.com/images/recettes/1106.jpg', 'https://www.soscuisine.com//recipe/coconut-flavoured-chicken-shrimp-soup', 'Individual 500 ml (2 cups) serving bowls are needed.', '20 min', '410 kcal', '{\"calories\":\"410\",\"fat\":\"16 g\",\"cholesterol\":\"80 mg\",\"protein\":\"21 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Iron, Magnesium, Manganese, Niacin, Potassium, Selenium, Vitamin A, Vitamin B12, Vitamin B6, Vitamin C, Vitamin K\",\"good_source_of\":\"Calcium, Fibre, Phosphorus, Vitamin E, Zinc\",\"source_of\":\"Copper, Pantothenic Acid, Vitamin B1, Vitamin B2\"}', '2021-06-18 14:11:11'),
(130, 130, 1, 'Cod with Mushrooms and Celeriac', 'Preheat the oven to 205°C/400°F. Lightly oil a roasting pan. Prepare the celeriac and mushrooms . Cut the mushrooms into 4-5 mm slices and set aside. Peel the\r\nceleriac and cut into 7 mm slices. 5-7 min until softer but not fully cooked, then transfer into the centre of the prepared roasting pan. Set aside. Heat the oil in a frying pan, over medium heat. Add the minced or pressed garlic and sauté 1 min, with stirring , then add the cod fillet and 2 min on each side. Place over the celeriac slices in the roasting pan. Put the frying pan back on the heat, and add the parsley and garlic base . Add the sliced mushrooms and sauté 5 min over medium heat. Transfer them into the roasting pan around the fish, then add the diced tomatoes. Pour in the water, then add salt and pepper, followed by a topping of bread crumbs. Place the roasting pan in the middle of the oven. Bake 12-15 min for a 2 to 3 cm thick fillet. Since the cooking time depends on the thickness of the\r\nfillet and the actual temperature of your oven, it is important to check with a fork to see if it is cooked through Serve on the warmed plates. Sprinkle with the cooking liquid.', '[\"olive oil, plus some for the roasting pan\",\"celeriac, sliced\",\"button (white) mushrooms, sliced\",\"garlic, minced or pressed\",\"cod fillet, or hake\",\"Parsley and Garlic Base\",\"canned tomatoes (diced)\",\"water\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"bread crumbs\"]', 'https://media.soscuisine.com/images/recettes/372.jpg', 'https://www.soscuisine.com//recipe/cod-mushrooms-celeriac-alcohol-free', 'Keep the serving plates warm on the stove while you\'re preparing the dish.', '40 min', '330 kcal', '{\"calories\":\"330\",\"fat\":\"14 g\",\"cholesterol\":\"90 mg\",\"protein\":\"38 g\"}', '{\"excellent_source_of\":\"Magnesium, Niacin, Phosphorus, Potassium, Selenium, Vitamin B12, Vitamin B6, Vitamin E, Vitamin K\",\"good_source_of\":\"Vitamin B1, Vitamin B2, Vitamin D, Zinc\",\"source_of\":\"Calcium, Copper, Folacin, Iron, Manganese, Pantothenic Acid, Vitamin A, Vitamin C\",\"low\":\"Calories, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:11:11'),
(131, 131, 1, 'Cod with Olives and Fennel', 'Preheat the oven to 230°C/450°F. Prepare the vegetables : finely chop the onions, trim the stalk and feathery leaves from the fennel bulbs, discard any tough outer layers, then cut into quarters. Set aside. Heat one tablespoon of oil in a skillet over medium heat. Add the onions and 2-3 min with stirring . Add a little salt. As soon as the onions are soft, transfer them to a lightly oiled ovenproof dish. Pat-dry the cod fillet and cut it into serving sized pieces. Spread the olive paste on the pieces and place them in the dish on top of the onion, taking care to cover the onion well to prevent it from burning in the oven. Pour the remaining oil and the lemon juice over the fish. Bake in the middle of the oven between 12 and 15 min. The exact time depends on the fillet thickness and the actual temperature of the oven. Check\r\nwith a fork to see if the fish is cooked through While the fish is cooking, fill a pot with salted water and add the fennel quarters. Bring to a boil. Cook 5-6 min, until the fennel is soft but still al dente . Drain thoroughly, then slice each quarter in half and place them on the individual serving plates. Transfer the cod to the plates next to the fennel. Add pepper to taste and drizzle with extra virgin olive oil and lemon juice, if desired. Serve.', '[\"onions, finely chopped\",\"fennels, cut into quarters\",\"olive oil\",\"salt\",\"[optional]\",\"olive paste\",\"cod fillet, or hake\",\"lemon juice, freshly squeezed\",\"ground pepper to taste\",\"[optional]\",\"extra virgin olive oil\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/490.jpg', 'https://www.soscuisine.com//recipe/cod-olives-fennel', 'Keep the serving plates warm on the stove while you\'re preparing the dish.', '25 min', '330 kcal', '{\"calories\":\"330\",\"fat\":\"12 g\",\"cholesterol\":\"90 mg\",\"protein\":\"38 g\"}', '{\"excellent_source_of\":\"Folacin, Magnesium, Niacin, Phosphorus, Potassium, Selenium, Vitamin B12, Vitamin B6, Vitamin E\",\"good_source_of\":\"Fibre, Manganese, Vitamin B1, Vitamin C, Vitamin D\",\"source_of\":\"Calcium, Copper, Iron, Pantothenic Acid, Vitamin B2, Vitamin K, Zinc\",\"low\":\"Calories, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:11:12'),
(132, 132, 1, 'Country Style Soup with Spelt', 'Rinse and drain the legume mix and spelt, then set aside. Prepare the vegetables : Finely chop the onion and mince or the garlic. In a pot, the onion and garlic in the oil over medium heat until softened, about 4 min. Add the legume mix and spelt.  Add the tomatoes, , water, and oregano Bring to a boil, reduce the heat, cover and simmer for about 35 min or until the legumes and spelt are cooked. If the soup is too thick, it may be thinned with some or water. Adjust the seasoning and serve.', '[\"canola oil\",\"onions, finely chopped\",\"garlic, pressed or minced\",\"spelt berries\",\"dry legume mix\",\"canned tomatoes (diced)\",\"chicken broth\",\"water\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"dried oregano\"]', 'https://media.soscuisine.com/images/recettes/2494.jpg', 'https://www.soscuisine.com//recipe/country-style-soup-spelt', '', '40 min', '320 kcal', '{\"calories\":\"320\",\"fat\":\"3 g\",\"cholesterol\":\"0 mg\",\"protein\":\"18 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Copper, Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Zinc\",\"good_source_of\":\"Selenium, Vitamin B1, Vitamin B6\",\"source_of\":\"Calcium, Pantothenic Acid, Vitamin A, Vitamin B2, Vitamin C, Vitamin E, Vitamin K\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:11:13'),
(133, 133, 1, 'Country-Style Vegetable Soup', 'Rinse and drain the legume mix, then set aside. Prepare the vegetables : Finely chop the onion and mince or the garlic. In a pot, the onion and garlic in the oil over medium heat until softened, about 4 min. Add the legume mix, mustard, cayenne pepper oregano . Cook 1 min \r\nwith stirring . Add the tomatoes, frozen vegetables, and water. Bring to a boil, reduce the heat, cover and simmer for about 35 min or until the legumes are cooked. Adjust the seasoning and serve.', '[\"canola oil\",\"onions, finely chopped\",\"garlic, pressed or minced\",\"dry legume mix\",\"mustard powder\",\"cayenne pepper\",\"dried oregano\",\"canned tomatoes (diced)\",\"frozen vegetable mix\",\"chicken broth\",\"water\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2495.jpg', 'https://www.soscuisine.com//recipe/country-style-vegetable-soup', '', '40 min', '210 kcal', '{\"calories\":\"210\",\"fat\":\"3 g\",\"cholesterol\":\"0 mg\",\"protein\":\"14 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Fibre, Folacin, Iron, Magnesium, Manganese, Phosphorus, Potassium, Vitamin A\",\"good_source_of\":\"Copper, Niacin, Vitamin B1, Vitamin B6, Zinc\",\"source_of\":\"Calcium, Pantothenic Acid, Selenium, Vitamin B2, Vitamin C, Vitamin E, Vitamin K\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:11:13'),
(134, 134, 1, 'Athlete Meatballs', 'Prepare the vegetables : Finely chop the onion, garlic, carrot, and celery. Heat the olive oil in a pan over medium heat. Add the chopped vegetables then sauté until softened and translucent, about 3 min. in the oregano and chili pepper , then cook an additional minute, with stirring Layer about half of the cooked vegetables in the bottom of the ceramic cooking pot. Transfer the remaining vegetables to the food processor , then pulse a few minutes until the a puree is obtained. Transfer the pureed vegetables to a bowl. Chill a few minutes to cool slightly. Add the beef, bread crumbs, beaten egg, grated cheese, and salt to the bowl with the pureed vegetables. Add pepper to taste then mix well. Scooping about 2 tablespoons of the mixture at a time into your hands, make the meatballs (3 per serving). Pour half of the tomato sauce into the bottom of the ceramic cooking pot, along with the water. Combine well with the vegetables. Place the meatballs on top in a single layer. Pour on the rest of the tomato sauce . Cover the slow cooker with the lid and cook on \'low\' for 4 h. A few minutes before the end of the cooking time for the meatballs, Cook the pasta Put the drained fettuccine immediately back in the pasta cooking pot with the extra virgin olive oil. Mix well then serve with the meatballs and sauce.', '[\"olive oil\",\"onions, chopped\",\"garlic, chopped\",\"carrots, chopped\",\"celery, chopped\",\"dried oregano\",\"dried chili peppers, minced\",\"ground beef, extra-lean\",\"bread, whole wheat, processed into bread crumbs\",\"eggs size large, beaten\",\"Parmesan cheese, grated\",\"salt\",\"ground pepper to taste\",\"[optional]\",\"My Mother\'s Tomato Sauce\",\"water\",\"fettuccine\",\"extra virgin olive oil\"]', 'https://media.soscuisine.com/images/recettes/3269.jpg', 'https://www.soscuisine.com//recipe/athlete-meatballs-slow-cooker', 'will be very useful to pure the vegetables.', '260 min', '610 kcal', '{\"calories\":\"610\",\"fat\":\"23 g\",\"cholesterol\":\"130 mg\",\"protein\":\"36 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Iron, Manganese, Niacin, Phosphorus, Potassium, Vitamin A, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin E, Vitamin K, Zinc\",\"good_source_of\":\"Fibre, Folacin, Magnesium, Pantothenic Acid, Selenium, Vitamin B1, Vitamin C\",\"source_of\":\"Calcium, Copper, Vitamin D\"}', '2021-06-18 14:11:14'),
(135, 135, 1, 'Crab and Red Quinoa Salad', 'Cook the quinoa in the water then let it cool down 10 minutes. Put the arugula and tomatoes in a salad bowl. Add the quinoa. Put the oil, lemon juice, grated ginger, Cayenne pepper, salt, and pepper in a small bowl. , using a fork, until it is emulsified. Pour over the salad. Gently to combine.\r\nAdd the crab meat and sprinkle with the finely chopped chives. Cover and chill for at least 20 min before seving to allow the flavours to meld.', '[\"quinoa\",\"water\",\"arugula, coarsely chopped\",\"tomatoes, Roma type, cut into small pieces\",\"extra virgin olive oil\",\"lemon juice, freshly squeezed\",\"gingerroot, grated\",\"cayenne pepper\",\"canned crab\",\"chives, fresh, finely chopped\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2701.jpg', 'https://www.soscuisine.com//recipe/crab-quinoa-salad', '', '30 min', '370 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Copper, Folacin, Iron, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Selenium, Vitamin E, Vitamin K, Zinc\",\"good_source_of\":\"Vitamin A, Vitamin B12\",\"source_of\":\"Calcium, Fibre, Pantothenic Acid, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin C\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:11:15'),
(136, 136, 1, 'Crab Risotto', 'Heat the in a small saucepan on the stove or in a microwave oven. Keep it warm while cooking the risotto (about 20 min). Heat the oil in a large skillet or saucepan. Sauté the shallot 2-3 min, until it becomes translucent. Add the rice then cook 1-2 min, with constant stirring , until the rice grains are well toasted and translucent. Add the parsley and garlic base , tomato paste and peas. Cook the risotto , using the warmed until the rice is creamy but still al dente Meanwhile, shell the cooked crab meat, using a nutcracker and scissors. Add the crab meat to the risotto at the vary last minute to warm it up. in the cheese. Remove the risotto pan from the heat and let stand for 2 min. Adjust the seasoning and serve.', '[\"chicken broth\",\"olive oil\",\"shallots, finely chopped\",\"arborio rice\",\"Parsley and Garlic Base\",\"tomato paste\",\"frozen peas\",\"snow crab legs, cooked\",\"Parmesan cheese, grated\",\"ground pepper to taste\",\"[optional]\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2697.jpg', 'https://www.soscuisine.com//recipe/crab-risotto', '.', '30 min', '400 kcal', '{\"calories\":\"400\",\"fat\":\"10 g\",\"cholesterol\":\"20 mg\",\"protein\":\"15 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Selenium, Vitamin A, Vitamin B12, Vitamin K, Zinc\",\"good_source_of\":\"Copper, Iron, Magnesium, Niacin, Potassium, Vitamin E\",\"source_of\":\"Calcium, Fibre, Folacin, Manganese, Phosphorus, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin C\"}', '2021-06-18 14:11:15'),
(137, 137, 1, 'Curried Chicken with Fruits', 'Peel and core the apples, then cut each into segments. Heat half of the oil in a pan over high heat. Sauté the chicken pieces thoroughly on each side until golden, about  8 min. Take them out of the pan and set aside, keeping them warm in the oven. Add the remaining oil and the onion, then sauté 2-3 min until it is translucent. in the spices then cook 1 min. Add the apples and pears, then cook 6-8 min with occasional stirring. Pour in the then put the chicken pieces back into the pan. Add salt and pepper to taste. Bring the liquid to a boil, then lower the heat, cover, and simmer until the chicken pieces are tender, 12-15 min. Stir in the cranberries and coconut milk. Garnish with the green onions, then serve on the warmed plates.', '[\"canola oil\",\"chicken thighs, boneless, skinless\",\"onions, finely chopped\",\"curry powder\",\"ground cumin\",\"apples, peeled, cored, then cut into segments\",\"pears, peeled, cored, then cut into segments\",\"chicken broth\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"dried cranberries\",\"unsweetened coconut milk\",\"green onions\\/scallions, chopped\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1144.jpg', 'https://www.soscuisine.com//recipe/curried-chicken-fruits', 'Keep the serving plates in the oven at the lowest setting so they are warm when you serve.', '45 min', '370 kcal', '{\"calories\":\"370\",\"fat\":\"16 g\",\"cholesterol\":\"80 mg\",\"protein\":\"28 g\"}', '{\"good_source_of\":\"Fibre, Manganese\",\"source_of\":\"Copper, Folacin, Iron, Magnesium, Potassium, Vitamin B6, Vitamin C, Vitamin E, Vitamin K\",\"low\":\"Calories, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:11:16'),
(138, 138, 1, 'Curried Vegan Minced Meat and Vegetables', 'Heat the oil in a sauté pan over medium heat. Add the onion and garlic, then sauté 2-3 min, with stirring , until the onion softens, paying attention not to let the garlic burn. Add the veggie ground, curry, other spices, and grated ginger. Cook 1 min. Add the potatoes, carrots, tomatoes, and water. Mix well. Bring to a boil,  then reduce the heat, cover and simmer 30 min, or until the potatoes are done. Add water if necessary to maintain a moist environment. in the peas and cook an additional 5 min Adjust the seasoning , then serve on the warmed plates.', '[\"canola oil\",\"onions, finely chopped\",\"garlic, minced\",\"veggie ground\",\"curry powder\",\"ground cinnamon\",\"gingerroot, grated\",\"turmeric\",\"cayenne pepper\",\"potatoes, peeled and diced\",\"carrots, peeled and diced\",\"canned tomatoes (diced)\",\"water\",\"frozen peas\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/3617.jpg', 'https://www.soscuisine.com//recipe/curried-vegan-minced-meat-vegetables', '', '40 min', '320 kcal', '{\"calories\":\"320\",\"fat\":\"8 g\",\"cholesterol\":\"0 mg\",\"protein\":\"23 g\"}', '{\"diet-related_health_claims\":\"Bone-healthy\",\"excellent_source_of\":\"Fibre, Iron, Manganese, Potassium, Vitamin A, Vitamin B6, Vitamin K\",\"good_source_of\":\"Calcium, Folacin, Magnesium, Vitamin B1, Vitamin C, Vitamin E\",\"source_of\":\"Copper, Niacin, Pantothenic Acid, Phosphorus, Vitamin B2, Zinc\",\"low\":\"Calories, Fat, Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:11:17'),
(140, 140, 1, 'Dijon-Style Trout Fillets', 'Preheat the oven to 215°C/425°F. Arrange the fillets on an oiled baking sheet or dish. In a small bowl, mix the all the ingredients, then spread the mixture on the fillets. Place in the middle of the oven and bake for about 15 min, or until the flesh detaches easily with a . Serve on the warmed plates.', '[\"trout fillets\",\"olive oil\",\"lemonjuice, freshly squeezed\",\"whole-grain mustard\",\"garlic, finely chopped\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/3274.jpg', 'https://www.soscuisine.com//recipe/dijon-style-trout-fillets', 'Keep the serving plates warm on the stove while you\'re preparing the dish.', '20 min', '300 kcal', '{\"calories\":\"300\",\"fat\":\"16 g\",\"cholesterol\":\"100 mg\",\"protein\":\"38 g\"}', '{\"free\":\"Sugar\",\"excellent_source_of\":\"Manganese, Niacin, Pantothenic Acid, Phosphorus, Potassium, Selenium, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin D\",\"good_source_of\":\"Copper, Iron, Magnesium, Vitamin B6\",\"source_of\":\"Calcium, Folacin, Omega-3, Vitamin E, Zinc\"}', '2021-06-18 14:11:18');
INSERT INTO `recipe_translation` (`rt_id`, `rt_recipe_id`, `rt_lang_id`, `rt_recipe_name`, `rt_recipe_text`, `rt_recipe_ingredients_full`, `rt_recipe_image`, `rt_recipe_link`, `rt_recipe_prep`, `rt_recipe_duration`, `rt_recipe_calories`, `rt_recipe_nutrients`, `rt_recipe_claims`, `rt_created`) VALUES
(141, 141, 1, 'Dill Salmon with Potato Patties', 'Preheat the oven to 215°C/425°F. the potatoes in their skins until soft, about 15-20 min depending on the potato size. Drain, then peel when still warm. Place the potatoes in a bowl and mash. the egg then add it to the potatoes. Finely chop the scallions and 2/3 of the , then add them to the bowl. Crumble the feta cheese and add it to the mixture. Pour in the lemon juice and season with a little salt and pepper. well. Chill the mixture in the refrigerator for a few minutes until firm. Meanwhile, prepare the fish: cut into pieces of comparable size, as per the number of servings required. Pour the olive oil on a baking sheet, put the fish pieces on the sheet, skin side down, and brush them with the oil. Add salt and pepper, then cover with the chives and the remaining Place the fish in the middle of the oven and bake for about 10 min for a 2 to 2,5 cm thick fillet. Since the cooking time depends on the fillet thickness and the actual temperature of the oven, it is important to check with a fork to see if the fish is cooked through While the fish is cooking, finish the patties. Heat the canola oil in a thick-bottom pan over medium-high heat. Divide the potato-egg mixture into golfball size balls, then flatten them slightly. When the pan is hot, add the potato patties and cook about 3 min per side, turning once, until golden-brown. Arrange the fish pieces and the potato patties on the individual plates then serve.', '[\"potatoes, unpeeled\",\"eggs size large\",\"green onions\\/scallions, finely chopped\",\"fresh dill, finely chopped\",\"feta cheese, crumbled\",\"lemon juice, freshly squeezed\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"salmon fillet, or trout fillet\",\"olive oil\",\"chives, fresh, finely chopped\",\"canola oil\"]', 'https://media.soscuisine.com/images/recettes/525.jpg', 'https://www.soscuisine.com//recipe/dill-salmon-potato-patties', 'Keep the serving plates warm by placing them on the stove while you\'re preparing the dish.', '50 min', '410 kcal', '{\"calories\":\"410\",\"fat\":\"19 g\",\"cholesterol\":\"150 mg\",\"protein\":\"35 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Magnesium, Niacin, Pantothenic Acid, Phosphorus, Potassium, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin D, Vitamin E, Vitamin K\",\"good_source_of\":\"Calcium, Copper, Selenium, Vitamin B1, Vitamin C, Zinc\",\"source_of\":\"Fibre, Iron, Manganese, Omega-3, Vitamin A\",\"low\":\"Sodium\"}', '2021-06-18 14:11:19'),
(142, 142, 1, 'Duck Breast with Honey and Spices', 'Preheat the oven to 230°C /450°F. Heat the honey in a saucepan over high heat 2-3 min, until it is slightly caramelized. Pour in the vinegar and mix well. Add the spices, lower the heat to \'low\', then let the sauce reduce 5 min, until it has reached a \'coating\' consistency. Make crosshatched incisions in the skin of the breasts. Season with salt then rub it into the meat. Put the breasts, skin side down, in a thick-bottom skillet. Pour the honey sauce over the breasts then cook in the middle of the oven about 8 min. Turn them, then cook an additional 2 min (for medium-rare doneness). Transfer the duck breasts to a cutting board, cover with aluminum foil and let stand 5 min before slicing (to reabsorb the juices). Put the slices on the warmed plates, spoon the sauce on the slices and serve.', '[\"honey, liquid\",\"balsamic vinegar\",\"ground cinnamon\",\"ground cumin\",\"coriander seeds, coarsely ground or crushed\",\"peppercorns, coarsely ground or crushed\",\"steaklets of duck\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/982.jpg', 'https://www.soscuisine.com//recipe/duck-breast-honey-spices', '', '20 min', '220 kcal', '{\"calories\":\"220\",\"fat\":\"9 g\",\"cholesterol\":\"70 mg\",\"protein\":\"18 g\"}', '{\"excellent_source_of\":\"Niacin, Selenium\",\"good_source_of\":\"Iron, Pantothenic Acid, Vitamin B1, Vitamin B12, Vitamin B2, Zinc\",\"source_of\":\"Copper, Magnesium, Manganese, Phosphorus, Potassium, Vitamin B6, Vitamin E\",\"low\":\"Sodium\"}', '2021-06-18 14:11:19'),
(143, 143, 1, 'Duck Cutlet in a Raspberry Sauce', 'Preheat the oven to 175°C/350°F. Heat a thick-bottom skillet a couple minutes before cooking the breasts. Place the skin side down and lower the heat immediately to medium-low. Cook  approximately 10 min until the fat has taken on a crisp quality. Remove the duck breasts from the pan and turn them over on a baking sheet (skin side up). Bake about 10 min for medium-rare. Pour off the liquid fat from skillet and put it aside in a small container in the refrigerator (Duck fat may be used to replace butter or oil in another recipe). Transfer duck to a cutting board, cover with aluminum foil and let stand 5 min before slicing. In the meantime, finely chop the shallot and garlic. Heat the butter and oil in a pan over medium heat, sauté the shallot 2-3 min, then add the garlic. Cook 2 min, then delicately add the frozen raspberries to maintain their shape. Cook 2-3 min. Add the honey and vinegar. Reduce a few minutes, then add the demi-glace and apple juice. After cooking for 2-3 more minutes, taste and adjust the seasoning : you may need to add salt, pepper and adjust the sweet-sour balance by adding more honey or vinegar. Keep warm. Slice the duck, place on the warmed plates, coat with the sauce, sprinkle with the fresh chopped tarragon and serve.', '[\"steaklets of duck\",\"shallots, finely chopped\",\"garlic, finely chopped\",\"butter, unsalted\",\"olive oil\",\"raspberries, frozen, or fresh\",\"honey\",\"apple cider vinegar\",\"demi-glace sauce\",\"apple juice\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"fresh tarragon, chopped\"]', 'https://media.soscuisine.com/images/recettes/158.jpg', 'https://www.soscuisine.com//recipe/duck-cutlet-in-raspberry-sauce', '', '30 min', '310 kcal', '{\"calories\":\"310\",\"fat\":\"18 g\",\"cholesterol\":\"80 mg\",\"protein\":\"21 g\"}', '{\"excellent_source_of\":\"Manganese, Niacin, Selenium, Zinc\",\"good_source_of\":\"Fibre, Iron, Pantothenic Acid, Phosphorus, Potassium, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin E\",\"source_of\":\"Copper, Folacin, Magnesium, Vitamin A, Vitamin C, Vitamin K\",\"low\":\"Sodium\"}', '2021-06-18 14:11:20'),
(144, 144, 1, 'Duck Legs Confit', 'Preheat the oven to 205°C/400°F. Put the duck legs, skin side down, in a skillet large enough to hold all the ingredients. Put the skillet on the stovetop then turn the heat to \'medium\'. the legs slowly and evenly (it will take about 20 min). \r\nSeason with salt and pepper to taste. When the legs are nicely browned, turn and the meat side for 1-2 min. Transfer the legs to a plate. Remove all but about one tablespoon of the fat. (Set the removed fat aside in a small container then put it the refrigerator for future use. Duck fat may be used to replace butter or oil in another recipe). Add the  garlic to the skillet and cook 1 min with stirring Return the duck legs to the skillet, skin side up, then add the . Pour in the . It should come about halfway up the duck legs, but should not cover them. Bring the liquid to a boil, then put the skillet in the middle of \r\nthe oven. Cook 30 min, then lower the heat to 175°C/350°F. Continue to cook until the meat is tender and the liquid is reduced, an additional 30 min. Serve on the warmed plates.', '[\"duck legs\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"garlic, pressed\",\"herbes de Provence\",\"chicken broth\"]', 'https://media.soscuisine.com/images/recettes/4198.jpg', 'https://www.soscuisine.com//recipe/duck-legs-confit', 'Keep the serving plates warm on the stove while you\'re preparing the dish.', '80 min', '160 kcal', '{\"calories\":\"160\",\"fat\":\"9 g\",\"cholesterol\":\"70 mg\",\"protein\":\"19 g\"}', '{\"free\":\"Sugar\",\"excellent_source_of\":\"Niacin, Selenium\",\"good_source_of\":\"Iron, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin B12, Vitamin B2, Zinc\",\"source_of\":\"Copper, Magnesium, Potassium, Vitamin B6, Vitamin E, Vitamin K\",\"low\":\"Sodium\"}', '2021-06-18 14:11:21'),
(145, 145, 1, 'Duck Roast  with Apples', 'Prepare the vegetables : Cut the leek into large chunks, cut the carrots and celery stalks in\r\nhalf. Place the vegetables and whole duck into a pot. Add cold water to cover (2-3 cm above the duck). Add peppercorns and salt (not too much, you can always add more later on). Bring to a boil, then reduce to a very gentle simmer : liquid should just bubble up to the surface. Cook,  covered, for 1 h. Let the duck cool down in its broth (This step can be made a few days ahead and the duck kept aside in its broth in the refrigerator). Preheat the oven to 150°C/300°F. Take the duck out of the broth and discard the vegetables. Set aside the broth and the fat (on the surface of the broth) for use in other recipes. Peel and core the apples, then quarter them. Pour the soy sauce and honey into a small bowl then mix well. Use this mixture to baste the duck and apples, then place them on an oven-proof plate. Cook in the middle of the oven, until the duck is tender and golden-brown, about 1 h or longer depending on the size of the duck (use 30 min per kilo of meat as the cooking time). About half-way through the cooking, turn the duck and apples, then baste with the cooking \r\njuice from the plate. Serve the duck with the apples and cooking juices on the warmed serving plates.', '[\"duck, whole\",\"carrots\",\"leeks\",\"celery\",\"salt\",\"peppercorns\",\"water\",\"soy sauce\",\"honey\",\"apples, Cortland or Lobo, peeled and quartered\"]', 'https://media.soscuisine.com/images/recettes/1136.jpg', 'https://www.soscuisine.com//recipe/duck-roast-apples', 'Keep the serving plates warm on the stove while you\'re preparing the dish.', '135 min', '310 kcal', '{\"calories\":\"310\",\"fat\":\"11 g\",\"cholesterol\":\"80 mg\",\"protein\":\"22 g\"}', '{\"excellent_source_of\":\"Niacin, Selenium, Vitamin A, Vitamin B2, Zinc\",\"good_source_of\":\"Fibre, Iron, Manganese, Pantothenic Acid, Phosphorus, Potassium, Vitamin B1, Vitamin B12, Vitamin B6\",\"source_of\":\"Copper, Folacin, Magnesium, Vitamin E, Vitamin K\",\"low\":\"Calories, Saturated Fat\",\"free\":\"Trans Fat\"}', '2021-06-18 14:11:22'),
(146, 146, 1, 'Easy Carrot SoufflÃÂ©', 'Preheat the oven to 160°C/325°F. Butter the moulds. Cook carrots in a pot of salted boiling water until very tender, about 20 min. Drain well and purée in a food processor . Set aside. Meanwhile, melt the butter in a saucepan using low heat. Add the flour, stirring , then pour in the milk, very slowly, stirring constantly to avoid lumps. Cook for 4-5 min, until the sauce thickens. Add the grated cheese, then the eggs, one at a time, with stirring . Add salt, pepper and baking powder. Incorporate the carrot purée using a spatula then portion out to the buttered molds. Clean any drops on the inner sides: the soufflés will rise evenly if they have no obstacles on the inside of the dish. Bake in the middle of the oven until puffed and just set in the middle, about 45 min. To verify doneness, insert a tooth-pick into the soufflé. If it comes out clean, the soufflé is ready. Serve immediately.', '[\"carrots, peeled and cut into 2 cm pieces\",\"butter, unsalted\",\"white flour (all purpose)\",\"milk, partly skimmed, 2%\",\"Cheddar cheese, sharp, grated\",\"eggs size large\",\"salt\",\"ground pepper to taste\",\"[optional]\",\"baking powder\"]', 'https://media.soscuisine.com/images/recettes/4423.jpg', 'https://www.soscuisine.com//recipe/easy-carrot-souffle', '', '80 min', '460 kcal', '{\"calories\":\"460\",\"fat\":\"30 g\",\"cholesterol\":\"360 mg\",\"protein\":\"21 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Calcium, Folacin, Niacin, Pantothenic Acid, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B12, Vitamin B2, Vitamin D, Vitamin E, Vitamin K, Zinc\",\"good_source_of\":\"Fibre, Iron, Magnesium, Manganese, Vitamin B1, Vitamin B6\",\"source_of\":\"Vitamin C\"}', '2021-06-18 14:11:23'),
(149, 149, 1, 'Farfalle (Bow Tie Pasta) with Radishes', 'To save time, the pasta and the sauce are cooked at the same time. Start cooking the pasta Meanwhile, prepare the sauce. Prepare the vegetables : Cut off the leaves from the radishes, remove the older leaves (they are bitter) and coarsely chop the younger ones. Slice the radishes into thin rounds. Finely chop the onion. Pour the oil into a pan, then add the onion and sauté 2-3 min until it is a little softened. Add the radish rounds and cook 2-3 min over low heat. in the reserved radish leaves, crumbled feta cheese and the required amount of pasta cooking water. Keep warm over very low heat. Drain the pasta, then pour it into the pan. Mix well. Season with salt and pepper to taste, sprinkle with the parmesan cheese, then serve immediately.', '[\"farfalle (bow-tie), or other short pasta\",\"olive oil\",\"onions, finely chopped\",\"radishes\",\"feta cheese, light, crumbled\",\"pasta cooking water\",\"Parmesan cheese, grated\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1197.jpg', 'https://www.soscuisine.com//recipe/farfalle-bow-tie-pasta-radishes', '', '25 min', '390 kcal', '{\"calories\":\"390\",\"fat\":\"8 g\",\"cholesterol\":\"10 mg\",\"protein\":\"15 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Manganese, Selenium\",\"good_source_of\":\"Fibre, Folacin, Magnesium, Zinc\",\"source_of\":\"Calcium, Copper, Iron, Niacin, Pantothenic Acid, Phosphorus, Potassium, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin C, Vitamin E\"}', '2021-06-18 14:11:26'),
(150, 150, 1, 'Farfalle (Bow Tie) with Vegan Sausage', 'Coarsely chop the onion. Clean the baby spinach Heat the oil in a frying pan over medium heat. Add the onion and sauté 2-3 min with\r\nstirring. Cut the sausage in pieces, then add to the pan. Break up the pieces using a wooden spoon and cook 4-5 min. To save time, the rest of the sauce preparation and the pasta cooking can be done at the same time. Cook the pasta Pour the warm into the frying pan. Reduce 5 min until the is almost completely absorbed but the sauce is still\r\nmoist. Pour the drained farfalle into the frying pan, then add the baby spinach. Add salt and pepper to taste, then sprinkle with nutritional yeast. Toss well and serve in the warmed dishes.', '[\"farfalle (bow-tie), or other short pasta\",\"smoked vegetarian sausages\",\"baby spinach\",\"onions, coarsely chopped\",\"vegetable broth\",\"olive oil\",\"nutritional yeast\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/3724.jpg', 'https://www.soscuisine.com//recipe/farfalle-bow-tie-sausage-vegan', '', '25 min', '450 kcal', '{\"calories\":\"450\",\"fat\":\"11 g\",\"cholesterol\":\"0 mg\",\"protein\":\"22 g\"}', '{\"excellent_source_of\":\"Fibre, Folacin, Iron, Magnesium, Manganese, Selenium, Vitamin A, Vitamin B12, Vitamin B2, Vitamin K\",\"good_source_of\":\"Niacin, Phosphorus, Vitamin B1, Vitamin E\",\"source_of\":\"Calcium, Copper, Potassium, Vitamin B6, Vitamin C, Zinc\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:11:26'),
(151, 151, 1, 'Farfalle (Bow Ties) with Chicken Sausage', 'Coarsely chop the onion. Clean the baby spinach Heat the oil in a frying pan over medium heat. Add the onion and sauté 2-3 min with\r\nstirring. Remove the skin from the sausage, then add the meat to the pan. Break the meat up using a wooden spoon and cook 4-5 min until it looses its pink\r\ncolour. To save time, the rest of the sauce preparation and the pasta cooking can be done at the same time. Cook the pasta Pour the warm into the frying pan. Reduce 5 min until the is almost completely absorbed but the sauce is still\r\nmoist. Pour the drained farfalle into the frying pan, then add the baby spinach. Add salt and pepper to taste, then sprinkle with grated Parmesan. Toss well and serve in the warmed dishes.', '[\"farfalle (bow-tie), or other short pasta\",\"chicken sausages\",\"baby spinach\",\"onions, coarsely chopped\",\"chicken broth\",\"olive oil\",\"Parmesan cheese, grated\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/875.jpg', 'https://www.soscuisine.com//recipe/farfalle-bow-tie-chicken-sausage', '', '25 min', '450 kcal', '{\"calories\":\"450\",\"fat\":\"12 g\",\"cholesterol\":\"40 mg\",\"protein\":\"23 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Magnesium, Manganese, Niacin, Selenium, Vitamin A, Vitamin B12, Vitamin K, Zinc\",\"good_source_of\":\"Copper, Fibre, Iron, Phosphorus, Potassium, Vitamin B2, Vitamin B6, Vitamin E\",\"source_of\":\"Calcium, Pantothenic Acid, Vitamin B1, Vitamin C\"}', '2021-06-18 14:11:27'),
(152, 152, 1, 'Farfalle (Bow Ties) with Tomatoes and Brie', 'To save time, the sauce preparation and the pasta cooking can be done at the same time. Start cooking the pasta Meanwhile, remove and discard the Brie\'s rind, cut the cheese into pieces, then put them in a serving bowl and set aside in the oven at the lowest setting (cheese must melt without cooking). Seed and dice the tomatoes, mince the garlic, then add them to the cheese. Mix in the oil and add pepper to taste. Pour the drained farfalle into the serving bowl. Mix well. Adjust the seasoning and serve in the warmed dishes.', '[\"farfalle (bow-tie), or other short pasta\",\"brie cheese, rind removed, cut into small pieces\",\"tomatoes, Roma type, seeded and diced\",\"garlic, minced\",\"extra virgin olive oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/206.jpg', 'https://www.soscuisine.com//recipe/farfalle-bow-ties-tomatoes-brie', '', '25 min', '520 kcal', '{\"calories\":\"520\",\"fat\":\"23 g\",\"cholesterol\":\"40 mg\",\"protein\":\"18 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Manganese, Selenium, Vitamin A, Vitamin B12\",\"good_source_of\":\"Folacin, Magnesium, Niacin, Phosphorus, Vitamin B2, Vitamin E, Vitamin K, Zinc\",\"source_of\":\"Calcium, Copper, Fibre, Iron, Pantothenic Acid, Potassium, Vitamin B1, Vitamin B6, Vitamin C\"}', '2021-06-18 14:11:28'),
(153, 153, 1, 'Farfalle Pasta with Fried Egg', 'To save time, the pasta and the eggs are cooked at the same time. Start cooking the pasta Meanwhile, put the olive oil, chives and almost all of the cheese in a serving bowl and set aside in the oven at the lowest setting. Reserve a few spoonfuls of cheese to sprinkle on top of each dish when serving. When the pasta is almost ready, remove the required amount of pasta cooking water and add it to the bowl. Season with salt and pepper to taste. Melt the butter in a nonstick skillet, then break the eggs into it and cook 2-3 min over high heat until the whites are set. To cook more than 4 eggs, you may need to work with 2 skillets at the same time. Drain the pasta, pour it into the serving bowl then well. Spoon the seasoned pasta into the warmed serving dishes and place one egg on top of the pasta. Sprinkle with the reserved cheese, then serve immediately.', '[\"farfalle (bow-tie), or other short pasta\",\"extra virgin olive oil\",\"chives, fresh, finely chopped\",\"Parmesan cheese, grated\",\"pasta cooking water\",\"salt\",\"[optional]\",\"eggs size large\",\"butter, unsalted\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/988.jpg', 'https://www.soscuisine.com//recipe/farfalle-pasta-fried-egg', '', '25 min', '450 kcal', '{\"calories\":\"450\",\"fat\":\"16 g\",\"cholesterol\":\"240 mg\",\"protein\":\"17 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Manganese, Selenium, Vitamin B12\",\"good_source_of\":\"Folacin, Magnesium, Niacin, Phosphorus, Vitamin B2, Zinc\",\"source_of\":\"Calcium, Copper, Fibre, Iron, Pantothenic Acid, Vitamin A, Vitamin B1, Vitamin B6, Vitamin D, Vitamin E, Vitamin K\"}', '2021-06-18 14:11:29'),
(154, 154, 1, 'Farinata (Chickpea Pancake)', 'In a mixing bowl, combine chickpea flour and salt. Gradually add water and oil, whisking constantly, until a smooth, thin batter forms. Let stand at room temperature at least 4 and up to 12 hours. Preheat the oven to 290°C/550°F. Add the chopped rosemary to the batter. Grease one or more baking sheets making sure to coat it evenly. Put in the oven for 3-4 min then take it out of the oven. Pour the batter into the sheet (Note: the mixture should not be thicker than 4 mm). Transfer the sheet to the oven and cook for about 15 min, until the pancake has just set, no longer jiggles, and is browned all over. If the top has not already browned, place it under a broiler for 1 to 2 min until it is flecked with brown spots. Remove the sheet from the oven, and let it cool for a minute. Carefully transfer the farinata to a cutting board. Cut it into wedges, add freshly ground black pepper, then serve warm.', '[\"chickpea\\/garbanzo flour\",\"salt\",\"water\",\"extra virgin olive oil\",\"rosemary, fresh, finely chopped\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/4316.jpg', 'https://www.soscuisine.com//recipe/farinata-chickpea-pancake', 'For good results, use one or more flat-bottomed baking sheets, large enough so that the batter will be less than 4 mm thick.', '25 min', '280 kcal', '{\"calories\":\"280\",\"fat\":\"8 g\",\"cholesterol\":\"0 mg\",\"protein\":\"14 g\"}', '{\"excellent_source_of\":\"Copper, Fibre, Folacin, Magnesium, Manganese, Potassium\",\"good_source_of\":\"Iron, Niacin, Phosphorus, Vitamin B1, Vitamin B6, Zinc\",\"source_of\":\"Omega-6, Pantothenic Acid, Selenium, Vitamin E, Vitamin K\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:11:30'),
(155, 155, 1, 'Fettuccine with Asparagus', 'Preheat the oven to 230ºC/450ºF. Prepare the asparagus . Lay the asparagus\r\nin a single layer on an oiled baking tray. Coat thoroughly with oil, then add a little salt.\r\nBake in the middle of the oven until the asparagus change colour, about 8-10 min, depending on their size. Shake the tray a couple times during\r\ncooking, so that the asparagus will cook evenly. Set aside. To save time, the rest of the sauce preparation and the pasta cooking can be done at the same time. Cook the fresh pasta in a large pot of boiling salted water, exactly as you would do for dried .\r\nThe cooking time is written on the package: the pasta is ready when just tender but still firm to the bite (al dente). Meanwhile, melt the butter in a frying pan over medium heat. Add the finely chopped shallot and garlic, then sauté 2-3\r\nmin. Add the mini-tomatoes. Cut the asparagus into bite-size pieces (about 1,5 cm) and add them to the pan. Dice the feta and it into the pan. Mix well, then lower the heat to very low. Pour in the cream. Add just a little salt (feta cheese is rather salty), pepper, and grated nutmeg to taste. Pour the drained pasta into the pan, mix well and adjust\r\nthe seasoning Serve in the warmed dishes.', '[\"olive oil\",\"asparagus, average size\",\"fettuccine (fresh)\",\"shallots, finely chopped\",\"butter, unsalted\",\"garlic, finely chopped\",\"mini-tomatoes (cherry, miniature or grape)\",\"feta cheese, diced\",\"cream 15%\",\"nutmeg, to taste\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/474.jpg', 'https://www.soscuisine.com//recipe/fettuccine-asparagus', '', '30 min', '430 kcal', '{\"calories\":\"430\",\"fat\":\"19 g\",\"cholesterol\":\"100 mg\",\"protein\":\"15 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Iron, Manganese, Niacin, Vitamin A, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin K, Zinc\",\"good_source_of\":\"Calcium, Copper, Fibre, Magnesium, Phosphorus, Vitamin B6, Vitamin E\",\"source_of\":\"Pantothenic Acid, Potassium, Selenium, Vitamin C\"}', '2021-06-18 14:11:32'),
(156, 156, 1, 'Fettuccine with Three Cheeses', 'Cook the fresh pasta in a large pot of boiling salted water, exactly as you would do for dried .\r\nThe cooking time is written on the package: the pasta is ready when just tender but still firm to the bite (al dente) Meanwhile, in a large pasta bowl, combine the 3 cheeses: ricotta, gorgonzola, and grated parmesan. Warm them up in a microwave oven then add the cream. Pour the drained pasta into the bowl, mix well and adjust\r\nthe seasoning . Serve in the warmed dishes.', '[\"green fettuccine (fresh)\",\"ricotta cheese\",\"Gorgonzola cheese, or Cambozola\",\"Parmesan cheese, grated\",\"cream 15%\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/426.jpg', 'https://www.soscuisine.com//recipe/fettuccine-three-cheeses', '', '15 min', '420 kcal', '{\"calories\":\"420\",\"fat\":\"16 g\",\"cholesterol\":\"100 mg\",\"protein\":\"21 g\"}', '{\"diet-related_health_claims\":\"Bone-healthy\",\"free\":\"Sugar\",\"excellent_source_of\":\"Calcium, Folacin, Manganese, Niacin, Phosphorus, Vitamin B1, Vitamin B12, Vitamin B2, Zinc\",\"good_source_of\":\"Iron, Magnesium, Selenium\",\"source_of\":\"Copper, Fibre, Pantothenic Acid, Potassium, Vitamin A, Vitamin B6, Vitamin E\"}', '2021-06-18 14:11:35'),
(157, 157, 1, 'Filet Mignon with a Creamy Paprika Sauce', 'Pat the beef dry and sprinkle with the salt and pepper. Finely chop the shallot(s). Heat the oil and butter in a heavy skillet over moderate heat, until hot but not smoking. Add the filets and sauté about 4 min on each side for medium-rare, turning once. Transfer the filets to a cutting board and let stand, loosely covered with foil, 10 min (to reabsorb the juices). While the filets are standing, add the shallot to the skillet and cook over moderate heat, stirring occasionally until softened, 3-4 min. Deglaze with the , scraping up brown bits. Bring to a boil, then cook 1 min. Reduce the heat then add the paprika and cook 2 min with stirring. in the mustard, Worcestershire sauce, cream, and any\r\nbeef juice from the cutting board. Bring just to a simmer and cook 1 min. Add salt and pepper to taste. Thin the sauce with a few tablespoons of water if\r\nnecessary. Serve the filets on the warmed plates, with the sauce spooned on the top.', '[\"beef, filets mignon, about 2 cm thick\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"shallots, finely chopped\",\"olive oil\",\"butter, unsalted\",\"aluminum foil\",\"beef broth\",\"paprika\",\"Dijon mustard\",\"Worcestershire sauce\",\"whipping cream 35%\"]', 'https://media.soscuisine.com/images/recettes/707.jpg', 'https://www.soscuisine.com//recipe/filet-mignon-creamy-paprika-sauce', '', '15 min', '300 kcal', '{\"calories\":\"300\",\"fat\":\"17 g\",\"cholesterol\":\"90 mg\",\"protein\":\"29 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Iron, Niacin, Selenium, Vitamin B12, Zinc\",\"good_source_of\":\"Pantothenic Acid, Phosphorus, Potassium, Vitamin A, Vitamin B2, Vitamin B6\",\"source_of\":\"Copper, Folacin, Magnesium, Vitamin B1, Vitamin D, Vitamin E\"}', '2021-06-18 14:11:37'),
(158, 158, 1, 'Fish Burger with Lemony Mayonnaise', 'Preheat the outdoor grill. Lightly oil the rack. Using a knife, chop the fish into small pieces, \r\n  then put them in a bowl. Add the scallions, egg, parsley, breadcrumbs, curry and Cayenne pepper . Season with salt and pepper. Mix well until the mixture is homogeneous. You may need to add more or less breadcrumbs to reach a good consistency. Form the mixture into patties, then place them on the oiled rack. Grill about 4 min per side. Toast the buns at the same time. Alternatively, you may cook the patties on the stovetop in a thick-bottom pan. Meanwhile, in a small bowl, conbine the mayonnaise with yogurt and lemon juice. Spread the inside of the buns with f this mixture. Place the mix greens and the patties on the bottom of the buns. Close the burger then serve with the remaining lemony mayonnaise.', '[\"canola oil, to oil the rack\",\"salmon fillet, skinned, cut into chunks\",\"walleye fillet, or other white-fleshed fish, skinned, cut into chunks\",\"green onions\\/scallions, finely chopped\",\"eggs size large, lightly beaten\",\"Italian parsley, fresh, finely chopped\",\"bread crumbs\",\"curry powder\",\"cayenne pepper\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"hamburger buns\",\"mayonnaise\",\"yogurt, plain, 2%\",\"lemon juice, freshly squeezed\",\"mixed greens\"]', 'https://media.soscuisine.com/images/recettes/3193.jpg', 'https://www.soscuisine.com//recipe/fish-burger-lemony-mayonnaise', 'These burgers can be cooked either using an outdoor grill or in a pan on the stovetop.', '25 min', '580 kcal', '{\"calories\":\"580\",\"fat\":\"32 g\",\"cholesterol\":\"210 mg\",\"protein\":\"36 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Iron, Manganese, Niacin, Pantothenic Acid, Phosphorus, Potassium, Selenium, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin D, Vitamin E, Vitamin K\",\"good_source_of\":\"Calcium, Copper, Magnesium, Zinc\",\"source_of\":\"Omega-3, Omega-6, Vitamin A, Vitamin C\"}', '2021-06-18 14:11:38'),
(159, 159, 1, 'Fish Fillets ÃÂ  la ProvenÃÂ§ale', 'Preheat the oven to 190ºC/375ºF. Finely chop the sun-dried tomatoes and the shallot. Transfer to a small bowl then add the mayonnaise and . Mix thoroughly. Since each fish fillet is uneven in thickness, here is the trick to ensure uniform cooking: cut each fillet into 2 pieces lengthwise, then put each piece separately on a lightly-oiled baking sheet and brush them lightly with oil. Cover with the sauce. Do not add salt – the sauce is already fairly salty. Place in the lower third of the oven and cook for about 10 min (5-6 min per cm of thickness) until the top(s) have changed colour. Since the cooking time depends on the thickness of the fillets and the actual temperature of your oven, it is important to check with a fork to see if they are cooked through . The thinner pieces will be done before the thicker ones: pull them out when ready, then cover and keep warm while waiting for the remaining ones to be done. Serve on the warmed plates.', '[\"tilapia fillets, or turbot fillets\",\"sun-dried tomatoes (oil packed), finely chopped\",\"shallots, finely chopped\",\"pesto sauce\",\"mayonnaise\",\"olive oil\"]', 'https://media.soscuisine.com/images/recettes/38.jpg', 'https://www.soscuisine.com//recipe/fish-fillets-provencale', 'Keep the serving plates warm on the stove while you\'re preparing the dish.', '15 min', '370 kcal', '{\"calories\":\"370\",\"fat\":\"23 g\",\"cholesterol\":\"90 mg\",\"protein\":\"39 g\"}', '{\"free\":\"Sugar\",\"excellent_source_of\":\"Niacin, Phosphorus, Potassium, Selenium, Vitamin B12\",\"good_source_of\":\"Magnesium, Vitamin B6, Vitamin E\",\"source_of\":\"Calcium, Copper, Folacin, Iron, Manganese, Omega-3, Omega-6, Pantothenic Acid, Vitamin B1, Vitamin B2, Vitamin C, Vitamin K, Zinc\"}', '2021-06-18 14:11:39'),
(160, 160, 1, 'Fish Fillets in a Sweet-and-Sour Sauce', 'Mix the water and milk in a bowl, then soak the capers for about 15 min (while cooking the onions). Drain the capers, rinse them, then drain them again and set aside. This step is needed to remove the excess salt. If using capers in a vinegar brine instead of the salted type, they should simply be rinsed then drained. Heat half of the oil in a skillet over medium heat. Cut the onions into thick slices, then add them to the skillet and sauté until they are caramelized, about 10 min. Add some water, if needed, to keep a moist environment. Mix the vinegar and sugar well, then add the mixture to the skillet. Cook over medium-high heat until the vinegar has evaporated, about 5 min. in the capers then lower the heat to \'very low\'. Pat-dry the fish then cut it into serving sized pieces. Season the pieces with salt and pepper, then them in flour. Heat the remaining oil in another pan over medium-high heat. Cook the fish, 3-4 min per side, depending on the thickness of the fillets ( check\r\nwith a fork to see if the fish is cooked through). Transfer the fish to the sauce skillet, then coat them thoroughly with the sauce. Cook a few minutes over low heat, then serve.', '[\"water\",\"milk, partly skimmed, 2%\",\"capers, unsalted, or in vinegar brine\",\"olive oil\",\"red onions, cut into thick slices\",\"wine vinegar\",\"sugar\",\"grouper fillet, red snapper, or walleye\",\"white flour (all purpose)\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1043.jpg', 'https://www.soscuisine.com//recipe/fish-fillets-in-sweet-sour-sauce', 'Keep the serving plates in the oven at the lowest setting so they are warm when you serve.', '25 min', '320 kcal', '{\"calories\":\"320\",\"fat\":\"17 g\",\"cholesterol\":\"60 mg\",\"protein\":\"31 g\"}', '{\"excellent_source_of\":\"Niacin, Potassium, Selenium, Vitamin B12, Vitamin B6\",\"good_source_of\":\"Magnesium, Pantothenic Acid, Phosphorus, Vitamin E, Vitamin K\",\"source_of\":\"Calcium, Copper, Folacin, Iron, Manganese, Vitamin A, Vitamin B1, Vitamin B2, Zinc\"}', '2021-06-18 14:11:40'),
(161, 161, 1, 'Fish Fingers and Sweet Potato Oven-Fries', 'Preheat the oven to 230°C/450°F. Line with parchment\r\npaper a large baking sheet and an ovenproof dish. Prepare the potatoes first and start cooking them. Prepare the fish while the potatoes are baking, then bake the fish with the potatoes during the last 15 min. Peel the potatoes, then cut them into 1x8 cm pieces. It is important to cut them into pieces of similar size so that they will all cook evenly and be done at the same time. In a deep dish, the egg white with the oil, salt, and pepper to taste. Add the potato pieces and coat them well with the egg white mixture. Transfer them to the baking sheet. Don\'t crowd the potatoes on the sheet or they will steam and not turn golden-brown. Bake on the bottom oven rack 15 min, then turn the potatoes and bake an additional 15 min.', '[\"sweet potatoes\",\"egg whites\",\"salt, for the potatoes\",\"ground pepper to taste\",\"[optional]\",\"olive oil\",\"parchment paper, for the sheet\",\"tilapia fillets, or turbot, cut into 4 x 8 cm pieces\",\"mayonnaise\",\"bread crumbs\",\"cayenne pepper\",\"dried oregano\",\"salt, for the fish\",\"[optional]\",\"vegetable oil spray\",\"Tartare Sauce\"]', 'https://media.soscuisine.com/images/recettes/1194.jpg', 'https://www.soscuisine.com//recipe/fish-fingers-sweet-potato-oven-fries', 'Pay attention to the timing of the potato and fish preparation so that the fish is baked during the last 15 min of potato baking.', '45 min', '650 kcal', '{\"calories\":\"650\",\"fat\":\"35 g\",\"cholesterol\":\"90 mg\",\"protein\":\"45 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin E, Vitamin K\",\"good_source_of\":\"Copper, Fibre, Folacin, Iron, Vitamin C, Zinc\",\"source_of\":\"Calcium, Omega-3, Omega-6\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:11:42'),
(162, 162, 1, 'Flemish Beef Stew', 'Preheat the oven to 160ºC/325ºF. Cut the beef into large cubes, about 4 cm, then sprinkle with salt and pepper. Finely chop the onions. Heat the butter and oil in a casserole dish\r\nover high heat. Add the beef cubes in batches, turning them until dark brown on all sides, 5-7 min. Take the cubes out of the casserole using a slotted spoon, then transfer them to a plate. Add the onions and sauté over medium heat about 5 min, then add the flour and cook 1-2 min with stirring .\r\nPour in the beer, then put the meat back into the casserole .\r\nAdd the bay leaves, rosemary, brown sugar, and vinegar. Pour in some water if necessary to cover the meat. Cover and cook 2 h in the middle of the oven, until the meat is tender. During this time, prepare the vegetables : peel them and cut into large chunks then add them to the casserole. Pour in some warm water if too dry. Season with salt, cover and continue to cook an additional 20-25 min until the vegetables are tender. Serve.', '[\"blade pot roast, rib roast or shoulder cloud, cut into cubes\",\"butter, unsalted\",\"canola oil\",\"onions, finely chopped\",\"white flour (all purpose)\",\"alcohol-free beer\",\"bay leaf\",\"rosemary, fresh\",\"brown sugar\",\"wine vinegar\",\"rutabagas, or turnips, peeled and cut into large pieces\",\"potatoes, peeled and cut into large pieces\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/712.jpg', 'https://www.soscuisine.com//recipe/flemish-beef-stew-alcohol-free', 'dish with a tight-fitting lid is necessary for this recipe.', '165 min', '400 kcal', '{\"calories\":\"400\",\"fat\":\"13 g\",\"cholesterol\":\"70 mg\",\"protein\":\"28 g\"}', '{\"excellent_source_of\":\"Niacin, Potassium, Selenium, Vitamin B12, Vitamin B6, Zinc\",\"good_source_of\":\"Copper, Folacin, Iron, Magnesium, Manganese, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin B2, Vitamin C\",\"source_of\":\"Fibre, Vitamin D, Vitamin E, Vitamin K\",\"low\":\"Sodium\"}', '2021-06-18 14:11:43'),
(163, 163, 1, 'Fried Rice with Shrimp', 'Cook the . Cook the peas, still frozen, by plunging them 3-4 min in a small pot of boiling salted water. Drain them, then set aside. In a small bowl, the egg, then set aside. Heat half of the oil in a skillet over medium heat. When the oil is hot, the shrimp. Cook, with some stirring, until the shrimp lose its gray colour and turn pink, 3-4 min. Remove from the pan, using a slotted spoon, and transfer to a plate. Add the onion and sauté 2-3 min until it becomes translucent. Add the rice then stir-fry 2 min, breaking up the rice with a wooden spoon. Make a well in the rice, exposing the bottom of the skillet. Add the remaining oil then in the egg. Immediately stir-fry to incorporate the egg throughout the rice, until the egg is almost cooked through, 1-2 min. Put the shrimp back into the skillet. Stir in the peas, season with salt, and pepper then stir-fry 1-2 min until it is heated through. Serve on the warmed dishes.', '[\"rice, long grain\",\"frozen peas\",\"eggs size large, beaten\",\"canola oil\",\"shrimp, small\",\"onions, finely chopped\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1242.jpg', 'https://www.soscuisine.com//recipe/fried-rice-shrimp', '', '25 min', '410 kcal', '{\"calories\":\"410\",\"fat\":\"11 g\",\"cholesterol\":\"200 mg\",\"protein\":\"21 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Manganese, Niacin, Selenium, Vitamin B12, Vitamin E\",\"good_source_of\":\"Folacin, Iron, Magnesium, Pantothenic Acid, Phosphorus, Vitamin A, Vitamin B6, Vitamin K, Zinc\",\"source_of\":\"Calcium, Copper, Fibre, Omega-3, Potassium, Vitamin B1, Vitamin B2, Vitamin C, Vitamin D\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:11:44'),
(164, 164, 1, 'Fried Rice with Turkey', 'Cook the . Cook the peas, still frozen, by plunging them 3-4 min in a small pot of boiling salted water. Drain them, then set aside. In a small bowl, the egg, then set aside. Heat half of the oil in a skillet over medium heat. Add the onion and sauté 2-3 min until it becomes translucent. Add the rice then stir-fry 2 min, breaking up the rice with a wooden spoon. Make a well in the rice, exposing the bottom of the skillet. Add the remaining oil then in the egg. Immediately stir-fry to incorporate the egg throughout the rice, until the egg is almost cooked through, 1-2 min. Add the turkey, peas, salt, and pepper then stir-fry 1-2 min until it is heated through. Serve on the warmed dishes.', '[\"rice, long grain\",\"frozen peas\",\"eggs size large, beaten\",\"canola oil\",\"onions, finely chopped\",\"turkey breast roast (cooked), or chicken, diced\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2838.jpg', 'https://www.soscuisine.com//recipe/fried-rice-turkey', '', '20 min', '410 kcal', '{\"calories\":\"410\",\"fat\":\"13 g\",\"cholesterol\":\"130 mg\",\"protein\":\"18 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Manganese, Niacin, Selenium, Zinc\",\"good_source_of\":\"Folacin, Iron, Magnesium, Pantothenic Acid, Phosphorus, Potassium, Vitamin A, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin E, Vitamin K\",\"source_of\":\"Copper, Fibre, Omega-3, Vitamin B1, Vitamin C, Vitamin D\"}', '2021-06-18 14:11:45'),
(165, 165, 1, 'Fusilli with Watercress and Feta Cheese', 'In a bowl, coarsely crumble the feta cheese and combine it with the chopped dill. Pour in the lemon juice, mix well then set aside to marinate for about 10 min. To save time, the rest of the sauce preparation and the pasta cooking can be done at the same time. Cook the pasta Rinse the watercress carefully, without soaking it, to remove any sand. Eliminate any thick stems and set aside. Heat the oil in a pan over medium-low heat, add the feta mixture and the olives, then cook a few min. Add the watercress to the pan (keeping a few leaves with some stems for decoration) and heat just 1-2 additional min. It is important not to leave the watercress on the heat for too long to avoid excessive wilting. Pour the drained pasta into the pan. Mix well and add pepper to taste. Serve in the warmed dishes. Garnish with the reserved watercress leaves.', '[\"feta cheese\",\"fresh dill, chopped\",\"lemon juice, freshly squeezed\",\"fusilli\",\"watercress\",\"olive oil\",\"black olives\"]', 'https://media.soscuisine.com/images/recettes/216.jpg', 'https://www.soscuisine.com//recipe/fusilli-watercress-feta-cheese', '', '25 min', '440 kcal', '{\"calories\":\"440\",\"fat\":\"15 g\",\"cholesterol\":\"20 mg\",\"protein\":\"14 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Manganese, Selenium, Vitamin K\",\"good_source_of\":\"Fibre, Magnesium, Niacin, Phosphorus, Vitamin A, Vitamin B12, Vitamin B2, Vitamin E, Zinc\",\"source_of\":\"Calcium, Copper, Folacin, Iron, Pantothenic Acid, Vitamin B1, Vitamin B6, Vitamin C\"}', '2021-06-18 14:11:48'),
(166, 166, 1, 'Fusilli with Zucchini', 'Prepare the zucchini . Slice them into 4-5 mm rounds. Heat the oil in a pan over medium heat. Add the parsley and garlic base . Add the zucchini rounds and cook 5 min uncovered, stirring frequently. To save time, the rest of the sauce preparation and the pasta cooking can be done at the same time. Cook the pasta Back to the zucchini pan, add salt, cover, and cook over low heat about 8-10 min, or until the zucchini is soft, but still al dente . Add paprika to taste, the tomato sauce and cook just a few minutes. Pour the drained fusilli into the zucchini pan, add the cream, pepper to taste, sprinkle with grated Parmesan, then mix well. Serve in the warmed dishes.', '[\"fusilli, or penne\",\"zucchini, cut into 4-5 mm rounds\",\"olive oil\",\"Parsley and Garlic Base\",\"paprika\",\"My Mother\'s Tomato Sauce\",\"cream 15%\",\"Parmesan cheese, grated\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/73.jpg', 'https://www.soscuisine.com//recipe/fusilli-zucchini', '', '25 min', '480 kcal', '{\"calories\":\"480\",\"fat\":\"19 g\",\"cholesterol\":\"10 mg\",\"protein\":\"13 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Manganese, Selenium, Vitamin A, Vitamin E, Vitamin K\",\"good_source_of\":\"Fibre, Folacin, Iron, Magnesium, Niacin, Phosphorus, Vitamin B6, Vitamin C, Zinc\",\"source_of\":\"Calcium, Copper, Pantothenic Acid, Potassium, Vitamin B1, Vitamin B2\"}', '2021-06-18 14:11:49'),
(167, 167, 1, 'Goat Tagine with Fennel', 'Preheat the oven to 175°C/350°F. In a small bowl, macerate the raisins in water. Prepare the vegetables . Mince the onion and garlic, cut the fennel into thin slices, and chop the carrot. Cut the meat into 3-4 cm pieces. Heat the oil in a pan over high heat. Sauté the goat pieces, turning frequently. Cook about 8-10 min, until golden. Add salt and pepper, then transfer the pieces and cooking juice into the tagine casserole . Set aside. In the same pan, add the butter and sauté the onion, garlic, and fennel 2-3 min over medium heat. Add the carrot and diced tomatoes. Cook 5 min. Place the vegetables into the casserole with the meat. Add the raisins, olives, whole almonds (optional), cilantro , bay leaves, and spices. Pour in the warm . Cook 40 min with the lid on and then 15 min without, in order to reduce the juice. Sprinkle with lemon juice. Adjust the seasoning When ready to serve, cook the couscous . Serve directly out of the casserole with the couscous on the side.', '[\"goat for stew, cut into 3-4 cm pieces\",\"fennels, thinly sliced\",\"onions, finely chopped\",\"garlic, finely chopped\",\"carrots, diced\",\"canned tomatoes (diced)\",\"black olives\",\"almonds\",\"[optional]\",\"raisins\",\"butter, unsalted\",\"olive oil\",\"beef broth\",\"ground cumin\",\"curry powder\",\"couscous spice (ras-el-hanout)\",\"bay leaf\",\"fresh cilantro\",\"lemon juice, freshly squeezed\",\"couscous, whole wheat\",\"ground pepper to taste\",\"[optional]\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1478.jpg', 'https://www.soscuisine.com//recipe/goat-tagine-fennel', '', '90 min', '470 kcal', '{\"calories\":\"470\",\"fat\":\"13 g\",\"cholesterol\":\"60 mg\",\"protein\":\"28 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Fibre, Folacin, Iron, Manganese, Niacin, Potassium, Selenium, Vitamin A, Vitamin B12, Vitamin B2, Zinc\",\"good_source_of\":\"Copper, Magnesium, Phosphorus, Vitamin B1, Vitamin B6, Vitamin C, Vitamin E, Vitamin K\",\"source_of\":\"Calcium, Pantothenic Acid\",\"low\":\"Calories, Cholesterol, Fat, Saturated Fat, Sodium\"}', '2021-06-18 14:11:50'),
(168, 168, 1, '\"Gravad Lax\"', 'In a bowl, mix enough salt and sugar (about half-half) to generously coat the salmon on both sides. Rub the salt and sugar on the fish, then sprinkle with pepper and cover with dill. Place everything (salmon, dill, and mix) in a plastic bag. Lay the bag on a plate and put another plate or something flat on top as a weight. Put it in the refrigerator to cure for 18-24 hours. When ready to serve, prepare the sauce: in a small bowl, mix the yogurt with the horseradish and lemon juice. Take the salmon out of the refrigerator, wash it in running water to remove excess salt, sugar, and juice; then dry with a cloth. Slice the salmon off the skin as thinly as possible, crosswise, using the longest and sharpest knife you have. A gentle, gliding motion will help to not crush the fish. Immerse the knife in hot water between each cut to make cutting easier. Place the slices on a plate. Garnish with capers, thinly sliced onion rings, dill sprigs, and lemon slices. Serve with the horseradish sauce on the side and pita bread grilled in the toaster or in the oven at 175°C/350°F.', '[\"salmon fillet, fresh\",\"sugar\",\"salt\",\"ground pepper\",\"fresh dill\",\"capers, to garnish\",\"onions, to garnish\",\"lemons, to garnish\",\"yogurt, plain, 2%\",\"horseradish\",\"lemon juice, freshly squeezed\",\"pita breads\"]', 'https://media.soscuisine.com/images/recettes/92.jpg', 'https://www.soscuisine.com//recipe/gravad-lax', 'Choose the fresh salmon fillet towards the tail of the fish. \r\n\r\nCuring time is about 18-24 hours.', '10 min', '250 kcal', '{\"calories\":\"250\",\"fat\":\"5 g\",\"cholesterol\":\"50 mg\",\"protein\":\"31 g\"}', '{\"excellent_source_of\":\"Folacin, Niacin, Phosphorus, Potassium, Selenium, Vitamin B12, Vitamin B6, Vitamin D\",\"good_source_of\":\"Iron, Magnesium, Manganese, Pantothenic Acid, Vitamin A, Vitamin B1, Vitamin B2, Vitamin C, Vitamin E\",\"source_of\":\"Calcium, Copper, Omega-3, Zinc\",\"low\":\"Saturated Fat\",\"free\":\"Trans Fat\"}', '2021-06-18 14:11:51'),
(169, 169, 1, 'Greek-Style Chicken Skewers', 'the garlic, then put it in a bowl. Add the oregano, then in half of the olive oil and lemon juice. Cut the meat into about 2 cm chunks. Place the meat chunks into the bowl and well. Cover the bowl with a dish and let the meat marinate for 1 h in the refrigerator, or about 20 min at room temperature. Just a few minutes before grilling, pour the remaining olive oil and lemon juice in another bowl. Cut each squash into quarters then put them into the bowl. well. Alternate the meat and squash pieces onto metal skewers. Season generously with salt and pepper. Put the skewers on an oiled, hot grill or under the broiler. Grill or broil until the chicken is cooked through and the squash is just tender, turning occasionally, about 10 min. Serve.', '[\"garlic, crushed\",\"dried oregano\",\"olive oil\",\"lemon juice, freshly squeezed\",\"chicken thighs, boneless, skinless, cut into 2 cm chunks\",\"pattypan squash, zucchini, or other summer squash, cut into quarters\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/664.jpg', 'https://www.soscuisine.com//recipe/greek-style-chicken-skewers', 'Metal skewers are needed for cooking.', '20 min', '200 kcal', '{\"calories\":\"200\",\"fat\":\"10 g\",\"cholesterol\":\"60 mg\",\"protein\":\"22 g\"}', '{\"good_source_of\":\"Folacin, Vitamin C\",\"source_of\":\"Copper, Magnesium, Manganese, Potassium, Vitamin B1, Vitamin B6, Vitamin E\",\"low\":\"Calories, Saturated Fat\",\"free\":\"Sodium, Sugar, Trans Fat\"}', '2021-06-18 14:11:52');
INSERT INTO `recipe_translation` (`rt_id`, `rt_recipe_id`, `rt_lang_id`, `rt_recipe_name`, `rt_recipe_text`, `rt_recipe_ingredients_full`, `rt_recipe_image`, `rt_recipe_link`, `rt_recipe_prep`, `rt_recipe_duration`, `rt_recipe_calories`, `rt_recipe_nutrients`, `rt_recipe_claims`, `rt_created`) VALUES
(170, 170, 1, 'Green Chicken Curry', 'Purée the garlic, cilantro , ginger, jalapeño pepper , onion, lemon juice, cayenne, curry powder, cumin, ground coriander, and a bit of salt in a blender food processor Toss together the chicken pieces with about 1 or 2 tablespoons of the spice mixture then set aside. Heat the oil in a sauté pan to medium heat. Add the remaining spice mixture and cook, with stirring , about 10 min, or until the paste is lightly browned. in the coconut milk, , sugar, and cinnamon. Bring to a boil, then reduce the heat, cover and simmer 10 min. Add the chicken pieces to the sauce and cook 3-4 min, with stirring , or until the chicken becomes opaque. Add the fruits to the sauce and cook an additional 2 min. in the mint, adjust the seasoning , then serve in the warmed dishes.', '[\"garlic, chopped\",\"fresh cilantro, coarsely chopped\",\"gingerroot, chopped\",\"jalape\\u00c3\\u00b1o pepper, fresh, chopped\",\"onions, chopped\",\"lemon, freshly squeezed\",\"cayenne pepper\",\"curry powder\",\"ground cumin\",\"coriander seeds, ground\",\"salt\",\"[optional]\",\"chicken breasts, boneless, skinless, cut into bitesize pieces\",\"canola oil\",\"unsweetened coconut milk\",\"chicken broth\",\"sugar\",\"ground cinnamon\",\"raisins\",\"bananas, small, cut into thick rounds\",\"canned pineapple, cut into pieces\",\"fresh mint, finely chopped\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2496.jpg', 'https://www.soscuisine.com//recipe/green-chicken-curry', '', '40 min', '280 kcal', '{\"calories\":\"280\",\"fat\":\"13 g\",\"cholesterol\":\"60 mg\",\"protein\":\"24 g\"}', '{\"excellent_source_of\":\"Manganese, Niacin, Vitamin B6\",\"good_source_of\":\"Magnesium, Phosphorus, Potassium, Vitamin K\",\"source_of\":\"Copper, Folacin, Iron, Pantothenic Acid, Selenium, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin C, Vitamin E, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:11:54'),
(172, 172, 1, 'Green Lentil Stew with a Tomato Sauce', 'Rinse the lentils and pick out any small stones and debris. Cook them in a saucepan of salted water, about 20-25 min until tender but still somewhat al\r\ndente . Drain the lentils, discard the liquid, and set them aside. My Mother\'s Tomato Sauce in a saucepan over medium-low heat. Add the lentils and cook 5-7 min, with occasional stirring , until the lentils are fully cooked. Serve.', '[\"green or brown lentils (dried), rinsed and drained\",\"My Mother\'s Tomato Sauce\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/410.jpg', 'https://www.soscuisine.com//recipe/green-lentil-stew-tomato-sauce', 'in advance.', '35 min', '190 kcal', '{\"calories\":\"190\",\"fat\":\"5 g\",\"cholesterol\":\"10 mg\",\"protein\":\"11 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Iron, Manganese, Potassium, Vitamin A\",\"good_source_of\":\"Copper, Fibre, Magnesium, Phosphorus, Vitamin B1, Vitamin B6, Zinc\",\"source_of\":\"Niacin, Pantothenic Acid, Selenium, Vitamin B2, Vitamin C, Vitamin E, Vitamin K\"}', '2021-06-18 14:11:56'),
(173, 173, 1, 'Green Tea Risotto', 'Finely chop the onion. Heat the in a small saucepan on the stove or in a microwave oven. Keep it warm while cooking the risotto (which will take about 20 min). Heat the oil in a saucepan. Add the onion then sauté 2-3 min, until it becomes translucent. Add the rice and toast the grains 1-2 min (until translucent), with constant stirring Cook the risotto until the rice is creamy but still al dente , about 20 min. in the matcha, then let the risotto stand for 2 min. Season with pepper to taste, then serve.', '[\"onions, finely chopped\",\"chicken broth\",\"olive oil\",\"arborio rice\",\"matcha (fine powder green tea), or more to taste\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2643.jpg', 'https://www.soscuisine.com//recipe/green-tea-risotto', 'will reduce the risotto cooking time to 7 min.', '25 min', '250 kcal', '{\"calories\":\"250\",\"fat\":\"3 g\",\"cholesterol\":\"0 mg\",\"protein\":\"5 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"good_source_of\":\"Selenium\",\"source_of\":\"Copper, Magnesium, Phosphorus, Vitamin B1, Zinc\",\"low\":\"Fat, Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Sodium, Trans Fat\"}', '2021-06-18 14:11:57'),
(174, 174, 1, 'Green \"Wave\" Risotto', 'Clean the arugula, parsley, and chervil: discard any withered leaves and any tough parts, then wash rapidly, but carefully, without letting them soak in water. Drain the leaves, then transfer them to a blender .\r\nAdd the water, nutmeg, and pepper to taste. Mix 2 min, until a green purée is obtained. Set aside. Finely chop the onion. Heat the in a small saucepan on the stove or in a microwave oven. Keep it warm while cooking the risotto (which will take about 20 min). Melt the oil and half of the butter in a saucepan. Add the onion and sauté 2-3 min, until translucent, then add the rice. Toast the grains 1-2 min (until translucent), with constant stirring Cook the risotto , using the warmed until the rice is creamy but\r\nstill al dente , about 20 min, then in the green purée, adding it in 2 or 3 portions. Remove the saucepan from the heat, then in the remaining butter and grated Parmesan cheese. Let stand for 2 min. Season with salt (not much if the is salty) and pepper to taste. Spoon the risotto into dishes and serve.', '[\"arugula\",\"Italian parsley, fresh\",\"chervil\",\"[optional]\",\"water\",\"nutmeg\",\"ground pepper to taste\",\"[optional]\",\"onions, finely chopped\",\"chicken broth, approximately\",\"olive oil\",\"butter, unsalted\",\"arborio rice\",\"Parmesan cheese, grated\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/668.jpg', 'https://www.soscuisine.com//recipe/green-wave-risotto', '.', '30 min', '400 kcal', '{\"calories\":\"400\",\"fat\":\"14 g\",\"cholesterol\":\"20 mg\",\"protein\":\"7 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Vitamin K\",\"good_source_of\":\"Selenium, Vitamin A\",\"source_of\":\"Calcium, Copper, Folacin, Iron, Magnesium, Manganese, Phosphorus, Potassium, Vitamin B1, Vitamin C, Vitamin E, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:11:58'),
(175, 175, 1, 'Grilled Chicken in Coconut Milk with Spices', 'Coarsely chop the shallot and garlic, grate the ginger ,\r\nthen place all in a blender food processor . Add the coconut milk, cumin, turmeric, cloves, anise seeds, and black peppercorns. Split the cardamom pod open to extract the seeds: remove and discard the pod then\r\nadd the seeds to the blender . Add one pinch of freshly grated nutmeg. Blend to a smooth paste. Make 3-4 diagonal cuts across each chicken breast. Arrange them in one layer in a shallow dish. Add half of the coconut mixture and well to coat the chicken evenly. Cover the dish and marinate for at least 30 min at room temperature, or overnight in the refrigerator. Cook the chicken on a medium grill for 12-15 min, turning once, until browned and thoroughly cooked. Alternatively, roast the chicken under a preheated broiler. Pour the remaining coconut mixture into a saucepan and bring to a boil, with occasional stirring Adjust the seasoning (with the spiciness, you may not need to add any salt). Serve the chicken on individual plates with the sauce, garnish with chopped cilantro leaves (optional), then serve.', '[\"shallots, coarsely chopped\",\"garlic, coarsely chopped\",\"gingerroot, grated\",\"unsweetened coconut milk\",\"ground cumin\",\"turmeric\",\"cloves\",\"anise seeds\",\"peppercorns\",\"cardamom pods\",\"nutmeg\",\"chicken breasts, boneless, skinless\",\"salt\",\"[optional]\",\"fresh cilantro, chopped\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/488.jpg', 'https://www.soscuisine.com//recipe/grilled-chicken-in-coconut-milk-spices', 'will be very useful for this recipe.', '30 min', '320 kcal', '{\"calories\":\"320\",\"fat\":\"22 g\",\"cholesterol\":\"60 mg\",\"protein\":\"25 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Manganese, Niacin, Vitamin B6\",\"good_source_of\":\"Iron, Magnesium, Phosphorus, Potassium\",\"source_of\":\"Copper, Folacin, Pantothenic Acid, Selenium, Vitamin B1, Vitamin B12, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:11:59'),
(177, 177, 1, 'Grilled Chicken with Caraway and Black Peppercorns', 'Score the chicken pieces deeply using a knife to allow the marinate to penetrate, then arrange the pieces in a shallow bowl. Grind the peppercorns and caraway seeds using a mortar and pestle or using a pepper mill if available. Otherwise, place the spices in a plastic bag and crush them using a rolling pin . Finely chop the ginger and garlic, then add them to the mixture. Add the sugar, paprika ,\r\nand oil, then grind into a paste. Spread the mixture over the chicken pieces, making sure to coat them well. Cover the bowl with a plate and let them marinate in the refrigerator at least 6 hours or overnight. Cook the chicken on a medium grill for about 20-25 min, basting with the marinade and turning the pieces once. Alternatively, put the chicken on the rack of a broiler pan, then roast it in the oven under a preheated broiler 7-10 cm from the heat. Season with a little salt, then serve with lime wedges on the side.', '[\"chicken thighs, bone-in, with skin\",\"peppercorns, coarsely ground\",\"caraway seeds, coarsely ground\",\"gingerroot, finely chopped\",\"garlic, finely chopped\",\"sugar\",\"paprika\",\"canola oil\",\"salt\",\"[optional]\",\"limes, quartered\"]', 'https://media.soscuisine.com/images/recettes/577.jpg', 'https://www.soscuisine.com//recipe/grilled-chicken-caraway-black-peppercorns', '', '30 min', '350 kcal', '{\"calories\":\"350\",\"fat\":\"19 g\",\"cholesterol\":\"120 mg\",\"protein\":\"40 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"good_source_of\":\"Vitamin E\",\"source_of\":\"Iron, Omega-3, Vitamin A, Vitamin C, Vitamin K\",\"low\":\"Saturated Fat\",\"free\":\"Sodium, Trans Fat\"}', '2021-06-18 14:12:01'),
(178, 178, 1, 'Grilled Fish Fillet with Spinach in a Thai Sauce', 'Mince the garlic, ginger ,\r\nand chili pepper ,\r\nthen put them in a small bowl. Mix in the sugar, fish sauce, water, and lime juice.\r\n(The sauce can be prepared a few days ahead, covered, and kept in the refrigerator). Prepare the vegetables :\r\nrinse and drain the spinach; thinly slice the shallot. Set them aside. Brush the fish fillets on all sides with half of the oil. Season with salt and pepper. Cook on a grill using medium-high heat, or under the broiler, until the fish is opaque in the centre, about 4 min per side, depending on the thickness of the fillets. Check with a fork to see if it is cooked through. Meanwhile, heat the remaining oil in a pan over medium heat. Add the sliced shallot and sauté 1 min with stirring ,\r\nthen add the spinach. Sprinkle with salt and until the spinach is wilted, but still bright green, about 2-3 min. Distribute the spinach onto the individual serving plates. Place the fish fillets on top of the spinach, then drizzle each with 2 tablespoons of the sauce. Serve, passing the bowl of remaining sauce separately. (For a nicer presentation, cut a carrot into matchstick-size strips, then let\r\nstand 15 min in a bowl of ice water. Drain well, then place on top of the fillets).', '[\"garlic, minced\",\"gingerroot, minced\",\"dried chili peppers, minced\",\"sugar\",\"fish sauce (nam pla)\",\"water\",\"lime juice, freshly squeezed\",\"spinach\",\"shallots, thinly sliced\",\"sea bass fillet, halibut or grouper, cut into servings\",\"canola oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"carrots\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/573.jpg', 'https://www.soscuisine.com//recipe/grilled-fish-fillet-spinach-in-thai-sauce', 'Any firm-textured fish will work well with this recipe : sea-bass, halibut, grouper, mahi-mahi, red snapper, etc.', '20 min', '290 kcal', '{\"calories\":\"290\",\"fat\":\"11 g\",\"cholesterol\":\"60 mg\",\"protein\":\"31 g\"}', '{\"excellent_source_of\":\"Folacin, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B6, Vitamin E, Vitamin K\",\"good_source_of\":\"Iron, Pantothenic Acid, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin C\",\"source_of\":\"Calcium, Copper, Fibre, Omega-3, Zinc\",\"low\":\"Calories, Saturated Fat\",\"free\":\"Trans Fat\"}', '2021-06-18 14:12:02'),
(179, 179, 1, 'Grilled Fish with Fennel', 'Using a sharp knife, make 3-4 deep slashes into both sides of the fish. Brush the fish with half of the olive oil, then season with salt and pepper. Crush the garlic then put it in the gutted cavity of the fish with some of the fennel seeds. Put the remaining seeds in the slashes of the fish. Cook the fish on a grill using medium-low heat for about  10-12 min, basting occasionally and turning it once. Alternatively, put the fish on the rack of a broiler pan under a preheated broiler 7-10 cm from the heat for about 5-6 min on each side. Check with a fork to see if the fish is cooked through. Prepare the fennel : Trim the stalk and feathery leaves. Discard the stalk but reserve the leaves. Remove any tough outer layers, then cut the bulbs lengthwise into ½ cm-thick slices, reserving a few feathery leaves for garnish. Brush the slices with the remaining oil and grill for 8-10 min, until tender, turning them once. Scatter the fennel slices on the individual serving plates, lay the fish on top and garnish with the reserved fennel leaves. Serve.', '[\"sea bass, whole, red snapper, cleaned and scaled\",\"olive oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"garlic, crushed\",\"fennel seeds\",\"fennels\"]', 'https://media.soscuisine.com/images/recettes/920.jpg', 'https://www.soscuisine.com//recipe/grilled-fish-fennel', 'The fish can be cooked using either a broiler in the oven or an outdoor grill.', '22 min', '340 kcal', '{\"calories\":\"340\",\"fat\":\"14 g\",\"cholesterol\":\"70 mg\",\"protein\":\"35 g\"}', '{\"excellent_source_of\":\"Fibre, Folacin, Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Potassium, Selenium, Vitamin B6, Vitamin C\",\"good_source_of\":\"Iron, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin E\",\"source_of\":\"Calcium, Copper, Vitamin A, Vitamin K, Zinc\",\"low\":\"Calories, Cholesterol, Saturated Fat, Sodium\",\"free\":\"Sugar, Trans Fat\"}', '2021-06-18 14:12:03'),
(180, 180, 1, 'Grilled Lobster with Pesto', 'Prepare the grill to a medium-high heat. Remove the elastic bands from the claws and plunge one lobster head-first into a large pot of\r\nsalted boiling water, with the tail tucked underneath (to avoid being splashed by the tail). As soon as the water comes to a boil again, after about 3-5 min, take the lobster out of the water using tongs, drain it and transfer it to a work surface. Return the water to a boil and repeat the blanching process with each remaining lobster. For each lobster, place the tip of a large knife in the centre. Cut it lengthwise in half from the centre to the end towards the head (the knife might not cut completely through shell), then cut it in half from the centre to the end towards the tail. Use poultry shears to cut completely through the shell if necessary. Place the lobster halves, meat side up, on the grill. Brush the meat with pesto, then add salt and pepper. Cover the grill; cook the lobsters until the meat is just opaque in the thickest portion of tail, about 7-8 min max for a 500 g lobster. Do not overcook the lobster since it can dry out the meat. Remove the lobsters from the grill, arrange them on a platter then serve.', '[\"lobsters, or cooked\",\"pesto sauce\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/427.jpg', 'https://www.soscuisine.com//recipe/grilled-lobster-pesto', 'Blanching the lobster before grilling is the secret to obtain a more tender meat (and it\'s easier for the faint of heart than splitting it alive into sections before grilling it...). Some people advise putting the living lobster in the freezer 1 hour before cooking to anesthetize it. If you buy previously cooked lobsters, go directly to step 4 and leave them on the grill just long enough to warm them up, 4-5 min.', '20 min', '160 kcal', '{\"calories\":\"160\",\"fat\":\"8 g\",\"cholesterol\":\"110 mg\",\"protein\":\"22 g\"}', '{\"excellent_source_of\":\"Copper, Niacin, Pantothenic Acid, Selenium, Vitamin B12, Zinc\",\"good_source_of\":\"Phosphorus, Vitamin E\",\"source_of\":\"Calcium, Folacin, Magnesium, Potassium\",\"low\":\"Saturated Fat\",\"free\":\"Sugar, Trans Fat\"}', '2021-06-18 14:12:04'),
(181, 181, 1, 'Grilled Salmon with Honey', 'Cut the salmon fillet into similarly sized pieces, as per the number of servings required, then put them in a resealable plastic bag. Add the honey and soy sauce, then mix well. Let marinate 2 hours in the refrigerator. Place the fish on an oiled, hot grill, then cook 8 to 10 min, depending on thickness of the fillet pieces, turning them once. Alternatively, heat the oil in a grooved thick-bottom pan. When hot, add the fish, then cook 4-5 min per side, turning the pieces once. It is important to check with a fork to see if the fish is cooked through Season with salt and pepper, then serve on the warmed plates.', '[\"salmon fillet\",\"honey, liquid\",\"soy sauce\",\"olive oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"resealable plastic bag\"]', 'https://media.soscuisine.com/images/recettes/944.jpg', 'https://www.soscuisine.com//recipe/grilled-salmon-honey', '', '15 min', '180 kcal', '{\"calories\":\"180\",\"fat\":\"4 g\",\"cholesterol\":\"30 mg\",\"protein\":\"20 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Niacin, Phosphorus, Vitamin B12, Vitamin B6, Vitamin D\",\"good_source_of\":\"Potassium\",\"source_of\":\"Iron, Magnesium, Omega-3, Pantothenic Acid, Vitamin B1, Vitamin B2, Vitamin E, Zinc\",\"low\":\"Saturated Fat\",\"free\":\"Trans Fat\"}', '2021-06-18 14:12:06'),
(182, 182, 1, 'Grilled Scallops with Fennel and Lime Butter', 'Prepare the fennels : Trim the stalk and feathery leaves. Discard the stalk but reserve the leaves. Remove any tough outer layers, then cut the bulbs lengthwise into thin wedges. Rinse the scallops and pat dry. Add salt and pepper. Cut half of the limes into wedges. For the other half, finely grate the and squeeze the juice into a small bowl. In a separate bowl, half of the\r\njuice and zest with the scallops. Separate the egg whites and yolks. Set the whites aside in a glass jar with a lid and put them in the refrigerator or freezer for a future use in another recipe. Put the yolks in a small bowl. Add the remaining lime and juice, then until pale and smooth. Put the butter in a microwave safe container and melt it a few seconds in a microwave oven. Gradually the melted butter into the yolk and lime mixture. Continue to whisk until thick and smooth. Finely chop the reserved fennel leaves and add them to the mixture. Season with salt and pepper. Brush the fennel wedges with olive oil and cook them on a hot grill, for 3-4 min, turning them once. Add the scallops and cook another 3-4 min, turning them once, paying attention not to overcook them or they will dry out and get tough. Alternatively, cook the fennels and scallops in a very hot heavy-bottom pan. Serve with the lime butter and reserved lime wedges.', '[\"fennels\",\"scallops, large\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"limes\",\"egg yolks\",\"butter, unsalted\",\"olive oil\"]', 'https://media.soscuisine.com/images/recettes/597.jpg', 'https://www.soscuisine.com//recipe/grilled-scallops-fennel-lime-butter', 'If you prefer to replace the large scallops with small ones, it may be better to thread them onto flat skewers to make turning them easier.', '20 min', '400 kcal', '{\"calories\":\"400\",\"fat\":\"24 g\",\"cholesterol\":\"230 mg\",\"protein\":\"36 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Copper, Folacin, Iron, Magnesium, Niacin, Phosphorus, Potassium, Selenium, Vitamin B12, Vitamin E, Zinc\",\"good_source_of\":\"Calcium, Fibre, Vitamin A, Vitamin C\",\"source_of\":\"Manganese, Pantothenic Acid, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin D\",\"low\":\"Sodium\"}', '2021-06-18 14:12:07'),
(183, 183, 1, 'Almond Trout', 'Heat the butter and oil in a frying pan, taking care not to let them burn. Add the almonds then sauté over medium heat until they are golden (again, taking care so that they don\'t burn). Take the almonds out of the pan then keep them warm on a small plate in the oven. Cook the trout over fairly high heat, 2-3 min on each side, starting with the skin side down. Add the lemon juice, then lower the heat and cover. Cook 7-10 min, depending on the thickness of the fillet(s), until the trout is tender. Check with a fork to see if it is cooked through Take the skin out. Add salt and pepper to taste.  Cover the trout with the almonds and serve.', '[\"trout fillets\",\"flaked almonds\",\"lemon juice, freshly squeezed\",\"butter, unsalted\",\"olive oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/413.jpg', 'https://www.soscuisine.com//recipe/almond-trout-alcohol-free', 'Keep the serving plates in the oven at the lowest setting so they are warm when you serve.', '15 min', '440 kcal', '{\"calories\":\"440\",\"fat\":\"30 g\",\"cholesterol\":\"130 mg\",\"protein\":\"40 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Potassium, Selenium, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin D, Vitamin E\",\"good_source_of\":\"Copper, Iron, Vitamin B6, Zinc\",\"source_of\":\"Calcium, Folacin, Omega-3, Vitamin A, Vitamin C\",\"low\":\"Sodium\"}', '2021-06-18 14:12:08'),
(184, 184, 1, 'Grilled \"Tagliata\" Steak', 'Finely chop the rosemary, then put it in a shallow dish. Add the oregano and freshly ground pepper. Pat the steak dry with paper towels, then press the herb mixture onto both sides of the meat. Let the meat stand at room temperature, loosely covered, for 30 min. Brush the meat with the olive oil, then cook it on a hot grill, or in a heavy-bottom pan, for about 8 min per side for medium-rare, turning it once. Transfer the beef to a board, cover loosely and let stand for about 5 min (to reabsorb the juices). While the meat is cooking, put the mixed greens in a bowl, pour in the Classic\r\nVinaigrette , then season with salt and pepper. , then distribute onto individual serving plates. Slice the meat thinly using a heavy knife, and place the slices over the beds of mixed greens. Pour in any accumulated meat juices, sprinkle with balsamic vinegar and a little salt, then serve.', '[\"rosemary, fresh\",\"dried oregano\",\"ground pepper\",\"beef, top sirloin, or sirloin tip, 5 cm thick\",\"olive oil\",\"mixed greens\",\"Classic Vinaigrette\",\"balsamic vinegar\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/611.jpg', 'https://www.soscuisine.com//recipe/grilled-tagliata-steak', 'When you buy the meat, have it cut into one steak about 5 cm thick.', '25 min', '390 kcal', '{\"calories\":\"390\",\"fat\":\"21 g\",\"cholesterol\":\"110 mg\",\"protein\":\"45 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Iron, Magnesium, Niacin, Pantothenic Acid, Phosphorus, Potassium, Selenium, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin K, Zinc\",\"good_source_of\":\"Folacin, Vitamin A, Vitamin B1, Vitamin D, Vitamin E\",\"source_of\":\"Calcium, Copper, Manganese, Vitamin C\",\"low\":\"Sodium\"}', '2021-06-18 14:12:09'),
(185, 185, 1, 'Grilled Trout in a Balsamic Reduction', 'Pour the balsamic vinegar and honey into a small saucepan and bring to a boil. Cook over medium heat about 5 min until the volume is reduced by half and it reaches a syrupy consistency. Set aside. Lightly oil the trout fillet(s) on both sides. Heat a grooved, thick-bottom frying pan or a nonstick pan. When hot, add the trout, skin side down, and cook about 4 min until the edges become opaque and lighter coloured. Turn and cook an additional 4 min. Peel off the skin and add salt and pepper. Check with a fork to see if it is cooked through . Depending on its thickness, the trout is cooked in 8-10 min total. Alternatively, cook the fillets on a hot grill. Serve on the warmed plates. Drizzle with the balsamic syrup.', '[\"trout fillets\",\"balsamic vinegar\",\"honey\",\"canola oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/339.jpg', 'https://www.soscuisine.com//recipe/grilled-trout-in-balsamic-reduction-alcohol-free', 'Keep the serving plates in the oven at the lowest setting so they are warm when you serve.', '30 min', '360 kcal', '{\"calories\":\"360\",\"fat\":\"15 g\",\"cholesterol\":\"100 mg\",\"protein\":\"38 g\"}', '{\"excellent_source_of\":\"Manganese, Niacin, Pantothenic Acid, Phosphorus, Potassium, Selenium, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin D\",\"good_source_of\":\"Copper, Iron, Magnesium, Vitamin B6\",\"source_of\":\"Calcium, Folacin, Omega-3, Vitamin E, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:12:10'),
(186, 186, 1, 'Grilled-Chicken Caesar Salad', 'Preheat the grill to medium-high heat or preheat the broiler. Pat the chicken dry, then brush it with a little of the oil and season with salt and pepper. Grill or broil the chicken until cooked through and golden-coloured, about 15 min, turning it once. Transfer the chicken to a cutting board and cover it loosely with foil. Meanwhile, lightly oil a baking sheet, using a little more of the oil. Lay the bread cubes on the sheet and coat them thoroughly with the oil. Grill or broil until the cubes are lightly toasted, about 5 min. Set aside.', '[\"chicken breasts, bone-in, skinless\",\"olive oil\",\"bread, whole wheat, for the croutons\",\"anchovy fillets, minced\",\"garlic, crushed\",\"egg yolks\",\"Dijon mustard\",\"Worcestershire sauce\",\"wine vinegar\",\"Parmesan cheese, grated\",\"Romaine lettuce, torn into bite-size pieces\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"paper towels\",\"aluminum foil\"]', 'https://media.soscuisine.com/images/recettes/892.jpg', 'https://www.soscuisine.com//recipe/grilled-chicken-caesar-salad-halal', '', '35 min', '410 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Folacin, Iron, Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B12, Vitamin B6, Vitamin C, Vitamin E, Vitamin K\",\"good_source_of\":\"Vitamin B1, Vitamin B2, Zinc\",\"source_of\":\"Calcium, Copper, Fibre, Vitamin D\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:12:11'),
(187, 187, 1, 'Hamburger with Herbs', 'Finely chop the onion and herbs, then put them in a bowl. Add the ground beef, salt and pepper to taste, then mix well until the mixture is well combined and\r\nsmooth. Using floured hands, form the mixture into flat patties. Lightly brush the burgers with oil and cook on a hot grill for about 10 min, until the outside is golden brown and the inside loses its pink colour. Turn the \r\nburgers once halfway through the cooking. Alternatively, the burgers can be cooked on the stovetop. Melt a little butter in a frying pan over medium-high heat. Add the burgers and cook for about 10 min, turning them once. Place each burger on a slice of bread. Add the lettuce leaves and tomato slices. Serve with mustard and ketchup on the side.', '[\"onions, finely chopped\",\"Italian parsley, fresh, finely chopped\",\"marjoram, fresh, finely chopped\",\"ground beef, lean, or medium-lean\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"white flour (all purpose)\",\"[optional]\",\"olive oil, for brushing\",\"bread, whole wheat\",\"tomatoes, sliced\",\"Boston lettuce, or curly leaf\",\"Dijon mustard to taste\",\"[optional]\",\"ketchup to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/472.jpg', 'https://www.soscuisine.com//recipe/hamburger-herbs', 'These burgers can be cooked either in a pan on the stovetop or using an outdoor grill.', '25 min', '390 kcal', '{\"calories\":\"390\",\"fat\":\"19 g\",\"cholesterol\":\"70 mg\",\"protein\":\"30 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Iron, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B12, Vitamin B6, Vitamin K, Zinc\",\"good_source_of\":\"Fibre, Vitamin B1, Vitamin B2\",\"source_of\":\"Calcium, Copper, Pantothenic Acid, Vitamin C, Vitamin D, Vitamin E\",\"low\":\"Sodium\"}', '2021-06-18 14:12:12'),
(188, 188, 1, 'Honey-Mustard Slow Cooker Chicken', 'Coat the ceramic cooking pot with cooking spray. Prepare the vegetables :  Thinly slice the onion and mince the garlic. Heat half of the oil in a pan over medium heat. Add the onion and garlic then sauté until softened and translucent, about 3 min. Transfer to \r\nthe ceramic cooking pot. Add the remaining oil, honey, mustards, tomato paste, vinegar, water, rosemary, and  a pinch of Cayenne pepper . Mix well to combine. Add the chicken pieces and to coat it with the mixture. Cover the slow cooker with the lid and cook on \'low\' for 7 h. Adjust the seasoning then serve.', '[\"vegetable oil spray\",\"onions, sliced\",\"garlic, minced\",\"olive oil\",\"honey\",\"Dijon mustard\",\"whole-grain mustard\",\"tomato paste\",\"white vinegar\",\"water\",\"rosemary, fresh, chopped\",\"cayenne pepper\",\"chicken breasts, boneless, skinless, cut into 2 cm pieces\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2575.jpg', 'https://www.soscuisine.com//recipe/honey-mustard-chicken-slow-cooker', 'is needed to make this recipe.', '435 min', '250 kcal', '{\"calories\":\"250\",\"fat\":\"8 g\",\"cholesterol\":\"60 mg\",\"protein\":\"27 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Niacin, Vitamin B6\",\"good_source_of\":\"Phosphorus, Potassium\",\"source_of\":\"Calcium, Folacin, Iron, Magnesium, Manganese, Pantothenic Acid, Vitamin A, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin E, Zinc\",\"low\":\"Saturated Fat\",\"free\":\"Trans Fat\"}', '2021-06-18 14:12:13'),
(189, 189, 1, 'Huevos Rancheros', 'Preheat the oven to 205ºC/400ºF.\n   Wrap tortillas in foil, then heat 5 min in the oven. Wrap tortillas in clean kitchen towel to keep them warm. Alternatively, heat tortillas over medium heat in a dry hot pan until warmed and lightly toasted. Heat the oil in a skillet over medium heat. Crack the eggs into the skillet, taking care to keep the yolks intact. Cook them sunny-side up or over easy until the whites are firm but the yolks are still runny, about 4 min. Add salt and pepper to taste. Place one tortilla on each warmed plate. \nCarefully slide two eggs on top of each tortilla. Add the Mexican Rice and Beans and the Fresh Tomatillo Salsa then serve.', '[\"aluminum foil\",\"corn tortillas\",\"olive oil\",\"eggs size large\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"Mexican Rice and Beans\",\"Fresh Tomatillo Salsa\"]', 'https://media.soscuisine.com/images/recettes/2602.jpg', 'https://www.soscuisine.com//recipe/huevos-rancheros', 'Keep the serving plates warm on the stove while you\'re preparing the dish.', '10 min', '490 kcal', '{\"calories\":\"490\",\"fat\":\"19 g\",\"cholesterol\":\"450 mg\",\"protein\":\"22 g\"}', '{\"diet-related_health_claims\":\"Artery-healthy\",\"excellent_source_of\":\"Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Selenium, Vitamin A, Vitamin B12, Vitamin B2, Vitamin E, Zinc\",\"good_source_of\":\"Calcium, Copper, Potassium, Vitamin B1, Vitamin B6, Vitamin D\",\"source_of\":\"Vitamin C, Vitamin K\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:12:14'),
(190, 190, 1, 'Baked Mackerel Fillets', 'Preheat the oven to 175ºC/350ºF. Slice the onion crosswise, then separate the segments to make rings. Arrange the fillets (can be either fresh or frozen) on a cooking dish or plate. Brush lightly with oil, then season with salt and pepper to taste. Cover each fillet with the onion rings. Place in the middle of the oven and cook for about 20 min (25 min if frozen) until the flesh turns white. It is important to check with a fork to see if they are cooked through , \r\nsince they get tough and dry when overcooked. Serve on the warmed plates.', '[\"mackerel fillets\",\"olive oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"onions, sliced crosswise\"]', 'https://media.soscuisine.com/images/recettes/1498.jpg', 'https://www.soscuisine.com//recipe/baked-mackerel-fillets', 'Keep the serving plates warm on the stove while you\'re preparing the dish.', '30 min', '230 kcal', '{\"calories\":\"230\",\"fat\":\"15 g\",\"cholesterol\":\"60 mg\",\"protein\":\"19 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Magnesium, Niacin, Selenium, Vitamin B12, Vitamin D\",\"good_source_of\":\"Phosphorus, Potassium, Vitamin B2, Vitamin B6, Vitamin E\",\"source_of\":\"Iron, Omega-3, Pantothenic Acid, Vitamin B1, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:12:15'),
(191, 191, 1, 'Hungarian Cholent Slow Cooker Beef-Stew', 'Place the in a large bowl, cover them with cold water and leave to soak for at least 8 h or overnight. Drain the beans well, then place them in a large pot, cover with fresh cold water and bring to a boil. Boil them steadily for about 10 min, then drain well and set aside. Meanwhile, heat the oil in a pan, add the onion and cook gently until softened, about 5 min. in the paprika cayenne pepper , then cook 1 min with stirring . Transfer  to the ceramic cooking pot. Add the garlic,  beans, barley, vegetables, beef and hot . Mix well. Cover the slow cooker with the lid and cook 5-6 h on \'low\', or until the meat and vegetables are tender. Add the rice, , and season with salt and pepper. Cover and cook on \'high\' for a further 45 min, or until the rice is cooked. Serve hot.', '[\"romano\\/cranberry beans (dried)\",\"olive oil\",\"onions, finely chopped\",\"paprika\",\"cayenne pepper\",\"garlic, finely chopped\",\"pearl barley\",\"celery, chopped\",\"canned tomatoes (diced)\",\"carrots. into 1 cm rounds\",\"parsnips, into 1 cm rounds\",\"potatoes, cut into 7 mm slices\",\"stewing beef cubes\",\"beef broth, hot\",\"arborio rice\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2101.jpg', 'https://www.soscuisine.com//recipe/hungarian-cholent', '', '440 min', '460 kcal', '{\"calories\":\"460\",\"fat\":\"13 g\",\"cholesterol\":\"80 mg\",\"protein\":\"40 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B12, Vitamin B6, Zinc\",\"good_source_of\":\"Copper, Pantothenic Acid, Vitamin B1, Vitamin B2, Vitamin C, Vitamin E, Vitamin K\",\"source_of\":\"Calcium, Vitamin D\",\"low\":\"Calories, Cholesterol, Fat, Saturated Fat, Sodium\"}', '2021-06-18 14:12:16'),
(192, 192, 1, 'Hunter-Style Chicken', 'the chicken with flour. Finely chop the onion and rosemary. Heat the oil and butter in a pan over high heat. Sauté the chicken pieces thoroughly on each side until golden, about 6-8 min. Take them out of the pan and set aside, keeping them warm in the oven. Add the onion and rosemary into the pan and cook 2-3 min over medium heat. Deglaze with the . Cook 6-8 min over medium heat until the cooking juices reduce and are completely absorbed. Add the diced tomatoes and put the chicken pieces back into the pan. Add salt and pepper. Cook, covered, over medium-low heat 30-35 min. Serve on the warmed plates.', '[\"chicken legs, with back, skinless\",\"onions, finely chopped\",\"rosemary, fresh, finely chopped\",\"olive oil\",\"butter, unsalted\",\"chicken broth\",\"white flour (all purpose)\",\"canned tomatoes (diced)\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/662.jpg', 'https://www.soscuisine.com//recipe/hunter-style-chicken-halal', 'Keep the serving plates in the oven at the lowest setting so they are warm when you serve.', '55 min', '340 kcal', '{\"calories\":\"340\",\"fat\":\"17 g\",\"cholesterol\":\"100 mg\",\"protein\":\"31 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Niacin, Vitamin B6, Zinc\",\"good_source_of\":\"Folacin, Iron, Magnesium, Pantothenic Acid, Phosphorus, Potassium, Vitamin A, Vitamin B12, Vitamin B2\",\"source_of\":\"Copper, Manganese, Selenium, Vitamin B1, Vitamin C, Vitamin E, Vitamin K\"}', '2021-06-18 14:12:17'),
(193, 193, 1, 'Indian Butter Chicken', 'Cut the chicken breasts into cubes then set aside. In a large pan, heat the ghee (clarified butter) over medium-high heat. Sauté the finely chopped onion and cinnamon 3-4 min then add the grated ginger, crushed garlic, cardamom pods, turmeric and minced chili pepper . Cook 1 min with constant stirring . Add the chicken pieces and sauté until they lose their pink colour. Add the tomato paste, ground almonds and diced tomatoes. , cover, lower the heat and simmer about 25 min. In the meantime, mix the yogurt and cream in a small bowl. Add the mixture to the pan at the very end and cook an additional 1-2 min without letting it boil. Add salt and pepper to taste and remove the cardamom pods. Garnish with fresh cilantro leaves then serve.', '[\"chicken breasts, boneless, skinless, diced\",\"butter, unsalted, clarified\",\"onions, finely chopped\",\"ground cinnamon\",\"gingerroot, grated\",\"garlic, crushed\",\"cardamom pods\",\"turmeric\",\"dried chili peppers, minced\",\"tomato paste\",\"flaked almonds, finely ground\",\"canned tomatoes (diced)\",\"yogurt, plain, 2%\",\"cream 15%\",\"fresh cilantro\",\"[optional]\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/156.jpg', 'https://www.soscuisine.com//recipe/indian-butter-chicken', '', '45 min', '320 kcal', '{\"calories\":\"320\",\"fat\":\"13 g\",\"cholesterol\":\"110 mg\",\"protein\":\"38 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Niacin, Phosphorus, Potassium, Vitamin A, Vitamin B12, Vitamin B6\",\"good_source_of\":\"Iron, Magnesium, Manganese, Pantothenic Acid, Vitamin B2, Vitamin E, Zinc\",\"source_of\":\"Calcium, Copper, Folacin, Vitamin B1, Vitamin C, Vitamin D\",\"low\":\"Sodium\"}', '2021-06-18 14:12:18'),
(194, 194, 1, 'Indian-Style Chicken SautÃÂ©', 'Heat the butter in a skillet or over medium heat. Sauté the chicken strips 2-3 minutes. Turn them, add salt and pepper, then cook an additional 2-3 minutes. Remove the chicken from the skillet, transfer to a dish and keep warm in the oven. Add half of the oil to the skillet over medium heat and sauté the finely chopped onion. Coarsely slice the zucchini into rounds and the peppers into narrow strips, of about 7 mm. Add them to the skillet and sauté 7-8 min with occasional stirring . Add 1 teaspoon of curry powder and cook 1 min with constant stirring . Add the soybean sprouts and salt, then cook 3-4 min. Add the contents of the skillet to the chicken strips and keep warm in the oven. Pour the remaining oil into the skillet over medium heat and sauté the crushed garlic 1 min with stirring . Add the remaining curry powder and cook 1 min with constant stirring . Pour in the coconut milk, and cook over very low heat 2-3 min. Put the chicken and vegetables back into the skillet, then mix well with the coconut-curry sauce. Heat a couple of minutes then serve.', '[\"butter, unsalted\",\"canola oil\",\"chicken strips\",\"onions, finely chopped\",\"zucchini, cut into thin rounds\",\"green peppers, cut into thin strips\",\"curry powder\",\"soybean sprouts\",\"garlic, crushed\",\"unsweetened coconut milk\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/377.jpg', 'https://www.soscuisine.com//recipe/indian-style-chicken-saute', 'Put the serving dish in the oven at the lowest setting to keep the chicken strips warm while you cook the vegetables.', '35 min', '430 kcal', '{\"calories\":\"430\",\"fat\":\"30 g\",\"cholesterol\":\"80 mg\",\"protein\":\"30 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Iron, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Selenium, Vitamin B6, Vitamin C, Vitamin E, Vitamin K, Zinc\",\"good_source_of\":\"Copper, Pantothenic Acid, Vitamin A, Vitamin B1, Vitamin B2\",\"source_of\":\"Calcium, Fibre, Omega-3, Vitamin B12\",\"low\":\"Sodium\"}', '2021-06-18 14:12:19'),
(195, 195, 1, 'Indian-Style Split Pea Soup', 'Rinse the splt peas well under cold water and drain. Heat the oil in a pot over medium heat. Finely chop the onion, add it to the pot, and sauté with occasional stirring 4-5 min until translucent. Add the minced or pressed garlic, grated ginger, spices, and cloves. Cook 1 min with stirring . Add the peas and . Season with salt and pepper. Bring to a boil then reduce the heat and simmer , uncovered, 45 min until the peas become very soft. Add the lemon juice and adjust the seasoning If desired, purée the soup in a blender . Serve into bowls and garnish with fresh cilantro leaves (optional).', '[\"green split peas (dried), rinsed and drained\",\"canola oil\",\"onions, finely chopped\",\"garlic, pressed or minced\",\"gingerroot, grated\",\"turmeric\",\"curry powder\",\"cayenne pepper\",\"cloves\",\"chicken broth\",\"lemon juice, freshly squeezed\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"fresh cilantro\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2522.jpg', 'https://www.soscuisine.com//recipe/indian-style-split-pea-soup', 'Split peas do not require presoaking before cooking.', '55 min', '210 kcal', '{\"calories\":\"210\",\"fat\":\"2 g\",\"cholesterol\":\"0 mg\",\"protein\":\"13 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Folacin, Manganese, Potassium\",\"good_source_of\":\"Fibre, Iron, Magnesium, Niacin, Vitamin B1, Zinc\",\"source_of\":\"Copper, Pantothenic Acid, Phosphorus, Vitamin B2, Vitamin B6, Vitamin K\",\"low\":\"Fat, Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:12:20'),
(196, 196, 1, 'Indian-Style Tofu SautÃÂ©', 'Heat a small quantity of oil in a skillet or over medium heat. Coarsely dice the tofu and sauté 7-8 minutes, with gentle tossing , until the dices are golden-coloured. Remove the tofu from the skillet, place in a dish and keep warm in the\r\noven. Add some additional oil to the skillet over medium heat and sauté the finely chopped onion. Coarsely slice the zucchini into rounds and the peppers into narrow strips, of about 7 mm. Add them to the skillet and sauté 7-8 min with occasional stirring . Add 1 teaspoon of curry powder and cook 1 min with constant stirring . Add the soybean sprouts and salt, then cook 2-3 min. Add the contents of the skillet to the tofu dices and keep warm in the oven. Add the remaining oil into the skillet over medium heat and sauté the crushed garlic 1 min with stirring . Add the remaining curry powder and cook 1 min with constant stirring . Pour in the coconut milk, and cook over very low heat 2-3 min. Put the tofu and vegetables back into the skillet, then mix well with the coconut-curry sauce. Heat a couple minutes then serve.', '[\"canola oil\",\"firm regular tofu, diced\",\"onions, finely chopped\",\"zucchini, cut into rounds\",\"green peppers, cut into 7 mm strips\",\"curry powder\",\"soybean sprouts\",\"garlic, crushed\",\"unsweetened coconut milk\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/378.jpg', 'https://www.soscuisine.com//recipe/indian-style-tofu-saute', 'Put the serving dish in the oven at the lowest setting to keep the tofu and vegetables warm while the sauce cooks.', '35 min', '400 kcal', '{\"calories\":\"400\",\"fat\":\"31 g\",\"cholesterol\":\"0 mg\",\"protein\":\"21 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Copper, Folacin, Iron, Magnesium, Manganese, Niacin, Potassium, Selenium, Vitamin B6, Vitamin C, Vitamin E, Vitamin K\",\"good_source_of\":\"Calcium, Phosphorus, Vitamin B1, Zinc\",\"source_of\":\"Fibre, Omega-3, Omega-6, Pantothenic Acid, Vitamin A, Vitamin B2\",\"low\":\"Sodium\"}', '2021-06-18 14:12:20'),
(199, 199, 1, 'Baked Mahi Mahi Fillet', 'Preheat the oven to 230°C/450°F. Prepare the potatoes . Peel and boil or steam 20 min (they should come out half-cooked). Cut into ½ cm slices and lay them out in a generously oiled roasting pan. Place the mahi mahi fillet over the potatoes in the center of the pan. Surround it with the tomatoes, olives, capers, unpealed and crushed garlic cloves, and lemon slices. Add salt and pepper, then pour in the tomato juice and a little oil. Bake in the centre of the oven about 20 min for a 4 cm thick fillet. Since the cooking time depends on the thickness of the fillets and the actual temperature of your oven, it is important to check with a fork to see if the fish is cooked through Serve on the warmed plates.', '[\"mahi mahi fillet, or other firm-textured fish\",\"potatoes\",\"canned tomatoes (diced)\",\"black olives\",\"capers\",\"lemons, sliced\",\"garlic, crushed\",\"tomato juice\",\"olive oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/958.jpg', 'https://www.soscuisine.com//recipe/baked-mahi-mahi-fillet-alcohol-free', 'Keep the serving plates warm on the stove while you\'re preparing the dish.', '40 min', '380 kcal', '{\"calories\":\"380\",\"fat\":\"13 g\",\"cholesterol\":\"130 mg\",\"protein\":\"36 g\"}', '{\"excellent_source_of\":\"Iron, Magnesium, Niacin, Pantothenic Acid, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B12, Vitamin B6, Vitamin C\",\"good_source_of\":\"Copper, Manganese, Vitamin B1, Vitamin E\",\"source_of\":\"Calcium, Fibre, Folacin, Vitamin B2, Vitamin K, Zinc\",\"low\":\"Calories, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:12:24'),
(200, 200, 1, '\"Kafta\" Kebabs', 'Finely chop the onion and parsley, then put them in a bowl. Add the ground beef, bread crumbs, and ground coriander. Add salt and pepper. For a more\r\npiquant flavour, you may add the curry powder. well until the mixture is well combined and smooth. Chill for about 10 minutes in the refrigerator to firm up the meat mixture. The traditional kaftas are sausage-shaped : little balls are made first, then threaded onto skewers and moulded into log shapes about 10 cm long and 3 cm thick. However, it is perfectly acceptable to shape the kaftas into regular patties. Cook the « kaftas » on a lightly oiled hot grill for about 10 min, until the outside is golden brown and the inside loses its pink colour. Turn the patties once halfway through the cooking. Alternatively, heat a nonstick heavy-bottom pan. Add the « kaftas » and cook for about 10 min, turning them once. While the meat is cooking, chop the mint and mix it with the yogurt in a small bowl. Place the « kaftas » on pita bread then serve with the yogurt dip on the side.', '[\"red onions, finely chopped\",\"Italian parsley, fresh, finely chopped\",\"ground beef, lean, or medium-lean\",\"bread crumbs\",\"ground coriander\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"curry powder\",\"[optional]\",\"fresh mint, chopped\",\"yogurt, plain, 2%\",\"pita breads\",\"olive oil\"]', 'https://media.soscuisine.com/images/recettes/555.jpg', 'https://www.soscuisine.com//recipe/kafta-kebabs', 'These patties can be cooked using either an outdoor grill or in a pan on the stovetop.', '30 min', '440 kcal', '{\"calories\":\"440\",\"fat\":\"17 g\",\"cholesterol\":\"60 mg\",\"protein\":\"31 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Iron, Niacin, Potassium, Selenium, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin K, Zinc\",\"good_source_of\":\"Magnesium, Manganese, Phosphorus, Vitamin A, Vitamin B6, Vitamin C\",\"source_of\":\"Calcium, Copper, Fibre, Pantothenic Acid, Vitamin D, Vitamin E\"}', '2021-06-18 14:12:25');
INSERT INTO `recipe_translation` (`rt_id`, `rt_recipe_id`, `rt_lang_id`, `rt_recipe_name`, `rt_recipe_text`, `rt_recipe_ingredients_full`, `rt_recipe_image`, `rt_recipe_link`, `rt_recipe_prep`, `rt_recipe_duration`, `rt_recipe_calories`, `rt_recipe_nutrients`, `rt_recipe_claims`, `rt_created`) VALUES
(201, 201, 1, 'Lamb and Vegetable Stew', 'Preheat the oven to 175°C/350°F. Prepare the vegetables . Mince the garlic and chop the onion. Cut the peppers into 1,5 cm strips. Peel the potatoes then cut them into 7 mm-thick slices. Heat half of the oil in a pan over medium heat. Sauté the garlic and onion 3-4 min until soft. Add the pepper strips. Cover and cook 15 min with occasional stirring . Season with  salt and pepper. In the meantime, cut the lamb into 4 cm pieces, then with flour. Heat the rest of the oil in another pan over high heat. Sauté the lamb pieces, turning frequently. Cook about 10-12 min, until golden, then season with salt and pepper. Cover the bottom of a baking dish with the potato slices. Lay the lamb pieces with the cooking juices over the potato slices. Add the other cooked vegetables. Pour in the . Cover with one more layer of potato slices. Sprinkle with bread crumbs and grated cheese. Cover. Cook 2 h with the lid on, then uncover and cook an additional ½ h. Serve directly out of the baking dish.', '[\"lamb\'s leg, boneless, cut into 4 cm pieces\",\"potatoes, peeled, then cut into 7 mm slices\",\"yellow or red sweet peppers, cut into strips\",\"onions, finely chopped\",\"garlic, minced\",\"olive oil\",\"white flour (all purpose)\",\"beef broth\",\"bread crumbs\",\"Parmesan cheese, grated\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/810.jpg', 'https://www.soscuisine.com//recipe/lamb-vegetable-stew-alcohol-free', 'dish with a tight-fitting lid is necessary for this recipe.', '170 min', '380 kcal', '{\"calories\":\"380\",\"fat\":\"12 g\",\"cholesterol\":\"70 mg\",\"protein\":\"27 g\"}', '{\"excellent_source_of\":\"Folacin, Magnesium, Niacin, Phosphorus, Potassium, Selenium, Vitamin B1, Vitamin B12, Vitamin B6, Vitamin C, Zinc\",\"good_source_of\":\"Copper, Fibre, Iron, Manganese, Pantothenic Acid, Vitamin A, Vitamin B2, Vitamin E\",\"source_of\":\"Calcium, Vitamin D, Vitamin K\",\"low\":\"Calories, Cholesterol, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:12:26'),
(202, 202, 1, 'Lamb Tagine with Fennel', 'Preheat the oven to 175°C/350°F. In a small bowl, macerate the raisins in water. Prepare the vegetables . Mince the onion and garlic, cut the fennel into thin slices, and chop the carrot. Cut the lamb into 3-4 cm pieces. Heat the oil in a pan over high heat. Sauté the lamb pieces, turning frequently. Cook about 8-10 min, until golden. Add salt and pepper, then transfer the lamb and cooking juice into the tagine casserole . Set aside. In the same pan, add the butter and sauté the onion, garlic, and fennel 2-3 min over medium heat. Add the carrot and diced tomatoes. Cook 5 min. Place the vegetables into the casserole with the lamb pieces. Add the raisins, olives, whole almonds (optional), cilantro , bay leaves, and spices. Pour in the warm . Cook 40 min with the lid on and then 15 min without, in order to reduce the juice. Sprinkle with lemon juice. Adjust the seasoning When ready to serve, cook the couscous . Serve directly out of the casserole with the couscous on the side.', '[\"lamb\'s shoulder, boneless, cut into 3-4 cm pieces\",\"fennels, thinly sliced\",\"onions, finely chopped\",\"garlic, finely chopped\",\"carrots, diced\",\"canned tomatoes (diced)\",\"black olives\",\"almonds\",\"[optional]\",\"raisins\",\"butter, unsalted\",\"olive oil\",\"beef broth\",\"ground cumin\",\"curry powder\",\"couscous spice (ras-el-hanout)\",\"bay leaf\",\"fresh cilantro\",\"lemon juice, freshly squeezed\",\"couscous, whole wheat\",\"ground pepper to taste\",\"[optional]\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/105.jpg', 'https://www.soscuisine.com//recipe/lamb-tagine-fennel', '', '90 min', '570 kcal', '{\"calories\":\"570\",\"fat\":\"21 g\",\"cholesterol\":\"100 mg\",\"protein\":\"35 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B12, Vitamin B2, Zinc\",\"good_source_of\":\"Copper, Pantothenic Acid, Vitamin B1, Vitamin B6, Vitamin C, Vitamin E, Vitamin K\",\"source_of\":\"Calcium, Vitamin D\",\"low\":\"Calories, Cholesterol, Saturated Fat, Sodium\"}', '2021-06-18 14:12:27'),
(203, 203, 1, 'Lasagna with Tomato Sauce', 'Heat the butter in a heavy saucepan over moderately low heat until it has melted, then add the flour and cook the over low heat, with whisking , for 3 minutes. Add the milk in a fast stream while whisking vigorously to avoid lumps. Bring to a boil, then reduce the heat and simmer , whisking occasionally, 6-7 minutes. Season with salt and \r\npepper. Add all the grated Parmesan minus about 3 spoonfuls (set this aside for sprinkling on top of the assembled lasagna dish). in the grated nutmeg.', '[\"butter, unsalted\",\"white flour (all purpose)\",\"milk, partly skimmed, 2%, luke-warm\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"Parmesan cheese, grated\",\"nutmeg, grated\",\"lasagne noodles, oven-ready type (8,5x15cm)\",\"My Mother\'s Tomato Sauce\"]', 'https://media.soscuisine.com/images/recettes/977.jpg', 'https://www.soscuisine.com//recipe/lasagna-tomato-sauce', 'This recipe uses oven-ready lasagne noodles, which do not require any precooking before baking. It\'s up to you to decide whether or not you should skip this painstaking step: you may use them \"as is\" directly in the baking dish, or you may precook them anyway to obtain soft noodles which can be cut up easily to better fit the baking dish. Other advantages of precooking are that the noodles will absorb the sauce better, and the final baking will be faster.', '55 min', '530 kcal', '{\"calories\":\"530\",\"fat\":\"22 g\",\"cholesterol\":\"50 mg\",\"protein\":\"18 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Calcium, Folacin, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B12, Vitamin B2, Vitamin D\",\"good_source_of\":\"Magnesium, Niacin, Vitamin B1\",\"source_of\":\"Copper, Fibre, Iron, Manganese, Pantothenic Acid, Vitamin B6, Vitamin C, Vitamin E, Vitamin K, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:12:28'),
(204, 204, 1, 'Baked Salmon with Herbs', 'Preheat the oven to 215°C/425°F. Cut the salmon fillet into pieces of comparable size, as per the number of servings required. Put them on an oiled baking sheet and brush them with oil. Add salt and pepper, then cover with the oregano. Place in the middle of the oven and bake for about 10 min for a 2 to 2,5 cm thick fillet. Since the cooking time depends on the fillet thickness and the\r\nactual temperature of the oven, it is important to check\r\nwith a fork to see if the fish is cooked through . Serve on the warmed plates.', '[\"salmon fillet\",\"olive oil\",\"dried oregano\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/15.jpg', 'https://www.soscuisine.com//recipe/baked-salmon-herbs', 'Keep the serving plates warm on the stove while you\'re preparing the dish.', '15 min', '220 kcal', '{\"calories\":\"220\",\"fat\":\"10 g\",\"cholesterol\":\"110 mg\",\"protein\":\"30 g\"}', '{\"free\":\"Sugar\",\"excellent_source_of\":\"Niacin, Phosphorus, Potassium, Selenium, Vitamin B12, Vitamin B6, Vitamin D\",\"good_source_of\":\"Vitamin B2, Vitamin E\",\"source_of\":\"Iron, Magnesium, Omega-3, Pantothenic Acid, Vitamin B1, Vitamin K, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:12:29'),
(205, 205, 1, 'Lazy Fish', 'Heat the oil in a skillet, over medium heat. Add the garlic and sauté 1 min, with stirring . Add the fish filllet then cook 1 min on one side. Turn the fillets then cook 1 min on the other side. Add the mini-tomatoes and the parsley and garlic base . Season with salt and pepper to taste. Cover and cook about 5-7 min over medium heat. The fillets are cooked when they turn opaque. Serve on the warmed plates.', '[\"olive oil\",\"garlic, chopped\",\"tilapia fillets, or turbot\",\"mini-tomatoes (cherry, miniature or grape)\",\"Parsley and Garlic Base\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1564.jpg', 'https://www.soscuisine.com//recipe/lazy-fish', 'Keep the serving plates in the oven at the lowest setting so they are warm when you serve.', '20 min', '260 kcal', '{\"calories\":\"260\",\"fat\":\"12 g\",\"cholesterol\":\"80 mg\",\"protein\":\"37 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Niacin, Phosphorus, Potassium, Selenium, Vitamin B12, Vitamin E, Vitamin K\",\"good_source_of\":\"Magnesium\",\"source_of\":\"Copper, Folacin, Iron, Manganese, Pantothenic Acid, Vitamin A, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin C, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:12:30'),
(206, 206, 1, 'Legume Pasta alla Puttanesca', 'To save time, the sauce preparation and the pasta cooking can be done at the same time. Start by cooking the pasta Meanwhile, heat the olive oil in a saucepan over medium heat. Sauté the finely chopped garlic, 1 min taking care not to let it burn. Chop the anchovies, then add them to the pan and cook with stirring . When they have broken apart and «melted» (after about 2 min), add the coarsely chopped capers, olive paste parsley and garlic base and diced tomatoes. Cook, uncovered, for 7-8 min over low heat while stirring from time to time. Add pepper to taste. In general, it is not necessary to add salt since the anchovies are already salted. Put the drained spaghetti back into the pasta cooking pot, add the sauce, then mix well. Serve in the warmed dishes.', '[\"legume pasta\",\"canned tomatoes (diced)\",\"anchovy fillets, chopped\",\"olive paste\",\"capers, coarsely chopped\",\"garlic, finely chopped\",\"Parsley and Garlic Base\",\"olive oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/3733.jpg', 'https://www.soscuisine.com//recipe/legume-pasta-alla-puttanesca', '', '20 min', '410 kcal', '{\"calories\":\"410\",\"fat\":\"15 g\",\"cholesterol\":\"0 mg\",\"protein\":\"23 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Fibre, Iron, Vitamin K\",\"good_source_of\":\"Vitamin E\",\"source_of\":\"Calcium, Niacin, Selenium, Vitamin A, Vitamin C\",\"low\":\"Cholesterol, Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:12:34'),
(207, 207, 1, 'Lemon Scaloppine', 'Flatten and tenderize the cutlets using a meat pounder. Make a few shallow cuts around the outside edge to avoid curling during cooking. them with the flour and shake off the excess. Heat the butter and oil in a pan over medium heat, taking care not to let them burn. Add the whole garlic cloves, sauté 1-2 min, then add the cutlets, and each side for about 1 min. Pour the warm into the pan, cover, and cook over low heat 5-6 min. Take out the garlic, add the lemon juice, then cook 1 min. Add salt and pepper to taste. Sprinkle with chopped parsley then serve on the warmed plates.', '[\"veal cutlets, thinly sliced\",\"white flour (all purpose)\",\"lemon juice, freshly squeezed\",\"butter, unsalted\",\"canola oil\",\"beef broth\",\"Italian parsley, fresh, chopped\",\"garlic\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/39.jpg', 'https://www.soscuisine.com//recipe/lemon-scaloppine', '', '15 min', '260 kcal', '{\"calories\":\"260\",\"fat\":\"12 g\",\"cholesterol\":\"90 mg\",\"protein\":\"27 g\"}', '{\"free\":\"Sugar\",\"excellent_source_of\":\"Niacin, Vitamin B12\",\"good_source_of\":\"Phosphorus, Potassium, Selenium, Vitamin B2, Vitamin B6, Vitamin K, Zinc\",\"source_of\":\"Folacin, Iron, Magnesium, Manganese, Pantothenic Acid, Vitamin A, Vitamin B1, Vitamin C, Vitamin D, Vitamin E\"}', '2021-06-18 14:12:37'),
(208, 208, 1, 'Lentil and Potato Pie', 'Preheat the oven to 190°C/375°F. Rinse the lentils and pick out any small stones and debris. Cook them in a saucepan of salted water, about 20-25 min until tender but still somewhat al\r\ndente . Drain the lentils, discard the liquid, and set them aside. Meanwhile, peel the potatoes, cut them in half then them 20-25 min until very tender. Drain them well and set aside. Prepare the remaining vegetables : finely chop the onion; mince the garlic; and thinly slice the mushrooms. Heat half of the oil in a pan over medium-low heat. Add the onion and garlic then sauté 3-4 min with occasional stirring . Heat the remaining oil in another pan over moderately high heat, then add the mushrooms and sauté, with some stirring, until they are golden-brown and any liquid they may release has evaporated, about 5 min. Season with salt and pepper, then transfer the mushrooms to the onion pan. Stir in the lentils, soy, Tabasco sauce and Parsley and Garlic Base Adjust the seasoning , then transfer the contents to a baking dish. Cook the frozen corn about 3 min in a small pot of salted boiling water. Drain well, then place the corn on top of the lentils. Pour the milk into a large microwave-safe bowl. Add the butter and microwave on medium-high a few minutes, uncovered, until very hot. Add the cooked potatoes and mash the mixture until it is creamy. Add salt and pepper to taste. Place a spoonful of the potato mixture on top of the lentil and corn layers, then gently spread it with a spoon to cover evenly. Bake in the middle of the oven until the top is golden-brown, about 30 min. Serve.', '[\"green or brown lentils (dried)\",\"potatoes\",\"onions, fin\",\"garlic, minced\",\"button (white) mushrooms, thinly sliced\",\"olive oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"soy sauce\",\"Tabasco sauce\",\"Parsley and Garlic Base\",\"frozen corn kernels\",\"milk, partly skimmed, 2%\",\"butter, unsalted\"]', 'https://media.soscuisine.com/images/recettes/980.jpg', 'https://www.soscuisine.com//recipe/lentil-potato-pie', 'in advance. If preferred, canned lentils may replace the dried lentils (2 cups canned is equivalent to about 1 cup dried).', '60 min', '350 kcal', '{\"calories\":\"350\",\"fat\":\"10 g\",\"cholesterol\":\"10 mg\",\"protein\":\"13 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Copper, Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Potassium, Selenium, Vitamin B1, Vitamin B6, Vitamin K, Zinc\",\"good_source_of\":\"Vitamin B2\",\"source_of\":\"Calcium, Vitamin A, Vitamin B12, Vitamin C, Vitamin D, Vitamin E\"}', '2021-06-18 14:12:39'),
(209, 209, 1, 'Lentil and Vegetable Pie', 'Preheat the oven to 190°C/375°F. Rinse the lentils and pick out any small stones and debris. Cook them in a saucepan of salted water, about 20-25 min until tender but still somewhat al\r\ndente . Drain the lentils, discard the liquid, and set them aside. Meanwhile, peel the potatoes, cut them in half then them 20-25 min until very tender. Drain them well and set aside. Prepare the remaining vegetables : finely chop the onion; mince the garlic; and thinly slice the mushrooms. Heat half of the oil in a pan over medium-low heat. Add the onion and garlic then sauté 3-4 min with occasional stirring . Heat the remaining oil in another pan over moderately high heat, then add the mushrooms and sauté, with some stirring, until they are golden-brown and any liquid they may release has evaporated, about 5 min. Season with salt and pepper, then transfer the mushrooms to the onion pan. Stir in the lentils, soy, Tabasco sauce and Parsley and Garlic Base Adjust the seasoning , then transfer the contents to a baking dish. Cook the frozen peas about 3 min in a small pot of salted boiling water. Drain well, then place the peas on top of the lentils. Pour the milk into a large microwave-safe bowl. Add the butter and microwave on medium-high a few minutes, uncovered, until very hot. Add the cooked potatoes and mash the mixture until it is creamy. Add salt and pepper to taste. Place a spoonful of the potato mixture on top of the lentil and pea layers, then gently spread it with a spoon to cover evenly. Bake in the middle of the oven until the top is golden-brown, about 30 min. Serve.', '[\"green du Puy lentils (dried)\",\"potatoes, peeled and halved\",\"sweet potatoes, peeled and halved\",\"onions, fin\",\"garlic, minced\",\"button (white) mushrooms, thinly sliced\",\"olive oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"soy sauce\",\"Tabasco sauce\",\"Parsley and Garlic Base\",\"frozen peas\",\"milk, partly skimmed, 2%\",\"butter, unsalted\"]', 'https://media.soscuisine.com/images/recettes/2623.jpg', 'https://www.soscuisine.com//recipe/lentil-vegetable-pie', 'in advance. If preferred, canned lentils may replace the dried lentils (2 cups canned is equivalent to about 1 cup dried).', '60 min', '350 kcal', '{\"calories\":\"350\",\"fat\":\"10 g\",\"cholesterol\":\"10 mg\",\"protein\":\"14 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Copper, Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin K, Zinc\",\"good_source_of\":\"Vitamin C\",\"source_of\":\"Calcium, Vitamin B12, Vitamin D, Vitamin E\"}', '2021-06-18 14:12:41'),
(210, 210, 1, 'Basil Crisp Chicken Breast', 'Preheat the oven to 190°C/375°F. Chop the basil finely and put it in a bowl. Add the yogurt, cornstarch, salt, and pepper, then mix well. Butterfly the chicken breasts by splitting the thickness in half with a cut starting on one side and slicing to almost, but not completely through to the other side. Fold the breasts, then spread half of the mixture inside the fold and the other half over the top. Lay the chicken breasts in an ovenproof dish. In a bowl, mix the bread crumbs and the grated parmesan, then sprinkle the mixture over the chicken. Bake, uncovered, in the upper third of the oven for about 35 min, until the chicken is cooked and the crust is browned. Serve on the warmed plates.', '[\"fresh basil, chopped\",\"yogurt, plain, 2%\",\"cornstarch\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"chicken breasts, boneless, skinless, butterflied\",\"bread crumbs\",\"Parmesan cheese, grated\"]', 'https://media.soscuisine.com/images/recettes/266.jpg', 'https://www.soscuisine.com//recipe/basil-crisp-chicken-breast', 'Keep the serving plates warm on the stove while you\'re preparing the dish.', '45 min', '340 kcal', '{\"calories\":\"340\",\"fat\":\"6 g\",\"cholesterol\":\"100 mg\",\"protein\":\"45 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Calcium, Magnesium, Niacin, Phosphorus, Potassium, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin K, Zinc\",\"good_source_of\":\"Folacin, Iron, Manganese, Pantothenic Acid, Selenium, Vitamin B1\",\"source_of\":\"Copper, Vitamin A, Vitamin D\"}', '2021-06-18 14:12:42'),
(211, 211, 1, 'Ligurian Mussels', 'Carefully rinse and brush the mussels to remove any sand. Drain. Discard any of the mussels that stay open, even after being tapped, because they are not edible. Cook in a covered saucepan with the parsley and garlic base and oil over medium heat. After 7-8 min, all the mussels should be open and ready; discard any that are still closed. Serve warm. Have a side bowl on the table to collect the empty shells.', '[\"mussels\",\"olive oil\",\"Parsley and Garlic Base\"]', 'https://media.soscuisine.com/images/recettes/84.jpg', 'https://www.soscuisine.com//recipe/ligurian-mussels', '.', '20 min', '330 kcal', '{\"calories\":\"330\",\"fat\":\"16 g\",\"cholesterol\":\"80 mg\",\"protein\":\"32 g\"}', '{\"free\":\"Sugar\",\"excellent_source_of\":\"Folacin, Iron, Manganese, Niacin, Phosphorus, Selenium, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin E, Vitamin K, Zinc\",\"good_source_of\":\"Magnesium, Pantothenic Acid, Potassium, Vitamin A, Vitamin C\",\"source_of\":\"Copper, Omega-3, Vitamin B6, Vitamin D\"}', '2021-06-18 14:12:43'),
(212, 212, 1, 'Linguine Alfredo', 'To save time, the sauce preparation and the pasta cooking can be done at the same time: Start cooking the pasta Meanwhile, pour the cream into a saucepan, which is large enough to also hold the pasta, then bring it to a boil. Lower the heat to very low, add the grated Parmesan, then mix well. Keep the pan warm over the low heat. Drain the pasta then add it to the saucepan. Add a little salt and pepper to taste. Mix well and serve on the warmed plates.', '[\"linguine\",\"whipping cream 35%\",\"Parmesan cheese, grated\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1119.jpg', 'https://www.soscuisine.com//recipe/linguine-alfredo', '', '15 min', '470 kcal', '{\"calories\":\"470\",\"fat\":\"19 g\",\"cholesterol\":\"60 mg\",\"protein\":\"14 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Manganese, Selenium\",\"good_source_of\":\"Magnesium, Niacin, Phosphorus, Vitamin A, Zinc\",\"source_of\":\"Calcium, Copper, Fibre, Folacin, Iron, Pantothenic Acid, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin D, Vitamin E\"}', '2021-06-18 14:12:43'),
(213, 213, 1, 'Lobster Roll', 'Remove the elastic bands from the claws and plunge one lobster, head-first, into a large pot of\r\nsalted boiling water, with the tail tucked underneath (to avoid being splashed by the tail). \r\nLoosely cover the pot and cook the lobsters over moderately high heat until the shell turns red. From the time the water comes to a boil again, plan to cook 5 min for a 500 g lobster (add 1 min for each additional 100 g). Transfer the lobsters with tongs to a sink to drain and cool. Obviously, this step is skipped if starting with a cooked lobster. When the lobsters are cool enough to handle, twist off the claws and crack them, then remove the meat. Halve the lobsters lengthwise with a large knife or poultry shears, beginning from the tail end, then remove the tail meat. Cut all the lobster meat into bite-size pieces then set them aside. In a bowl, together the lemon juice,  mayonnaise, and ketchup until well blended. Mix in the celery and radish, then lightly mix   in the lobster so it just gets coated without falling apart. Stuff the lobster filling into the rolls and put the greens over the filling. Season with salt and pepper then enjoy.', '[\"lobsters, or cooked\",\"lemon juice, freshly squeezed\",\"mayonnaise\",\"ketchup\",\"celery, thinly sliced\",\"radishes, thinly sliced\",\"panino rolls, ciabatta type\",\"mixed greens\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2473.jpg', 'https://www.soscuisine.com//recipe/lobster-roll', 'will make slicing the radish and celery easier.', '20 min', '470 kcal', '{\"calories\":\"470\",\"fat\":\"12 g\",\"cholesterol\":\"80 mg\",\"protein\":\"32 g\"}', '{\"excellent_source_of\":\"Copper, Folacin, Iron, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Selenium, Vitamin B1, Vitamin B12, Vitamin B2, Zinc\",\"good_source_of\":\"Calcium, Pantothenic Acid, Vitamin A, Vitamin E, Vitamin K\",\"source_of\":\"Fibre, Omega-6, Vitamin B6, Vitamin C\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:12:44'),
(214, 214, 1, 'Macaroni and Cheese', 'cooking the pasta In a saucepan, melt the butter over medium heat. Add the minced chili pepper sauté 1 min, then add the flour and cook 2 min with stirring . Pour in the milk and bring to a boil. Add the mustard and grated cheeses while stirring until the sauce is smooth. Put the drained pasta back into the pasta cooking pot, add the sauce and mix well. Serve in the warmed dishes.', '[\"pipe rigate, or other short-cut pasta\",\"butter, unsalted\",\"dried chili peppers, minced\",\"white flour (all purpose)\",\"milk, partly skimmed, 2%\",\"whole-grain mustard\",\"Cheddar cheese, grated\",\"Parmesan cheese, grated\"]', 'https://media.soscuisine.com/images/recettes/237.jpg', 'https://www.soscuisine.com//recipe/macaroni-cheese', '', '25 min', '480 kcal', '{\"calories\":\"480\",\"fat\":\"14 g\",\"cholesterol\":\"40 mg\",\"protein\":\"19 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Manganese, Phosphorus, Selenium\",\"good_source_of\":\"Calcium, Magnesium, Niacin, Vitamin B12, Zinc\",\"source_of\":\"Copper, Fibre, Folacin, Iron, Pantothenic Acid, Vitamin A, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin D\"}', '2021-06-18 14:12:45'),
(215, 215, 1, 'Maple-glazed Chicken and Sweet Potatoes', 'Preheat the oven to 230°C/450°F. Prepare the vegetables: Cut the carrots and potatoes into pieces, about 1,5 cm; cut the shallots in half, then lay out the vegetables on a sheet or an oven-proof dish. Add the chicken pieces, rosemary, and pressed garlic. Pour the syrup on top, then mix all the pieces well to coat them thoroughly with the syrup. Season with salt and pepper to taste. Cook in the middle of the oven until it is golden-coloured, about 40 min. Turn the pieces halfway through the cooking. You may need to add a few spoonfuls of water to prevent the pieces from sticking to the sheet. Serve on the warmed dishes.', '[\"carrots, cut into 1,5 cm pieces\",\"sweet potatoes, peeled and cut into 1,5 cm pieces\",\"shallots, cut in half\",\"chicken thighs, bone-in\",\"rosemary, fresh\",\"garlic, pressed\",\"maple syrup\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1128.jpg', 'https://www.soscuisine.com//recipe/maple-glazed-chicken-sweet-potatoes', 'Keep the serving plates warm on the stove while you\'re preparing the dish.', '50 min', '430 kcal', '{\"calories\":\"430\",\"fat\":\"7 g\",\"cholesterol\":\"70 mg\",\"protein\":\"27 g\"}', '{\"excellent_source_of\":\"Fibre, Magnesium, Manganese, Potassium, Vitamin A, Vitamin B2, Vitamin B6, Vitamin C\",\"good_source_of\":\"Copper, Folacin, Iron, Niacin, Pantothenic Acid, Vitamin B1, Vitamin E, Vitamin K\",\"source_of\":\"Calcium, Phosphorus, Zinc\",\"low\":\"Calories, Cholesterol, Fat, Sodium\",\"free\":\"Saturated Fat, Trans Fat\"}', '2021-06-18 14:12:46'),
(216, 216, 1, 'Marengo Chicken', 'the chicken with flour. Prepare the vegetables: Finely chop the garlic and shallot; slice the mushrooms. Heat the butter in a pan, over medium heat and sauté the pieces thoroughly on each side until golden, about 6-7 min. Set them aside on the warmed serving plate in the oven. Add the oil to the pan and heat. Add the garlic and shallot, bay leaf, and thyme. Cook 2-3 min. Pour half of the warm then scrape the bottom of the pan thoroughly as the liquid comes to a boil. Add the chicken back in. Add the remaining broth and the tomato paste, cover, and simmer . Turn the chicken pieces 2 or 3 times during the cooking. Add the mushrooms to the pan after the chicken has cooked 30-35 min. Cook an additional 10-15 min. Add salt and pepper to taste. Serve.', '[\"chicken legs, with back, skinless\",\"white flour (all purpose)\",\"garlic, finely chopped\",\"shallots, finely chopped\",\"button (white) mushrooms, sliced\",\"butter, unsalted\",\"olive oil\",\"bay leaf\",\"fresh thyme\",\"chicken broth\",\"tomato paste\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/296.jpg', 'https://www.soscuisine.com//recipe/marengo-chicken-alcohol-free', 'Put the serving dish in the oven at the lowest setting to keep the chicken warm.', '55 min', '320 kcal', '{\"calories\":\"320\",\"fat\":\"15 g\",\"cholesterol\":\"100 mg\",\"protein\":\"32 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Niacin, Pantothenic Acid, Phosphorus, Potassium, Selenium, Vitamin B2, Vitamin B6, Zinc\",\"good_source_of\":\"Copper, Folacin, Iron, Magnesium, Vitamin A, Vitamin B1, Vitamin B12\",\"source_of\":\"Manganese, Vitamin E\"}', '2021-06-18 14:12:46'),
(217, 217, 1, 'Maria del Pilar\'s Mexican Soup', 'Prepare the vegetables . Coarsely chop the onion and peppers. or mince the garlic. Peel the potatoes and keep them whole. Heat the oil in a pot. Sauté the onion over medium heat 3-4 min, until soft, then lower the heat, add the peppers, garlic and salt. Cook 10-12 min. Add the minced chili\r\npepper , oregano, the diced tomatoes, the whole potatoes, and the . Cook about 20 min over medium-low heat, until the potatoes are fork-tender. Purée the soup in a blender , then\r\npour it back into the pot. While the soup is cooking, boil the frozen peas 5 min in a small pot of boiling salted water. Set aside. Drain the beans, rinse them, drain again then add them to the pot. Add also the peas. Warm up the soup just a few minutes. Adjust the seasoning . You may want to add Tabasco sauce for extra pungency. Pour the soup into bowls. You may garnish each bowl with cubed avocado, grated Cheddar, and cilantro leaves. Serve with grilled tortillas.', '[\"red onions, coarsely chopped\",\"yellow or red sweet peppers, coarsely chopped\",\"potatoes, peeled\",\"garlic, minced or pressed\",\"canola oil\",\"dried chili peppers, minced\",\"dried oregano\",\"canned tomatoes (diced)\",\"chicken broth\",\"frozen peas\",\"red beans (canned), rinsed and drained\",\"Tabasco sauce, to taste\",\"avocados, cubed\",\"[optional]\",\"Cheddar cheese, grated\",\"[optional]\",\"corn tortillas\",\"[optional]\",\"fresh cilantro\",\"[optional]\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/463.jpg', 'https://www.soscuisine.com//recipe/maria-del-pilar-mexican-soup', 'will be very useful to purée the soup.', '55 min', '230 kcal', '{\"calories\":\"230\",\"fat\":\"8 g\",\"cholesterol\":\"0 mg\",\"protein\":\"7 g\"}', '{\"excellent_source_of\":\"Fibre, Folacin, Manganese, Potassium, Vitamin A, Vitamin B6, Vitamin C, Vitamin E, Vitamin K\",\"good_source_of\":\"Iron, Magnesium, Niacin, Phosphorus, Vitamin B1\",\"source_of\":\"Calcium, Copper, Omega-3, Pantothenic Acid, Vitamin B2, Zinc\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:12:47'),
(218, 218, 1, 'Marinated Octopus Salad', 'Put the frozen octopus in a bowl, under running water to defrost it rapidly. Transfer it to a pot, add water to cover and a little salt. Turn the heat to medium, cover, and bring to a boil. Adjust the heat so that the liquid simmers slowly and cook until the octopus is tender, about 30 min per pound (1/2 kilo). Check with the sharp point of a thin-bladed knife; when it meets little resistance, the octopus is done. If using a pressure cooker the cooking time is reduced to 10 min per pound (1/2 kilo). Leave the octopus to cool down completely in the liquid until at room temperature. Transfer the octopus to a cutting board, discard the skin and cut the meat into bite-sized pieces. Set aside. Meanwhile, finely chop the vegetables then add them to a salad bowl. Pour in the oil and lemon juice. Add the octopus, season with salt and pepper, sprinkle with oregano and well. Let stand 30 min before serving.', '[\"octopus, frozen, cleaned\",\"red onions, finely chopped\",\"celery, finely chopped\",\"radishes, finely chopped\",\"capers, finely chopped\",\"extra virgin olive oil\",\"lemon juice, freshly squeezed\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"dried oregano\"]', 'https://media.soscuisine.com/images/recettes/4232.jpg', 'https://www.soscuisine.com//recipe/marinated-octopus-salad', 'will reduce the cooking time.', '70 min', '290 kcal', '{\"calories\":\"290\",\"fat\":\"17 g\",\"cholesterol\":\"90 mg\",\"protein\":\"27 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Copper, Iron, Niacin, Potassium, Selenium, Vitamin B12, Vitamin B6, Vitamin E, Zinc\",\"good_source_of\":\"Folacin, Magnesium, Phosphorus, Vitamin K\",\"source_of\":\"Calcium, Omega-3, Pantothenic Acid, Vitamin A, Vitamin B1, Vitamin B2, Vitamin C\"}', '2021-06-18 14:12:48'),
(219, 219, 1, 'Marinated Swordfish with Marjoram', 'In a plastic bag, add all the ingredients of the marinade (mustard, oil, chopped marjoram, minced garlic, salt, and pepper) and mix well. Add the steak(s), turning them to well, then close the bag tightly. Chill in a refrigerator at least 1 hour or overnight, turning the bag occasionally. Heat a nonstick frying pan over medium-high heat and sauté the swordfish. Cook about 3 min per side for a 1,5 cm thick steak. When ready, the steak(s) will be opaque throughout and slightly brown on the surface\r\n( avoid overcooking as it dries the fish out and makes it tough!) Drizzle with optional extra virgin olive oil, then serve on the warmed plates.', '[\"resealable plastic bag\",\"Dijon mustard\",\"olive oil\",\"marjoram, fresh, chopped\",\"garlic, minced\",\"salt\",\"ground pepper\",\"swordfish steaks, ou shark\",\"extra virgin olive oil\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/274.jpg', 'https://www.soscuisine.com//recipe/marinated-swordfish-marjoram', 'Keep the serving plates in the oven at the lowest setting so they are warm when you serve.', '20 min', '270 kcal', '{\"calories\":\"270\",\"fat\":\"14 g\",\"cholesterol\":\"60 mg\",\"protein\":\"31 g\"}', '{\"free\":\"Sugar\",\"excellent_source_of\":\"Iron, Niacin, Phosphorus, Selenium, Vitamin B12, Vitamin B6, Vitamin D, Vitamin K\",\"good_source_of\":\"Magnesium, Potassium, Vitamin E, Zinc\",\"source_of\":\"Calcium, Copper, Folacin, Manganese, Omega-3, Pantothenic Acid, Vitamin A, Vitamin B2\"}', '2021-06-18 14:12:49'),
(220, 220, 1, 'Basil-flavoured Chicken and Pepper Stir-Fry', 'Prepare the vegetables : Cut the peppers into 1 cm-wide strips; halve the onions then cut them into 1 cm wedges; mince the garlic. Cut the chicken into strips ½ to 1 cm wide and about 5 cm long. Pat the strips dry with paper towels, then them with the cornstarch until they are coated. Season with salt and pepper. Heat half of the oil in a large nonstick pan over medium-high heat. Sauté the chicken pieces in batches, so as not to overcrowd the pan. Cook until browned, but not completely cooked through, 4-5 min total. Transfer the chicken to a plate and keep it warm in the oven. Pour the remaining oil into the pan, then add the onion and peppers. Cook over medium-high heat, tossing often, until they begin to brown and soften, about 5 min. Add the garlic then cook until fragrant, about 1 min. Season with salt and pepper. Pour in the water, soy sauce, and vinegar. Put \r\nthe chicken pieces back into the pan. Cook, with tossing, until the chicken is cooked through, about 3-4 min. Remove the pan from the heat, in the basil leaves, adjust the seasoning then serve.', '[\"yellow or red sweet peppers, cut into 1 cm-wide strips\",\"onions, halved and cut into 1 cm-thick wedges\",\"garlic, minced\",\"chicken breasts, boneless, skinless, cut into 1 x 5 cm pieces\",\"paper towels\",\"cornstarch\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"canola oil\",\"water\",\"soy sauce\",\"rice vinegar\",\"fresh basil, larger leaves torn in half\"]', 'https://media.soscuisine.com/images/recettes/922.jpg', 'https://www.soscuisine.com//recipe/basil-flavoured-chicken-pepper-stir-fry', 'Put the serving dish in the oven at the lowest setting to keep the meat warm while you cook the vegetables.', '25 min', '240 kcal', '{\"calories\":\"240\",\"fat\":\"8 g\",\"cholesterol\":\"60 mg\",\"protein\":\"24 g\"}', '{\"excellent_source_of\":\"Niacin, Vitamin A, Vitamin B6, Vitamin C, Vitamin E, Vitamin K\",\"good_source_of\":\"Magnesium, Manganese, Phosphorus, Potassium\",\"source_of\":\"Copper, Folacin, Iron, Pantothenic Acid, Vitamin B1, Vitamin B12, Vitamin B2, Zinc\",\"low\":\"Calories, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:12:50'),
(221, 221, 1, 'Meatballs in Curry Sauce', 'Place the first 8 ingredients in a bowl, season with salt and pepper. Run in the blender at medium speed for 3 to 4 minutes. Make balls, dip them in some additional flour and keep aside. Pour oil in a pan and heat (it should not be smoking). As soon as the oil becomes hot, add onions and cook for 3 to 4 minutes. Add curry and continue cooking for 2 to 3 minutes. Add flour, mix everything and pour in the hot chicken broth. Season with salt and pepper. Cook over low heat for 5 to 6 minutes. Add the meatballs, raisins, and season to taste. Simmer over low heat for 10 to 15 minutes and serve with grated coconut on top.', '[\"ground beef, lean\",\"brown rice flour, seasoned with salt and pepper\",\"onions, chopped\",\"garlic, crushed and chopped\",\"Italian parsley, fresh, chopped\",\"eggs size large\",\"Tabasco sauce\",\"dried chili peppers, minced\",\"ground pepper to taste\",\"[optional]\",\"salt\",\"[optional]\",\"olive oil\",\"onions, minced\",\"curry powder\",\"white rice flour, or other type\",\"chicken broth, low-sodium, hot\",\"raisins\",\"grated coconut\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2204.jpg', 'https://www.soscuisine.com//recipe/meatballs-in-curry-sauce', 'will be very useful to prepare the meatballs.', '50 min', '380 kcal', '{\"calories\":\"380\",\"fat\":\"19 g\",\"cholesterol\":\"110 mg\",\"protein\":\"29 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Iron, Manganese, Niacin, Potassium, Selenium, Vitamin B12, Vitamin B6, Vitamin K, Zinc\",\"good_source_of\":\"Folacin, Magnesium, Phosphorus, Vitamin B2\",\"source_of\":\"Calcium, Copper, Fibre, Pantothenic Acid, Vitamin B1, Vitamin C, Vitamin D, Vitamin E\",\"low\":\"Sodium\"}', '2021-06-18 14:12:51'),
(222, 222, 1, 'Meatless Meatpie', 'Preheat the oven to 190°C/375°F. Line the baking sheet with parchment paper or spray with non-stick spray. Prepare the egg replacer , then set aside.    Pierce the sweet potato with a fork then microwave 5 min. Allow to cool enough to handle, then peel and set aside. Prepare the vegetables : Finely chop the onion, celery, and carrot. Heat the oil in a pan over medium heat, then add the vegetables and sauté 6-10 min, with occasional stirring . Add a little water if necessary to keep the vegetables from sticking or becoming dry. Once they’re softened, add the drained beans and spices and mash them lightly with a fork. Meanwhile, place the peeled sweet potato into the food processor along with the tofu, soy sauce, and all seasonings, including nutritional yeast and parsley. Process until fairly smooth. In a large bowl, combine the egg replacer with the quinoa flakes and optional ground walnuts. Add the tofu mixture and vegetable mixture, then mix well. Spoon the mixture onto the prepared baking sheet. Using dampened hands shape it into an oblong or oval loaf about 6 in (15 cm) wide. Cook in the middle of the oven 25 min, until the top is evenly browned. Loosely cover with aluminum foil, then cook an additional 35-40 min. Using a toothpick, check to make sure that the center is firm, if not give it a little extra time. Let the meatloaf stand 20 min before slicing and serving. Be careful when slicing, since this loaf is not as firm as a meatloaf.', '[\"Egg Replacer\",\"sweet potatoes\",\"canola oil\",\"onions, finely chopped\",\"celery, finely chopped\",\"carrots, finely chopped\",\"garlic, finely chopped\",\"white \\\"navy\\\" beans (canned)\",\"firm regular tofu\",\"paprika\",\"salt\",\"ground pepper\",\"cayenne pepper\",\"dried oregano\",\"soy sauce\",\"tomato paste\",\"prepared mustard\",\"nutritional yeast\",\"Tabasco sauce\",\"Italian parsley, fresh\",\"quinoa flakes\",\"walnuts\",\"[optional]\",\"parchment paper\",\"aluminum foil\"]', 'https://media.soscuisine.com/images/recettes/2752.jpg', 'https://www.soscuisine.com//recipe/meatless-meatpie', 'would make things easier to chop the vegetables.', '85 min', '240 kcal', '{\"calories\":\"240\",\"fat\":\"7 g\",\"cholesterol\":\"0 mg\",\"protein\":\"17 g\"}', '{\"excellent_source_of\":\"Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Potassium, Vitamin A, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin K\",\"good_source_of\":\"Calcium, Copper, Phosphorus, Selenium, Vitamin B6, Zinc\",\"source_of\":\"Omega-3, Pantothenic Acid, Vitamin C, Vitamin E\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:12:52'),
(223, 223, 1, 'Meatloaf', 'Preheat the oven to 175°C/350°F. Lightly oil a baking dish or sheet. Prepare the vegetables : Finely chop the onion, garlic, carrot, and celery. Heat the oil in a pan over medium heat, then add the vegetables and sauté 5 min, with occasional stirring . Add a little salt, cover, then lower the heat. Cook 5 min. Take the pan off the heat, then add the Worcestershire sauce, vinegar, salt, pepper, and allspice. Finely chop the prunes and parsley. Add this mixture to the vegetables. In a large bowl, the eggs lightly, using a fork, then add the beef, bread crumbs, and milk. Mix well, then incorporate the vegetable mixture. Using your hands, blend the mixture together until it is just combined well (do not over-mix). In the prepared dish, form the mixture into a loaf, about 14-15 cm wide. Cook in the middle of the oven 1 h to 1 h 15 min until a thermometer inserted into the centre of the meatloaf registers 68°C/155°F. Let the meatloaf stand 5-10 min before slicing and serving.', '[\"onions\",\"garlic, finely chopped\",\"celery, finely chopped\",\"carrots, finely chopped\",\"canola oil\",\"Worcestershire sauce\",\"apple cider vinegar\",\"salt\",\"ground pepper\",\"allspice powder\",\"pitted prunes, finely chopped\",\"Italian parsley, fresh, finely chopped\",\"eggs size large\",\"ground beef, extra-lean\",\"bread crumbs\",\"milk, partly skimmed, 2%\"]', 'https://media.soscuisine.com/images/recettes/2721.jpg', 'https://www.soscuisine.com//recipe/meatloaf-halal', 'would make things easier to chop the vegetables and prunes.', '80 min', '330 kcal', '{\"calories\":\"330\",\"fat\":\"13 g\",\"cholesterol\":\"130 mg\",\"protein\":\"31 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Iron, Niacin, Potassium, Vitamin B12, Vitamin B2, Vitamin K, Zinc\",\"good_source_of\":\"Folacin, Magnesium, Pantothenic Acid, Phosphorus, Selenium, Vitamin A, Vitamin B1, Vitamin B6\",\"source_of\":\"Calcium, Copper, Fibre, Manganese, Vitamin C, Vitamin D, Vitamin E\"}', '2021-06-18 14:12:53'),
(224, 224, 1, 'Meatloaf for Singles', 'Preheat the oven to 175°C/350°F. Lightly oil a 30 x 11 x 7 cm baking pan. Prepare the vegetables : Finely chop the onion, garlic, carrot, and celery. Heat the oil in a pan over medium heat, then add the vegetables and sauté 5 min, with occasional stirring . Add a little salt, cover, then lower the heat. Cook 5 min. Take the pan off the heat, then add the Worcestershire sauce, vinegar, salt, pepper, and allspice. Finely chop the prunes then add them to the pan. in the Parsley and Garlic base then mix well. In a large bowl, the eggs lightly, using a fork, then add the beef, bread crumbs, and milk. Mix well, then incorporate the vegetable mixture. Using your hands, blend the mixture together until it is just combined well (do not over-mix). Put the preparation into the oiled baking pan. Cook in the middle of the oven 40 min to 1 h  until a thermometer inserted into the centre of the meatloaf registers 68°C/155°F. Let the meatloaf stand 5-10 min before slicing and serving.', '[\"onions\",\"garlic, finely chopped\",\"celery, finely chopped\",\"carrots, finely chopped\",\"canola oil\",\"Worcestershire sauce\",\"apple cider vinegar\",\"salt\",\"ground pepper\",\"allspice powder\",\"pitted prunes, finely chopped\",\"Parsley and Garlic Base\",\"eggs size large\",\"ground beef, extra-lean\",\"bread crumbs\",\"milk, partly skimmed, 2%\"]', 'https://media.soscuisine.com/images/recettes/1553.jpg', 'https://www.soscuisine.com//recipe/meatloaf-for-singles', 'would make things easier to chop the vegetables and prunes.', '65 min', '290 kcal', '{\"calories\":\"290\",\"fat\":\"12 g\",\"cholesterol\":\"110 mg\",\"protein\":\"27 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Niacin, Vitamin B12, Vitamin K, Zinc\",\"good_source_of\":\"Folacin, Iron, Phosphorus, Potassium, Vitamin A, Vitamin B1, Vitamin B2, Vitamin B6\",\"source_of\":\"Calcium, Copper, Magnesium, Manganese, Pantothenic Acid, Selenium, Vitamin D, Vitamin E\"}', '2021-06-18 14:12:55'),
(225, 225, 1, 'Mediterranean Beef Burger', 'Preheat the outdoor grill. Finely chop the dried tomatoes, then put them in a bowl. Add the Parsley and\r\nGarlic Base , egg, ground meat, and grated cheese. Season with salt and pepper to taste, then mix well until the mixture is well combined and\r\nsmooth. Form the mixture into flat patties. To prevent the patties from puffing up, make a shallow depression with your thumb in the centre. Lightly brush the patties with the oil and cook on a hot grill for about 15 min, until the outside \r\nbecomes golden-brown and the inside loses its pink colour. Turn them once halfway through the cooking. Alternatively, the patties can be cooked on the stovetop. Heat the oil in a frying pan over medium-high heat. Add the patties and cook for about 15 min, turning them once. Place each patty inside a half pita bread. Add a few lettuce leaves and tomato slices then serve.', '[\"sun-dried tomatoes (oil packed), finely chopped\",\"Parsley and Garlic Base\",\"eggs size large\",\"ground beef, extra-lean\",\"Parmesan cheese, grated\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"olive oil\",\"pita breads\",\"Boston lettuce, or curly leaf\",\"tomatoes, sliced\"]', 'https://media.soscuisine.com/images/recettes/1352.jpg', 'https://www.soscuisine.com//recipe/mediterranean-beef-burger', 'These burgers can be cooked either in a pan on the stovetop or using an outdoor grill.', '30 min', '320 kcal', '{\"calories\":\"320\",\"fat\":\"16 g\",\"cholesterol\":\"100 mg\",\"protein\":\"26 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Niacin, Vitamin A, Vitamin B12, Vitamin K, Zinc\",\"good_source_of\":\"Iron, Magnesium, Phosphorus, Potassium, Selenium, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin E\",\"source_of\":\"Calcium, Copper, Manganese, Pantothenic Acid, Vitamin C, Vitamin D\"}', '2021-06-18 14:12:57'),
(226, 226, 1, 'Mediterranean Beef Stir-Fry', 'Prepare the vegetables : Cut the peppers into 1 cm-wide strips; slice the zucchini into thin rounds; quarter the mushrooms; halve the onion then cut it into 1 cm wedges; mince the garlic; dice the tomatoes. Cut the meat into strips, 1 cm wide and about 5 cm long. Heat half of the oil in a large frying-pan or over medium-high heat. Sauté the \r\nmeat in batches, so as not to overcrowd the pan. Cook the meat until it browns, but is not completely cooked through, 3-4 min total. Remove the meat from the pan then set aside on the warmed serving plate in the oven. Pour the remaining oil into the pan, then add the onion and sauté 2 min until it starts to soften. Add the peppers and continue to cook, tossing often, until they begin to brown and soften, about 5 min. Add \r\nthe zucchini and mushrooms, then sauté, with frequent tossing, about 3 min. Add the garlic \r\nand tomatoes. Cook 1-2 min, with stirring , then season with salt and pepper. Cover and cook an additional 2 min until the vegetables are cooked al dente Put the meat back into the pan. Cook, with tossing, about 1-2 min. Adjust the seasoning then serve.', '[\"yellow or red sweet peppers, cut into 1 cm-wide strips\",\"zucchini, cut into thin rounds\",\"button (white) mushrooms, quartered\",\"onions, halved and cut into 1 cm-thick wedges\",\"garlic, minced\",\"tomatoes, Roma type, diced\",\"beef, top sirloin, cut into strips of about 1 x 5 cm\",\"olive oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/973.jpg', 'https://www.soscuisine.com//recipe/mediterranean-beef-stir-fry', '', '30 min', '300 kcal', '{\"calories\":\"300\",\"fat\":\"18 g\",\"cholesterol\":\"50 mg\",\"protein\":\"24 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Niacin, Potassium, Selenium, Vitamin A, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin C, Vitamin E, Zinc\",\"good_source_of\":\"Folacin, Iron, Magnesium, Manganese, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin K\",\"source_of\":\"Copper, Fibre, Vitamin D\",\"low\":\"Calories, Cholesterol, Saturated Fat, Sodium\"}', '2021-06-18 14:12:59');
INSERT INTO `recipe_translation` (`rt_id`, `rt_recipe_id`, `rt_lang_id`, `rt_recipe_name`, `rt_recipe_text`, `rt_recipe_ingredients_full`, `rt_recipe_image`, `rt_recipe_link`, `rt_recipe_prep`, `rt_recipe_duration`, `rt_recipe_calories`, `rt_recipe_nutrients`, `rt_recipe_claims`, `rt_created`) VALUES
(227, 227, 1, 'Mediterranean Lamb Burger', 'Preheat the outdoor grill. Finely chop the dried tomatoes, then put them in a bowl. Add the Parsley and\r\nGarlic Base , egg, ground meat, and grated cheese. Season with salt and pepper to taste, then mix well until the mixture is well combined and\r\nsmooth. Form the mixture into flat patties. To prevent the patties from puffing up, make a shallow depression with your thumb in the centre. Lightly brush the patties with the oil and cook on a hot grill for about 15 min, until the outside \r\nbecomes golden-brown and the inside loses its pink colour. Turn them once halfway through the cooking. Alternatively, the patties can be cooked on the stovetop. Heat the oil in a frying pan over medium-high heat. Add the patties and cook for about 15 min, turning them once. Place each patty inside a half pita bread. Add a few lettuce leaves and tomato slices then serve.', '[\"sun-dried tomatoes (oil packed), finely chopped\",\"Parsley and Garlic Base\",\"eggs size large\",\"lean ground lamb\",\"Parmesan cheese, grated\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"olive oil\",\"pita breads\",\"Boston lettuce, or curly leaf\",\"tomatoes, sliced\"]', 'https://media.soscuisine.com/images/recettes/1200.jpg', 'https://www.soscuisine.com//recipe/mediterranean-lamb-burger', 'These burgers can be cooked either in a pan on the stovetop or using an outdoor grill.', '30 min', '430 kcal', '{\"calories\":\"430\",\"fat\":\"27 g\",\"cholesterol\":\"140 mg\",\"protein\":\"28 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Niacin, Potassium, Selenium, Vitamin A, Vitamin B12, Vitamin B2, Vitamin K, Zinc\",\"good_source_of\":\"Iron, Magnesium, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin D, Vitamin E\",\"source_of\":\"Calcium, Copper, Manganese, Vitamin B6, Vitamin C\"}', '2021-06-18 14:13:01'),
(228, 228, 1, 'Mediterranean Spiced Fish Fillets', 'Preheat the oven to 190ºC/375ºF. Finely chop the sun-dried tomatoes, anchovies, and capers. Transfer to a small bowl, add the oil, parsley and garlic base olive paste , then mix thoroughly. Since each fish fillet is uneven in thickness, here is the trick to ensure uniform cooking: cut each fillet into 2 pieces lengthwise, then\r\nput each piece separately on a lightly-oiled baking sheet and brush them lightly with oil. Cover with the sauce. Do not add salt – the sauce is already fairly salty. Add a little bit of pepper. Place in the lower third of the oven and cook for about 10 min (5-6 min per cm of thickness) until the tops have changed colour. Since the cooking time depends on the thickness of the fillets and the actual temperature of your oven, it is important to check with a fork to see if they are cooked through .The thinner pieces will be done before the thicker ones: pull them out when ready, then cover and\r\nkeep warm while waiting for the remaining ones to be done. Serve on the warmed plates.', '[\"tilapia fillets, or turbot\",\"sun-dried tomatoes (oil packed), finely chopped\",\"anchovy fillets, finely chopped\",\"Parsley and Garlic Base\",\"olive paste\",\"capers, finely chopped\",\"olive oil\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/37.jpg', 'https://www.soscuisine.com//recipe/mediterranean-spiced-fish-fillets', 'Keep the serving plates warm on the stove while you\'re preparing the dish.', '15 min', '300 kcal', '{\"calories\":\"300\",\"fat\":\"16 g\",\"cholesterol\":\"90 mg\",\"protein\":\"38 g\"}', '{\"free\":\"Sugar\",\"excellent_source_of\":\"Niacin, Phosphorus, Potassium, Selenium, Vitamin B12, Vitamin E, Vitamin K\",\"good_source_of\":\"Folacin, Magnesium, Vitamin B6\",\"source_of\":\"Copper, Iron, Manganese, Pantothenic Acid, Vitamin B1, Vitamin B2, Vitamin C, Zinc\"}', '2021-06-18 14:13:01'),
(229, 229, 1, 'Milan-Style Sole', 'Pat-dry the fillets, then season with salt and pepper. Prepare 2 shallow dishes: the egg in one, and put the bread crumbs in the other. Dip one fillet at the time in the egg, let the excess egg drip off before coating the fillet with the bread crumbs. Turn the fillets to both sides. Heat the oil in a skillet over medium heat. Sauté the fish 2 min on each side, until the bread crumb coating becomes golden-coloured. Serve on the warmed plates with optional lemon quarters on the side.', '[\"sole fillets, or haddock or basa\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"eggs size large\",\"bread crumbs\",\"olive oil\",\"lemons, cut into quarters\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1154.jpg', 'https://www.soscuisine.com//recipe/milan-style-sole', '', '10 min', '250 kcal', '{\"calories\":\"250\",\"fat\":\"10 g\",\"cholesterol\":\"180 mg\",\"protein\":\"33 g\"}', '{\"excellent_source_of\":\"Magnesium, Niacin, Phosphorus, Selenium, Vitamin B12, Vitamin D\",\"good_source_of\":\"Folacin, Pantothenic Acid, Potassium, Vitamin B2, Vitamin B6, Vitamin E\",\"source_of\":\"Iron, Manganese, Omega-3, Vitamin A, Vitamin B1, Zinc\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:13:02'),
(230, 230, 1, 'Beef and Beer Stew', 'Preheat the oven to 160ºC/325ºF. Prepare the vegetables : Cut the carrots and celery stalks into large pieces (about 2-3 cm thick). Finely chop the onion and garlic. Leave the meat whole. Heat the oil in a thick-base roasting pan over medium heat. the meat thoroughly on each side until golden, 7-8 min total. Take the meat out and set aside. Add the onion and garlic to the pan and sauté 3-4 min until translucent. Add the other vegetables and cook 2-3 min. Add the cornstarch and the , then pour in the beer and the sauce demi-glace . Bring to a boil, then put the meat back into the pan. Add salt and pepper to taste. Cover then cook in the middle of the oven until the meat is very tender (about 2 h 30 min per kilo of meat). Serve the with the cooking juices.', '[\"carrots, cut into large pieces\",\"celery, cut into large pieces\",\"onions, finely chopped\",\"garlic, finely chopped\",\"blade pot roast, rib roast or shoulder cloud\",\"olive oil\",\"cornstarch\",\"herbes de Provence\",\"alcohol-free beer, red type\",\"demi-glace sauce\",\"ground pepper to taste\",\"[optional]\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/3497.jpg', 'https://www.soscuisine.com//recipe/beef-beer-stew-alcool-free', 'dish with a tight-fitting lid is necessary for this recipe.', '195 min', '300 kcal', '{\"calories\":\"300\",\"fat\":\"11 g\",\"cholesterol\":\"70 mg\",\"protein\":\"28 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Niacin, Potassium, Selenium, Vitamin A, Vitamin B12, Vitamin K, Zinc\",\"good_source_of\":\"Folacin, Iron, Magnesium, Phosphorus, Vitamin B2, Vitamin B6\",\"source_of\":\"Calcium, Copper, Fibre, Manganese, Pantothenic Acid, Vitamin B1, Vitamin C, Vitamin D, Vitamin E\",\"low\":\"Sodium\"}', '2021-06-18 14:13:03'),
(231, 231, 1, 'Mint-Marinated Lamb Chops', 'Finely chop the leaves, onion, and garlic, then put them in a bowl. Crush the peppercorns, then add them to the bowl. Pour in the olive oil and lemon juice, then mix well: the marinade should have a thick consistency. Add the lamb chops, well, then cover with plastic wrap or a dish. Place the bowl in the refrigerator to marinate overnight. Cook the steaks on a medium grill or under the broiler for about 10 min, basting occasionally with the marinade and turning them once. Season with salt and serve on the warmed dishes.', '[\"fresh mint, finely chopped\",\"onions, finely chopped\",\"garlic, finely chopped\",\"peppercorns, crushed\",\"olive oil\",\"lemon juice, freshly squeezed\",\"lamb loin chops\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/684.jpg', 'https://www.soscuisine.com//recipe/lamb-chops-marinated-mint-alcohol-free', 'Keep the serving plates warm on the stove while you\'re preparing the dish.', '25 min', '170 kcal', '{\"calories\":\"170\",\"fat\":\"8 g\",\"cholesterol\":\"70 mg\",\"protein\":\"20 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Niacin, Vitamin B12\",\"good_source_of\":\"Iron, Phosphorus, Vitamin B2, Zinc\",\"source_of\":\"Copper, Magnesium, Manganese, Vitamin B1, Vitamin B6, Vitamin C, Vitamin D, Vitamin E, Vitamin K\",\"low\":\"Sodium\"}', '2021-06-18 14:13:04'),
(232, 232, 1, 'Mushroom Scaloppine', 'Prepare the mushrooms : slice them thinly lengthwise. Heat half of the oil in a skillet over moderately high heat until hot but not smoking, then sauté the mushrooms, stirring occasionally, until the released liquid is evaporated, about 3 min. Add the Parsley and Garlic Base , then cook an additional 2 min, with stirring. Season with salt and pepper. Remove the skillet from the heat and keep warm. Flatten and tenderise the cutlets using a meat pounder. them with the flour and shake off the excess. Heat the butter and remaining oil in a pan over medium heat, taking care not to let them burn. Add\r\nthe cutlets, then each side for about 1 min. Warm up the in a separate pan, and pour it into the pan with the cutlets. Cover and cook over low heat 5-6 min. Season with salt and pepper, then add the mushrooms and cook 1 additional minute. Serve on the warmed plates.', '[\"button (white) mushrooms, thinly sliced\",\"canola oil\",\"Parsley and Garlic Base\",\"veal cutlets, thinly sliced\",\"white flour (all purpose)\",\"butter, unsalted\",\"beef broth\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/571.jpg', 'https://www.soscuisine.com//recipe/mushroom-scaloppine', '', '20 min', '390 kcal', '{\"calories\":\"390\",\"fat\":\"24 g\",\"cholesterol\":\"100 mg\",\"protein\":\"32 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Niacin, Phosphorus, Potassium, Selenium, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin E, Vitamin K\",\"good_source_of\":\"Folacin, Pantothenic Acid, Zinc\",\"source_of\":\"Copper, Iron, Magnesium, Manganese, Omega-3, Omega-6, Vitamin A, Vitamin B1, Vitamin D\"}', '2021-06-18 14:13:05'),
(233, 233, 1, 'Beef and Cauliflower Pie', 'Preheat the oven to 205°C/400°F. Prepare the vegetables : finely chop the onion; thinly slice the mushrooms; cut the cauliflower into florets then them 10-15 min until they are very tender. Drain them well and set aside. Heat the oil in a pan over medium-high heat. Add the ground meat and it until it looses its red colour, about 4-5 min, then break it up with a fork. In order to the meat, it is important not to it at the beginning, otherwise it will release its juices and will «boil» rather than When the meat is golden-coloured, add the chopped onion then cook 2 min with stirring in the diced tomatoes, mushrooms, tomato paste, Worcestershire sauce, and . Add the frozen peas and continue cooking until heated through, about 4-5 min. Add salt and pepper. Remove the pan from the heat and transfer the contents to one large baking dish, or distribute it into individual baking dishes. Pour the milk into a large microwave-safe bowl. Add the butter and microwave on medium-high a few minutes, uncovered, until very hot. Add the cooked cauliflower and mash the mixture until it is creamy. Add salt and pepper to taste. Place a spoonful of the cauliflower mixture on top of the beef mixture, then gently spread it with a spoon to cover evenly. Bake in the middle of the oven until the top is golden-brown, about 30 min. Serve.', '[\"cauliflower, cut into florets\",\"onions, finely chopped\",\"button (white) mushrooms, thinly sliced\",\"olive oil\",\"ground beef, lean\",\"canned tomatoes (diced)\",\"tomato paste\",\"Worcestershire sauce\",\"beef broth\",\"frozen peas\",\"milk, partly skimmed, 2%\",\"butter, unsalted\",\"ground pepper to taste\",\"[optional]\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/943.jpg', 'https://www.soscuisine.com//recipe/beef-cauliflower-pie', 'For individual pies, choose baking dishes which contain about 375 ml or 1 ½ cups when 3/4 full.', '55 min', '330 kcal', '{\"calories\":\"330\",\"fat\":\"18 g\",\"cholesterol\":\"60 mg\",\"protein\":\"25 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Fibre, Folacin, Niacin, Potassium, Selenium, Vitamin A, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin C, Vitamin K, Zinc\",\"good_source_of\":\"Copper, Iron, Magnesium, Manganese, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin D\",\"source_of\":\"Calcium, Vitamin E\"}', '2021-06-18 14:13:07'),
(234, 234, 1, 'Orange Halibut Steaks', 'Preheat the oven to 190°C/375°F. with flour the halibut steaks. Heat the butter and oil in a pan over medium heat. Sauté the steaks, 1-2 min per side to colour them. Transfer the fish to an ovenproof dish. Press half the oranges and pour in the juice over the halibut. Cut the remaining oranges into rounds to cover the halibut. Keep some to decorate the\r\nserving dish later. Add salt and pepper. Bake in the middle of the oven about 12 min. Check with a fork to see if it is cooked\r\nthrough Serve on the warmed plates. Sprinkle with the cooking liquid. Garnish with the remaining orange rounds.', '[\"halibut steaks, or other lean fish, 2 cm thick\",\"oranges\",\"butter, unsalted\",\"canola oil\",\"white flour (all purpose)\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/87.jpg', 'https://www.soscuisine.com//recipe/orange-halibut-steaks', 'Keep the serving plates warm on the stove while you\'re preparing the dish.', '25 min', '370 kcal', '{\"calories\":\"370\",\"fat\":\"18 g\",\"cholesterol\":\"60 mg\",\"protein\":\"33 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Magnesium, Niacin, Phosphorus, Potassium, Selenium, Vitamin B12, Vitamin B6, Vitamin C, Vitamin D, Vitamin E\",\"good_source_of\":\"Vitamin B1, Vitamin K\",\"source_of\":\"Calcium, Copper, Fibre, Iron, Omega-3, Pantothenic Acid, Vitamin A, Vitamin B2, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:13:08'),
(235, 235, 1, 'Orecchiette Pasta Bari-style \"alla Barese\"', 'Prepare the broccoli : clean and cut off the florets. Peel off any though skin of the stalks and cut them into small pieces. Blanch and drain the broccoli, then set aside, but keep them warm. To save time, the rest of the sauce preparation and pasta cooking can be done at the same time. Cook the pasta In the meantime, heat the oil in a skillet over medium heat. Gently sauté the minced or pressed garlic 1-2 min, with stirring , until soft taking care not to let it burn. Chop the anchovies, then add them to the skillet with stirring . Cook 2 min until they have broken apart and \"melted\". in the minced chili pepper then add the mini-tomatoes cut in half and the drained broccoli. Pour the drained pasta into the pan and mix with the seasoned broccoli. Adjust the seasoning , add the grated romano(*), then serve in the warmed dishes.', '[\"broccoli, cut into florets\",\"orecchiette, shells, or other short pasta\",\"olive oil\",\"garlic, minced or pressed\",\"anchovy fillets, chopped\",\"dried chili peppers, minced\",\"mini-tomatoes (cherry, miniature or grape), cut in half\",\"Romano cheese, or Parmesan, grated\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/254.jpg', 'https://www.soscuisine.com//recipe/orecchiette-pasta-bari-style-alla-barese', '', '25 min', '420 kcal', '{\"calories\":\"420\",\"fat\":\"10 g\",\"cholesterol\":\"10 mg\",\"protein\":\"15 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Folacin, Magnesium, Manganese, Niacin, Selenium, Vitamin A, Vitamin C, Vitamin K\",\"good_source_of\":\"Fibre, Iron, Phosphorus, Potassium, Vitamin B6, Vitamin E, Zinc\",\"source_of\":\"Calcium, Copper, Pantothenic Acid, Vitamin B1, Vitamin B2\",\"low\":\"Cholesterol, Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:13:09'),
(236, 236, 1, '\"Orecchiette\" Pasta with Broccoli', 'Prepare the broccoli : clean and cut off the florets. Peel off any though skin of the stalks and cut them into small pieces. Blanch and drain the broccoli, then set aside, but keep them\r\nwarm. To save time, the rest of the sauce preparation and pasta cooking can be done at the same time. Cook the pasta In the meantime, heat the oil in a skillet over medium heat. Gently sauté the minced or pressed garlic 1-2 min, with stirring , until soft without letting it burn. Add the drained broccoli and pepper. Pour the drained pasta into the pan and mix with the seasoned broccoli. Adjust the seasoning and add the grated parmesan. Serve in the warmed dishes.', '[\"broccoli, cut into florets\",\"orecchiette, or other short pasta\",\"olive oil\",\"garlic, minced or pressed\",\"Parmesan cheese, grated\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/255.jpg', 'https://www.soscuisine.com//recipe/orecchiette-pasta-broccoli', '', '25 min', '410 kcal', '{\"calories\":\"410\",\"fat\":\"9 g\",\"cholesterol\":\"0 mg\",\"protein\":\"15 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Fibre, Folacin, Magnesium, Manganese, Selenium, Vitamin A, Vitamin C, Vitamin K\",\"good_source_of\":\"Niacin, Phosphorus, Potassium, Vitamin B6, Vitamin E, Zinc\",\"source_of\":\"Calcium, Copper, Iron, Pantothenic Acid, Vitamin B1, Vitamin B2\",\"low\":\"Cholesterol, Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:13:09'),
(237, 237, 1, 'Oven \"Fried\" Fish and Chips', 'Cut the potatoes in half lengthwise, then cut each half into 4-6 wedges. It is important to cut them into wedges of similar size so that they will all cook evenly and be done at the same time. In a deep dish, the egg white with the paprika and salt. Add the potato wedges and coat them well with the egg white mixture. Transfer them to the baking sheet. Don\'t crowd the potatoes on the sheet or they will steam and not turn golden-brown. Bake on the bottom oven rack 15 min, then turn the potatoes and bake an additional 15 min.', '[\"potatoes, Russet or Idaho type, yukon gold\",\"egg whites, for the chips\",\"paprika, for the chips\",\"salt, for the chips\",\"canola oil, for the baking sheet and the rack\",\"parchment paper, for the sheet\",\"cod fillet, or hake, cut into pieces\",\"egg whites, for the fish\",\"milk, partly skimmed, 2%, for the fish\",\"white flour (all purpose), for the fish\",\"bread crumbs, for the fish\",\"paprika, for the fish\",\"cayenne pepper, for the fish\",\"vegetable oil spray, for the fish\",\"Tartare Sauce\"]', 'https://media.soscuisine.com/images/recettes/391.jpg', 'https://www.soscuisine.com//recipe/oven-fried-fish-chips', 'Pay attention to the timing of the potato and fish preparation so that the fish is baked during the last 15 min of potato baking.', '40 min', '580 kcal', '{\"calories\":\"580\",\"fat\":\"17 g\",\"cholesterol\":\"60 mg\",\"protein\":\"37 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Selenium, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin E\",\"good_source_of\":\"Copper, Pantothenic Acid, Vitamin A, Vitamin C, Vitamin D, Vitamin K, Zinc\",\"source_of\":\"Calcium\",\"low\":\"Cholesterol, Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:13:10'),
(238, 238, 1, 'Beef and Potato Fricassee', 'Cut the meat into small 1 cm cubes. Prepare\r\nthe vegetables : Finely chop the onion and garlic; cut the potatoes and celery into 1 cm thick pieces. Heat half of the butter and oil in a thick-bottom frying pan over medium heat. Add the onion and garlic, sauté 3-4 min until translucent, then remove them and set aside. In the same pan, add the cubes of beef and them over high heat 7-8 min until golden-brown. In\r\norder to the meat, it is important to remove any juices coming out of the meat, otherwise the meat will «boil» rather than brown. A bulb baster may be used to pull the juices out of the pan (The meat juices may be reserved and added back to the pan later with the broth). Add the remaining butter and oil to the pan. in the potatoes and celery, then sauté a few\r\nminutes. Pour in the (and any reserved meat juices), then deglaze . Put the onion and garlic back into the pan. Season with salt and pepper to taste. Cook, covered, over low heat 20-25 min, until the potatoes are soft. Add the peas and cook an additional 3 min. Sprinkle with the chopped parsley (optional) and serve in the warmed dishes.', '[\"beef, inside round, or French steak, cut into 1 cm cubes\",\"onions, finely chopped\",\"garlic, finely chopped\",\"potatoes, peeled and cut into 1 cm cubes\",\"celery, cut into 1 cm cubes\",\"butter, unsalted\",\"canola oil\",\"beef broth\",\"frozen peas\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"Italian parsley, fresh\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/666.jpg', 'https://www.soscuisine.com//recipe/beef-potato-fricassee', '', '50 min', '320 kcal', '{\"calories\":\"320\",\"fat\":\"11 g\",\"cholesterol\":\"70 mg\",\"protein\":\"29 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Niacin, Potassium, Selenium, Vitamin B12, Vitamin B6, Vitamin K, Zinc\",\"good_source_of\":\"Folacin, Iron, Magnesium, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin B2\",\"source_of\":\"Copper, Fibre, Manganese, Vitamin A, Vitamin C, Vitamin D, Vitamin E\",\"low\":\"Calories, Cholesterol, Saturated Fat, Sodium\"}', '2021-06-18 14:13:11'),
(239, 239, 1, 'Oven-Baked \"Fried\" Drumsticks', 'Place the drumsticks in a resealable plastic bag. Finely chop the onion and mince the garlic, then add them to a bowl. Pour in the canola oil and soy sauce, then mix well. Pour the mixture into the bag, then seal it and turn it to coat the drumsticks with the marinade .\r\nRefrigerate overnight. Preheat the oven to 190°C/375°F. Line a baking sheet with aluminum foil. Brush generously with olive oil. Combine the mustard and water in a large bowl. Remove the drumsticks from the marinade ,\r\nscrape off any onion and garlic, then add the drumsticks to the bowl. well to coat with the mustard mixture. Add salt and pepper. Put the bread crumbs in another bowl. Roll each drumstick in bread crumbs, coating lightly but evenly, then transfer them to the prepared baking sheet. Bake in the middle of the oven for about 45 min. Increase heat to 205°C/400°F and continue to bake about 15 min, until the drumsticks are evenly browned and cooked through. It is not necessary to turn them. Serve warm or at room temperature.', '[\"resealable plastic bag\",\"chicken drumsticks\",\"onions\",\"garlic\",\"canola oil\",\"soy sauce\",\"olive oil, to grease the sheet\",\"Dijon mustard\",\"water\",\"bread crumbs\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"aluminum foil\"]', 'https://media.soscuisine.com/images/recettes/563.jpg', 'https://www.soscuisine.com//recipe/oven-baked-fried-drumsticks-alcohol-free', '', '70 min', '340 kcal', '{\"calories\":\"340\",\"fat\":\"21 g\",\"cholesterol\":\"80 mg\",\"protein\":\"26 g\"}', '{\"source_of\":\"Folacin, Iron, Manganese, Niacin, Selenium, Vitamin B1, Vitamin D, Vitamin E, Vitamin K\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:13:12'),
(240, 240, 1, 'Pad Thai', 'Cook the rice sticks , drain them and set aside. In a small bowl, combine the fish sauce, tamarind paste, sugar, and chili pepper Heat one tablespoon of the oil in a or skillet, \r\nover medium heat. Add the eggs and scramble quickly to make a very thin omelet. Cook just until it sets then transfer the omelet to a cutting board. Cut into 1/2 cm strips and set aside. Add the remaining oil and raise the heat to \'high\'. When the oil is hot, in the garlic and shrimp. Cook, with some stirring, until the shrimp lose their gray colour and turn pink, 3-4 min. Remove the shrimp from the pan using a slotted spoon, and transfer them to a plate. Add the tofu, scallions, and half of the bean sprouts. Cook 3 min with some stirring. Transfer the tofu mixture to the plate with the shrimp. Add the rice sticks, omelet strips, and tamarind mixture. Cook, with stirring, until the rice noodles are heated through. Put the shrimp and tofu back into the skillet. well then transfer the contents to the warmed serving dishes. Garnish with the remaining bean sprouts along with the optional peanuts and cilantro leaves. Serve with lime wedges on the side.', '[\"rice sticks (noodles)\",\"fish sauce (nam pla)\",\"tamarind paste\",\"sugar\",\"dried chili peppers\",\"canola oil\",\"eggs size large\",\"garlic, minced\",\"shrimp, small\",\"firm regular tofu, diced\",\"green onions\\/scallions, coarsely chopped\",\"soybean sprouts\",\"peanuts\",\"[optional]\",\"fresh cilantro, chopped\",\"[optional]\",\"limes, cut into wedges\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1237.jpg', 'https://www.soscuisine.com//recipe/pad-thai', '', '30 min', '580 kcal', '{\"calories\":\"580\",\"fat\":\"19 g\",\"cholesterol\":\"260 mg\",\"protein\":\"27 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Folacin, Iron, Magnesium, Manganese, Niacin, Phosphorus, Selenium, Vitamin B12, Vitamin E, Vitamin K, Zinc\",\"good_source_of\":\"Calcium, Copper, Pantothenic Acid, Potassium, Vitamin B1, Vitamin B2\",\"source_of\":\"Fibre, Vitamin A, Vitamin B6, Vitamin D\",\"low\":\"Saturated Fat\",\"free\":\"Trans Fat\"}', '2021-06-18 14:13:12'),
(241, 241, 1, 'Paris-Style Penne', 'Cook the pasta While the pasta is cooking, heat the Tomato Sauce and the Pesto Sauce in a saucepan over low heat. Add the specified amount of pasta cooking water, which will warm up the sauce and will dilute it a bit. Put the drained pasta back into the pasta cooking pot, add the sauce and extra virgin oil, then mix well. Sprinkle with grated Parmesan\r\ncheese, then serve in the warmed dishes.', '[\"Pesto Sauce\",\"My Mother\'s Tomato Sauce\",\"penne rigate\",\"pasta cooking water\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"extra virgin olive oil\",\"Parmesan cheese\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1035.jpg', 'https://www.soscuisine.com//recipe/paris-style-penne', '', '15 min', '430 kcal', '{\"calories\":\"430\",\"fat\":\"17 g\",\"cholesterol\":\"0 mg\",\"protein\":\"11 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Manganese, Selenium\",\"good_source_of\":\"Magnesium, Vitamin E, Vitamin K\",\"source_of\":\"Copper, Fibre, Folacin, Iron, Niacin, Phosphorus, Vitamin A, Vitamin B1, Vitamin B6, Zinc\"}', '2021-06-18 14:13:13'),
(242, 242, 1, '\"Pasta e Fagioli\"', 'Cook the dried beans either 18 min in a pressure cooker or about 1 hour in a pot. Drain the beans, set them aside and discard the liquid. Prepare the onion and garlic . Coarsely chop the onion and mince the garlic. Heat the butter and olive oil in a pot over medium-low heat. the onion\r\nand garlic 2-3 min, then add the sprig of rosemary and let it infuse 3-4 min, taking care not to let it burn. Add of the beans, pour in the ,\r\nand cook 5 min over medium heat, with some stirring Remove the sprig of rosemary and purée the soup in a blender or by using a food-mill . Put the mixture back into the pot. Meanwhile, cook the pasta in a pot of boiling salted water. Drain and pour the pasta into the bean-mixture. Add the remaining whole beans and warm up the soup just 2-3 min. If the soup is too thick, it may be thinned with some or water. Serve into bowls, add the grated parmesan, and drizzle with extra virgin olive oil.', '[\"romano\\/cranberry beans (dried), or white kidney type\",\"onions, coarsely chopped\",\"garlic, minced\",\"rosemary, fresh\",\"butter, unsalted\",\"olive oil\",\"chicken broth\",\"mezzi tubetti (pasta for soups)\",\"Parmesan cheese, grated\",\"extra virgin olive oil\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/396.jpg', 'https://www.soscuisine.com//recipe/pasta-e-fagioli', '', '60 min', '450 kcal', '{\"calories\":\"450\",\"fat\":\"14 g\",\"cholesterol\":\"10 mg\",\"protein\":\"21 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Fibre, Folacin, Iron, Magnesium, Manganese, Phosphorus, Potassium, Selenium, Vitamin B1, Zinc\",\"good_source_of\":\"Copper, Niacin, Vitamin E\",\"source_of\":\"Calcium, Pantothenic Acid, Vitamin B2, Vitamin B6, Vitamin K\"}', '2021-06-18 14:13:14'),
(243, 243, 1, 'Pasta in a Pepper Sauce', 'Cook the pasta While the pasta is cooking, heat the pepper\r\nsauce in a saucepan over low heat. Add the specified amount of pasta cooking water to dilute the sauce a bit, and warm up just a few minutes. Put the drained tortiglioni back into the pasta cooking pot, add the sauce and mix well.  Sprinkle with Parmesan cheese, if desired, then serve in the warmed dishes.', '[\"tortiglioni\",\"Pepper Sauce for Pasta\",\"pasta cooking water\",\"salt\",\"[optional]\",\"Parmesan cheese, grated\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/201.jpg', 'https://www.soscuisine.com//recipe/pasta-in-pepper-sauce', '', '20 min', '410 kcal', '{\"calories\":\"410\",\"fat\":\"9 g\",\"cholesterol\":\"20 mg\",\"protein\":\"12 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Manganese, Selenium, Vitamin A, Vitamin C\",\"good_source_of\":\"Fibre, Folacin, Magnesium, Niacin, Vitamin B6, Vitamin E, Zinc\",\"source_of\":\"Copper, Iron, Pantothenic Acid, Phosphorus, Potassium, Vitamin B1, Vitamin B2, Vitamin K\"}', '2021-06-18 14:13:15'),
(244, 244, 1, 'Pasta with a Sun-dried Tomato Sauce', 'Put the sun-dried tomatoes, pine nuts, and basil in a blender food processor . Purée the mixture, then add the grated cheese and oil. Continue to mix until a creamy but thick consistency is obtained. Add the sour cream if desired. Meanwhile, cook the pasta Pour enough of the pasta cooking water into the tomato mixture to dilute it and obtain a sauce consistency. Adjust the seasoning Drain the pasta, then put it back into the pasta cooking pot. Add the sauce, mix thoroughly, then serve in the warmed dishes.', '[\"sun-dried tomatoes (oil packed)\",\"pine nuts\",\"fresh basil\",\"Parmesan cheese, grated\",\"olive oil\",\"sour cream\",\"[optional]\",\"fusilli, or other short cut pasta\",\"pasta cooking water\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1059.jpg', 'https://www.soscuisine.com//recipe/pasta-sun-dried-tomato-sauce', '', '25 min', '480 kcal', '{\"calories\":\"480\",\"fat\":\"19 g\",\"cholesterol\":\"0 mg\",\"protein\":\"13 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Magnesium, Manganese, Selenium\",\"good_source_of\":\"Copper, Fibre, Niacin, Phosphorus, Potassium, Vitamin E, Vitamin K, Zinc\",\"source_of\":\"Calcium, Folacin, Iron, Pantothenic Acid, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin C\"}', '2021-06-18 14:13:16'),
(245, 245, 1, 'Pasta with Arugula Pesto', 'Cook the pasta While the pasta is cooking, put the pesto\r\nsauce in a small bowl. Add the salt (as per the quantity specified in the Pesto Sauce with Arugula recipe), milk and specified amount of pasta cooking water, which will warm up the sauce and dilute it a bit. Put the drained linguine back into the pasta cooking pot, add the sauce, then mix well. Serve in the warmed dishes.', '[\"linguine, or spaghetti\",\"Pesto Sauce with Arugula\",\"pasta cooking water\",\"milk, partly skimmed, 2%\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1085.jpg', 'https://www.soscuisine.com//recipe/pasta-arugula-pesto', '', '15 min', '590 kcal', '{\"calories\":\"590\",\"fat\":\"31 g\",\"cholesterol\":\"10 mg\",\"protein\":\"15 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Magnesium, Manganese, Selenium, Vitamin E, Vitamin K\",\"good_source_of\":\"Copper, Fibre, Folacin, Niacin, Phosphorus, Zinc\",\"source_of\":\"Calcium, Iron, Omega-3, Omega-6, Pantothenic Acid, Potassium, Vitamin A, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin B6\"}', '2021-06-18 14:13:16'),
(248, 248, 1, 'Pasta with Broccoli Rabe', 'Prepare the broccoli rabe : remove any tough portions of the stalks and wash well. Blanch in a pot with plenty of salted water about 4-5 min, then drain. Cut the broccoli rabe into chunks and set them aside, keeping them warm. To save time, the rest of the sauce preparation and pasta cooking can be done at the same time. Cook the pasta In the meantime, heat the oil in a skillet over medium heat. Gently sauté the minced or pressed garlic 1-2 min, with stirring , until soft without letting it burn. Add the drained broccoli rabe and season with pepper. Pour the drained pasta into the pan and mix with the seasoned broccoli rabe. Adjust the seasoning , add the grated parmesan, then serve in the warmed dishes.', '[\"broccoli rabe\",\"pipe rigate, or other short cut pasta\",\"olive oil\",\"garlic, minced or pressed\",\"Parmesan cheese, grated\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/269.jpg', 'https://www.soscuisine.com//recipe/pasta-broccoli-rabe', '', '20 min', '400 kcal', '{\"calories\":\"400\",\"fat\":\"10 g\",\"cholesterol\":\"0 mg\",\"protein\":\"15 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Folacin, Magnesium, Manganese, Selenium, Vitamin A, Vitamin C, Vitamin E, Vitamin K\",\"good_source_of\":\"Fibre, Iron, Niacin, Phosphorus, Potassium, Vitamin B6, Zinc\",\"source_of\":\"Calcium, Copper, Pantothenic Acid, Vitamin B1, Vitamin B2\",\"low\":\"Cholesterol, Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:13:18'),
(249, 249, 1, 'Pasta with Chicken Sausage and Cauliflower', 'Prepare the vegetables : Coarsely chop the onion and cut the cauliflower into small pieces (about 2 cm). Heat the oil in a frying pan over medium heat. Add the onion and sauté 2-3 min with stirring Remove the skin from the sausage, then add the meat to the pan. Break up the meat using a wooden spoon and cook 4-5 min until it looses its pink\r\ncolour. Add the chili pepper (if the sausage is not already spiced). Pour in the warm and stir in the cauliflower. Bring to a boil then lower the heat. Cover and simmer 10 min until the cauliflower is cooked al dente and the is almost completely absorbed (the sauce should still be moist). Meanwhile, cook the pasta Drain the pasta then pour it into the frying pan. Season with salt and pepper to taste. Sprinkle with the grated cheese then well. Serve in the warmed dishes.', '[\"onions, coarsely chopped\",\"cauliflower, cut into small florets\",\"olive oil\",\"chicken sausages\",\"dried chili peppers, minced\",\"chicken broth, warm\",\"penne rigate, or other short pasta\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"Parmesan cheese, or Romano, grated\"]', 'https://media.soscuisine.com/images/recettes/1114.jpg', 'https://www.soscuisine.com//recipe/pasta-chicken-sausage-cauliflower-1', '', '25 min', '430 kcal', '{\"calories\":\"430\",\"fat\":\"10 g\",\"cholesterol\":\"40 mg\",\"protein\":\"23 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Fibre, Folacin, Manganese, Niacin, Selenium, Vitamin B12, Vitamin C, Zinc\",\"good_source_of\":\"Magnesium, Pantothenic Acid, Phosphorus, Potassium, Vitamin B6, Vitamin K\",\"source_of\":\"Calcium, Copper, Iron, Vitamin B1, Vitamin B2, Vitamin E\"}', '2021-06-18 14:13:19'),
(250, 250, 1, 'Pasta with Pesto Sauce', 'Cook the pasta While the pasta is cooking, put the pesto\r\nsauce in a small bowl, then add salt (as per the quantity specified in the Pesto Sauce recipe ) and the specified amount of pasta cooking water, which will warm up the sauce and will dilute it a bit. Put the drained linguine back into the pasta cooking pot, add the sauce and extra virgin oil, then mix well. Serve in the warmed dishes.', '[\"linguine, or spaghetti\",\"Pesto Sauce\",\"pasta cooking water\",\"extra virgin olive oil\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/682.jpg', 'https://www.soscuisine.com//recipe/pasta-pesto-sauce', '', '15 min', '540 kcal', '{\"calories\":\"540\",\"fat\":\"27 g\",\"cholesterol\":\"0 mg\",\"protein\":\"12 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Manganese, Selenium, Vitamin E, Vitamin K\",\"good_source_of\":\"Fibre, Magnesium, Niacin, Zinc\",\"source_of\":\"Calcium, Copper, Folacin, Iron, Omega-6, Phosphorus, Vitamin B1, Vitamin B6\"}', '2021-06-18 14:13:20'),
(251, 251, 1, 'Pasta with Sausage and Cauliflower', 'Prepare the vegetables : Coarsely chop the onion and cut the cauliflower into small pieces (about 2 cm). Heat the oil in a frying pan over medium heat. Add the onion and sauté 2-3 min with stirring Add the sausages to the pan. Break them up using a wooden spoon and cook 4-5 min. Add the chili pepper (if the sausage is not already spiced). Pour in the warm and stir in the cauliflower. Bring to a boil then lower the heat. Cover and simmer 10 min until the cauliflower is cooked al dente and the is almost completely absorbed (the sauce should still be moist). Meanwhile, cook the pasta Drain the pasta then pour it into the frying pan. Season with salt and pepper to taste. Sprinkle with the nutritional yeast then well. Serve in the warmed dishes.', '[\"onions, coarsely chopped\",\"cauliflower, cut into small florets\",\"olive oil\",\"smoked vegetarian sausages\",\"dried chili peppers, minced\",\"vegetable broth, warm\",\"penne rigate, or other short pasta\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"nutritional yeast\"]', 'https://media.soscuisine.com/images/recettes/3763.jpg', 'https://www.soscuisine.com//recipe/pasta-sausage-cauliflower-vegan', '', '25 min', '420 kcal', '{\"calories\":\"420\",\"fat\":\"9 g\",\"cholesterol\":\"0 mg\",\"protein\":\"22 g\"}', '{\"excellent_source_of\":\"Fibre, Folacin, Iron, Manganese, Selenium, Vitamin B12, Vitamin B2, Vitamin C\",\"good_source_of\":\"Magnesium, Niacin, Phosphorus, Vitamin B1, Vitamin B6, Vitamin K\",\"source_of\":\"Calcium, Copper, Pantothenic Acid, Potassium, Vitamin E, Zinc\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:13:20'),
(253, 253, 1, 'Penne with Arugula, Tomato, and Feta Cheese', 'Preheat the oven to 230°C /450°F. Oil an ovensafe dish (about 1 teaspoon per serving). Lay the mini-tomatoes on the sheet. Coat them thoroughly with the oil. Bake 5-7 min, until the skins split open. To save time, the sauce preparation and the pasta cooking can be done at the same time. Start cooking the pasta Transfer the tomatoes with the cooking juices into a skillet. Add the remaining oil, the pressed or minced garlic, and the finely minced chili pepper Sauté 3-4\r\nmin over medium heat. Lower the heat, then add the Parsley\r\nand Garlic Base and crumbled Feta cheese. Rinse and dry the arugula, then remove and discard the stems. Add the leaves to the skillet and sauté for just a minute, taking care not to overcook them. Pour the drained penne into the skillet, then well. Add pepper to taste, then serve in the warmed dishes.', '[\"mini-tomatoes (cherry, miniature or grape)\",\"olive oil\",\"penne rigate\",\"garlic, pressed or minced\",\"dried chili peppers, minced\",\"Parsley and Garlic Base\",\"feta cheese, crumbled\",\"arugula\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/639.jpg', 'https://www.soscuisine.com//recipe/penne-arugula-tomato-feta-cheese', '', '25 min', '430 kcal', '{\"calories\":\"430\",\"fat\":\"15 g\",\"cholesterol\":\"20 mg\",\"protein\":\"14 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Manganese, Selenium, Vitamin A, Vitamin K\",\"good_source_of\":\"Calcium, Fibre, Folacin, Magnesium, Niacin, Phosphorus, Vitamin B12, Vitamin B2, Vitamin E, Zinc\",\"source_of\":\"Copper, Iron, Pantothenic Acid, Potassium, Vitamin B1, Vitamin B6, Vitamin C\"}', '2021-06-18 14:13:22'),
(254, 254, 1, 'Penne with Asparagus Carbonara', 'Preheat the oven to 230ºC/450ºF. Prepare the asparagus . Lay the asparagus in a single layer on an oiled baking tray. Coat thoroughly with oil, then add a little salt. Bake in the middle of the oven until the asparagus change colour, about 8-10 min, depending on their size. Shake the tray a couple times during cooking so that the asparagus will cook evenly. After baking, cut the asparagus into pieces sliced at an angle, about 2 cm long. Set aside. To save time, the rest of the sauce preparation and the pasta cooking can be done at the same time. Cook the pasta in a large pot of boiling salted water,  until al dente. Meanwhile, separate the egg whites and yolks. Set the whites aside in a glass jar with a lid and put them in the refrigerator or freezer for a future use in another recipe. the yolks in a serving bowl which is large enough to hold and mix all the pasta, add the oregano, and season with salt and pepper. the egg mixture 1 min with a fork, then dilute it with the specified amount of pasta cooking water. Set aside. Drain the pasta, then pour it into the bowl. Mix rapidly in order to cook the yolks and let the pasta get coated at the same time. Add the asparagus and its cooking juices, sprinkle with the grated parmesan, then serve in the warmed plates.', '[\"asparagus, average size\",\"olive oil\",\"penne rigate, or other short cut pasta\",\"egg yolks\",\"dried oregano\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"pasta cooking water\",\"Parmesan cheese, grated\"]', 'https://media.soscuisine.com/images/recettes/1065.jpg', 'https://www.soscuisine.com//recipe/penne-asparagus-carbonara', '', '30 min', '400 kcal', '{\"calories\":\"400\",\"fat\":\"11 g\",\"cholesterol\":\"110 mg\",\"protein\":\"15 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Manganese, Selenium, Vitamin K\",\"good_source_of\":\"Copper, Fibre, Iron, Magnesium, Niacin, Phosphorus, Vitamin A, Vitamin B12, Vitamin E, Zinc\",\"source_of\":\"Calcium, Pantothenic Acid, Potassium, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin D\"}', '2021-06-18 14:13:24'),
(255, 255, 1, 'Asian Beef and Vegetable Soup', 'Heat the oil in a saucepan over medium-low heat. Add the shallot, then sauté 2-3 \r\nmin. Add the garlic, ginger and chili pepper . \r\nSauté 3 min with stirring . Pour in the and water, then add the fish sauce and a little salt and pepper. Bring to a boil, then lower the heat and simmer a few \r\nminutes. Adjust the seasoning . Add \r\nthe meat slices, warm up the meat broth 1 min, then take the saucepan off the heat. Meanwhile, cook the rice sticks for about 4 min in a large pot of salted boiling water. Drain \r\nin a colander , then rinse and drain again. Set aside. Prepare the vegetables : Grate the carrots, then thinly slice the green onions and mushrooms. Portion out the vegetables into individual serving bowls. Add the soybean sprouts and cooked rice sticks. Pour in the hot broth and serve.', '[\"canola oil\",\"shallots, finely chopped\",\"garlic, minced\",\"gingerroot, grated\",\"dried chili peppers, minced\",\"chicken broth\",\"water\",\"fish sauce (nam pla)\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"beef for Chinese fondue\",\"rice sticks (noodles)\",\"carrots, grated\",\"green onions\\/scallions, thinly sliced\",\"button (white) mushrooms, thinly sliced\",\"soybean sprouts\"]', 'https://media.soscuisine.com/images/recettes/954.jpg', 'https://www.soscuisine.com//recipe/asian-beef-vegetable-soup', 'Individual 500 ml (2 cups) serving bowls are needed.', '20 min', '400 kcal', '{\"calories\":\"400\",\"fat\":\"11 g\",\"cholesterol\":\"50 mg\",\"protein\":\"30 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Copper, Folacin, Iron, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B12, Vitamin B2, Vitamin K, Zinc\",\"good_source_of\":\"Pantothenic Acid, Vitamin B1, Vitamin B6\",\"source_of\":\"Calcium, Fibre, Vitamin C, Vitamin D, Vitamin E\"}', '2021-06-18 14:13:26'),
(256, 256, 1, 'Beef and Vegetable Curry', 'Heat the oil in a sauté pan over medium heat. Add the onion and garlic, then sauté 2-3 min, with stirring , until the onion softens, paying attention not to let the garlic burn. Add the meat. Cook about 5 min, stirring occasionally with a wooden spoon, until the meat loses its pink colour. \r\n  Add the curry, other spices, and grated ginger. Cook 1 min. Add the potatoes, carrots, tomatoes, and water. Mix well. Bring to a boil,  then reduce the heat, cover and simmer 30 min, or until the potatoes are done. Add water if necessary to maintain a moist environment. in the peas and cook an additional 5 min Adjust the seasoning , then serve on the warmed plates.', '[\"canola oil\",\"onions, finely chopped\",\"garlic, minced\",\"ground beef, lean, or extra-lean\",\"curry powder\",\"ground cinnamon\",\"gingerroot, grated\",\"turmeric\",\"cayenne pepper\",\"potatoes, peeled and diced\",\"carrots, peeled and diced\",\"canned tomatoes (diced)\",\"water\",\"frozen peas\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2480.jpg', 'https://www.soscuisine.com//recipe/beef-vegetable-curry', '', '40 min', '420 kcal', '{\"calories\":\"420\",\"fat\":\"19 g\",\"cholesterol\":\"60 mg\",\"protein\":\"28 g\"}', '{\"excellent_source_of\":\"Folacin, Iron, Magnesium, Manganese, Niacin, Potassium, Selenium, Vitamin A, Vitamin B12, Vitamin B6, Vitamin K, Zinc\",\"good_source_of\":\"Copper, Fibre, Phosphorus, Vitamin B1, Vitamin B2, Vitamin C, Vitamin E\",\"source_of\":\"Calcium, Pantothenic Acid, Vitamin D\",\"low\":\"Calories, Cholesterol, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:13:28'),
(257, 257, 1, 'Penne with Avocado and Smoked Salmon', 'To save time, the sauce preparation and pasta cooking steps should be done at the same time. cooking the pasta Cut the avocado(s) in half, twist out the pit and spoon out the flesh into a bowl. Chop and mash the flesh, sprinkle with the lemon juice, then add salt and pepper. Chop the salmon and green onion(s) into small pieces, then add them to the bowl. Add the required amount of pasta cooking water. Put the drained penne into the bowl and mix well. Serve in the warmed dishes.', '[\"penne rigate\",\"avocados\",\"lemon juice, freshly squeezed\",\"smoked salmon, chopped\",\"green onions\\/scallions, chopped\",\"pasta cooking water\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/244.jpg', 'https://www.soscuisine.com//recipe/penne-avocado-smoked-salmon', '', '20 min', '410 kcal', '{\"calories\":\"410\",\"fat\":\"11 g\",\"cholesterol\":\"0 mg\",\"protein\":\"14 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Fibre, Folacin, Manganese, Selenium, Vitamin D, Vitamin K\",\"good_source_of\":\"Copper, Magnesium, Niacin, Pantothenic Acid, Phosphorus, Potassium, Vitamin B12, Vitamin B6, Vitamin E, Zinc\",\"source_of\":\"Iron, Vitamin A, Vitamin B1, Vitamin B2, Vitamin C\",\"low\":\"Cholesterol, Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:13:29'),
(258, 258, 1, 'Penne with Duck Confit', 'In a small bowl, soak the porcini mushrooms in ½ cup of warm water until softened, about 20 min. While the porcini are softening, prepare the vegetables : Finely chop the onion and thinly slice the fresh white mushrooms. Cook the small peas, still frozen, by blanching them about 3 min in a small pot of boiling salted water. Drain them and set aside. Using a microwave, heat the duck legs confit about 1 ½ min at high power. Remove and discard the skin and bones, then set the meat aside. To save time, the rest of the sauce preparation and pasta cooking can be done at the same time. Cook the pasta Heat the oil in a skillet over medium heat. Add the onion then sauté until it becomes translucent, about 3 min. Add the fresh sliced white mushrooms and sauté, with stirring, until the mushrooms are browned and any liquid they give off has evaporated, about 3 min. Lift the porcini mushrooms out of the soaking liquid,  then add them to the skillet. Sauté 1 min. Pour the soaking liquid through a sieve (lined with a dampened paper towel to eliminate any grit) then add it to the skillet. in the duck meat, cooked peas, and demi-glace . \r\nSeason with a little salt and pepper. Heat gently through. Drain the pasta, then pour it into the pan. Mix well, sprinkle with the grated parmesan, then serve.', '[\"dried (porcini) mushrooms\",\"red onions, finely chopped\",\"button (white) mushrooms, thinly sliced\",\"frozen peas\",\"duck legs confit\",\"penne rigate\",\"olive oil\",\"demi-glace sauce\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"Parmesan cheese, grated\"]', 'https://media.soscuisine.com/images/recettes/1225.jpg', 'https://www.soscuisine.com//recipe/penne-duck-confit', '', '30 min', '500 kcal', '{\"calories\":\"500\",\"fat\":\"14 g\",\"cholesterol\":\"50 mg\",\"protein\":\"26 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Manganese, Phosphorus, Selenium\",\"good_source_of\":\"Copper, Fibre, Folacin, Iron, Magnesium, Niacin, Pantothenic Acid, Vitamin D, Zinc\",\"source_of\":\"Potassium, Vitamin A, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin E, Vitamin K\"}', '2021-06-18 14:13:29');
INSERT INTO `recipe_translation` (`rt_id`, `rt_recipe_id`, `rt_lang_id`, `rt_recipe_name`, `rt_recipe_text`, `rt_recipe_ingredients_full`, `rt_recipe_image`, `rt_recipe_link`, `rt_recipe_prep`, `rt_recipe_duration`, `rt_recipe_calories`, `rt_recipe_nutrients`, `rt_recipe_claims`, `rt_created`) VALUES
(259, 259, 1, 'Penne with Smoked Salmon', 'To save time, the sauce preparation and the pasta cooking can be done at the same time. Start cooking the pasta Meanwhile, prepare the leeks and cut them into thin slices. Melt the butter in a skillet over low heat. Sauté the leeks about 5 min until translucent, taking care not to burn\r\nthem. Chop the salmon into small pieces and add them to the skillet. Warm up just a few minutes then set aside keeping them warm. Put the drained into the skillet. Add the cream, salt and pepper to taste, then mix well. Serve in the warmed dishes.', '[\"penne rigate\",\"smoked salmon, chopped\",\"leeks, thinly sliced crosswise\",\"butter, unsalted\",\"whipping cream 35%\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/72.jpg', 'https://www.soscuisine.com//recipe/penne-smoked-salmon', '', '25 min', '420 kcal', '{\"calories\":\"420\",\"fat\":\"11 g\",\"cholesterol\":\"30 mg\",\"protein\":\"13 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Manganese, Selenium, Vitamin A, Vitamin D, Vitamin K\",\"good_source_of\":\"Copper, Fibre, Iron, Magnesium, Niacin, Vitamin B12\",\"source_of\":\"Calcium, Pantothenic Acid, Phosphorus, Potassium, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin C, Vitamin E, Zinc\"}', '2021-06-18 14:13:31'),
(260, 260, 1, 'Pesto Pasta with Tuna', 'To save time, the sauce preparation and the pasta cooking can be done at the same time. Start cooking the pasta Open the tuna can, then drain and discard the oil. Shred the tuna then add it to a bowl. in the pesto sauce, lemon juice, olive oil, and enough of the pasta cooking water to make a sauce. Mix well, then adjust the seasoning . Generally, you don\'t need to add salt since tuna is already salty. Pour the drained pasta into the serving bowl and mix thoroughly with the sauce. Serve in the warmed dishes.', '[\"penne rigate, or other short pasta\",\"tuna, canned, in vegetable oil, drained and shredded\",\"pesto sauce\",\"lemon juice, freshly squeezed\",\"olive oil\",\"pasta cooking water, approximately\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1042.jpg', 'https://www.soscuisine.com//recipe/pesto-pasta-tuna', '', '20 min', '610 kcal', '{\"calories\":\"610\",\"fat\":\"30 g\",\"cholesterol\":\"10 mg\",\"protein\":\"27 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Manganese, Niacin, Phosphorus, Selenium, Vitamin B12\",\"good_source_of\":\"Iron, Magnesium, Vitamin E, Zinc\",\"source_of\":\"Calcium, Copper, Fibre, Folacin, Omega-6, Vitamin B2, Vitamin B6, Vitamin D, Vitamin K\"}', '2021-06-18 14:13:32'),
(261, 261, 1, 'Poached Fish in Tomato Sauce', 'Heat the oil in a skillet, over medium-low heat. Add the onion and garlic and sauté gently, with occasional stirring , until softened, about 5 min. Add the spices and grated ginger, then cook 2 min with stirring . Add the strained tomatoes, and half of the lemon juice. Season with salt and pepper to taste, cover and continue to cook 5 min. Add the fish fillets, cover and cook 5 min on one side. Turn the fillets then cook 5 min on the other side, or until the fish turns opaque. Adjust the seasoning , adding the remaining lemon juice Spoon the sauce over the fish, sprinkle with optional cilantro , then serve on the warmed plates.', '[\"canola oil\",\"onions, finely chopped\",\"garlic, finely chopped\",\"dried chili peppers, minced\",\"curry powder\",\"ground cumin\",\"turmeric\",\"gingerroot, grated\",\"strained tomatoes\",\"vegetable broth\",\"lemon, freshly squeezed\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"cod fillet\",\"fresh cilantro, chopped\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2453.jpg', 'https://www.soscuisine.com//recipe/poached-fish-tomato-sauce', 'Keep the serving plates in the oven at the lowest setting so they are warm when you serve.', '30 min', '240 kcal', '{\"calories\":\"240\",\"fat\":\"6 g\",\"cholesterol\":\"90 mg\",\"protein\":\"37 g\"}', '{\"excellent_source_of\":\"Magnesium, Niacin, Potassium, Selenium, Vitamin B12, Vitamin B6, Vitamin E\",\"good_source_of\":\"Phosphorus, Vitamin C, Vitamin D\",\"source_of\":\"Copper, Folacin, Iron, Manganese, Pantothenic Acid, Vitamin A, Vitamin B1, Vitamin B2, Vitamin K, Zinc\",\"low\":\"Calories, Fat, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:13:32'),
(262, 262, 1, 'Provence-Style Chicken', 'Put the chicken legs in a resealable plastic bag. Finely chop the garlic then put it in a small bowl. Add the olive paste , olive oil, lemon juice, Parsley and garlic base cayenne pepper . Season with a little salt and pepper, then mix well. Pour the mixture into the bag, then seal it and turn it to coat the chicken with the marinade . Chill in the refrigerator at least 3 h to overnight. Preheat the oven to 190°C /375°F. Line a baking sheet or oven-proof dish with aluminium foil. Arrange the chicken pieces on the prepared baking sheet, then cook 35 min in the middle of the oven. Meanwhile, in a bowl, mix the mini-tomatoes and olives with the extra virgin olive oil. Add them to the chicken and cook an additional 15 min. Serve.', '[\"resealable plastic bag\",\"chicken legs, with back, skin removed\",\"garlic, finely chopped\",\"olive paste\",\"olive oil\",\"lemon juice, freshly squeezed\",\"Parsley and Garlic Base\",\"cayenne pepper\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"aluminum foil\",\"mini-tomatoes (cherry, miniature or grape)\",\"black olives\",\"extra virgin olive oil\"]', 'https://media.soscuisine.com/images/recettes/1164.jpg', 'https://www.soscuisine.com//recipe/provence-style-chicken', '', '65 min', '310 kcal', '{\"calories\":\"310\",\"fat\":\"18 g\",\"cholesterol\":\"90 mg\",\"protein\":\"30 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Niacin, Vitamin K, Zinc\",\"good_source_of\":\"Iron, Pantothenic Acid, Phosphorus, Potassium, Vitamin A, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin E\",\"source_of\":\"Copper, Folacin, Magnesium, Omega-6, Vitamin B1, Vitamin C\"}', '2021-06-18 14:13:33'),
(263, 263, 1, 'Provence-Style Cod Casserole', 'Preheat the oven to 205°C/400°F. Prepare the vegetables : Finely chop the garlic and  onion.  Peel the potatoes then cut them into ½ cm-thick slices. Cut the tomatoes into ½ cm-thick slices. Heat the oil in a pan over medium heat, then sauté the garlic and onion until they start to caramelize, about 5 min. Add a little  salt. Cover the bottom of a baking dish with about half of the potato slices, then add the tomatoes. Lay the cod pieces  over the tomatoes, then add the sautéed garlic and onion. Add the olives and sprinkle with the oregano. Season with salt and pepper to taste. Pour in the , then cover with the remaining potato slices. Cover and cook in the middle of the oven until the potatoes are fully cooked, about 50-55 min. For a nice golden crust, uncover and turn on the top broiler for the last 2 min. Serve directly out of the baking dish.', '[\"garlic, finely chopped\",\"onions, finely chopped\",\"potatoes, peeled and cut into 1\\/2 cm slices\",\"tomatoes, Roma type, cut into 1\\/2 cm slices\",\"olive oil\",\"cod fillet, or hake, cut into large pieces\",\"dried oregano\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"black olives\",\"vegetable broth\"]', 'https://media.soscuisine.com/images/recettes/1217.jpg', 'https://www.soscuisine.com//recipe/provence-style-cod-casserole', 'Cod may be replaced with any lean, flaky-textured fish.', '70 min', '380 kcal', '{\"calories\":\"380\",\"fat\":\"6 g\",\"cholesterol\":\"90 mg\",\"protein\":\"41 g\"}', '{\"excellent_source_of\":\"Folacin, Iron, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Selenium, Vitamin B12, Vitamin B6, Vitamin C\",\"good_source_of\":\"Copper, Fibre, Pantothenic Acid, Vitamin A, Vitamin B1, Vitamin D, Vitamin E, Zinc\",\"source_of\":\"Calcium, Vitamin B2, Vitamin K\",\"low\":\"Calories, Cholesterol, Fat, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:13:34'),
(264, 264, 1, 'Pumpkin Risotto', 'Preheat the oven to 175°C/375°F. Put the pumpkin, whole, on a baking sheet and bake for about 1 h until soft. Let it cool down, remove the seeds, carve out the pulp and dice it into 1,5 cm cubes. Take the required quantity and put the rest in the refrigerator or in the freezer for future use in another recipe. Finely chop the onion. Heat the in a small saucepan on the stove or in a microwave oven. Keep it warm while cooking the risotto (about 20 min). Melt half of the butter and the oil in a large skillet or saucepan. Sauté the onion 3-4 min until it becomes translucent. Add the rice grains and toast them 1-2 min (until translucent), with constant stirring . Add the pumpkin cubes. Cook the risotto , using the warmed until the rice is creamy but still al dente . Remove the saucepan from the heat, then in the remaining butter, grated Parmesan cheese, and grated nutmeg. Let stand for 2 min. Season with salt (not much if the is salty) and pepper to taste. Spoon the risotto into dishes and serve.', '[\"pumpkin\",\"onions, finely chopped\",\"chicken broth\",\"butter, unsalted\",\"olive oil\",\"arborio rice\",\"Parmesan cheese, grated\",\"nutmeg\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/744.jpg', 'https://www.soscuisine.com//recipe/pumpkin-risotto', '.', '90 min', '420 kcal', '{\"calories\":\"420\",\"fat\":\"14 g\",\"cholesterol\":\"20 mg\",\"protein\":\"8 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Vitamin A\",\"good_source_of\":\"Potassium, Selenium, Vitamin E, Zinc\",\"source_of\":\"Calcium, Copper, Fibre, Folacin, Iron, Magnesium, Manganese, Phosphorus, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin C, Vitamin K\",\"low\":\"Sodium\"}', '2021-06-18 14:13:35'),
(265, 265, 1, 'Quesadilla with Peppers and Avocado', 'Put half of the tortillas on a working surface. Put all ingredients, except the cheese, in a bowl. Mix the ingredients well to distribute the spices evenly in the mixture. Portion out the mixture onto the tortillas, spread it evenly over the tortilla surfaces, then top with the cheese and cover with the remaining tortillas. Sauté each quesadilla in a nonstick pan over medium-low heat 1-2 min, then flip it over using a spatula. Cook an additional 2 min until the cheese has melted and the tortillas are golden-coloured. Pay attention not to overcook the tortillas to a crispy texture – they should remain somewhat soft and pliable. Repeat with the remaining quesadillas. (You can keep them warm in a 95°C/200°F oven for a few minutes). Alternatively, quesadillas may be broiled, about 2 min per side. Do not overcook: tortillas should not be too crisp and remain soft. Cut each quesadilla into 6 wedges then serve.', '[\"wheat tortillas, large\",\"Oven-Roasted Peppers, cut into thin strips\",\"avocados, cut into small cubes\",\"red onions, chopped\",\"fresh cilantro, chopped\",\"lemon juice, freshly squeezed\",\"ground cumin\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"Cheddar cheese, grated\"]', 'https://media.soscuisine.com/images/recettes/1073.jpg', 'https://www.soscuisine.com//recipe/quesadilla-peppers-avocado', 'Depending on the quantity of quesadillas you wish to prepare, you may choose to cook them in a nonstick pan, or to arrange them on a baking sheet then broil them in an oven, at about 10 cm from the heat.', '20 min', '460 kcal', '{\"calories\":\"460\",\"fat\":\"24 g\",\"cholesterol\":\"30 mg\",\"protein\":\"14 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Fibre, Folacin, Manganese, Niacin, Potassium, Selenium, Vitamin A, Vitamin B1, Vitamin C, Vitamin E, Vitamin K\",\"good_source_of\":\"Calcium, Copper, Iron, Magnesium, Pantothenic Acid, Phosphorus, Vitamin B2, Vitamin B6, Zinc\",\"source_of\":\"Vitamin B12\"}', '2021-06-18 14:13:37'),
(266, 266, 1, 'Quesadilla with Peppers, Avocado and Turkey', 'Put half of the tortillas on a working surface. Put all ingredients, except the cheese, in a bowl. Mix the ingredients well to distribute the spices evenly in the mixture. Portion out the mixture onto the tortillas, spread it evenly over the tortilla surfaces, then top with the cheese and cover with the remaining tortillas. Sauté each quesadilla in a nonstick pan over medium-low heat 1-2 min, then flip it over using a spatula. Cook an additional 2 min until the cheese has melted and the tortillas are golden-coloured. Pay attention not to overcook the tortillas to a crispy texture – they should remain somewhat soft and pliable. Repeat with the remaining quesadillas. (You can keep them warm in a 95°C/200°F oven for a few minutes). Alternatively, quesadillas may be broiled, about 2 min per side. Do not overcook: tortillas should not be too crisp and remain soft. Cut each quesadilla into 6 wedges then serve.', '[\"wheat tortillas, large\",\"Oven-Roasted Peppers, cut into thin strips\",\"avocados, cut into small cubes\",\"turkey breast roast (cooked), thinly sliced\",\"red onions, chopped\",\"fresh cilantro, chopped\",\"lemon juice, freshly squeezed\",\"ground cumin\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"Cheddar cheese, grated\"]', 'https://media.soscuisine.com/images/recettes/1071.jpg', 'https://www.soscuisine.com//recipe/quesadilla-peppers-avocado-turkey', 'Depending on the quantity of quesadillas you wish to prepare, you may choose to cook them in a nonstick pan, or to arrange them on a baking sheet then broil them in an oven, at about 10 cm from the heat.', '15 min', '500 kcal', '{\"calories\":\"500\",\"fat\":\"25 g\",\"cholesterol\":\"50 mg\",\"protein\":\"19 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Fibre, Folacin, Iron, Manganese, Niacin, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin C, Vitamin E, Vitamin K, Zinc\",\"good_source_of\":\"Calcium, Copper, Magnesium, Pantothenic Acid\",\"source_of\":\"Vitamin B12\"}', '2021-06-18 14:13:40'),
(267, 267, 1, 'Quick Microwaved Salmon', 'Place the steaks in a microwave-safe dish, sprinkle with the lemon juice, then let stand 30 min on the counter. Cover loosely with plastic and cook at maximum power. Please consider the suggested time as a reference only, since the precise cooking time depends on your oven\'s power and the size of your steak. Ideally you should cook one or two steaks at a time for 5 min, then continue to cook 1 min at a time, while checking\r\nwith a fork to see if the fish is cooked through. Season with salt and pepper to taste, garnish with green onion tops then serve.', '[\"salmon steaks\",\"lemonjuice, freshly squeezed\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"green onions\\/scallions, green tops only, chopped\"]', 'https://media.soscuisine.com/images/recettes/2438.jpg', 'https://www.soscuisine.com//recipe/quick-microwaved-salmon', '', '12 min', '200 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Niacin, Phosphorus, Potassium, Selenium, Vitamin B12, Vitamin B6, Vitamin D\",\"good_source_of\":\"Pantothenic Acid, Vitamin B2, Vitamin E\",\"source_of\":\"Iron, Magnesium, Omega-3, Vitamin A, Vitamin B1, Vitamin C, Zinc\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Sugar, Trans Fat\"}', '2021-06-18 14:13:43'),
(268, 268, 1, 'Quick Shrimp \"Paella\"', 'Prepare the vegetables : Chop the onion and bell pepper. Heat the oil in a heavy  pan over medium-high heat. Add the onion and bell pepper, then sauté until golden brown, 7-8 min, with occasional stirring . Stir in the paprika , saffron, cayenne pepper (optional), and rice. Sauté 1 min with stirring. Pour in all the except about 1/4 cup, then bring to a boil. Season with salt and pepper. Reduce the heat to \'low\', cover and simmer until the rice is almost tender, about 18 min. Put the shrimp on top of the rice, add the peas and drizzle with the remaining broth (add a little water, if necessary, to moisten the contents). Cover and cook until the shrimp is opaque in the centres and pink-coloured, 5-6 min. Adjust the seasoning , sprinkle with parsley (optional) then serve in the warmed dishes.', '[\"onions, chopped\",\"yellow or red sweet peppers, chopped\",\"olive oil\",\"paprika\",\"saffron powder\",\"cayenne pepper\",\"[optional]\",\"arborio rice\",\"vegetable broth\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"shrimp, medium-large\",\"frozen peas\",\"Italian parsley, fresh, chopped\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2326.jpg', 'https://www.soscuisine.com//recipe/quick-shrimp-paella-veg', 'For good results, use only good quality spices.', '40 min', '390 kcal', '{\"calories\":\"390\",\"fat\":\"9 g\",\"cholesterol\":\"110 mg\",\"protein\":\"17 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Selenium, Vitamin B12, Vitamin C\",\"good_source_of\":\"Iron, Magnesium, Niacin, Phosphorus, Potassium, Vitamin A, Vitamin B6, Vitamin E, Zinc\",\"source_of\":\"Calcium, Copper, Fibre, Folacin, Manganese, Vitamin B1, Vitamin B2, Vitamin K\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:13:44'),
(272, 272, 1, 'Reaction-Time Chicken', 'In a large pan, heat the oil over medium-high heat. Sauté the finely chopped onion and cinnamon 3-4 min then add the grated ginger, crushed garlic, cardamom pods, turmeric and minced chili pepper . Cook 1 min with constant stirring . Add the chicken pieces and sauté until they lose their pink colour. Add the tomato paste, ground almonds and diced tomatoes. , cover, lower the heat and simmer about 25 min. Meanwhile, cook the In the meantime, mix the yogurt and cream in a small bowl. Add the mixture to the pan at the very end and cook an additional 1-2 min without letting it boil. Add salt and pepper to taste and remove the cardamom pods. Garnish with fresh cilantro leaves then serve with the rice.', '[\"canola oil\",\"onions, finely chopped\",\"ground cinnamon\",\"gingerroot, grated\",\"garlic, crushed\",\"cardamom pods\",\"turmeric\",\"dried chili peppers, minced\",\"chicken breasts, boneless, skinless, cut into bite-size pieces\",\"tomato paste\",\"flaked almonds, finely ground\",\"canned tomatoes (diced)\",\"yogurt, plain, 2%\",\"cream 15%\",\"fresh cilantro\",\"[optional]\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"basmati rice\"]', 'https://media.soscuisine.com/images/recettes/3275.jpg', 'https://www.soscuisine.com//recipe/reaction-time-chicken', '', '45 min', '580 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"free\":\"Added Sugar\",\"excellent_source_of\":\"Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Potassium, Selenium, Vitamin B6, Vitamin E\",\"good_source_of\":\"Iron, Vitamin A, Vitamin B12, Vitamin B2, Vitamin K, Zinc\",\"source_of\":\"Calcium, Copper, Fibre, Folacin, Omega-3, Vitamin B1, Vitamin C\",\"low\":\"Cholesterol, Saturated Fat, Sodium\"}', '2021-06-18 14:13:50'),
(273, 273, 1, 'Beef Fajitas', 'In a shallow dish, together the lime juice, minced or pressed garlic, cumin, salt, and pepper. Add the steak, turning to coat well. Cover and chill in a refrigerator overnight.', '[\"beef, inside round, or French steak\",\"lime juice, freshly squeezed\",\"garlic, for the marinade\",\"ground cumin, for the marinade\",\"onions, finely chopped\",\"garlic, minced\",\"yellow or red sweet peppers, cut into 1,5 cm strips\",\"canola oil\",\"corn tortillas, about 21 cm diameter\",\"sour cream\",\"[optional]\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/103.jpg', 'https://www.soscuisine.com//recipe/beef-fajitas', '', '30 min', '440 kcal', '{\"calories\":\"440\",\"fat\":\"13 g\",\"cholesterol\":\"50 mg\",\"protein\":\"28 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Selenium, Vitamin B12, Vitamin B6, Vitamin C, Zinc\",\"good_source_of\":\"Calcium, Vitamin B1, Vitamin B2, Vitamin E\",\"source_of\":\"Copper, Omega-3, Omega-6, Pantothenic Acid, Vitamin A, Vitamin D, Vitamin K\",\"low\":\"Sodium\"}', '2021-06-18 14:13:51'),
(274, 274, 1, 'Red Lentil and Tofu Curry', 'Rinse and drain the lentils, then set aside. Finely chop the onion. Mince the garlic and ginger Heat half of the oil in a saucepan over medium heat. Add the onion and garlic, then 2 min, with stirring ,\r\nuntil translucent. Add the ginger and cook, with stirring, 1 min. Add the lentils and water, bring to a boil, then reduce the heat and simmer ,\r\nuncovered, until the lentils are cooked and fall apart, about 15 min. Rinse the tofu, then cut it into 1 cm cubes. Press the cubes gently between paper towels to remove excess moisture. Heat the remaining oil in a small skillet until hot but not smoking, then in the curry powder and cayenne .\r\nCook 30 seconds with stirring, then add the spiced oil to the lentils. Gently add the tofu cubes and season with salt. Cook 2 min, then remove the pan from the heat, cover and let stand 5 min to allow the flavours to develop. Sprinkle with fresh cilantro leaves and serve.', '[\"onions, finely chopped\",\"garlic, minced\",\"gingerroot, minced\",\"red-orange lentils (dried), rinsed and drained\",\"canola oil\",\"water\",\"firm regular tofu, cut into 1 cm cubes\",\"curry powder\",\"cayenne pepper\",\"salt\",\"fresh cilantro\"]', 'https://media.soscuisine.com/images/recettes/677.jpg', 'https://www.soscuisine.com//recipe/red-lentil-tofu-curry', 'It is not necessary to soak the lentils in advance.', '30 min', '390 kcal', '{\"calories\":\"390\",\"fat\":\"19 g\",\"cholesterol\":\"0 mg\",\"protein\":\"26 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Copper, Folacin, Iron, Magnesium, Manganese, Niacin, Selenium, Vitamin E, Vitamin K, Zinc\",\"good_source_of\":\"Calcium, Fibre, Pantothenic Acid, Phosphorus, Potassium, Vitamin B1, Vitamin B6\",\"source_of\":\"Omega-3, Vitamin B2\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Cholesterol\"}', '2021-06-18 14:13:52'),
(275, 275, 1, 'Risotto with Peppers', 'Finely chop the onion. Prepare the peppers then cut them into small squares (about 1 cm). Heat the in a small saucepan on the stove or in a microwave oven. Keep it warm while cooking the risotto (about 20 min). Melt the butter and oil in a large skillet or saucepan. Sauté the onion 2-3 min, until it becomes translucent, then add the peppers and continue to cook 2 min. Add the rice , then sauté 1-2 min, with constant stirring , until the rice grains are well toasted and translucent. Cook the risotto using the warmed until the rice is creamy but still al dente . Remove from the heat and let stand for 2 min. Season with salt (not much if the is salty) and pepper to taste. Sprinkle with grated Parmesan\r\ncheese, then serve.', '[\"onions, finely chopped\",\"yellow or red sweet peppers, cut into 1 cm squares\",\"chicken broth\",\"butter, unsalted\",\"olive oil\",\"arborio rice\",\"Parmesan cheese, grated\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/934.jpg', 'https://www.soscuisine.com//recipe/risotto-peppers', '.', '30 min', '400 kcal', '{\"calories\":\"400\",\"fat\":\"10 g\",\"cholesterol\":\"10 mg\",\"protein\":\"8 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Vitamin A, Vitamin C\",\"good_source_of\":\"Potassium, Selenium, Vitamin B6, Vitamin E, Zinc\",\"source_of\":\"Calcium, Copper, Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin B2, Vitamin K\",\"low\":\"Sodium\"}', '2021-06-18 14:13:52'),
(276, 276, 1, 'Roast Beef with Tuna Sauce', 'Place the tuna in a food processor . Add the capers, mayonnaise, milk, and lemon juice, and mix for a few seconds until a smooth consitency is obtained. Add a little extra milk if the sauce is too dense to your taste. Arrange the roast beef slices on a serving plate, then spoon the tuna sauce on top. Chill in the refrigerator for at least 1 h then serve.', '[\"roast beef (cooked), thinly sliced\",\"capers\",\"tuna, canned\",\"mayonnaise\",\"whipping cream 35%\",\"lemon juice, freshly squeezed\"]', 'https://media.soscuisine.com/images/recettes/3013.jpg', 'https://www.soscuisine.com//recipe/roast-beef-tuna-sauce', 'will be very useful for this recipe.', '15 min', '300 kcal', '{\"calories\":\"300\",\"fat\":\"18 g\",\"cholesterol\":\"60 mg\",\"protein\":\"32 g\"}', '{\"free\":\"Sugar\",\"excellent_source_of\":\"Niacin, Selenium, Vitamin B12, Zinc\",\"good_source_of\":\"Iron, Phosphorus, Vitamin D\",\"source_of\":\"Copper, Magnesium, Omega-3, Omega-6, Pantothenic Acid, Potassium, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin E, Vitamin K\"}', '2021-06-18 14:13:54'),
(277, 277, 1, 'Roast Chicken and Potatoes with Rosemary', 'Preheat the oven to 230ºC/450ºF. Pour one tablespoon of oil on a large oven-proof dish or baking sheet. Flatten the chicken by pressing down on the breast, then break the joints between the body and the legs to flatten the legs as well. Rub the chicken with the butter. Slice 3 cloves of garlic into thin strips then put some into the bird \r\ncavity and tuck the rest under the skin. Do the same with 3 rosemary sprigs. Season generously with salt and pepper, then place the chicken on the sheet, breast side down. Cook 15 min in the middle of the oven, then lower the temperature to 190ºC/375ºF and cook an additional 30-35 min. Meanwhile, peel the potatoes, wash them and pat them dry. Cut each potato into quarters lengthwise, then put them into a bowl. Pour in the remaining oil. the remaining garlic cloves then add them to the bowl. Add the remaining rosemary leaves stripped from the stem, whole. Season with salt and pepper then mix well. Take the sheet with the chicken out of the oven, turn the chicken breast side up, then arrange the potatoes all around it. Cook an additional 40-45 min, until the potatoes and chicken are golden-coloured and fully cooked. to prevent excessive sticking, loosen the potatoes from the sheet once or twice during cooking, without turning them over. For a nicely coloured and crisp skin, turn on the top broiler for the last 2 min. Let stand 3-5 min before serving.', '[\"olive oil\",\"chicken, whole, trimmed of excess skin and fat\",\"butter, unsalted\",\"garlic\",\"rosemary, fresh\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"potatoes, Idaho, Russet, or Yukon Gold, cut into quarters lengthwise\"]', 'https://media.soscuisine.com/images/recettes/792.jpg', 'https://www.soscuisine.com//recipe/roast-chicken-potatoes-rosemary', '', '105 min', '450 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Iron, Magnesium, Niacin, Pantothenic Acid, Phosphorus, Potassium, Selenium, Vitamin B6, Zinc\",\"good_source_of\":\"Fibre, Manganese, Vitamin B12, Vitamin B2, Vitamin E\",\"source_of\":\"Calcium, Copper, Vitamin A, Vitamin B1, Vitamin C, Vitamin D, Vitamin K\",\"low\":\"Saturated Fat, Sodium\"}', '2021-06-18 14:13:56'),
(278, 278, 1, 'Roman-Style Chicken Breast', 'Prepare the vegetables : Finely chop the onion and coarsely chop the fennel. Cut each whole chicken breast in half lengthwise then the halves with the flour. Heat half of the oil in a pan over medium heat. Add the onion, fennel, and crushed fennel seeds, then sauté 5 min. Take the mixture out of the pan and set aside on a dish. Pour the remaining oil into the pan. Add the chicken breasts, then until they are lightly golden-brown, about 3 min on each side. Season with salt and pepper. Pour in the , return the vegetable mixture to the pan then add the peas. Cook over very low heat until the chicken breasts are fully cooked, about 10 min. Meanwhile, separate the egg whites and yolks. Set the whites aside in a glass jar with a lid and put them in the refrigerator or freezer for a future use in another recipe. Put the yolks in a small bowl. Pour in the lemon juice, then the lemon juice and egg yolk(s) together. Slowly, with stirring , add about ½ cup of the hot liquid from the chicken and vegetables. Mix well to combine. Pour the eggmixture into the pan and cook over low heat, with stirring, until it thickens slightly, about 2 min. (Do not allow the mixture to boil or the eggs will curdle). Sprinkle with the parsley (optional) then serve.', '[\"onions, finely chopped\",\"fennels, coarsely chopped\",\"fennel seeds, crushed\",\"chicken breasts, boneless, skinless\",\"white flour (all purpose)\",\"olive oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"chicken broth\",\"frozen peas\",\"egg yolks\",\"lemon juice, freshly squeezed\",\"Italian parsley, fresh, chopped\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1554.jpg', 'https://www.soscuisine.com//recipe/roman-style-chicken-breast-alcohol-free', 'Keep the serving plates warm on the stove while you\'re preparing the dish.', '40 min', '340 kcal', '{\"calories\":\"340\",\"fat\":\"13 g\",\"cholesterol\":\"190 mg\",\"protein\":\"39 g\"}', '{\"excellent_source_of\":\"Folacin, Niacin, Pantothenic Acid, Phosphorus, Potassium, Vitamin B12, Vitamin B6\",\"good_source_of\":\"Iron, Magnesium, Manganese, Vitamin A, Vitamin B1, Vitamin B2, Vitamin C, Vitamin E, Vitamin K, Zinc\",\"source_of\":\"Calcium, Copper, Fibre, Selenium, Vitamin D\",\"low\":\"Calories, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:13:58'),
(279, 279, 1, 'Rosemary Chicken', 'Heat the oil in a pan over high heat. Add the chicken legs and sauté thoroughly on each side until golden, about 10 min. Take the chicken out of the pan then set it aside Finely chop the onion, garlic, and rosemary, then add them to the pan. Cook 2-3 min over medium heat, taking care not to let them burn. Add the Parsley and Garlic Base and the tomato paste then cook 2-3 min over medium heat. Pour in the , then put the chicken back into the pan. Season with salt and pepper. Cover, and simmer over low heat until the meat is tender, 30-35 min. Serve on the warmed plates.', '[\"olive oil\",\"chicken legs, with back\",\"onions, finely chopped\",\"garlic, finely chopped\",\"rosemary, fresh, finely chopped\",\"Parsley and Garlic Base\",\"tomato paste\",\"chicken broth\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1101.jpg', 'https://www.soscuisine.com//recipe/rosemary-chicken-halal', '', '55 min', '270 kcal', '{\"calories\":\"270\",\"fat\":\"13 g\",\"cholesterol\":\"90 mg\",\"protein\":\"30 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Niacin, Vitamin B6, Vitamin K, Zinc\",\"good_source_of\":\"Pantothenic Acid, Phosphorus, Potassium, Vitamin A, Vitamin B12, Vitamin B2\",\"source_of\":\"Copper, Folacin, Iron, Magnesium, Manganese, Vitamin B1, Vitamin C, Vitamin E\"}', '2021-06-18 14:13:59'),
(280, 280, 1, 'Rosemary Rabbit', 'Heat the oil and butter in a pan over high heat. Add the rabbit pieces and sauté thoroughly on each side until golden, about 7-8 min. Finely chop the onion and rosemary, then add them to the pan. Cook 2-3 min over medium heat, taking care not to let them burn. Add the Parsley and Garlic Base , the tomato paste and cook 2-3 min over medium heat. Scrape the bottom of the pan, using a wooden spoon. Add salt and pepper. Pour in about 1 cm of warm water, cover, and simmer over low heat about 30 min or longer, until the meat is tender. (Do as if it were chicken) Serve on the warmed plates.', '[\"olive oil\",\"butter, unsalted\",\"rabbit, cut into pieces\",\"onions, finely chopped\",\"rosemary, fresh, finely chopped\",\"Parsley and Garlic Base\",\"tomato paste\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"water\"]', 'https://media.soscuisine.com/images/recettes/532.jpg', 'https://www.soscuisine.com//recipe/rosemary-rabbit-halal', '', '45 min', '330 kcal', '{\"calories\":\"330\",\"fat\":\"17 g\",\"cholesterol\":\"110 mg\",\"protein\":\"38 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Niacin, Phosphorus, Selenium, Vitamin B12, Vitamin B6, Vitamin K, Zinc\",\"good_source_of\":\"Iron, Potassium, Vitamin A\",\"source_of\":\"Copper, Folacin, Magnesium, Manganese, Omega-3, Pantothenic Acid, Vitamin B1, Vitamin B2, Vitamin E\",\"low\":\"Sodium\"}', '2021-06-18 14:14:00'),
(281, 281, 1, 'Run Down Codfish', 'Salt the cod lighly on both sides then let rest refrigerated for at least 30 min and up to 24 h. Heat the oil in a wide skillet, over medium-high heat. Add the garlic, onion,  jalapeño pepper, and pepper. Sauté , with occasional stirring , until the onion softens, about 5 min. in the coconut milk and tomatoes, bring to a boil, and cook with occasional stirring , until the mixture reduces by about a half. Rinse the fish, then add it to the pan. Adjust the heat so that the mixture bubbles steadily but not violently. The fish is done after about 10 min. It is important to check\r\nwith a fork to see if the fish is cooked through Add the lime juice, garnish with the cilantro leaves then serve in the warmed dishes.', '[\"cod fillet\",\"salt\",\"[optional]\",\"canola oil\",\"garlic, minced\",\"onions, finely chopped\",\"jalape\\u00c3\\u00b1o pepper, fresh, finely chopped\",\"ground pepper to taste, in generous quantity\",\"[optional]\",\"unsweetened coconut milk\",\"canned tomatoes (diced)\",\"lime juice, freshly squeezed\",\"fresh cilantro, chopped, pour garnir\"]', 'https://media.soscuisine.com/images/recettes/2558.jpg', 'https://www.soscuisine.com//recipe/run-down-codfish', 'Keep the serving dishes in the oven at the lowest setting so they are warm when you serve', '30 min', '310 kcal', '{\"calories\":\"310\",\"fat\":\"19 g\",\"cholesterol\":\"60 mg\",\"protein\":\"29 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Magnesium, Manganese, Niacin, Selenium, Vitamin B12\",\"good_source_of\":\"Phosphorus, Potassium, Vitamin B6, Vitamin D, Vitamin E\",\"source_of\":\"Copper, Folacin, Iron, Omega-3, Pantothenic Acid, Vitamin A, Vitamin B1, Vitamin B2, Vitamin C, Vitamin K, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:14:01'),
(282, 282, 1, 'Beef Stew en Papillote', 'Preheat the oven to 135ºC/275ºF. In a small bowl, mix the ketchup, flour, soy sauce, Worcestershire sauce and mustard. Put the pot roast on a large sheet of heavy-duty aluminum foil, spread the mixture on top, then wrap and seal thoroughly (you may want to add an additional sheet to ensure that the juices are well trapped inside). Put the wrap on a baking pan then cook in the middle of the oven. Serve with the juices.', '[\"ketchup\",\"white flour (all purpose)\",\"Worcestershire sauce\",\"soy sauce\",\"mustard powder\",\"blade pot roast\"]', 'https://media.soscuisine.com/images/recettes/1023.jpg', 'https://www.soscuisine.com//recipe/beef-stew-en-papillote', 'The cooking time varies with the temperature of the oven: I recommend using 135ºC/275ºF and calculate about 3 h per kilo of meat. If you prefer, you may vary the temperature between 100ºC/205ºF and 150ºC/300ºF, then adjust the cooking time accordingly (longer at lower temperatures and shorter at higher temperatures).', '190 min', '250 kcal', '{\"calories\":\"250\",\"fat\":\"10 g\",\"cholesterol\":\"80 mg\",\"protein\":\"31 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Iron, Niacin, Selenium, Vitamin A, Vitamin B12, Zinc\",\"good_source_of\":\"Phosphorus, Potassium, Vitamin B2\",\"source_of\":\"Copper, Folacin, Magnesium, Pantothenic Acid, Vitamin B6, Vitamin D\"}', '2021-06-18 14:14:02'),
(283, 283, 1, 'Salmon and Arugula Bowl', 'Boil the eggs (10 min), cool them down immediately in cold water. Set aside. Meanwhile, prepare the vegetables : Grate the carrots, dice the celery, finely chop the green onions and radish. Put all the vegetables in a salad bowl. Add the arugula, then pour in the oil and lemon juice. Adjust the\r\nseasoning Transfer the salad to serving bowls. Cut the salmon into pieces and quarter the eggs. Place them on top of the salad, garnish with cilantro and serve.', '[\"eggs size large\",\"carrots, grated\",\"celery, finely diced\",\"green onions\\/scallions, finely chopped\",\"radishes, thinly sliced\",\"extra virgin olive oil\",\"lemon juice, freshly squeezed\",\"salmon, canned\",\"baby arugula\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"fresh cilantro\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/4229.jpg', 'https://www.soscuisine.com//recipe/salmon-argula-bowl', '', '25 min', '360 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Bone-healthy, Heart-healthy\",\"excellent_source_of\":\"Calcium, Folacin, Niacin, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B12, Vitamin B2, Vitamin D, Vitamin E, Vitamin K\",\"good_source_of\":\"Iron, Magnesium, Pantothenic Acid, Vitamin B6, Zinc\",\"source_of\":\"Copper, Manganese, Omega-3, Vitamin B1, Vitamin C\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:14:02'),
(284, 284, 1, 'Salmon and Avocado on Mixed Greens', 'Dice the avocado. Wash and spin-dry the mixed greens. Put all the ingredients in a salad bowl or serving plate. Pour in the Miso Dressing . Add salt and pepper to taste then toss. Serve.', '[\"avocados, diced\",\"mixed greens\",\"dried goji berries\",\"pumpkin seeds\",\"salmon, canned\",\"Miso Dressing\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/4114.jpg', 'https://www.soscuisine.com//recipe/salmon-avocado-mixed-greens', 'If goji berries are not available, substitute for dried cranberries.', '15 min', '360 kcal', '{\"calories\":\"360\",\"fat\":\"28 g\",\"cholesterol\":\"40 mg\",\"protein\":\"18 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Fibre, Folacin, Magnesium, Niacin, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B12, Vitamin E, Vitamin K\",\"good_source_of\":\"Calcium, Iron, Manganese, Pantothenic Acid, Vitamin C, Zinc\",\"source_of\":\"Copper, Omega-3, Omega-6, Vitamin B1, Vitamin B2, Vitamin B6\"}', '2021-06-18 14:14:04'),
(285, 285, 1, 'Salmon and Rice Buddha Bowl', 'Cook the rice . Let stand in the refrigerator at least 1 h. Boil the eggs (10 min), cool them down immediately in cold water. Set aside. When ready to serve, prepare the vegetables : grate the carrots, dice the celery, and chop the green onions. Put them in a salad bowl, with the rice, flageolet beans and arugula. Drizzle with the oil and lemon juice. Adjust the\r\nseasoning , then Transfer the salad to serving bowls. Cut the salmon into pieces and quarter the eggs. Place them on top of the salad, garnish with cilantro and serve.', '[\"rice, long grain\",\"eggs size large\",\"carrots, grated\",\"celery, finely diced\",\"green onions\\/scallions, finely chopped\",\"green kidney \\/ flageolet beans (canned), rinsed and drained\",\"extra virgin olive oil\",\"lemon juice, freshly squeezed\",\"salmon, canned\",\"baby arugula\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"fresh cilantro\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/3350.jpg', 'https://www.soscuisine.com//recipe/salmon-rice-buddah-bowl', '', '25 min', '610 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Calcium, Folacin, Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin D, Vitamin E, Vitamin K, Zinc\",\"good_source_of\":\"Iron\",\"source_of\":\"Copper, Fibre, Omega-3, Vitamin B1, Vitamin C\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:14:04'),
(286, 286, 1, 'Salmon and Spinach with a Balsamic Sauce', 'Pour the balsamic vinegar and honey into a small saucepan then bring to a boil. Cook over medium heat until the volume is reduced by half and a syrupy consistency is obtained, 5-7 min. Set aside. Prepare the spinach . Wash and drain rapidly then transfer to a pot or saucepan without adding any water. The water trapped in the leaves after gentle shaking is enough to cook them. Add salt, cover and cook over high heat 3-4 min until the leaves wilt and turn very deep green. Avoid overcooking otherwise the spinach will become brownish. Transfer the spinach to a colander ,\r\npress to remove excess water, then set aside. Cut the salmon fillet into servings. Lightly oil \r\n  each piece on both sides. Heat a grooved, thick-bottom frying pan or a nonstick pan. When hot, add the fish, skin side down, and cook  until the edges become opaque and lighter coloured, about 5 min. Turn and cook an additional 5 min. Peel off the skin then season with salt and pepper. Check with a fork to see if it is cooked through . Alternatively, cook the fish on a hot grill. Transfer the spinach to the warmed serving plates, place the fish on top, then drizzle with the balsamic syrup. Serve.', '[\"balsamic vinegar\",\"honey\",\"spinach\",\"salt\",\"[optional]\",\"salmon fillet, cut into servings\",\"canola oil\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1031.jpg', 'https://www.soscuisine.com//recipe/salmon-spinach-balsamic-sauce-alcohol-free', 'Keep the serving plates in the oven at the lowest setting so they are warm when you serve.', '30 min', '290 kcal', '{\"calories\":\"290\",\"fat\":\"9 g\",\"cholesterol\":\"110 mg\",\"protein\":\"32 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Folacin, Iron, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin D, Vitamin E, Vitamin K\",\"good_source_of\":\"Pantothenic Acid, Zinc\",\"source_of\":\"Calcium, Copper, Fibre, Omega-3, Vitamin B1, Vitamin C\",\"low\":\"Saturated Fat\",\"free\":\"Trans Fat\"}', '2021-06-18 14:14:05'),
(287, 287, 1, 'Salmon Burger', 'Preheat the outdoor grill. Lightly oil the rack. Using a knife, chop the salmon into small pieces, \n  then put them in a bowl. Add the shallot, egg, cilantro, mayonnaise, mustard, lemon juice, breadcrumbs and Cayenne pepper . Season with salt and pepper. Mix well until the mixture is homogeneous. You may need to add more or less breadcrumbs to reach a good consistency. Form the mixture into patties, then place them on the oiled rack. Grill about 4 min per side. Toast the buns at the same time. Alternatively, you may cook the patties on the stovetop in a thick-bottom pan. Spread the inside of the buns with the tartare sauce . Place the mix greens and the patties on the bottom of the buns. Top with the sliced radish. Close the burger then serve.\n  ', '[\"canola oil, to oil the rack\",\"salmon fillet, skinned, cut into chunks\",\"shallots, finely chopped\",\"eggs size large, lightly beaten\",\"fresh cilantro, finely chopped\",\"mayonnaise\",\"Dijon mustard\",\"lemon juice, freshly squeezed\",\"bread crumbs\",\"cayenne pepper\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"hamburger buns\",\"Tartare Sauce\",\"radishes,thinly  sliced\",\"mixed greens\"]', 'https://media.soscuisine.com/images/recettes/2707.jpg', 'https://www.soscuisine.com//recipe/salmon-burger', 'These burgers can be cooked either using an outdoor grill or in a pan on the stovetop.', '25 min', '520 kcal', '{\"calories\":\"520\",\"fat\":\"25 g\",\"cholesterol\":\"200 mg\",\"protein\":\"36 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Folacin, Niacin, Pantothenic Acid, Phosphorus, Potassium, Selenium, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin D, Vitamin E\",\"good_source_of\":\"Iron, Magnesium, Manganese, Vitamin K, Zinc\",\"source_of\":\"Calcium, Copper, Fibre, Omega-3, Omega-6, Vitamin A\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:14:06'),
(288, 288, 1, 'Salmon with a Nut Crust', 'Preheat the oven to 95°C/200°F. Put the salmon fillet on an oven-proof plate. Season with salt and pepper to taste.\r\n  Grind the haselnuts and bread, then cover the fish with the mixture. Place in the middle of the oven and bake for 50-55 min. You can check\r\nwith a fork to see if the fish is cooked through: It is done when it flakes easily and does not stick to the  prongs. Finely chop the herbs, then put them on top of the fish. Serve with the mayonnaise.', '[\"salmon fillet\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"hazelnuts, shelled, or other nuts, ground\",\"country bread, chopped\",\"chives, fresh, finely chopped\",\"fresh mint, finely chopped\",\"mayonnaise, or to taste\"]', 'https://media.soscuisine.com/images/recettes/2424.jpg', 'https://www.soscuisine.com//recipe/salmon-nut-crust', '', '60 min', '280 kcal', '{\"calories\":\"280\",\"fat\":\"13 g\",\"cholesterol\":\"110 mg\",\"protein\":\"32 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Manganese, Niacin, Phosphorus, Potassium, Selenium, Vitamin B12, Vitamin B6, Vitamin D, Vitamin E\",\"good_source_of\":\"Magnesium, Pantothenic Acid, Vitamin B2\",\"source_of\":\"Copper, Folacin, Iron, Omega-3, Vitamin A, Vitamin B1, Vitamin K, Zinc\"}', '2021-06-18 14:14:07'),
(289, 289, 1, 'Salmon with a Spicy Crust', 'Preheat the oven to 230°C/450°F. Cut the salmon into pieces of comparable size, as per the number of servings required. Set aside. Coarsely grind the peppercorns, coriander, mustard, and celery seeds, using a pepper mill if available. Otherwise, place the spices in a plastic bag and crush them using a rolling pin . Transfer the mixture to a shallow dish, add the salt, then the salmon pieces on both sides with the spice\r\nmixture. Melt the butter and oil in a nonstick skillet over medium heat. Add the salmon and sauté until the crust is golden, about 1-2 min per side, taking care not to let it burn. Transfer the fillets to a baking dish, place it in the middle of the oven, and bake for about 7-8 min for a 2 to 2,5 cm thick fillet. Since the cooking time depends on the thickness of the fillets and the actual temperature of the oven, it is important to check with a fork to see if the fish is cooked through. Serve on the warmed plates.', '[\"peppercorns\",\"coriander seeds\",\"mustard seeds\",\"celery seeds\",\"salt\",\"salmon fillet\",\"butter, unsalted\",\"olive oil\"]', 'https://media.soscuisine.com/images/recettes/271.jpg', 'https://www.soscuisine.com//recipe/salmon-spicy-crust', 'Keep the serving plates warm on the stove while you\'re preparing the dish.', '20 min', '310 kcal', '{\"calories\":\"310\",\"fat\":\"17 g\",\"cholesterol\":\"120 mg\",\"protein\":\"32 g\"}', '{\"free\":\"Sugar\",\"excellent_source_of\":\"Iron, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Selenium, Vitamin B12, Vitamin B6, Vitamin D, Vitamin E\",\"good_source_of\":\"Vitamin B2, Zinc\",\"source_of\":\"Calcium, Copper, Fibre, Omega-3, Pantothenic Acid, Vitamin A, Vitamin B1, Vitamin K\"}', '2021-06-18 14:14:07'),
(290, 290, 1, 'Beef Stroganoff', 'Cut the meat into 1 X 5 cm strips, then them with flour. Heat the oil in a frying pan over medium heat. Sauté the finely chopped onion a few minutes until traslucent, then take it out of the pan and set aside on a small plate. Turn the heat up high, add the butter, and the pieces of meat in the same pan, until nicely coloured, about 5 min. For large quantities, avoid crowding the meat in the pan and work in batches. Add the warm deglaze the pan. Put the onion back in and season with salt and pepper. Start cooking gently, covered, for about 20-25 min. Add the thinly sliced mushrooms , then continue to cook an additional 10 min. In a small bowl, mix the tomato paste with the cream and Worcestershire sauce. Add to the\r\npan and cook over very low heat 3-5 min, taking care not to let it boil. Serve on the warmed plates.', '[\"beef, top sirloin, cut into 1 x 5 cm strips\",\"white flour (all purpose)\",\"canola oil\",\"onions, finely chopped\",\"butter, unsalted\",\"beef broth\",\"button (white) mushrooms, thinly sliced\",\"tomato paste\",\"whipping cream 35%\",\"Worcestershire sauce\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/10.jpg', 'https://www.soscuisine.com//recipe/beef-stroganoff', '', '55 min', '340 kcal', '{\"calories\":\"340\",\"fat\":\"21 g\",\"cholesterol\":\"80 mg\",\"protein\":\"25 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Niacin, Potassium, Selenium, Vitamin A, Vitamin B12, Vitamin B2, Zinc\",\"good_source_of\":\"Copper, Iron, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin B6, Vitamin E\",\"source_of\":\"Folacin, Magnesium, Manganese, Vitamin D, Vitamin K\",\"low\":\"Sodium\"}', '2021-06-18 14:14:09');
INSERT INTO `recipe_translation` (`rt_id`, `rt_recipe_id`, `rt_lang_id`, `rt_recipe_name`, `rt_recipe_text`, `rt_recipe_ingredients_full`, `rt_recipe_image`, `rt_recipe_link`, `rt_recipe_prep`, `rt_recipe_duration`, `rt_recipe_calories`, `rt_recipe_nutrients`, `rt_recipe_claims`, `rt_created`) VALUES
(291, 291, 1, 'Salmon with Leeks', 'Preheat the oven to 215°C/425°F. Prepare the leeks : Keep the white and light-green parts only, quarter them lengthwise, then cut them in half crosswise. Clean the leeks well, drain, then place them on a large rimmed baking sheet. Pour in the oil, season with salt and pepper, then well to coat the leeks thoroughly with the oil. Place in the middle of the oven and roast, tossing once, until the leeks begin to soften, about 12 min. Meanwhile, cut the salmon fillet into similarly-sized pieces, according to the number of servings required. Set aside. When the leeks are softened, remove the baking sheet from the oven, toss the leeks with the pan juices to coat, then push them to the edges of the baking sheet to allow room for the salmon in the centre. Arrange the salmon pieces and season generously with salt and pepper. Return the sheet to the oven and bake until the salmon is opaque throughout, about 10 min for a 2 to 2,5 cm thick fillet. Since the cooking time depends on the fillet thickness and the actual temperature of the oven, it is important to check with a fork to see if the fish is cooked through Serve the salmon with leeks on the warmed plates. Add lemon wedges on the side (optional).', '[\"leeks, quartered lengthwise and halved crosswise\",\"olive oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"salmon fillet\",\"lemons\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/887.jpg', 'https://www.soscuisine.com//recipe/salmon-leeks', 'Keep the serving plates warm on the stove while you\'re preparing the dish.', '35 min', '330 kcal', '{\"calories\":\"330\",\"fat\":\"9 g\",\"cholesterol\":\"30 mg\",\"protein\":\"29 g\"}', '{\"excellent_source_of\":\"Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Vitamin A, Vitamin B12, Vitamin B6, Vitamin C, Vitamin D, Vitamin E, Vitamin K\",\"good_source_of\":\"Calcium, Copper, Pantothenic Acid, Vitamin B1\",\"source_of\":\"Selenium, Vitamin B2, Zinc\",\"low\":\"Calories, Cholesterol, Fat, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:14:10'),
(292, 292, 1, 'Sausage with Caramelized Radicchio and Onions', 'Prepare the vegetables : Thinly slice the onions and radicchio. Set aside separately. Heat the butter and half of the oil in a skillet over medium-low heat. Add the onions then sauté with frequent stirring until they are softened and golden-coloured, about 20 min. While the onions cook, prepare the sausages. Prick them in a few spots using a fork then put them in a saucepan. Cover the sausages with water then bring to a boil. Cover and simmer 5 min. Take the sausages out of the water and pat them dry. Heat the remaining oil in another skillet over medium heat. Add the sausages and sauté 4-5 min, until they become golden-coloured. Turn them a few times while cooking. When they are done, keep them warm while the onions continue to cook. Add the radicchio to the onions and sauté until it is wilted, about 5 min. Add the two vinegars and cook over medium-high heat until the liquid is absorbed, about 1 min. Season with salt and pepper to taste. Serve the onion-radicchio mixture \r\nalongside the sausages.', '[\"red onions, thinly sliced\",\"radicchio (red chicory), thinly sliced\",\"butter, unsalted\",\"olive oil\",\"chicken sausages, or Toulouse, mild\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"wine vinegar\",\"balsamic vinegar\"]', 'https://media.soscuisine.com/images/recettes/1153.jpg', 'https://www.soscuisine.com//recipe/sausage-caramelized-radicchio-onions', 'Keep the serving dishes in the oven at the lowest setting so they are warm when you serve.', '30 min', '320 kcal', '{\"calories\":\"320\",\"fat\":\"18 g\",\"cholesterol\":\"90 mg\",\"protein\":\"25 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Copper, Folacin, Niacin, Potassium, Vitamin A, Vitamin B12, Vitamin B6, Vitamin E, Vitamin K, Zinc\",\"good_source_of\":\"Iron, Magnesium, Manganese, Pantothenic Acid, Phosphorus, Vitamin B2\",\"source_of\":\"Calcium, Fibre, Vitamin B1, Vitamin C\",\"low\":\"Calories, Saturated Fat\"}', '2021-06-18 14:14:11'),
(293, 293, 1, 'SautÃÂ©ed Scallops with Spinach', 'Prepare the baby spinach : Wash and drain well. Rinse the scallops and pat dry. Add salt and pepper. Heat half of the butter in a pan over medium heat. (It is important to use a pan large enough to avoid crowding the scallops or they will steam and not turn golden-brown. For larger amounts, cook only a few scallops at a time and keep them warm in the oven while repeating the operation with the remaining scallops). Add the scallops then sauté rapidly, until they become golden-brown, about 2 min per side (they get harder and dry when overcooked). Set them aside on a warm plate in the oven. Discard the remaining cooking liquid. Put the pan back over high heat. Melt the rest of the butter and scrape the bottom with a wooden spoon. Add the spinach and . Cook 2-3 min until wilted. Add salt and pepper, then add the pine nuts and lemon juice. Distribute the spinach over the warmed individual serving plates. Place the scallops on top then serve.', '[\"scallops, large\",\"baby spinach\",\"butter, unsalted\",\"lemon juice, freshly squeezed\",\"pine nuts\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/91.jpg', 'https://www.soscuisine.com//recipe/sauteed-scallops-spinach', 'Keep the serving plates in the oven at the lowest setting so they are warm when you serve.', '20 min', '230 kcal', '{\"calories\":\"230\",\"fat\":\"9 g\",\"cholesterol\":\"90 mg\",\"protein\":\"34 g\"}', '{\"diet-related_health_claims\":\"Bone-healthy\",\"free\":\"Sugar\",\"excellent_source_of\":\"Folacin, Iron, Magnesium, Niacin, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B12, Vitamin E, Vitamin K, Zinc\",\"good_source_of\":\"Calcium, Copper, Manganese\",\"source_of\":\"Omega-3, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin C\",\"low\":\"Calories\"}', '2021-06-18 14:14:14'),
(294, 294, 1, 'SautÃÂ©ed Shrimp with Brussel Sprouts', 'Leave the Brussel sprouts whole or cut them in half if large, then blanch them in a pot of salted boiling water until crisp-tender ( al dente ), about 4 min. Remove the sprouts from the pot using a slotted spoon. Drain well then set aside. Heat half of the oil in a pan over medium-high heat. Add the shrimp then sauté , with stirring until the shrimp are opaque throughout and pink-coloured, 3-4 min. Season with salt and pepper, then take the shrimp out of the pan, and set them aside, covered to keep them warm. Lower the heat to \'medium\', add the remaining oil, then sauté the oignon, until softened, 2-3 min, with stirring . Add the sprouts and sauté until golden and crisp-tender, 2-3 min. Season with salt and pepper. Put the shrimp back into the pan, sprinkle with the lemon juice and . Heat throughout (1-2 min). Serve on the warmed plates.', '[\"Brussels sprouts\",\"olive oil\",\"shrimp, medium-large\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"red onions, finely chopped\",\"lemon juice, freshly squeezed\"]', 'https://media.soscuisine.com/images/recettes/4366.jpg', 'https://www.soscuisine.com//recipe/sauteed-shrimp-brussel-sprouts', 'Keep the serving plates in the oven at the lowest setting so they are warm when you serve.', '20 min', '170 kcal', '{\"calories\":\"170\",\"fat\":\"8 g\",\"cholesterol\":\"120 mg\",\"protein\":\"15 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Selenium, Vitamin B12, Vitamin C, Vitamin K\",\"good_source_of\":\"Folacin, Iron, Magnesium, Niacin, Potassium, Vitamin A, Vitamin E\",\"source_of\":\"Calcium, Copper, Fibre, Manganese, Omega-3, Phosphorus, Vitamin B1, Vitamin B2, Vitamin B6, Zinc\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:14:17'),
(295, 295, 1, 'SautÃÂ©ed Shrimp with Snow Peas', 'Heat half of the oil in a pan over medium-high heat. Add the shrimp then sauté , with stirring until the shrimp are opaque throughout and pink-coloured, 3-4 min. Season with salt and pepper, then take the shrimp out of the pan, and set them aside, covered to keep them warm. Lower the heat to \'medium\', add the remaining oil, then sauté the shallot, until softened, 2-3 min, with stirring. Add the snow peas and sauté until golden and crisp-tender, 4-5 min. Season with salt and pepper. Put the shrimp back into the pan, sprinkle with the lemon juice and stir. Heat throughout (1-2 min). Serve.', '[\"olive oil\",\"shrimp, medium-large\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"shallots, finely chopped\",\"snow peas\",\"lemon juice, freshly squeezed\"]', 'https://media.soscuisine.com/images/recettes/1163.jpg', 'https://www.soscuisine.com//recipe/sauteed-shrimp-snowpeas', 'Keep the serving plates in the oven at the lowest setting so they are warm when you serve.', '20 min', '160 kcal', '{\"calories\":\"160\",\"fat\":\"8 g\",\"cholesterol\":\"120 mg\",\"protein\":\"15 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Selenium, Vitamin B12, Vitamin C\",\"good_source_of\":\"Iron, Niacin, Vitamin E, Vitamin K\",\"source_of\":\"Copper, Folacin, Magnesium, Manganese, Pantothenic Acid, Phosphorus, Potassium, Vitamin A, Vitamin B1, Vitamin B6, Zinc\"}', '2021-06-18 14:14:28'),
(296, 296, 1, 'SautÃÂ©ed Veal with a Roasted Garlic and Basil Sauce', 'the pattypan squash in a pot of salted boiling water, about 4 min, until al dente. Drain them in a colander , then season with salt and pepper. Keep the squash warm in the oven. In a shallow dish, combine the mustard, lemon juice, and olive oil. If the veal slices are too thick, gently flatten them to about 3 mm, using a meat pounder. Dip the escalopes in the mustard mixture or brush them with it on both sides. Heat a ridged grill pan over medium-high heat. Cook the veal escalopes in batches about 1 min per side, or until cooked through. Season the veal with salt and serve it on the warmed dishes with the squash and the Roasted Garlic and Basil Sauce', '[\"pattypan squash, or other summer squash\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"Dijon mustard\",\"lemon juice, freshly squeezed\",\"olive oil\",\"veal cutlets, thinly sliced\",\"Roasted Garlic and Basil Sauce\"]', 'https://media.soscuisine.com/images/recettes/651.jpg', 'https://www.soscuisine.com//recipe/sauteed-veal-roasted-garlic-basil-sauce', '', '20 min', '300 kcal', '{\"calories\":\"300\",\"fat\":\"15 g\",\"cholesterol\":\"80 mg\",\"protein\":\"33 g\"}', '{\"excellent_source_of\":\"Folacin, Niacin, Phosphorus, Potassium, Vitamin B12, Vitamin B6, Vitamin C, Vitamin K\",\"good_source_of\":\"Magnesium, Manganese, Pantothenic Acid, Selenium, Vitamin A, Vitamin B2, Vitamin E, Zinc\",\"source_of\":\"Copper, Fibre, Iron, Vitamin B1, Vitamin D\",\"low\":\"Calories, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:14:32'),
(297, 297, 1, 'Scallop Pokeviche', 'Cook the quinoa . Let stand in the refrigerator at least 1 h. Meanwhile, the scallops, onion, mini-tomatoes, chili pepper and lime juice in a bowl. Let sit 15 min at room temperature, or up to 2 hours in the refrigerator. In a pot of salted boiling water, cook the edamame 3-4 min, until just tender. Drain and set aside. When ready to serve, prepare the vegetables : grate the carrots, dice the celery, slice the avocado, thinly slice the cabbage, and chop the green onions. Transfer them to a salad bowl, with the quinoa, edamame and arugula. In a small bowl, mix the olive oil, lemon juice and mustard, then drizzle over the salad. Adjust the seasoning , then Transfer the quinoa salad to serving bowls. Put the scallop mixture on top. Garnish with cilantro and serve.', '[\"quinoa\",\"scallops, medium size, fresh, cut into 1 cm cubes\",\"red onions, finely chopped\",\"mini-tomatoes (cherry, miniature or grape), halved\",\"lime juice, freshly squeezed\",\"dried chili peppers, minced\",\"edamame\\/soybeans, shelled\",\"carrots\",\"avocados\",\"red cabbage\",\"green onions\\/scallions\",\"baby arugula\",\"extra virgin olive oil\",\"Dijon mustard\",\"lemon juice, freshly squeezed\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"fresh cilantro\"]', 'https://media.soscuisine.com/images/recettes/3629.jpg', 'https://www.soscuisine.com//recipe/scallop-pokeviche', 'with olive oil, cover and refrigerate until ready to marinate.', '30 min', '520 kcal', '{\"calories\":\"520\",\"fat\":\"26 g\",\"cholesterol\":\"30 mg\",\"protein\":\"30 g\"}', '{\"excellent_source_of\":\"Copper, Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B12, Vitamin B6, Vitamin C, Vitamin E, Vitamin K, Zinc\",\"good_source_of\":\"Calcium, Pantothenic Acid, Vitamin B1, Vitamin B2\",\"low\":\"Calories, Cholesterol, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:14:34'),
(298, 298, 1, 'Scrambled Tofu', 'Preheat a skillet over medium heat then add the oil, shallot, and spices. Crumble in the tofu using your hands or a fork. until well mixed together with the spicy oil. Stir in the garlic and soy sauce. Season with salt and pepper to taste. As soon as the tofu is hot, it\'s ready.', '[\"shallots, finely chopped\",\"canola oil\",\"turmeric\",\"ground cumin\",\"curry powder\",\"firm regular tofu, crumbled\",\"garlic, minced\",\"soy sauce\",\"ground pepper to taste\",\"[optional]\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/3378.jpg', 'https://www.soscuisine.com//recipe/scrambled-tofu', 'If preparing in advance, keep a cup of water to splash into the skillet when reheating, to avoid tofu getting too dry.', '15 min', '250 kcal', '', '{\"diet_related_health_claims\":\"Bone-healthy, Heart-healthy\",\"excellent_source_of\":\"Iron, Magnesium, Manganese, Selenium\",\"good_source_of\":\"Calcium, Copper, Folacin, Niacin, Phosphorus, Potassium, Vitamin B6, Vitamin E, Zinc\",\"source_of\":\"Fibre, Omega-3, Omega-6, Vitamin B1, Vitamin B2, Vitamin K\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:14:34'),
(299, 299, 1, 'Seared Tuna Steaks with Greens', 'Cut the peppers into quarters lengthwise, removing the seeds and the stems, then brush them with the olive oil, and sprinkle with plenty of salt. Arrange them on a hot grill, or under a preheated broiler in the oven. Cook the peppers until they are golden-brown and charred in spots, 5 to 7 min, turning them once. To make the peeling operation easier, cover or wrap the peppers in aluminum foil or in a paper bag, and let them cool down a few minutes (the moisture kept within will help lift the peel). Put the tuna steaks in a dry pan or on a grill, over medium-low heat. 3-4 min per side, depending on the desired level of doneness. Tuna dries out very quickly when overcooked and is best appreciated served \"pink\" or \"blue\" in the centre. Season with salt and pepper to taste. Wrap the steaks in aluminum foil and set aside for 5 min so that the juices can distribute evenly and give the inside time to become soft and tender. Use these last few minutes to dress the plates with the vegetables. Rinse and spin-dry the mixed\r\ngreens, then put them in a bowl and with the Classic Vinaigrette . Season with salt and pepper, then divide them up onto the individual serving plates. Arrange the peppers on top, then add the tuna steaks and drizzle with the extra virgin olive oil. Garnish with chopped chives and freshly ground pepper, then serve.', '[\"yellow or red sweet peppers\",\"olive oil\",\"tuna steaks, or blue marlin\",\"mixed greens\",\"Classic Vinaigrette\",\"extra virgin olive oil\",\"chives, fresh\",\"[optional]\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"aluminum foil\"]', 'https://media.soscuisine.com/images/recettes/694.jpg', 'https://www.soscuisine.com//recipe/seared-tuna-steaks-greens', '', '20 min', '330 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Magnesium, Niacin, Pantothenic Acid, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin C, Vitamin D, Vitamin E, Vitamin K\",\"good_source_of\":\"Folacin, Iron\",\"source_of\":\"Calcium, Copper, Manganese, Omega-3, Zinc\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:14:36'),
(302, 302, 1, 'Shrimp and Broccoli Pasta with Turmeric', 'Prepare the broccoli : rinse to clean then cut to separate the florets from the stalks. Peel and discard any tough skin from the stalks then cut them into small pieces. Blanch and drain the broccoli, then set aside. Heat the oil in a skillet over medium-high heat. Add the shrimp and cook, with some stirring , until the shrimp lose their gray colour and turn pink, 3-4 min. Set the shrimp aside on the plate with the broccoli. To save time, the rest of the sauce preparation and the pasta cooking can be done at the same time. Start cooking the pasta Meanwhile,  add the onion to the skillet then cook over medium-low heat, until the onion is translucent, 2-3 min. in the chili pepper and turmeric. Cook 1 min with stirring. Drain the pasta, setting aside the required amount of cooking water. Pour the pasta into the skillet. Cook 1 min, then pour in the water and stir to separate the strands of pasta. Transfer the broccoli and shrimp into the skillet. Heat through 2-3 min, with occasional stirring , until the pasta turns golden-coloured. Sprinkle with the pine nuts (optional), then season with salt and pepper to taste. Serve in the warmed dishes.', '[\"broccoli, cut into florets\",\"olive oil\",\"shrimp, small\",\"spaghettini\",\"onions, coarsely chopped\",\"dried chili peppers, minced\",\"turmeric\",\"pasta cooking water\",\"pine nuts\",\"[optional]\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1446.jpg', 'https://www.soscuisine.com//recipe/shrimp-broccoli-pasta-turmeric', '', '30 min', '420 kcal', '{\"calories\":\"420\",\"fat\":\"9 g\",\"cholesterol\":\"110 mg\",\"protein\":\"22 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Folacin, Iron, Magnesium, Manganese, Niacin, Selenium, Vitamin B12, Vitamin C, Vitamin K\",\"good_source_of\":\"Copper, Fibre, Phosphorus, Potassium, Vitamin B6, Vitamin E, Zinc\",\"source_of\":\"Calcium, Pantothenic Acid, Vitamin A, Vitamin B1, Vitamin B2\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:14:42'),
(303, 303, 1, 'Sicilian Pasta with Cauliflower', 'In a small cup, soak the raisins in luke-warm water. Set aside. In a small pan, heat half the oil over medium heat and brown the bread crumbs 1-2 min until golden. Set aside. Heat the remaining olive oil in a large pan over low heat. Finely chop the onion and sauté in the pan for about 10 min until soft. Add the chopped anchovies and continue cooking over low heat with stirring , a few more minutes until creamy. While the onion cooks, prepare the cauliflower . Discard the large stem and cut off the florets. the florets in a large pot of salted water for about 10 min, keeping them \" al dente \". Remove the florets and add them to the pan with the onions and anchovy paste. Cook with occasional stirring for a further 8-10 min (time to cook the pasta). Cook the pasta using the cauliflower cooking water (adding more if necessary) and add the saffron to the water. Drain the pasta, pour into the cauliflower mixture and quickly. Add the raisins and pine nuts (optional) then cook over medium heat for 1 min. Sprinkle the bread crumbs over the pasta, adjust the seasoning and serve immediately in the warmed dishes.', '[\"raisins\",\"olive oil\",\"bread crumbs\",\"onions, finely chopped\",\"anchovy fillets, chopped\",\"cauliflower, cut into florets\",\"bucatini\",\"pine nuts\",\"[optional]\",\"saffron powder\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/171.jpg', 'https://www.soscuisine.com//recipe/sicilian-pasta-cauliflower', '', '35 min', '440 kcal', '{\"calories\":\"440\",\"fat\":\"13 g\",\"cholesterol\":\"10 mg\",\"protein\":\"14 g\"}', '{\"excellent_source_of\":\"Fibre, Folacin, Manganese, Niacin, Selenium, Vitamin C, Vitamin K\",\"good_source_of\":\"Magnesium, Phosphorus, Potassium, Vitamin B6, Vitamin E, Zinc\",\"source_of\":\"Calcium, Copper, Iron, Pantothenic Acid, Vitamin B1, Vitamin B2\",\"low\":\"Cholesterol, Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:14:43'),
(304, 304, 1, 'Simplified No-Crust Quiche', 'Preheat the oven to 175°C/350°F. Butter a pie-dish.\n   Drain the sun-dried tomatoes and chop them finely. Peel, clean and pat dry the roasted peppers , then cut them into strips of about 1 cm.\n   In a bowl, beat the eggs with the cream cheese and cream using a fork. Add salt. Mix in the grated cheese, peppers, and tomatoes.\n   Pour into the prepared pie-dish and bake in the middle of the oven 35-40 min until firm. with a tooth-pick or knife if it is cooked through. If it comes out clean, the quiche is ready.\n   Let rest a few minutes before cutting.\n  ', '[\"eggs size large\",\"cream cheese\",\"cream 15%\",\"Cheddar cheese, grated\",\"sun-dried tomatoes (oil packed), finely chopped\",\"Oven-Roasted Peppers\",\"butter, unsalted, to grease the pie-dish\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/76.jpg', 'https://www.soscuisine.com//recipe/simplified-no-crust-quiche', '', '55 min', '220 kcal', '{\"calories\":\"220\",\"fat\":\"18 g\",\"cholesterol\":\"230 mg\",\"protein\":\"12 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Selenium, Vitamin A, Vitamin B12, Vitamin C\",\"good_source_of\":\"Folacin, Pantothenic Acid, Phosphorus, Vitamin B2, Vitamin D, Vitamin E\",\"source_of\":\"Calcium, Iron, Magnesium, Niacin, Potassium, Vitamin B1, Vitamin B6, Zinc\"}', '2021-06-18 14:14:44'),
(305, 305, 1, 'Bison Stroganoff', 'Cut the meat into 1 X 5 cm strips, then them with flour. Heat the oil in a frying pan over medium heat. Sauté the finely chopped onion a few minutes until traslucent, then take it out of the pan and set aside on a small plate. Turn the heat up high, add the butter, and the pieces of meat in the same pan, until nicely coloured, about 3 min. For large quantities, avoid crowding the meat in the pan and work in batches. Add the warm deglaze the pan. Put the onion back in and season with salt and pepper. Start cooking gently, covered, for about 20-25 min. Add the thinly sliced mushrooms , then continue to cook an additional 10 min. In a small bowl, mix the tomato paste with the cream and Worcestershire sauce. Add to the\r\npan and cook over very low heat 3-5 min, taking care not to let it boil. Serve on the warmed plates.', '[\"bison, sirloin, cut into 1 x 5 cm strips\",\"white flour (all purpose)\",\"canola oil\",\"onions, finely chopped\",\"butter, unsalted\",\"beef broth\",\"button (white) mushrooms, thinly sliced\",\"tomato paste\",\"whipping cream 35%\",\"Worcestershire sauce\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2381.jpg', 'https://www.soscuisine.com//recipe/bison-stroganoff', '', '55 min', '310 kcal', '{\"calories\":\"310\",\"fat\":\"18 g\",\"cholesterol\":\"90 mg\",\"protein\":\"22 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Niacin, Potassium, Selenium, Vitamin A, Vitamin B12, Vitamin B2, Vitamin B6, Zinc\",\"good_source_of\":\"Copper, Folacin, Iron, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin E\",\"source_of\":\"Magnesium, Manganese, Omega-3, Vitamin K\"}', '2021-06-18 14:14:45'),
(306, 306, 1, 'Slow Cooker Chicken in a Pepper Sauce', 'Heat the oil in a pan over low heat. in the almonds. Toast them, shaking the pan the entire time to prevent them from burning. When you start to \"smell\" the almonds, add the paprika and cook for 30 seconds more. Transfer the almonds and paprika to a food processor . Add all the other ingredients, except chicken and tomatoes. Pulse until everything is roughly chopped. Pour the sauce into\r\n    the ceramic cooking pot, add the chicken and tomatoes. to combine and coat the chicken with the mixture. Cover the slow cooker with the lid and cook on \'low\' for 6-8 h. Alternatively, cook on \'high\' for 4-5 h. Serve the chicken with the sauce. You may garnish with additional chopped parsley.', '[\"canola oil\",\"flaked almonds\",\"Oven-Roasted Peppers\",\"paprika\",\"cayenne pepper\",\"garlic\",\"onions, quartered\",\"wine vinegar\",\"balsamic vinegar\",\"salt\",\"Italian parsley, fresh, plus a few leaves for garnish\",\"chicken breasts, boneless, skinless, cut into bite-size pieces\",\"canned tomatoes (diced)\"]', 'https://media.soscuisine.com/images/recettes/2443.jpg', 'https://www.soscuisine.com//recipe/chicken-in-pepper-sauce-slow-cooker', 'are needed to make this recipe.', '490 min', '240 kcal', '{\"calories\":\"240\",\"fat\":\"6 g\",\"cholesterol\":\"80 mg\",\"protein\":\"36 g\"}', '{\"excellent_source_of\":\"Niacin, Phosphorus, Vitamin A, Vitamin B6, Vitamin C, Vitamin E, Vitamin K\",\"good_source_of\":\"Iron, Magnesium, Pantothenic Acid, Potassium, Vitamin B12\",\"source_of\":\"Copper, Fibre, Folacin, Manganese, Vitamin B1, Vitamin B2, Zinc\",\"low\":\"Calories, Fat, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:14:46'),
(307, 307, 1, 'Slow Cooker Meatballs in Tomato Sauce', 'Prepare the vegetables :  Finely chop the onion, garlic, carrot, and celery. Heat the oil in a pan over medium heat. Add the chopped vegetables then sauté until softened and translucent, about 3 min. in the oregano and chili pepper , then cook an additional minute, with stirring Layer about half of the cooked vegetables in the bottom of\r\n    the ceramic cooking pot. Transfer the remaining vegetables to the food processor , then pulse a few minutes until the a puree is obtained. Transfer the pureed vegetables to a bowl. Chill a few minutes to cool slightly. Add the beef, bread crumbs, beaten egg, grated cheese, and salt to the bowl with the pureed vegetables. Add pepper to taste then mix well. Scooping about 2 tablespoons of the mixture at a time into your hands, make the meatballs (3 per serving). Pour half of the tomato sauce into the bottom of the ceramic cooking pot, along with the water. Combine well with the vegetables. Place the meatballs on top in a single layer. Pour on the rest of the tomato sauce . Cover the slow cooker with the lid and cook on \'low\' for 4 h. Serve.', '[\"olive oil\",\"onions, chopped\",\"garlic, chopped\",\"carrots, chopped\",\"celery, chopped\",\"dried oregano\",\"dried chili peppers, minced\",\"ground beef, extra-lean\",\"bread, whole wheat, processed into bread crumbs\",\"eggs size large, beaten\",\"Parmesan cheese, grated\",\"salt\",\"ground pepper to taste\",\"[optional]\",\"My Mother\'s Tomato Sauce\",\"water\"]', 'https://media.soscuisine.com/images/recettes/2583.jpg', 'https://www.soscuisine.com//recipe/meatballs-in-tomato-sauce-slow-cooker', 'will be very useful to pure the vegetables.', '260 min', '340 kcal', '{\"calories\":\"340\",\"fat\":\"18 g\",\"cholesterol\":\"130 mg\",\"protein\":\"28 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Iron, Manganese, Niacin, Potassium, Vitamin A, Vitamin B12, Vitamin B2, Vitamin B6, Zinc\",\"good_source_of\":\"Folacin, Magnesium, Pantothenic Acid, Phosphorus, Selenium, Vitamin B1, Vitamin C, Vitamin E, Vitamin K\",\"source_of\":\"Calcium, Copper, Fibre, Vitamin D\",\"low\":\"Calories\"}', '2021-06-18 14:14:47'),
(308, 308, 1, 'Slow Cooker Peanut Chicken', 'In a bowl, mix together half of the oil, garlic, oregano, curry powder, and half of the lemon juice. Cut the chicken breast into thin strips, then add the strips to the bowl. well to combine, then cover the bowl with plastic wrap. Let marinate in the refrigerator for 1 h 1/2 to overnight. Heat the remaining oil in a pan, add the onion and cook gently until softened, about 5 min. Add the tomatoes and jalapeño pepper , then cook 1 min with stirring . Take the pan off the heat, then add the peanut butter. Blend in the hot , adding a little at a time.  Season with salt and pepper to taste then transfer the mixture to the ceramic cooking pot. Cover the slow cooker with the lid and cook 1 h on \'high\'. About 30 min before the end of the cooking time, take the marinated chicken out of the refrigerator and leave it to come to room temperature. Add the chicken and marinade to the cooking pot, mixing well to combine. Cover and cook 1 h. Add the rice, to mix. Cover and cook on \'high\' for a further 45 min, or until the rice is cooked. in the remaining lemon juice, garnish with green onions (optional) and serve.', '[\"plastic wrap\",\"chicken breasts, boneless, skinless, thinly sliced\",\"canola oil\",\"garlic, finely chopped\",\"dried oregano\",\"curry powder\",\"lemon juice, freshly squeezed\",\"onions, finely chopped\",\"tomatoes, diced\",\"jalape\\u00c3\\u00b1o pepper, fresh, minced\",\"peanut butter, natural\",\"chicken broth, hot\",\"arborio rice\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"green onions\\/scallions, finely chopped\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2454.jpg', 'https://www.soscuisine.com//recipe/peanut-chicken-slow-cooker', 'is needed to make this recipe.', '180 min', '510 kcal', '{\"calories\":\"510\",\"fat\":\"12 g\",\"cholesterol\":\"80 mg\",\"protein\":\"42 g\"}', '{\"excellent_source_of\":\"Magnesium, Niacin, Phosphorus, Potassium, Vitamin B6, Vitamin E, Zinc\",\"good_source_of\":\"Copper, Folacin, Iron, Pantothenic Acid, Selenium, Vitamin A, Vitamin B1, Vitamin B12, Vitamin K\",\"source_of\":\"Calcium, Fibre, Manganese, Vitamin B2, Vitamin C\",\"low\":\"Calories, Cholesterol, Fat, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:14:48'),
(309, 309, 1, 'Slow Cooker Shredded Chicken Tex-Mex', 'Add the first 8 ingredients to \r\nthe ceramic cooking pot, then mix well. Add the chicken and coat it well with the mixture. Cover the slow cooker with the lid and cook on \'low\' for 6-8 h, or until the chicken meat is tender enough to be \"pulled\" apart easily with a fork. Alternatively, cook on high for 4-5 h. Take the chicken out of the pot, shred it then put it back into the pot. Add the beans and peas. Cover, then cook 10 additional min on \'high\'. Serve.', '[\"onions, finely chopped\",\"garlic, minced\",\"canned tomatoes (diced)\",\"ground cumin\",\"cayenne pepper\",\"dried oregano\",\"salt\",\"ground pepper\",\"chicken breasts, boneless, skinless\",\"red beans (canned), rinsed and drained\",\"frozen peas\"]', 'https://media.soscuisine.com/images/recettes/2434.jpg', 'https://www.soscuisine.com//recipe/shredded-chicken-tex-mex-slow-cooker', 'is needed to make this recipe.', '430 min', '280 kcal', '{\"calories\":\"280\",\"fat\":\"3 g\",\"cholesterol\":\"80 mg\",\"protein\":\"40 g\"}', '{\"excellent_source_of\":\"Fibre, Folacin, Iron, Magnesium, Niacin, Phosphorus, Potassium, Vitamin B6\",\"good_source_of\":\"Manganese, Pantothenic Acid, Vitamin A, Vitamin B1, Vitamin B12, Vitamin K, Zinc\",\"source_of\":\"Calcium, Copper, Vitamin B2, Vitamin C, Vitamin E\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:14:49'),
(310, 310, 1, 'Smoked Salmon and Potatoes with Dill Sauce', 'Prepare the potatoes or steam them, unpeeled and whole. Meanwhile, prepare the sauce : In a small bowl, mix the yogurt with the horseradish and lemon juice.\r\nChop the and add it to the bowl. Season with salt and pepper then mix well. Arrange the smoked salmon slices on individual serving plates. Place the potatoes next to the salmon. Pour the sauce over the potatoes and serve.', '[\"new potatoes\",\"yogurt, plain, 2%\",\"horseradish\",\"lemon juice, freshly squeezed\",\"fresh dill\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"smoked salmon\"]', 'https://media.soscuisine.com/images/recettes/591.jpg', 'https://www.soscuisine.com//recipe/smoked-salmon-potatoes-dill-sauce', 'Because of their crisp, waxy texture and thin, delicate skin, new potatoes are best suited for this dish.', '20 min', '210 kcal', '{\"calories\":\"210\",\"fat\":\"3 g\",\"cholesterol\":\"20 mg\",\"protein\":\"15 g\"}', '{\"excellent_source_of\":\"Niacin, Potassium, Selenium, Vitamin B12, Vitamin B6, Vitamin D\",\"good_source_of\":\"Copper, Magnesium, Pantothenic Acid, Phosphorus, Vitamin C\",\"source_of\":\"Calcium, Fibre, Folacin, Iron, Manganese, Vitamin B1, Vitamin B2, Vitamin E, Zinc\",\"low\":\"Cholesterol, Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:14:49'),
(311, 311, 1, 'Smoked Salmon SoufflÃÂ©', 'Preheat the oven to 160°C/325°F. Grease the moulds. Heat the margarine in a saucepan using low heat. Add the shallot, then sauté 2-3 min until soft. Add the flour while stirring until a paste is obtained. Pour in the milk, very slowly, stirring constantly. Cook for 4-5 min, with\r\noccasional stirring to avoid lumps. Incorporate the chopped smoked salmon and tomato paste (for a nicer pink colour), gradually, using a wooden spoon. Add the grated nutmeg, salt (pay attention: smoked salmon is rather salty!), and pepper to taste. Separate the egg whites and yolks carefully, taking care not to let any egg yolk mix with the egg whites. Remove the pan from the heat and add the yolks. Mix, then set aside. In a separate bowl, using an electric mixer the whites to form soft peaks . Incorporate the whites into the milk-yolk mixture, blending gently, using a spatula. Distribute the mixture into the buttered moulds. Clean any drops on the inner sides: the soufflé will rise evenly if it has no obstacles on the inside of the\r\ndish. Put the moulds in the oven. After about 15 min, the soufflés will be golden and ready. To verify, you can insert a toothpick into it. If it comes out clean, the soufflé is ready.', '[\"margarine non-hydrogenated\",\"shallots\",\"white flour (all purpose)\",\"milk, partly skimmed, 2%\",\"smoked salmon, finely chopped\",\"tomato paste\",\"nutmeg\",\"eggs size large\",\"ground pepper to taste\",\"[optional]\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/899.jpg', 'https://www.soscuisine.com//recipe/smoked-salmon-souffle', '', '35 min', '280 kcal', '{\"calories\":\"280\",\"fat\":\"15 g\",\"cholesterol\":\"210 mg\",\"protein\":\"19 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Niacin, Pantothenic Acid, Selenium, Vitamin A, Vitamin B12, Vitamin B2, Vitamin D\",\"good_source_of\":\"Phosphorus, Potassium, Vitamin E\",\"source_of\":\"Calcium, Copper, Iron, Magnesium, Manganese, Omega-3, Vitamin B1, Vitamin B6, Vitamin K, Zinc\"}', '2021-06-18 14:14:50'),
(312, 312, 1, 'Smoking Fast Pancakes', 'Combine the flour, salt, baking soda and water in a bowl. Mix well, using a whip, until the texture is smooth. Let stand in the refrigerator about 1-2 h to obtain a lighter texture. Grease a non-stick frying pan, then put it over medium heat. Pour about ¼ to &frac13; cup of the batter onto the center of the pan. Spread it rapidly, either by whirling the pan or using a spatula. After about 2 min, when the pancake turns golden-brown, flip it and cook about 1 more minute. Keep the cooked pancakes in the oven while preparing the rest. Repeat the operation with the remaing batter. Garnish each pancake with greek yogurt, smoked salmon and dill. Serve 2 pancakes per person.', '[\"buckwheat flour\",\"salt\",\"baking soda\",\"water, cold\",\"canola oil\",\"Greek yogurt, plain, 2% M.F.\",\"smoked salmon\",\"fresh dill\"]', 'https://media.soscuisine.com/images/recettes/3293.jpg', 'https://www.soscuisine.com//recipe/smoking-fast-pancakes', '', '30 min', '570 kcal', '{\"calories\":\"570\",\"fat\":\"18 g\",\"cholesterol\":\"20 mg\",\"protein\":\"37 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Copper, Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Selenium, Vitamin B1, Vitamin B12, Vitamin B6, Vitamin D, Vitamin E, Zinc\",\"good_source_of\":\"Pantothenic Acid, Vitamin B2, Vitamin K\",\"source_of\":\"Calcium, Omega-3, Vitamin A\",\"low\":\"Cholesterol, Saturated Fat\"}', '2021-06-18 14:14:52'),
(314, 314, 1, 'Asian Chicken and Vegetable Soup', 'Heat the oil in a saucepan over medium-low heat. Add the shallot, then sauté 2-3 \r\nmin. Add the garlic, ginger and chili pepper . \r\nSauté 3 min with stirring . Pour in the and water, then add the fish sauce and a little salt and pepper. Bring to a boil, then lower the heat and simmer a few \r\nminutes. Adjust the seasoning . Add \r\nthe chicken slices, warm up the broth 1 min, then take the saucepan off the heat. Meanwhile, cook the rice sticks for about 4 min in a large pot of salted boiling water. Drain \r\nin a colander , then rinse and drain again. Set aside. Prepare the vegetables : Grate the carrots, then thinly slice the green onions and mushrooms. Portion out the vegetables into individual serving bowls. Add the soybean sprouts and cooked rice sticks. Pour in the hot broth and serve.', '[\"canola oil\",\"shallots, finely chopped\",\"garlic, minced\",\"gingerroot, grated\",\"dried chili peppers, minced\",\"chicken broth\",\"water\",\"fish sauce (nam pla)\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"chicken for Chinese fondue\",\"rice sticks (noodles)\",\"carrots, grated\",\"green onions\\/scallions, thinly sliced\",\"button (white) mushrooms, thinly sliced\",\"soybean sprouts\"]', 'https://media.soscuisine.com/images/recettes/957.jpg', 'https://www.soscuisine.com//recipe/asian-chicken-vegetable-soup', 'Individual 500 ml (2 cups) serving bowls are needed.', '20 min', '380 kcal', '{\"calories\":\"380\",\"fat\":\"10 g\",\"cholesterol\":\"40 mg\",\"protein\":\"25 g\"}', '{\"excellent_source_of\":\"Folacin, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B6, Vitamin K, Zinc\",\"good_source_of\":\"Copper, Iron, Pantothenic Acid, Vitamin B1, Vitamin B2\",\"source_of\":\"Calcium, Fibre, Vitamin B12, Vitamin C, Vitamin E\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:14:57'),
(315, 315, 1, 'Blackened Fish Fillets', 'In a shallow bowl, together the paprika ,\r\noregano, cayenne , sugar, salt, and ground pepper. To obtain a crispier crust, add the cornmeal (optional). Pat the fillets dry and dredge them in the mixture, turning them to coat well. Shake off the excess, then place the fillets on an oiled, hot grill. Cook until the fish is opaque throughout and lightly blackened on the outside, 4-5 min on each side, turning them once. Alternatively, heat the oil in a large skillet over moderately high heat. Thinly slice the garlic then add it to the skillet and sauté , with stirring , until it is golden-brown, about 2 min. Discard the garlic, add the butter, then heat it until the foam subsides. Add the fish then sauté for 4-5 min on each side, or until it is cooked through and lightly blackened on the outside. Serve immediately with lemon wedges.', '[\"paper towels\",\"paprika\",\"dried oregano\",\"cayenne pepper\",\"sugar\",\"salt\",\"ground pepper\",\"cornmeal (polenta)\",\"[optional]\",\"tilapia fillets, or turbot fillets\",\"canola oil\",\"garlic, for pan-frying\",\"butter, unsalted, for pan-frying\",\"lemons, cut into wedges\"]', 'https://media.soscuisine.com/images/recettes/552.jpg', 'https://www.soscuisine.com//recipe/blackened-fish-fillets', 'These fish fillets can be cooked either in a pan on the stovetop or using an outdoor grill.', '20 min', '260 kcal', '{\"calories\":\"260\",\"fat\":\"10 g\",\"cholesterol\":\"90 mg\",\"protein\":\"38 g\"}', '{\"excellent_source_of\":\"Niacin, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B12, Vitamin E\",\"good_source_of\":\"Iron, Magnesium, Pantothenic Acid, Vitamin B6\",\"source_of\":\"Copper, Fibre, Folacin, Manganese, Vitamin B1, Vitamin B2, Vitamin C, Vitamin K, Zinc\"}', '2021-06-18 14:15:02'),
(316, 316, 1, 'Sole Fillets Florentine-Style', 'Preheat the oven to 205°C/400°F. Prepare the spinach : Wash and drain briefly then transfer it to a pot or saucepan without adding any water. The water trapped in the leaves after gentle shaking is enough to cook them. Add salt, cover and cook over high heat 2-3 min until the leaves wilt. Transfer the spinach to a colander , press to remove excess water, then put it in a baking dish. Pat-dry the sole fillets, then arrange them over the spinach. Heat the oil in a pan over medium-low heat. Finely chop the onion and grate the carrots, then add them to the pan. Sauté 3-4 min, add salt and pepper, then portion them out on top of the fillets. Cover the top with the grated cheese. Bake in the middle of the oven for about 20 min, until golden-coloured. Serve.', '[\"spinach\",\"sole fillets, or haddock\",\"canola oil\",\"onions, finely chopped\",\"carrots, grated\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"Parmesan cheese, grated\"]', 'https://media.soscuisine.com/images/recettes/542.jpg', 'https://www.soscuisine.com//recipe/sole-fillets-florentine-style', 'Keep the serving plates warm on the stove while you\'re preparing the dish.', '30 min', '230 kcal', '{\"calories\":\"230\",\"fat\":\"7 g\",\"cholesterol\":\"80 mg\",\"protein\":\"33 g\"}', '{\"excellent_source_of\":\"Folacin, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B12, Vitamin B6, Vitamin D, Vitamin E, Vitamin K\",\"good_source_of\":\"Calcium, Iron, Vitamin B2, Zinc\",\"source_of\":\"Copper, Fibre, Omega-3, Pantothenic Acid, Vitamin B1, Vitamin C\",\"low\":\"Calories, Fat, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:15:06'),
(317, 317, 1, 'Sole Fillets with Mushrooms', 'Preheat the oven to the lowest setting. Prepare the mushrooms : slice them thinly. Chop the parsley .\r\nSet aside. Rinse the fillets and pat dry. Add salt, pepper and with flour. Melt the butter in a pan over high heat. Add the fillets and cook 2 min on one side, turn them, and cook 1-2 min. Put them on a plate and keep them warm in the oven. Add the oil to the pan. Add the mushrooms and cook 4-5 min over high heat. Add salt and pepper. Add the chopped parsley ,\r\nlemon juice, and transfer over the fillets. Serve immediately.', '[\"button (white) mushrooms, thinly sliced\",\"Italian parsley, fresh, chopped\",\"sole fillets, haddock, or turbot\",\"white flour (all purpose)\",\"butter, unsalted\",\"canola oil\",\"lemon juice, freshly squeezed\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/307.jpg', 'https://www.soscuisine.com//recipe/sole-fillets-mushrooms', 'Keep the serving dishes in the oven at the lowest setting so they are warm when you serve.', '20 min', '350 kcal', '{\"calories\":\"350\",\"fat\":\"20 g\",\"cholesterol\":\"100 mg\",\"protein\":\"31 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Magnesium, Niacin, Phosphorus, Potassium, Selenium, Vitamin B12, Vitamin D, Vitamin E, Vitamin K\",\"good_source_of\":\"Folacin, Pantothenic Acid, Vitamin B1, Vitamin B2, Vitamin B6\",\"source_of\":\"Copper, Iron, Manganese, Omega-3, Vitamin A, Vitamin C, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:15:11'),
(319, 319, 1, 'Spaghetti alla Puttanesca', 'To save time, the sauce preparation and the pasta cooking can be done at the same time. Start by cooking the pasta Meanwhile, heat the olive oil in a saucepan over medium heat. Sauté the finely chopped garlic, 1 min taking care not to let it burn. Chop the anchovies, then add them to the pan and cook with stirring . When they have broken apart and «melted» (after about 2 min), add the coarsely chopped capers, olive paste parsley and garlic base and diced tomatoes. Cook, uncovered, for 7-8 min over low heat while stirring from time to time. Add pepper to taste. In general, it is not necessary to add salt since the anchovies are already salted. Put the drained spaghetti back into the pasta cooking pot, add the sauce, then mix well. Serve in the warmed dishes.', '[\"spaghetti\",\"canned tomatoes (diced)\",\"anchovy fillets, chopped\",\"olive paste\",\"capers, coarsely chopped\",\"garlic, finely chopped\",\"Parsley and Garlic Base\",\"olive oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/7.jpg', 'https://www.soscuisine.com//recipe/spaghetti-alla-puttanesca', '', '20 min', '420 kcal', '{\"calories\":\"420\",\"fat\":\"14 g\",\"cholesterol\":\"0 mg\",\"protein\":\"12 g\"}', '{\"excellent_source_of\":\"Manganese, Selenium, Vitamin K\",\"good_source_of\":\"Magnesium, Niacin, Vitamin E\",\"source_of\":\"Copper, Fibre, Folacin, Iron, Pantothenic Acid, Phosphorus, Vitamin A, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin C, Zinc\",\"low\":\"Cholesterol, Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:15:17'),
(321, 321, 1, 'Spaghetti with Anchovies', 'cooking the pasta Meanwhile, heat the oil in a small saucepan over low heat. Sauté the pressed or minced garlic 1-2 min, taking care not to let it burn. Chop the anchovies, then add them to the pan with stirring . Cook until they have broken apart and «melted». Set aside and keep warm. Put the drained spaghetti back into the pasta cooking pot. Add the anchovy sauce and mix well. Add pepper to taste. In general, it is not necessary to add salt since the anchovies are already salted. Serve in warmed dishes.', '[\"spaghetti\",\"anchovy fillets, chopped\",\"garlic, minced or pressed\",\"olive oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/71.jpg', 'https://www.soscuisine.com//recipe/spaghetti-anchovies', '', '15 min', '450 kcal', '{\"calories\":\"450\",\"fat\":\"17 g\",\"cholesterol\":\"10 mg\",\"protein\":\"13 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Manganese, Selenium\",\"good_source_of\":\"Magnesium, Niacin, Vitamin E\",\"source_of\":\"Copper, Fibre, Folacin, Iron, Phosphorus, Vitamin B6, Vitamin K, Zinc\"}', '2021-06-18 14:15:19'),
(322, 322, 1, 'Spaghetti with Clams and Tomatoes', 'Heat the olive oil in a skillet over medium heat. Mince the garlic then sauté 1 min taking care not to let it burn. Add the Parsley and Garlic Base and the drained clams, reserving their juice for later. Cook 2 min with stirring , then add the tomatoes and cayenne pepper Simmer , uncovered, 5-6 min with occasional stirring. Add pepper to taste. In general, it is not necessary to add salt since the clams are already salted. At the end of the cooking, add about half of the clam juice to dilute the sauce. Keep the skillet warm. While the sauce is cooking, cook the\r\npasta Pour the drained pasta into the skillet. well then serve in the warmed dishes.', '[\"olive oil\",\"garlic, minced\",\"Parsley and Garlic Base\",\"baby clams\",\"canned tomatoes (diced)\",\"cayenne pepper\",\"spaghetti\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/721.jpg', 'https://www.soscuisine.com//recipe/spaghetti-clams-tomatoes', '', '20 min', '550 kcal', '{\"calories\":\"550\",\"fat\":\"16 g\",\"cholesterol\":\"50 mg\",\"protein\":\"30 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Copper, Folacin, Iron, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B12, Vitamin B2, Vitamin C, Vitamin E, Vitamin K, Zinc\",\"good_source_of\":\"Fibre, Vitamin B1, Vitamin B6\",\"source_of\":\"Calcium, Pantothenic Acid\"}', '2021-06-18 14:15:20');
INSERT INTO `recipe_translation` (`rt_id`, `rt_recipe_id`, `rt_lang_id`, `rt_recipe_name`, `rt_recipe_text`, `rt_recipe_ingredients_full`, `rt_recipe_image`, `rt_recipe_link`, `rt_recipe_prep`, `rt_recipe_duration`, `rt_recipe_calories`, `rt_recipe_nutrients`, `rt_recipe_claims`, `rt_created`) VALUES
(323, 323, 1, 'Spaghetti with Lobster', 'Remove the elastic bands from the claws and plunge one lobster, head-first, into a large pot of\r\nsalted boiling water, with the tail tucked underneath (to avoid being splashed by the tail). \r\nLoosely cover the pot and cook the lobsters over moderately high heat until the shell turns red. From the time the water comes to a boil again, plan to cook 5 min for a 500 g lobster (add 1 min for each additional 100 g). Transfer the lobsters with tongs to a sink to drain and cool. Obviously, this step is skipped if starting with a cooked lobster. When the lobsters are cool enough to handle, twist off the claws and crack them, then remove the meat. Halve the lobsters lengthwise with a large knife or poultry shears, beginning from the tail end, then remove the tail meat. Cut all the lobster meat into bite-size pieces then set them aside. Cook the pasta Meanwhile, heat the oil in a skillet over medium heat. the finely chopped onion, 2-3 min taking care not to let it burn. Add the tomatoes, the minced chili pepper parsley and garlic base . Cook uncovered, with occasional stirring . Add salt and pepper to taste. Add the lobster meat and pasta cooking water, to dilute the sauce a bit. Drain the spaghetti and pour them over the sauce. gently, sprinkle with the optional parsley, then serve in the warmed dishes.', '[\"lobsters, or cooked\",\"spaghetti\",\"olive oil\",\"onions, finely chopped\",\"canned tomatoes (diced)\",\"dried chili peppers, minced\",\"Parsley and Garlic Base\",\"pasta cooking water\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"Italian parsley, fresh, finely chopped\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2099.jpg', 'https://www.soscuisine.com//recipe/spaghetti-lobster', '', '30 min', '480 kcal', '{\"calories\":\"480\",\"fat\":\"12 g\",\"cholesterol\":\"40 mg\",\"protein\":\"22 g\"}', '{\"excellent_source_of\":\"Copper, Magnesium, Manganese, Niacin, Selenium, Vitamin A, Vitamin B12, Vitamin E, Vitamin K, Zinc\",\"good_source_of\":\"Fibre, Folacin, Iron, Phosphorus, Potassium, Vitamin B6, Vitamin C\",\"source_of\":\"Calcium, Pantothenic Acid, Vitamin B1, Vitamin B2\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:15:21'),
(324, 324, 1, 'Spaghetti with Mussels', 'Carefully rinse and brush the mussels to remove any sand. Drain. Discard any mussels that are open and stay open, even after being tapped. Put the mussels in a pot with enough water to bring its height to about 1 cm. Cook over medium heat, covered, about 7 min. All the mussels should be open. Meanwhile, heat the oil in a pan over medium heat. Add the garlic and chili pepper . Cook 1 min with stirring . Add the tomatoes, Parsley\r\nand Garlic Base , season with a little salt and pepper, then continue to cook over low heat. cooking the pasta while continuing the sauce preparation. Take the mussels out of the pot. Filter the liquid through a sieve to remove any bits of shell and sand, then set the liquid aside. Separate the mussels from the shells then discard most of the shells, keeping some as a garnish. Also remove and discard any unopened mussels. Transfer the mussels to the pan with the sauce, add about 1 tablespoon per serving of the reserved liquid, then heat through gently. Pour the drained spaghetti into the pan, well, then serve in the warmed dishes.', '[\"mussels\",\"olive oil\",\"garlic, minced\",\"dried chili peppers, minced\",\"canned tomatoes (diced)\",\"Parsley and Garlic Base\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"spaghetti\"]', 'https://media.soscuisine.com/images/recettes/1022.jpg', 'https://www.soscuisine.com//recipe/spaghetti-mussels', 'in the sink to drain the cooked pasta so that it will be ready when needed.', '30 min', '480 kcal', '{\"calories\":\"480\",\"fat\":\"11 g\",\"cholesterol\":\"40 mg\",\"protein\":\"27 g\"}', '{\"excellent_source_of\":\"Folacin, Iron, Magnesium, Manganese, Niacin, Phosphorus, Selenium, Vitamin B12, Vitamin K, Zinc\",\"good_source_of\":\"Copper, Vitamin A, Vitamin B1, Vitamin B2, Vitamin E\",\"source_of\":\"Fibre, Omega-3, Pantothenic Acid, Potassium, Vitamin B6, Vitamin C\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:15:22'),
(325, 325, 1, 'Spaghetti with Snow Crab', 'To save time, the sauce preparation and the pasta cooking can be done at the same time. Start by cooking the pasta Meanwhile, heat the canola oil in a skillet over medium heat. the finely chopped shallot, 2-3 min taking care not to let it burn. Add the parsley and garlic base , then add the diced tomatoes and cook uncovered, with occasional stirring . Add salt and pepper to taste. While the sauce and pasta are cooking, shell the cooked crab meat, using a nutcracker. Add it to the pan at the very last minute, just to warm it up. Add the cream. Pour the drained spaghetti over the sauce and gently. Serve in the warmed dishes.', '[\"spaghetti\",\"canola oil\",\"shallots, finely chopped\",\"Parsley and Garlic Base\",\"canned tomatoes (diced)\",\"snow crab legs, cooked, or Alaskan crab\",\"cream 15%\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/351.jpg', 'https://www.soscuisine.com//recipe/spaghetti-snow-crab', '', '20 min', '460 kcal', '{\"calories\":\"460\",\"fat\":\"14 g\",\"cholesterol\":\"30 mg\",\"protein\":\"18 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Magnesium, Manganese, Niacin, Selenium, Vitamin B12, Vitamin K, Zinc\",\"good_source_of\":\"Copper, Fibre, Folacin, Iron, Phosphorus, Vitamin A, Vitamin E\",\"source_of\":\"Calcium, Omega-3, Pantothenic Acid, Potassium, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin C\"}', '2021-06-18 14:15:24'),
(326, 326, 1, 'Blue Cheese Burgers', 'Finely chop the onion and celery, then put them in a bowl. Add the ground meat, oregano, mustard, salt, and pepper. Mix well using a fork, then bring the combined ingredients together with your hands to form a firm mixture. Divide the mixture into twice the number of the needed servings. Shape each portion into rounds and flatten each one slightly. Crumble the cheese and place a small amount in the centre of half of the rounds (about 2 tablespoons of crumbled cheese per round). Place the remaining meat rounds on top of the cheese topped rounds. Use your hands to mould\r\nthe rounds together, encasing the crumbled cheese, and shaping them into burgers. Cook the burgers on a medium grill, lightly oiled, for about 10 min, or until cooked through, turning them once. Alternatively, you may cook the burgers on a nonstick, heavy-bottom pan, over very high heat. Split the hamburger buns and place a burger inside each one. Serve with mustard and ketchup on the side.', '[\"onions, finely chopped\",\"celery, finely chopped\",\"ground beef, extra-lean, or lean\",\"dried oregano\",\"Dijon mustard\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"blue cheese, crumbled\",\"hamburger buns\",\"olive oil\",\"Dijon mustard\",\"[optional]\",\"ketchup\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/586.jpg', 'https://www.soscuisine.com//recipe/blue-cheese-burgers', 'These burgers can be cooked either using an outdoor grill or in a pan on the stovetop.', '20 min', '360 kcal', '{\"calories\":\"360\",\"fat\":\"14 g\",\"cholesterol\":\"70 mg\",\"protein\":\"30 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Iron, Niacin, Vitamin B12, Vitamin B2, Zinc\",\"good_source_of\":\"Phosphorus, Potassium, Selenium, Vitamin B1, Vitamin B6\",\"source_of\":\"Calcium, Copper, Magnesium, Manganese, Pantothenic Acid, Vitamin D, Vitamin K\"}', '2021-06-18 14:15:25'),
(327, 327, 1, 'Spaghetti with Tomato Sauce', 'Cook the pasta While the pasta is cooking, heat the tomato sauce in a saucepan over low heat. Add the specified amount of pasta cooking water to dilute the sauce a bit, and warm up just a few minutes. Put the drained spaghetti back into the pasta cooking pot, add the sauce and extra virgin oil, then mix well. You may sprinkle with Parmesan cheese. Serve in the warmed dishes.', '[\"spaghetti\",\"My Mother\'s Tomato Sauce\",\"extra virgin olive oil\",\"pasta cooking water\",\"salt\",\"[optional]\",\"Parmesan cheese\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/48.jpg', 'https://www.soscuisine.com//recipe/spaghetti-tomato-sauce', '', '15 min', '410 kcal', '{\"calories\":\"410\",\"fat\":\"13 g\",\"cholesterol\":\"0 mg\",\"protein\":\"10 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Manganese, Selenium\",\"good_source_of\":\"Magnesium, Vitamin E\",\"source_of\":\"Copper, Fibre, Folacin, Iron, Niacin, Phosphorus, Vitamin A, Vitamin B6, Vitamin K, Zinc\"}', '2021-06-18 14:15:27'),
(328, 328, 1, 'Spaghettini with Mini-Tomatoes', 'Preheat the oven to 230°C /450°F. Oil an ovenproof dish (about 1 teaspoon per serving). Lay the mini-tomatoes on the sheet. Coat them thoroughly with the oil. Bake 5-7 min, until the skins split open. To save time, the rest of the sauce preparation and the pasta cooking can be done at the same time. Cook the pasta Transfer the tomatoes and juices into a skillet. Add the remaining oil, the pressed or minced garlic, the minced chili pepper , and the olives. Sauté 3-4 min. Pour the drained pasta into the skillet with the tomatoes. Sprinkle with the chopped herbs, mix well, add salt and pepper to taste. Garnish with the basil leaves then serve in the warmed dishes.', '[\"spaghettini\",\"mini-tomatoes (cherry, miniature or grape)\",\"black olives\",\"garlic, pressed or minced\",\"olive oil\",\"dried chili peppers, minced\",\"Italian parsley, fresh, chopped\",\"chives, fresh, chopped\",\"fresh basil, whole\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/24.jpg', 'https://www.soscuisine.com//recipe/spaghettini-mini-tomatoes', '', '20 min', '430 kcal', '{\"calories\":\"430\",\"fat\":\"14 g\",\"cholesterol\":\"0 mg\",\"protein\":\"11 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Manganese, Selenium, Vitamin A, Vitamin K\",\"good_source_of\":\"Copper, Fibre, Iron, Magnesium, Niacin, Vitamin E, Zinc\",\"source_of\":\"Folacin, Phosphorus, Potassium, Vitamin B1, Vitamin B6, Vitamin C\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:15:27'),
(329, 329, 1, 'Spaghettini with Rosy-red Sauce', 'Cook the pasta While the pasta is cooking, heat the in a saucepan over low heat. Add the specified amount of pasta cooking water to dilute the sauce a bit, and warm up just a few minutes. Put the drained spaghettini back into the pasta cooking pot, add the sauce and butter, then mix well. Serve in the warmed dishes. If desired, Parmesan cheese may be grated on top.', '[\"spaghettini\",\"Rosy-red Pasta Sauce\",\"butter, unsalted\",\"pasta cooking water\",\"salt\",\"[optional]\",\"Parmesan cheese, grated\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/634.jpg', 'https://www.soscuisine.com//recipe/spaghettini-rosy-red-sauce-alcohol-free', '', '15 min', '410 kcal', '{\"calories\":\"410\",\"fat\":\"12 g\",\"cholesterol\":\"30 mg\",\"protein\":\"11 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Manganese, Selenium\",\"good_source_of\":\"Fibre, Magnesium, Niacin, Vitamin A\",\"source_of\":\"Copper, Folacin, Iron, Pantothenic Acid, Phosphorus, Potassium, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin C, Vitamin E, Zinc\"}', '2021-06-18 14:15:28'),
(330, 330, 1, 'Speedster Veggie Chili', 'Prepare the vegetables : Chop the onion, mince the garlic and chili pepper , finely dice the carrots, celery, and bell pepper. Heat the canola oil in a pan over medium heat. Sauté the onion and garlic about 2 min until the onion is translucent, with occasional stirring , paying attention not to let them burn. Add the carrots, celery, and bell pepper, then cook 4-5 min, with occasional stirring. Add the minced chili pepper , cumin and brown sugar, then cook 1 min, with stirring .\r\nFinely dice the tofu then add it to the mixture, then cook until golden-brown, about 8-10 min. Drain the beans, rinse them and drain again. Add them to the pan, mix well, add the diced tomatoes and enough water to provide a moist environment. Cover and cook over low heat an additional 10 min, until the carrots are tender. Meanwhile, cook the Add salt and pepper to taste to the chili. Sprinkle with freshly chopped cilantro leaves, grated cheddar and serve with the rice.', '[\"onions, finely chopped\",\"garlic, minced\",\"dried chili peppers, minced\",\"carrots, finely diced\",\"celery, finely diced\",\"green peppers, finely diced\",\"canola oil\",\"ground cumin\",\"brown sugar\",\"firm regular tofu, finely diced\",\"red beans (canned)\",\"canned tomatoes (diced)\",\"water approximately\",\"basmati rice\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"fresh cilantro\",\"[optional]\",\"Cheddar cheese, grated\"]', 'https://media.soscuisine.com/images/recettes/3277.jpg', 'https://www.soscuisine.com//recipe/speedster-veggie-chili', 'Keep the serving plates in the oven at the lowest setting so they are warm when you serve.', '50 min', '570 kcal', '{\"calories\":\"570\",\"fat\":\"23 g\",\"cholesterol\":\"10 mg\",\"protein\":\"26 g\"}', '{\"excellent_source_of\":\"Calcium, Copper, Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin E, Vitamin K, Zinc\",\"good_source_of\":\"Pantothenic Acid, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin C\",\"low\":\"Calories, Cholesterol, Saturated Fat, Sodium\"}', '2021-06-18 14:15:29'),
(331, 331, 1, 'Spicy Late-Night Spaghetti', 'To save time, the sauce preparation and the pasta cooking can be done at the same time. Start cooking the pasta Meanwhile, heat the oil in a frying pan over medium-low heat. Sauté the garlic 2-3 min. Pay attention not to let it burn. Add the chili pepper . Add more for extra spiciness. Pour the drained spaghetti into the pan and add salt to taste. Sprinkle with grated Parmesan (optional), then serve in the warmed dishes.', '[\"spaghetti\",\"garlic, crushed\",\"dried chili peppers, minced\",\"olive oil\",\"salt\",\"[optional]\",\"Parmesan cheese, grated\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/25.jpg', 'https://www.soscuisine.com//recipe/spicy-late-night-spaghetti', 'in the sink to drain the cooked pasta so that it will be ready when needed.', '15 min', '390 kcal', '{\"calories\":\"390\",\"fat\":\"11 g\",\"cholesterol\":\"0 mg\",\"protein\":\"10 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Manganese, Selenium\",\"good_source_of\":\"Magnesium, Vitamin E\",\"source_of\":\"Copper, Fibre, Folacin, Iron, Niacin, Phosphorus, Vitamin B6, Vitamin K, Zinc\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:15:30'),
(332, 332, 1, 'Spring Risotto', 'Finely chop the onion. Chop the carrot, zucchini, and celery into small pieces (7 mm). Heat the in a small saucepan on the stove or in a microwave oven. Keep it warm while cooking the risotto (about 20 min). Melt the butter and oil in a large skillet or saucepan. Sauté the vegetables, except the peas, 2-3 min, or until the onion is translucent. Add the frozen peas, then the rice. Toast the grains 1-2 min (until translucent), with constant stirring Cook the risotto , using the warmed until the rice is creamy but still al dente Remove from the heat and let stand for 2 min. Season with salt (not much if the is salty) and pepper to taste. Sprinkle with grated Parmesan cheese then serve.', '[\"arborio rice\",\"chicken broth, approximately\",\"butter, unsalted\",\"olive oil\",\"onions, finely chopped\",\"carrots, chopped into small dices\",\"zucchini, chopped into small dices\",\"celery, chopped into small dices\",\"frozen peas\",\"salt\",\"[optional]\",\"Parmesan cheese, grated\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/21.jpg', 'https://www.soscuisine.com//recipe/spring-risotto', '.', '30 min', '370 kcal', '{\"calories\":\"370\",\"fat\":\"10 g\",\"cholesterol\":\"10 mg\",\"protein\":\"8 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Vitamin A\",\"good_source_of\":\"Folacin, Magnesium, Manganese, Potassium, Selenium, Vitamin B6, Vitamin C, Vitamin K, Zinc\",\"source_of\":\"Calcium, Copper, Fibre, Iron, Niacin, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin B2, Vitamin E\",\"low\":\"Sodium\"}', '2021-06-18 14:15:32'),
(333, 333, 1, 'Steak in a Mustard-Herbs Creamy Sauce', 'Melt the butter in a small saucepan over low heat. Add the sage leaves and sprigs of rosemary. Finely chop the garlic and add it to the saucepan. Let infuse a few minutes, until the butter becomes perfumed with the herbs aroma, paying attention not to let it burn. Filter the mixture using a sieve, pressing the solids to extract the butter. Put the perfumed butter in a skillet. Heat the butter over medium-high heat. Add the steaks and them 1-2 min per side, add salt and pepper, then remove the steaks from the skillet and set them aside on a warmed plate in the oven. In a small bowl, mix well the cream and mustard. Pour it into the skillet, then cook 1 min over medium heat with stirring using a wooden spoon or spatula to scrape the bottom of the skillet. Put the steaks back into the skillet and cook 1-2 more min, turning them once. Transfer the steaks to the warmed plates, spoon the sauce over the top, and serve.', '[\"butter, unsalted\",\"fresh sage\",\"rosemary, fresh\",\"garlic, finely chopped\",\"beef strip loin, or rib eye\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"cream 15%\",\"Dijon mustard\"]', 'https://media.soscuisine.com/images/recettes/511.jpg', 'https://www.soscuisine.com//recipe/steak-in-mustard-herbs-creamy-sauce-alcohol-free', 'Preheat the oven to the lowest temperature to keep the steaks and the plates warm while cooking the sauce.', '15 min', '250 kcal', '{\"calories\":\"250\",\"fat\":\"15 g\",\"cholesterol\":\"80 mg\",\"protein\":\"25 g\"}', '{\"free\":\"Sugar\",\"excellent_source_of\":\"Niacin, Selenium, Vitamin B12, Zinc\",\"good_source_of\":\"Iron, Phosphorus, Vitamin B6\",\"source_of\":\"Magnesium, Pantothenic Acid, Potassium, Vitamin A, Vitamin B1, Vitamin B2, Vitamin D, Vitamin K\",\"low\":\"Sodium\"}', '2021-06-18 14:15:33'),
(334, 334, 1, 'Blue Cheese \"Gorgonzola\" Penne', 'To save time, the sauce preparation and the pasta cooking can be done at the same time. Start cooking the pasta Meanwhile, coarsely cut the cheese into pieces. Put them in a serving bowl and heat 1-2 min in a microwave oven or in a small saucepan on the stove-top about 2 min over very low heat (cheese should be softened, not cooked). Pour in the cream and Pour the drained pasta into the bowl with the cheese. Add pepper to taste and salt only if needed, since the blue cheese is already rather salty. Mix well and serve in the warmed dishes.', '[\"penne rigate\",\"Gorgonzola cheese, or other creamy blue cheese, coarsely chopped\",\"whipping cream 35%\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/70.jpg', 'https://www.soscuisine.com//recipe/blue-cheese-gorgonzola-penne', '', '20 min', '450 kcal', '{\"calories\":\"450\",\"fat\":\"15 g\",\"cholesterol\":\"40 mg\",\"protein\":\"18 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Manganese, Selenium, Vitamin B12\",\"good_source_of\":\"Calcium, Magnesium, Niacin, Phosphorus, Zinc\",\"source_of\":\"Copper, Fibre, Folacin, Iron, Pantothenic Acid, Vitamin A, Vitamin B2, Vitamin B6\"}', '2021-06-18 14:15:34'),
(335, 335, 1, 'Steamed Sole with Vegetables', 'Prepare the vegetables : Coarsely chop the onion and mince the garlic. Cut all the other vegetables into pieces of about the same size. Set them aside. Heat the oil in a skillet, over medium heat. Add the onion and garlic and sauté 1 min, with stirring , then add all the other vegetables. Season with a little salt and pepper, then continue to cook, with occasional stirring, until al dente , about 8 min. in the parsley and garlic base and cook 1 min. Sprinkle the sole fillets with the lemon juice, then place them on top of the vegetables. Cover and cook about 5 min over medium heat. The fillets are cooked when they turn opaque. Add a little salt on the fillets, garnish with optional green onions then serve on the warmed plates.', '[\"olive oil\",\"onions, coarsely chopped\",\"garlic, minced\",\"zucchini, cut into dices\",\"yellow or red sweet peppers, cut into squares\",\"mini-tomatoes (cherry, miniature or grape), halved\",\"button (white) mushrooms, quartered\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"Parsley and Garlic Base\",\"sole fillets\",\"lemon juice, freshly squeezed\",\"green onions\\/scallions, finely chopped\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2418.jpg', 'https://www.soscuisine.com//recipe/steamed-sole-vegetables', 'Keep the serving plates in the oven at the lowest setting so they are warm when you serve.', '25 min', '300 kcal', '{\"calories\":\"300\",\"fat\":\"14 g\",\"cholesterol\":\"80 mg\",\"protein\":\"31 g\"}', '{\"excellent_source_of\":\"Magnesium, Niacin, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin C, Vitamin D, Vitamin E, Vitamin K\",\"good_source_of\":\"Folacin, Manganese, Pantothenic Acid, Vitamin B1, Zinc\",\"source_of\":\"Calcium, Copper, Fibre, Iron\",\"low\":\"Calories, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:15:36'),
(337, 337, 1, 'Stuffed Sole Fillets with Lime Sauce', 'Preheat the oven to 175°C/350°F. Drain the crab meat, chop it finely and transfer it to a bowl. Finely chop the chives, celery, and capers, then add them to the bowl and well. Lay the sole fillet(s) flat, skin side up (light grey-coloured) on a working surface. Distribute the stuffing over the widest end of the fillets, roll them up and place them in a buttered ovenproof dish. Chop the parsley and add it to a small bowl. Add salt and pepper, then incorporate the mayonnaise and mustard. Spread the mixture over the rolled fillet(s). Distribute the butter on top of each fillet, sprinkle with the sliced almonds (optional) and bake in the upper third of the oven for about 20 min. Since the cooking time depends on the thickness of the fillets and the actual temperature of your oven, it is important to check them with a fork to see if they are cooked through. In the meantime, prepare the lime sauce: pour the lime juice and water into a small saucepan then bring to a boil with stirring , then add the cream and continue cooking until the sauce has reduced to about a half its initial volume. Remove the sauce from the heat and add the cold butter cubes while whisking until the butter has melted. Add salt and pepper to taste. Place the fillets on the warmed plates, sprinkle with the sauce and serve immediately.', '[\"canned crab, or imitation crab\",\"capers, finely chopped\",\"chives, fresh, finely chopped\",\"celery, finely chopped\",\"sole fillets, haddock, or pangasius\",\"Italian parsley, fresh, finely chopped\",\"mayonnaise\",\"Dijon mustard\",\"flaked almonds\",\"[optional]\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"lime juice, freshly squeezed\",\"water\",\"cream 15%\",\"butter, unsalted, cold\"]', 'https://media.soscuisine.com/images/recettes/263.jpg', 'https://www.soscuisine.com//recipe/stuffed-sole-fillets-lime-sauce', 'Keep the serving plates warm on the stove while you\'re preparing the dish.', '40 min', '360 kcal', '{\"calories\":\"360\",\"fat\":\"19 g\",\"cholesterol\":\"170 mg\",\"protein\":\"43 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Copper, Magnesium, Niacin, Phosphorus, Potassium, Selenium, Vitamin B12, Vitamin D, Vitamin E, Vitamin K, Zinc\",\"good_source_of\":\"Folacin, Pantothenic Acid, Vitamin A, Vitamin B2, Vitamin B6\",\"source_of\":\"Calcium, Iron, Manganese, Omega-3, Vitamin B1, Vitamin C\"}', '2021-06-18 14:15:47'),
(338, 338, 1, 'Stuffed Zucchini Flowers', 'Preheat the oven to 190°C/375°F. Oil a baking sheet lightly. Prepare 3 shallow dishes: Put the flour in one dish, the eggs in the second dish, put the bread crumbs in the third dish. Stuff each flower with a small piece of cheese and half anchovy. Close the flower, then dip it first in the flour, then in the egg.  Let the excess egg drip off before coating the flower in the bread crumbs. Turn the flower to coat on all sides.', '[\"olive oil, for the baking sheet\",\"zucchini flowers\",\"bocconcini \\/ fresh mozzarella\",\"anchovy fillets, cut into two pieces\",\"white flour (all purpose)\",\"eggs size large, lightly beaten\",\"bread crumbs\",\"vegetable oil spray\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2711.jpg', 'https://www.soscuisine.com//recipe/stuffed-zucchini-flowers', 'The zucchini flowers can be bought from the producers or at farmers markets. They are very delicate and must be consumed on the same day they are picked. You should first open them (even if they are shrivelled up) to make sure that no insect is hiding inside. Then, wash and gently pat them dry.', '45 min', '330 kcal', '{\"calories\":\"330\",\"fat\":\"16 g\",\"cholesterol\":\"130 mg\",\"protein\":\"19 g\"}', '{\"diet-related_health_claims\":\"Bone-healthy\",\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Niacin, Selenium, Vitamin B1\",\"good_source_of\":\"Calcium, Iron, Phosphorus, Vitamin B12, Vitamin B2\",\"source_of\":\"Copper, Magnesium, Manganese, Pantothenic Acid, Vitamin A, Vitamin C, Vitamin D, Vitamin E, Zinc\"}', '2021-06-18 14:15:50'),
(339, 339, 1, 'Blue Cheese \"Gorgonzola\" SoufflÃÂ©', 'Preheat the oven to 160°C/325°F. Butter the moulds. Melt the butter in a saucepan using low heat. Add the flour, stirring until you obtain a paste. Pour in the milk, very slowly, stirring constantly. Cook for 4-5 min, with\r\noccasional stirring to avoid lumps. Incorporate bits of blue cheese and the grated parmesan, gradually, using a wooden spoon. Add the grated nutmeg, salt (pay attention: blue cheese is rather salty!), and pepper to taste. Separate the egg whites and yolks carefully, taking care not to let any egg yolk mix with the egg whites. Remove the pan from heat and add the yolk(s). Set aside. In a separate bowl, using an electric mixer the white(s) to form soft peaks . Incorporate into the cheese-yolk mixture, blending gently, using a spatula. Pour out into the buttered mould(s). Clean any drops on the inner sides: the soufflé will rise evenly if it has no obstacles on the inside of the\r\ndish. Put the mould(s) in the oven. After about 15 min, the soufflé(s) will be golden and ready. To verify, you can insert a tooth-pick into it. If it comes out clean, the soufflé is ready.', '[\"eggs size large\",\"butter, unsalted\",\"white flour (all purpose)\",\"milk, partly skimmed, 2%\",\"Gorgonzola cheese, creamy type, or any other creamy blue cheese\",\"Parmesan cheese, grated\",\"nutmeg\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/74.jpg', 'https://www.soscuisine.com//recipe/blue-cheese-gorgonzola-souffle', '', '35 min', '470 kcal', '{\"calories\":\"470\",\"fat\":\"33 g\",\"cholesterol\":\"270 mg\",\"protein\":\"29 g\"}', '{\"diet-related_health_claims\":\"Bone-healthy\",\"free\":\"Added Sugar\",\"excellent_source_of\":\"Calcium, Folacin, Niacin, Pantothenic Acid, Phosphorus, Selenium, Vitamin A, Vitamin B12, Vitamin B2, Vitamin D, Zinc\",\"good_source_of\":\"Magnesium, Potassium\",\"source_of\":\"Iron, Vitamin B1, Vitamin B6, Vitamin E\"}', '2021-06-18 14:15:50'),
(340, 340, 1, 'Summer Milanese Veal', 'Tenderize the veal by flattening the cutlets using a meat pounder. Make a few shallow cuts around the outside edge to avoid curling during cooking. Prepare 2 shallow dishes: the egg in one, and put the bread crumbs in the other. Dip one cutlet at the time in the egg, let the excess egg drip off before coating the cutlet with the bread crumbs. Turn the cutlets to both sides, then set them aside. Heat the butter and oil in a skillet over medium-high heat, taking care not to let them burn. Add the cutlets and sauté until golden, about 4 min on each side. Add salt and pepper. Meanwhile, dice the tomatoes discarding the seeds. Transfer the cutlets to the warmed plates, arrange the tomatoes on top, then serve.', '[\"veal cutlets, thinly sliced\",\"eggs size large\",\"bread crumbs\",\"butter, unsalted\",\"canola oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"tomatoes, Roma type, deseeded and diced\"]', 'https://media.soscuisine.com/images/recettes/1190.jpg', 'https://www.soscuisine.com//recipe/summer-milanese-veal', '', '20 min', '240 kcal', '{\"calories\":\"240\",\"fat\":\"11 g\",\"cholesterol\":\"160 mg\",\"protein\":\"25 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Niacin, Selenium, Vitamin B12\",\"good_source_of\":\"Folacin, Pantothenic Acid, Phosphorus, Potassium, Vitamin A, Vitamin B2, Vitamin B6, Vitamin E, Zinc\",\"source_of\":\"Iron, Magnesium, Manganese, Omega-3, Vitamin B1, Vitamin C, Vitamin D, Vitamin K\",\"low\":\"Sodium\"}', '2021-06-18 14:15:50'),
(341, 341, 1, 'Swedish Meatballs', 'Peel the potatoes, then them  until they are very tender, 20-25 min. Drain them well, then put them in a bowl and mash. Mince the parsley, then add half to the bowl of the potatoes and reserve the rest. Finely chop the onion, then add it to the bowl. Add the egg, ground beef, milk, allspice, salt, and pepper. Using your hands, blend the mixture together until it is just combined well (do not overmix). Form the mixture into 2-3 cm balls and arrange them on a tray. Cover and chill in the refrigerator for at least 1 h, or up to overnight. The purpose is to firm up the meat mixture. Meanwhile, in a small bowl, together all remaining ingredients, including the reserved parsley, except the olive oil, until the brown sugar is dissolved and a sauce consistency is obtained. Set aside. Preheat the oven to 175°C/350°F. Line a baking sheet with aluminum foil. Heat the olive oil in a large pan over medium heat. Working in batches, add the meatballs and sauté until they are golden on all sides, about 5 min. Transfer the meatballs to the prepared baking sheet and brush them with the sauce. Cover loosely with foil and roast in the middle of the oven 25-30 min. Alternatively, the meatballs may be threaded onto bamboo skewers and cooked on the oiled rack of an outdoor grill. Serve the meatballs with any remaining sauce on the side.', '[\"potatoes, peeled\",\"Italian parsley, fresh, minced\",\"onions, finely chopped\",\"eggs size large\",\"ground beef, lean, or medium-lean\",\"milk, partly skimmed, 2%\",\"allspice powder\",\"salt, or to taste\",\"ground pepper to taste\",\"[optional]\",\"brown sugar\",\"Dijon mustard\",\"apple cider vinegar\",\"canola oil\",\"olive oil\",\"aluminum foil\"]', 'https://media.soscuisine.com/images/recettes/1060.jpg', 'https://www.soscuisine.com//recipe/swedish-meatballs', 'If shaped into smaller meatballs, they may be served as appetizers with extra sauce for dipping.', '60 min', '300 kcal', '{\"calories\":\"300\",\"fat\":\"17 g\",\"cholesterol\":\"100 mg\",\"protein\":\"23 g\"}', '{\"excellent_source_of\":\"Niacin, Selenium, Vitamin B12, Zinc\",\"good_source_of\":\"Iron, Phosphorus, Potassium, Vitamin B2, Vitamin B6\",\"source_of\":\"Copper, Folacin, Magnesium, Pantothenic Acid, Vitamin B1, Vitamin D, Vitamin E, Vitamin K\"}', '2021-06-18 14:15:51'),
(342, 342, 1, 'Sweet potato and Bean Soup', 'Prepare the vegetables : Finely chop the onion and celery; chop the pepper; peel the sweet potato then dice it. Set aside. Heat the oil in a saucepan over medium heat. Add the onion, celery and pepper, then sauté until softened, about 5 min. in the cumin, ground coriander, ginger, and chili pepper . Cook 1 min with stirring Meanwhile, cook the rice sticks then set aside. Add the potatoes, beans, and fish sauce. Bring to a boil, then reduce the heat, cover and simmer 10 min. Add the bok choy and continue to cook until the vegetables are cooked al dente , about 5 more min. At the very end, in the cooked rice sticks. Warm up and adjust the seasoning Portion out the soup into the individual serving bowls , garnish with chopped cilantro leaves, and serve.', '[\"onions, finely chopped\",\"celery, finely chopped\",\"green peppers, chopped\",\"sweet potatoes, diced\",\"canola oil\",\"ground cumin\",\"coriander seeds, ground\",\"gingerroot, grated\",\"dried chili peppers, minced\",\"rice sticks (noodles)\",\"white \\\"navy\\\" beans (canned), rinsed and drained\",\"chicken broth\",\"fish sauce (nam pla)\",\"small bok choy\",\"fresh cilantro, finely chopped\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2421.jpg', 'https://www.soscuisine.com//recipe/sweet-potato-bean-soup', 'Individual 500 ml (2 cups) serving bowls are needed.', '25 min', '420 kcal', '{\"calories\":\"420\",\"fat\":\"8 g\",\"cholesterol\":\"0 mg\",\"protein\":\"14 g\"}', '{\"diet-related_health_claims\":\"Bone-healthy\",\"excellent_source_of\":\"Fibre, Folacin, Iron, Magnesium, Manganese, Potassium, Vitamin A, Vitamin B1, Vitamin B6, Vitamin C, Vitamin K\",\"good_source_of\":\"Calcium, Copper, Niacin, Pantothenic Acid, Phosphorus, Selenium, Vitamin B2, Vitamin E, Zinc\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:15:51'),
(343, 343, 1, 'Sweet Potato and Chicken Chili', 'Prepare the vegetables . Chop the onions, mince the garlic and finely dice the bell peppers and sweet potatoes. Heat half the oil in a skillet or a pan over medium heat. Cook the onion and garlic about 3 min until the onion is soft and translucent, with occasional stirring , paying attention not to let them burn. Remove from pan and set aside. Pour the remaining oil into the same pan, heat over medium heat, and add the ground chicken. Cook about 5 min, stirring occasionally with a wooden spoon, until the meat loses its pink colour. Place the onion mixture, the chicken as well as the remaining ingredient, except the rice, into the slow cooker . Cover the slow cooker with the lid and cook on \'low\' for 4 h. A few minutes before the end of cooking, start to cook the Drain the beans, rinse them and drain again. Add them to the slow cooker with the chili, mix well, and cook an additional 8-10 min. Add salt and pepper to taste. Serve over the steamed rice.', '[\"garlic, minced\",\"yellow or red sweet peppers, cut into small dices\",\"onions, finely chopped\",\"sweet potatoes, diced\",\"ground chicken, or ground turkey\",\"frozen corn kernels\",\"canned tomatoes (diced)\",\"maple syrup\",\"olive oil\",\"cocoa powder\",\"chili powder\",\"ground cinnamon\",\"[optional]\",\"fresh thyme, chopped\",\"[optional]\",\"red beans (canned)\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"basmati rice\"]', 'https://media.soscuisine.com/images/recettes/3523.jpg', 'https://www.soscuisine.com//recipe/cwhl-sweet-potato-chicken-chili', 'is needed to make this recipe.', '260 min', '600 kcal', '{\"calories\":\"600\",\"fat\":\"18 g\",\"cholesterol\":\"80 mg\",\"protein\":\"36 g\"}', '{\"excellent_source_of\":\"Copper, Fibre, Folacin, Iron, Magnesium, Manganese, Phosphorus, Potassium, Vitamin A, Vitamin B1, Vitamin B6, Vitamin C, Vitamin E\",\"good_source_of\":\"Niacin, Pantothenic Acid, Selenium, Vitamin B2, Vitamin K, Zinc\",\"source_of\":\"Calcium, Vitamin D\",\"low\":\"Calories, Cholesterol, Fat, Saturated Fat, Sodium\",\"free\":\"Trans Fat\"}', '2021-06-18 14:15:52'),
(344, 344, 1, 'Swiss-Style Veal Cutlets', 'Preheat the oven to the lowest setting. Flatten and tenderize the cutlets using a meat pounder. them with the flour and shake off the excess. Set aside. Prepare the vegetables : Finely chop the onion; thinly slice the mushrooms lengthwise. Heat the butter and oil in a skillet over moderately high heat, then add the cutlets and sauté until brown, about 2 min on each side. Take the cutlets out of the skillet, transfer them to a plate and keep them warm in the oven. Add the onion to the skillet, lower the heat, then sauté 2-3 min until it becomes translucent. Add the mushrooms then cook 3-4 min, stirring occasionally, until the released liquid has\r\nevaporated. Pour in the and cook a few minutes, then pour in the cream and bring just to a simmer . Put the meat back into the skillet and cook a few minutes to blend the flavours. Season with salt and pepper. Sprinkle with the chopped parsley. Serve on the warmed plates.', '[\"veal cutlets, thinly sliced\",\"white flour (all purpose)\",\"onions, finely chopped\",\"button (white) mushrooms, thinly sliced\",\"butter, unsalted\",\"canola oil\",\"beef broth\",\"whipping cream 35%\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"Italian parsley, fresh, chopped\"]', 'https://media.soscuisine.com/images/recettes/803.jpg', 'https://www.soscuisine.com//recipe/swiss-style-veal-cutlets-alcohol-free', '', '25 min', '300 kcal', '{\"calories\":\"300\",\"fat\":\"12 g\",\"cholesterol\":\"100 mg\",\"protein\":\"33 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Niacin, Pantothenic Acid, Phosphorus, Potassium, Selenium, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin K, Zinc\",\"good_source_of\":\"Copper, Folacin\",\"source_of\":\"Iron, Magnesium, Manganese, Vitamin A, Vitamin B1, Vitamin D, Vitamin E\",\"low\":\"Sodium\"}', '2021-06-18 14:15:53'),
(345, 345, 1, 'Tempeh Fajitas', 'Cut each 8oz (240g) tempeh block into 4 squares, then cut each square into 2 triangles. Combine the soy sauce, balsamic vinegar, and garlic in a bowl. Place the tempeh into the bowl then let marinate for about 30 min, turning the pieces once to cover them well. Make sure that both sides of the tempeh are covered with the marinade.', '[\"tempeh\",\"soy sauce\",\"garlic, finely chopped, for the marinade\",\"balsamic vinegar\",\"onions, finely chopped\",\"garlic, finely chopped\",\"yellow or red sweet peppers, cut into 1,5 cm strips\",\"canola oil\",\"corn tortillas, about 21 cm diameter\",\"soy yogurt\",\"[optional]\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/3633.jpg', 'https://www.soscuisine.com//recipe/tempeh-fajitas', '', '30 min', '580 kcal', '{\"calories\":\"580\",\"fat\":\"26 g\",\"cholesterol\":\"0 mg\",\"protein\":\"29 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Calcium, Copper, Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Vitamin B2, Vitamin B6, Vitamin C, Zinc\",\"good_source_of\":\"Vitamin B1, Vitamin E, Vitamin K\",\"source_of\":\"Omega-3, Omega-6, Pantothenic Acid, Vitamin A\"}', '2021-06-18 14:15:53'),
(346, 346, 1, 'Blue Cheese Turkey Burgers', 'Coarsely chop the onion and celery, then put them in a bowl. Add the ground turkey, oregano, mustard, salt, and pepper. Mix well using a fork, then bring the combined ingredients together with your hands to form a firm mixture. Divide the mixture into twice the number of the needed servings. Shape each portion into rounds and flatten each one slightly. Crumble the cheese and place a small amount in the centre of half of the rounds (about 2 tablespoons of crumbled cheese per round). Place the remaining meat rounds on top of the cheese topped rounds. Use your hands to mould\r\nthe rounds together, encasing the crumbled cheese, and shaping them into burgers. Cook the burgers on a lightly oiled medium grill for about 10 min, or until cooked through, turning them once. Alternatively, you may cook the burgers on a nonstick, heavy-bottom pan, over very high heat. Split the hamburger buns and place a burger inside each one. Serve with mustard and ketch-up on the side.', '[\"onions, coarsely chopped\",\"celery, coarsely chopped\",\"ground turkey, or ground chicken\",\"dried oregano\",\"Dijon mustard\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"blue cheese\",\"hamburger buns\",\"canola oil\",\"ketchup\",\"[optional]\",\"Dijon mustard\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/593.jpg', 'https://www.soscuisine.com//recipe/blue-cheese-turkey-burgers', 'These burgers can be cooked either using an outdoor grill or in a pan on the stovetop.', '20 min', '390 kcal', '{\"calories\":\"390\",\"fat\":\"17 g\",\"cholesterol\":\"90 mg\",\"protein\":\"28 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Niacin, Selenium, Zinc\",\"good_source_of\":\"Iron, Magnesium, Phosphorus, Potassium, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin D\",\"source_of\":\"Calcium, Copper, Fibre, Manganese, Pantothenic Acid, Vitamin E, Vitamin K\"}', '2021-06-18 14:15:53'),
(347, 347, 1, 'Thai Chicken Legs', 'Place chicken legs in the slow cooker. In a bowl, combine broth, peanut butter, soy sauce, cilantro, lime juice, chili pepper or Cayenne pepper and ginger. Pour over the chicken. Cover and cook at a low temperature for 6 to 8 hours, or until the chicken is well done. Garnish with peanuts or cashews and chopped cilantro before serving.', '[\"chicken legs, with back\",\"chicken broth, low-sodium\",\"peanut butter, natural\",\"wheat-free soy sauce\",\"fresh cilantro, chopped\",\"lime juice, freshly squeezed\",\"cayenne pepper\",\"gingerroot, minced\",\"peanuts (or cashews), crushed\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2201.jpg', 'https://www.soscuisine.com//recipe/thai-chicken-legs', 'is needed to make this recipe.', '435 min', '260 kcal', '{\"calories\":\"260\",\"fat\":\"12 g\",\"cholesterol\":\"70 mg\",\"protein\":\"28 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Niacin, Zinc\",\"good_source_of\":\"Magnesium, Phosphorus, Potassium, Vitamin B6\",\"source_of\":\"Copper, Folacin, Iron, Manganese, Omega-6, Pantothenic Acid, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin E\"}', '2021-06-18 14:15:54'),
(348, 348, 1, 'Thai Noodles with Beef', 'Put the lime juice, fish sauce, oil, sugar, garlic and chili pepper in a small bowl. until the vinaigrette is emulsified. Take 1-2 tablespoons of this vinaigrette and pour it in a shallow dish, \r\nsetting aside the rest. Add the steak to the shallow dish, then turn it to coat well. Cover, put it in the refrigerator, and let it marinate', '[\"lime juice, freshly squeezed\",\"fish sauce (nam pla)\",\"canola oil\",\"sugar\",\"garlic, finely chopped\",\"dried chili peppers, finely chopped\",\"beef, top sirloin\",\"rice sticks (noodles)\",\"broccoli, cut into florets\",\"carrots, grated\",\"soybean sprouts\",\"fresh mint, finely chopped\"]', 'https://media.soscuisine.com/images/recettes/1202.jpg', 'https://www.soscuisine.com//recipe/thai-noodles-beef', '', '25 min', '370 kcal', '{\"calories\":\"370\",\"fat\":\"13 g\",\"cholesterol\":\"50 mg\",\"protein\":\"27 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Folacin, Niacin, Potassium, Selenium, Vitamin A, Vitamin B12, Vitamin K, Zinc\",\"good_source_of\":\"Iron, Magnesium, Manganese, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin C\",\"source_of\":\"Copper, Fibre, Vitamin D, Vitamin E\",\"low\":\"Cholesterol, Saturated Fat\"}', '2021-06-18 14:15:54'),
(349, 349, 1, 'Thai Peanut Chicken', 'Put all the ingredients, but peas, rice and cilantro, in the ceramic cooking pot. Mix well. Cover the slow cooker with the lid and cook on \'high\' for 4 h. About 30 min before the end of the cooking time, in the peas and cook the brown rice in a pan. Garnish with cilantro and serve the chicken with the rice.', '[\"chicken thighs, boneless, skinless\",\"peanut butter, natural\",\"salsa\",\"lime juice, freshly squeezed\",\"soy sauce\",\"gingerroot, grated\",\"canola oil\",\"yellow or red sweet peppers, in 2 cm slices\",\"onions, finely chopped\",\"garlic, finely chopped\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"frozen peas\",\"brown rice\",\"fresh cilantro, thinly sliced\"]', 'https://media.soscuisine.com/images/recettes/3104.jpg', 'https://www.soscuisine.com//recipe/thai-peanut-chicken', 'is needed to make this recipe.', '270 min', '590 kcal', '{\"calories\":\"590\",\"fat\":\"19 g\",\"cholesterol\":\"90 mg\",\"protein\":\"35 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Fibre, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Vitamin A, Vitamin B1, Vitamin B6, Vitamin C, Vitamin E, Vitamin K, Zinc\",\"good_source_of\":\"Copper, Folacin, Iron\",\"source_of\":\"Calcium, Pantothenic Acid, Vitamin B2\",\"low\":\"Calories, Cholesterol, Saturated Fat, Sodium\"}', '2021-06-18 14:15:55'),
(350, 350, 1, 'Thai Peanut Chicken Sandwich', 'Put all the ingredients, but peas and breads, in the ceramic cooking pot. Mix well. Cover the slow cooker with the lid and cook on \'high\' for 4 h. About 30 min before the end of the cooking time, in the peas and prepare the pickled carrots Serve the chicken in the breads with the pickled carrots.', '[\"chicken thighs, boneless, skinless\",\"green onions\\/scallions, finely chopped\",\"sriracha (hot chili sauce)\",\"ground coriander\",\"ground cumin\",\"maple syrup\",\"lime juice, freshly squeezed\",\"unsweetened coconut milk light\",\"soy sauce\",\"peanut butter, natural\",\"yellow or red sweet peppers, in 2 cm slices\",\"onions, finely chopped\",\"ground ginger\",\"frozen peas\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"kaiser bread\",\"Pickled Carrots\"]', 'https://media.soscuisine.com/images/recettes/3526.jpg', 'https://www.soscuisine.com//recipe/thai-peanut-chicken-sandwich', 'is needed to make this recipe.', '270 min', '610 kcal', '{\"calories\":\"610\",\"fat\":\"21 g\",\"cholesterol\":\"90 mg\",\"protein\":\"37 g\"}', '{\"excellent_source_of\":\"Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Potassium, Selenium, Vitamin A, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin C, Vitamin E, Vitamin K\",\"good_source_of\":\"Copper, Phosphorus, Zinc\",\"source_of\":\"Calcium, Pantothenic Acid\",\"low\":\"Calories, Cholesterol, Saturated Fat\",\"free\":\"Trans Fat\"}', '2021-06-18 14:15:55'),
(351, 351, 1, 'Thai Peanut Vegetarian Sandwich', 'Put all the ingredients, but peas and bread, in the ceramic cooking pot. Mix well. Cover the slow cooker with the lid and cook on \'high\' for 4 h. About 30 min before the end of the cooking time, in the peas and prepare the pickled carrots Serve the tempeh mixture in the breads with the pickled carrots.', '[\"tempeh, finely chopped\",\"green onions\\/scallions, finely chopped\",\"sriracha (hot chili sauce)\",\"ground coriander\",\"ground cumin\",\"maple syrup\",\"lime juice, freshly squeezed\",\"unsweetened coconut milk light\",\"soy sauce\",\"peanut butter, natural\",\"yellow or red sweet peppers, in 2 cm slices\",\"onions, finely chopped\",\"ground ginger\",\"frozen peas\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"kaiser bread\",\"Pickled Carrots\"]', 'https://media.soscuisine.com/images/recettes/3527.jpg', 'https://www.soscuisine.com//recipe/cwhl-thai-peanut-vege-sandwich', 'is needed to make this recipe.', '270 min', '620 kcal', '{\"calories\":\"620\",\"fat\":\"24 g\",\"cholesterol\":\"0 mg\",\"protein\":\"30 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Copper, Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin C, Vitamin E, Vitamin K, Zinc\",\"good_source_of\":\"Calcium\",\"source_of\":\"Pantothenic Acid\",\"low\":\"Saturated Fat\",\"free\":\"Cholesterol, Trans Fat\"}', '2021-06-18 14:15:56');
INSERT INTO `recipe_translation` (`rt_id`, `rt_recipe_id`, `rt_lang_id`, `rt_recipe_name`, `rt_recipe_text`, `rt_recipe_ingredients_full`, `rt_recipe_image`, `rt_recipe_link`, `rt_recipe_prep`, `rt_recipe_duration`, `rt_recipe_calories`, `rt_recipe_nutrients`, `rt_recipe_claims`, `rt_created`) VALUES
(352, 352, 1, 'Tofu and Cauliflower \"Shepherd\'s\" Pie', 'Preheat the oven to 205°C/400°F. Prepare the cauliflower : Cut into florets then them 10-15 min until they are very tender. Drain well and set aside. Prepare the mushrooms : slice them thinly lengthwise. Heat one tablespoon of the oil in a skillet over moderately high heat until hot but not smoking, then sauté the mushrooms, stirring occasionally, until the released liquid is evaporated, about 3 min. Add the Parsley and Garlic Base , then cook an additional 2 min, with stirring. Season with salt and pepper. Remove the skillet from the heat but keep it warm on the stovetop. Heat the remaining oil in a pan over medium-high heat. Finely chop the onion then add it to the pan and sauté 3 min until it becomes translucent. Cut the tofu into small cubes, then add them to the pan and sauté 2-3 min, with stirring ,\r\nuntil they are nicely coloured. in the diced tomatoes, tomato paste, Tabasco sauce . Add the frozen peas and the cooked mushrooms. Continue to cook until the mixture is heated through, about 4-5 min. Add salt and pepper. Remove the pan from the heat and transfer the contents to a large baking dish, or distribute it into individual baking dishes. Pour the milk into a large microwave-safe bowl. Add the butter and microwave on medium-high a few minutes, uncovered, until very hot. Add the cooked cauliflower and mash it until it is creamy. Add salt and pepper to taste. Place a spoonful of the cauliflower mixture on top of the tofu mixture, then gently spread it with a spoon to cover evenly. Bake the pie in the middle of the oven until the top is golden-brown, about 25-30 min. Serve.', '[\"cauliflower, cut into florets\",\"button (white) mushrooms, thinly sliced\",\"olive oil\",\"Parsley and Garlic Base\",\"onions, finely chopped\",\"firm regular tofu, cut into small cubes\",\"canned tomatoes (diced)\",\"tomato paste\",\"Tabasco sauce\",\"vegetable broth\",\"frozen peas\",\"milk, partly skimmed, 2%\",\"butter, unsalted\",\"ground pepper to taste\",\"[optional]\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/777.jpg', 'https://www.soscuisine.com//recipe/tofu-cauliflower-shepherd-pie', 'For individual pies, choose baking dishes which contain about 375 ml or 1 ½ cups when 3/4 full.', '50 min', '300 kcal', '{\"calories\":\"300\",\"fat\":\"18 g\",\"cholesterol\":\"10 mg\",\"protein\":\"18 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Fibre, Folacin, Magnesium, Manganese, Niacin, Potassium, Selenium, Vitamin A, Vitamin B6, Vitamin C, Vitamin K\",\"good_source_of\":\"Calcium, Copper, Iron, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin B2, Vitamin E, Zinc\",\"source_of\":\"Vitamin B12, Vitamin D\",\"low\":\"Sodium\"}', '2021-06-18 14:15:56'),
(353, 353, 1, 'Bow Tie Pasta with Brie Cheese and Spinach', 'To save time, the sauce preparation and the pasta cooking can be done at the same time. Start cooking the pasta Meanwhile, coarsely cut the cheese into pieces. Put them in a serving bowl and heat 1-2 min in a microwave oven, or alternatively in a small saucepan on the stovetop and warm about 2 min over very low heat (cheese should be softened, not cooked). Pour in the cream and the baby spinach. Pour the drained pasta into the bowl with the cheese, then add the baby spinach. Season with a little salt (cheese is already salted) and pepper to taste, then sprinkle with the walnuts (optional). well and serve in the warmed dishes.', '[\"farfalle (bow-tie), or other short pasta\",\"brie cheese, coarsely chopped\",\"whipping cream 35%\",\"baby spinach\",\"walnuts\",\"[optional]\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/775.jpg', 'https://www.soscuisine.com//recipe/bow-tie-pasta-brie-cheese-spinach', '', '25 min', '440 kcal', '{\"calories\":\"440\",\"fat\":\"14 g\",\"cholesterol\":\"40 mg\",\"protein\":\"18 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Magnesium, Manganese, Selenium, Vitamin A, Vitamin B12, Vitamin K\",\"good_source_of\":\"Niacin, Phosphorus, Vitamin B2, Zinc\",\"source_of\":\"Calcium, Copper, Fibre, Iron, Pantothenic Acid, Potassium, Vitamin B1, Vitamin B6, Vitamin C, Vitamin E\"}', '2021-06-18 14:15:56'),
(354, 354, 1, 'Tofu Burger', 'Preheat the oven to 175ºC/350ºF. Line a baking sheet with parchment paper . Cook the rice, then let it cool down a few minutes. food processor combine the rice, tofu, garlic, green onions, parsley, soy sauce, paprika, and Tabasco sauce , then pulse until coarsely ground. Adjust the seasoning Transfer to a bowl and in the beaten egg. Shape the dough into patties (2 per serving). Heat the oil in a pan over medium-high heat. Cook the patties on one side for about 4 min, until golden, then gently flip and cook on the other side for about 5 min. Transfer the burgers to the prepared baking sheet and cook in the middle of the oven for about 30 min, or until they are firm and cooked through on the inside. Serve the burgers on bread and top with a spoonful of mayonnaise.', '[\"parchment paper\",\"rice, long grain\",\"firm regular tofu, cut into dices\",\"garlic, coarsly chopped\",\"green onions\\/scallions, coarsly chopped\",\"Italian parsley, fresh, coarsly chopped\",\"soy sauce\",\"paprika\",\"Tabasco sauce\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"eggs size large, beaten\",\"canola oil\",\"bread, whole wheat\",\"mayonnaise\"]', 'https://media.soscuisine.com/images/recettes/2582.jpg', 'https://www.soscuisine.com//recipe/tofu-burger', 'will be very useful.', '45 min', '480 kcal', '{\"calories\":\"480\",\"fat\":\"25 g\",\"cholesterol\":\"110 mg\",\"protein\":\"20 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Iron, Magnesium, Manganese, Niacin, Phosphorus, Selenium, Vitamin A, Vitamin E, Vitamin K\",\"good_source_of\":\"Calcium, Copper, Fibre, Pantothenic Acid, Potassium, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin C, Zinc\",\"source_of\":\"Omega-3, Omega-6, Vitamin D\"}', '2021-06-18 14:15:57'),
(355, 355, 1, 'Tomato and Sage Spaghetti', 'Finely chop the ; mince the garlic and chili pepper Heat the olive oil in a skillet over low heat. Add the garlic, sage and chili pepper sauté for 2-3 min, with stirring . Add the Parsley\r\nand Garlic Base Tomato Base and cook about 7-8 min over medium heat. Reduce the heat, then add the Feta cheese and mix well. Season with salt and pepper to taste. To save time, while the sauce is cooking, cook the pasta . Pour the drained pasta into the skillet and Sprinkle with grated Parmesan and serve in the warmed dishes.', '[\"fresh sage, finely chopped\",\"garlic, minced\",\"dried chili peppers, minced\",\"olive oil\",\"Parsley and Garlic Base\",\"Fresh Tomato Base\",\"feta cheese, crumbled\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"spaghetti\",\"Parmesan cheese, grated\"]', 'https://media.soscuisine.com/images/recettes/696.jpg', 'https://www.soscuisine.com//recipe/tomato-sage-spaghetti', '', '20 min', '440 kcal', '{\"calories\":\"440\",\"fat\":\"12 g\",\"cholesterol\":\"10 mg\",\"protein\":\"15 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Magnesium, Manganese, Selenium, Vitamin A, Vitamin K\",\"good_source_of\":\"Copper, Fibre, Folacin, Niacin, Phosphorus, Potassium, Vitamin B6, Vitamin C, Vitamin E, Zinc\",\"source_of\":\"Calcium, Iron, Pantothenic Acid, Vitamin B1, Vitamin B12, Vitamin B2\"}', '2021-06-18 14:15:57'),
(356, 356, 1, 'Tomato Sauce and Sunflower Seeds Penne', 'To save time, the reheat the sauce and cook the pasta at the same time. Start by cooking the pasta Meanwhile, heat the in a pan with the specified amount of pasta cooking water to dilute the sauce a bit. Put the drained pasta back into the pasta cooking pot, add the sauce, then mix well. Serve in the warmed dishes.', '[\"Tomato and Sunflower Seeds Sauce\",\"pasta cooking water\",\"penne, whole wheat\"]', 'https://media.soscuisine.com/images/recettes/3539.jpg', 'https://www.soscuisine.com//recipe/tomato-sauce-sunflower-seed-penne', '', '15 min', '440 kcal', '{\"calories\":\"440\",\"fat\":\"15 g\",\"cholesterol\":\"0 mg\",\"protein\":\"16 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Copper, Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Selenium, Vitamin B1, Vitamin E, Vitamin K, Zinc\",\"good_source_of\":\"Vitamin B6\",\"source_of\":\"Calcium, Omega-6, Potassium, Vitamin A, Vitamin B2, Vitamin C\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:15:58'),
(357, 357, 1, 'Tortilla EspaÃÂ±ola', 'Prepare the vegetables . Mince the garlic and finely chop the onion. Peel the potatoes and cut them into slices about 7 mm thick. Chop the oven-roasted peppers Heat the butter and half of the oil in a non-stick skillet. Add the garlic and onion. Cook on medium heat 4-5 min, until the garlic is translucent and not burned. Add the potatoes and roasted peppers, then season with salt and pepper. Cook over low heat 15-20 min, stirring from time to time until they are soft and lightly coloured.   In a bowl, the eggs. Add the minced chili\npepper , then season with salt and pepper. Add the cooked vegetables then mix well.   Heat the rest of the oil in another non-stick skillet over high heat. Add the mixture, distributing it evenly over the pan. Gently lift the edges with a spatula and push them towards the centre. After 3-5 min, the bottom will be cooked to a nice crust. Lower the heat and continue to cook until the edges get darker (10-15 min). Gently shake the pan occasionally to keep the omelette from sticking.   Before turning the omelette, gently lift the edges with a spatula and cover the skillet with a large plate or flat lid. Leave the plate on the skillet 2 min, in order to trap some humidity underneath. This will help the flipping. Quickly turn the covered skillet upside-down so that the omelette ends up on the plate. Add a little more oil to the skillet. Gently slide the omelette back in and cook over medium heat 3-4 min. Slide onto a plate and serve.', '[\"eggs size large\",\"potatoes, peeled and cut into 7 mm slices\",\"onions, finely chopped\",\"garlic, minced\",\"dried chili peppers, minced\",\"butter, unsalted\",\"olive oil\",\"Oven-Roasted Peppers\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/75.jpg', 'https://www.soscuisine.com//recipe/tortilla-espanola', '', '45 min', '390 kcal', '{\"calories\":\"390\",\"fat\":\"19 g\",\"cholesterol\":\"390 mg\",\"protein\":\"17 g\"}', '{\"excellent_source_of\":\"Folacin, Niacin, Pantothenic Acid, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin C, Vitamin D, Vitamin E\",\"good_source_of\":\"Copper, Fibre, Iron, Magnesium, Manganese, Vitamin B1, Zinc\",\"source_of\":\"Calcium, Vitamin K\",\"low\":\"Calories, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:15:58'),
(358, 358, 1, 'Bow Tie Pasta with Roasted Asparagus and Peppers', 'Preheat the oven to 215ºC/425ºF. Add half of the oil to a large baking tray. Prepare the asparagus and peppers . Leave the asparagus whole; Cut the peppers in half or quarters, removing the stem and seeds. Lay the vegetables in a single layer on the oiled baking tray. Coat them thoroughly with the oil in the tray, then add a little salt. Bake in the middle of the oven until the vegetables are nicely browned, about 10-12 min. Turn the vegetables a couple times during\r\ncooking, so that they will cook evenly. Set aside. The peppers should be peeled before serving. To make the peeling easier, cover or wrap the peppers with aluminum foil or put them in a paper bag, and let them cool down a few minutes (the moisture kept under the cover will help lift the peel). Cut the peppers into strips and the asparagus into bite-size pieces (about 1,5 cm). To save time, the rest of the sauce preparation and the pasta cooking can be done at the same time. Cook the pasta in a large pot of boiling salted water until it is (al dente). Meanwhile, warm the remaining oil in a frying pan over medium heat. Add the finely chopped shallot, then sauté 2-3\r\nmin, until it is softened. Add the cooked vegetables. Crumble the feta, add it to the pan, and . Mix well, then lower the heat to very low. Add just a little salt (feta cheese is rather salty), and pepper to taste. Drain the pasta then pour it into the pan, mix well and adjust\r\nthe seasoning Serve in the warmed dishes.', '[\"olive oil\",\"asparagus, average size\",\"yellow or red sweet peppers\",\"farfalle (bow-tie), penne, or other short-cut pasta\",\"shallots, finely chopped\",\"feta cheese, crumbled\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1162.jpg', 'https://www.soscuisine.com//recipe/bow-tie-pasta-roasted-asparagus-peppers', '', '35 min', '530 kcal', '{\"calories\":\"530\",\"fat\":\"23 g\",\"cholesterol\":\"20 mg\",\"protein\":\"16 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Fibre, Folacin, Manganese, Selenium, Vitamin A, Vitamin B6, Vitamin C, Vitamin E, Vitamin K, Zinc\",\"good_source_of\":\"Copper, Iron, Magnesium, Niacin, Phosphorus, Potassium, Vitamin B1, Vitamin B12, Vitamin B2\",\"source_of\":\"Calcium, Pantothenic Acid\"}', '2021-06-18 14:15:59'),
(359, 359, 1, 'Tuna and Ricotta Patties', 'If using the baking method : Preheat the oven to 205°C/400°F. Lightly oil a baking dish. Alternatively, for deep-frying :\r\nPreheat a sufficient quantity of peanut oil to 175°C/350°F in an electric fryer or in a large skillet. Put all the ingredients, but half of the bread crumbs in a blender . Process until a smooth consistency is obtained. Form the mixture into small balls, then flatten them slightly into patties and roll into the remaining bread crumbs. Baking : Transfer the patties on the prepared baking dish and spray them evenly with a vegetable oil spray. Cook in the middle of the oven 12-15 min until golden-brown, turning them once. Deep-frying : Working in batches, deep-fry the patties about 5 min per side until golden-brown, then set them on paper towels to drain. Serve.', '[\"olive oil\",\"tuna, canned\",\"ricotta cheese\",\"anchovy fillets\",\"capers\",\"bread crumbs\",\"Italian parsley, fresh, finely chopped\",\"eggs size large\",\"Parmesan cheese, grated\",\"ground pepper to taste\",\"[optional]\",\"vegetable oil spray\"]', 'https://media.soscuisine.com/images/recettes/4107.jpg', 'https://www.soscuisine.com//recipe/tuna-ricotta-patties', '', '30 min', '310 kcal', '{\"calories\":\"310\",\"fat\":\"16 g\",\"cholesterol\":\"130 mg\",\"protein\":\"29 g\"}', '{\"diet-related_health_claims\":\"Bone-healthy\",\"free\":\"Added Sugar\",\"excellent_source_of\":\"Niacin, Phosphorus, Selenium, Vitamin B12, Vitamin K\",\"good_source_of\":\"Calcium, Folacin, Iron, Magnesium, Vitamin B2, Vitamin D, Vitamin E, Zinc\",\"source_of\":\"Copper, Manganese, Pantothenic Acid, Potassium, Vitamin A, Vitamin B1, Vitamin B6\"}', '2021-06-18 14:16:00'),
(360, 360, 1, 'Tuna and Veggie Bowl', 'Boil the eggs (10 min), cool them down immediately in cold water. Set aside. Meanwhile, prepare the vegetables : Dice the celery and tomatoes, finaly chop the shallot. Put them in a salad bowl then add the mixed greens. In a small bowl, combine the oil, lemon juice and mustard, then add the vinaigrette to the salad. Adjust the\r\nseasoning , then Transfer the salad to serving bowls. Cut the tuna into pieces and quarter the eggs. Place them on top of the salad with the olives, then serve.', '[\"eggs size large\",\"mini-tomatoes (cherry, miniature or grape), diced\",\"celery, finely diced\",\"shallots, finely chopped\",\"Dijon mustard\",\"extra virgin olive oil\",\"lemon juice, freshly squeezed\",\"tuna, canned\",\"mixed greens\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"black olives\"]', 'https://media.soscuisine.com/images/recettes/4230.jpg', 'https://www.soscuisine.com//recipe/tuna-veggie-bowl', '', '25 min', '400 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Folacin, Niacin, Phosphorus, Selenium, Vitamin A, Vitamin B12, Vitamin D, Vitamin E, Vitamin K\",\"good_source_of\":\"Iron, Magnesium, Pantothenic Acid, Potassium, Vitamin B2, Zinc\",\"source_of\":\"Calcium, Copper, Manganese, Vitamin B1, Vitamin B6, Vitamin C\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:16:00'),
(361, 361, 1, 'Turkey Roast with an Orange-Cranberry Sauce', 'Pour the water and salt in a bowl, then mix well until the salt is dissolved. Put the turkey in the brine, then chill, covered, in the refrigerator for at least 3 h. Depending on the size of the bowl, it may be necessary to add some additional brine to cover the turkey: you will need 1 tablespoon of salt for every cup of water. Preheat the oven to 175ºC/350ºF. Take the turkey out of the brine, then pat it dry using paper towels. Heat the oil in a pan or casserole dish\r\nover medium-high heat. Sauté thoroughly 7-8 min on all sides until golden coloured. Cut the shallots into large chunks and add them to the pan. Cover and cook 1 h in the middle of the oven. Pour in the orange juice, and cranberries. Turn the turkey, add a little salt and pepper to taste, then continue to cook, uncovered, until the internal temperature of the turkey reaches 77ºC/170ºF. Take the turkey out of the pan, put it on a cutting board, cover it with aluminum foil and let it rest 10 min (to reabsorb all the juice). During this time, reduce the cooking juices on the stovetop 2 min over high heat if the consistency is too thin, or dilute it with additional broth if it is too concentrated for your taste. Mix in the cold butter, stirring well to\r\nenrich the sauce. Remove and discard the twine, slice then serve the turkey with the cooking sauce.', '[\"water\",\"coarse salt\",\"turkey breast roast, trussed, skinless\",\"paper towels\",\"olive oil\",\"shallots, cut into large chunks\",\"orange juice\",\"chicken broth\",\"dried cranberries\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"aluminum foil\",\"butter, unsalted\"]', 'https://media.soscuisine.com/images/recettes/725.jpg', 'https://www.soscuisine.com//recipe/turkey-roast-orange-cranberry-sauce-alcohol-free', '', '90 min', '350 kcal', '{\"calories\":\"350\",\"fat\":\"12 g\",\"cholesterol\":\"120 mg\",\"protein\":\"40 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"free\":\"Added Sugar\",\"excellent_source_of\":\"Niacin, Phosphorus, Potassium, Selenium, Vitamin B12, Vitamin B6, Zinc\",\"good_source_of\":\"Iron, Magnesium, Pantothenic Acid\",\"source_of\":\"Copper, Folacin, Manganese, Vitamin A, Vitamin B1, Vitamin B2, Vitamin C, Vitamin E\",\"low\":\"Saturated Fat\"}', '2021-06-18 14:16:01'),
(362, 362, 1, 'Tuscan Soup of Beans and Spelt', 'Put the spelt berries in a pot, cover with water then bring to a boil. Add a little salt, cover, and simmer until the berries are cooked, about 35 min. Drain and set aside. Meanwhile, in another pot, heat the oil over medium-low heat. Add the onion, carrot, garlic and celery, together with the rosemary, then cook, with occasional stirring , until they are softened, about 5 min. Add the potatoes and cook 2 min with stirring. Pour in the strained tomatoes and , add a little salt and pepper. Cook until the potatoes are tender, about 15 min. Add about &frac23; of the beans then cook 5 min. Set aside the remaining beans. Purée the soup in a blender or by using a food-mill . Put the soup back into the pot, with the remaining beans and cooked spelt. Cook a few minutes until hot. Add the optional parsley and the grated parmesan, then ladle into bowls.', '[\"spelt berries\",\"olive oil\",\"onions, finely chopped\",\"carrots, finelly chopped\",\"garlic, finely chopped\",\"celery, finely chopped\",\"rosemary, fresh, finely chopped\",\"potatoes, peeled and cut into big pieces\",\"strained tomatoes\",\"chicken broth\",\"white \\\"navy\\\" beans (canned), strained and rinced\",\"Italian parsley, fresh, finely chopped\",\"[optional]\",\"Parmesan cheese, grated\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2542.jpg', 'https://www.soscuisine.com//recipe/tuscan-soup-beans-spelt', '', '50 min', '300 kcal', '{\"calories\":\"300\",\"fat\":\"5 g\",\"cholesterol\":\"0 mg\",\"protein\":\"12 g\"}', '{\"excellent_source_of\":\"Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Vitamin A\",\"good_source_of\":\"Copper, Vitamin B1, Vitamin B6, Zinc\",\"source_of\":\"Calcium, Pantothenic Acid, Selenium, Vitamin B2, Vitamin C, Vitamin E, Vitamin K\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:16:02'),
(363, 363, 1, 'Braised Brisket of Beef', 'Prepare the vegetables : peel the carrots, potatoes and turnips, then cut the carrots, turnips, and celery\r\nstalks into large pieces (about 2-3 cm thick). Leave the potatoes whole or cut them in half if big. Finely chop the onion and garlic. Leave the meat whole. Heat the butter and oil in a pressure cooker or in a thick-base roasting pan over medium heat. the meat thoroughly on each side until golden, 7-8 min total. Take the meat out and set aside. Add the onion and garlic to the pressure cooker or pan and sauté 3-4 min until translucent. Add the other vegetables and cook 2-3 min, then pour in the . Scrape the bottom of the pan using a wooden spoon, then pour in about 1 cm water. Add the tomato paste and put the meat back into the pan. Add salt and pepper. If you are using a pressure cooker , cover and close, and bring to high pressure (*Follow the manufacturer\'s directions to determine when high pressure has been reached). Cook for 40 min. If you are not using a pressure cooker , cover the pan, lower the heat, and simmer for about 2 h 30 min. Serve the meat and vegetables with the cooking juices.', '[\"carrots, cut into large pieces\",\"potatoes, whole or halved\",\"turnips, or rutabagas, cut into large pieces\",\"celery, cut into large pieces\",\"onions, finely chopped\",\"garlic, finely chopped\",\"blade pot roast, rib roast or shoulder cloud\",\"butter, unsalted\",\"canola oil\",\"beef broth\",\"water\",\"tomato paste\",\"ground pepper to taste\",\"[optional]\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/376.jpg', 'https://www.soscuisine.com//recipe/braised-brisket-beef-alcohol-free', '', '165 min', '410 kcal', '{\"calories\":\"410\",\"fat\":\"15 g\",\"cholesterol\":\"80 mg\",\"protein\":\"29 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B12, Vitamin B6, Vitamin C, Vitamin K, Zinc\",\"good_source_of\":\"Copper, Pantothenic Acid, Vitamin B1, Vitamin B2, Vitamin E\",\"source_of\":\"Calcium, Vitamin D\"}', '2021-06-18 14:16:03'),
(364, 364, 1, 'Two-Ingredients Beef Stew', 'Preheat the oven to 135ºC/275ºF. Put the pot roast on a large sheet of heavy-duty aluminum foil, spread the soup mix on top, then wrap and seal thoroughly (you may want to add an additional sheet to ensure that the juices are well trapped inside). Put the wrap on a baking pan. Cook in the middle of the oven. Serve with the juices. It is not necessary to add any salt, since the soup mix is already salted.', '[\"blade pot roast\",\"pouch onion or leek soup mix\",\"aluminum foil\"]', 'https://media.soscuisine.com/images/recettes/715.jpg', 'https://www.soscuisine.com//recipe/two-ingredients-beef-stew', 'The cooking time varies with the temperature of the oven: I recommend using 135ºC/275ºF and calculate about 3 h per kilo of meat. If you prefer, you may vary the temperature between 100ºC/205ºF and 150ºC/300ºF, then adjust the cooking time accordingly (longer at lower temperatures and shorter at higher temperatures).', '185 min', '270 kcal', '{\"calories\":\"270\",\"fat\":\"10 g\",\"cholesterol\":\"90 mg\",\"protein\":\"32 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Niacin, Selenium, Vitamin B12, Zinc\",\"good_source_of\":\"Iron, Pantothenic Acid, Phosphorus, Potassium, Vitamin B2, Vitamin B6, Vitamin D\",\"source_of\":\"Copper, Magnesium, Vitamin B1\"}', '2021-06-18 14:16:05'),
(365, 365, 1, 'Veal Burger with Goat Cheese', 'Preheat the outdoor grill to medium-high heat. Heat one tablespoon of oil in a pan. Add the peppers then sauté 2 min over \r\nmedium-high heat. Cover, then lower the heat to \'low\' and let cook while preparing the meat. Put the egg in a bowl, then lightly. Add the ground meat, oregano, mustard, salt and pepper \r\nto taste. Mix well using a fork, then form one ball for each serving and insert one cheese slice into each meatball. Flatten the meatballs into thick patties. Lightly brush the patties with oil then place them on the grill. Cook until the burgers become golden coloured and the inside has lost its pink colour (the internal temperature should reach 80ºC/175ºF), about 10 min. Turn the burgers once midway through cooking. Alternatively, you may cook the burgers on a nonstick, heavy-bottom pan, over very high heat. Place each burger on the split buns, garnish with the peppers, then serve right away.', '[\"olive oil\",\"yellow or red sweet peppers, cut into 1,5 cm strips\",\"eggs size large\",\"ground veal, lean\",\"dried oregano\",\"Dijon mustard\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"goat cheese, sliced\",\"hamburger buns\"]', 'https://media.soscuisine.com/images/recettes/1184.jpg', 'https://www.soscuisine.com//recipe/veal-burger-goat-cheese', 'These burgers can be cooked either in a pan on the stovetop or using an outdoor grill.', '25 min', '440 kcal', '{\"calories\":\"440\",\"fat\":\"22 g\",\"cholesterol\":\"160 mg\",\"protein\":\"33 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Niacin, Phosphorus, Selenium, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin C, Zinc\",\"good_source_of\":\"Iron, Magnesium, Pantothenic Acid, Potassium, Vitamin B1, Vitamin D, Vitamin E\",\"source_of\":\"Calcium, Copper, Manganese, Vitamin A, Vitamin K\"}', '2021-06-18 14:16:05'),
(366, 366, 1, 'Veal Chops with Sage Butter', 'In a small bowl, the butter and minced leaves to blend. Wrap the sage butter in plastic wrap, forming a 3 cm-diameter log. Chill at least 1 hour (or can be made up to 1 week ahead and kept refrigerated). Arrange the chops in single layer in a shallow dish. Drizzle with half of the olive oil, sprinkle with the minced rosemary leaves, then season with salt and pepper. Rub the oil and seasoning into the chops, then cover with plastic wrap. Chill overnight. Let the chops stand at room temperature 1 hour before cooking. Heat the remaining oil in a heavy pan over medium-high heat. Add the garlic, sauté 1 min until fragrant, then remove it. Increase the heat to \'high\', then add the chops. Cook until the chops are browned, about 2 min per side. Transfer the chops to a plate. Cut the sage butter into slices and place 1 slice on top of each chop. Serve.', '[\"butter, unsalted, room temperature\",\"fresh sage, minced\",\"plastic wrap\",\"veal chops, about 1-1,5 cm thick\",\"olive oil\",\"rosemary, fresh, minced\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"garlic, whole\"]', 'https://media.soscuisine.com/images/recettes/1868.jpg', 'https://www.soscuisine.com//recipe/veal-chops-sage-butter-alcohol-free', 'Keep the serving plates in the oven at the lowest setting so they are warm when you serve.', '15 min', '190 kcal', '{\"calories\":\"190\",\"fat\":\"13 g\",\"cholesterol\":\"70 mg\",\"protein\":\"18 g\"}', '{\"free\":\"Sugar\",\"excellent_source_of\":\"Niacin, Vitamin B12, Zinc\",\"good_source_of\":\"Vitamin D, Vitamin K\",\"source_of\":\"Copper, Folacin, Iron, Magnesium, Pantothenic Acid, Phosphorus, Potassium, Vitamin A, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin E\",\"low\":\"Sodium\"}', '2021-06-18 14:16:06'),
(367, 367, 1, 'Veal Cutlets Milanese', 'Tenderize the veal by flattening the cutlets using a meat pounder. Make a few shallow cuts around the outside edge to avoid curling during cooking. Prepare 2 shallow dishes: the egg in one, and put the bread crumbs in the other. Dip one cutlet at the time in the egg, let the excess egg drip off before coating the cutlet with the bread crumbs. Turn the cutlets to both sides, then set them aside. Heat the butter and oil in a skillet over medium-high heat, taking care not to let them burn. Add the cutlets and sauté until golden, about 4 min on each side. Add salt and pepper. Serve on the warmed plates.', '[\"veal cutlets, thinly sliced\",\"eggs size large\",\"bread crumbs\",\"butter, unsalted\",\"canola oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/409.jpg', 'https://www.soscuisine.com//recipe/veal-cutlets-milanese', '', '15 min', '230 kcal', '{\"calories\":\"230\",\"fat\":\"11 g\",\"cholesterol\":\"160 mg\",\"protein\":\"24 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Niacin, Selenium, Vitamin B12\",\"good_source_of\":\"Folacin, Pantothenic Acid, Phosphorus, Vitamin B2, Vitamin B6, Vitamin E, Zinc\",\"source_of\":\"Iron, Magnesium, Omega-3, Omega-6, Potassium, Vitamin B1, Vitamin D, Vitamin K\",\"low\":\"Sodium\"}', '2021-06-18 14:16:07'),
(368, 368, 1, 'Veal Shank \"Ossobuco\" Milanese', 'Finely chop the onion and mince the garlic. Set aside. Pat the shanks dry. Make a few shallow cuts around the outside edge to avoid curling during cooking. (If you wish, you may tie each piece with a string around the outer circumference to keep it together better during cooking). Dredge the shanks in the flour shaking off any excess. Heat the butter and oil in a heavy skillet over moderately high heat until hot but not smoking. the shanks on all sides, about 10 min, then transfer them to a plate. Add the onion and garlic to the skillet, then sauté 2-3 min until they become translucent. Add the diced tomatoes, cook 5 min with occasional stirring , then put the veal shanks back into the skillet. Season with salt and pepper. Cover and cook over low heat until the meat is very tender and falls off the bone, about 1 h 40 min or longer, turning the shanks once. In order to keep the environment moist, occasionally add a few tablespoons of warm . (Heat the broth in a small saucepan on the stove or in a microwave oven and keep it warm while cooking the shanks). Adjust the seasoning When almost ready to serve, prepare the gremolata : Finely chop the parsley , mince the garlic, and grate the zest. Put them in a small bowl, then mix well. Sprinkle the gremolata on top of the shanks, then serve.', '[\"onions, finely chopped\",\"garlic, minced\",\"slices of veal shank, 3 cm thick, center cut\",\"white flour (all purpose)\",\"butter, unsalted\",\"olive oil\",\"canned tomatoes (diced)\",\"beef broth\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"Italian parsley, fresh, chopped\",\"garlic, minced\",\"lemon zest, grated\"]', 'https://media.soscuisine.com/images/recettes/1007.jpg', 'https://www.soscuisine.com//recipe/veal-shank-ossobuco-milanese-alcohol-free', 'Two skillets are needed if cooking more than 4 shanks.', '120 min', '450 kcal', '{\"calories\":\"450\",\"fat\":\"16 g\",\"cholesterol\":\"280 mg\",\"protein\":\"63 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Magnesium, Niacin, Pantothenic Acid, Phosphorus, Potassium, Selenium, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin D, Vitamin K, Zinc\",\"good_source_of\":\"Iron\",\"source_of\":\"Calcium, Copper, Manganese, Vitamin A, Vitamin B1, Vitamin C, Vitamin E\"}', '2021-06-18 14:16:08'),
(369, 369, 1, 'Veal Stew with Vegetables', 'Prepare the vegetables : peel the carrots and potatoes, then cut them into 2 cm pieces. Finely chop the onion and garlic. Leave the meat whole. Heat the oil in a pressure cooker or in a thick-base roasting pan over medium heat. the meat thoroughly on all sides until golden, about 8 min total. Season the meat with salt and pepper, then take it out of the pan and set aside. Add the onion and garlic to the pressure cooker or pan and sauté 3-4 min until the onion is translucent. Add the vegetables and cook 2-3 min, then in the herbes de Provence . Add salt and pepper to taste. Pour in water to a depth of about 1 cm and put the meat back into the pan. If you are using a pressure cooker , cover and close, and bring to high pressure (*Follow the manufacturer\'s directions to determine when high pressure has been reached). Cook 20-25 min. If you are not using a pressure cooker , cover the pan, lower the heat, and simmer for about 1 h 15 min. Serve the meat and vegetables with the cooking juices.', '[\"carrots, cut into 2 cm pieces\",\"potatoes, cut into 2 cm pieces\",\"onions, finely chopped\",\"garlic, finely chopped\",\"veal blade roast\",\"olive oil\",\"herbes de Provence\",\"water\",\"ground pepper to taste\",\"[optional]\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1148.jpg', 'https://www.soscuisine.com//recipe/veal-stew-vegetables-alcohol-free', '', '90 min', '330 kcal', '{\"calories\":\"330\",\"fat\":\"8 g\",\"cholesterol\":\"140 mg\",\"protein\":\"32 g\"}', '{\"excellent_source_of\":\"Niacin, Pantothenic Acid, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B12, Vitamin B6, Zinc\",\"good_source_of\":\"Copper, Folacin, Iron, Magnesium, Manganese, Vitamin B1, Vitamin B2, Vitamin C, Vitamin D, Vitamin K\",\"source_of\":\"Calcium, Fibre, Vitamin E\",\"low\":\"Calories, Fat, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:16:09'),
(370, 370, 1, 'Vegan Cabbage Rolls', 'Using a paring knife, remove the centre core of the cabbage. In a large stockpot, bring salted water to a boil. Add the cabbage and cook until the outer leaves are tender, 2-3 min. Lift the cabbage from the water, then remove and set aside the softened\r\n    outer leaves. When the undercooked inner leaves become difficult to remove, return the cabbage to the pot. Repeat the brief cooking and removal of leaves until enough leaves are cooked (you will need 3 leaves/serving, plus some larger leaves to line\r\n    the bottom of the baking dish). Drain the leaves well, then pat them dry with paper towels. Trim the thick centre vein from the bottom of each leaf. (As an alternative, you can also microwave the cabbage to soften the leaves: Place the cabbage in a bowl with about 2 tbsp of water, cover,\r\n    then microwave on \'High\' for about 12 minutes, depending on the power of the microwave and size of the cabbage head). Preheat the oven to 175°C/350°F. Oil a baking dish, then line the bottom with a few of the larger cabbage leaves. Heat the oil in a pan over medium heat. Add the chopped onion and garlic, then sauté 2-3 min until softened. Add the rice then cook, with stirring , until golden, about 3 min. Stir\r\n    in the tomatoes, spices, herbs and lemon juice. Mix well, then add the veggie ground. Sauté over high heat, with stirring, 2-3 min. Season with salt and pepper. Place 3 tablespoons of the mixture into the centre of each reserved cabbage leaf. Fold the sides over the filling, then roll the leaf up tightly. Arrange the rolls with the seam side down in the cabbage lined baking dish. Pour the tomato juice over the\r\n    rolls, then cover with aluminum foil. Bake in the middle of the oven until very tender, about 1 h 15 min. Serve.', '[\"green cabbage, or Savoy\",\"paper towels\",\"olive oil\",\"onions, finely chopped\",\"garlic, finely chopped\",\"rice, long grain, uncooked\",\"canned tomatoes (diced)\",\"cayenne pepper\",\"ground cinnamon\",\"dried oregano\",\"dried savory\",\"lemon juice, freshly squeezed\",\"veggie ground\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"tomato juice\",\"aluminum foil\"]', 'https://media.soscuisine.com/images/recettes/4125.jpg', 'https://www.soscuisine.com//recipe/cabbage-rolls-vegan', 'To ease the preparation, you may alternate layers of stuffing with layers of chopped cabbage. The preparation time will be much shorter, the final result less elegant, but equally good.', '135 min', '230 kcal', '{\"calories\":\"230\",\"fat\":\"4 g\",\"cholesterol\":\"0 mg\",\"protein\":\"18 g\"}', '{\"excellent_source_of\":\"Fibre, Folacin, Iron, Manganese, Vitamin A, Vitamin C, Vitamin K\",\"good_source_of\":\"Magnesium, Potassium, Vitamin B6\",\"source_of\":\"Calcium, Copper, Niacin, Pantothenic Acid, Phosphorus, Selenium, Vitamin B1, Vitamin E, Zinc\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:16:10'),
(371, 371, 1, 'Braised Chicken with Rosemary and Onion', 'Season the chicken pieces with salt and pepper. Heat the oil in a pan over medium heat and sauté the chicken 10-12 min until golden-coloured on all sides. Remove the chicken from the pan and keep the pieces warm in the oven. Add the chopped onion and flour to the pan, then sauté 2 min with stirring . Pour in the , bring to a boil and reduce for about 1-2 min until it reaches half its initial volume. Put the chicken back into the pan, add the vinegar, lemon juice, and rosemary. Bring to a boil, lower the heat, cover and let simmer for about 8-10 min, until the chicken pieces are tender. Adjust the seasoning and serve on the warmed plates.', '[\"chicken legs, with back, skinless\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"olive oil\",\"onions, chopped\",\"white flour (all purpose)\",\"chicken broth\",\"white vinegar\",\"lemon juice, freshly squeezed\",\"rosemary, fresh\"]', 'https://media.soscuisine.com/images/recettes/260.jpg', 'https://www.soscuisine.com//recipe/braised-chicken-rosemary-onion', 'Keep the serving plates in the oven at the lowest setting so they are warm when you serve.', '35 min', '320 kcal', '{\"calories\":\"320\",\"fat\":\"18 g\",\"cholesterol\":\"90 mg\",\"protein\":\"30 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Niacin, Vitamin B6, Zinc\",\"good_source_of\":\"Pantothenic Acid, Phosphorus, Potassium, Vitamin B12, Vitamin B2\",\"source_of\":\"Copper, Folacin, Iron, Magnesium, Manganese, Vitamin B1, Vitamin C, Vitamin E, Vitamin K\"}', '2021-06-18 14:16:10'),
(372, 372, 1, 'Vegan Tacos', 'Preheat the oven to 190°C/375°F. Generously oil a baking sheet. Roast in the middle of the oven for about 15 min, then take the baking sheet out of the oven and add the peppers and tofu. Mix well. Continue to cook for about 15 min, until the vegetables are soft and golden-coloured. Arrange the tofu and vegetables on the tortillas, garnish with soy yogurt and serve.', '[\"canola oil\",\"onions, cut into 2 cm pieces\",\"sweet potatoes, cut into 2 cm pieces\",\"yellow or red sweet peppers, cut into 2 cm pieces\",\"dried oregano\",\"cayenne pepper\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"firm regular tofu, smoked, cut into 2 cm pieces\",\"corn tortillas, about 21 cm diameter\",\"soy yogurt\"]', 'https://media.soscuisine.com/images/recettes/notAvailable.jpg', 'https://www.soscuisine.com//recipe/vegan-tacos', '', '45 min', '420 kcal', '{\"calories\":\"420\",\"fat\":\"21 g\",\"cholesterol\":\"0 mg\",\"protein\":\"16 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Fibre, Folacin, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Vitamin A, Vitamin B6, Vitamin C, Vitamin E, Vitamin K\",\"good_source_of\":\"Calcium, Copper, Iron, Selenium, Vitamin B1, Zinc\",\"source_of\":\"Omega-3, Omega-6, Pantothenic Acid, Vitamin B2\",\"low\":\"Sodium\"}', '2021-06-18 14:16:11'),
(373, 373, 1, 'Vegetarian Burger', 'Prepare the vegetables cilantro :\r\nfinely chop the onion, the\r\ngarlic, finely chop the mushrooms, chop the cilantro, and mince the chili pepper . Set them aside. Heat half of the oil in a skillet over medium-low heat. Add the onion and garlic then sauté 3-4 until translucent. Add the cumin, turmeric and minced chili\r\npepper . Cook 1 min with constant stirring . Add the mushrooms and cook, with occasional stirring , a\r\nfew minutes until the mushrooms are softened and have lost most of their moisture. Remove the skillet from the heat. Drain the beans, rinse them and drain again thoroughly, then place them in a bowl. Mash them using a fork, then add them to the skillet with the chopped cilantro and mix well. Add plenty of salt and pepper. Using floured hands, form the mixture into flat patties. If the mixture is too sticky to handle, mix in a little flour. Lightly brush the patties with the remaining oil then cook on a hot grill for 8-10 min, until golden-brown, turning them once gently (they are not quite as firm as meat burgers). Alternatively, they may be cooked in a pan, over medium heat for 8-10 min, turning them once. Serve each burger over a pita bread with a spoonful of yogurt.', '[\"onions, finely chopped\",\"garlic, pressed\",\"button (white) mushrooms, finely chopped\",\"fresh cilantro, chopped\",\"olive oil\",\"ground cumin\",\"turmeric\",\"dried chili peppers, minced\",\"red beans (canned), rinsed and drained\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"white flour (all purpose)\",\"yogurt, plain, 2%\",\"pita breads\"]', 'https://media.soscuisine.com/images/recettes/471.jpg', 'https://www.soscuisine.com//recipe/vegetarian-burger', 'These burgers can be cooked either in a pan on the stovetop or using an outdoor grill.', '30 min', '310 kcal', '{\"calories\":\"310\",\"fat\":\"9 g\",\"cholesterol\":\"0 mg\",\"protein\":\"11 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Fibre, Folacin, Manganese, Niacin, Potassium, Selenium, Vitamin B1, Vitamin B2\",\"good_source_of\":\"Copper, Iron, Magnesium, Phosphorus, Vitamin E, Zinc\",\"source_of\":\"Calcium, Pantothenic Acid, Vitamin B12, Vitamin B6, Vitamin K\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:16:11'),
(374, 374, 1, 'Braised Duck Legs', 'Preheat the oven to 205°C/400°F. Put the duck legs, skin side down, in a skillet large enough to hold all the ingredients. Put the skillet on the stovetop then turn the heat to \'medium\'. the legs slowly and evenly (it will take about 20 min). \r\nSeason with salt and pepper to taste. Meanwhile, prepare the vegetables : Remove and discard about ¼ of the dark-green part of the leeks, then chop them coarsely; dice the carrots and celery; the garlic. When the legs are nicely browned, turn and the meat side for 1-2 min. Transfer the legs to a plate. Remove all but about one tablespoon of the fat. (Set the removed fat aside in a small container then put it the refrigerator for future use. Duck fat may be used to replace butter or oil in another recipe). Add the vegetables and garlic to the skillet. Season with salt and pepper, then add the Sauté the vegetables over medium-high heat with occasional stirring , until they start to become golden-coloured, about 10 min. Return the duck legs to the skillet, skin side up. Pour in the . It should come about halfway up the duck legs, but should not cover them. Bring the liquid to a boil, then put the skillet in the middle of \r\nthe oven. Cook 30 min, then lower the heat to 175°C/350°F. Continue to cook until the meat is tender and the liquid is reduced, an additional 30 min. Serve on the warmed plates.', '[\"duck legs\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"leeks\",\"carrots, diced\",\"celery, diced\",\"garlic, pressed\",\"herbes de Provence\",\"chicken broth\"]', 'https://media.soscuisine.com/images/recettes/1224.jpg', 'https://www.soscuisine.com//recipe/braised-duck-legs', 'Keep the serving plates warm on the stove while you\'re preparing the dish.', '90 min', '270 kcal', '{\"calories\":\"270\",\"fat\":\"9 g\",\"cholesterol\":\"70 mg\",\"protein\":\"21 g\"}', '{\"excellent_source_of\":\"Folacin, Iron, Magnesium, Manganese, Niacin, Potassium, Selenium, Vitamin A, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin K, Zinc\",\"good_source_of\":\"Copper, Fibre, Pantothenic Acid, Phosphorus, Vitamin B12, Vitamin C, Vitamin E\",\"source_of\":\"Calcium\",\"low\":\"Calories, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:16:12'),
(375, 375, 1, 'Vegetarian Chili with Tofu', 'Prepare the vegetables : Chop the onion, mince the garlic and chili pepper , finely dice the carrots, celery, and bell pepper. Heat the oil in a pan over medium heat. Sauté the onion and garlic about 2 min until the onion is translucent, with occasional stirring , paying attention not to let them burn. Add the carrots, celery, and bell pepper, then cook 4-5 min, with occasional stirring. Add the minced chili pepper , cumin and brown sugar, then cook 1 min, with stirring .\r\nFinely dice the tofu then add it to the mixture, then cook until golden-brown, about 8-10 min. Drain the beans, rinse them and drain again. Add them to the pan, mix well, add the diced tomatoes and enough water to provide a moist environment. Cover and cook over low heat an additional 10 min, until the carrots are tender. Add salt and pepper to taste. Sprinkle with freshly chopped cilantro leaves, grated cheddar and serve.', '[\"onions, finely chopped\",\"garlic, minced\",\"dried chili peppers, minced\",\"carrots, finely diced\",\"celery, finely diced\",\"green peppers, finely diced\",\"canola oil\",\"ground cumin\",\"brown sugar\",\"firm regular tofu, finely diced\",\"red beans (canned)\",\"canned tomatoes (diced)\",\"water approximately\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"fresh cilantro\",\"[optional]\",\"Cheddar cheese, grated\"]', 'https://media.soscuisine.com/images/recettes/526.jpg', 'https://www.soscuisine.com//recipe/vegetarian-chili-tofu', 'Keep the serving plates in the oven at the lowest setting so they are warm when you serve.', '50 min', '290 kcal', '{\"calories\":\"290\",\"fat\":\"15 g\",\"cholesterol\":\"10 mg\",\"protein\":\"16 g\"}', '{\"diet-related_health_claims\":\"Bone-healthy\",\"excellent_source_of\":\"Fibre, Folacin, Magnesium, Manganese, Potassium, Vitamin A, Vitamin K\",\"good_source_of\":\"Calcium, Copper, Iron, Niacin, Phosphorus, Selenium, Vitamin B6, Vitamin C, Vitamin E, Zinc\",\"source_of\":\"Omega-3, Omega-6, Pantothenic Acid, Vitamin B1, Vitamin B2\"}', '2021-06-18 14:16:12'),
(376, 376, 1, 'Vegetarian Chinese Fondue', 'Prepare the vegetables : detach the cabbage leaves, leaving them whole, and slice the other vegetables into thin strips. Place and arrange them nicely on a serving platter. If you do not like crunchy\r\nvegetables, you may blanch them a few minutes before placing them on the serving platter. Cut the tofu into 1,5 cm cubes and lay the cubes on the platter. Set aside. To prepare the dipping sauce, pour the lemon juice and soy sauce into a bowl. Grind or pound the sesame seeds and add them to the bowl. Set aside. Combine the water and in a\r\nsaucepan, bring the liquid to a boil, then transfer enough so that the fondue pot is approximately 2/3 to 3/4 full (how much you will need will depend on the size of the fondue pot). Draw about 3 tablespoons of per serving and add it to the dipping sauce bowl, mix well, then portion out the sauce into small individual serving bowls. Place the fondue pot on top of the burner in the centre of the table, and keep it simmering throughout the meal. Keep any remaining warm on the stovetop. To serve, each guest spears one of the tofu or vegetable pieces with a dipping fork, immerses it\r\nbriefly in the until cooked to their liking, then dips it into the sauce as desired. After the food is cooked, the rich is\r\ndistributed to whomever has enough room for it. As an option, one egg may be added to the . Cook 1-2 min with stirring , then ladle the into bowls.', '[\"Napa cabbage\",\"zucchini\",\"leeks\",\"soybean sprouts\",\"button (white) mushrooms\",\"firm regular tofu, cut into 1,5 cm cubes\",\"lemon juice, freshly squeezed\",\"soy sauce\",\"sesame seeds\",\"water, approximately\",\"vegetable broth, approximately\",\"eggs size large\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/476.jpg', 'https://www.soscuisine.com//recipe/vegetarian-chinese-fondue-vegetarian', 'A fondue pot and a burner are needed for this recipe. Each guest should have a dipping fork (colour-coded if possible) and a small plate or bowl for the cooked food.', '15 min', '450 kcal', '{\"calories\":\"450\",\"fat\":\"22 g\",\"cholesterol\":\"0 mg\",\"protein\":\"39 g\"}', '{\"excellent_source_of\":\"Calcium, Copper, Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin C, Vitamin K, Zinc\",\"source_of\":\"Vitamin B12, Vitamin E\",\"low\":\"Calories, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:16:13');
INSERT INTO `recipe_translation` (`rt_id`, `rt_recipe_id`, `rt_lang_id`, `rt_recipe_name`, `rt_recipe_text`, `rt_recipe_ingredients_full`, `rt_recipe_image`, `rt_recipe_link`, `rt_recipe_prep`, `rt_recipe_duration`, `rt_recipe_calories`, `rt_recipe_nutrients`, `rt_recipe_claims`, `rt_created`) VALUES
(377, 377, 1, 'Vegetarian Sausage with Lentils', 'Prepare the vegetables : Finely chop the garlic, onion(s), carrot(s), and celery stalk(s). Mince the chili pepper Heat the oil in a pan over medium heat. Add the vegetables and chili pepper, then sauté 2-3 min until they are slightly softened. in the lentils then cook 1 min. Pour in the and tomato paste. Bring to a boil, then cover and simmer until the lentils are cooked al dente , about 30 min. Stir occasionally and check that the lentils remain moist, adding some more broth or water if necessary. Season with salt and pepper to taste. Meanwhile, cook the sausages on a medium-hot grill until brown and crisp, about 2-3 min per side. Alternatively, sauté the sausages in a grooved grill-pan, then add them to the lentils. Cover then cook an additional 5 min. Sprinkle with the chopped parsley (optional) then serve.', '[\"garlic, finely chopped\",\"onions, finely chopped\",\"carrots, finely chopped\",\"celery, finely chopped\",\"dried chili peppers, minced\",\"olive oil\",\"green or brown lentils (dried)\",\"vegetable broth\",\"tomato paste\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"smoked vegetarian sausages\",\"Italian parsley, fresh, finely chopped\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/884.jpg', 'https://www.soscuisine.com//recipe/vegetarian-sausage-lentils-alcohol-free', 'in advance.', '45 min', '500 kcal', '{\"calories\":\"500\",\"fat\":\"13 g\",\"cholesterol\":\"0 mg\",\"protein\":\"40 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Copper, Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Potassium, Vitamin A, Vitamin B1, Vitamin B6, Zinc\",\"good_source_of\":\"Selenium, Vitamin B2, Vitamin K\",\"source_of\":\"Calcium, Vitamin C, Vitamin E\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:16:13'),
(378, 378, 1, 'Vegetarian Shepherd\'s Pie', 'Preheat the oven to 205°C/400°F. Prepare the vegetables : finely chop the onion; thinly slice the mushrooms; peel the potatoes, cut them in half then them 20-25 min until very tender. Drain them well and set aside. Cut the tofu into small dices. Heat the oil in a pan over medium-high heat. Add the chopped onion and sauté 3 min until translucent, then add the tofu dices and sauté 2-3 min, with stirring , until they are nicely coloured. in the diced tomatoes, mushrooms, tomato paste, Tabasco sauce . Add the frozen peas and continue cooking until heated through, about 4-5 min. Add salt and pepper. Remove the pan from the heat and tranfer the contents to a large baking dish, or distribute into individual baking dishes. Pour the milk into a large microwave-safe bowl. Add the butter and microwave on medium-high a few minutes, uncovered, until very hot. Add the cooked potatoes and mash until creamy. Add salt and pepper to taste. Place a spoonful of the potato mixture on top of the tofu mixture, then gently spread it with a spoon to cover evenly. Bake in the middle of the oven until the top is golden-brown, about 30 min. Serve.', '[\"potatoes\",\"onions, finely chopped\",\"button (white) mushrooms, thinly sliced\",\"olive oil\",\"firm regular tofu, cut into small dices\",\"canned tomatoes (diced)\",\"tomato paste\",\"Tabasco sauce\",\"vegetable broth\",\"frozen peas\",\"milk, partly skimmed, 2%\",\"butter, unsalted\",\"ground pepper to taste\",\"[optional]\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/742.jpg', 'https://www.soscuisine.com//recipe/vegetarian-shepherd-pie', 'For individual pies, choose baking dishes which contain about 375 ml or 1 ½ cups when 3/4 full.', '55 min', '350 kcal', '{\"calories\":\"350\",\"fat\":\"13 g\",\"cholesterol\":\"10 mg\",\"protein\":\"17 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Copper, Folacin, Magnesium, Manganese, Niacin, Potassium, Selenium, Vitamin A, Vitamin B6\",\"good_source_of\":\"Calcium, Fibre, Iron, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin B2, Vitamin C, Zinc\",\"source_of\":\"Vitamin B12, Vitamin D, Vitamin E, Vitamin K\",\"low\":\"Sodium\"}', '2021-06-18 14:16:14'),
(379, 379, 1, 'Vegetarian Sloppy Joe', 'Prepare the vegetables : Finely chop the onion and mince the garlic. Heat  the oil in a pan over medium heat. Add the onion then cook until it is translucent, about 3 min with occasional stirring , paying \r\nattention not to let it burn. Add salt, then reduce the heat, cover and cook until the onion is soft, about 5 min. Add the garlic and Cayenne pepper then cook with stirring until fragrant, 1 min. Add the mushrooms and tempeh. Cook 7-8 min, breaking up the tempeh with a wooden spoon. Season with ground pepper to taste, then add the tomato paste, ketchup, brown sugar, and water. A few drops of Tabasco sauce may be added for extra spiciness. Cover, then simmer 5 min. Adjust the seasoning . Spoon the mixture onto the hamburger buns then serve.', '[\"onions, finely chopped\",\"garlic, minced\",\"canola oil\",\"salt\",\"cayenne pepper\",\"button (white) mushrooms, chopped\",\"tempeh, chopped\",\"ground pepper to taste\",\"[optional]\",\"tomato paste\",\"ketchup\",\"brown sugar\",\"water\",\"Tabasco sauce\",\"[optional]\",\"hamburger buns\"]', 'https://media.soscuisine.com/images/recettes/3479.jpg', 'https://www.soscuisine.com//recipe/vegetarian-sloppy-joe', 'Tempeh can be found in the chilled section of health food stores. Most often it is a compact 8oz (240g) square patty.', '35 min', '480 kcal', '{\"calories\":\"480\",\"fat\":\"19 g\",\"cholesterol\":\"0 mg\",\"protein\":\"29 g\"}', '{\"excellent_source_of\":\"Copper, Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B1, Vitamin B2, Vitamin B6\",\"good_source_of\":\"Calcium, Vitamin E, Zinc\",\"source_of\":\"Omega-3, Omega-6, Pantothenic Acid, Vitamin B12, Vitamin C, Vitamin K\"}', '2021-06-18 14:16:15'),
(380, 380, 1, 'Vegetarian Sweet Potato Chili', 'Prepare the vegetables . Chop the onions, mince the garlic and finely dice the bell peppers and sweet potatoes. Heat half the oil in a pan over medium heat. Cook the onion and garlic about 3 min until the onion is soft and translucent, with occasional stirring , paying attention not to let them burn. Remove from pan and transfer to the slow cooker. Place the tofu, remaining oil and remaining ingredients, except the rice and beans, into the slow cooker . Cover the slow cooker with the lid and cook on \'low\' for 4 h. A few minutes before the end of cooking, start to cook the Drain the beans, rinse them and drain again. Add them to the slow cooker , mix well, and cook an additional 8-10 min. Add salt and pepper to taste. Serve the chili over the steamed rice.', '[\"garlic, minced\",\"yellow or red sweet peppers, cut into small dices\",\"onions, finely chopped\",\"sweet potatoes, diced\",\"frozen corn kernels\",\"canned tomatoes (diced)\",\"firm regular tofu, grated\",\"maple syrup\",\"olive oil\",\"cocoa powder\",\"chili powder\",\"ground cinnamon\",\"[optional]\",\"fresh thyme, chopped\",\"[optional]\",\"red beans (canned)\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"basmati rice\"]', 'https://media.soscuisine.com/images/recettes/3524.jpg', 'https://www.soscuisine.com//recipe/vegetarian-sweet-potato-chili', 'is needed to make this recipe.', '260 min', '580 kcal', '{\"calories\":\"580\",\"fat\":\"19 g\",\"cholesterol\":\"0 mg\",\"protein\":\"26 g\"}', '{\"excellent_source_of\":\"Copper, Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B1, Vitamin B6, Vitamin C, Vitamin E, Zinc\",\"good_source_of\":\"Calcium, Pantothenic Acid, Vitamin B2, Vitamin K\",\"low\":\"Calories, Saturated Fat, Sodium\",\"free\":\"Cholesterol, Trans Fat\"}', '2021-06-18 14:16:15'),
(381, 381, 1, 'Warm Octopus and Potatoes', 'Put the frozen octopus in a bowl, under running water to defrost it rapidly. Transfer it to a pot, add water to cover and a little salt. Turn the heat to medium, cover, and bring to a boil. Adjust the heat so that the liquid simmers slowly and cook until the octopus is tender, about 30 min per pound (1/2 kilo). Check with the sharp point of a thin-bladed knife; when it meets little resistance, the octopus is done. If using a pressure cooker the cooking time is reduced to 10 min per pound (1/2 kilo). Take the octopus off the pot then transfer it to a bowl with enough cooking liquid to cover. Let it cool down completely in the liquid. Transfer the octopus to a cutting board, discard the skin and cut the meat into bite-sized pieces. Set aside in its cooled down liquid. Meanwhile, add the potatoes to the cooking pot and cook until the potatoes are tender, about 10-20 min, depending on the size of the potato pieces. Portion out the octopus and potato pieces to the serving plates. Drizzle with the olive oil and lemon juice, add the Parsley and Garlic Base then season with salt and pepper to taste. gently then serve.', '[\"octopus, frozen, cleaned\",\"potatoes, peeled, then cut into slices or diced\",\"extra virgin olive oil\",\"lemon juice, freshly squeezed\",\"Parsley and Garlic Base\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2590.jpg', 'https://www.soscuisine.com//recipe/warm-octopus-potatoes', 'Keep the serving plates in the oven at the lowest setting so they are warm when you serve.', '70 min', '490 kcal', '{\"calories\":\"490\",\"fat\":\"23 g\",\"cholesterol\":\"100 mg\",\"protein\":\"33 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Copper, Iron, Magnesium, Niacin, Pantothenic Acid, Phosphorus, Potassium, Selenium, Vitamin B12, Vitamin B6, Vitamin E, Vitamin K, Zinc\",\"good_source_of\":\"Folacin, Vitamin B1, Vitamin C\",\"source_of\":\"Calcium, Fibre, Manganese, Vitamin A, Vitamin B2\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:16:16'),
(382, 382, 1, 'Warm Quinoa and Arugula Salad', 'Cook the quinoa in the water. Meanwhile, clean the arugula, chop the mint, then put them in a salad bowl. Pour the oil and lemon juice in a small bowl, add salt and pepper, then using a fork until the mixture is well emulsified. Add the quinoa to the salad bowl. Pour the vinaigrette over the salad then well. Add the Feta cheese, adjust the seasoning , then serve.', '[\"quinoa\",\"water\",\"extra virgin olive oil\",\"lemon\",\"arugula\",\"fresh mint, chopped\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"feta cheese, light, cut into small cubes\"]', 'https://media.soscuisine.com/images/recettes/1048.jpg', 'https://www.soscuisine.com//recipe/warm-quinoa-arugula-salad', 'You may serve this salad warm or at room temperature.', '25 min', '360 kcal', '{\"calories\":\"360\",\"fat\":\"18 g\",\"cholesterol\":\"20 mg\",\"protein\":\"14 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Iron, Magnesium, Manganese, Vitamin K\",\"good_source_of\":\"Calcium, Copper, Fibre, Folacin, Phosphorus, Potassium, Vitamin A, Vitamin E, Zinc\",\"source_of\":\"Niacin, Pantothenic Acid, Vitamin B1, Vitamin B2, Vitamin B6\"}', '2021-06-18 14:16:17'),
(383, 383, 1, 'West Indian Chicken', 'the garlic, grate the ginger and put them in a bowl. Pour in the lime juice, then add salt and pepper. Separate the chicken drumsticks from the thighs and put all the pieces in the bowl. Rub the chicken with the marinade , then cover and let stand in the refrigerator overnight. Prepare the vegetables : finely chop the onion and cut the peppers into strips; peel the potatoes, then cut them into 1,5 cm cubes. Heat the oil in a sautépan or over medium-high heat. Add the chicken pieces and sauté thoroughly on each side until golden-brown, about 8 min. Take the chicken pieces out of the pan and set them aside, keeping them warm on a plate in the oven. Lower the heat to medium, then add the onion and sauté 2-3 min, taking care not to let it burn. Add the peppers and cook 4-5 min until golden-brown. Mix the curry with a little bit of the coconut milk and add it to the pan. Cook 2 min over low heat with constant stirring Put the chicken back into the pan, then add the remaining coconut milk and enough water to make the mixture moist. Cook over medium heat, uncovered, for about 15 min. Add the potatoes and brown sugar, cover and cook an additional 45-50 min until the potatoes are soft. Garnish with cilantro leaves (optional) then serve.', '[\"garlic, pressed\",\"gingerroot, grated\",\"lime juice, freshly squeezed\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"chicken legs, with back, skinless\",\"onions, finely chopped\",\"green peppers, cut into strips\",\"potatoes, peeled and diced\",\"olive oil\",\"curry powder\",\"unsweetened coconut milk\",\"water, approximately\",\"brown sugar\",\"fresh cilantro\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/539.jpg', 'https://www.soscuisine.com//recipe/west-indian-chicken', 'overnight.', '80 min', '310 kcal', '{\"calories\":\"310\",\"fat\":\"18 g\",\"cholesterol\":\"50 mg\",\"protein\":\"18 g\"}', '{\"excellent_source_of\":\"Manganese, Niacin, Potassium, Vitamin B6, Vitamin C\",\"good_source_of\":\"Copper, Folacin, Iron, Magnesium, Pantothenic Acid, Phosphorus, Vitamin E, Zinc\",\"source_of\":\"Fibre, Selenium, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin K\",\"low\":\"Sodium\"}', '2021-06-18 14:16:17'),
(384, 384, 1, 'White Bean Soup with Rosemary', 'Prepare the onion and garlic . Coarsely chop the onion and mince the garlic. Heat the sautéing oil in a pot over low heat. the onion 2-3 min, then add the whole sprig(s) of rosemary and cook 10-15 min, with occasional stirring . Drain the , add them to the pot, then add the garlic and . Bring to a boil, then lower the heat, cover and cook 1 ½ h or longer, until the beans are soft. Alternatively, you may use a pressure cooker and reduce the cooking time from 1 ½ h to about 30 min. Remove the sprig(s) of rosemary and purée the soup using a food-mill (the texture will be much smoother than using a blender ). Put the soup back into the pot, warm it through, then season with salt and pepper to taste. If the soup is too thick, it may be thinned with some or water. Serve the soup into bowls and drizzle with the extra virgin olive oil.', '[\"onions, coarsely chopped\",\"garlic, minced\",\"olive oil, for saut\\u00c3\\u00a9ing\",\"rosemary, fresh, whole\",\"white beans (dried) great Northern, or navy beans\",\"chicken broth\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"extra virgin olive oil, when serving\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/849.jpg', 'https://www.soscuisine.com//recipe/white-bean-soup-rosemary', '', '110 min', '280 kcal', '{\"calories\":\"280\",\"fat\":\"3 g\",\"cholesterol\":\"0 mg\",\"protein\":\"16 g\"}', '{\"excellent_source_of\":\"Copper, Fibre, Folacin, Iron, Magnesium, Manganese, Phosphorus, Potassium, Vitamin B1\",\"good_source_of\":\"Niacin, Selenium, Vitamin B6, Zinc\",\"source_of\":\"Calcium, Pantothenic Acid, Vitamin B2, Vitamin C, Vitamin E, Vitamin K\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:16:17'),
(385, 385, 1, 'Zucchini \"Frittata\"', 'Prepare the zucchini . Slice them into rounds, 3-4 mm thick. Heat half of the olive oil in a frying pan. Add the Parsley and Garlic Base . Add the zucchini rounds and cook 5 min uncovered, stirring frequently. Add salt and pepper, cover, and cook over low heat about 7-8 additional min, or until the zucchini is soft, but still al dente . If zucchini are giving out liquid, it must be removed from the pan. Break 2 eggs directly into the pan, then stir, using a wooden spoon and cook 2 min over medium heat. Remove the pan from the heat. In a large bowl, lightly the remaining\r\neggs, using a fork. Add the zucchini mixture to the beaten eggs. Add the grated cheese and chopped marjoram .\r\nSeason with salt and pepper, then mix well. Heat the canola oil in a nonstick skillet over high heat. Add the mixture, distributing it evenly over the skillet. Gently lift the edges with a spatula and push them towards the centre. After 3-5 min, the bottom will be cooked to a nice crust. Lower the heat to medium-low and continue to cook until the edges get darker (about 15 more min). Gently shake the skillet occasionally to keep the frittata from sticking. When the frittata has reached a rather firm consistency, it\'s time to flip it. If this operation makes you nervous, the frittata may be simply finished under a broiler. Gently lift the edges with a spatula and cover the skillet with a large plate or flat lid. Leave the plate on the skillet 2 min, in order to trap some humidity underneath. This will help the\r\nflipping. Hold the skillet handle with one hand and its lid/plate with the other hand, then quickly turn the covered skillet upside-down so that the frittata ends up on the lid/plate. Put the skillet back on the stovetop, gently slide the frittata back in and cook over medium heat about 5 min. Slide the frittata onto a serving plate and enjoy!', '[\"olive oil\",\"Parsley and Garlic Base\",\"zucchini, sliced into 3-4 mm rounds\",\"eggs size large\",\"Parmesan cheese, grated\",\"marjoram, fresh\",\"canola oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/172.jpg', 'https://www.soscuisine.com//recipe/zucchini-frittata', '', '45 min', '180 kcal', '{\"calories\":\"180\",\"fat\":\"15 g\",\"cholesterol\":\"190 mg\",\"protein\":\"8 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Selenium, Vitamin A, Vitamin B12, Vitamin B2, Vitamin E, Vitamin K\",\"good_source_of\":\"Iron, Manganese, Pantothenic Acid, Potassium, Vitamin B6, Vitamin C\",\"source_of\":\"Calcium, Fibre, Magnesium, Niacin, Omega-3, Phosphorus, Vitamin B1, Vitamin D, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:16:18'),
(386, 386, 1, 'Zucchini Noodles with Shrimp and Broccoli', 'Prepare the vegetables : rinse the broccoli then cut to separate the florets from the stalks. Peel and discard any tough skin from the stalks then cut them into small pieces. Blanch and drain the broccoli, then set aside. Spiralize the zucchini and set aside. Heat the oil in a skillet over medium-high heat. Add the shrimp and cook, with some stirring , until the shrimp lose their gray colour and turn pink, 3-4 min. Set the shrimp aside on the plate with the broccoli. Add the zucchini to the skillet and cook for 2-3 min, until softened. Set aside with the broccoli and shrimp. Add the shallot to the skillet then cook over medium-low heat, until the shallot is translucent, 2-3 min. in the chili pepper and turmeric. Cook 1 min with stirring. Transfer the broccoli, zucchini noodles and shrimp back into the skillet. Heat through 2-3 min, with occasional stirring Sprinkle with the pine nuts, then season with salt and pepper to taste. Serve in the warmed dishes.', '[\"broccoli, cut into florets\",\"zucchini, spiralized\",\"olive oil\",\"shrimp, small\",\"shallots, coarsely chopped\",\"dried chili peppers, minced\",\"turmeric\",\"pine nuts\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/4118.jpg', 'https://www.soscuisine.com//recipe/shrimp-broccoli-zucchini-noodles', '', '30 min', '280 kcal', '{\"calories\":\"280\",\"fat\":\"20 g\",\"cholesterol\":\"110 mg\",\"protein\":\"15 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Iron, Magnesium, Manganese, Niacin, Potassium, Selenium, Vitamin A, Vitamin B12, Vitamin B6, Vitamin C, Vitamin E, Vitamin K\",\"good_source_of\":\"Vitamin B1, Vitamin B2, Zinc\",\"source_of\":\"Calcium, Copper, Fibre, Omega-3, Omega-6, Pantothenic Acid, Phosphorus\"}', '2021-06-18 14:16:18'),
(387, 387, 1, 'Alcohol-Free Tiramisu', 'Separate the egg whites from the yolks and put them in 2 separate bowls. Mix the yolks with the sugar in one bowl. in the Mascarpone cheese, one spoonful at a time, incorporating well. In the other bowl, the egg whites to form stiff peaks using an electric mixer . Then, add the beaten whites to the yolk-mascarpone mix, blending gently. The cream is ready. Set aside. Pour the coffee and the milk into a small dish, then lightly dip the biscuits. Place them in the individual small serving bowls or cups (about 250 ml). Cover the biscuits with the cream. Sprinkle the cocoa powder on top. Refrigerate for at least one hour. Leave overnight in the refrigerator for best results. Serve cold.', '[\"Mascarpone cheese\",\"eggs size large\",\"sugar\",\"savoiardi\\/ladyfingers\",\"coffee (liquid)\",\"milk, partly skimmed, 2%\",\"cocoa powder\"]', 'https://media.soscuisine.com/images/recettes/397.jpg', 'https://www.soscuisine.com//recipe/alcohol-free-tiramisu-alcohol-free', '', '15 min', '240 kcal', '{\"calories\":\"240\",\"fat\":\"18 g\",\"cholesterol\":\"210 mg\",\"protein\":\"8 g\"}', '{\"good_source_of\":\"Phosphorus, Selenium, Vitamin A, Vitamin B12\",\"source_of\":\"Calcium, Folacin, Iron, Niacin, Pantothenic Acid, Vitamin B1, Vitamin B2, Vitamin D, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:16:19'),
(388, 388, 1, 'Breaded Fish Fillets', 'Pat-dry the fish fillets then cut each fillet into 2 pieces lengthwise (since the fillet is uneven in thickness, this operation ensures uniform cooking). \r\nSeason with salt and pepper. Prepare 3 shallow dishes: one for the flour, one for the egg, and one for the bread crumbs. the egg lightly. Dip one fish piece at the time, first in the flour, then in the egg. Let the excess egg drip off before coating the fish in the bread crumbs. Turn the fish to coat both sides with bread crumbs. Heat the oil in a skillet over medium heat. Sauté the fish 3-5 min on each side, until the bread crumb coating becomes golden-coloured. Add salt and pepper to taste. Serve on the warmed plates with optional lemon quarters on the side.', '[\"tilapia fillets, cut into 2 pieces lengthwise\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"white flour (all purpose)\",\"eggs size large\",\"bread crumbs\",\"olive oil\",\"lemons, cut into quarters\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1051.jpg', 'https://www.soscuisine.com//recipe/breaded-fish-fillets', '', '20 min', '320 kcal', '{\"calories\":\"320\",\"fat\":\"12 g\",\"cholesterol\":\"180 mg\",\"protein\":\"42 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Niacin, Phosphorus, Potassium, Selenium, Vitamin B12\",\"good_source_of\":\"Folacin, Magnesium, Pantothenic Acid, Vitamin B1, Vitamin B2, Vitamin E\",\"source_of\":\"Copper, Iron, Manganese, Vitamin B6, Vitamin D, Vitamin K, Zinc\"}', '2021-06-18 14:16:19'),
(389, 389, 1, 'Allergy-Friendly Gingerbread', 'Preheat the oven to 175°C/350°F. Spray a 9x9 inch baking dish with a vegetable oil spray.   Prepare the Egg Replacer , then set aside.   In a large bowl, combine the oil and syrup using a for about 2 min until thoroughly blended. Add the Egg Replacer , about 1/3 cup at a time beating well after each addition. Add the vanilla then set aside.   Sift together the dry ingredients (except the nuts) in a second bowl. Add some of the dry ingredients to the bowl with the wet ingredients, a little at a time, blending well. Alternate with the Unsweetened Applesauce , about 1/4 cup at a time, blending well after each addition.  Fold in the nuts at the end of the process using a spatula.   Transfer the batter to the prepared baking dish and bake in the middle of the oven for about 35 min, or until the gingerbread is done. Check for doneness with a toothpick or knife to see if the gingerbread is cooked through. Pull the baking dish out of the oven and let stand at least 15 min before removing the gingerbread from the dish. After removing the gingerbread, let it cool on a wire rack at least an additional 30 min before serving.', '[\"vegetable oil spray\",\"Egg Replacer\",\"canola oil\",\"maple syrup\",\"vanilla extract\",\"brown rice flour\",\"salt\",\"baking soda\",\"cream of tartar\",\"arrowroot\",\"ground ginger\",\"ground cinnamon\",\"nutmeg, grated\",\"allspice powder\",\"Unsweetened Applesauce\",\"walnuts, chopped\"]', 'https://media.soscuisine.com/images/recettes/1957.jpg', 'https://www.soscuisine.com//recipe/allergen-free-gingerbread', '', '50 min', '270 kcal', '{\"calories\":\"270\",\"fat\":\"12 g\",\"cholesterol\":\"0 mg\",\"protein\":\"3 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Manganese\",\"good_source_of\":\"Magnesium, Vitamin B2\",\"source_of\":\"Copper, Fibre, Folacin, Iron, Niacin, Omega-3, Omega-6, Pantothenic Acid, Phosphorus, Potassium, Vitamin B1, Vitamin B6, Vitamin E, Vitamin K, Zinc\",\"low\":\"Saturated Fat\",\"free\":\"Cholesterol, Trans Fat\"}', '2021-06-18 14:16:20'),
(390, 390, 1, 'Almond and Chocolate Cookies', 'Preheat the oven to 175°C/350°F. Line two baking sheets with parchment\r\npaper In a large bowl, mix the almond flour, salt and baking soda. Set aside. In another bowl, mix the oil, maple syrup and vanilla. Add the dry mix into the liquid one. Mix well. Incorporate the chocolate chips and slivered almonds. Form cookie balls with about 1 tbsp of the dough and set them on the baking sheets. Press lightly on each ball to flatten it. Bake the cookies in the middle of the oven until they turn light brown around the edges, about 8-10 min. Let the cookies cool on the sheet for 20 min.', '[\"almond meal\",\"salt\",\"baking soda\",\"canola oil\",\"maple syrup\",\"vanilla extract\",\"bittersweet chocolate chips\",\"flaked almonds\"]', 'https://media.soscuisine.com/images/recettes/4102.jpg', 'https://www.soscuisine.com//recipe/almond-chocolate-cookies', 'This recipe makes about 24 cookies, on two baking sheets of standard dimension.', '20 min', '90 kcal', '{\"calories\":\"90\",\"fat\":\"7 g\",\"cholesterol\":\"0 mg\",\"protein\":\"2 g\"}', '{\"excellent_source_of\":\"Vitamin E\",\"source_of\":\"Copper, Magnesium, Manganese, Omega-3, Omega-6, Vitamin B2\",\"low\":\"Sodium\"}', '2021-06-18 14:16:20'),
(391, 391, 1, 'Almond-Chocolate Cake', 'Preheat the oven to 175°C/350°F. Butter a springform cake pan, then put the pan on a baking sheet. Melt the butter and chocolate in the upper part of a bain-marie . When the mixture is melted, in the coffee. Set aside. Meanwhile, in a large bowl, the sugar with the eggs using a , about 5 min until the mixture is light and creamy. Fold in the ground almonds and the baking powder using a spatula. Incorporate the chocolate mixture into the almond preparation, then transfer the mixture to the prepared pan. Put the pan (on the baking sheet) in the middle of the oven. Bake for about 30-40 min. Check the cake with a toothpick or knife to see if it is cooked through. When done, pull the cake out of the oven and let it cool down . When the cake is cool, transfer it to a serving dish. Dust the top of the cake with the confectioner\'s sugar then serve.', '[\"butter, unsalted\",\"unsweetened (dark) chocolate, in small pieces\",\"coffee (liquid), strong or expresso, lukewarm\",\"sugar\",\"eggs size large\",\"almonds, skin on, ground\",\"baking powder\",\"icing\\/confectioners\' sugar\"]', 'https://media.soscuisine.com/images/recettes/1986.jpg', 'https://www.soscuisine.com//recipe/almond-chocolate-cake', '', '50 min', '330 kcal', '{\"calories\":\"330\",\"fat\":\"24 g\",\"cholesterol\":\"90 mg\",\"protein\":\"7 g\"}', '{\"excellent_source_of\":\"Vitamin E\",\"good_source_of\":\"Magnesium, Manganese\",\"source_of\":\"Calcium, Copper, Fibre, Folacin, Iron, Niacin, Omega-6, Pantothenic Acid, Phosphorus, Selenium, Vitamin A, Vitamin B12, Vitamin B2, Vitamin D, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:16:21'),
(392, 392, 1, 'Apple Brown Betty', 'Preheat the oven to 175°C/350°F. Lightly butter a 9 in (23 cm) pie dish. Peel and slice the apples then with lemon juice and 2 tablespoons of brown sugar. Place them in the bottom of the buttered pie dish. Set aside. In the bowl of a food processor , process bread until coarse crumbs form, about 15 sec. Transfer the bread crumbs to a bowl. in the remaining brown sugar, cinnamon, nutmeg, salt and butter. Combine well then scatter the crumb mixture on top of the apples. Cover the dish with aluminum foil and bake in the middle of the oven for 30 min. Remove foil and allow to continue cooking until the topping is crisp and lightly brown, and the apples are tender, about 10 additional minutes. Serve warm or cold.', '[\"butter, unsalted, melted\",\"apples, green, Granny Smith type, peeled, seeded and cut into segments\",\"lemonjuice, freshly squeezed\",\"brown sugar\",\"bread, whole wheat, stale, with the crust\",\"ground cinnamon\",\"nutmeg\",\"salt\",\"aluminum foil\"]', 'https://media.soscuisine.com/images/recettes/4401.jpg', 'https://www.soscuisine.com//recipe/apple-brown-betty', 'will be very useful for this recipe.', '55 min', '240 kcal', '{\"calories\":\"240\",\"fat\":\"9 g\",\"cholesterol\":\"20 mg\",\"protein\":\"2 g\"}', '{\"excellent_source_of\":\"Manganese\",\"source_of\":\"Copper, Fibre, Iron, Magnesium, Niacin, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B1, Vitamin C, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:16:21'),
(393, 393, 1, 'Apple Compote', 'Cut the apples into quarters without peeling them. Put them in a saucepan. Pour about 1-2 cm of water in the bottom of the saucepan and add sugar (optional). Cover and cook over low heat about 10 min, until the apples are\r\nsoftened completely. Purée the apples using a food mill . Let the purée cool down and serve cold or at room temperature.', '[\"apples\",\"water, approximately\",\"sugar\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/353.jpg', 'https://www.soscuisine.com//recipe/apple-compote', 'will be very useful to purée the apples, without having to peel them first.', '20 min', '100 kcal', '{\"calories\":\"100\",\"fat\":\"0 g\",\"cholesterol\":\"0 mg\",\"protein\":\"1 g\"}', '{\"source_of\":\"Fibre, Potassium, Vitamin C, Vitamin K\",\"free\":\"Cholesterol, Fat, Saturated Fat, Sodium, Trans Fat\"}', '2021-06-18 14:16:22'),
(394, 394, 1, 'Apple Fritters', 'Preheat the oil to 175°C/350°F. Put the sesame seeds in a small pan and heat over medium heat a few minutes, with some stirring , until lightly coloured. Set aside. In a bowl, the eggs and water, then incorporate the cornstarch. Peel and core the apples, then cut each into 8 wedges. To reduce the discolouration of the cut parts, sprinkle them all with lemon juice. Dip each wedge in the batter and deep fry 2 min until golden-brown, then set it on a paper towel to drain. Do only a few wedges at a time. To make the sauce, bring the sugar and honey to a boil in a small saucepan. Remove from the heat as soon as the sugar is dissolved, then in the sesame seeds. Drench the fritters with the sauce and serve them hot.', '[\"peanut oil\",\"eggs size large\",\"water\",\"cornstarch\",\"apples, peeled, then cut into wedges\",\"lemon juice, freshly squeezed\",\"sugar\",\"honey\",\"sesame seeds\"]', 'https://media.soscuisine.com/images/recettes/268.jpg', 'https://www.soscuisine.com//recipe/apple-fritters', 'pan will be needed for this recipe.', '25 min', '500 kcal', '{\"calories\":\"500\",\"fat\":\"17 g\",\"cholesterol\":\"100 mg\",\"protein\":\"4 g\"}', '{\"excellent_source_of\":\"Vitamin E\",\"good_source_of\":\"Selenium, Vitamin B12\",\"source_of\":\"Copper, Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Potassium, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin C, Vitamin D, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:16:22'),
(395, 395, 1, 'Apple Muffins', 'Preheat the oven to 400°F (200°C). Combine the flours, guar gum or xanthan, baking powder, cinnamon and salt. Mix the eggs, milk, oil, apple sauce, vanilla and grated apples in a bowl and pour over the dry ingredients. Mix the batter just until blended. Fill the muffin pan, bake in the oven for 25 to 30 minutes. Remove from pan and serve hot.', '[\"brown rice flour\",\"millet flour\",\"almond meal\",\"tapioca flour\\/starch\",\"guar gum, or xanthan\",\"baking powder\",\"ground cinnamon\",\"salt\",\"eggs size large, beaten\",\"almond beverage, unsweetened, fortified, rice, or  soy\",\"olive oil\",\"Unsweetened Applesauce\",\"vanilla extract\",\"apples, grated\"]', 'https://media.soscuisine.com/images/recettes/2311.jpg', 'https://www.soscuisine.com//recipe/apple-muffins-hypotoxic', '', '45 min', '260 kcal', '{\"calories\":\"260\",\"fat\":\"17 g\",\"cholesterol\":\"30 mg\",\"protein\":\"4 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Manganese, Vitamin D, Vitamin E\",\"good_source_of\":\"Magnesium, Phosphorus\",\"source_of\":\"Calcium, Copper, Fibre, Folacin, Iron, Niacin, Pantothenic Acid, Selenium, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin K, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:16:23'),
(396, 396, 1, 'Apricot Mousse', 'Pit the apricots, cut them into chunks then transfer them to a blender . Add the sugar and the lemon juice, then process one minute. Add the cheese then continue to process until a smooth consistency is obtained. Portion out the mixture into small glasses or cups and chill them for at least 2 hours or overnight. Garnish with some apricot slices and mint leaves (optional) then serve.', '[\"apricots, ripe\",\"icing\\/confectioners\' sugar\",\"lemonjuice, freshly squeezed\",\"quark\\/curd cheese, or cream cheese\",\"fresh mint\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/4354.jpg', 'https://www.soscuisine.com//recipe/apricot-mousse', 'will be very useful for this recipe.', '15 min', '70 kcal', '{\"calories\":\"70\",\"fat\":\"2 g\",\"cholesterol\":\"10 mg\",\"protein\":\"3 g\"}', '{\"source_of\":\"Vitamin A\",\"low\":\"Cholesterol, Saturated Fat, Sodium\",\"free\":\"Trans Fat\"}', '2021-06-18 14:16:23'),
(397, 397, 1, 'Asian Broccoli SautÃÂ©', 'Blanch the broccoli 3-4 min. Heat the over medium heat. Pour in the oil, oyster sauce, black bean sauce, sugar, pressed garlic, grated ginger and . Cook 3 min with stirring In a small cup, mix the cornflour with water. Add to the . Add the broccoli. Cook 3 min with stirring so that the broccoli is coated well with the sauce. Serve warm.', '[\"broccoli, cut into florets\",\"chicken broth\",\"oyster sauce\",\"black bean garlic sauce\",\"garlic, pressed\",\"gingerroot, grated\",\"sugar\",\"canola oil\",\"water\",\"cornstarch\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/123.jpg', 'https://www.soscuisine.com//recipe/asian-broccoli-saute', 'or frying pan.', '20 min', '130 kcal', '{\"calories\":\"130\",\"fat\":\"6 g\",\"cholesterol\":\"0 mg\",\"protein\":\"5 g\"}', '{\"excellent_source_of\":\"Folacin, Vitamin C, Vitamin K\",\"good_source_of\":\"Manganese, Potassium, Vitamin A, Vitamin E\",\"source_of\":\"Calcium, Copper, Fibre, Iron, Magnesium, Niacin, Pantothenic Acid, Phosphorus, Selenium, Vitamin B1, Vitamin B2, Vitamin B6, Zinc\",\"low\":\"Saturated Fat\",\"free\":\"Cholesterol, Trans Fat\"}', '2021-06-18 14:16:24'),
(398, 398, 1, 'Asparagus and Carrot Vinaigrette', 'Prepare the asparagus blanch them about 10 min in a pot of boiling salted water. Make sure you cook them al dente. Take the asparagus out of the pot using tongs or a slotted spoon because the spears are too delicate to be drained directly in a colander .\r\nRinse the asparagus in cold water to stop the cooking and fix the colour. Let them cool down 10 min or so, then distribute them onto the individual serving plates. Prepare the carrots : peel and grate, then place them on the plates next to the asparagus. In a small bowl, add the oil, lemon juice, salt and pepper. well, using a fork, until the vinaigrette is emulsified. Press\r\nthe garlic and add it to the bowl and mix. Pour the vinaigrette over the vegetables and\r\nserve.', '[\"asparagus, average size\",\"carrots, grated\",\"extra virgin olive oil\",\"lemon juice, freshly squeezed\",\"garlic, pressed\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/425.jpg', 'https://www.soscuisine.com//recipe/asparagus-carrot-vinaigrette', '', '20 min', '170 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Folacin, Vitamin A, Vitamin E, Vitamin K\",\"good_source_of\":\"Potassium, Vitamin B1\",\"source_of\":\"Copper, Fibre, Iron, Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Selenium, Vitamin B2, Vitamin B6, Vitamin C, Zinc\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:16:24'),
(399, 399, 1, 'Asparagus and Tomato Vinaigrette', 'Prepare the asparagus blanch them about 10 min in a pot of boiling salted water. Make sure you cook them al dente. Take the asparagus out of the pot using tongs or a slotted spoon because the spears are too delicate to be drained directly in a colander .\r\nRinse the asparagus in cold water to stop the cooking and fix the colour. Let them cool down 10 min or so, then distribute them onto the individual serving plates. Prepare the tomatoes : cut them, then place them on the plates next to the asparagus. In a small bowl, add the oil, lemon juice, salt and pepper. well, using a fork, until the vinaigrette is emulsified. Press\r\nthe garlic and add it to the bowl and mix. Pour the vinaigrette over the vegetables and\r\nserve.', '[\"asparagus, average size\",\"tomatoes, sliced\",\"extra virgin olive oil\",\"lemon juice, freshly squeezed\",\"garlic, pressed\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/424.jpg', 'https://www.soscuisine.com//recipe/asparagus-tomato-vinaigrette', '', '20 min', '160 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Folacin, Vitamin A, Vitamin E, Vitamin K\",\"good_source_of\":\"Potassium, Vitamin B1, Vitamin C\",\"source_of\":\"Copper, Fibre, Iron, Magnesium, Manganese, Niacin, Phosphorus, Selenium, Vitamin B2, Vitamin B6, Zinc\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:16:25'),
(400, 400, 1, 'Asparagus Milanese', 'Preheat the oven to 230ºC/450ºF. Prepare the asparagus . Lay the asparagus on an oiled baking tray. Coat thoroughly with oil, then add salt. Cook until the asparagus change colour, about 8-10 min, depending on their size. Shake the tray a couple times during cooking, so that the asparagus will grill evenly. Arrange on the warmed\r\nplates and keep warm. While the asparagus are in the oven, heat the butter in a skillet over medium heat. Crack the eggs into the skillet, taking care to keep the yolks intact. Cook them sunny-side up about 4-5 min until the whites are firm but the yolks are still runny. Add salt and pepper before carefully sliding one egg on top of each asparagus serving. Grate the Parmesan cheese over each plate and serve.', '[\"asparagus, average size\",\"eggs size large\",\"olive oil\",\"butter, unsalted\",\"Parmesan cheese, grated\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/148.jpg', 'https://www.soscuisine.com//recipe/asparagus-milanese', 'Keep the serving plates warm on the stove while you\'re preparing the dish.', '25 min', '240 kcal', '{\"calories\":\"240\",\"fat\":\"19 g\",\"cholesterol\":\"220 mg\",\"protein\":\"11 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Iron, Selenium, Vitamin A, Vitamin B12, Vitamin B2, Vitamin E, Vitamin K\",\"good_source_of\":\"Copper, Niacin, Pantothenic Acid, Phosphorus, Potassium, Vitamin B1, Vitamin D, Zinc\",\"source_of\":\"Calcium, Fibre, Magnesium, Manganese, Vitamin B6, Vitamin C\",\"low\":\"Sodium\"}', '2021-06-18 14:16:26'),
(401, 401, 1, 'Avocado and Green Tea Smoothie', 'Make the green tea Place the avocado, baby spinach, tahini, turmeric, hemp seeds, salt and pepper in a food processor blender . Add the oil and green tea infusion. Process on the highest speed until a well-blended purée forms, about 15 seconds, stopping to scrape down the sides of the container once or twice. Taste the mixture, adjust seasoning, if necessary. Serve.', '[\"avocados\",\"avocado oil\",\"baby spinach\",\"Cup of green tea\",\"Tahini paste\",\"turmeric\",\"hemp seeds\",\"salt\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2744.jpg', 'https://www.soscuisine.com//recipe/avocado-green-tea-smoothie', 'will be very useful for this recipe.', '10 min', '360 kcal', '{\"calories\":\"360\",\"fat\":\"34 g\",\"cholesterol\":\"0 mg\",\"protein\":\"8 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Copper, Fibre, Folacin, Iron, Magnesium, Manganese, Phosphorus, Potassium, Vitamin B1, Vitamin B2, Vitamin E, Vitamin K, Zinc\",\"good_source_of\":\"Niacin, Vitamin A, Vitamin B6\",\"source_of\":\"Calcium, Omega-6, Pantothenic Acid, Vitamin C\",\"low\":\"Sodium\"}', '2021-06-18 14:16:27'),
(402, 402, 1, 'Avocado Chocolate Mousse', 'Coarsely chop the chocolate then put the pieces in the upper part of a bain-marie . Let the chocolate melt. Alternatively put the chocolate pieces in a microwave-safe bowl. Microwave in 15-second bursts, stirring between each and watching carefully so that the chocolate does not burn. When it is almost completely melted, remove it from the stove top or the microwave and until smooth. Set aside and let cool until just barely warm. Cut the avocados in half, twist out the pit and spoon out the flesh into a blender . Add the melted chocolate, cocoa powder, almond milk, maple syrup, and one pinch of salt. Blend until very smooth and creamy, stopping to scrape down the bowl as needed. Pour the mixture into individual bowls. Chill the mousse in the refrigerator for about 1 h or overnight. You may throw some berries or chocolate shavings on top, if you like, then serve.', '[\"unsweetened (dark) chocolate\",\"avocados, ripe, maturi\",\"cocoa powder\",\"almond beverage, unsweetened, fortified\",\"maple syrup\",\"salt\"]', 'https://media.soscuisine.com/images/recettes/4410.jpg', 'https://www.soscuisine.com//recipe/avocado-chocolate-mouss', 'will be very useful to make this recipe.', '20 min', '270 kcal', '{\"calories\":\"270\",\"fat\":\"17 g\",\"cholesterol\":\"0 mg\",\"protein\":\"4 g\"}', '{\"excellent_source_of\":\"Fibre, Vitamin D\",\"good_source_of\":\"Folacin, Iron, Magnesium, Manganese, Potassium, Vitamin B2, Vitamin K\",\"source_of\":\"Calcium, Copper, Niacin, Pantothenic Acid, Phosphorus, Vitamin B6, Vitamin C, Vitamin E, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:16:28'),
(403, 403, 1, 'Brined Salmon with Maple Syrup', 'Pour the water and salt in a bowl or shallow mould, then mix well until the salt is dissolved. Lightly crush the peppercorns then add them to the brine. Add the grated zest and maple syrup. Remove and discard the skin of the salmon, then put the salmon in the brine. Cover the salmon completely with the brine (Depending on the size of the bowl, it may be necessary to add some additional brine to cover the salmon: you will need 1 tablespoon of salt for every cup of water). Cover and chill in the refrigerator for at least 4 h (maximum overnight). Take the salmon out of the brine, pat it dry using paper towels, then cut it into serving size pieces. Discard the brine. Heat the oil in a nonstick pan over medium heat. the salmon, 2 min per side, until a light gold crust is formed. Lower the heat to \'low\' and cook an additional 4-5 min. Check with a fork to see if the fish is cooked through . Serve on the warmed plates.', '[\"water\",\"coarse salt\",\"peppercorns\",\"lemon zest, finely grated\",\"maple syrup\",\"salmon fillet\",\"olive oil\"]', 'https://media.soscuisine.com/images/recettes/997.jpg', 'https://www.soscuisine.com//recipe/brined-salmon-maple-syrup', '', '20 min', '210 kcal', '{\"calories\":\"210\",\"fat\":\"9 g\",\"cholesterol\":\"110 mg\",\"protein\":\"30 g\"}', '{\"excellent_source_of\":\"Niacin, Phosphorus, Potassium, Selenium, Vitamin B12, Vitamin B6, Vitamin D\",\"good_source_of\":\"Vitamin B2, Vitamin E\",\"source_of\":\"Iron, Magnesium, Omega-3, Pantothenic Acid, Vitamin B1, Zinc\",\"low\":\"Saturated Fat\",\"free\":\"Sugar, Trans Fat\"}', '2021-06-18 14:16:29'),
(405, 405, 1, 'Baked Jicama Fries', 'Preheat the oven to 220°C/425°F. Line a large baking sheet with parchment\r\npaper Peel the jicama, then cut it into 1x8 cm pieces. It is important to cut it into pieces of similar size so that they will all cook evenly and be done at the same time. Place the pieces in a microwave-safe bowl with water. Microwave for 6 min. Alternatively, you can pour boiling hot water over the pieces and let set for 10 min. Drain. In a large bowl, mix the oil, lemon juice, spices, oregano, salt, and pepper. Add the jicama pieces and coat them well with the mixture. Transfer them to the prepared baking sheet. Don\'t crowd the pieces on the sheet or they will steam and not turn golden-brown. Bake in the middle of the oven for 25-30 min, or until they begin to turn golden brown, tossing halfway through. Serve with your choice of mayo, ketchup, salsa or dip.', '[\"jicama\",\"lemonjuice, freshly squeezed\",\"olive oil\",\"ground cumin\",\"cayenne pepper\",\"dried oregano\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"parchment paper, for the sheet\"]', 'https://media.soscuisine.com/images/recettes/4364.jpg', 'https://www.soscuisine.com//recipe/baked-jicama-fries', '', '40 min', '120 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Fibre, Vitamin C\",\"good_source_of\":\"Iron\",\"source_of\":\"Magnesium, Potassium, Vitamin E, Vitamin K\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:16:30'),
(406, 406, 1, 'Baked Sweet Potatoes with Rosemary', 'Preheat the oven to 190ºC/375ºF. Peel and coarsely dice the sweet potatoes (1,5 cm). Mince the garlic. Place the potatoes with garlic on a generously oiled baking sheet. Turn them to coat thoroughly with oil. Add the rosemary leaves and the pine nuts (optional). Add salt and pepper. Bake for 25-30 min, turning the potatoes occasionally, until they are soft. Serve.', '[\"sweet potatoes, diced into 1,5 cm pieces\",\"garlic, minced\",\"olive oil\",\"rosemary, fresh\",\"pine nuts\",\"[optional]\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/195.jpg', 'https://www.soscuisine.com//recipe/baked-sweet-potatoes-rosemary', '', '30 min', '160 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Manganese, Potassium, Vitamin A\",\"good_source_of\":\"Fibre, Pantothenic Acid, Vitamin B6, Vitamin C, Vitamin E\",\"source_of\":\"Calcium, Copper, Iron, Magnesium, Niacin, Phosphorus, Vitamin B1, Vitamin B2, Vitamin K\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:16:31'),
(407, 407, 1, 'Bulgur Veggie Burgers', 'Put the bulgur in a saucepan with the water and a pinch of salt. Bring to a rolling boil. Reduce the heat, cover, then simmer about 5 min, until the bulgur has swelled and all the water is absorbed. Add a little more water if it looks too dry.\r\n  Drain if there is too much water. Put the bulgur in a blender together with the soy sauce, onion, garlic, beans, nuts, cilantro, and spices. Pulse until finely chopped, then season to taste. Form the mixture into 9 cm (3.5 in) patties. Chill at least 10 min (up to 4 h). Meanwhile, together the mayonnaise, mustard, lemon juice and yogurt. Set aside. Heat the oil in a skillet over medium heat. Add the patties and cook until golden-brown, about 8 min total, turning them once gently (they are not quite as firm as meat burgers). Serve each patty on a toast with the sauce.', '[\"bulghur\",\"water\",\"soy sauce\",\"onions, coarsely chopped\",\"garlic, coarsely chopped\",\"red beans (canned) ,rinsed and drained\",\"walnuts\",\"fresh cilantro, coarsely chopped\",\"ground cumin\",\"cayenne pepper\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"mayonnaise\",\"Dijon mustard\",\"lemon juice, freshly squeezed\",\"yogurt, plain, 2%\",\"canola oil\",\"bread, whole wheat, toasted\"]', 'https://media.soscuisine.com/images/recettes/2525.jpg', 'https://www.soscuisine.com//recipe/bulgur-veggie-burgers', 'will be very useful to make the patties.', '35 min', '380 kcal', '{\"calories\":\"380\",\"fat\":\"20 g\",\"cholesterol\":\"0 mg\",\"protein\":\"12 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Fibre, Folacin, Magnesium, Manganese, Selenium, Vitamin K\",\"good_source_of\":\"Copper, Iron, Niacin, Phosphorus, Potassium, Vitamin B1, Vitamin B6, Zinc\",\"source_of\":\"Calcium, Omega-3, Omega-6, Pantothenic Acid, Vitamin A, Vitamin B12, Vitamin B2, Vitamin C, Vitamin E\"}', '2021-06-18 14:16:32');
INSERT INTO `recipe_translation` (`rt_id`, `rt_recipe_id`, `rt_lang_id`, `rt_recipe_name`, `rt_recipe_text`, `rt_recipe_ingredients_full`, `rt_recipe_image`, `rt_recipe_link`, `rt_recipe_prep`, `rt_recipe_duration`, `rt_recipe_calories`, `rt_recipe_nutrients`, `rt_recipe_claims`, `rt_created`) VALUES
(409, 409, 1, 'Balsamic-Marinated Tempeh', 'Cut each 8oz (240g) tempeh block into 4 squares, then cut each square into 2 triangles. Combine the soy sauce, balsamic vinegar, and garlic in a bowl. Place the tempeh into the bowl then let marinate for about 30 min, turning the pieces once to cover them well. Make sure that both sides of the tempeh are covered with the marinade. Heat oil in a pan over medium-high heat. Add the tempeh pieces and sauté until golden-brown, about 5 min. Serve.', '[\"tempeh\",\"soy sauce\",\"balsamic vinegar\",\"garlic, finely chopped\",\"olive oil\"]', 'https://media.soscuisine.com/images/recettes/3619.jpg', 'https://www.soscuisine.com//recipe/balsamic-marinated-tempeh', 'Tempeh can be found in the chilled section of health food stores. Most often it is a compact 8oz (240g) square patty. It must be defrosted in the refrigerator a few hours before it can be used in the recipe.', '10 min', '270 kcal', '{\"calories\":\"270\",\"fat\":\"16 g\",\"cholesterol\":\"0 mg\",\"protein\":\"23 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Copper, Fibre, Magnesium, Manganese, Niacin, Phosphorus, Vitamin B2\",\"good_source_of\":\"Iron, Potassium, Vitamin B6, Zinc\",\"source_of\":\"Calcium, Folacin, Omega-6, Pantothenic Acid, Vitamin B1\"}', '2021-06-18 14:16:33'),
(410, 410, 1, 'Banana Colada', 'Put the lime juice and some of the coconut milk in a blender . Add some of the banana slices. Mix at maximum speed, then stop the blender and scrape the ingredients down. Add more coconut milk and banana slices, then blend without over-mixing. If blending goes on too long the mixture will get runny and warm rather then creamy and cool. Add the grated coconut at the end and run the blender 5 seconds. Pour the mixture into individual bowls. Chill them in the refrigerator for about 1 h before serving.', '[\"unsweetened coconut milk\",\"lime juice, freshly squeezed\",\"bananas, small, sliced into 1 cm rounds\",\"grated coconut\"]', 'https://media.soscuisine.com/images/recettes/1977.jpg', 'https://www.soscuisine.com//recipe/banana-colada', 'will be very useful for this recipe.', '15 min', '320 kcal', '{\"calories\":\"320\",\"fat\":\"24 g\",\"cholesterol\":\"0 mg\",\"protein\":\"3 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Magnesium, Manganese, Potassium\",\"good_source_of\":\"Copper, Fibre, Vitamin B6\",\"source_of\":\"Folacin, Iron, Niacin, Pantothenic Acid, Phosphorus, Selenium, Vitamin B2, Vitamin C, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:16:34'),
(411, 411, 1, 'Banana Pancakes', 'In a medium bowl, together the flour, sugar, baking powder, and salt. In a second bowl, mash the bananas with a fork until almost smooth. in the eggs, then add the milk, vanilla and melted butter, then until well blended. Pour the banana mixture into the flour mixture. Fold the batter gently with a rubber spatula until just blended; do not over-mix. The batter will be thick and lumpy. Preheat a skillet over medium heat. Spray with nonstick spray. Drop batter by ¼ to &frac13; cup onto the skillet and cook until bubbles begin to break the surface and the edges no longer appear wet, about 2 to 3 min. Flip, using a thin spatula, then cook until golden on the other side, about 2 more minutes. Set aside on a plate in a warm oven while you finish the rest. Serve with the syrup.', '[\"white flour (all purpose)\",\"baking powder\",\"sugar\",\"salt\",\"[optional]\",\"bananas, small, ripe\",\"eggs size large\",\"milk, partly skimmed, 2%\",\"vanilla extract\",\"butter, unsalted, melted\",\"vegetable oil spray\",\"maple syrup\"]', 'https://media.soscuisine.com/images/recettes/1854.jpg', 'https://www.soscuisine.com//recipe/banana-pancake', '', '25 min', '290 kcal', '{\"calories\":\"290\",\"fat\":\"9 g\",\"cholesterol\":\"70 mg\",\"protein\":\"8 g\"}', '{\"excellent_source_of\":\"Folacin, Manganese, Phosphorus, Selenium, Vitamin B2\",\"good_source_of\":\"Calcium, Niacin, Vitamin B1, Vitamin B12, Vitamin D\",\"source_of\":\"Iron, Magnesium, Pantothenic Acid, Potassium, Vitamin A, Vitamin B6, Zinc\"}', '2021-06-18 14:16:34'),
(412, 412, 1, 'Barbecue Pulled Chicken Sandwich', 'Put all the ingredients, but bread and tomato, in the ceramic cooking pot. Mix well. Cover the slow cooker with the lid and cook on \'high\' for 3-4 h, or until the chicken meat is tender enough to be \"pulled\" apart easily with a fork. Once cooked, remove the chicken from the slow cooker and pull apart with two forks. Add the chicken back to the slow cooker then mix well. Serve the chicken in panini buns and garnish with sliced tomatoes.', '[\"chicken thighs, boneless, skinless\",\"Tabasco sauce\",\"jalape\\u00c3\\u00b1o pepper, fresh, chopped\",\"white vinegar\",\"honey\",\"paprika\",\"mustard powder\",\"onions, finely chopped\",\"garlic, minced\",\"strained tomatoes\",\"canola oil\",\"panino rolls\",\"tomatoes, sliced\"]', 'https://media.soscuisine.com/images/recettes/3103.jpg', 'https://www.soscuisine.com//recipe/barbecue-pulled-chicken-sandwich', 'is needed to make this recipe.', '250 min', '560 kcal', '{\"calories\":\"560\",\"fat\":\"17 g\",\"cholesterol\":\"70 mg\",\"protein\":\"36 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Folacin, Iron, Manganese, Niacin, Selenium, Vitamin A, Vitamin B1, Vitamin B2\",\"good_source_of\":\"Fibre, Magnesium, Potassium, Vitamin B6, Vitamin C, Vitamin E, Vitamin K, Zinc\",\"source_of\":\"Calcium, Copper, Pantothenic Acid, Phosphorus\",\"low\":\"Cholesterol, Saturated Fat\",\"free\":\"Trans Fat\"}', '2021-06-18 14:16:35'),
(413, 413, 1, 'Barley and Lentil Soup', 'Rinse and drain the lentils, then set aside. Prepare the vegetables : Finely chop the onion and carrots; coarsely chop the Swiss chard (green and white parts); and mince or the garlic. Set aside. Heat the oil in a large pot over medium heat. Add the onion then sauté 3-4 min until soft. Add the carrots, then sauté 5 min with occasional stirring , until they are golden-coloured. Add the garlic and stir 1 min, then add the cumin and stir 1 min. Pour in the , water and barley. Bring to a boil, then reduce the heat, cover and simmer 25 min. Stir in the tomatoes and lentils. Continue to simmer, covered, until the lentils and barley are tender, 25-30 min. Add the chard to the soup, cover and simmer until the chard is tender, about 5 min. Season with salt and pepper to taste. Thin the soup with more broth or water, if desired. Ladle the soup into bowls and serve.', '[\"green or brown lentils (dried)\",\"onions, finely chopped\",\"carrots, finely chopped\",\"Swiss chard, or spinach, coarsely chopped and packed\",\"garlic, minced\",\"olive oil\",\"ground cumin\",\"chicken broth\",\"water\",\"pearl barley\",\"canned tomatoes (diced)\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/861.jpg', 'https://www.soscuisine.com//recipe/barley-lentil-soup', 'It is not necessary to soak the lentils in advance.', '75 min', '130 kcal', '{\"calories\":\"130\",\"fat\":\"2 g\",\"cholesterol\":\"0 mg\",\"protein\":\"5 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Folacin, Vitamin A, Vitamin K\",\"good_source_of\":\"Iron, Magnesium, Manganese, Potassium\",\"source_of\":\"Calcium, Copper, Fibre, Niacin, Pantothenic Acid, Phosphorus, Selenium, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin C, Vitamin E, Zinc\",\"low\":\"Fat, Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:16:36'),
(414, 414, 1, 'Burgundy Fondue', 'Let the meat stand for about 1 h at room temperature. Meanwhile, prepare the Mayonnaise Sauce . Portion out to 3 bowl to prepare 3 sauces that will be served on the side with the meat. For the white \"aioli\" sauce: Blanch the garlic 1 minute, then press it and mix it with the mayonnaise of the first bowl. Set aside. For the red sauce: Mix the mayonnaise of the second bowl with the ketchup and Worcestershire sauce. Set aside. For the green sauce: Using a food processor , mix together the remaining mayonnaise with the parsley, mustard, onions, and capers. Set aside. Heat the oil in a pot over the stovetop, then put it on top of the burner in the centre of the table. The oil should not be smoking (less than 190°C/375°F) but should keep hot during the meal. It is not necessary to put too much oil in the pot, but just enough to cover the meat. To serve, each guest spears one of the meat pieces with a dipping fork, immerses it\r\nbriefly in the oil until cooked to their liking, then dips it into the sauces as desired.', '[\"bourguignonne fondue beef cubes, or filet\",\"Mayonnaise Sauce\",\"garlic\",\"ketchup\",\"Worcestershire sauce\",\"Italian parsley, fresh\",\"Dijon mustard\",\"pickled onions\",\"capers\",\"peanut oil\"]', 'https://media.soscuisine.com/images/recettes/1014.jpg', 'https://www.soscuisine.com//recipe/burgundy-fondue', '', '15 min', '540 kcal', '{\"calories\":\"540\",\"fat\":\"43 g\",\"cholesterol\":\"100 mg\",\"protein\":\"34 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Niacin, Selenium, Vitamin B12, Vitamin E, Vitamin K, Zinc\",\"good_source_of\":\"Iron, Pantothenic Acid, Phosphorus, Potassium, Vitamin B2, Vitamin B6\",\"source_of\":\"Copper, Folacin, Magnesium, Omega-3, Omega-6, Vitamin A, Vitamin B1, Vitamin C, Vitamin D\",\"low\":\"Sodium\"}', '2021-06-18 14:16:36'),
(415, 415, 1, 'Barley Pilaf', 'Prepare the vegetables : Finely chop the onion and the carrot. Melt the butter in a saucepan over medium heat. Add the onion, sprinkle with \r\nsalt, then sauté until the onion begins to soften, about 5 min. Add the barley, then cook 3 min with constant stirring . Pour in the and water. Bring to a boil, then reduce the heat to \'low\', stir once, add the bay leaf and cover. Cook until the barley just starts to become tender, about 25 min. Add the carrot and peas, cover and cook until the vegetables are tender, 6-7 min. Remove the saucepan from the heat, stir once, cover and let stand 10 min. Discard the bay leaf, adjust the seasoning and serve.', '[\"onions, finely chopped\",\"carrots, finely chopped\",\"butter, unsalted\",\"pearl barley\",\"chicken broth\",\"water\",\"bay leaf\",\"frozen peas\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/951.jpg', 'https://www.soscuisine.com//recipe/barley-pilaf', '', '40 min', '210 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Vitamin A\",\"good_source_of\":\"Fibre, Folacin, Manganese, Niacin, Selenium\",\"source_of\":\"Copper, Iron, Magnesium, Phosphorus, Potassium, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin K, Zinc\",\"low\":\"Cholesterol, Fat, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:16:37'),
(416, 416, 1, 'Beef Tartare', 'Separate the egg whites and yolks. Set the whites aside in a glass jar with a lid and put them in the refrigerator or freezer for a future use in another recipe. Put the yolks in a bowl. Finely chop the shallots and capers, then add them\r\nto the bowl. Add the mustard, olive oil, and Worcestershire sauce. Mix well using a fork. Using a knife, chop the beef into small pieces until the desired consistency is obtained, then add the pieces to the bowl with the other ingredients. Season with salt and pepper to taste. Form the mixture into flattened mounds and place one mound onto each individual serving plate. Serve immediately.', '[\"shallots, finely chopped\",\"capers, finely chopped\",\"Dijon mustard\",\"extra virgin olive oil\",\"Worcestershire sauce, to taste\",\"egg yolks\",\"beef, filets mignon, or rib steak, chopped into small pieces\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1191.jpg', 'https://www.soscuisine.com//recipe/beef-tartare', '', '15 min', '190 kcal', '{\"calories\":\"190\",\"fat\":\"13 g\",\"cholesterol\":\"140 mg\",\"protein\":\"15 g\"}', '{\"free\":\"Sugar\",\"excellent_source_of\":\"Selenium, Vitamin B12, Zinc\",\"good_source_of\":\"Iron, Niacin, Pantothenic Acid, Phosphorus, Vitamin E\",\"source_of\":\"Folacin, Magnesium, Potassium, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin D, Vitamin K\"}', '2021-06-18 14:16:37'),
(417, 417, 1, 'Beet and Green Apple Salad', 'Prepare the beets boil or steam them about 25-30 min. Let the beets cool down a few minutes, then peel them and dice into 1,5 cm pieces. Transfer the pieces to a salad bowl. Cut the apples into 1,5 cm cubes, without peeling them, but removing the core. Add the apples to the beets in the salad bowl. Pour in the Classic\r\nVinaigrette , then season with salt and pepper. well then serve.', '[\"beetroots\",\"apples, green, Granny Smith type\",\"Classic Vinaigrette\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/648.jpg', 'https://www.soscuisine.com//recipe/beet-green-apple-salad', 'The beets may be cooked a few day in advance.', '35 min', '190 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Folacin\",\"good_source_of\":\"Manganese, Potassium, Vitamin E\",\"source_of\":\"Copper, Fibre, Iron, Magnesium, Phosphorus, Vitamin B6, Vitamin C, Vitamin K, Zinc\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:16:38'),
(418, 418, 1, 'Beet Salad', 'Wrap each beet individually in aluminum foil and bake at 300 °F (150 °C). About 2 hours of cooking are required depending on their size. Touch them to see if they are cooked. Leave to cool in the foil before removing the peel and cutting into cubes. Mix all the ingredients in a bowl. Refrigerate for several hours before serving.', '[\"beetroots\",\"red onions, chopped\",\"garlic, chopped\",\"horseradish\",\"extra virgin olive oil\"]', 'https://media.soscuisine.com/images/recettes/2255.jpg', 'https://www.soscuisine.com//recipe/beet-salad', '', '130 min', '110 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Folacin\",\"good_source_of\":\"Manganese\",\"source_of\":\"Fibre, Iron, Magnesium, Potassium, Vitamin B6, Vitamin C, Vitamin E, Vitamin K\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:16:38'),
(419, 419, 1, 'Beet Salad on Mixed Greens', 'Thinly slice the onion, then soak it in a small bowl filled with water and a few drops of vinegar. Set aside while preparing the rest of the salad or leave it overnight in the refrigerator. This makes the raw onion easier to digest and crispier. Boil the egg(s) 10 min, cool them down immediately in cold water, then dice finely. Prepare the beets boil or steam them about 25-30 min, then peel and julienne In a bowl, mix the oil, vinegars, and mustard, then well until the vinaigrette is emulsified. Add the beets and well, then adjust the\r\nseasoning . Drain the presoaked onion then spread it along with the mixed greens on a large serving plate. Place the julienned beets on top of the mixed greens and sprinkle with the diced hard-boiled egg(s). Garnish with the chopped tarragon . Serve.', '[\"red onions, thinly sliced\",\"beetroots\",\"eggs size large\",\"olive oil\",\"Dijon mustard\",\"wine vinegar\",\"balsamic vinegar\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"mixed greens\",\"fresh tarragon, chopped\"]', 'https://media.soscuisine.com/images/recettes/264.jpg', 'https://www.soscuisine.com//recipe/beet-salad-on-mixed-greens', 'will make slicing easier.', '45 min', '230 kcal', '{\"calories\":\"230\",\"fat\":\"17 g\",\"cholesterol\":\"110 mg\",\"protein\":\"6 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Vitamin K\",\"good_source_of\":\"Magnesium, Manganese, Potassium, Selenium, Vitamin A, Vitamin E\",\"source_of\":\"Calcium, Copper, Fibre, Iron, Niacin, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin C, Vitamin D, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:16:39'),
(420, 420, 1, 'Beet Salad with Mango', 'Preheat the oven to 205°C/400°F or the outdoor grill. Prepare the beets . Place a sheet of parchment\r\npaper on top of a similarly sized piece of aluminum foil, then place the beets in the centre of the parchment paper. Drizzle with oil, then add salt and pepper to taste. Fold the aluminum foil / parchment paper over the beets to enclose them, then place the packet on a baking sheet and roast it in the middle of the oven for about 1 h. The beets can be pierced, through the foil on the top of the packet, to check for doneness. Alternatively, the beets may be cooked on an outdoor grill. Remove the beets from the oven, let them cool down about 10 min, then rub off the skins and discard them. Cut the beets into small cubes of about 7 mm and put them in a salad bowl or on a platter. Cut the mangoes in half without peeling them, slicing them near, and on each side of the large oval pit. Using a knife, make check pattern incisions (about 1 cm wide) in the flesh without cutting through the skin. Gently press the scored halves to turn them inside out, then cut off the cubes of fruit from the peel. Peel and trim the rest of the fruit off the pit. Add the mango cubes to the beets, but without tossing them together (otherwise the whole salad will turn red). Pour the vinegar in a small bowl. Season with salt and pepper to taste, add the sugar, then to combine. Finely chop the shallot, add it to the bowl then pour the vinaigrette over the salad. Garnish with the chopped tarragon and serve.', '[\"beetroots\",\"olive oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"mangoes\",\"rice vinegar\",\"sugar\",\"shallots, finely chopped\",\"fresh tarragon, chopped\",\"aluminum foil\",\"parchment paper\"]', 'https://media.soscuisine.com/images/recettes/536.jpg', 'https://www.soscuisine.com//recipe/beet-salad-mango', 'Beets can be cooked up to 5 days in advance.', '65 min', '190 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Folacin, Potassium, Vitamin C\",\"good_source_of\":\"Fibre, Magnesium, Manganese, Vitamin E\",\"source_of\":\"Copper, Iron, Niacin, Pantothenic Acid, Phosphorus, Vitamin A, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin K, Zinc\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Cholesterol, Trans Fat\"}', '2021-06-18 14:16:39'),
(421, 421, 1, 'Butter and Sage Ravioli', 'Cook the ravioli in a large pot of boiling, salted water, exactly as you would do for . The cooking time is written on the package: the ravioli are ready when just tender but still firm to the \r\nbite. Meanwhile, melt the butter in a small saucepan over low heat. Add the sage leaves and let them infuse a few minutes, until the butter becomes perfumed with the sage aroma. Pay attention not to let the butter burn. When the ravioli are cooked, take them out of the pot using a slotted spoon and transfer them to a colander (ravioli are too delicate to drain them directly into the colander like spaghetti). Drain the pot and put the ravioli back into it. Add the sage butter, remove the leaves,\r\nthen add the grated parmesan and ground pepper. gently a couple times, then serve in the warmed dishes.', '[\"ravioli (meat)\",\"butter, unsalted\",\"fresh sage\",\"Parmesan cheese, grated\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/393.jpg', 'https://www.soscuisine.com//recipe/butter-sage-ravioli', '', '15 min', '450 kcal', '{\"calories\":\"450\",\"fat\":\"14 g\",\"cholesterol\":\"60 mg\",\"protein\":\"19 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Iron, Vitamin K\",\"good_source_of\":\"Phosphorus\",\"source_of\":\"Calcium, Fibre, Magnesium, Vitamin A\"}', '2021-06-18 14:16:41'),
(422, 422, 1, 'Beet Soup', 'Prepare the vegetables : chop the onions and garlic; peel the beets and potatoes, then cut them into large chunks. Heat the butter and oil in a saucepan over medium heat. Add the onions and garlic, then sauté 3-4 min until soft. Grate the ginger and add it to the pan. Cook 1 min with stirring . Add the beets and potatoes, then pour in the , bring it to a boil, cover and simmer 1 h. Add salt and pepper to taste. Take the pan off the heat, let it cool down a few minutes then purée the soup in a blender food processor Adjust the seasoning , then ladle the soup into bowls. Garnish with sour cream and chopped chives, then serve (warm or at room temperature).', '[\"onions, chopped\",\"garlic, chopped\",\"beetroots, peeled then cut into large chunks\",\"potatoes, peeled then cut into large chunks\",\"butter, unsalted\",\"canola oil\",\"gingerroot, grated\",\"chicken broth\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"sour cream\",\"chives, fresh, chopped\"]', 'https://media.soscuisine.com/images/recettes/716.jpg', 'https://www.soscuisine.com//recipe/beet-soup', 'will be very useful to purée the soup.', '70 min', '160 kcal', '{\"calories\":\"160\",\"fat\":\"5 g\",\"cholesterol\":\"10 mg\",\"protein\":\"4 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Manganese, Potassium\",\"good_source_of\":\"Magnesium\",\"source_of\":\"Calcium, Copper, Fibre, Iron, Niacin, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin C, Vitamin K, Zinc\"}', '2021-06-18 14:16:43'),
(423, 423, 1, 'Beets and Apple Verrines', 'Prepare the beets boil or steam them about 25 min, then peel and roughly chop them. Transfer to a blender and purée.\r\n    Set aside. In a saucepan, heat the soy milk over medium heat. Add the agar-agar powder and make sure it is well dissolved. Stir in the coffee and mix well. Add the rest of the ingredients and cook over low heat until the cream cheese and sugar are well dissolved. Pour the mixture into individual glasses then let set in the refrigerator for at least 6 hours. Serve.', '[\"beetroots\",\"soy beverage, unsweetened, fortified\",\"agar agar (powder)\",\"instant coffee\",\"Unsweetened Applesauce\",\"vegan cheese spread\",\"vanilla extract\",\"sugar\"]', 'https://media.soscuisine.com/images/recettes/3621.jpg', 'https://www.soscuisine.com//recipe/beets-apples-verrine-vegan', 'will be very useful to purée the beets.', '40 min', '150 kcal', '{\"calories\":\"150\",\"fat\":\"6 g\",\"cholesterol\":\"0 mg\",\"protein\":\"3 g\"}', '{\"good_source_of\":\"Folacin\",\"source_of\":\"Calcium, Iron, Magnesium, Manganese, Vitamin B12, Vitamin B2, Vitamin D, Vitamin E\"}', '2021-06-18 14:16:48'),
(424, 424, 1, 'Belgian Endive and Orange Salad', 'Rinse and dry the lettuce and belgian endive. Leave the lettuce leaves whole and arrange them on individual serving plates. Slice the endive crosswise into bite-size pieces and place\r\nthe pieces over the lettuce leaves. Peel the oranges with a sharp knife, removing all of the white pith from the flesh. Save any accumulated juices. Cut the oranges into 7-8 mm rounds and arrange them on the individual plates. In a small bowl, pour in the oil, lemon\r\njuice, and reserved orange juice, then add the mustard. well, using a fork, until the vinaigrette is emulsified. Add salt and pepper to taste, then pour the vinaigrette over the individual servings. Add the hazelnuts and dried cranberries (optional). Serve.', '[\"Boston lettuce, or curly leaf\",\"Belgian endive (Witloof), sliced crosswise\",\"oranges, cut into 7-8 mm rounds\",\"extra virgin olive oil\",\"lemon juice, freshly squeezed\",\"whole-grain mustard\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"hazelnuts, shelled\",\"[optional]\",\"dried cranberries\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/395.jpg', 'https://www.soscuisine.com//recipe/belgian-endive-orange-salad', '', '15 min', '170 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Folacin, Vitamin C, Vitamin K\",\"good_source_of\":\"Fibre, Potassium, Vitamin E\",\"source_of\":\"Calcium, Magnesium, Manganese, Pantothenic Acid, Vitamin A, Vitamin B1, Vitamin B6\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:16:50'),
(425, 425, 1, 'Berry Frozen Yogurt', 'Put the frozen berries in a blender . Add the yogurt and honey, then mix at maximum speed, for one or two minutes until homogeneous. Pour into serving bowls and serve right away as soft serve. Alternatively pour into a container, cover and chill in the freezer for at least 2 h before serving as ice cream.', '[\"berry mix, frozen\",\"mediterranean yogurt, 10%\",\"honey\"]', 'https://media.soscuisine.com/images/recettes/4416.jpg', 'https://www.soscuisine.com//recipe/berry-frozen-yogurt', 'will be very useful for this recipe.', '10 min', '120 kcal', '{\"calories\":\"120\",\"fat\":\"4 g\",\"cholesterol\":\"10 mg\",\"protein\":\"2 g\"}', '{\"excellent_source_of\":\"Manganese\",\"good_source_of\":\"Vitamin K\",\"source_of\":\"Calcium, Fibre, Folacin, Magnesium, Vitamin E\",\"low\":\"Sodium\"}', '2021-06-18 14:16:51'),
(426, 426, 1, 'Butternut Squash, Chickpea and Zucchini Soup', 'Preheat the oven to 190°C/375°F. Cut the squash in half lengthwise, remove the seeds. Place the halves on a baking sheet, cut side down. Bake about 45-50 min until soft. Alternatively, cook each halve separately in a microwave oven: Place each halve in a bowl, partially covered, then\r\n    cook at high intensity about 8 min for each halve. Let the halves cool down, carve out the pulp then dice it into 1,5 cm cubes. Set the cubes aside. Meanwhile, prepare the vegetables : Dice the zucchini and chop the onion. Heat the oil in a pot over medium heat. Add the onion, zucchini and curry powder. Cook, with stirring , until softened, 2-3 min. Add the squash, chickpeas and . Cook over medium heat until the zucchini are tender, about 10 min. Purée the soup in a blender adjust the\r\nseasoning Pour the soup into bowls, swirl in the yogurt and extra virgin olive oil. Serve.', '[\"butternut squash\",\"olive oil\",\"onions, diced\",\"zucchini, diced\",\"curry powder\",\"chickpeas\\/garbanzo beans (canned), rinsed and drained\",\"chicken broth\",\"Greek yogurt, plain, 2% M.F.\",\"extra virgin olive oil\"]', 'https://media.soscuisine.com/images/recettes/3455.jpg', 'https://www.soscuisine.com//recipe/butternut-squash-chickpea-zucchini-soup', 'will be very useful to purée the soup.', '75 min', '580 kcal', '{\"calories\":\"580\",\"fat\":\"23 g\",\"cholesterol\":\"0 mg\",\"protein\":\"24 g\"}', '{\"diet-related_health_claims\":\"Bone-healthy\",\"excellent_source_of\":\"Calcium, Copper, Fibre, Folacin, Iron, Magnesium, Manganese, Potassium, Vitamin A, Vitamin B6, Vitamin C, Vitamin E, Zinc\",\"good_source_of\":\"Niacin, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin K\",\"source_of\":\"Selenium, Vitamin B2\",\"low\":\"Calories, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:16:52'),
(427, 427, 1, 'Blueberry Lemon Cake', 'Preheat the oven to 160°C/325°F. Butter the baking pan(s). In a small bowl, combine the flour, baking powder, and salt. Set aside. In another bowl, the butter with ¾ of the sugar using a , about 3-4 min until light and fluffy. Add the eggs one at a time, beating well after each addition. Add 2 teaspoons lemon zest. Add the flour mixture in 3 portions, alternating with the milk. Mix well until homogeneous then fold in the blueberries using a spatula. Transfer the mixture to the baking pan(s) and bake in the middle of the oven 1 ¼ h. Check the cake with a toothpick or knife to see if it is cooked through. When done, pull it out of the oven and let it cool down a few minutes. Pour the lemon juice in a small microwave-safe bowl. Add the remaining sugar and microwave, uncovered, on medium-high 1 min until hot and syrupy. Pour the syrup over the cake(s) then let it cool at least 30 min before serving.', '[\"white flour (all purpose)\",\"baking powder\",\"salt\",\"butter, unsalted\",\"sugar\",\"eggs size large\",\"lemons, for juice and zest\",\"milk, partly skimmed, 2%\",\"blueberries\"]', 'https://media.soscuisine.com/images/recettes/234.jpg', 'https://www.soscuisine.com//recipe/blueberry-lemon-cake', '', '90 min', '300 kcal', '{\"calories\":\"300\",\"fat\":\"10 g\",\"cholesterol\":\"70 mg\",\"protein\":\"5 g\"}', '{\"excellent_source_of\":\"Folacin, Selenium\",\"good_source_of\":\"Vitamin B1\",\"source_of\":\"Calcium, Iron, Manganese, Niacin, Pantothenic Acid, Phosphorus, Vitamin A, Vitamin B12, Vitamin B2, Vitamin D, Vitamin E\",\"low\":\"Sodium\"}', '2021-06-18 14:16:53'),
(428, 428, 1, 'Blueberry Muffins', 'Preheat the oven to 190°C/375°F. Place 12 large paper muffin cups in a 12 cup muffin \r\npan. In a  bowl, combine  the flour, \r\nbaking powder, and salt. Set aside. In a separate bowl, the butter with \r\n    the sugar using a ,  until the mixture \r\n    is lighter in colour, about 3 min. Add the eggs one at a time, beating well after each addition. \r\n    Gradually in the milk, alternating with the flour mixture. Mix until homogeneous, then gently fold in the \r\n  blueberries using a spatula. Using an ice cream scoop, spoon the batter into the prepared muffin cups. Bake in the middle of the oven for about 25-30 min, until a tooth-pick inserted into the center of a muffin comes out clean. Take \r\nthe pan out of the oven, then put each of the paper lined muffins on a rack to cool. Serve.', '[\"white flour (all purpose)\",\"baking powder\",\"salt\",\"butter, unsalted, softened\",\"sugar\",\"eggs size large\",\"milk, partly skimmed, 2%\",\"blueberries, fresh of frozen\"]', 'https://media.soscuisine.com/images/recettes/2595.jpg', 'https://www.soscuisine.com//recipe/blueberry-muffins', '', '45 min', '240 kcal', '{\"calories\":\"240\",\"fat\":\"9 g\",\"cholesterol\":\"60 mg\",\"protein\":\"4 g\"}', '{\"good_source_of\":\"Folacin, Selenium\",\"source_of\":\"Calcium, Iron, Manganese, Niacin, Phosphorus, Vitamin A, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin D\",\"low\":\"Sodium\"}', '2021-06-18 14:16:53'),
(429, 429, 1, 'Blueberry Popsicles', 'Put the blueberries in a blender food processor . Add the greek yogurt and sugar. Purée until smooth. Fill 12 moulds with the yogurt mixture, then insert the coffee sticks. Chill in the freezer at least 5 h before serving.', '[\"Greek yogurt, plain, 2% M.F.\",\"blueberries\",\"sugar\",\"wooden coffee sticks\"]', 'https://media.soscuisine.com/images/recettes/3189.jpg', 'https://www.soscuisine.com//recipe/blueberry-popsicles', 'will be very useful for this recipe.', '10 min', '70 kcal', '{\"calories\":\"70\",\"fat\":\"1 g\",\"cholesterol\":\"0 mg\",\"protein\":\"2 g\"}', '{\"source_of\":\"Manganese, Vitamin K\",\"low\":\"Fat, Saturated Fat, Sodium\",\"free\":\"Cholesterol, Trans Fat\"}', '2021-06-18 14:16:54'),
(430, 430, 1, 'Blueberry Smoothie Bowl', 'Place the banana pieces and blueberries in a food processor blender , setting aside a few banana pieces and a few blueberries for decorating. Add the yogurt and milk to the blender. Process on the highest speed until a well-blended purée forms, about 15 seconds, stopping to scrape down the sides of the container once or twice. Pour the smoothie into bowls then garnish with the remaining ingredients and the fruits pieces set aside.', '[\"bananas, small, ripe, chunks\",\"blueberries, or other berries\",\"Greek yogurt, plain, 2% M.F.\",\"milk, skimmed, 0%\",\"chia seeds\",\"unsweetened coconut flakes\",\"pecans\",\"pumpkin seeds\",\"dried cranberries\"]', 'https://media.soscuisine.com/images/recettes/4097.jpg', 'https://www.soscuisine.com//recipe/blueberry-smoothie-bowl', 'will be very useful for this recipe.', '10 min', '350 kcal', '{\"calories\":\"350\",\"fat\":\"14 g\",\"cholesterol\":\"0 mg\",\"protein\":\"18 g\"}', '{\"diet-related_health_claims\":\"Bone-healthy\",\"free\":\"Added Sugar\",\"excellent_source_of\":\"Fibre, Magnesium, Manganese, Potassium\",\"good_source_of\":\"Calcium, Phosphorus, Vitamin B12, Vitamin B6, Vitamin K, Zinc\",\"source_of\":\"Copper, Folacin, Iron, Niacin, Omega-3, Pantothenic Acid, Selenium, Vitamin A, Vitamin B1, Vitamin B2, Vitamin C, Vitamin D\",\"low\":\"Sodium\"}', '2021-06-18 14:16:54'),
(432, 432, 1, 'Bone Broth', 'Preheat the oven to 150°C/300°F. Place the bones on a cookie sheet then cook in the middle of the oven for 30 min. Remove from the oven and let cool e few minutes. Add the water, vinegar and bones to a large pot or a slow cooker . Set aside. Prepare the vegetables : Cut the carrots, onion and celery stalks in half. Add the vegetables, salt and bay leaves to the pot. Bring the liquid to a boil, then cover and simmer over low heat for 18-24 h. When there are 30 min remaining to cook, add the parsley and peppercorns. Remove from heat and let cool for about 30 min. Strain broth through a sieve, pressing the vegetables to get the most broth.', '[\"beef bone\",\"water\",\"apple cider vinegar\",\"carrots, cut in half\",\"onions, cut in half\",\"celery, cut in half\",\"bay leaf\",\"coarse salt\",\"Italian parsley, fresh\",\"peppercorns\"]', 'https://media.soscuisine.com/images/recettes/4176.jpg', 'https://www.soscuisine.com//recipe/bone-broth', '.', '75 min', '200 kcal', '{\"calories\":\"30\",\"fat\":\"3 g\",\"cholesterol\":\"10 mg\",\"protein\":\"0 g\"}', '{\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:16:55'),
(433, 433, 1, 'Boston Lettuce, Tomato and Radish Salad', 'Cut the tomatoes into segments and place them in a salad bowl. Add the lettuce leaves. Finely slice the radish and green onions, then add them to the bowl. Pour in the Classic Vinaigrette . Add salt and pepper to taste. and serve\r\nimmediately.', '[\"tomatoes\",\"Boston lettuce, or curly leaf\",\"radishes\",\"green onions\\/scallions\",\"Classic Vinaigrette\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/331.jpg', 'https://www.soscuisine.com//recipe/lettuce-tomato-salad', '', '10 min', '130 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Vitamin A, Vitamin K\",\"good_source_of\":\"Folacin, Vitamin E\",\"source_of\":\"Iron, Magnesium, Manganese, Potassium, Vitamin B6, Vitamin C\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:16:56'),
(434, 434, 1, 'Breakfast \'\'Jef\"', 'Combine the flour, salt, baking soda and water in a bowl. Mix well, using a whip, until the texture is smooth. Let stand in the refrigerator about 1-2 h to obtain a lighter texture. Grease a non-stick frying pan, then put it over medium heat. Pour about ¼ to &frac13; cup of the batter onto the center of the pan. Spread it rapidly, either by whirling the pan or using a spatula. After about 2 min, when the pancake turns golden-brown, flip it and cook about 1 more minute. Keep the cooked pancakes in the oven while preparing the rest. Repeat the operation with the remaing batter. Meanwhile, heat the margarine in another pan over medium-low heat and cook the eggs. Place one egg on top of each pancake then serve with a glass of milk and clementines, or other seasonal fruit.', '[\"buckwheat flour\",\"salt\",\"baking soda\",\"water, cold\",\"canola oil\",\"margarine non-hydrogenated\",\"eggs size large\",\"milk, skimmed, 0%\",\"clementines\"]', 'https://media.soscuisine.com/images/recettes/3222.jpg', 'https://www.soscuisine.com//recipe/breakfast-jef', '', '25 min', '360 kcal', '{\"calories\":\"360\",\"fat\":\"12 g\",\"cholesterol\":\"230 mg\",\"protein\":\"20 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Calcium, Folacin, Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin C, Vitamin D, Zinc\",\"good_source_of\":\"Iron, Vitamin B6\",\"source_of\":\"Copper, Fibre, Vitamin E, Vitamin K\"}', '2021-06-18 14:16:57'),
(435, 435, 1, 'Breakfast \'\'Wellington\'\'', 'Preheat a skillet over medium heat and add the oil, shallot and spices. Crumble in the tofu using your hands or a fork. until well mixed together with the spicy oil. Add the garlic, soy sauce. Season with salt and pepper to taste. As soon as the tofu is hot, it\'s ready. Meanwhile, wash the mixed greens and blot dry. Put them in a salad bowl. Pour in the >. Add salt and pepper, then Put the cooked scrambled tofu onto the mixed greens. Serve with the keto bread and blackberries. If preparing in advance, keep a cup of water to splash into the skillet when reheating, to avoid tofu getting too dry.', '[\"shallots, finely chopped\",\"canola oil\",\"turmeric\",\"ground cumin\",\"curry powder\",\"firm regular tofu, crumbled\",\"garlic, minced\",\"soy sauce\",\"ground pepper to taste\",\"[optional]\",\"salt\",\"[optional]\",\"mixed greens\",\"Classic Vinaigrette\",\"Keto Bread\",\"blackberries\"]', 'https://media.soscuisine.com/images/recettes/4066.jpg', 'https://www.soscuisine.com//recipe/breakfast-wellington', '', '15 min', '460 kcal', '', '{\"diet_related_health_claims\":\"Bone-healthy, Bone-healthy, Heart-healthy\",\"excellent_source_of\":\"Calcium, Copper, Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Selenium, Vitamin E, Vitamin K, Zinc\",\"good_source_of\":\"Vitamin A, Vitamin B2, Vitamin B6, Vitamin C\",\"source_of\":\"Omega-3, Omega-6, Pantothenic Acid, Vitamin B1\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:16:58'),
(436, 436, 1, 'Breakfast \'West Palm Beach\'\'', 'Preheat a skillet over medium heat and add the oil, shallot and spices. Crumble in the tofu using your hands or a fork. until well mixed together with the spicy oil. Add the garlic, soy sauce. Season with salt and pepper to taste. As soon as the tofu is hot, it\'s ready. Meanwhile, wash the mixed greens and blot dry. Put them in a salad bowl. Pour in the >. Add salt and pepper, then Put the cooked scrambled tofu onto the mixed greens. Serve with the keto bread and blackberries.', '[\"shallots, finely chopped\",\"canola oil\",\"turmeric\",\"ground cumin\",\"curry powder\",\"firm regular tofu, crumbled\",\"garlic, minced\",\"soy sauce\",\"ground pepper to taste\",\"[optional]\",\"salt\",\"[optional]\",\"mixed greens\",\"Classic Vinaigrette\",\"Keto Bread\",\"blackberries\"]', 'https://media.soscuisine.com/images/recettes/4067.jpg', 'https://www.soscuisine.com//recipe/breakfast-west-palm-beach', 'If preparing in advance, keep a cup of water to splash into the skillet when reheating, to avoid tofu getting too dry.', '15 min', '590 kcal', '', '{\"diet_related_health_claims\":\"Bone-healthy, Heart-healthy\",\"excellent_source_of\":\"Calcium, Copper, Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Selenium, Vitamin B2, Vitamin E, Vitamin K, Zinc\",\"good_source_of\":\"Vitamin A, Vitamin B1, Vitamin B6, Vitamin C\",\"source_of\":\"Omega-6, Pantothenic Acid\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:17:00'),
(437, 437, 1, 'Asian Shrimp Soup', 'Cook the rice sticks then set aside. In a saucepan of salted boiling water, boil the shrimp about 3 min, until they become pink. Drain and set aside. Prepare the vegetables . Grate the carrots, slice the green onions, cabbage, and mushrooms. Portion out the vegetables into the individual serving bowls. Add the cooked rice sticks. Heat the in a saucepan. Add the grated ginger, minced garlic and chili pepper . Cook 2 min. Add the cooked shrimp and cook an additional 3-4 min. Adjust the seasoning Pour the hot into the serving bowls. Add the lime juice, garnish with whole cilantro leaves, and serve.', '[\"chicken broth\",\"rice sticks (noodles)\",\"carrots, grated\",\"button (white) mushrooms, thinly sliced\",\"green cabbage, or Savoy, thinly sliced\",\"green onions\\/scallions, thinly sliced\",\"shrimp, medium-large\",\"gingerroot, grated\",\"garlic, minced\",\"dried chili peppers, minced\",\"lime juice, freshly squeezed\",\"fresh cilantro\",\"[optional]\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/29.jpg', 'https://www.soscuisine.com//recipe/asian-shrimp-soup', 'Individual 500 ml (2 cups) serving bowls are needed.', '20 min', '260 kcal', '{\"calories\":\"260\",\"fat\":\"1 g\",\"cholesterol\":\"120 mg\",\"protein\":\"17 g\"}', '{\"excellent_source_of\":\"Niacin, Selenium, Vitamin A, Vitamin B12, Vitamin K\",\"good_source_of\":\"Folacin, Iron, Magnesium, Manganese, Phosphorus, Potassium, Zinc\",\"source_of\":\"Calcium, Copper, Fibre, Pantothenic Acid, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin C, Vitamin E\",\"low\":\"Fat, Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:17:01'),
(438, 438, 1, 'Breakfast \"Verdun\"', 'Make the green tea Place the avocado, baby spinach, tahini, turmeric, hemp seeds, salt and pepper in a food processor blender . Add the oil and green tea infusion. Process on the highest speed until a well-blended purée forms, about 15 seconds, stopping to scrape down the sides of the container once or twice. Taste the mixture, adjust seasoning, if necessary. Serve with the pumpkin seeds.', '[\"avocados\",\"baby spinach\",\"Tahini paste\",\"turmeric\",\"hemp seeds\",\"salt\",\"ground pepper to taste\",\"[optional]\",\"avocado oil\",\"Cup of green tea\",\"pumpkin seeds\"]', 'https://media.soscuisine.com/images/recettes/4267.jpg', 'https://www.soscuisine.com//recipe/breakfast-verdun', 'will be very useful for this recipe.', '10 min', '480 kcal', '{\"calories\":\"480\",\"fat\":\"44 g\",\"cholesterol\":\"0 mg\",\"protein\":\"14 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Copper, Fibre, Folacin, Iron, Magnesium, Manganese, Phosphorus, Potassium, Vitamin B1, Vitamin B2, Vitamin E, Vitamin K, Zinc\",\"good_source_of\":\"Niacin, Vitamin A, Vitamin B6\",\"source_of\":\"Calcium, Omega-6, Pantothenic Acid, Vitamin C\",\"low\":\"Sodium\"}', '2021-06-18 14:17:08'),
(439, 439, 1, 'Brown Rice Bread', 'Fit the pan in the bread machine. Heat water in the microwave for 50 to 70 seconds. Crack eggs into the hot water, beat them and pour everything into the pan of the bread machine. Add remaining ingredients, in the order they appear on the list. If your bread machine is a Black & Decker B2300 model, start the rapid baking cycle (no. 2), 2 lb. bread, dark crust and turn on the machine. Baking will take 1 hour 28 minutes and your bread should be cooked just right. If you have a different model, choose a rapid cycle and test it to determine the best conditions. When the baking is over, invert the pan onto a rack and cool 1 to 2 hours. Wrap the bread in paper towels or a cloth, put into a plastic bag and refrigerate.', '[\"water, ho\",\"eggs size large\",\"extra virgin olive oil\",\"salt, sea, unrefined gray\",\"honey\",\"rice vinegar\",\"flax seeds, ground\",\"guar gum, or xanthan\",\"tapioca flour\\/starch\",\"brown rice flour\",\"baking powder\",\"bread machine yeast, or quick-yeast\"]', 'https://media.soscuisine.com/images/recettes/2262.jpg', 'https://www.soscuisine.com//recipe/brown-rice-bread', '', '105 min', '150 kcal', '{\"calories\":\"150\",\"fat\":\"4 g\",\"cholesterol\":\"20 mg\",\"protein\":\"3 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Manganese\",\"source_of\":\"Fibre, Folacin, Iron, Magnesium, Niacin, Omega-3, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin B2, Vitamin B6, Zinc\",\"low\":\"Saturated Fat\",\"free\":\"Trans Fat\"}', '2021-06-18 14:17:09'),
(440, 440, 1, 'Brussels Sprouts and Kale Salad', 'Leave the Brussel sprouts whole or cut them in half if large, then blanch them in a pot of salted boiling water until crisp-tender ( al dente ), about 4 min. Remove the sprouts from the pot using a slotted spoon. Drain well then set aside in a salad bowl. Bring the water back to a boil. Add the kale and cook until just tender, about 3 min. Drain the kale and let cool slightly. Squeeze out any excess liquid then coarsely chop and set aside in the salad bowl. Add the chopped shallot. In a small bowl, together the oil, lemon juice, mustard, salt, and pepper. Pour over the vegetables then gently to combine. Sprinkle with sliced almonds, then serve.', '[\"Brussels sprouts, whole or cut in half\",\"kale\",\"shallots, finely chopped\",\"extra virgin olive oil\",\"lemonjuice, freshly squeezed\",\"Dijon mustard\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"flaked almonds\"]', 'https://media.soscuisine.com/images/recettes/4324.jpg', 'https://www.soscuisine.com//recipe/brussels-sprouts-kale-salad', '', '30 min', '170 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Folacin, Manganese, Vitamin A, Vitamin C, Vitamin E, Vitamin K\",\"good_source_of\":\"Fibre, Magnesium, Potassium, Vitamin B6\",\"source_of\":\"Calcium, Copper, Iron, Niacin, Phosphorus, Vitamin B1, Vitamin B2, Zinc\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:17:10'),
(441, 441, 1, 'Buckwheat Pancake', 'Combine the flour, salt, baking soda and water in a bowl. Mix well, using a whip, until the texture is smooth. Let stand in the refrigerator about 1-2 h to obtain a lighter texture. Grease a non-stick frying pan, then put it over medium heat. Pour about ¼ to &frac13; cup of the batter onto the center of the pan. Spread it rapidly, either by whirling the pan or using a spatula. After about 2 min, when the pancake turns golden-brown, flip it and cook about 1 more minute. Keep the cooked pancakes in the oven while preparing the rest. Repeat the operation with the remaing batter then serve.', '[\"buckwheat flour\",\"salt\",\"baking soda\",\"water, cold\",\"canola oil\"]', 'https://media.soscuisine.com/images/recettes/2785.jpg', 'https://www.soscuisine.com//recipe/buckwheat-pancake', '', '25 min', '140 kcal', '{\"calories\":\"140\",\"fat\":\"4 g\",\"cholesterol\":\"0 mg\",\"protein\":\"4 g\"}', '{\"excellent_source_of\":\"Magnesium, Manganese\",\"source_of\":\"Copper, Fibre, Folacin, Iron, Niacin, Omega-3, Phosphorus, Vitamin B1, Vitamin B6, Vitamin E, Vitamin K, Zinc\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:17:11'),
(442, 442, 1, 'Calf Liver Venetian Style', 'Prepare the onions : slice them into thin rings. Melt the butter and half of the oil in a skillet over medium-low heat. the onions, cover, and cook 10 min over low heat, then remove them from the skillet and keep\r\nwarm. the liver slices with flour, then shake off the excess. Add the rest of the oil to the skillet and raise the heat to medium-high. Add the liver slices, cook 2 min, turn them then deglaze with the vinegar. Put the onions back into the skillet and lower the heat to medium, cover, and cook a further 3 min ( do not overcook the liver or it will become tough! ). Remove the skillet from the heat, then season with salt and pepper. Serve on the warmed plates with the onions on top of the liver slices.', '[\"onions, thinly sliced\",\"butter, unsalted\",\"olive oil\",\"calf liver, thinly sliced\",\"white flour (all purpose)\",\"wine vinegar\",\"ground pepper to taste\",\"[optional]\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/253.jpg', 'https://www.soscuisine.com//recipe/calf-liver-venetian-style', '', '20 min', '300 kcal', '{\"calories\":\"300\",\"fat\":\"19 g\",\"cholesterol\":\"360 mg\",\"protein\":\"21 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Copper, Folacin, Iron, Niacin, Pantothenic Acid, Phosphorus, Selenium, Vitamin A, Vitamin B12, Vitamin B2, Vitamin B6, Zinc\",\"good_source_of\":\"Manganese, Vitamin E\",\"source_of\":\"Magnesium, Potassium, Vitamin B1, Vitamin K\",\"low\":\"Sodium\"}', '2021-06-18 14:17:12'),
(443, 443, 1, 'Buckwheat Pancake with Egg', 'Combine the flour, salt, baking soda and water in a bowl. Mix well, using a whip, until the texture is smooth. Let stand in the refrigerator about 1-2 h to obtain a lighter texture. Grease a non-stick frying pan, then put it over medium heat. Pour about ¼ to &frac13; cup of the batter onto the center of the pan. Spread it rapidly, either by whirling the pan or using a spatula. After about 2 min, when the pancake turns golden-brown, flip it and cook about 1 more minute. Keep the cooked pancakes in the oven while preparing the rest. Repeat the operation with the remaining batter. Meanwhile, heat the margarine in another pan over medium-low heat and cook the eggs. Place one egg on top of each pancake then serve.', '[\"buckwheat flour\",\"salt\",\"baking soda\",\"water, cold\",\"canola oil\",\"margarine non-hydrogenated\",\"eggs size large\"]', 'https://media.soscuisine.com/images/recettes/2801.jpg', 'https://www.soscuisine.com//recipe/buckwheat-pancake-egg', '', '25 min', '230 kcal', '{\"calories\":\"230\",\"fat\":\"11 g\",\"cholesterol\":\"220 mg\",\"protein\":\"11 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Magnesium, Manganese, Selenium, Vitamin B12\",\"good_source_of\":\"Folacin, Iron, Niacin, Phosphorus, Vitamin B2, Vitamin D, Zinc\",\"source_of\":\"Copper, Fibre, Omega-3, Pantothenic Acid, Potassium, Vitamin A, Vitamin B1, Vitamin B6, Vitamin E, Vitamin K\"}', '2021-06-18 14:17:13');
INSERT INTO `recipe_translation` (`rt_id`, `rt_recipe_id`, `rt_lang_id`, `rt_recipe_name`, `rt_recipe_text`, `rt_recipe_ingredients_full`, `rt_recipe_image`, `rt_recipe_link`, `rt_recipe_prep`, `rt_recipe_duration`, `rt_recipe_calories`, `rt_recipe_nutrients`, `rt_recipe_claims`, `rt_created`) VALUES
(444, 444, 1, 'Buckwheat Pancake with Smoked Salmon', 'Combine the flour, salt, baking soda and water in a bowl. Mix well, using a whip, until the texture is smooth. Let stand in the refrigerator about 1-2 h to obtain a lighter texture. Grease a non-stick frying pan, then put it over medium heat. Pour about ¼ to &frac13; cup of the batter onto the center of the pan. Spread it rapidly, either by whirling the pan or using a spatula. After about 2 min, when the pancake turns golden-brown, flip it and cook about 1 more minute. Keep the cooked pancakes in the oven while preparing the rest. Repeat the operation with the remaing batter. Garnish each pancake with sour cream, smoked salmon and dill, then serve.', '[\"buckwheat flour\",\"salt\",\"baking soda\",\"water, cold\",\"canola oil\",\"sour cream\",\"smoked salmon\",\"fresh dill\"]', 'https://media.soscuisine.com/images/recettes/2788.jpg', 'https://www.soscuisine.com//recipe/buckwheat-pancake-smoked-salmon', '', '25 min', '190 kcal', '{\"calories\":\"190\",\"fat\":\"7 g\",\"cholesterol\":\"10 mg\",\"protein\":\"10 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Magnesium, Manganese, Vitamin B12, Vitamin D\",\"good_source_of\":\"Niacin, Phosphorus, Selenium, Vitamin B6\",\"source_of\":\"Copper, Fibre, Folacin, Iron, Omega-3, Pantothenic Acid, Potassium, Vitamin B1, Vitamin B2, Vitamin E, Vitamin K, Zinc\"}', '2021-06-18 14:17:14'),
(445, 445, 1, 'Butter Carrots', 'Prepare the carrots : Slice into thin rounds (3-4 mm). Heat the butter and oil in a pan over medium heat, taking care not to let them burn. Add the rounds. Cook 5 min uncovered, stirring frequently. Add salt, cover and cook on low heat about 20 min, or until the carrots are soft.', '[\"carrots, cut into 3-4 mm rounds\",\"butter, unsalted\",\"canola oil\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/14.jpg', 'https://www.soscuisine.com//recipe/butter-carrots', '', '32 min', '110 kcal', '{\"calories\":\"110\",\"fat\":\"7 g\",\"cholesterol\":\"10 mg\",\"protein\":\"1 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Vitamin A, Vitamin K\",\"good_source_of\":\"Potassium\",\"source_of\":\"Fibre, Folacin, Magnesium, Manganese, Niacin, Pantothenic Acid, Vitamin B1, Vitamin B6, Vitamin C, Vitamin E\",\"low\":\"Sodium\"}', '2021-06-18 14:17:16'),
(446, 446, 1, 'Buttered Broccoli PurÃÂ©e', 'Prepare\r\nthe broccoli : remove the stalks and set them aside for another use. Blanch the florets in a pot of salted boiling water 4-5 min\r\nuntil tender-crisp. Drain the broccoli, keeping some of the cooking water for\r\nthe purée. Immediately plunge the broccoli into a bowl of cold\r\nwater to stop cooking (this also helps keeping them green), then put it in a blender food\r\nprocessor , adding just enough of the cooking water to dilute the purée (about ½ cup). Add\r\nsalt and pepper. Set aside. Melt the butter in a little saucepan over very\r\nlow heat and cook a few minutes until it reaches a light hazelnut colour, taking care not to let it burn. Pour the hazelnut butter\r\nover the broccoli purée, mix well, adjust\r\nthe seasoning and serve.', '[\"broccoli, cut into florets and diced stalks\",\"butter, unsalted\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/504.jpg', 'https://www.soscuisine.com//recipe/buttered-broccoli-puree', 'will be very useful to purée the broccoli.', '15 min', '70 kcal', '{\"calories\":\"70\",\"fat\":\"6 g\",\"cholesterol\":\"10 mg\",\"protein\":\"2 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Vitamin C, Vitamin K\",\"good_source_of\":\"Folacin, Vitamin A\",\"source_of\":\"Magnesium, Manganese, Pantothenic Acid, Vitamin B6, Vitamin E\",\"low\":\"Sodium\"}', '2021-06-18 14:17:17'),
(447, 447, 1, 'Buttered Fiddleheads', 'Prepare the fiddleheads : wash them well and soak them at least 10 min. Steam them 10 min or blanch them 15 min in a pot of boiling salted water. Drain them and shake a few times to remove excess water. Return the fiddleheads to the pan, add the butter, and season with salt and pepper to taste. Cook an additional couple minutes over low heat, with stirring , until the butter has melted and the fiddleheads are well coated and lightly coloured. Serve.', '[\"fiddleheads\",\"butter, unsalted\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/462.jpg', 'https://www.soscuisine.com//recipe/buttered-fiddleheads', 'Fiddleheads may be poisonous if eaten raw. Make sure you wash them well, soak at least 10 minutes to reduce their bitterness, and cook them in plenty of water.', '15 min', '70 kcal', '{\"calories\":\"70\",\"fat\":\"4 g\",\"cholesterol\":\"10 mg\",\"protein\":\"5 g\"}', '{\"excellent_source_of\":\"Manganese, Niacin, Vitamin A\",\"good_source_of\":\"Copper, Potassium, Vitamin C\",\"source_of\":\"Iron, Magnesium, Phosphorus, Vitamin B2, Zinc\",\"free\":\"Sodium, Sugar\"}', '2021-06-18 14:17:18'),
(448, 448, 1, 'Buttered Parsley Roots', 'Slice the parsley roots into thin rounds (3-4 mm). Heat the butter and oil in a pan over medium heat, taking care not to let them burn. Add the parsley roots, then cook 3-4 min uncovered, stirring frequently. Reduce the heat to \'low\', add salt, cover and cook until the parsley roots are soft, about 10 min.', '[\"parsley roots, cut into 3-4 mm rounds\",\"butter, unsalted\",\"olive oil\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1108.jpg', 'https://www.soscuisine.com//recipe/buttered-parsley-roots', '', '20 min', '130 kcal', '{\"calories\":\"130\",\"fat\":\"7 g\",\"cholesterol\":\"10 mg\",\"protein\":\"3 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Manganese, Potassium, Vitamin C, Vitamin E\",\"good_source_of\":\"Copper, Fibre, Magnesium, Vitamin B6, Zinc\",\"source_of\":\"Calcium, Iron, Niacin, Phosphorus, Vitamin B1, Vitamin B2\",\"low\":\"Sodium\"}', '2021-06-18 14:17:20'),
(449, 449, 1, 'Cabbage and Apple Salad', 'Put the vinegar, brown sugar, oil and water in a saucepan. Heat 4 min over medium heat. Remove the pan from the heat then add the mayonnaise, paprika , salt, and pepper and mix well. Set aside. Prepare the cabbage and green onions. Thinly slice them and put the slices in a salad bowl. Peel, core and thinly slice the apple(s), then add the slices to the bowl. Pour in the vinaigrette and mix well. Adjust the seasoning Cover with plastic wrap and chill in the refrigerator for at least 1 h before serving.', '[\"white vinegar\",\"brown sugar\",\"canola oil\",\"water\",\"mayonnaise\",\"paprika\",\"green cabbage, or Savoy, thinly sliced\",\"green onions\\/scallions, thinly sliced\",\"apples, green, Granny Smith type, thinly sliced\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/238.jpg', 'https://www.soscuisine.com//recipe/cabbage-apple-salad', 'will make slicing easier.', '15 min', '240 kcal', '{\"calories\":\"240\",\"fat\":\"19 g\",\"cholesterol\":\"10 mg\",\"protein\":\"2 g\"}', '{\"excellent_source_of\":\"Folacin, Vitamin K\",\"good_source_of\":\"Vitamin A, Vitamin B6, Vitamin C, Vitamin E\",\"source_of\":\"Copper, Fibre, Iron, Magnesium, Manganese, Omega-3, Omega-6, Potassium, Vitamin B1\",\"low\":\"Sodium\"}', '2021-06-18 14:17:20'),
(450, 450, 1, 'Cabbage Soup', 'Prepare the vegetables : thinly slice the onions; finely chop the cabbage; shred the carrots. Heat the oil and butter in a saucepan over medium heat. Add the vegetables, sugar, salt, and pepper. well, then cover and cook 25 min over very low heat. Pour in the , bring to a boil, then cover and simmer 15 min. Pour in the milk, then adjust\r\nthe seasoning Ladle the soup into bowls and serve.', '[\"onions, thinly sliced\",\"green cabbage, or Savoy, finely chopped\",\"carrots, shredded\",\"canola oil\",\"butter, unsalted\",\"sugar\",\"salt\",\"ground pepper\",\"chicken broth\",\"milk, partly skimmed, 2%\"]', 'https://media.soscuisine.com/images/recettes/767.jpg', 'https://www.soscuisine.com//recipe/cabbage-soup', 'will make chopping the vegetables easier.', '60 min', '150 kcal', '{\"calories\":\"150\",\"fat\":\"6 g\",\"cholesterol\":\"10 mg\",\"protein\":\"5 g\"}', '{\"excellent_source_of\":\"Vitamin A\",\"good_source_of\":\"Folacin, Potassium, Vitamin B12, Vitamin D\",\"source_of\":\"Calcium, Fibre, Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Selenium, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin C, Vitamin E, Vitamin K, Zinc\"}', '2021-06-18 14:17:21'),
(451, 451, 1, 'Caramelized Peaches', 'Take the peaches out of the can, drain them, reserving the syrup then set them aside. Pour the peach syrup in a pan and reduce over medium heat 6-7 min until it is lightly caramelized and golden-coloured. Add the peaches to the pan and cook 2-3 min, then add the cream and lemon juice. Cook an additional 1-2 min. Let the peaches and syrup cool down a few minutes, then transfer all to a bowl, cover and chill in the refrigerator at least 1 hour before serving. Spoon the peaches into cups, sprinkle the pistachios on top, and serve.', '[\"canned peaches (with syrup)\",\"whipping cream 35%\",\"lemon juice, freshly squeezed\",\"pistachios, shelled, unsalted\"]', 'https://media.soscuisine.com/images/recettes/761.jpg', 'https://www.soscuisine.com//recipe/caramelised-peaches', '', '15 min', '160 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"source_of\":\"Copper, Fibre, Iron, Magnesium, Manganese, Niacin, Potassium, Vitamin A, Vitamin B6, Vitamin C, Vitamin E, Vitamin K\",\"low\":\"Cholesterol, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:17:21'),
(452, 452, 1, 'Cardamon-Coffee Custard', 'Preheat the oven to 160°C/325°F. Put the cream, cardamom, vanilla, salt and coffee in a saucepan. Heat 5 min over medium-low heat, paying attention not to let it boil. Remove from the heat and set aside to infuse and cool down for 15 min. Meanwhile, separate the egg whites and yolks for the required number of yolks. Set aside in a glass jar with a lid the whites that are not used in this recipe. Put the yolks in a bowl, with the whole egg(s) and the sugar, then using an electric until the mixture is pale and form ribbons , about 3-4 min. Strain the cream mixture through a fine sieve\r\nto remove the spices, then pour into the egg preparation slowly while gently folding using a whisk. Spoon the mixture into ramekins Put a towel or piece of cloth into a large baking-pan (either a rectangular cake-mould or a roasting pan). Place the ramekins on the cloth and fill the pan with enough hot water to reach halfway up the sides of the ramekins Bake in the middle of the oven for about 45 min: the centre will still tremble slightly when moved and will continue to set as it cools. Take the ramekins out of the water bath right away to avoid overcooking. Let them cool down 20 min at room temperature, then cover them with a plastic wrap and chill at least 2 h in the refrigerator. Serve.', '[\"cream 15%\",\"cardamom pods\",\"vanilla extract\",\"salt\",\"coffee (liquid), strong (espresso), lukewarm\",\"egg yolks\",\"eggs size large\",\"sugar\",\"plastic wrap\"]', 'https://media.soscuisine.com/images/recettes/2733.jpg', 'https://www.soscuisine.com//recipe/cardamon-coffee-custard', '', '65 min', '180 kcal', '{\"calories\":\"180\",\"fat\":\"13 g\",\"cholesterol\":\"210 mg\",\"protein\":\"5 g\"}', '{\"excellent_source_of\":\"Vitamin B12\",\"good_source_of\":\"Pantothenic Acid, Selenium\",\"source_of\":\"Calcium, Folacin, Phosphorus, Vitamin A, Vitamin B2, Vitamin D, Vitamin E, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:17:22'),
(453, 453, 1, 'Carrot and Mint Soup', 'Prepare the carrots and onions . Peel and cut into 3 cm pieces. Melt the butter in a saucepan over medium heat. Add the carrots and onions and cook 5 min, with occasional stirring . Add the and milk, bring to a boil, then lower the heat. Cover and simmer about 15 min, until the vegetables are soft. Purée in a blender until smooth. Add the chopped mint, Worcestershire sauce, salt, and pepper. Ladle the soup into bowls. Garnish each with a dollop of yogurt and fresh mint leaves, then serve.', '[\"carrots, cut into 3 cm pieces\",\"onions, cut into 3 cm pieces\",\"butter, unsalted\",\"chicken broth\",\"milk, partly skimmed, 2%\",\"fresh mint, chopped\",\"Worcestershire sauce\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"yogurt, plain, 2%\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/214.jpg', 'https://www.soscuisine.com//recipe/carrot-mint-soup', 'will be very useful to purée the soup.', '30 min', '120 kcal', '{\"calories\":\"120\",\"fat\":\"5 g\",\"cholesterol\":\"10 mg\",\"protein\":\"5 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Vitamin A\",\"good_source_of\":\"Potassium, Vitamin B12, Vitamin B2, Vitamin D, Vitamin K\",\"source_of\":\"Calcium, Fibre, Folacin, Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Selenium, Vitamin B1, Vitamin B6, Vitamin E, Zinc\"}', '2021-06-18 14:17:23'),
(454, 454, 1, 'Carrot and Miso Soup', 'Prepare the vegetables : chop them coarsely. In a pot, the onion in oil over medium heat for about 3-4 min. Add the carrots, orange juice, coarsely grated ginger, and . Bring to a boil, lower the heat, cover and simmer until the carrots are tender, about 25 min. Far from heat, in the miso and soy preparation. Purée the soup in a blender processor Adjust the seasoning then serve.', '[\"canola oil\",\"onions, coarsely chopped\",\"carrots, coarsely chopped\",\"orange juice, freshly squeezed\",\"gingerroot, coarsely grated\",\"vegetable broth\",\"miso (fermented soybean paste)\",\"creamy soy preparation for cooking\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/3356.jpg', 'https://www.soscuisine.com//recipe/carrot-miso-soup', 'will be very useful to purée the soup.', '40 min', '160 kcal', '{\"calories\":\"160\",\"fat\":\"4 g\",\"cholesterol\":\"0 mg\",\"protein\":\"4 g\"}', '{\"excellent_source_of\":\"Potassium, Vitamin A, Vitamin C, Vitamin K\",\"good_source_of\":\"Fibre, Folacin, Magnesium, Manganese, Vitamin B6\",\"source_of\":\"Calcium, Copper, Iron, Niacin, Pantothenic Acid, Phosphorus, Selenium, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin E, Zinc\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:17:26'),
(455, 455, 1, 'Carrot Nut Cake', 'Preheat the oven to 160°C/325°F. Generously oil a bundt cake pan. food processor , powder the almonds and walnuts. Transfer the nuts to a bowl and set aside. In the food processor , put the carrots, brown and regular sugar. Mix at high speed until it becomes a thick purée. Add the eggs, salt, flour, powdered nuts, baking powder and cinnamon. Pulse until you have\r\n    a smooth batter. Pour the batter into the prepared pan, spreading it evenly, then bake the cake in the middle of the oven for 10 min. increase the temperature to 175°C/350°F and continue baking for 45 min, until golden-brown. with a toothpick or skewer to see if the cake is cooked through. Cool the cake at least 10 min in the pan, then remove it from the pan and let it cool on a wire rack for at least 30 min before slicing. Sprinkle with powdered sugar before serving.', '[\"canola oil, for the cake pan\",\"whole wheat flour\",\"eggs size large\",\"carrots, thinly sliced\",\"brown sugar\",\"sugar\",\"almonds\",\"walnuts\",\"salt\",\"baking powder\",\"ground cinnamon\",\"icing\\/confectioners\' sugar\"]', 'https://media.soscuisine.com/images/recettes/3440.jpg', 'https://www.soscuisine.com//recipe/carrot-nut-cake', 'will be very useful for this recipe.', '75 min', '350 kcal', '{\"calories\":\"350\",\"fat\":\"18 g\",\"cholesterol\":\"80 mg\",\"protein\":\"10 g\"}', '{\"excellent_source_of\":\"Magnesium, Manganese, Selenium, Vitamin A, Vitamin E\",\"good_source_of\":\"Copper, Fibre, Folacin, Niacin, Phosphorus, Vitamin B2, Zinc\",\"source_of\":\"Calcium, Iron, Omega-3, Omega-6, Pantothenic Acid, Potassium, Vitamin B1, Vitamin B12, Vitamin B6, Vitamin D\",\"low\":\"Sodium\"}', '2021-06-18 14:17:30'),
(456, 456, 1, 'Carrot Soup with Orange and Ginger', 'Prepare the vegetables : chop them coarsely. In a pot, the onion in oil over medium heat for about 3-4 min. Add the carrots, orange juice, coarsely grated ginger, and water. Bring to a boil, lower the heat, cover and simmer until the carrots are tender, about 25 min. Purée the soup in a blender processor , then pour it back into the pot. in the cream and just warm the soup a few minutes. Adjust the seasoning then serve.', '[\"canola oil\",\"onions, coarsely chopped\",\"carrots, coarsely chopped\",\"orange juice, freshly squeezed\",\"gingerroot, coarsely grated\",\"chicken broth\",\"water\",\"cream 15%\",\"[optional]\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/265.jpg', 'https://www.soscuisine.com//recipe/carrot-soup-orange-ginger', 'will be very useful to purée the soup.', '40 min', '120 kcal', '{\"calories\":\"120\",\"fat\":\"3 g\",\"cholesterol\":\"0 mg\",\"protein\":\"2 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Potassium, Vitamin A, Vitamin C, Vitamin K\",\"good_source_of\":\"Fibre, Folacin, Vitamin B6\",\"source_of\":\"Calcium, Copper, Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin B2, Vitamin E\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:17:35'),
(457, 457, 1, 'Carrots and Leeks with Fresh Mint', 'Preheat the oven to 195°C/375°F. Prepare the carrots and cut them into rounds about 1 cm thick. Prepare the leeks , remove about ¼ of the dark-green part, and cut them into 2 cm pieces. Transfer the vegetables to a baking sheet or dish (do not choose one that is too large, since the vegetables will reduce considerably in size while cooking). Add the oil, minced ginger, salt and pepper. Mix well to coat thoroughly with oil, then put in the oven and bake about 35 min. Finely chop half of the mint leaves then add them to the dish, mix and continue baking for about 15 min more. Garnish with the remaining mint leaves and serve.', '[\"carrots, cut into 1 cm rounds\",\"leeks, cut into 2 cm pieces\",\"olive oil\",\"gingerroot, grated\",\"fresh mint\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/208.jpg', 'https://www.soscuisine.com//recipe/carrots-leeks-fresh-mint', '', '60 min', '170 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Folacin, Vitamin A, Vitamin E, Vitamin K\",\"good_source_of\":\"Fibre, Manganese, Potassium, Vitamin B6\",\"source_of\":\"Calcium, Copper, Iron, Magnesium, Niacin, Phosphorus, Vitamin B1, Vitamin C\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:17:38'),
(458, 458, 1, 'Cauliflower \"Popcorn\"', 'Preheat the oven to 230°C/450°F. Line a large baking sheet with parchment\r\npaper Add the oil, vinegar, spices, and salt to a large bowl. Cut the cauliflower into equal-size small florets, then add them to the vinaigrette bowl. to coat well. Spread the florets in single layer on the prepared baking sheet. Roast in the middle of the oven until golden and tender-crisp, stirring occasionally, about 25-30 min. Serve warm or at room temperature.', '[\"parchment paper\",\"olive oil\",\"wine vinegar\",\"paprika\",\"cayenne pepper, or more, to taste\",\"[optional]\",\"salt\",\"[optional]\",\"cauliflower, cut into small, equal-size florets\"]', 'https://media.soscuisine.com/images/recettes/2759.jpg', 'https://www.soscuisine.com//recipe/cauliflower-popcorn', '', '40 min', '90 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Folacin, Vitamin C, Vitamin K\",\"source_of\":\"Magnesium, Manganese, Pantothenic Acid, Potassium, Vitamin B6, Vitamin E\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:17:41'),
(459, 459, 1, 'Cauliflower Rice', 'Prepare the cauliflower : Cut into equal-size florets. Transfer to a food processor , then pulse until cauliflower is crumbly (texture similar to rice). Heat the oil in a pan over medium-high heat. Add the shallot and sauté stirring until translucent, 2-3 min. Add the cauliflower and a pinch of salt, mix well. Cook until cauliflower is cooked al dente , about 3 min. Drizzle with lemon juice then serve.', '[\"cauliflower, cut into florets\",\"coconut oil\",\"salt\",\"[optional]\",\"shallots, finely diced\",\"lemon juice, freshly squeezed\"]', 'https://media.soscuisine.com/images/recettes/4149.jpg', 'https://www.soscuisine.com//recipe/cauliflower-rice', 'will be very useful.', '20 min', '150 kcal', '{\"calories\":\"150\",\"fat\":\"14 g\",\"cholesterol\":\"0 mg\",\"protein\":\"2 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Vitamin C\",\"good_source_of\":\"Folacin, Vitamin K\",\"source_of\":\"Magnesium, Manganese, Pantothenic Acid, Potassium, Vitamin B6\",\"low\":\"Sodium\"}', '2021-06-18 14:17:44'),
(460, 460, 1, 'Celeriac and Leek Soup', 'Prepare the vegetables : Wash the leeks well, remove and discard the dark-green part, then chop them finely. Peel the celeriac, then cut into 1-2 cm pieces Heat the butter and oil in a saucepan. Add the leeks, then sauté over low heat until the leeks are softened, about 6 min, with occasional stirring . Add the celeriac, then cook 2 min with stirring. Pour in the and water, bring to a boil, then simmer , covered, about 30-35 min, until the celeriac is very tender. Purée the soup in a blender food processor . Return the soup to the saucepan. Pour in the cream, season with salt and pepper, then mix well. If the soup is too thick, thin it with some additional or water. Heat it through then serve.', '[\"leeks, finely chopped\",\"celeriac, cut into 1-2 cm pieces\",\"butter, unsalted\",\"olive oil\",\"chicken broth\",\"water\",\"cream 15%\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/856.jpg', 'https://www.soscuisine.com//recipe/celeriac-leek-soup', 'will be very useful to purée the soup.', '50 min', '150 kcal', '{\"calories\":\"150\",\"fat\":\"6 g\",\"cholesterol\":\"10 mg\",\"protein\":\"4 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Manganese, Vitamin A, Vitamin K\",\"good_source_of\":\"Fibre, Iron, Magnesium, Phosphorus, Potassium, Vitamin B6, Vitamin C\",\"source_of\":\"Calcium, Copper, Niacin, Pantothenic Acid, Vitamin B1, Vitamin B2, Vitamin E, Zinc\"}', '2021-06-18 14:17:48'),
(461, 461, 1, 'Cheesecake Fat Bombs', 'Prepare 12 individual small silicon moulds or line the bottom of an 8-inch square baking dish (20 x 20 cm) with parchment paper (which will make it easier to unmold). Melt the butter and coconut oil in the microwave, in 15 seconds intervals. Add the cream cheese and mix well. Add the stevia (optional), lemon juice and zest as well as the grated coconut. Spread the mixture in the lined dish. Melt the chocolate and coconut oil in the microwave, in 15 seconds intervals. Pour over the cream cheese mixture. Refrigerate until firm, about 1 hour. Invert the dish onto a work surface, remove the parchment paper, then cut into 12 squares.', '[\"parchment paper\",\"butter, unsalted\",\"coconut oil\",\"cream cheese\",\"liquid stevia\",\"[optional]\",\"lemons, zest and juice\",\"grated coconut, unsweetened\",\"coconut oil, for the chocolate\",\"unsweetened (dark) chocolate\"]', 'https://media.soscuisine.com/images/recettes/4188.jpg', 'https://www.soscuisine.com//recipe/cheesecake-fat-bombs', '', '15 min', '140 kcal', '{\"calories\":\"140\",\"fat\":\"14 g\",\"cholesterol\":\"20 mg\",\"protein\":\"1 g\"}', '{\"source_of\":\"Vitamin A\",\"low\":\"Sodium\"}', '2021-06-18 14:17:49'),
(462, 462, 1, 'Cheesy Cabbage Gratin', 'Preheat the oven to 175°C/350°F. Cut the cabbage through core into 8 wedges then place them on a baking sheet and drizzle with oil; season lightly with salt and pepper. Roast in the middle of the oven until the cabbage is tender and golden on the edges, about 40 min. Meanwhile, put the shallots, garlic, cream and oregano in a small saucepan. Cook over low heat, covered, stirring occasionally, until shallots and garlic are very soft, about 15 min. Let cool slightly then transfer to a blender and blend until smooth. Rub the inside of a  baking dish with butter. Arrange the cabbage wedges in the dish so they are lying on a cut side; pour cream mixture over. Bake in the middle of the oven, until cream thickens, about 30 min. Take out of the oven then let cool 30 min. Heat the broiler. Sprinkle Gruyère cheese on top of the cabbage. Broil until the gratin is nicely browned, about 4 min. Serve hot.', '[\"green cabbage, or Savoy, cut into 8 wedges\",\"olive oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"garlic\",\"shallots, quartered\",\"dried oregano\",\"whipping cream 35%\",\"butter, unsalted\",\"Gruy\\u00c3\\u00a8re cheese, grated\"]', 'https://media.soscuisine.com/images/recettes/4402.jpg', 'https://www.soscuisine.com//recipe/cheesy-cabbage-gratin', 'will be very useful for this recipe.', '85 min', '210 kcal', '{\"calories\":\"210\",\"fat\":\"19 g\",\"cholesterol\":\"60 mg\",\"protein\":\"4 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Vitamin A, Vitamin K\",\"good_source_of\":\"Vitamin C\",\"source_of\":\"Calcium, Fibre, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin D, Vitamin E, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:17:50'),
(463, 463, 1, 'Cheese-Stuffed Chicken Breast', 'Preheat the oven to 190ºC/375ºF. Peel and core the pears, then slice them thinly. Set aside. Cut each whole chicken breast in half lengthwise. Heat the oil in a pan over medium heat. Add the chicken breasts, then until golden-brown, about 3 min on each side. Season with salt and pepper. Remove the pan from the heat, then let it rest a few minutes. Butterfly the chicken breasts by splitting the thickness in half with a cut starting on one side and slicing to almost, but not completely through to the other side. With the butterflied breasts folded back together, insert the cheese and pear slices inside the cut. Lay the chicken breasts in an ovenproof dish along with any of the cooking juices. Bake in the middle of the oven until the chicken is cooked and the top is browned, 15 min. Serve on the warmed plates.', '[\"chicken breasts, boneless, skinless\",\"olive oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"Oka cheese, or cheddar, sliced\",\"pears, peeled, cored, then thinly sliced\"]', 'https://media.soscuisine.com/images/recettes/1064.jpg', 'https://www.soscuisine.com//recipe/cheese-stuffed-chicken-breast', 'Keep the serving plates warm on the stove while you\'re preparing the dish.', '30 min', '310 kcal', '{\"calories\":\"310\",\"fat\":\"13 g\",\"cholesterol\":\"110 mg\",\"protein\":\"40 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Niacin, Phosphorus, Vitamin B6\",\"good_source_of\":\"Vitamin B12\",\"source_of\":\"Calcium, Iron, Magnesium, Pantothenic Acid, Potassium, Vitamin B1, Vitamin B2, Vitamin E, Zinc\"}', '2021-06-18 14:17:51'),
(464, 464, 1, 'Cherry Clafouti', 'Preheat the oven to 175°C/350°F. Butter a gratin dish that will hold the fruit in one layer; sprinkle the bottom and sides with 1 tablespoon of the sugar. Wash the cherries, pull the stems off, pat them dry, then lay the cherries in the dish. In a bowl, mix the flour, the remaining sugar, and salt. Add one egg at a time beating using a electric mixer after each addition, until the mixture is thick and smooth. Pour in the milk, cream, and vanilla, while continuing to beat until smooth. Pour the batter over the fruit and bake 30 to 50 min, depending on the servings, or until the clafouti is nicely browned on top and a tooth-pick inserted into it comes out clean. Let the clafouti cool down 15-20 min, sift confectioners\' sugar over it and serve luke-warm.', '[\"butter, unsalted, to grease the dish\",\"sugar\",\"cherries, dark red \\\"bing\\\"\",\"white flour (all purpose)\",\"salt\",\"eggs size large\",\"milk, partly skimmed, 2%\",\"whipping cream 35%\",\"vanilla extract\",\"icing\\/confectioners\' sugar\"]', 'https://media.soscuisine.com/images/recettes/924.jpg', 'https://www.soscuisine.com//recipe/cherry-clafouti', '', '45 min', '290 kcal', '{\"calories\":\"290\",\"fat\":\"11 g\",\"cholesterol\":\"130 mg\",\"protein\":\"8 g\"}', '{\"excellent_source_of\":\"Selenium, Vitamin B12\",\"good_source_of\":\"Folacin, Vitamin B2, Vitamin D\",\"source_of\":\"Calcium, Fibre, Iron, Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Potassium, Vitamin A, Vitamin B1, Vitamin E, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:17:52'),
(465, 465, 1, 'Chickpea and Pasta Soup', 'Prepare the vegetables : coarsely chop the onion; peel the potatoes, leaving them whole; cut the Swiss chard into 2 or 3 pieces (if using spinach, leave them whole). Set aside. Heat the oil in a pot over medium-low heat. Add the onion and sauté 3-4 min, with\r\noccasional stirring , until it becomes translucent. Add the chickpeas and potatoes, then cook 1-2 min with stirring .\r\nPour in the water, , salt and pepper. Bring to a boil, then reduce the heat and simmer ,\r\ncovered, about 45 min, until the chickpeas are softened, but al dente (if\r\novercooked, the chickpeas do not fall apart as other legumes, but become\r\n\"pasty\"). If using a pressure\r\ncooker , the cooking time is reduced to 12-15 min. Take the potatoes and about 2 ladles of chickpeas out of the pot and put them in a blender or in a food-mill . Purée the mixture, then put it back\r\ninto the pot with the soup. While the chickpeas are cooking, blanch the Swiss chard 4-5 min in a pot of salted boiling water. If using spinach, cook them 3-4 min\r\nwithout adding any water: the water trapped in the leaves after washing them is enough to cook the spinach. Drain the Swiss chard or spinach using a colander ,\r\npress to remove excess water, then chop them and add them to the chickpea pot. Cook an additional 2-3 min over medium-high heat, with occasional stirring :\r\nthe chickpea soup is ready and may be set aside in the refrigerator or freezer for later use. When ready to serve, pour the soup into a saucepan or pot, add about cup (65 ml) of water per serving and bring to a boil. Add about 1 tablespoons (10 g) of pasta per serving, cover,\r\nand cook about 6-7 min, over low heat. Ladle the soup into bowls, sprinkle with grated Parmesan cheese and serve.', '[\"chickpeas \\/ Garbanzo beans (dried), soaked then drained\",\"onions, coarsely chopped\",\"potatoes, peeled, whole\",\"Swiss chard, or spinach, cut into 2-3 pieces\",\"olive oil\",\"water\",\"vegetable broth\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"water, to cook the pasta\",\"mezzi tubetti (pasta for soups)\",\"Parmesan cheese, grated\"]', 'https://media.soscuisine.com/images/recettes/497.jpg', 'https://www.soscuisine.com//recipe/chickpea-pasta-soup-vegetarian', '', '70 min', '250 kcal', '{\"calories\":\"250\",\"fat\":\"5 g\",\"cholesterol\":\"0 mg\",\"protein\":\"11 g\"}', '{\"excellent_source_of\":\"Copper, Folacin, Iron, Magnesium, Manganese, Potassium, Vitamin A, Vitamin K\",\"good_source_of\":\"Fibre, Phosphorus, Selenium, Vitamin B1, Vitamin B6, Vitamin C, Zinc\",\"source_of\":\"Calcium, Niacin, Pantothenic Acid, Vitamin B2, Vitamin E\",\"low\":\"Calories, Cholesterol, Fat, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:17:53'),
(466, 466, 1, 'Choco-Hazelnut Spread', 'Preheat the oven to 175°C/350°F. Spread out nuts on a baking sheet. Roast, shaking sheet once for even toasting, until deep brown, 13-15 min. Let cool completely. If nuts have skins, rub them in a kitchen towel to remove. Meanwhile, place chocolate in a medium metal bowl. Set bowl over a large saucepan of simmering water, stirring often until chocolate is melted and smooth. Let cool down a little bit. Put the brown sugar into a food processor and pulse 2-3 min until very finely ground. Stop the motor, add the cooled nuts, then process 2-3 min until they release some oil and an evenly blended and shiny  paste is formed. If desired, oil may be added for a creamier consistency. Add the milk, alternating with the chocolate, and work the mixture into an evenly blended paste. Finally, pour the spread into a jar and let cool. (The spread will thicken  and become soft and peanut butter-  like as it cools.) Screw on lid.', '[\"hazelnuts, shelled\",\"unsweetened (dark) chocolate, coarsely chopped into pieces\",\"brown sugar\",\"milk, partly skimmed, 2%\",\"peanut oil\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2729.jpg', 'https://www.soscuisine.com//recipe/choco-hazelnut-spread', 'will be very useful', '15 min', '70 kcal', '{\"calories\":\"70\",\"fat\":\"3 g\",\"cholesterol\":\"0 mg\",\"protein\":\"1 g\"}', '{\"source_of\":\"Manganese\",\"low\":\"Sodium\"}', '2021-06-18 14:17:54'),
(467, 467, 1, 'Choco-Pumpkin Tiles', 'Line the bottom of an 8-inch square baking dish (20 x 20 cm) with parchment paper (which will make it easier to unmold). Melt the chocolate and coconut oil in the microwave, in 15 seconds intervals. Add the peanut butter. Mix well. Pour the mixture into the prepared dish. Sprinkle with pumpkin seeds and salt, then refrigerate until firm, about 1 hour. Invert the dish onto a work surface, remove the parchment paper, then cut into 16 squares or diamond shaped pieces.', '[\"parchment paper\",\"unsweetened (dark) chocolate, chopped\",\"coconut oil\",\"peanut butter, natural\",\"[optional]\",\"salt\",\"pumpkin seeds\"]', 'https://media.soscuisine.com/images/recettes/4115.jpg', 'https://www.soscuisine.com//recipe/choco-pumpkin-tiles', '', '15 min', '70 kcal', '{\"calories\":\"70\",\"fat\":\"6 g\",\"cholesterol\":\"0 mg\",\"protein\":\"1 g\"}', '{\"free\":\"Sodium\"}', '2021-06-18 14:17:55'),
(468, 468, 1, 'Cheese-Topped Carrots and Parsnips', 'Preheat the oven to 175ºC/350ºF. Butter a baking dish. Prepare the vegetables : Peel the carrots and parsnips, then slice them lengthwise into 3-4 mm thick slices using a mandolin . If you cannot cook the parsnips soon after slicing, put the slices in a bowl of water with some lemon juice to avoid discoloration. the garlic, then put it in a small bowl. Pour in the cream, add salt and pepper, then mix well. Grate the cheese then put in another bowl. Cover the bottom of the prepared baking dish with a first layer of carrots. Pour a few tablespoons of the cream mixture over the carrots, then cover with grated cheese. Repeat the operation with a parsnip layer and so on, finishing with grated cheese on top. The dish can be filled to the very top, since the layers will be compacted during cooking. Cover the dish with aluminum foil, then put it in the middle of the oven. Bake for 1 h to 2 h, depending on the quantity of the vegetables and the size of the dish. Take out the cover during the last 15 min to allow for a nice crust. Let the gratin stand 10 min before cutting and serving it.', '[\"carrots, sliced lengthwise into 3-4 mm thick slices\",\"parsnips, sliced lengthwise into 3-4 mm thick slices\",\"garlic, pressed\",\"cream 15%\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"Emmenthal cheese, or Gruy\\u00c3\\u00a8re\",\"butter, unsalted, to grease the baking dish\",\"aluminum foil\"]', 'https://media.soscuisine.com/images/recettes/782.jpg', 'https://www.soscuisine.com//recipe/cheese-topped-carrots-parsnips', 'will make slicing the vegetables easier.', '100 min', '390 kcal', '{\"calories\":\"390\",\"fat\":\"25 g\",\"cholesterol\":\"80 mg\",\"protein\":\"17 g\"}', '{\"diet-related_health_claims\":\"Bone-healthy\",\"free\":\"Added Sugar\",\"excellent_source_of\":\"Calcium, Folacin, Manganese, Phosphorus, Potassium, Vitamin A, Vitamin B12, Vitamin K, Zinc\",\"good_source_of\":\"Fibre, Magnesium, Niacin, Pantothenic Acid, Selenium, Vitamin B2, Vitamin B6, Vitamin D, Vitamin E\",\"source_of\":\"Copper, Iron, Vitamin B1, Vitamin C\",\"low\":\"Sodium\"}', '2021-06-18 14:17:55'),
(469, 469, 1, 'Choco-Raspberry Muffins', 'Preheat the oven to 160°C/325°F. Place 12 large paper muffin cups in a 12 cup muffin pan. Put the cashew in a food processor and process until it as the consistency of nut butter. Set aside. In a bowl, combine the flours, baking powder, cinnamon, and salt. Set aside. In a large mixing bowl, the egg whites using a soft peaks form. Add the mashed bananas, cashew butter and honey, then fold in using a spatula. Mix in the dry ingredients. Mix until homogeneous, then gently fold in the dark chocolate, raspberries, and walnuts. Using an ice cream scoop, spoon the batter into the prepared muffin cups. Bake in the middle of the oven for about 40 min, until a tooth-pick inserted into the center of a muffin comes out clean. Take the pan out of the oven, then put each of the paper lined muffins on a rack to cool. Serve.', '[\"whole wheat flour\",\"white flour (all purpose)\",\"baking powder\",\"salt\",\"ground cinnamon\",\"vanilla extract\",\"egg whites\",\"bananas, small, very ripe, mashed\",\"cashews\",\"honey\",\"unsweetened (dark) chocolate, coarsely chopped\",\"raspberries\",\"walnuts, chopped\"]', 'https://media.soscuisine.com/images/recettes/3282.jpg', 'https://www.soscuisine.com//recipe/choco-raspberry-muffins', '', '55 min', '260 kcal', '{\"calories\":\"260\",\"fat\":\"10 g\",\"cholesterol\":\"0 mg\",\"protein\":\"8 g\"}', '{\"excellent_source_of\":\"Magnesium, Manganese, Selenium\",\"good_source_of\":\"Copper, Fibre, Folacin, Iron, Niacin, Phosphorus, Vitamin B1\",\"source_of\":\"Calcium, Pantothenic Acid, Potassium, Vitamin B2, Vitamin B6, Vitamin C, Vitamin K, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:17:56'),
(470, 470, 1, 'Chocolate Fondue', 'Pour the cream in a small pot, then heat over low flame until warm, but do not bring to a boil. Remove from heat then add the chocolate. Let melt 2 min, then , using a , until the mixture becomes smooth. Transfer to a fondue pot and put it on top of a burner. If the fondue is too thick to your taste, in some more cream (or your preferred liquor). Each guest dips with various fruits and enjoy.', '[\"whipping cream 35%\",\"unsweetened (dark) chocolate, or other type\",\"strawberries\",\"bananas, small, cut into rounds\",\"clementines, quartered\",\"grapes, seedless\"]', 'https://media.soscuisine.com/images/recettes/2815.jpg', 'https://www.soscuisine.com//recipe/chocolate-fondue', '', '20 min', '460 kcal', '{\"calories\":\"460\",\"fat\":\"30 g\",\"cholesterol\":\"60 mg\",\"protein\":\"5 g\"}', '{\"excellent_source_of\":\"Vitamin C\",\"good_source_of\":\"Fibre, Iron, Manganese, Vitamin A\",\"source_of\":\"Calcium, Folacin, Magnesium, Potassium, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin D, Vitamin E\",\"low\":\"Sodium\"}', '2021-06-18 14:17:57'),
(471, 471, 1, 'Chocolate Hazelnut Delight', 'Mix the sugar, flour, 1 pinch of salt, cinnamon and milk in a microwave-proof dish. Add the butter and chocolate. Cook about 7 min at maximum power, stirring frequently, until the mixture boils. It should slightly thicken. In another bowl, mix the egg with some of the warm chocolate mixture. Pour this into the chocolate mixture and thoroughly to avoid lumps. Cook 2 min at medium power, stirring frequently, until the mixture thickens. Do not let it boil. Incorporate the vanilla and the hazelnuts. Pour out into 2/3 cup bowls. Place rounds of wax paper on the surface if you wish to prevent a skin forming. Chill 2 h before serving.', '[\"unsweetened (dark) chocolate\",\"sugar\",\"milk, partly skimmed, 2%\",\"eggs size large\",\"white flour (all purpose)\",\"butter, unsalted\",\"hazelnuts, shelled\",\"ground cinnamon\",\"vanilla extract\",\"salt, one pinch\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/52.jpg', 'https://www.soscuisine.com//recipe/chocolate-hazelnut-delight', 'Please consider the cooking times suggested here as a reference only, since they depend on the power of your microwave oven. If you are making the 12 serving size recipe, it is preferable to make the 6 serving size recipe twice, for more consistent results.', '20 min', '300 kcal', '{\"calories\":\"300\",\"fat\":\"16 g\",\"cholesterol\":\"60 mg\",\"protein\":\"6 g\"}', '{\"excellent_source_of\":\"Vitamin B12\",\"good_source_of\":\"Manganese, Vitamin D\",\"source_of\":\"Calcium, Folacin, Iron, Magnesium, Niacin, Pantothenic Acid, Phosphorus, Selenium, Vitamin A, Vitamin B1, Vitamin B2, Vitamin E, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:17:59'),
(472, 472, 1, 'Chocolate Mousse', 'Preheat the oven to 160°C/325°F. In a saucepan, heat the cream over medium-low heat, paying attention not to let it boil. Add the chopped chocolate, remove from heat and until the chocolate has melted completely. Let the mixture cool down a few minutes. Meanwhile, separate the egg whites from the yolks. Set the egg whites aside in a glass jar\r\nand put it in the refrigerator or freezer for a future use. Put the yolks in a bowl, add the sugar and using an electric until the mixture is pale and form ribbons , about 3-4 min. Pour in the cream-chocolate mixture slowly while gently folding using a whisk. Spoon the mixture into ramekins Put a towel or piece of cloth into a large baking-pan (either a rectangular cake-mould or a roasting pan). Place the ramekins on the cloth and fill the pan with enough hot water to reach halfway up the sides of the ramekins Bake in the middle of the oven 30 min: the centre will still tremble slightly when moved and will continue to set as it cools. Take the ramekins out of the water bath right away to avoid overcooking. Let them cool down 20 min at room temperature, then cover them with a plastic wrap and chill at least 2 h in the refrigerator. Serve.', '[\"cream 15%\",\"bittersweet chocolate, chopped\",\"egg yolks\",\"sugar\",\"plastic wrap\"]', 'https://media.soscuisine.com/images/recettes/367.jpg', 'https://www.soscuisine.com//recipe/chocolate-mousse', '', '40 min', '270 kcal', '{\"calories\":\"270\",\"fat\":\"17 g\",\"cholesterol\":\"130 mg\",\"protein\":\"4 g\"}', '{\"good_source_of\":\"Vitamin B12\",\"source_of\":\"Calcium, Folacin, Iron, Pantothenic Acid, Phosphorus, Selenium, Vitamin A, Vitamin B2, Vitamin D, Vitamin E, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:18:02'),
(473, 473, 1, 'Chocolate Mug Cake', 'Mix well the dry ingredients in a large microwave-safe mug. Mix the oil and milk in a separate bowl, then add them to the mixture. until all ingredients are combined and batter has no clumps. in the chocolate chips, if desired. Microwave on high for about 90 seconds. Since the precise cooking time depends on your oven\'s power, check after 60 seconds if it is rising well and doesn\'t look or smell burnt. Continue to cook using 10 second periods. Enjoy right away.', '[\"white flour (all purpose)\",\"sugar, or more\",\"baking powder\",\"cocoa powder\",\"salt\",\"milk, partly skimmed, 2%\",\"canola oil\",\"bittersweet chocolate chips\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2816.jpg', 'https://www.soscuisine.com//recipe/schocolate-mug-cake', 'It is very important to mix the ingredients well and to avoid overcooking.', '7 min', '510 kcal', '{\"calories\":\"510\",\"fat\":\"31 g\",\"cholesterol\":\"10 mg\",\"protein\":\"7 g\"}', '{\"excellent_source_of\":\"Folacin, Magnesium, Manganese, Phosphorus, Selenium, Vitamin E, Vitamin K\",\"good_source_of\":\"Calcium, Copper, Fibre, Iron, Niacin, Vitamin B1, Vitamin B12, Vitamin B2\",\"source_of\":\"Omega-3, Omega-6, Pantothenic Acid, Potassium, Vitamin D, Zinc\"}', '2021-06-18 14:18:04'),
(474, 474, 1, 'Cinnamon Almonds', 'Preheat oven to 160°C/325°F. Line with parchment\r\npaper a baking sheet. Melt butter in a microwave. Set aside. Meanwhile, in a bowl the egg whites with a pinch of salt. Slowly add the sugar, then to form stiff peaks using an Gently incorporate the almonds and cinnamon. Pour butter on the mixture and gently fold. Transfer the mixture to the prepared baking sheet. Bake in the middle of the oven for about 40 min, until the almonds are crispy, turning them often. Serve warm or at room temperature.', '[\"parchment paper\",\"butter, unsalted\",\"egg whites\",\"salt\",\"sugar\",\"almonds\",\"ground cinnamon\"]', 'https://media.soscuisine.com/images/recettes/2762.jpg', 'https://www.soscuisine.com//recipe/cinnamon-almonds', '', '50 min', '120 kcal', '{\"calories\":\"120\",\"fat\":\"9 g\",\"cholesterol\":\"0 mg\",\"protein\":\"3 g\"}', '{\"excellent_source_of\":\"Vitamin E\",\"good_source_of\":\"Magnesium, Manganese\",\"source_of\":\"Copper, Phosphorus, Vitamin B2\",\"low\":\"Sodium\"}', '2021-06-18 14:18:07'),
(475, 475, 1, 'Cheese-Topped Leeks', 'Preheat the oven to 215°C/425°F. Prepare the leeks , then slice them into thin rounds. Heat the oil in a saucepan over low heat, then add the leeks. Sauté about 5 min, add the warm and cook 10 min until the leeks are soft. Drain the leeks and set them aside in a bowl. Pour the drained broth back into the saucepan. Add the milk, warm a few minutes over very low heat and set aside. Melt the butter in another saucepan over low heat. Add the flour and mix well. Cook 5 min, with constant stirring so that the remains white. Gradually pour the warm broth and milk over the , whisking gently. After about 5 min, when the mixture is almost homogeneous, add the leeks and the grated nutmeg. Simmer 5 min, stirring occasionally. Pour in and blend 2/3 of the grated cheese. Adjust the\r\nseasoning . Salt may not be needed since the cheese is rather salty. Transfer all to an ovenproof dish and cover with the remaining cheese. Bake about 10 min until the cheese has formed a thin crust and is nicely browned on top. Serve.', '[\"leeks, sliced into thin rounds\",\"Emmenthal cheese, or aged Cheddar\",\"milk, partly skimmed, 2%\",\"butter, unsalted\",\"white flour (all purpose)\",\"chicken broth\",\"canola oil\",\"nutmeg\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/119.jpg', 'https://www.soscuisine.com//recipe/cheese-topped-leeks', 'This gratin may be served in single-servings, using shallow baking dishes containing about 1 cup ea.', '40 min', '340 kcal', '{\"calories\":\"340\",\"fat\":\"19 g\",\"cholesterol\":\"40 mg\",\"protein\":\"11 g\"}', '{\"diet-related_health_claims\":\"Bone-healthy\",\"free\":\"Added Sugar\",\"excellent_source_of\":\"Calcium, Folacin, Iron, Manganese, Vitamin A, Vitamin B12, Vitamin K\",\"good_source_of\":\"Magnesium, Niacin, Phosphorus, Potassium, Selenium, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin D, Vitamin E, Zinc\",\"source_of\":\"Copper, Fibre, Omega-3, Pantothenic Acid, Vitamin C\"}', '2021-06-18 14:18:09'),
(476, 476, 1, 'Cinnamon-Flavoured Apricot Compote', 'Briefly wash the apricots. Split them in half, pull apart and remove their pits. Add them to a saucepan with the sugar, cinnamon, and water. Cook over medium-low heat, covered, for about 5-8 min, until the apricots are soft. Take off heat and let cool. Serve with its juice either lukewarm or at room temperature.', '[\"apricots, firm-ripe\",\"sugar\",\"ground cinnamon\",\"water\"]', 'https://media.soscuisine.com/images/recettes/165.jpg', 'https://www.soscuisine.com//recipe/cinnamon-flavoured-apricot-compote', 'Fot best results, use ripe apricots.', '15 min', '80 kcal', '{\"calories\":\"80\",\"fat\":\"1 g\",\"cholesterol\":\"0 mg\",\"protein\":\"2 g\"}', '{\"diet-related_health_claims\":\"Artery-healthy\",\"excellent_source_of\":\"Vitamin A\",\"good_source_of\":\"Potassium\",\"source_of\":\"Copper, Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Pantothenic Acid, Vitamin C, Vitamin E, Vitamin K\",\"low\":\"Fat\",\"free\":\"Cholesterol, Saturated Fat, Sodium, Trans Fat\"}', '2021-06-18 14:18:10');
INSERT INTO `recipe_translation` (`rt_id`, `rt_recipe_id`, `rt_lang_id`, `rt_recipe_name`, `rt_recipe_text`, `rt_recipe_ingredients_full`, `rt_recipe_image`, `rt_recipe_link`, `rt_recipe_prep`, `rt_recipe_duration`, `rt_recipe_calories`, `rt_recipe_nutrients`, `rt_recipe_claims`, `rt_created`) VALUES
(477, 477, 1, 'Cinnamon-flavoured Peach Cake', 'Preheat the oven to 175°C/350°F. Butter a springform pan. Using an electric mixer the butter in a bowl until it is fluffy. Add all but 2 tablespoons of the sugar and beat until blended. Add the eggs, one at a time, beating well after each addition, then pour in the lemon juice. Mix the flour with the baking powder in a separate bowl, then blend it into the sugar-egg mixture. Beat well until smooth, then spread the batter evenly in the prepared pan. Arrange the peach slices on top of the batter in concentric circles to cover completely, pressing lightly to adhere. In a small bowl, mix the cinnamon and the remaining 2 tablespoons of sugar, then sprinkle over the cake. Bake the cake in the middle of the oven until the top is brown and a tooth-pick inserted into center comes out clean, about 1 h. Let the cake cool down a few minutes, then cut around it to loosen it from the pan and remove the pan sides. Let the cake cool down about 1 h, then serve it slightly warm or at room temperature.', '[\"butter, unsalted\",\"sugar\",\"eggs size large\",\"lemon juice, freshly squeezed\",\"white flour (all purpose)\",\"baking powder\",\"peaches, yellow, pitted, cut into 2 cm segments\",\"ground cinnamon\"]', 'https://media.soscuisine.com/images/recettes/925.jpg', 'https://www.soscuisine.com//recipe/cinnamon-flavoured-peach-cake', 'will make things easier for this recipe.', '75 min', '290 kcal', '{\"calories\":\"290\",\"fat\":\"13 g\",\"cholesterol\":\"80 mg\",\"protein\":\"4 g\"}', '{\"good_source_of\":\"Folacin, Selenium\",\"source_of\":\"Iron, Manganese, Niacin, Pantothenic Acid, Phosphorus, Vitamin A, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin D, Vitamin E\",\"low\":\"Sodium\"}', '2021-06-18 14:18:11'),
(478, 478, 1, 'Cinnamon-Scented Quinoa', 'Place the quinoa in a fine strainer and hold it under cold running water until the water runs clear, then drain well. Combine the quinoa, water, and cinnamon stick with salt to taste in a saucepan. Bring to a boil, then reduce to a simmer . Cover and cook until the grains are translucent and the germ has spiralled out from each grain, about 15 min. Remove pan from heat and let stand, covered, 5 min. Remove cinnamon stick*. Fluff with a fork then portion out to bowls. Top each bowl with walnuts, raisins, maple syrup, and milk, then serve.', '[\"quinoa\",\"water\",\"cinnamon sticks\",\"salt\",\"[optional]\",\"walnuts\",\"raisins\",\"maple syrup\",\"milk, partly skimmed, 2%\"]', 'https://media.soscuisine.com/images/recettes/2630.jpg', 'https://www.soscuisine.com//recipe/cinnamon-scented-quinoa', '* The used cinnamon stick may be rinsed, dried and stored for reuse.', '20 min', '260 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Iron, Magnesium, Manganese, Vitamin B2\",\"good_source_of\":\"Copper, Phosphorus, Potassium, Vitamin B12, Zinc\",\"source_of\":\"Calcium, Fibre, Folacin, Niacin, Pantothenic Acid, Vitamin B1, Vitamin B6, Vitamin D\",\"low\":\"Cholesterol, Saturated Fat, Sodium\",\"free\":\"Trans Fat\"}', '2021-06-18 14:18:12'),
(479, 479, 1, 'Citrus Fruit Sorbet', 'Put a metal or glass bowl (or tray) into the freezer so that it will be cold when filling it with the sorbet mixture. Add the sugar, water, and salt to a saucepan. Bring to a boil then cook over low heat, with occasional stirring , 4-5 min, until the mixture becomes a clear syrup. Let it cool down in the refrigerator about 20 min. Juice the oranges, grapefruit, and lemon, then set the juice aside. the egg white(s) in a bowl using an electric mixer stiff peaks are formed. Pour in the cooled syrup slowly, with stirring , then add the citrus juice. Mix well, then transfer the mixture to the prepared bowl, cover and put it in the freezer. After about 3 h, take the bowl out of the freezer, stir the mixture using a whisk, then return the bowl to the freezer. Repeat the same stirring operation after an additional 2 h in the freezer. A third stirring step may be needed later : It normally takes 12 hours until the proper consistency is reached. Remove the sorbet from the freezer and let it stand at room temperature 10-15 min before\r\nserving, so that it will soften slightly.', '[\"sugar\",\"water\",\"salt\",\"orange juice, freshly squeezed\",\"grapefruit juice, freshly squeezed\",\"lemon juice, freshly squeezed\",\"egg whites\"]', 'https://media.soscuisine.com/images/recettes/49.jpg', 'https://www.soscuisine.com//recipe/citrus-fruit-sorbet', '', '25 min', '170 kcal', '{\"calories\":\"170\",\"fat\":\"0 g\",\"cholesterol\":\"0 mg\",\"protein\":\"1 g\"}', '{\"diet-related_health_claims\":\"Artery-healthy\",\"good_source_of\":\"Vitamin C\",\"source_of\":\"Folacin, Vitamin A\",\"low\":\"Sodium\",\"free\":\"Cholesterol, Fat, Saturated Fat, Trans Fat\"}', '2021-06-18 14:18:12'),
(480, 480, 1, 'Citrus Pesto', 'Rinse the basil leaves briefly only if they are very dirty. Otherwise use a wet towel to clean the leaves, then pat them dry between 2 paper towels. Drop the peeled orange into a food processor with the almonds, capers, anchovies, basil, lemon juice and maple syrup. Slowly mix in the olive oil, until a creamy, but thick consistency is achieved. Transfer the pesto to a small bowl and add olive oil just to cover it to prevent the oxidation (and darkening) of its surface. Cover the bowl with a plastic wrap and chill until ready to use.', '[\"oranges\",\"almonds\",\"capers\",\"anchovy fillets\",\"fresh basil\",\"lemon juice, freshly squeezed\",\"maple syrup\",\"extra virgin olive oil\"]', 'https://media.soscuisine.com/images/recettes/3126.jpg', 'https://www.soscuisine.com//recipe/citrus-pesto', '', '15 min', '170 kcal', '', '', '2021-06-18 14:18:13'),
(482, 482, 1, 'Classic Waffle', 'In a large bowl, mix together the flour, baking powder, sugar, and salt. Separate the egg whites from the yolks: add the whites to another bowl; add the yolks to the dry mixture, incorporating them one at a time and alternating with milk. Blend gently, then add the melted butter. Set aside. the egg whites to form stiff peaks using a , then fold them into the mixture, blending gently with a spatule. Start the waffle iron. Pour about 1/2 cup of the batter. Close and cook following the instructions of the manufacturer. Remove the first waffle and continue to cook the remaing batter. Keep the waffles warm in the oven while cooking the others. Serve immediately with the toppings of your choice (fruits, maple sirop etc).', '[\"white flour (all purpose)\",\"baking powder\",\"sugar\",\"salt\",\"eggs size large\",\"milk, partly skimmed, 2%\",\"butter, unsalted, melted\"]', 'https://media.soscuisine.com/images/recettes/2786.jpg', 'https://www.soscuisine.com//recipe/classic-waffle', '', '30 min', '560 kcal', '{\"calories\":\"560\",\"fat\":\"29 g\",\"cholesterol\":\"240 mg\",\"protein\":\"15 g\"}', '{\"excellent_source_of\":\"Folacin, Iron, Niacin, Phosphorus, Selenium, Vitamin A, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin D\",\"good_source_of\":\"Calcium, Manganese, Pantothenic Acid\",\"source_of\":\"Copper, Magnesium, Potassium, Vitamin B6, Vitamin E, Zinc\"}', '2021-06-18 14:18:14'),
(483, 483, 1, 'Cheese-topped Mushrooms and Lentils', 'Preheat the oven to 190°C/375°F. Rinse and drain the lentils, then set aside. Prepare the vegetables . Finely chop the onion, carrot, celery, and mince the garlic. Thinly slice the\r\nmushrooms. Heat about half of the oil in a saucepan over medium heat. Sauté the onion, carrot, celery, and garlic about 7-8 min with occasional stirring . Add the lentils and water, cover, and cook over low heat about 15-20 min until the lentils are cooked al dente from time to time. Add salt and pepper. Meanwhile, prepare the mushroom topping. Heat the remaining oil in a pan over medium heat. Add the Parsley and Garlic base , sliced mushrooms, salt and pepper. Cook 5 min with stirring Place the lentil mix in a lightly oiled, oven-proof dish, cover with the mushrooms and top with the grated Gruyère. Bake 15 min until a nice golden crust is formed. Serve.', '[\"red-orange lentils (dried), rinsed and drained\",\"onions, finely chopped\",\"carrots, finely chopped\",\"celery, finely chopped\",\"garlic, minced\",\"button (white) mushrooms, thinly sliced\",\"olive oil\",\"water\",\"Parsley and Garlic Base\",\"Gruy\\u00c3\\u00a8re cheese, grated\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/229.jpg', 'https://www.soscuisine.com//recipe/cheese-topped-mushrooms-lentils', 'It is not necessary to soak the lentils in advance.', '55 min', '360 kcal', '{\"calories\":\"360\",\"fat\":\"18 g\",\"cholesterol\":\"30 mg\",\"protein\":\"20 g\"}', '{\"diet-related_health_claims\":\"Bone-healthy\",\"free\":\"Added Sugar\",\"excellent_source_of\":\"Calcium, Copper, Fibre, Folacin, Iron, Manganese, Niacin, Pantothenic Acid, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B2, Vitamin K, Zinc\",\"good_source_of\":\"Magnesium, Vitamin B1, Vitamin B12, Vitamin B6, Vitamin E\",\"source_of\":\"Vitamin C\",\"low\":\"Sodium\"}', '2021-06-18 14:18:14'),
(484, 484, 1, 'Cock-a-Leekie', 'Prepare the leeks : Keep only the white and light green parts then slice them thin. Put the leeks in a saucepan with the homemade chicken broth . Bring to a boil, then reduce the heat and simmer for 15 min, until the leeks are soft. Add the previously prepared shredded chicken meat, then simmer a couple minutes longer. Adjust the\r\nseasoning For each serving, place a prune in a soup bowl, pour over the soup, garnish with the chopped parsley then serve.', '[\"leeks\",\"Homemade Chicken Broth\",\"Homemade Boiled Chicken\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"Italian parsley, fresh, chopped\",\"[optional]\",\"pitted prunes\"]', 'https://media.soscuisine.com/images/recettes/202.jpg', 'https://www.soscuisine.com//recipe/cock-leekie', 'with reserved shredded meat is needed for this recipe.', '25 min', '160 kcal', '{\"calories\":\"160\",\"fat\":\"5 g\",\"cholesterol\":\"40 mg\",\"protein\":\"14 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Niacin, Vitamin A\",\"good_source_of\":\"Manganese, Selenium, Vitamin B6\",\"source_of\":\"Copper, Fibre, Folacin, Iron, Magnesium, Pantothenic Acid, Phosphorus, Potassium, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin C, Vitamin E, Vitamin K, Zinc\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:18:15'),
(485, 485, 1, 'Coconut Macaroons', 'Preheat the oven to 150ºC/300ºF. Line a large baking sheet (about 30 x 38 cm) with parchment\r\npaper In a bowl, using a the egg whites \r\nand a pinch of salt until stiff\r\npeaks form. Add the sugar gradually, one tablespoon at a time then continue to at high speed until the mixture is glossy and the sugar is dissolved, about 7 to 8 min. Fold in the coconut using a spatula. Using either a pastry bag, or a resealable plastic bag with a corner cut off, or simply a spoon, form small mounds (about a tablespoon of the mixture) then place them on the prepared sheet. Leave about 1 cm of space between the macaroons. The mixture yields about 5 macaroons per egg white. Bake in the middle of the oven until the macaroons become light-brown coloured and can be removed easily from the paper, about 35-40 min. Let the macaroons cool down about 30 min before serving.', '[\"egg whites\",\"salt\",\"icing\\/confectioners\' sugar\",\"grated coconut\"]', 'https://media.soscuisine.com/images/recettes/1213.jpg', 'https://www.soscuisine.com//recipe/coconut-macaroons', '', '50 min', '50 kcal', '{\"calories\":\"50\",\"fat\":\"2 g\",\"cholesterol\":\"0 mg\",\"protein\":\"1 g\"}', '{\"low\":\"Sodium\"}', '2021-06-18 14:18:16'),
(486, 486, 1, 'Coconut Pancakes', 'In a bowl, together the eggs, coconut milk and melted coconut oil. Mix well. Add the coconut flour, salt, cinnamon and baking powder. Mix well. Melt the butter in a skillet over medium heat. Depending on the quantity you are making, you may need to work in batches, in this case, set aside some of the butter for the next batches. Drop batter by ¼ to &frac13; cup onto the skillet and cook until bubbles begin to break the surface and the edges no longer appear wet, about 2 to 3 min. Flip, using a thin spatula, then cook until golden on the other side, about 2 more minutes. Set aside on a plate in a warm oven while you finish the rest. Top with whipped cream, hemp seeds and raspberries then serve.', '[\"eggs size large\",\"coconut flour\",\"unsweetened coconut milk\",\"coconut oil, melted\",\"salt\",\"baking powder\",\"ground cinnamon\",\"butter, unsalted\",\"whipping cream 35%, whipped\",\"hemp seeds\",\"raspberries\"]', 'https://media.soscuisine.com/images/recettes/4112.jpg', 'https://www.soscuisine.com//recipe/coconut-pancakes', '', '15 min', '450 kcal', '{\"calories\":\"450\",\"fat\":\"38 g\",\"cholesterol\":\"250 mg\",\"protein\":\"16 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Fibre, Folacin, Iron, Magnesium, Manganese, Phosphorus, Selenium, Vitamin B12, Vitamin B2, Zinc\",\"good_source_of\":\"Copper, Niacin, Potassium, Vitamin A, Vitamin B1\",\"source_of\":\"Calcium, Pantothenic Acid, Vitamin B6, Vitamin C, Vitamin D, Vitamin E\"}', '2021-06-18 14:18:17'),
(487, 487, 1, 'Colcannon', 'Prepare the vegetables : Thinly slice the onion and cabbage. Leaving the skin on, boil or steam the potatoes until very tender, about 20 -25 min. Drain well\r\n    and peel. While the potatoes are cooking, heat the oil in a pan over medium heat. Add the onion and cook until golden, 3-4 min. Add the cabbage and cook until tender, about 10 min. Set aside. Meanwhile, in a microwave-safe bowl, pour in the milk with butter and microwave on medium-high for a couple tens of seconds until hot. Pass the potatoes through a food mill , then put the purée back into the pot used to cook the potatoes. Pour in the butter-milk mixture. Add more or less milk depending on how creamy you like your purée. Add the\r\n    cabbage mixture, season with salt and pepper to taste, then mix well using a spatula. Reheat and serve warm.', '[\"potatoes, Russet or Idaho type\",\"butter, unsalted\",\"milk, partly skimmed, 2%\",\"olive oil\",\"green cabbage, thinly sliced\",\"onions, thinly sliced\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/3596.jpg', 'https://www.soscuisine.com//recipe/colcannon', 'cannot give the proper texture.', '40 min', '300 kcal', '{\"calories\":\"300\",\"fat\":\"9 g\",\"cholesterol\":\"20 mg\",\"protein\":\"7 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Magnesium, Manganese, Potassium, Vitamin B6, Vitamin C, Vitamin K\",\"good_source_of\":\"Fibre, Iron, Niacin, Phosphorus\",\"source_of\":\"Calcium, Copper, Pantothenic Acid, Selenium, Vitamin A, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin D, Vitamin E, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:18:18'),
(488, 488, 1, 'Cold Cucumber Soup', 'Peel the cucumbers, cut them in half lengthwise, remove the seeds with a spoon, then cut the pulp into large pieces (about 2-3 cm). Put the pieces in the blender .\r\nPour in the cream, vegetable , vinegar, and Tabasco sauce the garlic, chop the aromatic\r\nherbs , then add them to the blender .\r\nPurée the mixture until a smooth consistency is obtained. Season with salt and pepper, then chill until ready to serve. Ladle the soup into bowls, garnish with walnuts (optional), then serve.', '[\"cucumbers, large size, peeled, deseeded, then cut into large chunks\",\"cream 15%\",\"vegetable broth\",\"wine vinegar\",\"Tabasco sauce, to taste\",\"garlic, pressed\",\"fresh dill, chopped\",\"Italian parsley, fresh, chopped\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"walnuts\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/598.jpg', 'https://www.soscuisine.com//recipe/cold-cucumber-soup', 'will be very useful for this recipe.', '20 min', '130 kcal', '{\"calories\":\"130\",\"fat\":\"9 g\",\"cholesterol\":\"30 mg\",\"protein\":\"3 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Vitamin K\",\"good_source_of\":\"Potassium\",\"source_of\":\"Calcium, Copper, Folacin, Iron, Magnesium, Manganese, Pantothenic Acid, Phosphorus, Vitamin A, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin C, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:18:19'),
(489, 489, 1, 'Cold Melon \"Soup\"', 'Cut the melon in half crosswise and remove the seeds. Using a melon baller , cut 4 balls per serving and set them aside in the refrigerator. Using a spoon, scrape out the remaining pulp, dice it coarsely and transfer it to the jar of a blender Pour in the juice and sugar, then until very smooth. Chill the mixture in the refrigerator for at least 1 h before serving. When ready, pour the «soup» into cups, add the melon balls and garnish with mint leaves. Serve.', '[\"melon\",\"apple juice\",\"sugar\"]', 'https://media.soscuisine.com/images/recettes/308.jpg', 'https://www.soscuisine.com//recipe/cold-melon-soup-alcohol-free', 'will be very useful for this recipe.', '10 min', '70 kcal', '{\"calories\":\"70\",\"fat\":\"0 g\",\"cholesterol\":\"0 mg\",\"protein\":\"1 g\"}', '{\"diet-related_health_claims\":\"Artery-healthy\",\"excellent_source_of\":\"Vitamin A, Vitamin C\",\"source_of\":\"Folacin, Magnesium, Potassium\",\"low\":\"Sodium\",\"free\":\"Cholesterol, Fat, Saturated Fat, Trans Fat\"}', '2021-06-18 14:18:20'),
(490, 490, 1, 'Cold Sweet Potato Soup', 'Prepare the vegetables : peel the sweet potatoes, then cut them coarsely into 2 cm pieces; finely chop the onion and leek. Melt the butter in a pot over medium heat. Add the onion and leek, then sauté 4-5 min, taking care not to let them to burn. Add the diced sweet potatoes and . Bring to a boil, then lower the heat and cook about 20 min, partially covered, until the potatoes are soft. Purée the soup in a blender food processor , then add the curry powder, orange juice, and evaporated milk. Season with salt and pepper to taste. Mix well, then cover and chill thoroughly in the refrigerator (about 2 hours). Serve cold.', '[\"sweet potatoes, coarsely cut into 2 cm pieces\",\"onions, finely chopped\",\"leeks, finely chopped\",\"butter, unsalted\",\"chicken broth\",\"curry powder\",\"orange juice\",\"evaporated milk 7%\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/649.jpg', 'https://www.soscuisine.com//recipe/cold-sweet-potato-soup', 'will be very useful to purée the soup.', '30 min', '110 kcal', '{\"calories\":\"110\",\"fat\":\"2 g\",\"cholesterol\":\"0 mg\",\"protein\":\"2 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Vitamin A\",\"good_source_of\":\"Manganese, Potassium, Vitamin K\",\"source_of\":\"Copper, Fibre, Folacin, Iron, Magnesium, Niacin, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin B6, Vitamin C, Vitamin E\",\"low\":\"Cholesterol, Fat, Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:18:21'),
(491, 491, 1, 'Cheesy Cauliflower Risotto', 'Finely chop the garlic, shallot and cauliflower. Heat the in a small saucepan on the stove or in a microwave oven. Keep it warm while cooking the risotto (which will take about 20 min). Heat the oil in a saucepan. Add the garlic and shallot then sauté 2-3 min, until they become translucent. Add the rice and toast the grains 1-2 min (until translucent), with constant stirring . Add the cauliflower then sauté 1 min. Cook the risotto until the rice is creamy but still al dente , about 20 min. in the Parmesan and Gorgonzola cheese, then let the risotto stand for 2 min. Season with pepper to taste, then serve.', '[\"garlic, minced\",\"shallots, finely chopped\",\"chicken broth\",\"cauliflower, finely chopped\",\"olive oil\",\"arborio rice\",\"Gorgonzola cheese, or other creamy blu cheese, cut into pieces\",\"Parmesan cheese, grated\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/3959.jpg', 'https://www.soscuisine.com//recipe/cheesy-cauliflower-risotto', '.', '25 min', '290 kcal', '{\"calories\":\"290\",\"fat\":\"6 g\",\"cholesterol\":\"10 mg\",\"protein\":\"8 g\"}', '{\"free\":\"Added Sugar\",\"good_source_of\":\"Selenium, Vitamin C, Zinc\",\"source_of\":\"Calcium, Copper, Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Potassium, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin K\"}', '2021-06-18 14:18:22'),
(492, 492, 1, 'Cooked Cherries', 'Briefly wash the cherries, without letting them soak. Combine them with the sugar in a saucepan, then toss to coat. Add a little water and bring to a boil. Reduce heat to medium-low and simmer , with occasional stirring , until the liquid thickens slightly, about 10 min. Serve at room temperature. Garnish with vanilla ice cream, if desired.', '[\"cherries, firm-ripe\",\"sugar\",\"water, approximately\",\"vanilla ice cream\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/163.jpg', 'https://www.soscuisine.com//recipe/cooked-cherries', 'It is not necessary to remove the pits.', '12 min', '140 kcal', '{\"calories\":\"140\",\"fat\":\"0 g\",\"cholesterol\":\"0 mg\",\"protein\":\"2 g\"}', '{\"diet-related_health_claims\":\"Artery-healthy\",\"good_source_of\":\"Potassium\",\"source_of\":\"Copper, Fibre, Magnesium, Manganese, Pantothenic Acid, Vitamin C\",\"free\":\"Cholesterol, Fat, Saturated Fat, Sodium, Trans Fat\"}', '2021-06-18 14:18:22'),
(493, 493, 1, 'Cooked Tomatillo Salsa', 'Put the tomatillos, jalapeños, onion and garlic in a small saucepan, cover with water, then put on the stovetop. Bring to a boil and cook until the tomatillos are tender and become yellow-green, about 10 min. Remove from the heat, discard the water, and set aside to cool slightly. Transfer the ingredients to a blender food processor , and pulse until coarsely chopped. \r\nAdd the cilantro and pulse on \'low\' until smooth. Heat the oil in a pan over moderate heat. Add the salsa and simmer a few minutes, stirring occasionally, until thickened. Season to taste with salt, then serve.', '[\"tomatillos, husked and rinsed\",\"jalape\\u00c3\\u00b1o pepper, fresh\",\"onions\",\"garlic\",\"fresh cilantro\",\"canola oil\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2596.jpg', 'https://www.soscuisine.com//recipe/cooked-tomatillo-salsa', 'will be very useful to purée the vegetables.', '25 min', '140 kcal', '', '', '2021-06-18 14:18:22'),
(494, 494, 1, 'Cottage Cheese Pancakes', 'In a bowl, together the eggs, cottage cheese, salt, and sugar. Mix until smooth, without worrying about the lumps of the cottage cheese. In another bowl, mix the flour with the baking powder. Add the milk to the first bowl and until creamy. \r\n  Add the flour mixture and mix just until blended. in the oil. Preheat a skillet over medium heat. Spray with nonstick spray. Drop batter by ¼ to &frac13; cup onto the skillet and cook until bubbles begin to break the surface and the edges no longer appear wet, about 2 to 3 min. Flip, using a thin spatula, then cook until golden on the other side, about 2 more minutes. Set aside on a plate in a warm oven while you finish the rest. Serve with the syrup.', '[\"eggs size large\",\"cottage cheese, 1%\",\"salt\",\"sugar\",\"white flour (all purpose)\",\"baking powder\",\"milk, partly skimmed, 2%\",\"canola oil\",\"vegetable oil spray\",\"maple syrup\"]', 'https://media.soscuisine.com/images/recettes/2611.jpg', 'https://www.soscuisine.com//recipe/cottage-cheese-pancakes', '', '15 min', '460 kcal', '{\"calories\":\"460\",\"fat\":\"14 g\",\"cholesterol\":\"230 mg\",\"protein\":\"21 g\"}', '{\"excellent_source_of\":\"Folacin, Manganese, Niacin, Phosphorus, Selenium, Vitamin B1, Vitamin B12, Vitamin B2\",\"good_source_of\":\"Calcium, Iron, Pantothenic Acid, Vitamin E, Zinc\",\"source_of\":\"Copper, Magnesium, Potassium, Vitamin A, Vitamin B6, Vitamin D, Vitamin K\"}', '2021-06-18 14:18:23'),
(495, 495, 1, 'Cranberry Granola Bars', 'Preheat the oven to 175°C/350°F. Line one or multiple 20 cm (8 in) square baking pans with parchment\r\npaper , according to number of servings. Grind the flax seeds, then set aside. In a large bowl, mix the rice puffs, quinoa flakes, rolled oats, grated coconut, almonds, dried cranberries, and flax seeds. In a separate bowl, combine the eggs, canola oil, honey, and almond butter. Mix well with a until smooth. Add the wet mixture to the dry one then mix well to ensure all ingredients are coated. Place mixture into prepared baking pan(s). Press the mixture so it is compact. Bake in the middle of the oven for about 25-30 min. It is also possible to bake the mixture in a muffin pan. To do so, adjust baking time to 12-15 min. Take the pan(s) out of the oven, then let cool at least 30 min. Cut each square into 12 bars then serve.', '[\"rice puffs\",\"quinoa flakes\",\"rolled oats\",\"grated coconut\",\"almonds, finely chopped\",\"dried cranberries, finely chopped\",\"flax seeds, ground\",\"eggs size large\",\"canola oil\",\"honey\",\"almond butter\"]', 'https://media.soscuisine.com/images/recettes/3371.jpg', 'https://www.soscuisine.com//recipe/cranberry-granola-bars', 'will be very useful to grind the flax seeds.', '35 min', '250 kcal', '{\"calories\":\"250\",\"fat\":\"12 g\",\"cholesterol\":\"50 mg\",\"protein\":\"7 g\"}', '{\"excellent_source_of\":\"Magnesium, Manganese\",\"good_source_of\":\"Phosphorus, Vitamin E\",\"source_of\":\"Copper, Fibre, Folacin, Iron, Niacin, Omega-3, Omega-6, Pantothenic Acid, Potassium, Selenium, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin B6, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:18:23'),
(496, 496, 1, 'Asian Tempeh and Vegetable Soup', 'Pour the and water into a saucepan. Add the coconut milk, zest and lime juice, then bring to a boil. Add the bok choy and chili pepper .\r\n    Set aside over low heat. Meanwhile, cook the rice sticks for about 4 min in a large pot of salted boiling water. Drain in a colander , then rinse and drain again. Set aside. Heat the oil in a pan over medium-high heat. Add the tempeh cubes and curry powder. Sauté with stirring until all sides are golden-coloured, about 5 min. Season with salt and pepper. Prepare the vegetables : Grate the carrots, then thinly slice the green onions. Portion them out into individual serving bowls with the soybean sprouts, the rice sticks and tempeh cubes. Pour in the broth then serve.', '[\"vegetable broth\",\"water\",\"unsweetened coconut milk light\",\"limes, juice and zest\",\"small bok choy\",\"dried chili peppers, minced\",\"rice sticks (noodles)\",\"canola oil\",\"tempeh, cubed\",\"curry powder\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"carrots, finely grated\",\"green onions\\/scallions, chopped\",\"soybean sprouts\"]', 'https://media.soscuisine.com/images/recettes/3628.jpg', 'https://www.soscuisine.com//recipe/asian-tempeh-vegetable-soup', 'Individual 500 ml (2 cups) serving bowls are needed.', '20 min', '590 kcal', '{\"calories\":\"590\",\"fat\":\"24 g\",\"cholesterol\":\"0 mg\",\"protein\":\"30 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Calcium, Copper, Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Vitamin A, Vitamin B2, Vitamin B6, Vitamin C, Vitamin K, Zinc\",\"good_source_of\":\"Selenium, Vitamin B1, Vitamin E\",\"source_of\":\"Pantothenic Acid, Vitamin B12\"}', '2021-06-18 14:18:24'),
(497, 497, 1, 'Cheesy Risotto', 'Finely chop the onion. Heat the in a small saucepan on the stove or in a microwave oven. Keep it warm while cooking the risotto (which will take about 20 min). Heat the oil in a saucepan. Add the onion then sauté 2-3 min, until it becomes translucent. Add the rice and toast the grains 1-2 min (until translucent), with constant stirring Cook the risotto until the rice is creamy but still al dente , about 20 min. in the Parmesan and Gorgonzola cheese, then let the risotto stand for 2 min. Season with pepper to taste, then serve.', '[\"onions, finely chopped\",\"chicken broth\",\"olive oil\",\"arborio rice\",\"Gorgonzola cheese, or other creamy blu cheese, cut into pieces\",\"Parmesan cheese, grated\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1229.jpg', 'https://www.soscuisine.com//recipe/cheesy-risotto', '.', '25 min', '310 kcal', '{\"calories\":\"310\",\"fat\":\"8 g\",\"cholesterol\":\"10 mg\",\"protein\":\"9 g\"}', '{\"free\":\"Added Sugar\",\"good_source_of\":\"Selenium, Zinc\",\"source_of\":\"Calcium, Copper, Folacin, Magnesium, Niacin, Phosphorus, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin B6\"}', '2021-06-18 14:18:24'),
(498, 498, 1, 'Cranberry Shortbread Cookies', 'Whisk the butter, sugar and vanilla in a medium bowl with a blender , until the mixture becomes pale, about 5 min. Add the cranberries to the mixture, then mix well. In another bowl, mix the flour together with the baking powder. Incorporate this mixture to the cranberry-butter mixture. Roll the dough into one or two 1 ½ inch (4 cm) thick rolls then wrap them in plastic wrap. Refrigerate until firm, about 2 h. The cooling step will make the dough easier to cut into cookies.', '[\"butter, unsalted, diced\",\"sugar\",\"dried cranberries\",\"vanilla extract\",\"pastry flour\",\"baking powder\",\"milk, partly skimmed, 2%\"]', 'https://media.soscuisine.com/images/recettes/2742.jpg', 'https://www.soscuisine.com//recipe/cranberry-shortbread-cookies', 'will be very useful for this recipe.', '45 min', '50 kcal', '{\"calories\":\"50\",\"fat\":\"2 g\",\"cholesterol\":\"10 mg\",\"protein\":\"0 g\"}', '{\"low\":\"Sodium\"}', '2021-06-18 14:18:24'),
(499, 499, 1, 'Cream Cheese Mousse with Berries', 'In a bowl, the cream. Set aside. In a second bowl, the cream cheese using an electric mixer . Fold in the sugar and lemon juice, continuing to the mixture until smooth and homogeneous. Add the whipped cream, folding it gently into the mixture, using a spatula. Portion out into serving goblets (preferably transparent), alternating the mixture with the raspberries (or strawberries). Refrigerate 30 min before serving.', '[\"whipping cream 35%\",\"cream cheese\",\"sugar\",\"lemon juice, freshly squeezed\",\"raspberries, or strawberries\"]', 'https://media.soscuisine.com/images/recettes/130.jpg', 'https://www.soscuisine.com//recipe/cream-cheese-mousse-berries', '', '15 min', '290 kcal', '{\"calories\":\"290\",\"fat\":\"20 g\",\"cholesterol\":\"70 mg\",\"protein\":\"4 g\"}', '{\"good_source_of\":\"Manganese, Vitamin A, Vitamin C\",\"source_of\":\"Calcium, Fibre, Folacin, Iron, Magnesium, Omega-3, Phosphorus, Vitamin B12, Vitamin B2, Vitamin E, Vitamin K\",\"low\":\"Sodium\"}', '2021-06-18 14:18:25'),
(500, 500, 1, 'Cream of Potato Soup \"Parmentier\"', 'Prepare the vegetables : Finely chop the leeks; peel the potatoes then cut them into 2 cm pieces. Heat the butter and oil in a saucepan. Add the leeks, cover, then cook over low heat until the leeks are softened, 7-8 min. Add the potatoes, then sauté 2-3 min. Pour in the and water. Season with salt and pepper. Bring to a boil, then lower the heat, cover and simmer until the potatoes are softened, about 25 min. Purée the soup in a blender food processor Separate the egg white(s) and yolk(s). Set the white(s) aside in a glass jar with a lid and put it in the refrigerator or freezer for a future use in another recipe. Put the yolk(s) in a small bowl, then add 1-2 spoonfuls of soup and mix well with a fork. Pour the soup back into the saucepan, add the yolk mixture then reheat through. Ladle the soup into bowls. Sprinkle each bowl with minced chives (optional) and serve.', '[\"leeks\",\"potatoes, cut into 2 cm pieces\",\"butter, unsalted\",\"olive oil\",\"chicken broth\",\"water\",\"egg yolks\",\"chives, fresh\",\"[optional]\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/871.jpg', 'https://www.soscuisine.com//recipe/cream-potato-soup-parmentier', 'will be very useful to purée the soup.', '45 min', '170 kcal', '{\"calories\":\"170\",\"fat\":\"6 g\",\"cholesterol\":\"40 mg\",\"protein\":\"3 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Vitamin K\",\"good_source_of\":\"Folacin, Manganese, Potassium, Vitamin A, Vitamin B6\",\"source_of\":\"Copper, Fibre, Iron, Magnesium, Niacin, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin B12, Vitamin C, Vitamin E\"}', '2021-06-18 14:18:25'),
(501, 501, 1, 'Creamed Cauliflower Soup with Cheese', 'Prepare the vegetables : cut the cauliflower into florets, finely chop the garlic and onion. Heat the butter and oil in a saucepan over medium-low heat. Add the onion and\r\ngarlic and sauté 4-5 min, until translucent. Add the cauliflower and cook 2 min with stirring . Pour in the warm . Bring to a boil, then lower the heat, cover, and simmer about 20\r\nmin until very soft. Add a little salt and pepper. Purée the soup in a blender food processor until smooth. Pour in the\r\ncream, half of the grated cheddar and adjust the\r\nseasoning . Put the soup back on the stovetop, add more if the soup is too thick, and reheat it throughout. Serve into bowls, adding the remaining cheese on top of each bowl.', '[\"cauliflower, or brocoflower, cut into florets\",\"garlic, finely chopped\",\"onions, finely chopped\",\"butter, unsalted\",\"canola oil\",\"chicken broth\",\"cream 15%\",\"Cheddar cheese, grated\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/354.jpg', 'https://www.soscuisine.com//recipe/creamed-cauliflower-soup-cheese', 'will be very useful to purée the soup.', '30 min', '160 kcal', '{\"calories\":\"160\",\"fat\":\"10 g\",\"cholesterol\":\"30 mg\",\"protein\":\"8 g\"}', '{\"diet-related_health_claims\":\"Bone-healthy\",\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Vitamin C, Vitamin K\",\"good_source_of\":\"Calcium, Pantothenic Acid, Phosphorus, Potassium, Vitamin B6\",\"source_of\":\"Fibre, Iron, Magnesium, Manganese, Niacin, Selenium, Vitamin A, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin E, Zinc\"}', '2021-06-18 14:18:26'),
(502, 502, 1, 'Creamed Cauliflower Summer Soup', 'Prepare the cauliflower : cut it into large florets and it 10 min, at which point the cauliflower will be three-quarter cooked, i.e. firmer than al dente Drain it and put it back into the pot. Pour the warm over the cauliflower (just enough to cover it). Simmer 8-10 min, until the cauliflower is soft. Season with salt and pepper to taste. Purée the soup in a blender food processor until smooth. Transfer the soup to a container, cover and chill thoroughly, at least 2 h\r\nbefore serving. When ready to serve, pour in the cream, adjust the\r\nseasoning , then add the minced chives. Ladle into bowls and serve.', '[\"cauliflower, cut into florets\",\"chicken broth\",\"cream 15%\",\"chives, fresh, chopped\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/80.jpg', 'https://www.soscuisine.com//recipe/creamed-cauliflower-summer-soup', 'will be very useful to purée the soup.', '30 min', '80 kcal', '{\"calories\":\"80\",\"fat\":\"3 g\",\"cholesterol\":\"10 mg\",\"protein\":\"4 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Vitamin C, Vitamin K\",\"good_source_of\":\"Pantothenic Acid, Potassium, Vitamin B6\",\"source_of\":\"Calcium, Fibre, Iron, Magnesium, Manganese, Niacin, Phosphorus, Vitamin B1, Vitamin B2, Zinc\"}', '2021-06-18 14:18:26'),
(503, 503, 1, 'Creamy Adzuki Bean Popsicles', 'Combine the red beans and milk blender food processor . Blend for 1 min then add the condensed milk. Purée until smooth. Fill 6 popsicle moulds with the mixture then place them in the freezer for 30 min, until the mixture thickens. Meanwhile, soak the coffee sticks in water. Insert the sticks, keeping them as straight as possible. Return the popsicle molds to the freezer for another 5 hours. When ready to serve, run the molds under warm water for 3 to 5 seconds, and then gently pull the popsicle out.', '[\"milk, whole, 3.3%\",\"adzuki beans (canned)\",\"sweetened condensed milk\",\"wooden coffee sticks\"]', 'https://media.soscuisine.com/images/recettes/4270.jpg', 'https://www.soscuisine.com//recipe/creamy-adzuki-bean-popsicles', 'will be very useful for this recipe.', '10 min', '190 kcal', '{\"calories\":\"190\",\"fat\":\"4 g\",\"cholesterol\":\"10 mg\",\"protein\":\"8 g\"}', '{\"excellent_source_of\":\"Folacin\",\"good_source_of\":\"Fibre, Magnesium, Manganese, Phosphorus, Potassium, Vitamin B12, Zinc\",\"source_of\":\"Calcium, Copper, Iron, Niacin, Pantothenic Acid, Selenium, Vitamin B1, Vitamin B2, Vitamin D\",\"low\":\"Sodium\"}', '2021-06-18 14:18:27'),
(504, 504, 1, 'Creamy Asparagus Soup', 'Prepare\r\nthe asparagus them 7-8 min until tender. Drain the asparagus, then immediately plunge them into a bowl of cold\r\nwater to stop cooking (this also helps keeping a nice, green colour). Cut the asparagus into\r\npieces, keeping the tips for decorating the bowls. Meanwhile, warm up the in a saucepan and melt the butter in a pot over low heat. Add the flour to the pot and well with a\r\nwhisk or wooden spoon. Cook for about 3 min, stirring constantly and taking care not to let the mixture burn.\r\nSlowly add the warm , while stirring thoroughly to avoid lumps. Cook over medium heat 4-5 min. Add the asparagus and cook an additional 2-3 min, then purée the soup in a blender food\r\nprocessor . Pour the soup back into the pot, add the cream and adjust\r\nthe seasoning Reheat the soup for a few minutes, then serve it into bowls, garnishing with the reserved asparagus tips.', '[\"asparagus, average size\",\"chicken broth\",\"butter, unsalted\",\"white flour (all purpose)\",\"cream 15%\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/503.jpg', 'https://www.soscuisine.com//recipe/creamy-asparagus-soup', '', '25 min', '140 kcal', '{\"calories\":\"140\",\"fat\":\"9 g\",\"cholesterol\":\"30 mg\",\"protein\":\"4 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Vitamin K\",\"good_source_of\":\"Vitamin A\",\"source_of\":\"Copper, Iron, Magnesium, Manganese, Niacin, Phosphorus, Selenium, Vitamin B1, Vitamin B2, Vitamin E, Zinc\"}', '2021-06-18 14:18:27'),
(505, 505, 1, 'Creamy Cole Slaw', 'In a large bowl, add the mayonnaise, yogurt, vinegar, mustard and horseradish. Prepare the cabbage , carrots and green onions. Thinly slice the cabbage and onions. Peel and grate the carrots. Add the vegetables to the bowl, add salt and pepper, then mix well. Cover with some plastic wrap and chill in the refrigerator for at least 1 h. Adjust the seasoning and serve.', '[\"mayonnaise\",\"yogurt, plain, 2%\",\"wine vinegar\",\"Dijon mustard\",\"horseradish\",\"green cabbage, or Savoy, thinly sliced\",\"carrots, grated\",\"green onions\\/scallions, thinly sliced\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/226.jpg', 'https://www.soscuisine.com//recipe/creamy-cole-slaw', '', '15 min', '160 kcal', '{\"calories\":\"160\",\"fat\":\"12 g\",\"cholesterol\":\"10 mg\",\"protein\":\"3 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Folacin, Vitamin A, Vitamin C, Vitamin K\",\"good_source_of\":\"Fibre, Potassium, Vitamin B6\",\"source_of\":\"Calcium, Iron, Magnesium, Manganese, Niacin, Omega-3, Omega-6, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin E, Zinc\",\"low\":\"Cholesterol, Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:18:28'),
(506, 506, 1, 'Chicken \"Adobo\"', 'Pat the chicken dry. Coarsely chop the garlic. Heat the oil in a skillet over medium-high heat, until hot but not smoking. Add the chicken drumsticks, without crowding the skillet in order to ease the browning of the meat on each side, about 7-8 min per batch. Transfer the chicken as browned to a plate. If applicable, repeat the operation with the remaining drumsticks. Pour off all but 1 tablespoon fat from the skillet and cook the garlic 1-2 min in the remaining fat over low heat, with stirring . Add the vinegar, water, soy sauce, peppercorns, and bay leaves. Bring the liquid to a boil, then put the chicken with any accumulated juices back into the\r\nskillet, lower the heat and simmer , covered,\r\n15 min. Remove the lid and cook over moderately low heat, turning the chicken 2 or 3 times, until the sauce is thickened and the chicken is tender, about 15 min (there should be no need to add any salt since the soy sauce is already rather salty). Serve.', '[\"chicken drumsticks\",\"garlic, coarsely chopped\",\"olive oil\",\"apple cider vinegar\",\"water\",\"soy sauce\",\"peppercorns\",\"bay leaf\"]', 'https://media.soscuisine.com/images/recettes/505.jpg', 'https://www.soscuisine.com//recipe/chicken-adobo', 'Keep the serving plates in the oven at the lowest setting so they are warm when you serve.', '45 min', '280 kcal', '{\"calories\":\"280\",\"fat\":\"17 g\",\"cholesterol\":\"80 mg\",\"protein\":\"25 g\"}', '{\"source_of\":\"Manganese, Vitamin D\",\"low\":\"Saturated Fat\",\"free\":\"Sugar, Trans Fat\"}', '2021-06-18 14:18:29'),
(507, 507, 1, 'Creamy Yogurt Dip', 'Pour yogurt into a milk bag and attach the bag over a large bowl. Or: pour yogurt onto the cheesecloth covering a strainer placed above a bowl. Cover the strainer with a plate. Let it drain at room temperature until desired consistency. Add olive oil and lemon juice to the cream, whip. Use immediately for cooking or store the cream in a container in the refrigerator.', '[\"soy yogurt, or almond\",\"olive oil\",\"lemon juice, freshly squeezed\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2242.jpg', 'https://www.soscuisine.com//recipe/almond-or-soy-yogurt', 'Equipment: A nut milk bag (made from fine nylon) purchased at a health food store or a cheesecloth-covered strainer.', '5 min', '40 kcal', '{\"calories\":\"40\",\"fat\":\"2 g\",\"cholesterol\":\"0 mg\",\"protein\":\"1 g\"}', '{\"source_of\":\"Calcium\",\"low\":\"Calories, Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Saturated Fat, Trans Fat\"}', '2021-06-18 14:18:30'),
(508, 508, 1, '\"CrÃÂ¨me Anglaise\"', 'Pour the milk into a saucepan with the vanilla and bring to a boil. Set aside. Separate the egg white and yolk. Set the white aside in a glass jar with a lid and put it in the refrigerator or freezer for a future use. Put the yolk in the upper part of a bain-marie , add the sugar then a few minutes until the mixture is pale yellow in colour. in the flour, mix well, then slowly pour in the hot milk with constant stirring . Cook about 5 min until the sauce thickens and will coat the back of a spoon. Transfer the custard to a pitcher or bowl and let it cool down, stirring occasionally to avoid a skin forming on the surface. Add the cream just before serving.', '[\"milk, partly skimmed, 2%\",\"vanilla extract\",\"egg yolks\",\"sugar\",\"white flour (all purpose)\",\"whipping cream 35%\"]', 'https://media.soscuisine.com/images/recettes/242.jpg', 'https://www.soscuisine.com//recipe/creme-anglaise-light', ', reduces the risk of boiling (and spoiling) this heat-sensitive sauce.', '15 min', '40 kcal', '', '', '2021-06-18 14:18:31'),
(509, 509, 1, 'CrÃÂ¨me BrÃÂ»lÃÂ©e', 'Preheat the oven to 160°C/325°F. Lightly butter the custard dishes. Separate the egg whites and yolks. Set the whites aside in a glass jar with a lid and put them in the refrigerator or freezer for a future use. Put the yolks in a bowl, add the sugar and mix well. in the cream, mix, then divide the custard among the dishes. Bake in the centre of the oven for 30 min. Check with a toothpick or knife to see if it is cooked through. When done, take the dishes out of the oven and chill them in the refrigerator at least 2 h. Just before serving, preheat the broiler. Sprinkle the brown sugar evenly over each custard, put the dishes in the oven as close as possible to the upper element (about 3 cm) and cook a couple minutes until the tops have caramelized to a golden brown colour. Serve right away.', '[\"butter, unsalted, to grease the custard dishes\",\"egg yolks\",\"sugar\",\"whipping cream 35%\",\"brown sugar\"]', 'https://media.soscuisine.com/images/recettes/236.jpg', 'https://www.soscuisine.com//recipe/creme-brulee', '', '40 min', '410 kcal', '{\"calories\":\"410\",\"fat\":\"35 g\",\"cholesterol\":\"320 mg\",\"protein\":\"5 g\"}', '{\"excellent_source_of\":\"Vitamin A, Vitamin B12, Vitamin D\",\"good_source_of\":\"Folacin, Pantothenic Acid, Selenium, Vitamin E\",\"source_of\":\"Calcium, Iron, Omega-3, Phosphorus, Vitamin B2, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:18:31'),
(510, 510, 1, 'Cucumber and Carrot Salad', 'Mix oil and vinegar in a bowl. Add onion and parsley. Put the grated cucumber in a sieve and press to remove excess water. Pat dry. Add the cucumber and carrot to the onion-parsley bowl and mix. Season with salt and pepper. This mixture can be chilled for a few hours in the refrigerator if you want to prepare the salad in advance. Bring back to room temperature before serving. Garnish with fresh coriander.', '[\"extra virgin olive oil\",\"wine vinegar. white\",\"onions, finely chopped\",\"Italian parsley, fresh, finely chopped\",\"cucumbers, medium size, English, grated\",\"carrots, grated\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"fresh cilantro, finely chopped\"]', 'https://media.soscuisine.com/images/recettes/2258.jpg', 'https://www.soscuisine.com//recipe/cucumber-carrot-salad', '', '15 min', '170 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Vitamin A, Vitamin K\",\"good_source_of\":\"Folacin, Potassium, Vitamin E\",\"source_of\":\"Calcium, Copper, Fibre, Iron, Magnesium, Manganese, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin C, Zinc\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:18:33'),
(511, 511, 1, 'Chicken and Cabbage Salad', 'In a large bowl, add the mayonnaise, yogurt, vinegar and ketchup. Prepare the cabbage , carrots and red onion. Thinly slice the cabbage and onion. Peel and grate the carrots. Add the vegetables to the bowl, add salt and pepper, then mix well. Remove the chicken meat from the bones, then shred or slice. Put the chicken pieces on top of the salad then serve.', '[\"mayonnaise\",\"yogurt, plain, 2%\",\"wine vinegar\",\"ketchup\",\"green cabbage, or Savoy, thinly sliced\",\"carrots, grated\",\"red onions, thinly sliced\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"BBQ chicken, whole, cooked, removed from bones\"]', 'https://media.soscuisine.com/images/recettes/1126.jpg', 'https://www.soscuisine.com//recipe/chicken-cabbage-salade', '', '15 min', '350 kcal', '{\"calories\":\"350\",\"fat\":\"19 g\",\"cholesterol\":\"90 mg\",\"protein\":\"30 g\"}', '{\"excellent_source_of\":\"Folacin, Niacin, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B6, Vitamin C, Vitamin K\",\"good_source_of\":\"Fibre, Magnesium, Pantothenic Acid, Vitamin B12, Vitamin E, Zinc\",\"source_of\":\"Calcium, Copper, Iron, Manganese, Omega-6, Vitamin B1, Vitamin B2, Vitamin D\",\"low\":\"Calories, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:18:34'),
(512, 512, 1, 'Curried Lentil and Spinach Soup', 'Rinse and drain the lentils, then set aside. Prepare the vegetables : Finely chop the onions, carrots, and celery; mince or the garlic. Mince the chili pepper ginger . Set aside. Heat the oil in a large pot over medium heat. Add the onions, carrots, celery, and garlic, then sauté 8-10 min until they are golden-coloured with occasional stirring . Stir in the curry powder, chili pepper, ginger, cumin, and bay leaf. Cook 1 min with stirring, then pour in the water and lentils. Bring to a boil, then reduce the heat to medium-low and simmer , uncovered,\r\nuntil the lentils are tender, about 30 min. Add more water to thin the soup, if desired. Add the spinach to the soup and simmer until it is wilted, about 5 min. Season with salt and pepper to taste. Remove the bay leaf. Ladle the soup into bowls. Top each serving with a spoonful of yogurt and serve.', '[\"green or brown lentils (dried)\",\"onions, finely chopped\",\"carrots, finely chopped\",\"celery, finely chopped\",\"garlic, minced or pressed\",\"dried chili peppers, minced\",\"gingerroot, minced\",\"olive oil\",\"curry powder\",\"ground cumin\",\"bay leaf\",\"water\",\"spinach, coarsely chopped\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"yogurt, plain, 2%\"]', 'https://media.soscuisine.com/images/recettes/890.jpg', 'https://www.soscuisine.com//recipe/curried-lentil-spinach-soup', 'It is not necessary to soak the lentils in advance.', '55 min', '220 kcal', '{\"calories\":\"220\",\"fat\":\"3 g\",\"cholesterol\":\"0 mg\",\"protein\":\"16 g\"}', '{\"excellent_source_of\":\"Fibre, Folacin, Iron, Magnesium, Manganese, Potassium, Vitamin A, Vitamin K\",\"good_source_of\":\"Copper, Niacin, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin B6, Zinc\",\"source_of\":\"Calcium, Selenium, Vitamin B2, Vitamin C, Vitamin E\",\"low\":\"Calories, Fat, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:18:35');
INSERT INTO `recipe_translation` (`rt_id`, `rt_recipe_id`, `rt_lang_id`, `rt_recipe_name`, `rt_recipe_text`, `rt_recipe_ingredients_full`, `rt_recipe_image`, `rt_recipe_link`, `rt_recipe_prep`, `rt_recipe_duration`, `rt_recipe_calories`, `rt_recipe_nutrients`, `rt_recipe_claims`, `rt_created`) VALUES
(513, 513, 1, 'Date and Quinoa Squares', 'Preheat the oven to 190°C/375°F. Line the baking dish with parchment paper and grease the sides with a little margarine. Put the dates in a saucepan with the orange juice. Bring to a boil, then reduce the heat and cook until the dates are softened, about 8 min. Remove from the heat and let cool down. Meanwhile,  in a bowl, the margarine with the brown sugar or sucanat using a the almonds in a food processor until finely ground, then add them to the mixture. Fold in the quinoa flakes and mix well. Put half of the mixture into the baking dish, spreading it evenly and pressing firmly. Put the dates on top of the mixture, then layer the remaining mixture over the dates. Bake in the middle of the oven until  the topping is golden, about 30 min. Take the dish out of the oven and let it cool down completely (about 4 hours or overnight) before unmolding. Cut into 16 square pieces then serve.', '[\"parchment paper\",\"pitted dates, chopped\",\"orange juice\",\"margarine non-hydrogenated\",\"brown sugar, or sucanat (unrefined sugar)\",\"almonds, finely ground\",\"quinoa flakes\"]', 'https://media.soscuisine.com/images/recettes/2401.jpg', 'https://www.soscuisine.com//recipe/date-quinoa-squares', '', '45 min', '320 kcal', '{\"calories\":\"320\",\"fat\":\"19 g\",\"cholesterol\":\"0 mg\",\"protein\":\"4 g\"}', '{\"excellent_source_of\":\"Manganese, Vitamin D, Vitamin E\",\"good_source_of\":\"Magnesium, Vitamin A, Vitamin K\",\"source_of\":\"Copper, Fibre, Folacin, Iron, Niacin, Omega-3, Omega-6, Phosphorus, Potassium, Vitamin B1, Vitamin B2, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:18:36'),
(514, 514, 1, 'Detox Spinach Smoothie Bowl', 'Place the banana and kiwi pieces with the spinach in a food processor blender , setting aside a few pieces of banana and kiwi for decorating. Add the yogurt and milk to the blender. Process on the highest speed until a well-blended purée forms, about 15 seconds, stopping to scrape down the sides of the container once or twice. Pour the smoothie into bowls then garnish with the remaining ingredients and the fruit slices set aside.', '[\"bananas, small, ripe, cut into chunks\",\"kiwis,  cut into pieces\",\"baby spinach\",\"Greek yogurt, plain, 2% M.F.\",\"milk, skimmed, 0%\",\"chia seeds\",\"hemp seeds\",\"pumpkin seeds\",\"blueberries, or other berries\"]', 'https://media.soscuisine.com/images/recettes/4310.jpg', 'https://www.soscuisine.com//recipe/detox-spinach-smoothie-bowl', 'will be very useful for this recipe.', '10 min', '350 kcal', '{\"calories\":\"350\",\"fat\":\"10 g\",\"cholesterol\":\"0 mg\",\"protein\":\"20 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Calcium, Fibre, Folacin, Magnesium, Manganese, Phosphorus, Potassium, Vitamin B2, Vitamin B6, Vitamin C, Vitamin K\",\"good_source_of\":\"Iron, Vitamin A, Vitamin B12, Vitamin E, Zinc\",\"source_of\":\"Copper, Niacin, Omega-3, Pantothenic Acid, Selenium, Vitamin B1, Vitamin D\",\"low\":\"Sodium\"}', '2021-06-18 14:18:37'),
(515, 515, 1, 'Easy Baked Okra', 'Preheat the oven to 205°C/400°F. In a large bowl, mix the oil, with curry, salt, and pepper. Add the okra and coat them well with the mixture. Transfer the vegetables to a baking sheet or an oven-proof dish. Don\'t crowd them or they will steam and not turn golden-brown. Bake in the center of the oven until nicely browned and tender, about 15 min, turning the pieces once. Serve.', '[\"okra\\/lady\'s fingers\",\"olive oil\",\"curry powder\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/4405.jpg', 'https://www.soscuisine.com//recipe/easy-baked-okra', '', '25 min', '60 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Manganese, Vitamin K\",\"good_source_of\":\"Folacin\",\"source_of\":\"Magnesium, Vitamin B1, Vitamin B6, Vitamin C, Vitamin E\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:18:38'),
(516, 516, 1, 'Chicken and Cauliflower Pie', 'Preheat the oven to 205°C/400°F. Prepare the vegetables : finely chop the onion; thinly slice the mushrooms; cut the cauliflower into florets then them 10-15 min until they are very tender. Drain them well and set aside. Heat the oil in a pan over medium-high heat. Add the ground chicken and it until it looses its pink colour, about 7-8 min. When the chicken is golden-coloured, add the chopped onion then cook 2 min with stirring in the diced tomatoes, mushrooms, tomato paste, Worcestershire sauce, and . Add the frozen peas and continue cooking until heated through, about 4-5 min. Add salt and pepper. Remove the pan from the heat and tranfer the contents to a large baking dish, or distribute into individual baking dishes. Pour the milk into a large microwave-safe bowl. Add the butter and microwave on medium-high a few minutes, uncovered, until very hot. Add the cooked cauliflower and mash it until creamy. Add salt and pepper to taste. Place a spoonful of the cauliflower mixture on top of the chicken mixture, then gently spread it with a spoon to cover evenly. Bake in the middle of the oven until the top is golden-brown, about 30 min. Serve.', '[\"cauliflower, cut into florets\",\"onions, finely chopped\",\"button (white) mushrooms, thinly sliced\",\"olive oil\",\"ground chicken, or ground turkey\",\"canned tomatoes (diced)\",\"tomato paste\",\"Worcestershire sauce\",\"chicken broth\",\"frozen peas\",\"milk, partly skimmed, 2%\",\"butter, unsalted\",\"ground pepper to taste\",\"[optional]\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/946.jpg', 'https://www.soscuisine.com//recipe/chicken-cauliflower-pie', 'For individual pies, choose baking dishes which contain about 375 ml or 1 ½ cups when 3/4 full.', '55 min', '330 kcal', '{\"calories\":\"330\",\"fat\":\"18 g\",\"cholesterol\":\"70 mg\",\"protein\":\"23 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Fibre, Folacin, Phosphorus, Potassium, Vitamin A, Vitamin B6, Vitamin C, Vitamin K\",\"good_source_of\":\"Iron, Manganese, Niacin, Pantothenic Acid, Selenium, Vitamin B1, Vitamin B2\",\"source_of\":\"Calcium, Copper, Magnesium, Vitamin B12, Vitamin D, Vitamin E, Zinc\",\"low\":\"Calories, Cholesterol, Saturated Fat, Sodium\"}', '2021-06-18 14:18:38'),
(517, 517, 1, 'Chicken and Couscous Salad', 'Cook the couscous . Rinse and drain the chickpeas and set aside. In a small bowl, together the extra virgin olive oil, lemon juice, curry powder and grated ginger. Season with salt and pepper. Put the couscous in a salad bowl, then pour the vinaigrette over it. in the bell pepper, celery, green onion and chickpeas. Mix well then let stand in the refrigerator 30 min. About 15 min before serving, take the salad out of the refrigerator and prepare the grilled chicken breast Add the baby spinach to the couscous salad. Cut the chicken crosswise into thin slices, then add them to the salad. adjust the seasoning , sprinkle with cilantro, then serve.', '[\"chickpeas\\/garbanzo beans (canned), rinsed and drained\",\"couscous, whole wheat\",\"extra virgin olive oil\",\"lemon juice, freshly squeezed\",\"curry powder\",\"gingerroot, grated\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"green peppers, diced\",\"celery, diced\",\"green onions\\/scallions, finely chopped\",\"Grilled Chicken Breast\",\"baby spinach\",\"fresh cilantro, chopped\"]', 'https://media.soscuisine.com/images/recettes/3460.jpg', 'https://www.soscuisine.com//recipe/chicken-couscous-salad', '', '30 min', '570 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B6, Vitamin C, Vitamin E, Vitamin K\",\"good_source_of\":\"Copper, Vitamin B1, Vitamin B2, Zinc\",\"source_of\":\"Calcium, Vitamin B12\",\"low\":\"Cholesterol, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:18:38'),
(518, 518, 1, 'Energizer Breakfast Bowl', 'Portion out the oats to each jar of about 1 cup (250ml) volume. Pour in the milk, nuts, syrup and chia seeds, which will thicken the oatmeal. Close the lid and shake to combine. Open and top up the jar with the banana pieces. Close the lid again and keep in the refrigerator for at least 4 hours. When ready to serve, mix in yogurt and almond butter. Enjoy.', '[\"rolled oats, not instant type\",\"milk, partly skimmed, 2%\",\"walnuts\",\"maple syrup\",\"chia seeds\",\"bananas, small, or other seasonal fruit, cut into pieces\",\"Greek yogurt, plain, 2% M.F.\",\"almond butter\"]', 'https://media.soscuisine.com/images/recettes/3294.jpg', 'https://www.soscuisine.com//recipe/energizer-breakfast-bowl', 'This oatmeal in a jar can be stored 2 days in the refrigerator.', '5 min', '590 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Calcium, Fibre, Magnesium, Manganese, Phosphorus, Potassium, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin D\",\"good_source_of\":\"Copper, Folacin, Iron, Niacin, Pantothenic Acid, Selenium, Zinc\",\"source_of\":\"Omega-3, Vitamin A, Vitamin C\",\"low\":\"Cholesterol, Saturated Fat, Sodium\",\"free\":\"Trans Fat\"}', '2021-06-18 14:18:39'),
(520, 520, 1, 'Fall Apple Muffins', 'Preheat the oven to 175°C/350°F. Place 12 paper muffin cups in a 12 cup muffin \r\npan. Prepare the oatmeal topping: in a  bowl, combine the rolled oats with the flour, \r\nbrown sugar and half of the margarine. Set aside. Peel the apples, then dice them into small pieces. Set a few pieces aside for \r\ngarnishing each muffin at the end of the preparation. Heat one spoonful of \r\nmargarine in a pan, then sauté the remaining pieces until they are somewhat softened, about 4 min. Set aside. In a second bowl, together the pastry flour, baking powder, and cinnamon. Set aside. In a third bowl, the remaining margarine with \r\nthe sugar using a ,  until the mixture \r\nis lighter in colour, about 3 min. Add the eggs one at a time, beating well after each addition. \r\nStir in the vanilla. Using a wooden spoon add the flour mixture in small portions, alternating with the milk. Mix well until homogeneous then fold in the \r\nsautéed apples using a spatula. Using an ice cream scoop, divide the batter among the muffin cups. Cover each \r\nmuffin with the oatmeal topping and the uncooked apple pieces. Bake in the middle of the oven about 25 min, until a tooth-pick inserted into the center of a muffin comes out clean. Take \r\nthe pan out of the oven, then put each of the paper lined muffins on a rack to cool. Serve.', '[\"rolled oats, for topping\",\"white flour (all purpose), for topping\",\"brown sugar, for topping\",\"margarine non-hydrogenated\",\"apples, Cortland, peeled then diced\",\"pastry flour\",\"baking powder\",\"ground cinnamon\",\"sugar\",\"eggs size large\",\"vanilla extract\",\"milk, partly skimmed, 2%\"]', 'https://media.soscuisine.com/images/recettes/784.jpg', 'https://www.soscuisine.com//recipe/apple-muffins', '', '50 min', '320 kcal', '{\"calories\":\"320\",\"fat\":\"17 g\",\"cholesterol\":\"40 mg\",\"protein\":\"4 g\"}', '{\"excellent_source_of\":\"Vitamin D\",\"good_source_of\":\"Folacin, Vitamin A, Vitamin B1, Vitamin K\",\"source_of\":\"Calcium, Fibre, Iron, Manganese, Niacin, Omega-3, Omega-6, Phosphorus, Selenium, Vitamin B12, Vitamin B2, Vitamin E\",\"low\":\"Sodium\"}', '2021-06-18 14:18:40'),
(521, 521, 1, 'Fall Tart', 'Preheat the oven to 205°C/400°F. Butter a large baking sheet (about 30 x 38 cm) and line it with parchment\r\npaper Combine the flour, brown sugar, and cardamom in a large bowl. Peel the apples, remove and discard the cores, then cut them into 5 mm thick segments. Peel the pears, remove and discard the cores, then cut them into slightly thicker segments (about 7 mm). Place the apple and pear pieces into the flour mixture as soon as they are ready in order to avoid darkening. Add the cranberrys, then gently to make sure the fruits are thoroughly coated. On a lightly floured board, roll out the puff pastry to a 33 cm square (approx.), using a rolling pin. Place the pastry on the prepared baking sheet. Arrange the fruit in the centre of\r\nthe pastry leaving an uncovered frame of about 5 cm from the edges. Fold the pastry back over the fruit. Cut the butter into small pieces and add them on top. Cook the tart in the middle of the oven about 15 min. Lower the heat to 190°C/375°F, then continue to cook 30-35 min, until the fruits are tender and the pastry is crisp and golden. Take the tart out of the oven and set it aside to let it cool, about 15 min. Serve the tart luke-warm, with an optional scoop of vanilla ice cream on top of each serving.', '[\"puff pastry dough\",\"parchment paper, to line the sheet\",\"white flour (all purpose)\",\"brown sugar\",\"ground cardamom\",\"apples, Cortland or Lobo\",\"pears, firm-ripe\",\"cranberries\",\"butter, unsalted\",\"vanilla ice cream\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/741.jpg', 'https://www.soscuisine.com//recipe/fall-tart', 'Defrost the puff pastry dough at room temperature for 2 hours or overnight in the refrigerator. The dough should be flexible but still feel cold to the touch.', '60 min', '340 kcal', '{\"calories\":\"340\",\"fat\":\"15 g\",\"cholesterol\":\"10 mg\",\"protein\":\"4 g\"}', '{\"excellent_source_of\":\"Manganese\",\"good_source_of\":\"Fibre, Folacin, Selenium\",\"source_of\":\"Copper, Iron, Magnesium, Niacin, Omega-3, Omega-6, Potassium, Vitamin B1, Vitamin B2, Vitamin E, Vitamin K\",\"low\":\"Sodium\"}', '2021-06-18 14:18:41'),
(522, 522, 1, '\"Fattouche\" Salad', 'Coarsely chop the onion and soak it in water with a few drops of vinegar for about ½ h. You can also leave it overnight in the refrigerator. This makes the raw onion easier to digest and crispier. Prepare the vegetables . Cut the cucumbers in half lengthwise and use a spoon to scrape out the seeds. Slice them coarsely, then sprinkle with salt to let excess and possibly bitter liquids drain off. Coarsely dice the tomatoes. Chop the parsley and mint leaves. Wash the romaine lettuce, spin-dry, then tear the leaves into bite-size pieces. Place all the vegetables in a salad bowl or serving plate. Mince the garlic and put it into a small bowl. Add the oil, lemon juice, minced chili pepper (optional). Add salt and pepper. using a fork until the vinaigrette is emulsified. Adjust the seasoning . Pour over the vegetables and well. Let stand 15 min. When ready to serve, grill the pita bread in a toaster, break into pieces then add them to the salad. Serve.', '[\"Romaine lettuce\",\"tomatoes, coarsely diced\",\"cucumbers, medium size, seeded and coarsely sliced\",\"Italian parsley, fresh, chopped\",\"fresh mint, chopped\",\"onions, coarsely chopped\",\"garlic, finely chopped\",\"extra virgin olive oil\",\"lemon juice, freshly squeezed\",\"sumac\",\"[optional]\",\"dried chili peppers, minced\",\"pita breads\",\"ground pepper to taste\",\"[optional]\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/68.jpg', 'https://www.soscuisine.com//recipe/fattouche-salad', '» at your grocery store, you may substitute it by some lemon juice.', '15 min', '230 kcal', '{\"calories\":\"230\",\"fat\":\"15 g\",\"cholesterol\":\"0 mg\",\"protein\":\"4 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Manganese, Potassium, Vitamin A, Vitamin C, Vitamin E, Vitamin K\",\"good_source_of\":\"Fibre, Iron, Magnesium, Vitamin B1, Vitamin B6\",\"source_of\":\"Calcium, Copper, Niacin, Pantothenic Acid, Phosphorus, Selenium, Vitamin B2, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:18:41'),
(523, 523, 1, 'Fava Bean Soup', 'Prepare the vegetables : Finely chop the onion and garlic. Heat the oil in a large pot over medium heat. Add the onion and garlic, then sauté 3-4 min until they are soft. Pour in the and water. Bring to a boil. in the beans, savory, salt and pepper. Reduce the heat, cover and simmer until the beans are cooked al dente , \r\nbetween 1 h and 1 h 30 min, depending on the size and freshness of the beans. Add the barley, then bring to a boil. Continue to simmer, covered, until the  barley is tender, about 45 min. Adjust the seasoning . Thin the soup with more broth or water, if desired. Ladle the soup into bowls and serve.', '[\"onions, finely chopped\",\"garlic, finely chopped\",\"canola oil\",\"chicken broth\",\"water\",\"fava beans, shelled\",\"dried savory\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"pearl barley\"]', 'https://media.soscuisine.com/images/recettes/1089.jpg', 'https://www.soscuisine.com//recipe/fava-bean-soup', 'This recipe calls for shelled beans (either fresh or frozen). It takes about 1 kg of unshelled beans to obtain 2 cups (300 g) of shelled ones. Shell them just before cooking to avoid darkening.', '130 min', '140 kcal', '{\"calories\":\"140\",\"fat\":\"3 g\",\"cholesterol\":\"0 mg\",\"protein\":\"6 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Folacin\",\"good_source_of\":\"Fibre, Magnesium, Manganese, Vitamin C\",\"source_of\":\"Copper, Iron, Niacin, Omega-3, Phosphorus, Potassium, Selenium, Vitamin B1, Vitamin B2, Vitamin B6, Zinc\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:18:42'),
(524, 524, 1, 'Fennel and Orange Salad', 'In a small bowl, soak the thinly sliced onion in water with few drops of vinegar about 10 min while preparing the rest of the salad. Peel the oranges with a sharp knife, removing all of the white pith from the flesh. Save the juice resulting from the peeling. Cut the oranges into 7 mm thick rounds, then place the rounds in a salad bowl. Remove and discard the stalk and feathery leaves of the fennel. Thinly slice the bulb with a mandolin , then \r\nadd it to the bowl. Put the oil, reserved orange juice, lemon juice, mustard, salt, and pepper in a small bowl, then until the vinaigrette is emulsified. Pour the vinaigrette over the salad, add the onion, well, then serve.', '[\"red onions, thinly sliced\",\"oranges, blood type, if available\",\"fennels, thinly sliced\",\"extra virgin olive oil\",\"lemon juice, freshly squeezed\",\"mustard powder\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1021.jpg', 'https://www.soscuisine.com//recipe/fennel-orange-salad', 'will make slicing the fennel easier.', '15 min', '220 kcal', '{\"calories\":\"220\",\"fat\":\"15 g\",\"cholesterol\":\"0 mg\",\"protein\":\"2 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Vitamin C\",\"good_source_of\":\"Fibre, Potassium, Vitamin E\",\"source_of\":\"Calcium, Copper, Iron, Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Vitamin A, Vitamin B1, Vitamin B6, Vitamin K\",\"low\":\"Sodium\"}', '2021-06-18 14:18:43'),
(525, 525, 1, 'Fennel and Spinach Salad', 'Finely chop the onion, then put it in a small bowl and cover it with water and a few drops of vinegar. Let it soak for 30 min (you may leave it up to overnight in the refrigerator). This makes the raw onion easier to digest and crispier. Prepare the fennel : Trim and discard the stalk and feathery leaves. Also discard any tough outer layers of the bulb, then thinly slice the fennel bulb crosswise using a mandolin . Put the slices in a salad bowl. Prepare the spinach and add it to the bowl. in the olives. Pour the orange juice in a separate small bowl. Pour in the lemon juice and olive oil. Add salt and pepper to taste, then well using a fork, until the vinaigrette is emulsified. Pour it over the salad and Let stand 10 min before serving.', '[\"red onions, finely chopped\",\"fennels, thinly sliced\",\"baby spinach\",\"black olives\",\"orange juice\",\"lemon, freshly squeezed\",\"extra virgin olive oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/749.jpg', 'https://www.soscuisine.com//recipe/fennel-spinach-salad', 'will make slicing easier.', '15 min', '200 kcal', '{\"calories\":\"200\",\"fat\":\"17 g\",\"cholesterol\":\"0 mg\",\"protein\":\"2 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Vitamin A, Vitamin E, Vitamin K\",\"good_source_of\":\"Iron, Magnesium, Manganese, Potassium, Vitamin C\",\"source_of\":\"Calcium, Copper, Fibre, Vitamin B2, Vitamin B6\"}', '2021-06-18 14:18:44'),
(526, 526, 1, 'Fennel, Grape, and Blue Cheese Salad', 'Prepare the vegetables .\r\nTrim the fennel stalk and feathery leaves, discard any tough outer layers, then very\r\nfinely slice the fennel crosswise using a mandolin and put the slices in a salad bowl. In a small bowl, combine the classic vinaigrette and lemon juice. Add salt and pepper to taste, then pour the vinaigrette over the\r\nfennel, well and let stand 10 min. Wash the lettuce, then spin-dry. Tear the leaves into bite-size pieces and\r\nadd them to the salad bowl. Wash the grapes, dry, halve and remove the seeds (if needed).\r\nAdd the grapes to the bowl, then crumble the blue cheese over the salad. and serve\r\nimmediately.', '[\"fennels, thinly sliced\",\"Classic Vinaigrette\",\"lemon juice, freshly squeezed\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"Boston lettuce, or leaf lettuce\",\"grapes\",\"Gorgonzola cheese, Roquefort, or other blue cheese, crumbled\"]', 'https://media.soscuisine.com/images/recettes/478.jpg', 'https://www.soscuisine.com//recipe/fennel-grape-blue-cheese-salad', 'will make slicing the fennel easier.', '10 min', '150 kcal', '{\"calories\":\"150\",\"fat\":\"11 g\",\"cholesterol\":\"10 mg\",\"protein\":\"3 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Vitamin K\",\"good_source_of\":\"Folacin, Manganese, Potassium\",\"source_of\":\"Calcium, Fibre, Iron, Magnesium, Niacin, Pantothenic Acid, Phosphorus, Vitamin A, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin C, Vitamin E\"}', '2021-06-18 14:18:44'),
(527, 527, 1, 'Fiddlehead Soup', 'Cook the rice and set aside. Prepare the fiddleheads : wash them well, soak them at least 10 minutes, then blanch them\r\n15 min in a pot of boiling salted water. Set them aside. Melt the butter in a saucepan over medium-low heat. Add the finely chopped shallot and sauté 2-3 min until it is translucent, taking care not to let it burn. Add the fiddleheads and cook 1 min, then pour in the and the rice. Bring to a boil, cover and simmer 5 min. Add\r\nsalt and pepper to taste. Purée the soup in a blender , then distribute it into bowls and serve. If desired, garnish each bowl with sliced almonds.', '[\"rice, long grain\",\"fiddleheads\",\"butter, unsalted\",\"shallots, finely chopped\",\"chicken broth\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"flaked almonds\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/150.jpg', 'https://www.soscuisine.com//recipe/fiddlehead-soup', 'will be very useful to purée the soup.', '35 min', '100 kcal', '{\"calories\":\"100\",\"fat\":\"3 g\",\"cholesterol\":\"10 mg\",\"protein\":\"7 g\"}', '{\"free\":\"Sugar\",\"excellent_source_of\":\"Manganese, Niacin, Vitamin A, Vitamin C\",\"good_source_of\":\"Copper, Magnesium, Potassium, Vitamin B2\",\"source_of\":\"Iron, Phosphorus, Zinc\"}', '2021-06-18 14:18:45'),
(528, 528, 1, 'Five Flour Bread Machine Bread', 'Fit the pan in the bread machine. Heat water in the microwave for 50 to 70 seconds. Crack eggs into the hot water, beat them and pour everything into the pan of the bread machine. Add remaining ingredients, in the order they appear on the list. If your bread machine is a Black & Decker B2300 model, start the rapid baking cycle (no. 2), 2 lb. bread, dark crust and turn on the machine. Baking will take 1 hour 28 minutes and your bread should be cooked just right. If you have a different model, choose a rapid cycle and test it to determine the best conditions. When the baking is over, invert the pan onto a rack and cool 1 to 2 hours. Wrap the bread in paper towels or a cloth, put into a plastic bag and refrigerate.', '[\"water\",\"eggs size large\",\"extra virgin olive oil\",\"salt, sea, unrefined gray\",\"honey\",\"rice vinegar\",\"flax seeds, ground\",\"guar gum, or xanthan\",\"rice and chestnut flour\",\"quinoa flour\",\"brown rice flour\",\"tapioca flour\\/starch\",\"teff flour\",\"baking powder\",\"bread machine yeast, or quick-rise\"]', 'https://media.soscuisine.com/images/recettes/2265.jpg', 'https://www.soscuisine.com//recipe/five-flour-bread-machine-bread', '', '105 min', '150 kcal', '{\"calories\":\"150\",\"fat\":\"4 g\",\"cholesterol\":\"20 mg\",\"protein\":\"4 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"good_source_of\":\"Manganese\",\"source_of\":\"Calcium, Fibre, Folacin, Iron, Magnesium, Niacin, Omega-3, Pantothenic Acid, Phosphorus, Vitamin B2, Zinc\",\"low\":\"Saturated Fat\",\"free\":\"Trans Fat\"}', '2021-06-18 14:18:46'),
(529, 529, 1, 'Chicken and Potato Fricassee', 'Cut the meat into small 1 cm cubes. Prepare\r\nthe vegetables : Finely chop the onion and garlic; cut the potatoes and celery into 1 cm thick pieces. Heat half of the butter and oil in a thick-bottom frying pan over medium heat. Add the onion and garlic, sauté 3-4 min until translucent, then remove them and set aside. In the same pan, add the cubes of chicken and them over high heat 4-5 min until golden-brown. Add the remaining butter and oil to the pan. in the potatoes and celery, then sauté a few\r\nminutes. Pour in the , then deglaze . Put the onion and garlic back into the pan. Season with salt and pepper to taste. Cook, covered, over low heat 20-25 min, until the potatoes are soft. Add the peas and cook an additional 3 min. Sprinkle with the chopped parsley (optional) and serve in the warmed dishes.', '[\"chicken breasts, boneless, skinless, cut into 1 cm cubes\",\"onions, finely chopped\",\"garlic, finely chopped\",\"potatoes, peeled and cut into 1 cm cubes\",\"celery, cut into 1 cm cubes\",\"butter, unsalted\",\"canola oil\",\"chicken broth\",\"frozen peas\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"Italian parsley, fresh\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/672.jpg', 'https://www.soscuisine.com//recipe/chicken-potato-fricassee', '', '50 min', '350 kcal', '{\"calories\":\"350\",\"fat\":\"11 g\",\"cholesterol\":\"100 mg\",\"protein\":\"37 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Niacin, Phosphorus, Potassium, Vitamin B6, Vitamin K\",\"good_source_of\":\"Folacin, Magnesium, Pantothenic Acid, Vitamin B1, Vitamin B12\",\"source_of\":\"Copper, Fibre, Iron, Manganese, Vitamin A, Vitamin B2, Vitamin C, Vitamin D, Vitamin E, Zinc\",\"low\":\"Calories, Saturated Fat, Sodium\"}', '2021-06-18 14:18:48'),
(530, 530, 1, 'Fresh Marjoram Soup', 'Pour the and water into a saucepan, then bring it to a boil. in the pasta and cook until al\r\ndente, about 10 min. Meanwhile, mince the marjoram , then add it to a small bowl. Grate the Parmesan, then add it to the bowl. the egg(s) with the marjoram and Parmesan. Season with salt and pepper. Pour the egg mixture into the broth, then remove the saucepan from the heat, wait 30 seconds, then gently once or twice using a fork to scramble the egg(s). Serve.', '[\"chicken broth\",\"water\",\"orzo or risoni (tiny pasta for soups)\",\"marjoram, fresh, minced\",\"Parmesan cheese, grated\",\"eggs size large\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/612.jpg', 'https://www.soscuisine.com//recipe/fresh-marjoram-soup', 'If you cannot find «risoni», the pasta with the size and shape of rice grains, any other tiny pasta for soups will do. They are all beautifully shaped and poetically named. The most common ones are : «stelline - little stars», «farfalline\r\n- little butterflies», «orzo - barley», «pastina - tiny pasta».', '15 min', '230 kcal', '{\"calories\":\"230\",\"fat\":\"5 g\",\"cholesterol\":\"100 mg\",\"protein\":\"11 g\"}', '{\"diet-related_health_claims\":\"Bone-healthy\",\"excellent_source_of\":\"Iron, Manganese, Selenium, Vitamin K\",\"good_source_of\":\"Calcium, Fibre, Folacin, Magnesium, Vitamin B12\",\"source_of\":\"Copper, Niacin, Pantothenic Acid, Phosphorus, Vitamin A, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin D, Vitamin E, Zinc\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:18:51'),
(531, 531, 1, 'Fresh Tomatillo Salsa', 'Coarsely chop the tomatillos, then purée with the remaining ingredients, using a blender , until smooth. Salt to taste then serve.', '[\"tomatillos, husked and rinsed\",\"garlic\",\"jalape\\u00c3\\u00b1o pepper, fresh, chopped\",\"fresh cilantro, chopped\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2597.jpg', 'https://www.soscuisine.com//recipe/fresh-tomatillo-salsa', 'will be very useful to purée the vegetables.', '10 min', '160 kcal', '', '', '2021-06-18 14:18:55'),
(532, 532, 1, 'Fresh Tomato Base', 'Wash the tomatoes briefly, cut them in half and put them in a pot. Add the water and salt, cover, and cook for about 10-15 min until the tomatoes are softened. Pass the tomatoes through a food mill . Discard the skin and seeds, then put the purée back into the pot that was used to cook the tomatoes.\r\nBring to a boil, then simmer over medium-low heat, uncovered, for about 1,5-2 h, until the volume has reduced to about one third of the original volume and the purée has reached the consistency of a sauce. Let the purée cool down 30 min, then transfer it to small containers. Chill in the refrigerator then freeze.', '[\"tomatoes, Roma type\",\"water\",\"salt\"]', 'https://media.soscuisine.com/images/recettes/690.jpg', 'https://www.soscuisine.com//recipe/fresh-tomato-base', 'will be very useful to purée the tomatoes as well as removing the skin and seeds.', '115 min', '160 kcal', '{\"calories\":\"50\",\"fat\":\"1 g\",\"cholesterol\":\"0 mg\",\"protein\":\"2 g\"}', '{\"low\":\"Calories, Sodium\",\"free\":\"Added Sugar, Cholesterol, Fat, Saturated Fat, Trans Fat\"}', '2021-06-18 14:18:55'),
(533, 533, 1, 'Fruit and Couscous Salad', 'Cook the couscous . Let the couscous swell 2 min. Press the lemons and half of the oranges, then pour the juice into a small bowl. in the oil and balsamic vinegar. Mix well, then pour the dressing over the couscous and gently. Cover and chill in the refrigerator for about 1 h. Peel the remaining oranges and separate the segments. Peel the kiwis and cut them into lengthwise wedges. Wash the blackberries. Chop the mint, keeping a few whole leaves for decoration. Add the fruits and mint to the couscous just before\r\nserving. gently, season with salt and pepper, then garnish with a few mint leaves and serve.', '[\"couscous, whole wheat\",\"salt\",\"[optional]\",\"oranges\",\"lemon juice, freshly squeezed\",\"canola oil\",\"balsamic vinegar\",\"kiwis\",\"blackberries\",\"fresh mint\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/446.jpg', 'https://www.soscuisine.com//recipe/fruit-couscous-salad', '', '25 min', '280 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Fibre, Folacin, Manganese, Vitamin C, Vitamin K\",\"good_source_of\":\"Magnesium, Niacin, Potassium, Vitamin B1, Vitamin E\",\"source_of\":\"Calcium, Copper, Iron, Pantothenic Acid, Phosphorus, Vitamin A, Vitamin B2, Vitamin B6, Zinc\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:18:56'),
(534, 534, 1, 'Fruit Salad with Cream', 'Peel and cut the peaches into bite-size pieces, then put them in a bowl. Rinse the berries, gently, without soaking them. Hull the strawberries, halve them lengthwise, and add them to the bowl. Add the blueberries. Pour in the cream, gently, then portion out the fruits into individual serving cups. Serve.', '[\"peaches, yellow, or nectarines\",\"strawberries\",\"blueberries\",\"cream 15%\"]', 'https://media.soscuisine.com/images/recettes/640.jpg', 'https://www.soscuisine.com//recipe/fruit-salad-cream', '', '10 min', '80 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Vitamin C\",\"good_source_of\":\"Manganese\",\"source_of\":\"Fibre, Folacin, Magnesium, Potassium, Vitamin E, Vitamin K\",\"low\":\"Cholesterol, Fat, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:18:57'),
(535, 535, 1, 'Chicken and Sweet Potato Bake', 'Preheat the oven to 190°C/375°F. Prepare the vegetables : Finely chop the onion; peel the carrots then slice them into thin rounds; slice the celery into small pieces. Heat the oil in a pan over medium heat. Add the onion, carrots, and celery, then sauté 5-6 min until they are a bit softened. Add salt and pepper, then in the chicken pieces. Cook 3-4 min until  the mixture is warmed through, then transfer it to a baking dish. While the onions and carrots are cooking, melt the butter in a saucepan over medium heat. Add the flour and cook 2 min with stirring . Slowly add the broth with stirring and bring to a boil.  Cook a few minutes until a thicker consistency is obtained, then pour the sauce over the chicken and vegetable mixture. Peel the sweet potatoes and grate them using a large holed grater. Put them in a bowl, add the grated cheese and mix, then spread the mixture on top of the prepared baking dish. Bake in the middle of the oven for about 30 min. For a nice golden-brown crust, turn on the top broiler for the last 2 min. Serve.', '[\"onions, finely chopped\",\"carrots, sliced into thin rounds\",\"olive oil\",\"celery, sliced into small pieces\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"Homemade Boiled Chicken\",\"butter, unsalted\",\"white flour (all purpose)\",\"Homemade Chicken Broth\",\"sweet potatoes, peeled then grated\",\"Cheddar cheese, grated\"]', 'https://media.soscuisine.com/images/recettes/1044.jpg', 'https://www.soscuisine.com//recipe/chicken-sweet-potato-bake', 'available.', '55 min', '460 kcal', '{\"calories\":\"460\",\"fat\":\"23 g\",\"cholesterol\":\"90 mg\",\"protein\":\"28 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Calcium, Fibre, Folacin, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B2, Vitamin B6, Vitamin K, Zinc\",\"good_source_of\":\"Iron, Pantothenic Acid, Vitamin B1, Vitamin B12, Vitamin C, Vitamin E\",\"source_of\":\"Copper, Vitamin D\"}', '2021-06-18 14:18:59'),
(536, 536, 1, 'Garlic-Flavored Roasted Beets', 'Preheat the oven to 205°C/400°F or the outdoor grill. Prepare the beets . Place a sheet of parchment\r\npaper on top of a similarly sized piece of aluminum foil, then place the beets in the centre of the parchment paper. Fold the aluminum foil / parchment paper over the beets to enclose them, then place the packet on a baking sheet and roast it in the middle of the oven for about 1 h. The beets can be pierced, through the foil on the top of the packet, to check for doneness. Alternatively, the beets may be cooked on an outdoor grill. Remove the beets from the oven, let them cool down about 10 min, then rub off the skins and discard them. Grate the beets then put them in a salad bowl. Drizzle the beets with oil. Season with salt and pepper to taste, add the garlic, then . Serve.', '[\"beetroots\",\"parchment paper\",\"aluminum foil\",\"olive oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"garlic, finely chopped\"]', 'https://media.soscuisine.com/images/recettes/4421.jpg', 'https://www.soscuisine.com//recipe/garlic-flavored-roasted-beets', 'Beets can be cooked up to 5 days in advance.', '65 min', '100 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Folacin\",\"source_of\":\"Iron, Magnesium, Manganese, Potassium, Vitamin E, Vitamin K\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:19:03'),
(537, 537, 1, 'Gazpacho', 'Soak the bread in a bowl of water with the vinegar (just a few drops). After about 10 min squeeze the bread dry, discarding the soaking water, then transfer it to a food\r\nprocessor While the bread is soaking, prepare the vegetables . Peel the tomatoes by plunging them for 30 seconds into a pot of boiling water. the garlic, chop the green onions, and cut the cucumber and red pepper into small pieces. Put one batch of vegetables into the food processor then pulse a couple of times until the mixture is well blended. Add the remaining\r\nvegetables then process until a dense purée is obtained. Pour in the extra virgin olive oil in a slow stream while running the blender continuously, about 1 min, until the mixture is smooth. Season with salt, pepper, and Tabasco sauce. Add sugar to taste, if needed, according to the type and ripeness of the tomatoes. Transfer the soup to a bowl, cover, and chill thoroughly (about 2 hours). When ready to serve, prepare the croutons , cook the hard-boiled eggs , and prepare the garnish of chopped green onions, diced green peppers, celery, and cucumbers. Put each garnish ingredient into separate small bowls. Adjust the seasoning of the soup and serve it into dishes with the garnish on the side.', '[\"bread, whole wheat\",\"wine vinegar\",\"tomatoes, very ripe\",\"garlic\",\"green onions\\/scallions\",\"cucumbers, medium size\",\"yellow or red sweet peppers\",\"extra virgin olive oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"Tabasco sauce\",\"sugar to taste\",\"[optional]\",\"olive oil, for the croutons\",\"bread, whole wheat, for the croutons\",\"eggs size large, to garnish\",\"green onions\\/scallions, to garnish\",\"green peppers, to garnish\",\"celery, to garnish\",\"cucumbers, medium size, to garnish\"]', 'https://media.soscuisine.com/images/recettes/78.jpg', 'https://www.soscuisine.com//recipe/gazpacho', 'will be very useful to purée the soup.', '30 min', '340 kcal', '{\"calories\":\"340\",\"fat\":\"25 g\",\"cholesterol\":\"50 mg\",\"protein\":\"7 g\"}', '{\"excellent_source_of\":\"Folacin, Manganese, Potassium, Selenium, Vitamin A, Vitamin C, Vitamin E, Vitamin K\",\"good_source_of\":\"Fibre, Iron, Magnesium, Niacin, Vitamin B1, Vitamin B6\",\"source_of\":\"Calcium, Copper, Pantothenic Acid, Phosphorus, Vitamin B12, Vitamin B2, Zinc\"}', '2021-06-18 14:19:08'),
(538, 538, 1, 'Ginger Cookies', 'Sift the flour, baking soda, ginger powder, cinnamon, and salt into a medium bowl. Finely grind the cloves and peppercorns using a spice grinder or a mortar and pestle, then add them to the bowl. Add the grated ginger. Put the butter, brown sugar, honey, and molasses in a large bowl or saucepan. Warm up the mixture in a microwave or on the stovetop just enough to make the blending easier. Using a wooden spoon, the mixture until it is homogeneous, then pour some of it into the dry ingredients. Add the egg to the medium bowl with the dry ingredients, then until the mixture forms a soft dough. Transfer the dough to the large bowl and stir until all the ingredients are well blended and the dough has a \"pie dough\" consistency. Divide the dough into thirds. Gather each third into a ball, wrap it in plastic wrap then refrigerate it until firm, about ½ hour. The cooling step will make the dough easier to roll. (The dough can be prepared ahead and kept in the refrigerator for up to 2 days, or up to 2 months in the freezer).', '[\"white flour (all purpose)\",\"baking soda\",\"ground ginger\",\"ground cinnamon\",\"salt\",\"white peppercorns, or black, finely ground\",\"cloves, finely ground\",\"gingerroot, grated\",\"butter, unsalted\",\"brown sugar\",\"honey\",\"molasses\",\"eggs size large\"]', 'https://media.soscuisine.com/images/recettes/798.jpg', 'https://www.soscuisine.com//recipe/ginger-cookies', 'The quantity of spices may be adjusted according to your taste, however remember that these cookies are supposed to be spiced. Their size and thickness may be varied too : thinner cookies will be a little harder to do and take longer to make, but will be crispier. Fanciful cookie cutters will be needed for extra fun.', '80 min', '50 kcal', '{\"calories\":\"50\",\"fat\":\"2 g\",\"cholesterol\":\"10 mg\",\"protein\":\"1 g\"}', '{\"source_of\":\"Folacin, Manganese, Selenium\",\"low\":\"Sodium\"}', '2021-06-18 14:19:13'),
(539, 539, 1, 'Ginger Squash PurÃÂ©e', 'Preheat the oven to 175°C/350°F. Cut the butternut squash in half lengthwise. Place the 2 halves on a baking sheet, cut side down. Bake about 1 hour, until it can be mushed with a fork. Let cool down and purée in a food processor . Add the butter, nutmeg, and grated ginger . Season with salt and pepper to taste. Reheat and serve warm.', '[\"butternut squash, cut in half lengthwise\",\"butter, unsalted\",\"nutmeg\",\"gingerroot, grated\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/122.jpg', 'https://www.soscuisine.com//recipe/ginger-squash-puree', 'will be very useful to purée the squash.', '65 min', '150 kcal', '{\"calories\":\"150\",\"fat\":\"6 g\",\"cholesterol\":\"20 mg\",\"protein\":\"2 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Magnesium, Potassium, Vitamin A, Vitamin C, Vitamin E\",\"good_source_of\":\"Manganese, Vitamin B1, Vitamin B6\",\"source_of\":\"Calcium, Copper, Fibre, Iron, Niacin, Pantothenic Acid, Phosphorus\",\"low\":\"Sodium\"}', '2021-06-18 14:19:15'),
(540, 540, 1, 'Glazed Small Onions', 'Clean the cipollini as you would clean regular onions. Leave them whole. Heat the butter and oil in a saucepan over medium-low heat. Add the cipollini sauté 2-3 min, stirring gently, until lightly golden. Add the sugar, vinegar, and about 2 cm of water. Cook over medium heat, uncovered, about 10 min, until the cipollini are softened. If too much liquid is remaining at the end, reduce it over high\r\nheat and caramelize the cipollini . Serve.', '[\"cipollini onions (borettana)\",\"butter, unsalted\",\"olive oil\",\"sugar\",\"wine vinegar\",\"water, approximately\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/551.jpg', 'https://www.soscuisine.com//recipe/glazed-small-onions', '(round-shaped, flat, about 3-4 cm in diameter). If they are not available, you may replace them with pearl onions.', '15 min', '130 kcal', '{\"calories\":\"130\",\"fat\":\"7 g\",\"cholesterol\":\"10 mg\",\"protein\":\"1 g\"}', '{\"source_of\":\"Folacin, Vitamin B6, Vitamin E\",\"low\":\"Sodium\"}', '2021-06-18 14:19:17'),
(541, 541, 1, 'Chicken and Vegetable Bake', 'Preheat the oven to 190°C/375°F. Prepare the vegetables : Finely chop the onion; peel the carrots then slice them into thin rounds. Heat the oil in a pan over medium heat. Add the onion and carrots, then sauté 5-6 min until they are a bit softened. Add salt and pepper, then in the small frozen peas and chicken pieces. Cook 3-4 min until  the mixture is warmed through, then transfer it to a baking dish. While the onions and carrots are cooking, melt the butter in a saucepan over medium heat. Add the flour and cook 2 min with stirring . Slowly add the broth with stirring and bring to a boil.  Cook a few minutes until a thicker consistency is obtained, then pour the sauce over the chicken and vegetable mixture. Peel the potatoes and grate them using a large holed grater. Put them in a bowl, add the grated cheese and mix, then spread the mixture on top of the prepared baking dish. Put the dish in the oven immediately after this step, to avoid darkening the potatoes. Bake in the middle of the oven for about 30 min. For a nice golden-brown crust, turn on the top broiler for the last 2 min. Serve.', '[\"onions, finely chopped\",\"carrots, cut into thin rounds\",\"olive oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"frozen peas\",\"Homemade Boiled Chicken\",\"butter, unsalted\",\"white flour (all purpose)\",\"Homemade Chicken Broth\",\"potatoes, peeled then grated\",\"Cheddar cheese, grated\"]', 'https://media.soscuisine.com/images/recettes/1010.jpg', 'https://www.soscuisine.com//recipe/chicken-vegetable-bake', 'available.', '55 min', '480 kcal', '{\"calories\":\"480\",\"fat\":\"23 g\",\"cholesterol\":\"90 mg\",\"protein\":\"29 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Calcium, Folacin, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B2, Vitamin B6, Vitamin K, Zinc\",\"good_source_of\":\"Fibre, Iron, Pantothenic Acid, Vitamin B1, Vitamin B12, Vitamin C\",\"source_of\":\"Copper, Vitamin D, Vitamin E\"}', '2021-06-18 14:19:18'),
(542, 542, 1, 'Gluten-Free Pie Crust', 'Preheat the oven to 350°F (180°C). Sift dry ingredients in a bowl. Add margarine. Work the dough with a fork or your fingers, until it becomes granular. Beat the egg with a fork then add vinegar. Mix the egg with the dough until it forms a ball, adding a little water if needed. Flatten it, then chill for at least 1 hour. Roll out the dough between 2 sheets of parchment paper or plastic wrap. Remove the first sheet of paper and gently place the dough upside down in the pie plate. Peel off remaining paper. Prick dough with a fork and refrigerate. Bake 15 minutes for a cold pie. Bake 10 minutes for pre-baked crust. Finish with your favourite fillings.', '[\"brown rice flour\",\"tapioca flour\\/starch\",\"guar gum, or xantham\",\"salt\",\"margarine non-hydrogenated\",\"eggs size large\",\"rice vinegar\"]', 'https://media.soscuisine.com/images/recettes/2325.jpg', 'https://www.soscuisine.com//recipe/pie-crust-gluten-free', 'This recipe yields 6 8-inch diameter (20 cm) pie shells.', '40 min', '200 kcal', '', '', '2021-06-18 14:19:20'),
(543, 543, 1, 'Grandma Luigina\'s Apple Cake', 'Preheat the oven to 205°C/400°F. Butter the baking dish. Peel and core the apples, then cut each into 8 wedges. Combine them with the lemon juice, 1 tablespoon of sugar and the cinnamon in a bowl, then set aside. In another bowl, the egg with the remaining sugar, then in the flour and baking powder. Add the lemon zest, milk, then mix well to obtain a homogeneous batter. Incorporate 2/3 of the apples into the mixture and transfer to the greased dish. Place the remaining apple wedges with their juice on top. Bake in the middle of the oven 40 min. Check with a toothpick or knife to see if it is cooked through. When the cake is done, let it cool down at least 1 h before serving. Sprinkle each serving portion with cream if desired.', '[\"butter, unsalted, to grease the baking dish\",\"apples, cut into wedges\",\"lemon, juice and zest\",\"sugar\",\"ground cinnamon\",\"eggs size large\",\"white flour (all purpose)\",\"baking powder\",\"milk, partly skimmed, 2%\",\"cream 15%\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/241.jpg', 'https://www.soscuisine.com//recipe/grandma-luigina-apple-cake', 'This recipe yields 6-8 servings.', '55 min', '240 kcal', '{\"calories\":\"240\",\"fat\":\"2 g\",\"cholesterol\":\"30 mg\",\"protein\":\"4 g\"}', '{\"good_source_of\":\"Folacin, Manganese, Selenium, Vitamin B1\",\"source_of\":\"Calcium, Fibre, Iron, Niacin, Pantothenic Acid, Phosphorus, Vitamin B12, Vitamin B2, Vitamin D\",\"low\":\"Fat, Saturated Fat, Sodium\",\"free\":\"Trans Fat\"}', '2021-06-18 14:19:22'),
(544, 544, 1, 'Greek-Style Roasted Vegetables', 'Preheat the oven to 190°C/375°F. Generously oil a baking sheet. Prepare the vegetables then cut them into uniform pieces approximately 2 cm thick. Lay them out on the sheet in one layer and coat thoroughly with the oil. Add the oregano. Season with salt and pepper to taste. Roast in the middle of the oven for about 35-40 min until the vegetables are soft and golden-coloured. Turn them twice during cooking. Serve.', '[\"parsnips, cut into 2 cm pieces\",\"carrots, cut into 2 cm pieces\",\"celeriac, cut into 2 cm pieces\",\"olive oil\",\"dried oregano\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1168.jpg', 'https://www.soscuisine.com//recipe/greek-style-roasted-vegetables', '', '50 min', '130 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Potassium, Vitamin A\",\"good_source_of\":\"Fibre, Folacin, Manganese, Vitamin E, Vitamin K\",\"source_of\":\"Calcium, Copper, Iron, Magnesium, Niacin, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin C, Zinc\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:19:23');
INSERT INTO `recipe_translation` (`rt_id`, `rt_recipe_id`, `rt_lang_id`, `rt_recipe_name`, `rt_recipe_text`, `rt_recipe_ingredients_full`, `rt_recipe_image`, `rt_recipe_link`, `rt_recipe_prep`, `rt_recipe_duration`, `rt_recipe_calories`, `rt_recipe_nutrients`, `rt_recipe_claims`, `rt_created`) VALUES
(545, 545, 1, 'Green Lettuce with Miso Vinaigrette', 'Wash the romaine lettuce, then spin-dry. Tear the leaves into bite-size pieces and place them in a salad bowl. Season with salt and pepper to taste. Add the sesame seeds. Pour in the Miso Vinaigrette to coat well. Serve.', '[\"Romaine lettuce, torn into bite-size pieces\",\"sesame seeds\",\"Miso Dressing\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2533.jpg', 'https://www.soscuisine.com//recipe/green-lettuce-miso-vinaigrette', 'One serving is about 100 g, or 4 cups of lettuce, torn into bite-size pieces.', '5 min', '200 kcal', '{\"calories\":\"200\",\"fat\":\"19 g\",\"cholesterol\":\"0 mg\",\"protein\":\"3 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Folacin, Vitamin A, Vitamin E, Vitamin K\",\"good_source_of\":\"Vitamin C\",\"source_of\":\"Copper, Fibre, Iron, Magnesium, Manganese, Omega-3, Omega-6, Phosphorus, Potassium, Vitamin B1, Vitamin B2, Vitamin B6, Zinc\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Cholesterol\"}', '2021-06-18 14:19:23'),
(546, 546, 1, 'Green Pea Soup', 'Prepare the croutons Bring the to a boil. Add the frozen peas and cook 7-8 min, with no cover (to prevent discoloration). Purée the soup in a blender food processor . Add the cream, adjust the\r\nseasoning and reheat 2-3 min. Ladle the soup into bowls. You may garnish each bowl with mint leaves and a dollop of cream. Serve the soup with the croutons', '[\"bread, whole wheat, for the croutons\",\"olive oil, for the croutons\",\"chicken broth\",\"frozen peas\",\"whipping cream 35%\",\"fresh mint\",\"[optional]\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/31.jpg', 'https://www.soscuisine.com//recipe/green-pea-soup', 'will be very useful to purée the soup.', '15 min', '280 kcal', '{\"calories\":\"280\",\"fat\":\"12 g\",\"cholesterol\":\"20 mg\",\"protein\":\"11 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Fibre, Folacin, Magnesium, Manganese, Selenium, Vitamin A, Vitamin B1, Vitamin K\",\"good_source_of\":\"Iron, Niacin, Phosphorus, Vitamin C, Zinc\",\"source_of\":\"Calcium, Copper, Pantothenic Acid, Potassium, Vitamin B2, Vitamin B6, Vitamin E\"}', '2021-06-18 14:19:24'),
(547, 547, 1, 'Green Pineapple Smoothie', 'Place the ingredients in a food processor blender Process on the highest speed until a well-blended purée forms, about 1-2 min, stopping to scrape down the sides of the container once or twice. Serve.', '[\"pineapple, sliced\",\"avocados, cut into chunks\",\"bananas, small, cut into chunks\",\"Italian parsley, fresh, coarsely chopped\",\"gingerroot, coarsely grated\",\"silken tofu\",\"coconut water\",\"water\",\"chia seeds\"]', 'https://media.soscuisine.com/images/recettes/3087.jpg', 'https://www.soscuisine.com//recipe/green-pineapple-smoothie', 'will be very useful for this recipe.', '5 min', '240 kcal', '{\"calories\":\"240\",\"fat\":\"4 g\",\"cholesterol\":\"0 mg\",\"protein\":\"5 g\"}', '{\"excellent_source_of\":\"Fibre, Folacin, Magnesium, Manganese, Potassium, Vitamin B6, Vitamin C, Vitamin K\",\"good_source_of\":\"Copper, Vitamin B1\",\"source_of\":\"Calcium, Iron, Niacin, Pantothenic Acid, Phosphorus, Vitamin A, Vitamin B2, Zinc\",\"low\":\"Calories, Fat, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:19:24'),
(548, 548, 1, 'Green Tea Ice Cream', 'Put a metal or glass bowl into the freezer so that it will be cold when filling it with the cream mixture. Separate the egg whites and yolks : Put the yolks in one bowl and the egg whites in another bowl. the whites using a mixer until stiff\r\npeaks are formed. Set aside. Pour the cream in a third bowl, then using the electric mixer, the cream until stiff peaks are formed. Set aside. Add the sugar and matcha to the yolks, then well using the mixer until the mixture is pale and fluffy, about 2 min. Pour in the milk. Incorporate the egg whites and the whipped cream into the mixture, blending gently with a spatula. Transfer the mixture to the prepared bowl, cover and put it in the freezer. After about 1 h, take the bowl out of the freezer, the mixture using a whisk, then return the bowl to the freezer. Repeat the same stirring operation after one additional hour in the freezer. It normally takes 3-4 hours until the ice cream is ready.', '[\"eggs size large\",\"whipping cream 35%\",\"icing\\/confectioners\' sugar\",\"matcha (fine powder green tea), or more to taste\",\"milk, partly skimmed, 2%\"]', 'https://media.soscuisine.com/images/recettes/2640.jpg', 'https://www.soscuisine.com//recipe/green-tea-ice-cream', '', '15 min', '220 kcal', '{\"calories\":\"220\",\"fat\":\"14 g\",\"cholesterol\":\"140 mg\",\"protein\":\"4 g\"}', '{\"good_source_of\":\"Selenium, Vitamin A, Vitamin B12\",\"source_of\":\"Folacin, Pantothenic Acid, Phosphorus, Vitamin B2, Vitamin D, Vitamin E\",\"low\":\"Sodium\"}', '2021-06-18 14:19:25'),
(549, 549, 1, 'Grilled Chicken Breast', 'Preheat the grill or the oven broiler. In a bowl, mix well the yogurt, milk and curry. Brush the chicken breasts with this mixture. Grill or broil 10 cm from the heat. Cook for about 10-12 min, turning the pieces once. They are ready\r\nwhen the meat loses its pink colour. Take out of the oven, add salt and pepper, then slice into strips.', '[\"chicken breasts, boneless, skinless\",\"milk, partly skimmed, 2%\",\"yogurt, plain, 2%\",\"curry powder\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/3344.jpg', 'https://www.soscuisine.com//recipe/grilled-chicken-breast', 'The chicken can be kept in the fridge for up to 4 days.', '15 min', '120 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Niacin\",\"good_source_of\":\"Phosphorus, Vitamin B12, Vitamin B6\",\"source_of\":\"Iron, Magnesium, Pantothenic Acid, Potassium, Vitamin B2, Zinc\",\"low\":\"Fat, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:19:26'),
(550, 550, 1, 'Grilled Chicken Breast with Mustard', 'Preheat the grill or the oven broiler. In a bowl, mix well the yogurt, lemon juice and mustard. Brush the chicken breasts with this mixture. Grill or broil 10 cm from the heat. Cook for about 10-12 min, turning the pieces once. They are ready\r\nwhen the meat loses its pink colour. Take out of the oven, add salt and pepper, then slice into strips.', '[\"chicken breasts, boneless, skinless\",\"lemon, juiced\",\"mediterranean yogurt, 10%\",\"Dijon mustard\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/4146.jpg', 'https://www.soscuisine.com//recipe/grilled-chicken-breast-mustard', 'The chicken can be kept in the fridge for up to 4 days.', '15 min', '130 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Niacin\",\"good_source_of\":\"Phosphorus, Vitamin B6\",\"source_of\":\"Iron, Magnesium, Pantothenic Acid, Vitamin B12, Zinc\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Sugar, Trans Fat\"}', '2021-06-18 14:19:27'),
(551, 551, 1, 'Grilled Peaches with Cinnamon Cream', 'Cut the peaches in half and remove the pits. If the pit does not pull out easily, use a small, sharp knife to cut around it. In a medium bowl, combine the vinegar, honey, oil, and half of the ground cinnamon. Dip each peach half into the mixture and transfer it, cut-side down, to a medium hot grill. Cook until the cut side is golden and juicy, about 3-4 min. Turn the peaches and cook them an additional 3 min or so until the skin side is soft. The exact cooking time will vary with the size and ripeness of the peaches. Meanwhile, the cream until soft\r\npeaks form. Transfer the peaches to individual serving plates. Portion out the cream on top of the peaches. Drizzle any remaining vinegar-honey mixture over each peach, dust with the remaining ground cinnamon, and serve.', '[\"peaches, yellow, or nectarines\",\"balsamic vinegar\",\"honey\",\"canola oil\",\"ground cinnamon\",\"whipping cream 35%\"]', 'https://media.soscuisine.com/images/recettes/599.jpg', 'https://www.soscuisine.com//recipe/grilled-peaches-cinnamon-cream', '', '20 min', '210 kcal', '{\"calories\":\"210\",\"fat\":\"14 g\",\"cholesterol\":\"40 mg\",\"protein\":\"2 g\"}', '{\"good_source_of\":\"Vitamin A, Vitamin E\",\"source_of\":\"Fibre, Magnesium, Manganese, Niacin, Potassium, Vitamin B2, Vitamin C, Vitamin D, Vitamin K\",\"low\":\"Sodium\"}', '2021-06-18 14:19:28'),
(552, 552, 1, 'Grilled Peppers', 'Cut the peppers in half or quarters, removing the seeds and the stalks, then put them on an oiled baking sheet, turning them to coat thoroughly with oil. Put the sheet under a preheated broiler 7-10 cm from the heat, and cook 5-6 min turning the peppers once, until they are soft and browned in spots. Alternatively, arrange the peppers on the hot grill, and cook them until golden-brown, turning once. Peppers should be peeled before serving. To ease this operation, cover or wrap the peppers in aluminum foil or in a paper bag, and let cool down a few minutes (the moisture kept under the cover will help lift the peel). Season with salt and pepper to taste just before serving. Drizzle with extra virgin olive oil, then serve.', '[\"yellow or red sweet peppers\",\"extra virgin olive oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/139.jpg', 'https://www.soscuisine.com//recipe/grilled-peppers', 'Only red and yellow peppers are used in this recipe. They are harvested from the same plant as the green ones but are plumper and sweeter after changing colour since they are picked when fully ripe.', '15 min', '170 kcal', '{\"calories\":\"170\",\"fat\":\"16 g\",\"cholesterol\":\"0 mg\",\"protein\":\"1 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Vitamin A, Vitamin C, Vitamin E\",\"good_source_of\":\"Vitamin B6, Vitamin K\",\"source_of\":\"Manganese, Niacin, Omega-3, Omega-6, Vitamin B2\",\"low\":\"Sodium\"}', '2021-06-18 14:19:29'),
(553, 553, 1, 'Grilled Pineapple with a Butter Glaze', 'Using a large, sharp knife, cut the pineapple lengthwise into 4 wedges, leaving some leaves attached to each wedge for a nicer presentation. Cut out and discard the central core if it is hard. Using a curved, or paring knife, carve out a \"boat\" by cutting between the flesh and skin to release the flesh, but at the same time leaving it in place. Slice the flesh crosswise to make thick chunks. Push a skewer through one end of each wedge, into each pineapple chunk, then out to the other end, to hold the pineapple together during cooking. To prevent the leaves and the ends of the skewers from being scorched on the grill, they may be loosely covered with aluminum foil. Melt the butter either in a microwave oven or on the stovetop. Add the sugar and grated ginger , then brush the mixture over the pineapple. Cook the wedges on the grill for 4-5 min, or in a broiler pan in the oven. When done, place the pineapple on a plate, pour the remaining mixture over the top and serve.', '[\"pineapple, cut lengthwise into wedges\",\"bamboo or wooden skewers\",\"aluminum foil\",\"butter, unsalted\",\"brown sugar\",\"gingerroot, grated\"]', 'https://media.soscuisine.com/images/recettes/642.jpg', 'https://www.soscuisine.com//recipe/grilled-pineapple-butter-glaze-alcohol-free', 'Soak the skewers in water for 15 min to prevent them from scorching on the grill.', '15 min', '180 kcal', '{\"calories\":\"180\",\"fat\":\"4 g\",\"cholesterol\":\"10 mg\",\"protein\":\"1 g\"}', '{\"excellent_source_of\":\"Manganese, Vitamin C\",\"good_source_of\":\"Folacin, Vitamin B1, Vitamin B6\",\"source_of\":\"Copper, Fibre, Iron, Magnesium, Niacin, Pantothenic Acid, Potassium, Vitamin B2\",\"low\":\"Sodium\"}', '2021-06-18 14:19:30'),
(554, 554, 1, 'Grilled Romaine Lettuce', 'Heat the oil in a frying pan over medium heat. Add the garlic and sauté 1 min with stirring just to flavour the oil. Remove the garlic and discard. Set aside the oil. Wash the romaine lettuce, then pat dry. Cut each lettuce in half lenghtwise. Heat the grill to medium. Brush the cut sides of the romaine lettuces evenly with 1 teaspoon of the infused oil. Carefully place each piece on grill, cut side down and cook for about 5 min or until lettuce is light brown; remove from grill and place on a platter. Alternatively, preheat the broiler. Put the lettuce halves on the rack of a broiler pan, 7-10 cm from the heat. Broil them about 5 min. Drizzle grilled lettuce with lemon juice, rest of garlic infused oil, salt and pepper. Serve.', '[\"Romaine lettuce\",\"olive oil\",\"garlic, whole\",\"ground pepper to taste\",\"[optional]\",\"salt\",\"[optional]\",\"lemon juice, freshly squeezed\"]', 'https://media.soscuisine.com/images/recettes/3145.jpg', 'https://www.soscuisine.com//recipe/grilled-romaine-lettuce', '', '10 min', '50 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Folacin, Vitamin A, Vitamin C, Vitamin K\",\"source_of\":\"Fibre, Iron, Magnesium, Manganese, Potassium, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin E\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:19:31'),
(556, 556, 1, 'Chicken and Vegetable Kebabs', 'Cut the chicken into cubes and set aside. the garlic and finely chop the shallot, then put them in a shallow dish. in\r\nthe olive oil and lemon juice, add the oregano, salt, and pepper, then place the chicken cubes into the dish and mix well. Cover the dish with plastic wrap and let marinate for several hours, or overnight,\r\nin the refrigerator.', '[\"garlic, crushed\",\"shallots, finely chopped\",\"olive oil\",\"lemon juice, freshly squeezed\",\"dried oregano\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"chicken breasts, boneless, skinless, cut into cubes\",\"yellow or red sweet peppers, cut into 2 cm squares\",\"onions, cut into segments\",\"button (white) mushrooms, whole or cut in half\",\"mini-tomatoes (cherry, miniature or grape)\",\"olive oil, for the grill\"]', 'https://media.soscuisine.com/images/recettes/576.jpg', 'https://www.soscuisine.com//recipe/chicken-vegetable-kebabs', 'Metal skewers are needed for cooking.', '20 min', '260 kcal', '{\"calories\":\"260\",\"fat\":\"11 g\",\"cholesterol\":\"60 mg\",\"protein\":\"26 g\"}', '{\"excellent_source_of\":\"Niacin, Pantothenic Acid, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B2, Vitamin B6, Vitamin C\",\"good_source_of\":\"Copper, Magnesium, Manganese, Vitamin E, Vitamin K, Zinc\",\"source_of\":\"Fibre, Folacin, Iron, Vitamin B1, Vitamin B12\",\"low\":\"Calories, Cholesterol, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:19:33'),
(557, 557, 1, 'Hard-Boiled Eggs', 'Put the eggs in a saucepan in just one layer. Add cold water to cover them by at least 2 cm. Add a pinch of salt or one tablespoon vinegar to limit damage in case the egg cracks (the egg white will then coagulate right away on the shell sealing the crack rather than spreading into the water). Bring to a low boil, lower the heat, and cover. Start measuring the time: 3 min for soft-boiled and 10 min for hard-boiled egg. When ready, remove from heat immediately and cool down rapidly in cold running water to stop the cooking and prevent a green circle from forming around the yolk. This quick cooling makes the peeling easier. To peel, tap the egg against a hard surface to crack shell, then begin peeling from the air-pocket (wider) end. The shell should come off in spiral strips attached to a thin membrane.', '[\"eggs size large\"]', 'https://media.soscuisine.com/images/recettes/3887.jpg', 'https://www.soscuisine.com//recipe/hard-boiled-eggs', 'To reduce the potential for cracking during cooking, use eggs at room temperature.', '10 min', '160 kcal', '{\"calories\":\"160\",\"fat\":\"11 g\",\"cholesterol\":\"450 mg\",\"protein\":\"13 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Selenium, Vitamin B12, Vitamin B2, Vitamin D\",\"good_source_of\":\"Folacin, Pantothenic Acid, Phosphorus, Vitamin A\",\"source_of\":\"Iron, Niacin, Vitamin B1, Vitamin B6, Vitamin E, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:19:34'),
(558, 558, 1, 'Healthy Oatmeal Cookies', 'Preheat the oven to 175°C/350°F. Line two baking sheets with parchment\r\npaper In a large bowl, the butter and brown sugar, using a . Add the egg and mix well. Add the water and vanilla, mix well. Set aside. In another bowl, mix the flour and cinnamon. Add the raisins, chocolate chips and walnuts, then mix well. Incorporate the dry mix into the liquid one. Add the oats and mix well. Arrange spoonfuls of cookie dough onto the cookie sheets. Bake in the middle of the oven until they turn light brown around the edges, about 12-15 min. Let the cookies cool on the sheet for 20 min.', '[\"butter, unsalted\",\"brown sugar\",\"eggs size large\",\"water\",\"vanilla extract\",\"whole wheat flour\",\"ground cinnamon\",\"raisins\",\"bittersweet chocolate chips\",\"walnuts, chopped\",\"rolled oats\"]', 'https://media.soscuisine.com/images/recettes/4183.jpg', 'https://www.soscuisine.com//recipe/healthy-oatmeal-cookies', '', '25 min', '220 kcal', '{\"calories\":\"220\",\"fat\":\"12 g\",\"cholesterol\":\"40 mg\",\"protein\":\"4 g\"}', '{\"good_source_of\":\"Manganese, Selenium\",\"source_of\":\"Copper, Fibre, Folacin, Iron, Magnesium, Niacin, Omega-3, Omega-6, Phosphorus, Vitamin A, Vitamin B1\",\"low\":\"Sodium\"}', '2021-06-18 14:19:35'),
(559, 559, 1, 'Homemade Microwave Popcorn', 'Put the olive oil and a little salt in a microwave safe bowl. Add the popcorn kernels and so that the kernels get completely covered with the oil and salt mixture. Cover the bowl with the vented lid and microwave on \'High\' for 3-4 min, or until popping slows to 1-2 seconds between pops. The time will vary depending on your microwave and bowl, so you may need to some trial-and-error testing with the first few batches to figure out how long it takes the popcorn to cook. Carefully remove the popcorn from the microwave oven (the bowl is hot!), sprinkle with the herbs, and serve.', '[\"extra virgin olive oil\",\"salt\",\"[optional]\",\"popcorn kernels\",\"herbes de Provence\"]', 'https://media.soscuisine.com/images/recettes/2008.jpg', 'https://www.soscuisine.com//recipe/homemade-microwave-popcorn', '', '5 min', '110 kcal', '{\"calories\":\"110\",\"fat\":\"3 g\",\"cholesterol\":\"0 mg\",\"protein\":\"3 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"good_source_of\":\"Fibre\",\"source_of\":\"Copper, Iron, Magnesium, Manganese, Phosphorus, Vitamin K, Zinc\",\"low\":\"Saturated Fat\",\"free\":\"Cholesterol, Sodium, Sugar, Trans Fat\"}', '2021-06-18 14:19:35'),
(561, 561, 1, 'Hulled Barley Bread', 'Soak the barley for at leat 8 h. Drain the barley thn put it in a pot with 500 ml (2 cps) water. Bring to a boil, then lower the heat, cover and simmer 40 min. Drain if necessary and set aside. Preheat the oven to 180°C/350°F. Lightly oil a 22 cm (9 po) bread pan. In a large bowl, mix all the ingredients. Press the mixture into the prepared pan. Bake in middle of the oven for 50 min. Cool for 10 min before unmolding. Unmold and slice. Serve.', '[\"hulled barley, soaked overnight and drained\",\"wheat germ\",\"walnuts, finely chopped\",\"sunflower seeds, ground\",\"celery, cut into small dices\",\"onions, finely chopped\",\"Cheddar cheese, grated\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"eggs size large, lightly beaten\",\"Italian parsley, fresh, finely chopped\"]', 'https://media.soscuisine.com/images/recettes/911.jpg', 'https://www.soscuisine.com//recipe/hulled-barley-bread', 'This bread can be made in advance and reheated in the oven or microwave.', '100 min', '300 kcal', '{\"calories\":\"300\",\"fat\":\"16 g\",\"cholesterol\":\"120 mg\",\"protein\":\"15 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Fibre, Folacin, Magnesium, Manganese, Phosphorus, Selenium, Vitamin B1, Vitamin E, Zinc\",\"good_source_of\":\"Calcium, Copper, Iron, Niacin, Pantothenic Acid, Potassium, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin K\",\"source_of\":\"Omega-6, Vitamin A, Vitamin D\"}', '2021-06-18 14:19:37'),
(562, 562, 1, 'Irish Coffee', 'Prepare a very strong coffee (ideally espresso). Using an electric mixer the cream with the sugar until it just holds stiff peaks Pour the lemon and orange juice into mug(s), or heat-resistant glass(es), then pour in the coffee. Spoon the whipped cream on top. Serve immediately.', '[\"coffee (liquid), strong\",\"whipping cream 35%\",\"sugar\",\"orange juice\",\"lemon juice, freshly squeezed\"]', 'https://media.soscuisine.com/images/recettes/4050.jpg', 'https://www.soscuisine.com//recipe/irish-coffee-alcohol-free', '', '10 min', '160 kcal', '{\"calories\":\"160\",\"fat\":\"15 g\",\"cholesterol\":\"50 mg\",\"protein\":\"1 g\"}', '{\"good_source_of\":\"Vitamin A\",\"source_of\":\"Pantothenic Acid, Vitamin B2, Vitamin C, Vitamin D\",\"low\":\"Sodium\"}', '2021-06-18 14:19:38'),
(563, 563, 1, 'Irish Nettle Soup', 'Prepare the onions and potatoes . Coarsely chop the onions; peel and dice the potatoes into 1 cm cubes. Melt the butter in a saucepan over medium heat. Add the chopped onions and sauté 3 min, then add the diced potatoes. Continue to cook for about 4 min, with gentle stirring . Add the and milk, bring to a boil, then lower the heat. Cover and simmer about 15 min, until the potatoes are soft. Add the nettles and cook5 min. Purée in a blender until smooth. Adjust the seasoning in the cream, then serve.', '[\"onions, coarsely chopped\",\"potatoes, peeled and cut into small pieces\",\"butter, unsalted\",\"chicken broth\",\"milk, partly skimmed, 2%\",\"nettles\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"sour cream\"]', 'https://media.soscuisine.com/images/recettes/3592.jpg', 'https://www.soscuisine.com//recipe/irish-nettle-soup', 'will be very useful to purée the soup.', '30 min', '150 kcal', '{\"calories\":\"150\",\"fat\":\"5 g\",\"cholesterol\":\"20 mg\",\"protein\":\"5 g\"}', '{\"free\":\"Added Sugar\",\"good_source_of\":\"Potassium, Vitamin B12, Vitamin B6, Vitamin D\",\"source_of\":\"Calcium, Copper, Folacin, Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Selenium, Vitamin A, Vitamin B1, Vitamin B2, Vitamin C, Vitamin K, Zinc\"}', '2021-06-18 14:19:41'),
(564, 564, 1, 'Chicken Breast in a Tuna Sauce', 'Prepare the vegetables : Slice the onion, shallot and mushrooms; and coarsely dice carrot and celery. Put the vegetables in a large saucepan and add water. Bring to a boil, reduce heat to medium-low, then gently simmer 5 min, uncovered. Add the chicken breasts and cook until the broth returns to a boil, about 4 min. Boil for about 15 seconds, then remove the pan from the heat, cover, and let the breasts stand in the broth for 12 to 15 min. Pay attention not to overcook the chicken, to keep it juicy. Meanwhile, put the tuna and anchovies in a blender . Add the mustard, lemon juice, Tabasco and mayonnaise, then process for a few seconds. With the blender running, add the olive oil in a slow stream and process for a few seconds, or until it is well incorporated and a smooth sauce is obtained. Divide the arugula among the plates. Remove the chicken breasts from the broth with a slotted spoon. Cut each breast into crosswise slices, and arrange the slices on top of the arugula. Generously coat the chicken with the tuna sauce. Sprinkle the chicken with chives and capers, then serve. Reheat the broth, divide among bowls and serve with the chicken.', '[\"onions, thinly sliced\",\"shallots, thinly sliced\",\"button (white) mushrooms, thinly sliced\",\"carrots, coarsely diced\",\"celery, coarsely diced\",\"salt\",\"ground pepper\",\"water\",\"chicken breasts, boneless, skinless\",\"anchovy fillets\",\"tuna, canned\",\"Dijon mustard\",\"lemonjuice, freshly squeezed\",\"Tabasco sauce\",\"mayonnaise\",\"extra virgin olive oil\",\"arugula\",\"chives, fresh\",\"capers\"]', 'https://media.soscuisine.com/images/recettes/2736.jpg', 'https://www.soscuisine.com//recipe/chicken-breast-in-tuna-sauce', 'will be very useful for this recipe.', '40 min', '380 kcal', '{\"calories\":\"380\",\"fat\":\"25 g\",\"cholesterol\":\"70 mg\",\"protein\":\"30 g\"}', '{\"excellent_source_of\":\"Niacin, Phosphorus, Selenium, Vitamin A, Vitamin B12, Vitamin B6, Vitamin E, Vitamin K\",\"good_source_of\":\"Magnesium, Pantothenic Acid, Potassium\",\"source_of\":\"Calcium, Copper, Folacin, Iron, Manganese, Vitamin B1, Vitamin B2, Vitamin C, Vitamin D, Zinc\",\"low\":\"Calories, Cholesterol, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:19:43'),
(565, 565, 1, 'Jerusalem Artichoke and Potato Soup', 'Prepare the leeks , Jerusalem artichokes, and potatoes. Thinly slice the white and pale green parts of the leeks. Peel the potatoes and Jerusalem artichokes then cut them coarsely into 1 cm pieces. Bring the to a boil in a pot. Add the vegetables. Mince the garlic, grate the ginger then add them to the pot. Cover and simmer until the vegetables are soft, about 20 min. Let the soup cool down, then purée it until smooth. Add the cream, salt, and pepper. If the soup is too thick, it may be thinned with additional Garnish with the sliced green onions then serve into bowls.', '[\"leeks, thinly sliced\",\"jerusalem artichokes, peeled and cut into pieces\",\"potatoes, peeled and cut into pieces\",\"chicken broth\",\"garlic, minced\",\"gingerroot, finely grated\",\"cream 15%\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"green onions\\/scallions, thinly sliced\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/227.jpg', 'https://www.soscuisine.com//recipe/jerusalem-artichoke-potato-soup', 'will be very useful for this recipe.', '30 min', '160 kcal', '{\"calories\":\"160\",\"fat\":\"2 g\",\"cholesterol\":\"10 mg\",\"protein\":\"4 g\"}', '{\"excellent_source_of\":\"Potassium, Vitamin K\",\"good_source_of\":\"Folacin, Iron, Magnesium, Manganese, Vitamin A, Vitamin B1, Vitamin B6\",\"source_of\":\"Calcium, Copper, Fibre, Niacin, Pantothenic Acid, Phosphorus, Vitamin B2, Vitamin C, Vitamin E\",\"low\":\"Cholesterol, Fat, Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:19:46'),
(566, 566, 1, 'Jicama Slaw', 'In a salad bowl, together lime juice, oil, maple syrup and hot sauce. Season with salt and pepper to taste. Peel the jicama and carrots, then grate them. Finely chop the shallot and cilantro. Add vegetables to the bowl. well and serve.', '[\"jicama, peeled and grated\",\"carrots, peeled and grated\",\"shallots, finely chopped\",\"olive oil\",\"lime juice, freshly squeezed\",\"maple syrup\",\"sriracha (hot chili sauce)\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"fresh cilantro, finely chopped\"]', 'https://media.soscuisine.com/images/recettes/4395.jpg', 'https://www.soscuisine.com//recipe/jicama-slaw', '', '15 min', '150 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Fibre, Vitamin A, Vitamin C\",\"good_source_of\":\"Potassium, Vitamin K\",\"source_of\":\"Folacin, Iron, Magnesium, Manganese, Vitamin B6, Vitamin E\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Cholesterol, Trans Fat\"}', '2021-06-18 14:19:46'),
(567, 567, 1, 'Kale and Orange Salad', 'Fill a large pot with lightly salted water then bring to a boil. Add the kale and cook until just tender, about 3 min. Drain the kale and let cool slightly. Squeeze out any excess liquid then cut into large pieces and put into a salad bowl. Using a sharp knife, remove the peel and pith from the oranges then cut out the segments. Add the segments to the salad bowl. In a small bowl, add the oil, vinegar, mustard, and chopped shallot. Season with salt and pepper to taste. well, using a fork, until the vinaigrette is emulsified. Pour it over the salad and , then serve.', '[\"kale, tough stems discarded\",\"oranges\",\"extra virgin olive oil\",\"balsamic vinegar\",\"whole-grain mustard\",\"shallots, finely chopped\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2626.jpg', 'https://www.soscuisine.com//recipe/kale-orange-salad', '', '20 min', '120 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Vitamin A, Vitamin C, Vitamin K\",\"good_source_of\":\"Vitamin E\",\"source_of\":\"Calcium, Copper, Fibre, Folacin, Iron, Magnesium, Manganese, Potassium, Vitamin B1, Vitamin B6\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:19:47'),
(568, 568, 1, 'Keto Bread', 'Preheat the oven to 175°C/350°F. Oil a loaf pan or a cookie sheet, depending on the chosen cooking method. Set aside. In a bowl, mix together the dry ingredients. Add the vinegar and egg whites to the dry ingredients. Mix a few seconds using a Pour the boiling water into the bowl then mix well, using a , until the dough thickens. Transfer the mixture into the loaf pan. Put the pan in the oven and bake for 75-90 min, until the loaf is golden-colored and the inside is well cooked. Alternatively, divide the dough into 16 rolls. Transfer the rolls to the baking sheet, then to the oven. Bake for 60-75 min. Let cool completely (at least 30 min), then slice.', '[\"almond meal\",\"psyllium husks, very finely ground\",\"baking powder\",\"salt\",\"apple cider vinegar\",\"egg whites\",\"water, boiling\"]', 'https://media.soscuisine.com/images/recettes/4053.jpg', 'https://www.soscuisine.com//recipe/keto-bread', '', '85 min', '130 kcal', '{\"calories\":\"130\",\"fat\":\"10 g\",\"cholesterol\":\"0 mg\",\"protein\":\"5 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Vitamin E\",\"good_source_of\":\"Fibre, Magnesium, Manganese\",\"source_of\":\"Calcium, Copper, Iron, Niacin, Omega-6, Phosphorus, Selenium, Vitamin B2, Zinc\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:19:48'),
(569, 569, 1, 'Keto Chocolate Mousse', 'Melt the butter and  chocolate in a large bowl, using a microwave oven. Separate the egg whites from the egg yolks. Add the yolks to the chocolate mixture with the spices and sweetener. Incorporate using a whisk. In another bowl, beat the egg whites with salt into stiff peaks, using a Slowly add the whites to the preparation, using a spatula to incorporate well. Portion out to cups, then chill in the refrigerator for at least 3 hours before serving.', '[\"dark chocolate (90% cacao, cut into pieces\",\"butter, unsalted\",\"eggs size large\",\"salt\",\"ground cinnamon\",\"cayenne pepper\",\"monkfruit sugar substitute\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/4331.jpg', 'https://www.soscuisine.com//recipe/keto-chocolate-mousse', 'the egg whites.', '15 min', '260 kcal', '{\"calories\":\"260\",\"fat\":\"23 g\",\"cholesterol\":\"220 mg\",\"protein\":\"8 g\"}', '{\"excellent_source_of\":\"Selenium, Vitamin B12\",\"good_source_of\":\"Folacin, Pantothenic Acid, Vitamin A, Vitamin D\",\"source_of\":\"Fibre, Iron, Niacin, Phosphorus, Vitamin B2, Vitamin E, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:19:48'),
(570, 570, 1, 'Keto Flatbread', 'In a bowl, mix together the dry ingredients. Add the boiling water and coconut oil, mix thoroughly. Set aside for 5 min. Divide the dough into the number of servings needed, then flatten each portion to form a flatbread (a few millimeters thick). Heat a pan over medium-high heat. Cook the breads on the dry pan, one at a time, 5-10 min on each side, until golden-brown. Serve warm or hot.', '[\"coconut flour\",\"psyllium husks, very finely ground\",\"baking powder\",\"salt\",\"coconut oil, melted\",\"water, boiling\"]', 'https://media.soscuisine.com/images/recettes/4240.jpg', 'https://www.soscuisine.com//recipe/keto-flatbread', '', '20 min', '130 kcal', '{\"calories\":\"130\",\"fat\":\"11 g\",\"cholesterol\":\"0 mg\",\"protein\":\"2 g\"}', '{\"free\":\"Added Sugar\",\"good_source_of\":\"Fibre\",\"source_of\":\"Iron\"}', '2021-06-18 14:19:49'),
(571, 571, 1, 'Kohlrabi et Cucumber Salad', 'Prepare the dressing directly in the serving bowl: add the pressed garlic, chopped dill, mustard, oil, and lemon juice, along with salt and pepper to taste. Mix well. Peel the kohlrabi , shred it using a large-holed grater, then add it to the bowl. Wash the cucumbers, slice them thinly, using a mandolin , then add them the bowl. Adjust the seasoning then serve.', '[\"garlic, pressed\",\"fresh dill, finely chopped\",\"Dijon mustard\",\"olive oil\",\"lemon juice, freshly squeezed\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"kohlrabi\",\"cucumbers, medium size\"]', 'https://media.soscuisine.com/images/recettes/4269.jpg', 'https://www.soscuisine.com//recipe/kohlrabi-cucumber-salad', 'Choose small bulbs, between 5 and 7 cm in diameter, since larger kohlrabies tend to be woody.', '15 min', '160 kcal', '{\"calories\":\"160\",\"fat\":\"15 g\",\"cholesterol\":\"0 mg\",\"protein\":\"2 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Vitamin C\",\"good_source_of\":\"Vitamin E\",\"source_of\":\"Copper, Fibre, Folacin, Magnesium, Manganese, Potassium, Vitamin B6, Vitamin K\",\"low\":\"Sodium\"}', '2021-06-18 14:19:49'),
(572, 572, 1, 'Kohlrabi Remoulade', 'Prepare the dressing directly in the serving bowl: add the mayonnaise, mustard, pressed garlic, oil, and lemon juice, along with salt and pepper to taste. Mix well. Peel the kohlrabi , then slice it thinly, using a mandolin , or shred it using a large-holed grater. Add it to the dressing and Adjust the seasoning then serve.', '[\"kohlrabi\",\"garlic, pressed\",\"mayonnaise\",\"Dijon mustard\",\"olive oil\",\"lemon juice, freshly squeezed\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1090.jpg', 'https://www.soscuisine.com//recipe/kohlrabi-remoulade', 'Choose small bulbs, between 5 and 7 cm in diameter, since larger kohlrabies tend to be woody.', '10 min', '230 kcal', '{\"calories\":\"230\",\"fat\":\"20 g\",\"cholesterol\":\"0 mg\",\"protein\":\"3 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Vitamin C, Vitamin E\",\"good_source_of\":\"Fibre, Potassium, Vitamin B6\",\"source_of\":\"Copper, Folacin, Iron, Magnesium, Manganese, Omega-6, Phosphorus, Vitamin B1, Vitamin K\",\"low\":\"Sodium\"}', '2021-06-18 14:19:50'),
(573, 573, 1, 'Leeks Vinaigrette', 'Prepare the leeks : Cut off the dark green tops and slice the white and pale-green parts into large chunks. Boil or steam the leeks about 10 min, until soft. Drain then let cool down a few minutes. With a serrated knife, cut the leeks into rounds about 1 cm thick then transfer them to a bowl. Pour in the Classic Vinaigrette . Season with salt and pepper, blend gently then serve.', '[\"leeks\",\"Classic Vinaigrette\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/210.jpg', 'https://www.soscuisine.com//recipe/leeks-vinaigrette', '.', '15 min', '180 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Folacin, Manganese, Vitamin A, Vitamin E, Vitamin K\",\"good_source_of\":\"Iron, Vitamin B6\",\"source_of\":\"Calcium, Copper, Fibre, Magnesium, Potassium, Vitamin B1, Vitamin C\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:19:51'),
(574, 574, 1, 'Lemon CrÃÂ¨me BrÃÂ»lÃÂ©e', 'Preheat the oven to 150°C/300°F. Line a shallow baking pan with a kitchen towel. Have a pot of boiling water ready to add to the pan later Pour the lemon juice into a small saucepan. Bring it to a boil, then lower the heat and simmer until the juice is reduced to about 1/3 of the original amount, 3-5 min. Set aside. In another saucepan, combine the cream and sugar, then cook over medium heat, with occasional stirring , until steam rises from the surface, about 3-5 min. Remove the pan from the heat and let it cool down\r\nfor about 15 min. Separate the egg whites and yolks. Set the whites aside in a glass jar with a lid and put them in the refrigerator or freezer for a future use in another recipe. Put the yolks in a bowl, add the vanilla and mix until smooth and well combined. Slowly add the cream mixture, whisking constantly, then in the reduced lemon juice. Divide the custard among the ramekins .\r\nPlace the ramekins in the prepared baking pan and add the boiling water to fill the pan halfway up the sides of the ramekins Cover the pan loosely with aluminum foil and bake in the centre of the oven for 35-40 min, until the custards are just set. Check with a toothpick or knife to see if they are cooked through. When done, remove the ramekins from the pan and let them cool down to room temperature, about 1 h, then chill them in the refrigerator\r\nfor at least 2 h or overnight. Just before serving, preheat the broiler. Sprinkle the brown sugar evenly over each custard, put the ramekins in the oven close to the upper element (about 3 cm) and broil a couple minutes until the tops have caramelized to a golden brown colour. Serve right away.', '[\"butter, unsalted, to grease the ramekins\",\"lemon juice, freshly squeezed\",\"whipping cream 35%\",\"sugar\",\"egg yolks\",\"vanilla extract\",\"brown sugar\",\"aluminum foil\"]', 'https://media.soscuisine.com/images/recettes/444.jpg', 'https://www.soscuisine.com//recipe/lemon-creme-brulee', 'Due to the use of non-fractional egg amounts in this recipe, only limited choices in the number of servings are possible.', '50 min', '410 kcal', '{\"calories\":\"410\",\"fat\":\"34 g\",\"cholesterol\":\"290 mg\",\"protein\":\"4 g\"}', '{\"excellent_source_of\":\"Vitamin A, Vitamin B12, Vitamin D\",\"good_source_of\":\"Folacin, Pantothenic Acid, Vitamin E\",\"source_of\":\"Calcium, Omega-3, Phosphorus, Selenium, Vitamin B2, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:19:52'),
(575, 575, 1, 'Lemon Curd Sponge Cake', 'Preheat the oven to 175°C/350°F. Butter and flour a Bundt pan. In a bowl, sift together flour, baking powder and salt. Set aside. In a large bowl, together 2 cups of sugar and 1 cup of butter using a , until the mixture becomes thick and pale, about 4-5 min. Add the eggs one at a time, alternating with the dry ingredients, mixing well between each addition. Add the juice and zest from 2 lemons then mix well. Add the cream to the egg mixture then mix well. Pour the batter into the prepared pan, spreading it evenly. Bake in the middle of the oven until golden-brown, about 45 min. with a toothpick or skewer to see if the cake is cooked. Cool the cake at least 30 min in the pan before removing it, then let it cool down on a wire rack an additional 30 min. Meanwhile, make the curd. Put in a saucepan the egg yolks, the remaining sugar and the juice and zest of the remaining lemon. Add the juice and zest of the orange. Cook on medium heat until the mixture thickens, whisking the whole time, 5-6 min. Remove from the heat then stir in the butter. Pour the curd over the cake then serve.', '[\"white flour (all purpose)\",\"butter, unsalted\",\"sugar\",\"eggs size large\",\"baking powder\",\"salt, a pinch\",\"lemons\",\"whipping cream 35%\",\"oranges\",\"egg yolks\"]', 'https://media.soscuisine.com/images/recettes/2750.jpg', 'https://www.soscuisine.com//recipe/lemon-curd-sponge-cake', '', '60 min', '570 kcal', '{\"calories\":\"570\",\"fat\":\"30 g\",\"cholesterol\":\"200 mg\",\"protein\":\"7 g\"}', '{\"excellent_source_of\":\"Folacin, Selenium, Vitamin A\",\"good_source_of\":\"Vitamin B1, Vitamin B12, Vitamin B2, Vitamin D\",\"source_of\":\"Calcium, Iron, Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Vitamin C, Vitamin E, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:19:54'),
(576, 576, 1, 'Lemon Mousse with Cranberry Sauce', 'Lightly oil the bottom and sides of a large spring formpan or of individual ramekins Separate the egg whites from the yolks and put them in 2 separate bowls. Combine the egg yolks with the lemon juice and about ¼ of the sugar. Set aside. In the other bowl, the egg whites\r\nusing an electric mixer until foamy, then add the salt and continue to beat until soft peaks form. Gradually add the remaining sugar, beating until the egg whites are glossy and stand in stiff , about 7-8 min. Set aside. Pour the cream in a third bowl, then using the electric mixer, the cream until stiff peaks form. Gently the whipped cream and egg whites into the yolk mixture using a spatula. Carefully spoon the mixture into the pan or distribute it into the ramekins . Cover with foil and freeze at least 8 hours if using the pan, or 2-3 hours for the ramekins.', '[\"vegetable oil spray, to grease the pan or the ramekins\",\"eggs size large\",\"lemon juice, freshly squeezed\",\"sugar\",\"salt\",\"whipping cream 35%\",\"Cranberry Sauce\"]', 'https://media.soscuisine.com/images/recettes/1218.jpg', 'https://www.soscuisine.com//recipe/lemon-mousse-cranberry-sauce', '', '30 min', '260 kcal', '{\"calories\":\"260\",\"fat\":\"13 g\",\"cholesterol\":\"100 mg\",\"protein\":\"3 g\"}', '{\"source_of\":\"Folacin, Pantothenic Acid, Selenium, Vitamin A, Vitamin B12, Vitamin B2, Vitamin C, Vitamin D, Vitamin E\",\"low\":\"Sodium\"}', '2021-06-18 14:19:55'),
(578, 578, 1, 'Lemon Polenta Cake', 'Preheat the oven to 175°C/350°F.  Line the base of a 25cm springform cake pan with parchment paper and grease its sides lightly with butter. Lightly grind the sugar in a coffee grinder to make it just a bit finer, but not to icing sugar consistency. Set aside in a bowl. Grind the almonds, then set aside in another bowl. In a large bowl, the sugar with the butter using a , about 5 min until the mixture is pale and whipped. In another bowl, mix together the almonds, polenta and baking powder. Add the almond mixture, to the sugar micture, alternating with the eggs. Mix well until homogeneous. Pour the mixture into the prepared cake pan and bake in the oven for about 30-35 min. Check the cake with a toothpick or knife to see if it is cooked through. When done, pull the cake out of the oven and let it cool down in its pan. Meanwhile, make the syrup. Mix together the lemon juice and icing sugar in a glass or pyrex container. Cook in a microwave at maximum power until the icing sugar is dissolved into the juice. Pour the warm syrup over the cake, and leave to cool before taking it out of its pan. Serve.', '[\"butter, unsalted\",\"sugar\",\"almonds\",\"cornmeal (polenta)\",\"baking powder\",\"eggs size large\",\"lemons juice, freshly squeezed\",\"icing\\/confectioners\' sugar\"]', 'https://media.soscuisine.com/images/recettes/3022.jpg', 'https://www.soscuisine.com//recipe/lemon-polenta-cake', '', '45 min', '350 kcal', '{\"calories\":\"350\",\"fat\":\"24 g\",\"cholesterol\":\"80 mg\",\"protein\":\"6 g\"}', '{\"excellent_source_of\":\"Vitamin E\",\"good_source_of\":\"Magnesium, Manganese, Phosphorus\",\"source_of\":\"Calcium, Copper, Fibre, Folacin, Iron, Niacin, Omega-6, Pantothenic Acid, Selenium, Vitamin A, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin D, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:19:56'),
(579, 579, 1, 'Lemon \"Semifreddo\" with Berries', 'Lightly oil the bottom and sides of a large spring formpan or of individual ramekins Separate the egg whites from the yolks and put them in 2 separate bowls. Combine the egg yolks with the lemon juice and about ¼ of the sugar. Set aside. In the other bowl, the egg whites\r\nusing an electric mixer until foamy, then add the salt and continue to beat until soft peaks form. Gradually add the remaining sugar, beating until the egg whites are glossy and stand in stiff , about 7-8 min. Set aside. Pour the cream in a third bowl, then using the electric mixer, the cream until stiff peaks form. Gently the whipped cream and egg whites into the yolk mixture using a spatula. Carefully spoon the mixture into the pan or distribute it into the ramekins . Cover with foil and freeze at least 8 hours if using the pan, or 2-3 hours for the ramekins.', '[\"vegetable oil spray, to grease the pan or the ramekins\",\"eggs size large\",\"lemon juice, freshly squeezed\",\"sugar\",\"salt\",\"lactose-free cream, 35%, for whipping\",\"raspberries, frozen, or fresh\",\"sugar, for the sauce\",\"blueberries\"]', 'https://media.soscuisine.com/images/recettes/3201.jpg', 'https://www.soscuisine.com//recipe/lemon-semifreddo-berries-lactose-free', '', '30 min', '240 kcal', '{\"calories\":\"240\",\"fat\":\"12 g\",\"cholesterol\":\"100 mg\",\"protein\":\"3 g\"}', '{\"source_of\":\"Folacin, Manganese, Pantothenic Acid, Selenium, Vitamin A, Vitamin B12, Vitamin B2, Vitamin C, Vitamin E\",\"low\":\"Sodium\"}', '2021-06-18 14:19:57'),
(580, 580, 1, 'Lemon SoufflÃÂ©s', 'Preheat the oven to 160°C/325°F. Butter the individual ramekins or a large mould. Put the butter in a large bowl and melt it using a microwave. Add the sugar then using a about 2 min until the mixture is light and creamy. Separate the egg whites and yolks. Add the yolks, one at a time, to the sugar mixture, continuing to beat after each addition. Incorporate the flour by sifting it in with continuous beating until the mixture is smooth and homogeneous. Pour in the lemon juice and zest. Warm up the milk using a microwave or on the stovetop to luke-warm, then it into the mixture. Put the egg whites in another bowl, then them to form soft peaks using a mixer. Add one pinch of salt then continue whisking to form stiff\r\npeaks , about 4 min. Incorporate the egg whites into the mixture, blending gently with a spatula. Pour out the mixture into a large mould or individual ramekins Bake the soufflés in the middle of the oven about 45 min until they are golden-coloured. Check with a toothpick to see if the soufflés are cooked through. Let the soufflés cool down on the kitchen counter 5-10 min before serving.', '[\"butter, unsalted, plus some to grease the ramekins\",\"sugar\",\"eggs size large\",\"white flour (all purpose)\",\"lemons, for juice and zest\",\"milk, partly skimmed, 2%\",\"salt\"]', 'https://media.soscuisine.com/images/recettes/785.jpg', 'https://www.soscuisine.com//recipe/lemon-souffles', '', '65 min', '240 kcal', '{\"calories\":\"240\",\"fat\":\"9 g\",\"cholesterol\":\"110 mg\",\"protein\":\"6 g\"}', '{\"excellent_source_of\":\"Vitamin B12\",\"good_source_of\":\"Folacin, Selenium, Vitamin B2, Vitamin D\",\"source_of\":\"Calcium, Iron, Niacin, Pantothenic Acid, Phosphorus, Vitamin A, Vitamin B1, Vitamin C, Vitamin E, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:19:58'),
(581, 581, 1, 'Lentil and Tomato Salad with Mint', 'Dice the tomatoes, discarding the seeds, then put them in a salad bowl. Coarsely chop the celery, finely chop the shallot and , then add them to the bowl. Pour the Classic Vinaigrette over the salad. Season with salt and pepper. Rince and drain the lentils, then add them to the salad. adjust\r\nthe seasoning then serve.', '[\"tomatoes, Roma type, deseeded and diced\",\"celery, chopped\",\"shallots, finely chopped\",\"fresh mint, finely chopped\",\"Classic Vinaigrette\",\"lentils (canned), rinsed and drained\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1211.jpg', 'https://www.soscuisine.com//recipe/lentil-tomato-salad-mint', 'The leftover salad is just as good cold, the next day.', '15 min', '220 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Folacin, Iron, Manganese, Potassium, Vitamin K\",\"good_source_of\":\"Copper, Fibre, Magnesium, Phosphorus, Vitamin A, Vitamin B1, Vitamin B6, Vitamin E, Zinc\",\"source_of\":\"Niacin, Pantothenic Acid, Selenium, Vitamin B2, Vitamin C\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:19:59'),
(582, 582, 1, 'Lentil and Vegetable Soup', 'Rinse and drain the lentils, then set aside. Prepare the vegetables : finely slice the leek; mince or the garlic; coarsely chop the tomatoes; chop the celery and carrot into very small dices (about 3 mm); cut the broccoli into small pieces (about 2 cm). In a pot, the leek and garlic in the olive oil over medium heat about 3-4 min. Add the remaining vegetables, lentils, and , then bring to a boil, reduce the heat and simmer uncovered for 25 min or until the lentils are tender. Adjust the seasoning then serve.', '[\"green or brown lentils (dried)\",\"leeks, thinly sliced\",\"garlic, minced or pressed\",\"tomatoes, coarsely chopped\",\"celery, cut into very small dices\",\"carrots, cut into very small dices\",\"broccoli, cut into small florets\",\"olive oil\",\"chicken broth\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/398.jpg', 'https://www.soscuisine.com//recipe/lentil-vegetable-soup', 'It is not necessary to soak the lentils in advance.', '45 min', '160 kcal', '{\"calories\":\"160\",\"fat\":\"6 g\",\"cholesterol\":\"0 mg\",\"protein\":\"7 g\"}', '{\"excellent_source_of\":\"Folacin, Manganese, Vitamin A, Vitamin K\",\"good_source_of\":\"Fibre, Iron, Magnesium, Potassium, Vitamin C, Vitamin E\",\"source_of\":\"Calcium, Copper, Niacin, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin B2, Vitamin B6, Zinc\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:20:00');
INSERT INTO `recipe_translation` (`rt_id`, `rt_recipe_id`, `rt_lang_id`, `rt_recipe_name`, `rt_recipe_text`, `rt_recipe_ingredients_full`, `rt_recipe_image`, `rt_recipe_link`, `rt_recipe_prep`, `rt_recipe_duration`, `rt_recipe_calories`, `rt_recipe_nutrients`, `rt_recipe_claims`, `rt_created`) VALUES
(583, 583, 1, 'Lentil PatÃÂ©', 'Rinse and drain the lentils, put them in pot and add water to cover. Bring to a boil, then reduce the heat and simmer , uncovered, until the lentils are very tender, about 20 min. Drain and set aside. Meanwhile, heat the olive oil in a saucepan on medium heat. Sauté the onion, garlic, ginger and curry powder for 6-8 min, stirring from time to time. Set aside. Tip lentils, sunflower seeds and onion mixture into a food processor . Pulse a few times to mix the ingredients into a paste. Transfer the paste into a bowl and put in the fridge for 1 to 2 hours. Serve.', '[\"red-orange lentils (dried)\",\"sunflower seeds\",\"onions, diced\",\"garlic, finely chopped\",\"gingerroot, grated\",\"olive oil\",\"curry powder\"]', 'https://media.soscuisine.com/images/recettes/3501.jpg', 'https://www.soscuisine.com//recipe/lentil-pate', 'will be very useful to make the meatball mixture.', '35 min', '160 kcal', '{\"calories\":\"160\",\"fat\":\"8 g\",\"cholesterol\":\"0 mg\",\"protein\":\"7 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Folacin, Manganese, Vitamin E\",\"good_source_of\":\"Copper, Iron, Magnesium, Pantothenic Acid, Vitamin B1\",\"source_of\":\"Fibre, Niacin, Omega-6, Phosphorus, Potassium, Selenium, Vitamin B6, Zinc\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Sodium, Trans Fat\"}', '2021-06-18 14:20:01'),
(584, 584, 1, 'Chicken Cutlets ÃÂ  la Ferrer', 'Slice the breast horizontally into very thin cutlets. Flatten these cutlets using a rolling pin or meat pounder. with the flour. Melt the butter in a pan over medium heat. Add the rosemary sprigs whole. Cook 2-3 min, then take them out. Add the cutlets and cook over medium heat 4 min. Turn, add salt and pepper, then pour in the , cover, and cook an additional 3 min. Serve on the warmed plates.', '[\"chicken breasts, boneless, skinless\",\"butter, unsalted\",\"rosemary, fresh\",\"white flour (all purpose)\",\"chicken broth\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/401.jpg', 'https://www.soscuisine.com//recipe/chicken-cutlets-ferrer-alcohol-free', 'Keep the serving plates in the oven at the lowest setting so they are warm when you serve.', '17 min', '250 kcal', '{\"calories\":\"250\",\"fat\":\"10 g\",\"cholesterol\":\"100 mg\",\"protein\":\"34 g\"}', '{\"free\":\"Sugar\",\"excellent_source_of\":\"Niacin, Vitamin B6\",\"good_source_of\":\"Pantothenic Acid, Phosphorus, Vitamin B12\",\"source_of\":\"Folacin, Iron, Magnesium, Potassium, Vitamin A, Vitamin B1, Vitamin B2, Vitamin D, Zinc\"}', '2021-06-18 14:20:01'),
(585, 585, 1, 'Lentil Soup', 'Heat oil over low heat in a large saucepan, sauté onions, garlic, cumin and paprika until the onions become soft. Add the other ingredients except salt, pepper and parsley, and cook gently for 30 to 40 minutes while occasionally stirring. Add a little water to taste. Season with salt and pepper and sprinkle with parsley.', '[\"olive oil\",\"onions, thinly cut\",\"garlic, chopped\",\"ground cumin\",\"paprika\",\"red-orange lentils (dried), rinsed\",\"vegetable broth, or water\",\"canned tomatoes (diced)\",\"celery, diced into cubes\",\"yellow or red sweet peppers, diced into cubes\",\"dried apricots, or prunes, diced into small cubes\",\"fresh thyme\",\"lemon juice, freshly squeezed\",\"bay leaf\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"Italian parsley, fresh, chopped, to garnish\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2230.jpg', 'https://www.soscuisine.com//recipe/lentil-soup', '', '65 min', '210 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Folacin, Iron, Manganese, Potassium, Vitamin A, Vitamin C\",\"good_source_of\":\"Copper, Fibre, Magnesium, Vitamin B1, Vitamin B6, Vitamin E\",\"source_of\":\"Calcium, Niacin, Pantothenic Acid, Phosphorus, Selenium, Vitamin B12, Vitamin B2, Vitamin K, Zinc\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:20:02'),
(586, 586, 1, 'Lettuce and Radish Salad with Chives', 'Rinse and spin-dry the lettuce leaves, then add them to a salad bowl. Thinly slice the radish and chop the shallot, then add them to the bowl. Pour in the Classic Vinaigrette . Add salt and pepper to taste. the salad a few times and scatter the minced chives on top. Serve immediately.', '[\"Boston lettuce, or curly leaf\",\"shallots, finely chopped\",\"radishes, thinly sliced\",\"Classic Vinaigrette\",\"chives, fresh\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/394.jpg', 'https://www.soscuisine.com//recipe/lettuce-radish-salad-chives', '', '10 min', '110 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Vitamin K\",\"good_source_of\":\"Folacin, Vitamin A, Vitamin E\",\"source_of\":\"Iron, Manganese\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:20:03'),
(587, 587, 1, 'Lettuce Salad with Cucumbers and Radishes', 'Prepare the cucumbers : sprinkle them with salt and let drain a few minutes, then slice them thinly and put the slices in a salad bowl. Trim the lettuce leaves, rinse them and spin-dry, then add them to the bowl. Slice the radishes and scallions thinly, then add them to the salad. Pour in the Classic Vinaigrette , add salt and pepper to taste, then . Serve\r\nimmediately.', '[\"cucumbers, medium size, thinly sliced\",\"curly leaf lettuce, or Boston\",\"radishes, thinly sliced\",\"green onions\\/scallions, thinly sliced\",\"Classic Vinaigrette\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/560.jpg', 'https://www.soscuisine.com//recipe/lettuce-salad-cucumbers-radishes', '', '10 min', '120 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Vitamin A, Vitamin K\",\"good_source_of\":\"Vitamin E\",\"source_of\":\"Folacin, Iron, Magnesium, Manganese, Pantothenic Acid, Potassium, Vitamin B6, Vitamin C\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:20:06'),
(588, 588, 1, 'Lettuce, Fig, and Clementine Salad', 'Rinse and spin-dry the lettuce and the spinach, then put them in a salad bowl. Press one clementine out of three and collect the juice into a small bowl. Peel the remaining clementines, separate into segments, then add them to the salad bowl. Add the extra virgin olive oil to the reserved clementine juice, pour in the lemon juice, then season with salt and pepper. well using a fork until the vinaigrette is emulsified. Pour it over the salad. Add the walnuts (optional) and chopped figs. well to combine. Serve.', '[\"Boston lettuce, or curly leaf\",\"baby spinach\",\"extra virgin olive oil\",\"clementines\",\"lemon juice, freshly squeezed\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"walnuts\",\"[optional]\",\"dried figs, cut into small pieces\"]', 'https://media.soscuisine.com/images/recettes/769.jpg', 'https://www.soscuisine.com//recipe/lettuce-fig-clementine-salad', '', '10 min', '200 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Folacin, Vitamin A, Vitamin C, Vitamin E, Vitamin K\",\"good_source_of\":\"Potassium\",\"source_of\":\"Calcium, Fibre, Iron, Magnesium, Manganese, Vitamin B1, Vitamin B6\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:20:13'),
(589, 589, 1, 'Ligurian Broccoli Soup', 'Prepare the vegetables . Peel the potatoes. Coarsely chop all the vegetables except the broccoli into uniform 3 cm pieces. Cut the broccoli into florets. Heat the butter and oil in a saucepan over medium heat. Add all the vegetables except the broccoli and cook over medium heat for about 10 min with occasional stirring. Add the warm and water then cook an additional 8 min, uncovered. Meanwhile, prepare the croutons Add the broccoli stalks, which take longer to cook, then add the florets 2 min later. Cook, uncovered, 10 min maximum until the potatoes are cooked and fork-tender. Don\'t overcook the broccoli, so that the soup will maintain a nice green colour. Purée the soup in a blender . Add salt and pepper to taste. Ladle into bowls. Put a teaspoonful of or more on top of each bowl, garnish with croutons and serve.', '[\"potatoes, chopped into 3 cm pieces\",\"broccoli, cut into florets\",\"carrots, chopped into 3 cm pieces\",\"zucchini, chopped into 3 cm pieces\",\"celery, chopped into 3 cm pieces\",\"onions, chopped into 3 cm pieces\",\"chicken broth\",\"water\",\"butter, unsalted\",\"olive oil\",\"pesto sauce\",\"bread, whole wheat, for the croutons\",\"olive oil, for the croutons\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/32.jpg', 'https://www.soscuisine.com//recipe/ligurian-broccoli-soup', 'will be very useful to purée the soup.', '40 min', '330 kcal', '{\"calories\":\"330\",\"fat\":\"16 g\",\"cholesterol\":\"10 mg\",\"protein\":\"8 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Fibre, Folacin, Magnesium, Manganese, Potassium, Selenium, Vitamin A, Vitamin B6, Vitamin C, Vitamin K\",\"good_source_of\":\"Copper, Iron, Niacin, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin B2, Vitamin E, Zinc\",\"source_of\":\"Calcium\"}', '2021-06-18 14:20:18'),
(590, 590, 1, 'Low-Carb Lime and Cream Cheese Mousse', 'Preheat the oven to 150°C/300°F. Put all the ingredients,  except the whipping cream and blueberries in a bowl. using an electric mixer until well mixed. Portion out into serving goblets (preferably transparent), or other small oven-proof containers. Bake for 25-35 min. The goblets can be taken out of the oven when the middle is set. Chill for at least 1 h, until completely cooled. When ready to serve, whip the cream, then garnish with the blueberries and whipped cream.', '[\"cream cheese\",\"sour cream\",\"eggs size large\",\"liquid stevia\",\"vanilla extract\",\"limes, for juice and zest\",\"whipping cream 35%\",\"blueberries\"]', 'https://media.soscuisine.com/images/recettes/4181.jpg', 'https://www.soscuisine.com//recipe/low-carb-lime-cream-cheese-mousse', '', '30 min', '190 kcal', '{\"calories\":\"190\",\"fat\":\"18 g\",\"cholesterol\":\"100 mg\",\"protein\":\"5 g\"}', '{\"good_source_of\":\"Vitamin A, Vitamin B12\",\"source_of\":\"Calcium, Folacin, Pantothenic Acid, Phosphorus, Selenium, Vitamin B2, Vitamin D, Vitamin E\"}', '2021-06-18 14:20:20'),
(591, 591, 1, 'Chicken Cutlets in Pizzaiola Sauce', 'Flatten and tenderize the cutlets using a meat pounder. Make a few shallow cuts around the outside edge to avoid curling during cooking. each cutlet with the flour then shake off the excess (the flour will give a thicker sauce). Heat the oil in a pan over medium heat. Add the whole garlic cloves, sauté 1-2 min, then add the cutlets, and each side for about 2 min. Season with salt and pepper. Remove the cutlets from the pan then set aside on the warmed serving plate in the oven. Add the tomatoes, olive paste and oregano. Cook 4-5 min, then put the meat back into the pan. Continue to cook 2 min, turning the cutlets once. Serve.', '[\"chicken breasts, boneless, skinless, thinly sliced\",\"white flour (all purpose)\",\"[optional]\",\"olive oil\",\"garlic\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"canned tomatoes (diced)\",\"olive paste\",\"dried oregano\"]', 'https://media.soscuisine.com/images/recettes/1001.jpg', 'https://www.soscuisine.com//recipe/chicken-cutlets-in-pizzaiola-sauce', 'Put the serving dish in the oven at the lowest setting to keep the meat warm while cooking the sauce.', '20 min', '170 kcal', '{\"calories\":\"170\",\"fat\":\"7 g\",\"cholesterol\":\"60 mg\",\"protein\":\"23 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Niacin, Vitamin B6\",\"good_source_of\":\"Phosphorus\",\"source_of\":\"Iron, Magnesium, Pantothenic Acid, Potassium, Vitamin A, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin C, Vitamin E, Vitamin K, Zinc\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:20:23'),
(592, 592, 1, 'Low-Carb Zucchini Bread', 'Preheat the oven to 175°C/350°F. Generously oil a loaf pan. together the eggs and oil in a large bowl. Sift together the almond flour, baking powder, oregano, nutmeg, and salt into another bowl. Fold the almond mixture into the egg-oil bowl, combining them gently but thoroughly. in the nuts and zucchini. Pour the batter in the prepared loaf pan, spreading it evenly, then bake the bread in the middle of the oven until golden-brown about 60 min. with a toothpick or skewer to see if the bread is cooked through. Cool the bread 10 min in the pan, then remove it from the pan and let it cool on a wire rack for at least 30 min before slicing.', '[\"eggs size large\",\"olive oil\",\"almond meal\",\"baking powder\",\"dried oregano\",\"nutmeg\",\"salt\",\"zucchini, unpeeled, shredded\",\"walnuts, chopped\"]', 'https://media.soscuisine.com/images/recettes/4052.jpg', 'https://www.soscuisine.com//recipe/low-carb-zucchini-bread', '', '80 min', '260 kcal', '{\"calories\":\"260\",\"fat\":\"25 g\",\"cholesterol\":\"50 mg\",\"protein\":\"7 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Magnesium, Manganese, Vitamin E\",\"good_source_of\":\"Copper, Phosphorus\",\"source_of\":\"Calcium, Fibre, Folacin, Iron, Niacin, Omega-3, Omega-6, Pantothenic Acid, Potassium, Selenium, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin K, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:20:24'),
(593, 593, 1, 'Macadam cheese', 'Soak nuts in 4 cups (1 L) of water at room temperature for one hour. Drain and rinse. Put all the ingredients in the Vitamix (high speed blender), or in the food processor, and purée until smooth with food pusher.', '[\"macadamia nuts\",\"cashews\",\"onions\",\"salt\",\"lemon juice, freshly squeezed\",\"extra virgin olive oil\",\"miso (fermented soybean paste)\",\"dry yeast\"]', 'https://media.soscuisine.com/images/recettes/2416.jpg', 'https://www.soscuisine.com//recipe/macadam-cheese', '', '15 min', '140 kcal', '{\"calories\":\"140\",\"fat\":\"12 g\",\"cholesterol\":\"0 mg\",\"protein\":\"3 g\"}', '{\"free\":\"Added Sugar\",\"good_source_of\":\"Copper, Magnesium, Manganese\",\"source_of\":\"Folacin, Iron, Niacin, Phosphorus, Selenium, Vitamin B1, Vitamin E, Vitamin K, Zinc\"}', '2021-06-18 14:20:25'),
(594, 594, 1, 'Mackerel, Cabbage and Feta Salad', 'Prepare the vegetables : Thinly slice the cabbage and radishes. Cut the cucumber into slices. Transfer to a salad bowl. Pour the Classic\r\nVinaigrette over the salad and mix well. Drain the mackerel fillets then add them to the salad with the feta cheese. Season with salt and pepper to taste. Transfer the salad to serving bowls and serve.', '[\"Napa cabbage, thinly sliced\",\"radishes, thinly sliced\",\"cucumbers, medium size, English, slide into disks\",\"feta cheese, crumbled\",\"mackerel, canned\",\"Classic Vinaigrette\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/4265.jpg', 'https://www.soscuisine.com//recipe/mackerel-cabbage-feta-salad', '', '10 min', '410 kcal', '{\"calories\":\"410\",\"fat\":\"33 g\",\"cholesterol\":\"80 mg\",\"protein\":\"21 g\"}', '{\"diet-related_health_claims\":\"Bone-healthy\",\"free\":\"Added Sugar\",\"excellent_source_of\":\"Calcium, Folacin, Niacin, Phosphorus, Potassium, Selenium, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin C, Vitamin D, Vitamin E, Vitamin K\",\"good_source_of\":\"Iron, Magnesium, Manganese, Vitamin A, Zinc\",\"source_of\":\"Copper, Fibre, Pantothenic Acid, Vitamin B1\"}', '2021-06-18 14:20:25'),
(595, 595, 1, 'Mango and Lime Mousse', 'In a small saucepan, combine the lime juice and the agar agar. Place the pan over low heat and until the agar agar dissolves, 1-2 minutes. Pour the mixture into the jar of a blender food\r\nprocessor Peel the mangoes and cut the flesh from the pits. Add the flesh to the blender . Add the sugar and process until smooth, then pour the mango purée into a bowl. Fold in the evaporated milk powder and combine well until no white streaks remain. Portion out the purée into small bowls. Cover and chill in the refrigerator until set, about 5 hours. Just before serving, you may sprinkle the grated coconut over the mousse surface and garnish each bowl with mint leaves. Serve.', '[\"lime juice, freshly squeezed\",\"agar agar (powder)\",\"evaporated milk powder\",\"mangoes\",\"sugar\",\"grated coconut\",\"[optional]\",\"fresh mint\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2528.jpg', 'https://www.soscuisine.com//recipe/mango-lime-mousse-vegetarian', 'will be very useful for this recipe.', '15 min', '120 kcal', '{\"calories\":\"120\",\"fat\":\"0 g\",\"cholesterol\":\"0 mg\",\"protein\":\"5 g\"}', '{\"diet-related_health_claims\":\"Artery-healthy\",\"excellent_source_of\":\"Vitamin D\",\"good_source_of\":\"Vitamin B12, Vitamin C\",\"source_of\":\"Calcium, Folacin, Magnesium, Niacin, Pantothenic Acid, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin E, Zinc\",\"low\":\"Cholesterol, Sodium\",\"free\":\"Fat, Saturated Fat, Trans Fat\"}', '2021-06-18 14:20:26'),
(596, 596, 1, 'Mango and Tomato Salad', 'Cut the tomatoes into slices approximately ½ cm thick and arrange them on a flat dish. Sprinkle with salt. Let stand for 15 min to allow excess liquids to drain off. Transfer to a serving plate or to individual plates. Cut the mangoes in half, without peeling them, slicing near the large oval pit. Using a knife, make check pattern incisions (about 1 cm wide) in\r\nthe flesh without cutting through the skin. Gently press the scored halves to turn them inside out and then cut off the cubes of fruit from the peel. Trim the rest of the fruit off the pit. Place the mango pieces in the centre of the plates. In a small bowl, together the oil, vinegar, paprika , and salt until it is emulsified. Pour over the tomatoes and mangoes. Garnish with fresh parsley leaves on top (optional) then serve.', '[\"tomatoes, cut into &frac12 cm slices\",\"mangoes, ripe, diced\",\"olive oil\",\"balsamic vinegar\",\"paprika\",\"Italian parsley, fresh\",\"[optional]\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/144.jpg', 'https://www.soscuisine.com//recipe/mango-tomato-salad', '', '10 min', '170 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Vitamin A, Vitamin C, Vitamin E\",\"good_source_of\":\"Vitamin K\",\"source_of\":\"Copper, Fibre, Folacin, Magnesium, Niacin, Potassium, Vitamin B1, Vitamin B6\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:20:27'),
(597, 597, 1, 'Mango and Yogurt Mousse', 'Pour the water into a small saucepan, then add the agar agar. Place the saucepan over low heat and until the agar agar dissolves, 1-2 minutes. Remove the pan from the heat. Peel the mangoes, cut the flesh from the pits, then transfer the flesh to a blender . Add the sugar and the vanilla extract, then process until smooth. Add the dissolved agar agar and continue to process for one more minute. Transfer the mango purée to a bowl, then add the yogurt and mix well. Pour the whipping cream into a separate bowl. Using an electric mixer the cream until it holds stiff peaks , then fold it gently into the mango purée. Portion out the mixture into cups and chill them for at least 3 hours or overnight. Garnish with mint leaves (optional) and serve.', '[\"water\",\"agar agar (powder)\",\"mangoes, ripe\",\"sugar\",\"vanilla extract\",\"yogurt, plain, 2%\",\"whipping cream 35%\",\"fresh mint\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2529.jpg', 'https://www.soscuisine.com//recipe/mango-yogurt-mousse-vegetarian', 'will be very useful for this recipe.', '15 min', '180 kcal', '{\"calories\":\"180\",\"fat\":\"12 g\",\"cholesterol\":\"40 mg\",\"protein\":\"3 g\"}', '{\"good_source_of\":\"Vitamin A\",\"source_of\":\"Calcium, Folacin, Magnesium, Phosphorus, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin C, Vitamin D, Vitamin E\",\"low\":\"Sodium\"}', '2021-06-18 14:20:28'),
(598, 598, 1, 'Mashed Potatoes', 'Prepare the potatoes , leaving the skin on. Boil or steam until very tender, about 20 -25 min. Drain well and peel. Meanwhile, in a microwave-safe bowl, pour in the milk with butter and microwave on medium-high for a couple tens of seconds until hot. Pass the potatoes through a food mill , then put the purée back into the pot used to cook the potatoes. Pour in the butter-milk mixture. Add more or less milk depending on how creamy you like your purée. Season with salt and pepper to taste, then blend well using a spatula. Reheat and serve warm.', '[\"potatoes, Russet or Idaho type, or Yukon Gold (yellow)\",\"butter, unsalted\",\"milk, partly skimmed, 2%\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/121.jpg', 'https://www.soscuisine.com//recipe/potato-puree', 'cannot give the proper texture.', '35 min', '250 kcal', '{\"calories\":\"250\",\"fat\":\"7 g\",\"cholesterol\":\"20 mg\",\"protein\":\"6 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Potassium, Vitamin B6\",\"good_source_of\":\"Fibre, Folacin, Magnesium, Manganese, Niacin, Phosphorus, Vitamin C\",\"source_of\":\"Calcium, Copper, Iron, Pantothenic Acid, Vitamin A, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin D, Vitamin K, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:20:29'),
(599, 599, 1, 'Matcha Latte', 'Place 1 teaspoon matcha powder in each heatproof cup. Add 2 teaspoons of maple syrup and whisk until a smooth dark green paste is obtained with no lumps. Meanwhile bring water and milk to a boil in two separate saucepans. Distribute the water to the cups, whisk slowly. Top with the milk, tipping the cups slightly to help create more foam. You may sprinkle matcha powder on top for decoration. Serve.', '[\"matcha (fine powder green tea)\",\"maple syrup\",\"water\",\"milk, partly skimmed, 2%\"]', 'https://media.soscuisine.com/images/recettes/3721.jpg', 'https://www.soscuisine.com//recipe/matcha-green-tea-latte', '', '5 min', '80 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"good_source_of\":\"Manganese, Vitamin B12, Vitamin B2\",\"source_of\":\"Calcium, Phosphorus, Vitamin D\",\"low\":\"Cholesterol, Fat, Saturated Fat, Sodium\",\"free\":\"Trans Fat\"}', '2021-06-18 14:20:29'),
(600, 600, 1, 'Chicken Cutlets Milanese', 'Tenderize the chicken by flattening the cutlets using a meat pounder. Slice each breast horizontally into 2 or 3 cutlets. Prepare 2 shallow dishes: the egg in one, and put the bread crumbs in the other. Dip one cutlet at the time in the egg, let the excess egg drip off before coating the cutlet with the bread crumbs. Turn the cutlets to both sides, then set them aside. Heat the butter and oil in a skillet over medium-high heat, taking care not to let them burn. Add the cutlets and sauté until golden, about 4 min on each side. Add salt and pepper. Serve on the warmed plates.', '[\"chicken breasts, boneless, skinless\",\"eggs size large\",\"bread crumbs\",\"butter, unsalted\",\"canola oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/414.jpg', 'https://www.soscuisine.com//recipe/chicken-cutlets-milanese', '', '15 min', '260 kcal', '{\"calories\":\"260\",\"fat\":\"13 g\",\"cholesterol\":\"160 mg\",\"protein\":\"27 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Niacin, Vitamin B12\",\"good_source_of\":\"Pantothenic Acid, Phosphorus, Selenium, Vitamin B6, Vitamin E\",\"source_of\":\"Folacin, Iron, Magnesium, Omega-3, Potassium, Vitamin A, Vitamin B1, Vitamin B2, Vitamin D, Vitamin K, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:20:30'),
(601, 601, 1, 'Mayonnaise Sauce', 'If using a hand-held mixer , put the egg(s) and mustard in a deep, but fairly narrow flat-bottomed bowl. Put the oils in a container which can allow them to be slowly poured into the egg mixture. Begin to add the oil as you beat, using a blender, a little at a time, adding more oil as each bit is incorporated. When a thick emulsion forms, you can add the oil a little faster. The whole process takes 3 to 5 minutes. If using a food processor , add about ¼ cup of the oil to the egg(s) and mustard at the beginning. Turn the machine on. While it\'s running, add the remaining oil in a steady stream. Avoid running too fast and for too long. Add the lemon juice, then season with salt and pepper. If the mixture is thicker than you like, you may thin it with a little milk. If instead it is not thick enough, add just a little more oil. Serve.', '[\"eggs size large\",\"Dijon mustard\",\"canola oil\",\"olive oil\",\"lemon juice, freshly squeezed\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1013.jpg', 'https://www.soscuisine.com//recipe/mayonnaise-sauce', '', '10 min', '80 kcal', '', '', '2021-06-18 14:20:31'),
(602, 602, 1, 'Mediterranean Spelt Salad', 'Put the spelt berries in a pot, cover with water then bring to a boil. Add a little salt, cover, and simmer until the berries are cooked, about 35 min. Drain and set aside. Meanwhile put all the ingredients in a salad bowl. Add the cooked spelt then to combine. Adjust the seasoning , then serve hot or at room temperature.', '[\"spelt berries\",\"Italian parsley, fresh, chopped\",\"garlic, minced\",\"sun-dried tomatoes (oil packed), chopped\",\"artichoke hearts\",\"black olives, or Savoy\",\"feta cheese, diced\",\"extra virgin olive oil\",\"lemon juice, freshly squeezed\",\"cayenne pepper\",\"[optional]\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/4129.jpg', 'https://www.soscuisine.com//recipe/mediterranean-spelt-salad-1', '', '45 min', '400 kcal', '{\"calories\":\"400\",\"fat\":\"26 g\",\"cholesterol\":\"10 mg\",\"protein\":\"10 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Fibre, Iron, Magnesium, Manganese, Phosphorus, Vitamin E, Vitamin K\",\"good_source_of\":\"Copper, Niacin, Potassium, Zinc\",\"source_of\":\"Calcium, Folacin, Selenium, Vitamin A, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin C\"}', '2021-06-18 14:20:32'),
(603, 603, 1, 'Melon \"Granita\"', 'Peel the melon and remove the seeds. Coarsely dice the flesh, then transfer it to the jar of a blender . Pour in the lemon juice, sugar, and water, then until smooth. Pour the mixture into a large glass or metal pan, large enough so that the liquid will be less than 1 cm thick. Freeze until the mixture becomes a firm slush, about 40 min. Scrape the surface with a fork and spoon out the shavings into transparent glasses to serve. If the crystals are not ready yet, scrape the frozen edges and push them towards the centre, then put the pan back into the freezer, repeating the operation after 15 min, until the liquid is totally frozen.', '[\"melon, or cantaloupe\",\"lemon juice, freshly squeezed\",\"sugar, or to taste\",\"water\"]', 'https://media.soscuisine.com/images/recettes/678.jpg', 'https://www.soscuisine.com//recipe/melon-granita', 'the same day you make it.', '10 min', '70 kcal', '{\"calories\":\"70\",\"fat\":\"0 g\",\"cholesterol\":\"0 mg\",\"protein\":\"0 g\"}', '{\"diet-related_health_claims\":\"Artery-healthy\",\"good_source_of\":\"Vitamin A, Vitamin C\",\"source_of\":\"Folacin\",\"low\":\"Sodium\",\"free\":\"Cholesterol, Fat, Saturated Fat, Trans Fat\"}', '2021-06-18 14:20:33'),
(604, 604, 1, 'Melt-in-Your-Mouth Chocolate Cakes', 'Butter and lightly flour the ramekins or\r\nsmall aluminum moulds. Separate the egg whites and yolks for the required number of yolks. Set aside in a glass jar with a lid the whites that are not used in this recipe. Put the jar in the refrigerator or freezer for a future use. In a bowl, mix the whole eggs, yolks, and sugar, beating by hand or with an electric mixer 3-5 min, until the mixture is pale and form ribbons Melt the butter in the upper part of a bain-marie ,\r\nthen add the chopped chocolate, stirring as it melts. Remove from heat. Now add the egg mixture. Incorporate the flour by sifting it in and mixing with a wooden spoon. Portion out into the ramekins . Chill in the refrigerator at least 1 h 1/2. (Can be kept in the refrigerator up to 1 week) When you\'re ready to cook, preheat the oven to 230ºC/450ºF. Put the ramekins on a baking sheet and bake them in the centre of the oven for 8 min if taken straight out of the\r\nrefrigerator; 6 min if you let them reach room temperature: the outside should have a nice crust and the inside should be soft and runny. Take them out of the oven and leave for 1-2 min before removing the cakes from the ramekins running a knife around the edges to prevent sticking. Turn the ramekins upside-down on serving plates, remove the ramekins , dust the cakes with icing (powdered) sugar, and serve.', '[\"unsweetened (dark) chocolate\",\"butter, unsalted\",\"sugar\",\"white flour (all purpose)\",\"eggs size large\",\"egg yolks\",\"icing\\/confectioners\' sugar\"]', 'https://media.soscuisine.com/images/recettes/54.jpg', 'https://www.soscuisine.com//recipe/melt-in-your-mouth-chocolate-cakes', '', '25 min', '520 kcal', '{\"calories\":\"520\",\"fat\":\"38 g\",\"cholesterol\":\"270 mg\",\"protein\":\"8 g\"}', '{\"excellent_source_of\":\"Selenium, Vitamin A, Vitamin B12\",\"good_source_of\":\"Folacin, Iron, Pantothenic Acid, Vitamin D, Vitamin E\",\"source_of\":\"Calcium, Fibre, Niacin, Phosphorus, Vitamin B1, Vitamin B2, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:20:34'),
(605, 605, 1, 'Mexican Rice and Beans', 'Heat the oil in a saucepan over medium heat. Add the onion, pepper and garlic then sauté , with occasional stirring , for 2-3 min. Add the cumin, paprika, and oregano then cook 1 min with stirring in the rice then cook 2 min, until the grains are completely coated in oil. Add the tomato paste and beans. Bring to a boil, then reduce the heat to \'low\', cover and simmer until the rice is cooked al\r\ndente , about 15-20 min. Adjust the seasoning Remove from heat, keep covered, and let stand a 2-3 min. Fluff with a fork then serve  in the warmed dishes.', '[\"olive oil\",\"onions, finelly chopped\",\"garlic, finelly chopped\",\"green peppers, cut into dices\",\"ground cumin\",\"paprika\",\"dried oregano\",\"basmati rice\",\"tomato paste\",\"red beans (canned), or pinto, drained and rinsed\",\"vegetable broth\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2601.jpg', 'https://www.soscuisine.com//recipe/mexican-rice-beans', 'Keep the serving dishes in the oven at the lowest setting so they are warm when you serve.', '30 min', '190 kcal', '{\"calories\":\"190\",\"fat\":\"3 g\",\"cholesterol\":\"0 mg\",\"protein\":\"6 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Manganese\",\"good_source_of\":\"Fibre, Folacin\",\"source_of\":\"Copper, Iron, Magnesium, Niacin, Pantothenic Acid, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin C, Vitamin E, Vitamin K, Zinc\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:20:34'),
(606, 606, 1, 'Milan-Style Brussels Sprouts', 'Prepare the vegetables : cut the larger ones in half so they won\'t take longer to cook than the smaller ones. Heat the oil in a  pan over medium heat. \r\nAdd the sprouts to the pan and cook 2 min, with stirring , then pour in the water, cover, and simmer until the sprouts are almost tender, 5 to 7 min. Uncover, add a little salt, then simmer until the water evaporates completely, about 7 min. Add the grated cheese and bread crumbs then serve.', '[\"Brussels sprouts, whole or cut in half\",\"olive oil\",\"water\",\"Parmesan cheese, grated\",\"bread crumbs\",\"[optional]\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1024.jpg', 'https://www.soscuisine.com//recipe/milan-style-brussels-sprouts', '', '20 min', '80 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Folacin, Vitamin C, Vitamin K\",\"good_source_of\":\"Fibre, Manganese, Potassium, Vitamin A\",\"source_of\":\"Calcium, Iron, Magnesium, Niacin, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin E, Zinc\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:20:35'),
(607, 607, 1, 'Mini Veggie Quiches', 'Preheat the oven to 175°C/350°F. Prepare the vegetables : Finely chop the onion, garlic, green pepper and mushrooms. Heat the oil in a pan over medium heat. Add the onion and sauté for about 3 min, until tender. Add the garlic and green pepper. Sauté 1 min, then add the mushrooms, herbes de\r\n    Provence, salt and pepper. Cook, with stirring , until most of the liquid from the vegetables has evaporated. Meanwhile, mix the eggs, yogurt, cream and mustard in a bowl. Spoon the cooked vegetables into the cups of one or two silicon muffin pans (depending on the quantities prepared). Add the cheese to each cup. Fill the muffin cups with the egg mixture. Bake in the middle of the oven for about 25-30 min, until a tooth-pick inserted into the center of a muffin comes out clean. Take the pan out of the oven, leave to cool for a few minutes. Serve 2 mini-quiches per person.', '[\"onions, finely chopped\",\"garlic, finely chopped\",\"button (white) mushrooms, finely chopped\",\"green peppers, finely chopped\",\"olive oil\",\"eggs size large\",\"mediterranean yogurt, 10%\",\"whipping cream 35%\",\"Dijon mustard\",\"herbes de Provence\",\"Cheddar cheese, grated\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/4081.jpg', 'https://www.soscuisine.com//recipe/mini-veggie-quiches', 'This recipe yields 2 mini-quiches per person.', '50 min', '310 kcal', '{\"calories\":\"310\",\"fat\":\"23 g\",\"cholesterol\":\"410 mg\",\"protein\":\"18 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Pantothenic Acid, Phosphorus, Selenium, Vitamin A, Vitamin B12, Vitamin B2\",\"good_source_of\":\"Calcium, Niacin, Vitamin D, Zinc\",\"source_of\":\"Copper, Iron, Magnesium, Manganese, Potassium, Vitamin B1, Vitamin B6, Vitamin C, Vitamin E, Vitamin K\"}', '2021-06-18 14:20:36'),
(608, 608, 1, 'Mint Zucchini', 'Heat the oil in a skillet over medium heat. Add the onion and zucchini and cook, stirring occasionally, until the zucchini are softened and coloured, about 8-10 min. Add a sprinkling of salt, in the the garlic and sauté 1 min with stirring Turn the heat to \'low\' and add the broth. Cover and cook over low heat until the zucchini is very tender, 5-10 more minutes. in the herbs, adjust the seasoning then serve.', '[\"olive oil\",\"onions, finely chopped\",\"zucchini, cut into 1 cm pieces\",\"garlic, finely chopped\",\"chicken broth\",\"fresh mint, finely chopped\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2568.jpg', 'https://www.soscuisine.com//recipe/mint-zucchini', '', '30 min', '80 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Vitamin A\",\"good_source_of\":\"Potassium\",\"source_of\":\"Copper, Fibre, Folacin, Magnesium, Manganese, Phosphorus, Vitamin B1, Vitamin B6, Vitamin C, Vitamin E, Vitamin K\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:20:37'),
(609, 609, 1, 'Mint-flavoured Kiwi Sorbet', 'Put a metal or glass bowl (or tray) into the freezer so that it will be cold when filling it with the sorbet mixture. Combine the sugar and water in a saucepan. Bring to a boil then cook over low heat, with occasional stirring , 4-5 min, until the mixture becomes a clear syrup. Let it cool down in the refrigerator about 20 min. Peel the kiwis then cut them into quarters, removing any fibrous parts. Chop the mint leaves. Put the kiwis and mint in a blender , then purée until smooth. Add the lemon juice, then combine the mixture with the syrup. Mix well. With ripe kiwis, the consistency of the mixture will be similar to a light soup. If it is too thin, just add more kiwis. Pour  the mixture into the chilled bowl, cover and chill in the freezer. After about 2 h, take the mixture out of the freezer, it using a whisk, then return it to the freezer. Repeat the same stirring operation after an additional hour in the freezer. In order to reduce the standing times between the stirring operations, you may distribute the mixture into 2 smaller containers, rather than just pouring it into 1, so that it will freeze more rapidly. This is particularly useful when preparing larger amounts. Take the sorbet out of the freezer at least 15 min before serving, so that it will soften slightly. Garnish with a few mint leaves.', '[\"kiwis, ripe\",\"sugar\",\"water\",\"lemon juice, freshly squeezed\",\"fresh mint, chopped, plus some leaves to garnish\"]', 'https://media.soscuisine.com/images/recettes/917.jpg', 'https://www.soscuisine.com//recipe/mint-flavoured-kiwi-sorbet', 'will be very useful for this recipe.', '25 min', '70 kcal', '{\"calories\":\"70\",\"fat\":\"0 g\",\"cholesterol\":\"0 mg\",\"protein\":\"1 g\"}', '{\"excellent_source_of\":\"Vitamin C, Vitamin K\",\"source_of\":\"Folacin, Vitamin E\",\"free\":\"Cholesterol, Fat, Saturated Fat, Sodium, Trans Fat\"}', '2021-06-18 14:20:38'),
(610, 610, 1, 'Mint-flavoured Orange Salad', 'Finely chop the leaves. Soak the raisins in a small bowl of lukewarm water. Juice one third of the oranges, then collect the juice into a saucepan. Heat 2-3 min over medium heat, then remove the saucepan from the heat and in the chopped mint leaves. Let the leaves infuse 10 min, then filter the juice. Peel the remaining oranges with a sharp knife, removing all the white pith, then cut the oranges into slices (about 7-8 mm thick). Arrange the orange slices on a platter. Pour the mint-flavoured orange juice over the slices, then sprinkle with the almonds and drained raisins. Sprinkle the salad with the cinnamon, then chill in the refrigerator for at least 1 h. Before serving, garnish the plate with a few whole mint leaves.', '[\"fresh mint, chopped, plus some whole leaves to garnish\",\"raisins\",\"oranges\",\"almonds\",\"ground cinnamon\"]', 'https://media.soscuisine.com/images/recettes/853.jpg', 'https://www.soscuisine.com//recipe/mint-flavoured-orange-salad', '', '12 min', '160 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Folacin, Vitamin C\",\"good_source_of\":\"Fibre, Magnesium, Manganese, Potassium, Vitamin E\",\"source_of\":\"Calcium, Copper, Iron, Niacin, Pantothenic Acid, Phosphorus, Vitamin A, Vitamin B1, Vitamin B2, Vitamin B6\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Sodium, Trans Fat\"}', '2021-06-18 14:20:39'),
(611, 611, 1, 'Mint-Flavoured Pineapple', 'Trim the pineapple, removing all the \'eyes\' or small brown spots. Cut off its bottom part and stand it upright. Cut thin slices from all four sides till you reach the core. Arrange these slices onto a plate. Pulse the and sugar together in a food processor until finely ground. Sprinkle the mint sugar over the pineapple slices. Chill at least 1 h in the refrigerator before serving.', '[\"pineapple, thinly sliced\",\"fresh mint, finely chopped\",\"sugar\"]', 'https://media.soscuisine.com/images/recettes/2741.jpg', 'https://www.soscuisine.com//recipe/mint-flavoured-pineapple', 'will be very useful to make the mint sugar.', '15 min', '90 kcal', '{\"calories\":\"90\",\"fat\":\"0 g\",\"cholesterol\":\"0 mg\",\"protein\":\"1 g\"}', '{\"excellent_source_of\":\"Manganese, Vitamin C\",\"source_of\":\"Copper, Folacin, Magnesium, Vitamin B1, Vitamin B6\",\"free\":\"Cholesterol, Fat, Saturated Fat, Sodium, Trans Fat\"}', '2021-06-18 14:20:40'),
(612, 612, 1, 'Mix Cabbage Salad', 'Prepare the vegetables : Thinly slice the cabbage, peel and grate the carrots. Add the vegetables to a salad bowl. Pour the Miso Dressing over the salad. Add salt and pepper to taste then serve.', '[\"red cabbage, thinly sliced\",\"green cabbage, or Savoy, thinly sliced\",\"carrots, grated\",\"Miso Dressing\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2534.jpg', 'https://www.soscuisine.com//recipe/mix-cabbage-salad', '', '10 min', '200 kcal', '{\"calories\":\"200\",\"fat\":\"17 g\",\"cholesterol\":\"0 mg\",\"protein\":\"2 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Vitamin A, Vitamin C, Vitamin E, Vitamin K\",\"good_source_of\":\"Folacin\",\"source_of\":\"Fibre, Iron, Magnesium, Manganese, Niacin, Omega-3, Omega-6, Potassium, Vitamin B1, Vitamin B6, Zinc\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Cholesterol\"}', '2021-06-18 14:20:40'),
(613, 613, 1, 'Mixed Berry Crumble', 'Preheat the oven to 175°C/350°F. Lightly grease the baking pan. Place the frozen berries in a the dish. Add sugar and lemon juice, then mix. In a bowl, mix the margarine with the brown sugar, flour and rolled oats to obtain a crumbly mixture. Put the mixture on top of the berries to cover well. Bake in the middle of the oven until the fruit is tender and the topping is golden, about 30 min. Take the crumble out of the oven and let it cool down at least 30 min before serving.', '[\"berry mix, frozen\",\"sugar\",\"lemon juice, freshly squeezed\",\"margarine non-hydrogenated\",\"brown sugar\",\"white flour (all purpose)\",\"rolled oats\"]', 'https://media.soscuisine.com/images/recettes/3433.jpg', 'https://www.soscuisine.com//recipe/mixed-berry-crumble', 'This dessert may be prepared in advance and served cold, or warmed up just before serving.', '40 min', '380 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Fibre, Manganese, Vitamin D, Vitamin K\",\"good_source_of\":\"Folacin, Iron, Selenium, Vitamin A, Vitamin B1, Vitamin E\",\"source_of\":\"Calcium, Copper, Magnesium, Niacin, Omega-3, Omega-6, Phosphorus, Potassium, Vitamin B2\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Cholesterol, Trans Fat\"}', '2021-06-18 14:20:41'),
(614, 614, 1, 'Mixed Greens with Marinated Goat Cheese', 'Finely chop half of the then put it in a shallow bowl. Pour in the oil then mix well. Slice the goat cheese into rounds then add them to the bowl. Spoon the basil oil over the cheese, cover and let stand about 1 h at room temperature, or overnight in the refrigerator. Remove the cheese from the basil oil and transfer the oil to a large bowl. Pour in the vinegar, add salt and pepper to taste. Wash and spin-dry the mixed greens, then add them to the bowl. Chop the remaining basil then add it to the bowl. well, then divide up the greens onto individual serving plates. Wash the plums and cut each into thin wedges lengthwise, discarding the core. Place the wedges on top of each plate with 1 cheese round in the centre. Serve.', '[\"fresh basil, finely chopped\",\"extra virgin olive oil\",\"goat cheese, sliced into rounds\",\"wine vinegar\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"mixed greens\",\"plums, red or black, ripe, cut into thin wedges\"]', 'https://media.soscuisine.com/images/recettes/691.jpg', 'https://www.soscuisine.com//recipe/mixed-greens-marinated-goat-cheese', 'Marinate the cheese for 1 h, as explained below, then assemble the salad just before serving.', '10 min', '230 kcal', '{\"calories\":\"230\",\"fat\":\"20 g\",\"cholesterol\":\"20 mg\",\"protein\":\"6 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Vitamin A, Vitamin K\",\"good_source_of\":\"Folacin, Vitamin E\",\"source_of\":\"Calcium, Copper, Iron, Magnesium, Manganese, Niacin, Phosphorus, Potassium, Vitamin B2, Vitamin C\",\"low\":\"Sodium\"}', '2021-06-18 14:20:42'),
(615, 615, 1, 'Chicken in a Puff Pastry Shell', 'Preheat the oven using the lowest setting. Warm up the puff pastry shells on the individual serving plates. Prepare the mushrooms : slice them thinly. Heat the oil in a skillet over medium heat. Add the mushrooms, then sauté 3-4 min, with occasional stirring, until the mushrooms are golden and the released liquid has evaporated completely. Set them aside. While the mushrooms are cooking, cook the small peas, still frozen, by plunging them 4-5 min in a small pot of boiling salted water. Drain them, then set aside. Melt the butter in a saucepan over medium heat. Add the flour then cook 2 min with stirring . Slowly add the with stirring and bring to a boil. Lower the heat and cook 3-4 min, with stirring, until the sauce is smooth and a bit thick. Pour in the cream, chopped tarragon , and grated nutmeg. Add the chicken pieces, mushrooms, and peas. Adjust\r\nthe seasoning . Cook a few minutes, then portion out the mixture into and around the pastry shells. Serve.', '[\"puff pastry shells, large\",\"button (white) mushrooms\",\"olive oil\",\"frozen peas\",\"butter, unsalted\",\"white flour (all purpose)\",\"Homemade Chicken Broth\",\"whipping cream 35%\",\"fresh tarragon, chopped\",\"nutmeg, grated\",\"Homemade Boiled Chicken, cut into bite-size pieces\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/813.jpg', 'https://www.soscuisine.com//recipe/chicken-in-puff-pastry-shell', '', '25 min', '630 kcal', '{\"calories\":\"630\",\"fat\":\"38 g\",\"cholesterol\":\"90 mg\",\"protein\":\"30 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Iron, Manganese, Niacin, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin K, Zinc\",\"good_source_of\":\"Copper, Fibre, Magnesium, Pantothenic Acid, Vitamin E\",\"source_of\":\"Calcium, Omega-3, Omega-6, Vitamin B12, Vitamin C, Vitamin D\",\"low\":\"Sodium\"}', '2021-06-18 14:20:43'),
(616, 616, 1, 'Mixed Lettuce Salad with Grapefruit', 'Wash the romaine lettuce, then spin-dry.\r\nTear the leaves into bite-size pieces and place them in a salad bowl. Discard\r\nthe coarse stems of the watercress, wash the leaves well, then spin dry and put them in the salad bowl. Remove the stalk and feathery leaves of the fennel\r\nbulb. Thinly slice the fennel and the radishes with a mandolin ,\r\nthen add them to the salad. Set aside. Using a sharp knife, remove the peel and pith from the grapefruit and,\r\nworking over a small bowl to catch the juices, cut out the segments. Squeeze any\r\nremaining juice into the bowl. Set the segments aside. Mince and mash the garlic, then add it to the small bowl. Add the vinegar, mustard, oil, salt, and pepper to taste. Using a fork, the dressing until it is emulsified, then pour it over the salad and . Portion out the salad onto individual serving plates. Put the grapefruit segments on top. Shave the Parmesan using a mandolin or a\r\nvegetable peeler and add the curls to each plate. Serve.', '[\"Romaine lettuce\",\"watercress\",\"fennels, thinly sliced\",\"radishes, thinly sliced\",\"grapefruits\",\"garlic, minced and mashed\",\"apple cider vinegar\",\"Dijon mustard\",\"extra virgin olive oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"Parmesan cheese, sliced into thin curls\"]', 'https://media.soscuisine.com/images/recettes/466.jpg', 'https://www.soscuisine.com//recipe/mixed-lettuce-salad-grapefruit', 'will make slicing the fennel and radishes easier.', '15 min', '270 kcal', '{\"calories\":\"270\",\"fat\":\"23 g\",\"cholesterol\":\"10 mg\",\"protein\":\"6 g\"}', '{\"diet-related_health_claims\":\"Bone-healthy\",\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Potassium, Vitamin A, Vitamin C, Vitamin E, Vitamin K\",\"good_source_of\":\"Calcium, Fibre\",\"source_of\":\"Copper, Iron, Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Selenium, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin B6, Zinc\"}', '2021-06-18 14:20:43'),
(617, 617, 1, 'Moroccan Carrot Salad', 'Bring a large pot of salted water to a boil. Add the carrots and boil until fork-tender, about 15 min. Let cool slightly, then slice into 1 cm (1/2-in) coins. Meanwhile, in a large bowl, the olive oil, garlic, lemon juice, spices and a pinch of salt. with the carrots to coat, then with the cilantro and parsley. Serve warm or at room temperature, or chill until ready to serve.', '[\"carrots, peeled\",\"extra virgin olive oil\",\"garlic, minced\",\"lemonjuice, freshly squeezed\",\"ground cumin\",\"paprika\",\"cayenne pepper\",\"fresh cilantro, finely chopped\",\"Italian parsley, fresh, finely chopped\",\"salt\"]', 'https://media.soscuisine.com/images/recettes/4425.jpg', 'https://www.soscuisine.com//recipe/moroccan-carrot-salad', '', '25 min', '120 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Vitamin A, Vitamin E, Vitamin K\",\"good_source_of\":\"Fibre, Potassium, Vitamin B6\",\"source_of\":\"Calcium, Folacin, Iron, Magnesium, Manganese, Niacin, Pantothenic Acid, Vitamin B1, Vitamin B2, Vitamin C\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:20:44');
INSERT INTO `recipe_translation` (`rt_id`, `rt_recipe_id`, `rt_lang_id`, `rt_recipe_name`, `rt_recipe_text`, `rt_recipe_ingredients_full`, `rt_recipe_image`, `rt_recipe_link`, `rt_recipe_prep`, `rt_recipe_duration`, `rt_recipe_calories`, `rt_recipe_nutrients`, `rt_recipe_claims`, `rt_created`) VALUES
(618, 618, 1, 'Moroccan Red Lentil Soup', 'Rinse the lentils well under cold water and drain. Heat the oil in a pot over medium heat. Finely chop the onion and garlic, then add them to the pot. Sauté with occasional stirring 4-5 min until translucent. Add the grated ginger and spices. Cook 1 min with stirring . Add the lentils, , salt, and pepper. Bring to a boil then reduce the heat and simmer , uncovered, 15-20 min until the lentils become very soft. Pour in the lemon juice and adjust the seasoning Purée the soup in a blender , then ladle it into bowls and serve.', '[\"red-orange lentils (dried), rinsed and drained\",\"canola oil\",\"onions, finely chopped\",\"garlic, pressed or minced\",\"gingerroot, grated\",\"turmeric\",\"ground cumin\",\"couscous spice (ras-el-hanout)\",\"chicken broth\",\"lemon juice, freshly squeezed\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2088.jpg', 'https://www.soscuisine.com//recipe/moroccan-red-lentil-soup', 'will be very useful to purée the soup.', '35 min', '140 kcal', '{\"calories\":\"140\",\"fat\":\"3 g\",\"cholesterol\":\"0 mg\",\"protein\":\"8 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Folacin, Manganese\",\"good_source_of\":\"Copper, Iron, Pantothenic Acid\",\"source_of\":\"Fibre, Magnesium, Niacin, Phosphorus, Potassium, Selenium, Vitamin B1, Vitamin B6, Vitamin E, Zinc\",\"low\":\"Fat, Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:20:44'),
(619, 619, 1, 'Mulligatawny Soup', 'Rinse and drain the lentils then set aside. Finely chop the onion, garlic, celery and carrot. Heat the butter and oil in a pot over medium-low heat. Sauté the vegetables 5-6 min until the onion is translucent. Add the minced chili pepper and the curry powder. Cook 1 min with constant stirring . Pour in the homemade chicken broth , add the lentils, and bring to a boil. Reduce the heat, cover, and simmer 30 min, until the lentils are cooked. While the soup is simmering cook the basmati rice separately, then add it to the soup. When the soup is done, adjust the seasoning , add the previously prepared shredded chicken and the finely diced apples. Cook a couple minutes just to warm up. in the lemon juice, then blend in the coconut milk. Serve in bowls with a sprinkling of fresh cilantro leaves.', '[\"green or brown lentils (dried), rinsed and drained\",\"onions, finely chopped\",\"garlic, finely chopped\",\"celery, finely chopped\",\"carrots, finely chopped\",\"butter, unsalted\",\"canola oil\",\"dried chili peppers, minced\",\"curry powder\",\"Homemade Chicken Broth\",\"basmati rice\",\"Homemade Boiled Chicken\",\"apples, finely diced\",\"lemon juice, freshly squeezed\",\"unsweetened coconut milk\",\"fresh cilantro\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/198.jpg', 'https://www.soscuisine.com//recipe/mulligatawny-soup', '', '45 min', '310 kcal', '{\"calories\":\"310\",\"fat\":\"13 g\",\"cholesterol\":\"20 mg\",\"protein\":\"15 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Manganese, Potassium, Vitamin A, Vitamin K\",\"good_source_of\":\"Copper, Fibre, Iron, Magnesium, Niacin, Phosphorus, Selenium, Vitamin B6, Zinc\",\"source_of\":\"Calcium, Pantothenic Acid, Vitamin B1, Vitamin B2, Vitamin C, Vitamin E\"}', '2021-06-18 14:20:45'),
(620, 620, 1, 'Mushroom Soup', 'Prepare the vegetables : Thinly slice the mushrooms; or mince the garlic; discard the dark green part of the leeks, keep the white and light green parts, then slice them thin. Melt the butter in a pot or saucepan over medium-low heat. Add the leeks and garlic, then about 10 min until they are softened. During this time, heat the oil in a separate pan over medium-high heat. Add the mushrooms and sauté them in batches, so that they will turn golden-brown rather than \'boil\' in the water released during cooking. Take the mushrooms out of the pan as they become golden-brown and set aside. When the leeks are softened, in the flour. Cook 2 min, with stirring, then add the rice and mushrooms (you may keep some mushrooms aside\r\nas a garnish). Pour in the , bring to a boil, then lower the heat and simmer about 15 min, until the rice is cooked. Season with salt and pepper to taste. Purée the soup in a blender , then distribute it into bowls. Garnish each bowl with a spoonful of sour cream, the optional chopped chives, and reserved mushrooms. Serve.', '[\"button (white) mushrooms, thinly sliced\",\"garlic, pressed or minced\",\"leeks, thinly sliced\",\"butter, unsalted\",\"olive oil\",\"white flour (all purpose)\",\"rice, long grain\",\"chicken broth\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"sour cream\",\"chives, fresh, chopped\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/739.jpg', 'https://www.soscuisine.com//recipe/mushroom-soup', 'will be very useful to purée the soup.', '35 min', '190 kcal', '{\"calories\":\"190\",\"fat\":\"11 g\",\"cholesterol\":\"20 mg\",\"protein\":\"5 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Selenium, Vitamin B2\",\"good_source_of\":\"Copper, Folacin, Manganese, Niacin, Pantothenic Acid, Potassium, Vitamin A, Vitamin K\",\"source_of\":\"Calcium, Iron, Magnesium, Phosphorus, Vitamin B1, Vitamin B12, Vitamin B6, Vitamin E, Zinc\"}', '2021-06-18 14:20:47'),
(621, 621, 1, 'Chicken \"Kafta\" Kebabs', 'Finely chop the onion and parsley, then put them in a bowl. Add the ground meat, bread crumbs, and ground coriander. Add salt and pepper. For a more\r\npiquant flavour, you may add the curry powder. Mix well until the mixture is well combined and\r\nsmooth. Chill for about 10 minutes to firm up the meat mixture. The traditional « kaftas » are sausage-shaped : little balls are made first, then threaded onto skewers, and molded into a log shape about 10 cm long and 3cm thick. However, it is perfectly acceptable to shape the « kaftas » into regular patties. Cook the « kaftas » on a lightly oiled hot grill for about 10 min, until the outside is golden brown and the inside loses its pink colour. Turn the patties once halfway through the cooking. Alternatively, heat a nonstick heavy-bottom pan. Add the « kaftas » and cook for about 10 min, turning them once. While the meat is cooking, chop the mint and mix it with the yogurt in a small bowl. Place the « kaftas » on pita bread then serve with the yogurt dip on the side.', '[\"red onions, finely chopped\",\"Italian parsley, fresh, finely chopped\",\"ground chicken, or ground turkey\",\"bread crumbs\",\"ground coriander\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"curry powder\",\"[optional]\",\"fresh mint, chopped\",\"yogurt, plain, 2%\",\"pita breads\",\"olive oil\"]', 'https://media.soscuisine.com/images/recettes/562.jpg', 'https://www.soscuisine.com//recipe/chicken-kafta-kebabs', 'These patties can be cooked either using an outdoor grill or in a pan on the stovetop.', '30 min', '460 kcal', '{\"calories\":\"460\",\"fat\":\"17 g\",\"cholesterol\":\"80 mg\",\"protein\":\"31 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Folacin, Iron, Phosphorus, Potassium, Selenium, Vitamin B1, Vitamin K\",\"good_source_of\":\"Calcium, Manganese, Niacin, Vitamin A, Vitamin B2, Vitamin C\",\"source_of\":\"Copper, Fibre, Magnesium, Pantothenic Acid, Vitamin B12, Vitamin B6, Vitamin D, Vitamin E, Zinc\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:20:48'),
(622, 622, 1, 'Mussels with Parsley and Parmesan', 'Carefully rinse and brush the mussels to remove any sand. Drain. Discard any of the mussels that stay open, even after being tapped, because they are not alive and should not be eaten. Place the mussels with the water in a saucepan. Cover and cook over medium heat for 5-6 min, or until all of the mussels have opened. Meanwhile, in a bowl, mix together the olive oil, grated Parmesan cheese, Parsley and\r\nGarlic Base , and freshly ground pepper. Drain the mussels, discarding any that fail to open. Snap the top shell off of each, leaving the mussels attached to the bottom shell. Using a spoon, put a small amount of the parsley mixture on top of each mussel. Arrange the mussels on a baking sheet and cook them on a medium grill for about 3 min, until the mussels are sizzling hot. Alternatively, cook them in an oven under the broiler. Serve.', '[\"mussels, rinsed\",\"water\",\"olive oil\",\"Parmesan cheese, grated\",\"Parsley and Garlic Base\",\"ground pepper\"]', 'https://media.soscuisine.com/images/recettes/627.jpg', 'https://www.soscuisine.com//recipe/mussels-parsley-parmesan', '.', '25 min', '260 kcal', '{\"calories\":\"260\",\"fat\":\"18 g\",\"cholesterol\":\"40 mg\",\"protein\":\"17 g\"}', '{\"free\":\"Sugar\",\"excellent_source_of\":\"Folacin, Iron, Manganese, Selenium, Vitamin B12, Vitamin E, Vitamin K\",\"good_source_of\":\"Niacin, Phosphorus, Vitamin B1, Vitamin B2, Zinc\",\"source_of\":\"Calcium, Copper, Magnesium, Omega-3, Pantothenic Acid, Potassium, Vitamin A, Vitamin C\"}', '2021-06-18 14:20:48'),
(623, 623, 1, 'Mustard and Garlic Mayonnaise', 'Crush or the garlic and put it in a blender food\r\nprocessor Separate the egg whites and yolks. Put the yolks in the blender. Set the whites aside in a glass jar with a lid and put them in the refrigerator or freezer for a future use in another recipe. Add the lemon juice and mustard to the blender, then process a few seconds, until smooth. With the motor\r\nrunning, add the oil slowly until the mixture forms a thick cream. Season with salt and pepper. Serve.', '[\"garlic\",\"egg yolks\",\"lemon juice, freshly squeezed\",\"whole-grain mustard\",\"olive oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/543.jpg', 'https://www.soscuisine.com//recipe/mustard-garlic-mayonnaise', 'will be very useful for this recipe.', '10 min', '260 kcal', '', '', '2021-06-18 14:20:49'),
(624, 624, 1, 'My Mother\'s Tomato Sauce', 'Finely chop the onion, carrot, celery, and garlic. Heat the oil and butter in the pressure cooker or in a saucepan over low heat. Add the chopped vegetables. Cook 4-5 min, stirring a few times: the vegetables must soften without burning. Add the diced tomatoes, salt and pepper to taste. If you are using a pressure cooker , cover, close, and bring to high pressure. Cook 15 min from the time it starts to spatter. (Follow the manufacturer\'s directions to determine when high pressure has been reached). If you are not using a pressure cooker, simmer , covered, for about 45 min.', '[\"canned tomatoes (diced)\",\"garlic\",\"onions, finely chopped\",\"carrots, finely chopped\",\"celery, finely chopped\",\"olive oil\",\"butter, unsalted\",\"salt\",\"ground pepper\"]', 'https://media.soscuisine.com/images/recettes/58.jpg', 'https://www.soscuisine.com//recipe/mother-tomato-sauce', 'to reduce the cooking time would make things easier with this recipe.', '30 min', '220 kcal', '', '', '2021-06-18 14:20:49'),
(625, 625, 1, 'No-Cook Date Bars', 'Line one or multiple 20 cm (8 in) square baking pan with parchment paper, according to number of servings. Put the pitted dates in a food processor then purée. Add the peanut butter and vanilla then mix well. In a large bowl, combine the puffed rice and almonds. Add the date mixture then mix well. Tip this mixture into the prepared baking pan(s) and press the mixture so it is compact. Put the chocolate in a bowl, then put it in the microwave. Cook using short periods to avoid burning the chocolate. Spread the melted chocolate on top of the date mixture using the back of a spoon. Transfer the pan(s) to the fridge then let set for at least 45 min. Cut each squares into 12 pieces then serve.', '[\"fresh dates, pitted\",\"peanut butter, natural\",\"vanilla extract\",\"rice puffs\",\"almonds, coarsely ground\",\"unsweetened (dark) chocolate\"]', 'https://media.soscuisine.com/images/recettes/3444.jpg', 'https://www.soscuisine.com//recipe/no-cook-date-bars', 'will be very useful to purée the dates and coarsely grind the almonds.', '25 min', '250 kcal', '{\"calories\":\"250\",\"fat\":\"13 g\",\"cholesterol\":\"0 mg\",\"protein\":\"6 g\"}', '{\"excellent_source_of\":\"Magnesium, Vitamin E\",\"good_source_of\":\"Copper, Fibre, Manganese, Potassium\",\"source_of\":\"Calcium, Folacin, Iron, Niacin, Omega-6, Phosphorus, Vitamin B1, Vitamin B2, Vitamin B6, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:20:50'),
(626, 626, 1, 'No-Waste Carrot Tops Soup', 'Prepare the carrots : Cut the carrot greens from the stems then wash and rinse well to remove excess dirt. Remove any hard stems, chop the greens then set aside. Slice the carrots into thin rounds, coarsely chop the celery, finely chop the onion and garlic. In a pot, the onion and celery in oil over medium heat for about 3-4 min. Add garlic and carrots then sauté a few minutes. in the chili pepper and bay leaf. Season with salt and pepper. Pour in the and water. Bring to a boil, lower the heat, cover and simmer until the carrots are tender, about 25 min. Add the beans then continue to cook 5 min. At the very end in the greens, adjust the seasoning and serve.', '[\"carrots, with leaves\",\"olive oil\",\"onions, finely chopped\",\"celery, coarsely chopped\",\"garlic, finely chopped\",\"bay leaf\",\"chicken broth\",\"water\",\"white \\\"navy\\\" beans (canned), rinsed and drained\",\"dried chili peppers, minced\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/4422.jpg', 'https://www.soscuisine.com//recipe/no-waste-carrot-tops-soup', 'In the absence of carrot tops, parsley can be used.', '45 min', '170 kcal', '{\"calories\":\"170\",\"fat\":\"3 g\",\"cholesterol\":\"0 mg\",\"protein\":\"7 g\"}', '{\"excellent_source_of\":\"Fibre, Folacin, Manganese, Potassium, Vitamin A\",\"good_source_of\":\"Magnesium, Vitamin B1, Vitamin B6, Vitamin K\",\"source_of\":\"Calcium, Copper, Iron, Niacin, Pantothenic Acid, Phosphorus, Selenium, Vitamin B2, Vitamin C, Vitamin E, Zinc\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:20:51'),
(627, 627, 1, 'Chicken Legs with Vegetables', 'Prepare the vegetables : Finely chop the onion, slice the carrots into thin rounds (3-4 mm thick), cut the mushrooms into quarters. Soak the raisins in a small cup of lukewarm water. Set aside. Heat the oil in a pan over medium heat, then add the chicken drumsticks and sauté thoroughly on each side until golden, about 7-8 min. Take the chicken pieces out of the pan then set them aside on the warmed serving plate in the oven. Add the onion to the pan, then sauté 2-3 min. Add the carrots and mushrooms then cook 2-3 min. Add the raisins and . Scrape the bottom of the pan thoroughly as the liquid comes to a boil. Put the chicken back into the pan, then add the diced tomatoes and . Season with salt and pepper to taste. Cover, then simmer 20-25 min until the chicken is tender. Serve.', '[\"onions, finely chopped\",\"carrots, cut into 3-4 mm thick rounds\",\"button (white) mushrooms, quartered\",\"chicken broth\",\"raisins\",\"canola oil\",\"chicken drumsticks, skinless\",\"canned tomatoes (diced)\",\"herbes de Provence\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/880.jpg', 'https://www.soscuisine.com//recipe/chicken-legs-vegetables-alcohol-free', 'Put the serving dish in the oven at the lowest setting to keep the chicken warm after its initial sautéing.', '45 min', '280 kcal', '{\"calories\":\"280\",\"fat\":\"12 g\",\"cholesterol\":\"70 mg\",\"protein\":\"25 g\"}', '{\"excellent_source_of\":\"Vitamin A\",\"good_source_of\":\"Potassium, Vitamin E, Vitamin K\",\"source_of\":\"Calcium, Copper, Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Selenium, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin C, Vitamin D, Zinc\",\"low\":\"Calories, Saturated Fat, Sodium\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:20:51'),
(628, 628, 1, 'Okra with Tomatoes', 'Heat the oil in a skillet over medium heat. Add the onion then sauté 3 min until softened. Add the green pepper, okra, garlic, and chili pepper , then cook 3 min, with occasional stirring in the tomatoes and lemon juice. Bring the mixture to a boil, then reduce the heat, cover and simmer about 10 min, until okra is tender. Adjust the seasoning and serve.', '[\"olive oil\",\"onions, coarsely chopped\",\"green peppers, chopped\",\"okra\\/lady\'s fingers, ends trimmed, whole\",\"garlic, minced\",\"dried chili peppers, minced\",\"canned tomatoes (diced)\",\"lemon juice, freshly squeezed\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2593.jpg', 'https://www.soscuisine.com//recipe/okra-tomatoes', '', '25 min', '80 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Vitamin C, Vitamin K\",\"good_source_of\":\"Folacin, Manganese\",\"source_of\":\"Calcium, Copper, Fibre, Magnesium, Niacin, Potassium, Vitamin A, Vitamin B1, Vitamin B6, Vitamin E, Zinc\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:20:52'),
(629, 629, 1, 'Orange and Ginger Vinaigrette', 'Combine all the ingredients, except oil, mayonnaise and spices. Mix in the blender to finely reduce the ginger. Add the oil with a whisk, followed by the mayonnaise. Season with spices, salt and pepper. Chill in the refrigerator for 1 or 2 hours.', '[\"orange juice\",\"lime juice, freshly squeezed\",\"whole-grain mustard\",\"gingerroot, finely chopped\",\"extra virgin olive oil\",\"mayonnaise\",\"old-fashion spice blend\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2260.jpg', 'https://www.soscuisine.com//recipe/orange-ginger-vinaigrette', 'The \"old-fashioned spice blend\" is a mix of chives, garlic, onion, mustard seeds, and parsley.', '15 min', '160 kcal', '{\"calories\":\"160\",\"fat\":\"18 g\",\"cholesterol\":\"0 mg\",\"protein\":\"0 g\"}', '{\"free\":\"Sugar\",\"good_source_of\":\"Vitamin E\",\"source_of\":\"Omega-3, Omega-6, Vitamin K\",\"low\":\"Sodium\"}', '2021-06-18 14:20:53'),
(630, 630, 1, 'Orange Carrot PurÃÂ©e', 'Prepare the carrots . Peel and cut them into 2 cm pieces then boil or steam them about 15 min until they are fork-tender. Let the carrots cool down a few minutes, then purée in a food processor Add the butter, minced garlic, orange juice, and cream, then until a creamy consistency is obtained. Add salt and pepper to taste. Reheat and serve warm.', '[\"carrots, cut into 2 cm pieces\",\"butter, unsalted\",\"garlic, minced\",\"orange juice\",\"cream 15%\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/223.jpg', 'https://www.soscuisine.com//recipe/orange-carrot-puree', 'will be very useful to purée the carrots.', '25 min', '150 kcal', '{\"calories\":\"150\",\"fat\":\"9 g\",\"cholesterol\":\"30 mg\",\"protein\":\"2 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Vitamin A, Vitamin K\",\"good_source_of\":\"Fibre, Potassium, Vitamin B6, Vitamin E\",\"source_of\":\"Calcium, Folacin, Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin B2, Vitamin C\",\"low\":\"Sodium\"}', '2021-06-18 14:20:54'),
(631, 631, 1, 'Orange Cranberry Muffins', 'Preheat the oven to 350°F (180°C). Grease a 12-cup muffin pan. Mix all the dry ingredients, except sugar in a bowl. Beat the eggs and sugar in another bowl and add orange juice and oil. Mix well. Combine the dry ingredients and egg mixture and gently stir in the cranberries. Fill the prepared muffin pan three-quarters of the way. Bake for 20 to 25 minutes.', '[\"white rice flour\",\"brown rice flour\",\"tapioca flour\\/starch\",\"almond meal\",\"guar gum, or xanthan\",\"baking powder\",\"salt\",\"eggs size large\",\"sucanat\",\"orange juice\",\"canola oil\",\"cranberries\"]', 'https://media.soscuisine.com/images/recettes/2268.jpg', 'https://www.soscuisine.com//recipe/orange-cranberry-muffins', '', '45 min', '220 kcal', '{\"calories\":\"220\",\"fat\":\"12 g\",\"cholesterol\":\"30 mg\",\"protein\":\"3 g\"}', '{\"excellent_source_of\":\"Vitamin E\",\"good_source_of\":\"Manganese, Vitamin K\",\"source_of\":\"Calcium, Magnesium, Niacin, Pantothenic Acid, Phosphorus, Selenium, Vitamin B1, Vitamin B12, Vitamin B6, Vitamin C\"}', '2021-06-18 14:20:55'),
(632, 632, 1, 'Orange Olive Oil Cake', 'Preheat the oven to 175°C/350°F. Grease a baking pan. In a small bowl, combine the flour, baking powder, and salt. Set aside. In another bowl, the oil with ¾ of the sugar using a , about 3-4 min until light and fluffy. Add the eggs one at a time, beating well after each addition. Add 1 or 2 teaspoons orange zest and yogurt. Add the flour mixture in small portions,while mixing well until homogeneous. Transfer the mixture to the baking pan and bake in the middle of the oven for about 35 min. Check the cake with a toothpick or knife to see if it is cooked through. When done, pull it out of the oven and let it cool down a few minutes. Pour the orange juice in a small microwave-safe bowl. Add the remaining sugar and microwave, uncovered, on medium-high 1 min until hot and syrupy. Pour the syrup over the cake then let it cool at least 30 min before serving.', '[\"white flour (all purpose)\",\"baking powder\",\"salt\",\"yogurt, plain, 2%\",\"sugar\",\"eggs size large\",\"oranges, for juice and zest\",\"olive oil\"]', 'https://media.soscuisine.com/images/recettes/4321.jpg', 'https://www.soscuisine.com//recipe/orange-olive-oil-cake', '', '50 min', '270 kcal', '{\"calories\":\"270\",\"fat\":\"16 g\",\"cholesterol\":\"50 mg\",\"protein\":\"4 g\"}', '{\"good_source_of\":\"Folacin, Selenium, Vitamin E\",\"source_of\":\"Calcium, Iron, Manganese, Niacin, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin C, Vitamin K\",\"low\":\"Sodium\"}', '2021-06-18 14:20:55'),
(633, 633, 1, 'Orange-flavoured Applesauce with Ginger', 'Cut the apples into quarters without peeling them. Put them in a saucepan. Add the water, grated ginger and orange juice, cover and cook over low heat about 15 min, until the apples are softened completely. Purée the apples using a food mill . Let the purée cool down and serve cold or at room temperature.', '[\"apples\",\"water, approximately\",\"gingerroot, grated\",\"orange juice\"]', 'https://media.soscuisine.com/images/recettes/4415.jpg', 'https://www.soscuisine.com//recipe/orange-applesauce-ginger', 'will be very useful to purée the apples, without having to peel them first.', '25 min', '90 kcal', '{\"calories\":\"90\",\"fat\":\"0 g\",\"cholesterol\":\"0 mg\",\"protein\":\"1 g\"}', '{\"source_of\":\"Fibre, Vitamin C\",\"free\":\"Added Sugar, Cholesterol, Fat, Saturated Fat, Sodium, Trans Fat\"}', '2021-06-18 14:20:56'),
(634, 634, 1, 'Oven Baked Brown Rice Bread', 'Combine all the flours, guar gum or xanthan and yeast. Heat water in the microwave for 1½ minutes, add the honey, salt, vinegar, oil, egg, flax seeds and mix well. Add two-thirds of the flour gradually and mix for 1 minute. Cover with a cloth and let rise 15 minutes. Add the remaining flour and mix for 1 or 2 minutes. Line a large 9×5×3 inch (22.5×12.5×7 cm) loaf pan with parchment paper leaving a 2-inch overhang and pour the mixture into it. Heat 2 cups (500 ml) of water for 3 minutes in the microwave and then place your dough next to it to rise for 30 minutes (For less dense bread, let the dough rise at least 1 hour). In the meantime, preheat the oven to 400 °F (200 °C). Bake the bread for 30 minutes. Remove from oven, tap the bread out of the pan and cool on a rack. Wrap in a cloth and plastic bag and store in the refrigerator.', '[\"brown rice flour\",\"tapioca flour\\/starch\",\"guar gum, or xanthan\",\"quick-rise yeast\",\"water\",\"honey\",\"salt\",\"rice vinegar\",\"olive oil\",\"eggs size large, beaten\",\"flax seeds, ground\"]', 'https://media.soscuisine.com/images/recettes/2263.jpg', 'https://www.soscuisine.com//recipe/oven-baked-brown-rice-bread', '', '40 min', '150 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Manganese\",\"source_of\":\"Fibre, Folacin, Iron, Magnesium, Niacin, Omega-3, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin B6, Zinc\",\"low\":\"Cholesterol, Saturated Fat, Sodium\",\"free\":\"Trans Fat\"}', '2021-06-18 14:20:56'),
(635, 635, 1, 'Oven Baked Raisin Bread', 'Combine all the flours, almond meal, guar gum or xanthan and yeast. Heat water in the microwave for 1 minute, add the honey, salt, vinegar, oil, and beaten eggs and mix well. Add two-thirds of the flour mixture gradually and mix for 1 minute. Cover with a cloth and let rise 15 minutes. Add the rice flour-coated raisins and mix well. Add the remaining flour and mix for 1 or 2 minutes. Pour the preparation into two small loaf pans that are greased or lined with 4.5×2.5×3 inch (11×6×5 cm) parchment paper or into a greased 8-cup (2 L) measuring cup. Heat 2 cups (500 ml) of water for 3 minutes in the microwave and then place your dough next to it to rise for 30 minutes. In the meantime, preheat the oven to 400 °F (200 °C). Bake the bread for 20 to 25 minutes in the small pans or for 30 minutes in the measuring cup. Ten minutes before the end, cover the bread with aluminum foil to prevent excess browning. Remove from oven, tap the bread out of the pan and cool on a rack. Wrap in a cloth and plastic bag and store in the refrigerator.', '[\"white rice flour\",\"almond meal\",\"millet flour\",\"amaranth flour\",\"tapioca flour\\/starch\",\"quinoa flour\",\"guar gum, or xanthan\",\"quick-rise yeast\",\"water\",\"honey\",\"salt\",\"rice vinegar\",\"olive oil\",\"eggs size large\",\"egg yolks, beaten\",\"raisins, coated with 2 tbsp of rice flour\"]', 'https://media.soscuisine.com/images/recettes/2266.jpg', 'https://www.soscuisine.com//recipe/oven-baked-raisin-bread', '', '50 min', '190 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"good_source_of\":\"Manganese, Vitamin E\",\"source_of\":\"Copper, Fibre, Folacin, Iron, Magnesium, Niacin, Pantothenic Acid, Phosphorus, Potassium, Selenium, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin B6, Zinc\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Trans Fat\"}', '2021-06-18 14:20:57'),
(636, 636, 1, 'Oven Baked Six Flour Bread', 'Combine all the flours, guar gum or xanthan and yeast. Heat water in the microwave for 1 minute, add the honey, salt, vinegar, oil, egg, flax seeds and mix well. Add two-thirds of the flour mixture gradually and mix for 1 minute. Cover with a cloth and let rise 15 minutes. Add the remaining flour and mix for 1 or 2 minutes. Line a large 9×5×3 inch (22.5×12.5×7 cm) loaf pan with parchment paper leaving a 2-inch overhang and pour the mixture into it. Heat 2 cups (500 ml) of water for 3 minutes in the microwave and then place your dough next to it to rise for 30 minutes. In the meantime, preheat the oven to 400 °F (200 °C). Bake the bread for 30 minutes. Remove from oven, tap the bread out of the pan and cool on a rack. Wrap in a cloth and plastic bag and store in the refrigerator.', '[\"rice and chestnut flour\",\"quinoa flour\",\"buckwheat flour\",\"tapioca flour\\/starch\",\"guar gum, or xanthan\",\"water\",\"quick-rise yeast\",\"honey\",\"salt\",\"rice vinegar\",\"olive oil\",\"eggs size large\",\"flax seeds, ground\"]', 'https://media.soscuisine.com/images/recettes/2264.jpg', 'https://www.soscuisine.com//recipe/oven-baked-six-flour-bread', 'The texture of the bread can vary according to the amount of water. If you prefer bread that is moister, add a few tablespoons of water. However, for drier bread, remove some tablespoons of water.', '50 min', '140 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"good_source_of\":\"Manganese\",\"source_of\":\"Copper, Fibre, Folacin, Iron, Magnesium, Niacin, Omega-3, Phosphorus, Zinc\",\"low\":\"Cholesterol, Saturated Fat, Sodium\",\"free\":\"Trans Fat\"}', '2021-06-18 14:20:58'),
(637, 637, 1, 'Oven Braised Brussels Sprouts', 'Prepare the sprouts by peeling off the wilted outer leaves and piercing the core of the vegetable with the tip of a small knife. This allows even cooking of the vegetable and prevents bitterness. Place the sprouts in a baking dish, preferably deep. Season the sprouts with salt and pepper and drizzle a reasonable amount of olive oil or according to taste. Drizzle lemon juice. Cover with aluminum foil and put into the oven at 350°F (180°C) for 30 minutes. Serve plain or drizzled with high-quality olive oil. If the sprouts are not sufficiently cooked, leave them for 10 more minutes. Before putting into in the oven, add a bit of lemon if desired.', '[\"Brussels sprouts\",\"ground pepper to taste\",\"[optional]\",\"salt\",\"[optional]\",\"extra virgin olive oil\",\"lemon juice, freshly squeezed\"]', 'https://media.soscuisine.com/images/recettes/2205.jpg', 'https://www.soscuisine.com//recipe/oven-braised-brussels-sprouts', '', '50 min', '90 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Folacin, Vitamin C, Vitamin K\",\"good_source_of\":\"Fibre, Manganese, Potassium, Vitamin A\",\"source_of\":\"Copper, Iron, Magnesium, Niacin, Phosphorus, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin E\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:20:59'),
(638, 638, 1, 'Chicken Parmigiana', 'Spread the tomato sauce into the bottom of a baking dish. Slice each breast horizontally into thin cutlets. Flatten the cutlets between 2 plastic films and tenderize them, using a meat pounder or a rolling\r\npin Prepare 2 shallow dishes for the egg and coating mixture: the egg in one, combine bread crumbs and grated Parmesan in the other. Dip one chicken cutlet at the time in the egg, let the excess egg drip off before coating the cutlet with the bread crumbs mixture. Turn the cutlets to both sides. Heat the oil in a skillet on medium heat. Sauté the chicken cutlets 3-4 min on each side, until golden. Add salt and pepper to taste. Transfer to the baking dish, placing them side by side on top of the tomato sauce . Top each cutlet with a thin slice of mozzarella. Preheat the broiler. Broil the cutlets about 10 cm from the heat source 6-8 min, until the cheese is melted and lightly browned in spots. Serve on the warmed plates.', '[\"chicken breasts, boneless, skinless, cut into thin cutlets\",\"eggs size large\",\"Parmesan cheese, grated\",\"bread crumbs\",\"My Mother\'s Tomato Sauce\",\"bocconcini \\/ fresh mozzarella\",\"canola oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"plastic wrap, to flatten the cutlets\"]', 'https://media.soscuisine.com/images/recettes/100.jpg', 'https://www.soscuisine.com//recipe/chicken-parmigiana', 'Keep the serving plates warm on the stove while you\'re preparing the dish.', '35 min', '380 kcal', '{\"calories\":\"380\",\"fat\":\"24 g\",\"cholesterol\":\"150 mg\",\"protein\":\"35 g\"}', '{\"diet-related_health_claims\":\"Bone-healthy\",\"free\":\"Added Sugar\",\"excellent_source_of\":\"Niacin, Phosphorus, Vitamin A, Vitamin B6\",\"good_source_of\":\"Calcium, Pantothenic Acid, Vitamin B12, Vitamin E\",\"source_of\":\"Folacin, Iron, Magnesium, Manganese, Omega-3, Potassium, Selenium, Vitamin B1, Vitamin B2, Vitamin D, Vitamin K, Zinc\"}', '2021-06-18 14:21:00'),
(639, 639, 1, 'Oven-Baked \"Sweet Potato Squash\" Chips', 'Preheat the oven to 190°C/375°F. Line a large baking sheet with parchment\r\npaper Wash the squash, then cut each squash into 2 longitudinally, without peeling. Remove seeds and filaments, then cut them into 1x8 cm pieces. It is important to cut them into pieces of similar size so that they will all cook evenly and be done at the same time. In a large bowl, mix the oil, with curry, oregano, salt, and pepper. Add the squash pieces and coat them well with the mixture. Transfer them to the baking sheet. Don\'t crowd the pieces on the sheet or they will steam and not turn golden-brown. Bake on the bottom oven rack 10-12 min, then turn the pieces and bake an additional 10-12 min. Serve.', '[\"delicata squash\",\"olive oil\",\"curry powder\",\"dried oregano\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"parchment paper, for the sheet\"]', 'https://media.soscuisine.com/images/recettes/2628.jpg', 'https://www.soscuisine.com//recipe/oven-baked-sweet-potato-squash-chips', '', '30 min', '110 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Potassium, Vitamin A\",\"good_source_of\":\"Folacin, Manganese, Vitamin B6, Vitamin K\",\"source_of\":\"Copper, Fibre, Iron, Magnesium, Niacin, Pantothenic Acid, Vitamin B2, Vitamin C, Vitamin E\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Sodium, Trans Fat\"}', '2021-06-18 14:21:01'),
(640, 640, 1, 'Oven-Roasted Peppers', 'Preheat the oven to 215°C/425°F. Clean the peppers with a wet towel, pat dry, and place into an ovensafe dish or a roasting pan. Cook in the middle of the oven about 30 min, or until peppers are soft and browned in spots. Turn them a couple times during cooking. Remove from oven, cover or wrap in a paper bag, and let cool down about 15-20 min (the moisture kept in the bag or under the cover will help the peeling). Remove the stem. Peel and cut each pepper lengthwise into 3-4 strips and remove seeds. Drain in a colander for about 30 min. Add salt and pepper to taste only when ready to use. Drizzle with extra virgin olive oil. Serve.', '[\"yellow or red sweet peppers\",\"extra virgin olive oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/108.jpg', 'https://www.soscuisine.com//recipe/oven-roasted-peppers', 'Only red and yellow peppers are used in this recipe. They are harvested from the same plant as the green ones but are plumper and sweeter after changing colour since they are picked when fully ripe.', '35 min', '70 kcal', '{\"calories\":\"70\",\"fat\":\"4 g\",\"cholesterol\":\"0 mg\",\"protein\":\"1 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Vitamin A, Vitamin C, Vitamin E\",\"good_source_of\":\"Vitamin B6\",\"source_of\":\"Copper, Fibre, Folacin, Iron, Magnesium, Manganese, Potassium, Vitamin B1, Vitamin K\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Cholesterol, Sodium, Trans Fat\"}', '2021-06-18 14:21:01'),
(641, 641, 1, 'Oysters', 'Wash the oysters then scrub to remove any loose grit or barnacles. If possible, use an oyster knife which has a special blunted blade made for this purpose. Hold one oyster in your hand, wearing a heavy glove or oven mitt to protect yourself from injuries. With the flat side of the oyster up, insert the blade of the knife, with moderate force and twisting if necessary, at the hinge between the two shells. Twist the blade until there is a slight pop. Then slide the blade upward to cut the abductor muscle which holds the shell closed. Remove and discard the upper (flat) shell. Carefully wipe away any grit that may be inside of the oyster. Repeat with the other oysters then serve with optional ground pepper and lemon.', '[\"oysters\",\"ground pepper to taste\",\"[optional]\",\"lemons, quartered\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/1278.jpg', 'https://www.soscuisine.com//recipe/oysters', '', '5 min', '70 kcal', '{\"calories\":\"70\",\"fat\":\"2 g\",\"cholesterol\":\"50 mg\",\"protein\":\"7 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Copper, Iron, Selenium, Vitamin B12, Vitamin D, Zinc\",\"good_source_of\":\"Magnesium, Manganese\",\"source_of\":\"Niacin, Omega-3, Phosphorus, Vitamin B1, Vitamin B2, Vitamin E\",\"low\":\"Fat, Saturated Fat\",\"free\":\"Sugar, Trans Fat\"}', '2021-06-18 14:21:02'),
(642, 642, 1, '\"Panna Cotta\"', 'Prepare the caramel . Divide it among the ramekins , then tilt and rotate each ramekin to thinly coat it. The caramel may not initially cover bottoms and sides completely, but it will spread and even out after the hot cream mixture is poured in. Pour the cream into a skillet with the sugar and the vanilla. Heat gently, and bring to boil. Remove from the heat. Pour the agar agar in a small bowl, add about 50 ml (1/4 cup) of the cream mixture, and mix well. Pour it into the skillet and constantly until completely dissolved. Distribute the cream mixture into the ramekins . Chill at least 2 h in the refrigerator before serving. To unmold, carefully dip the bottom of each ramekin in a baking pan of hot water briefly (30 sec). Run a thin knife around the edges to help loosen the \"panna cotta\" from the inside, then turn upside-down onto serving plates and serve.', '[\"whipping cream 35%\",\"sugar\",\"vanilla extract\",\"agar agar (powder)\",\"Microwaved Caramel\"]', 'https://media.soscuisine.com/images/recettes/2527.jpg', 'https://www.soscuisine.com//recipe/panna-cotta-vegetarian', 'when measuring the agar agar amount because it is critical: if it is not enough, the \"panna cotta\" will not set, if it is too much, the texture will be rubbery.', '15 min', '400 kcal', '{\"calories\":\"400\",\"fat\":\"29 g\",\"cholesterol\":\"110 mg\",\"protein\":\"2 g\"}', '{\"excellent_source_of\":\"Vitamin A\",\"source_of\":\"Calcium, Omega-3, Vitamin B12, Vitamin B2, Vitamin D, Vitamin E\",\"low\":\"Sodium\"}', '2021-06-18 14:21:03'),
(643, 643, 1, 'Papaya Cream', 'Cut the papaya in half lengthwise and remove the black seeds. Peel and discard the skin which is not edible. Coarsely cut the pulp into pieces (about 1,5 cm) and place them in a blender . Add the ice-cream and until very smooth. Portion out the mixture into individual cups and serve immediately.', '[\"papaya, ripe\",\"vanilla ice cream\"]', 'https://media.soscuisine.com/images/recettes/1850.jpg', 'https://www.soscuisine.com//recipe/papaya-cream-alcohol-free', '', '10 min', '130 kcal', '{\"calories\":\"130\",\"fat\":\"4 g\",\"cholesterol\":\"20 mg\",\"protein\":\"2 g\"}', '{\"excellent_source_of\":\"Vitamin C\",\"good_source_of\":\"Folacin, Potassium, Vitamin A\",\"source_of\":\"Calcium, Fibre, Magnesium, Pantothenic Acid, Vitamin B12, Vitamin B2, Vitamin D, Vitamin E\",\"low\":\"Sodium\"}', '2021-06-18 14:21:03'),
(644, 644, 1, 'Chicken Piccata', 'Cut the chicken breasts in half lengthwise, then butterfly them to make cutlets. Flatten and tenderize the cutlets using a meat pounder. Season the cutlets with salt and pepper, then them with the flour and shake off the excess. Heat the oil and half of the butter in a large skillet over medium-high heat, taking care not to let the butter burn. When the butter and oil start to sizzle, add a few chicken cutlets at a time and cook for 3 min. When the chicken has browned ,\r\nflip and cook the other side for 3 min. Remove and\r\ntransfer the cutlets to a plate. Repeat the operation with the remaining chicken cutlets, then add them to the plate, cover with aluminum foil, and put them in the low-setting oven to keep them warm. Reduce the skillet heat to medium-low, then pour in the lemon juice, and capers. Bring the mixture to a boil, scraping up brown bits from the pan for extra flavour. Adjust\r\nthe seasoning . Return all of the chicken to the pan, cover and simmer for 3-4 min. Remove the chicken and transfer it to a serving platter. Add the remaining butter to the skillet and vigorously. Pour the sauce over the chicken and garnish with the chopped parsley. Serve.', '[\"chicken breasts, boneless, skinless, butterflied\",\"white flour (all purpose)\",\"lemon juice, freshly squeezed\",\"butter, unsalted\",\"canola oil\",\"chicken broth\",\"capers\",\"Italian parsley, fresh, chopped\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"aluminum foil\"]', 'https://media.soscuisine.com/images/recettes/774.jpg', 'https://www.soscuisine.com//recipe/chicken-piccata', '', '20 min', '310 kcal', '{\"calories\":\"310\",\"fat\":\"15 g\",\"cholesterol\":\"100 mg\",\"protein\":\"35 g\"}', '{\"free\":\"Sugar\",\"excellent_source_of\":\"Niacin, Vitamin B6\",\"good_source_of\":\"Pantothenic Acid, Phosphorus, Vitamin B12, Vitamin K\",\"source_of\":\"Folacin, Iron, Magnesium, Potassium, Selenium, Vitamin A, Vitamin B1, Vitamin B2, Vitamin C, Vitamin D, Vitamin E, Zinc\"}', '2021-06-18 14:21:04'),
(645, 645, 1, 'Parsley and Chick Pea Salad', 'Place the quinoa in a fine strainer and hold it under cold running water until the water runs clear, then drain well. To cook, use two parts liquid to one part quinoa. Combine the liquid and quinoa with salt to taste in a saucepan, bring to a boil, then reduce to a simmer . Cover and cook until the grains are translucent and the germ has spiralled out from each grain, about 15 minutes. Meanwhile, wash, spin-dry, and finely chop the parsley and mint leaves discarding the larger stems. Transfer to a salad bowl along with the finely chopped green onions. In a small bowl, together the oil, lemon juice, and salt. the dressing until it is emulsified. Adjust the seasoning . Pour into the salad bowl, add the quinoa and chickpeas then well. Let the salad stand 10 min. Dice the tomatoes discarding the seeds, then add them to the salad, , and serve.', '[\"quinoa\",\"fresh mint, finely chopped\",\"Italian parsley, fresh, finely chopped\",\"green onions\\/scallions, finely chopped\",\"extra virgin olive oil\",\"lemon juice, freshly squeezed\",\"chickpeas\\/garbanzo beans (canned), rinsed and drained\",\"tomatoes, deseeded and diced\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2572.jpg', 'https://www.soscuisine.com//recipe/parsley-chick-pea-salad', '', '25 min', '370 kcal', '{\"calories\":\"370\",\"fat\":\"17 g\",\"cholesterol\":\"0 mg\",\"protein\":\"11 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Fibre, Folacin, Iron, Magnesium, Manganese, Potassium, Vitamin A, Vitamin B6, Vitamin C, Vitamin E, Vitamin K, Zinc\",\"good_source_of\":\"Copper, Niacin, Phosphorus\",\"source_of\":\"Calcium, Pantothenic Acid, Selenium, Vitamin B1, Vitamin B2\"}', '2021-06-18 14:21:05'),
(646, 646, 1, 'Parsnip and Potato Soup', 'Prepare the vegetables : Peel the potatoes and parsnips. Coarsely cut the vegetables into 3 cm pieces. Heat the oil in a saucepan over medium heat. Add all the vegetables and cook over medium heat for about 10 min with occasional stirring Pour in the warm and water. Cook, uncovered, until the potatoes are cooked and fork-tender, about 15-20 min. Purée the soup in a blender Adjust the seasoning , then add milk and reheat. Ladle into bowls and sprinkle with chives and feta cheese.', '[\"onions, cut into 3 cm pieces\",\"celery, cut into 3 cm pieces\",\"parsnips, cut into 3 cm pieces\",\"potatoes, cut into 3 cm pieces\",\"olive oil\",\"chicken broth\",\"milk, partly skimmed, 2%\",\"feta cheese, crumbled\",\"chives, fresh, finely chopped\",\"[optional]\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2737.jpg', 'https://www.soscuisine.com//recipe/parsnip-potato-soup', 'will be very useful to purée the soup.', '40 min', '140 kcal', '{\"calories\":\"140\",\"fat\":\"4 g\",\"cholesterol\":\"10 mg\",\"protein\":\"4 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"good_source_of\":\"Folacin, Potassium, Vitamin B6\",\"source_of\":\"Calcium, Copper, Fibre, Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Selenium, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin C, Vitamin D, Vitamin E, Vitamin K, Zinc\",\"low\":\"Cholesterol, Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:21:06'),
(647, 647, 1, 'Pasteis de Nata', 'On a lightly floured board, roll out the puff pastry to a 33 cm (13 in.) square, using a rolling pin. Using a brush, cover the entire surface of the pastry with butter. Roll tightly, wrap in plastic wrap and refrigerate for at least 30 min. Slice the dough roll into 12 rounds of about 3 cm. On a lightly floured board, roll out each round, using a rolling pin. Using lightly wet fingers, line the tart pans or muffin tins. Chill for at least 30 min while preparing the filling. Preheat the oven to 270°C/525°F. In a saucepan off the heat, combine the sugar, flour and one pinch of salt. Add the egg yolks and egg then until smooth. Pour in the milk, lemon juice and vanilla. Mix thoroughly. Bring to a boil over medium heat, whisking and scraping the bottom and sides of the pan. Reduce the heat and continue to until the mixture has thickened. Remove from the heat and strain through a sieve. Portion out the filling to the tart pans. Smooth out the tops using the back of a spoon. Bake in the middle of the oven until the tops are caramelized and the crusts are golden-colored, about 13-15 min. Let cool before unmoulding. Dust with cinnamon then serve.', '[\"plastic wrap\",\"puff pastry dough\",\"butter, unsalted, melted\",\"sugar\",\"white flour (all purpose)\",\"salt\",\"egg yolks\",\"eggs size large\",\"[optional]\",\"milk, partly skimmed, 2%\",\"lemonjuice, freshly squeezed\",\"vanilla extract\",\"ground cinnamon\"]', 'https://media.soscuisine.com/images/recettes/4397.jpg', 'https://www.soscuisine.com//recipe/pasteis-nata', 'Defrost the puff pastry dough at room temperature for 2 hours or overnight in the refrigerator. The dough should be flexible but still feel cold to the touch.', '60 min', '210 kcal', '{\"calories\":\"210\",\"fat\":\"10 g\",\"cholesterol\":\"80 mg\",\"protein\":\"4 g\"}', '{\"good_source_of\":\"Selenium, Vitamin B12\",\"source_of\":\"Calcium, Folacin, Iron, Manganese, Niacin, Omega-3, Omega-6, Pantothenic Acid, Phosphorus, Vitamin A, Vitamin B1, Vitamin B2, Vitamin D, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:21:06'),
(648, 648, 1, 'Pea Soup Saint-Germain', 'Make the croutons Prepare the vegetables : wash the leeks well, then chop them finely. Wash the lettuce, then chop it coarsely. Coarsely chop the Melt the butter in a saucepan over moderately low heat, then add the leeks and sauté 2-3 min, with stirring ,\r\nuntil they are softened. Pour in the and water, then bring to a boil. Add the peas and lettuce, then simmer ,\r\npartially covered (to reduce discoloration), 7-8 min, or until the peas are tender. Stir in the mint, then purée the soup in a blender food processor . Return the soup to the pan, season it with salt and pepper, then reheat it 2-3 min until it is hot. In a small bowl, the cream until it is thickened slightly but still pourable. Ladle the soup into bowls, drizzle the cream on each serving, garnish with croutons , and serve.', '[\"bread, whole wheat, for the croutons\",\"olive oil, for the croutons\",\"leeks, finely chopped\",\"Boston lettuce, or curly leaf, coarsely chopped\",\"fresh mint, coarsely chopped\",\"butter, unsalted\",\"chicken broth\",\"water\",\"frozen peas\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"whipping cream 35%\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/689.jpg', 'https://www.soscuisine.com//recipe/pea-soup-saint-germain', 'will be very useful to purée the soup.', '25 min', '240 kcal', '{\"calories\":\"240\",\"fat\":\"8 g\",\"cholesterol\":\"0 mg\",\"protein\":\"9 g\"}', '{\"excellent_source_of\":\"Fibre, Folacin, Iron, Magnesium, Manganese, Selenium, Vitamin A, Vitamin B1, Vitamin K\",\"good_source_of\":\"Niacin, Phosphorus, Potassium, Vitamin B6, Vitamin C, Zinc\",\"source_of\":\"Calcium, Copper, Pantothenic Acid, Vitamin B2, Vitamin E\",\"low\":\"Cholesterol, Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:21:07'),
(649, 649, 1, 'Peaches with Marzipan', 'Cut the peaches in half and remove the pits. If the pit does not pull out easily, use a small, sharp knife to cut around it. Divide the marzipan into as many pieces as the number of peach halves. Roll each marzipan piece into a small ball, then press it into the pit cavity of each peach half. Spoon the ricotta cheese on top of the peach halves. Crush the amaretti and sprinkle them over the top. Place the fruit halves on a hot grill or alternatively on a broiler in the oven for about 5 min, until they are hot and the cheese starts to melt. Serve immediately.', '[\"peaches, yellow, or nectarines\",\"almond paste (marzipan)\",\"ricotta cheese\",\"amaretti (dry almond macaroons)\"]', 'https://media.soscuisine.com/images/recettes/626.jpg', 'https://www.soscuisine.com//recipe/peaches-marzipan', '', '15 min', '170 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Vitamin E\",\"good_source_of\":\"Magnesium\",\"source_of\":\"Calcium, Copper, Fibre, Folacin, Iron, Manganese, Niacin, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B2, Vitamin C, Zinc\",\"low\":\"Cholesterol, Saturated Fat, Sodium\",\"free\":\"Trans Fat\"}', '2021-06-18 14:21:07');
INSERT INTO `recipe_translation` (`rt_id`, `rt_recipe_id`, `rt_lang_id`, `rt_recipe_name`, `rt_recipe_text`, `rt_recipe_ingredients_full`, `rt_recipe_image`, `rt_recipe_link`, `rt_recipe_prep`, `rt_recipe_duration`, `rt_recipe_calories`, `rt_recipe_nutrients`, `rt_recipe_claims`, `rt_created`) VALUES
(651, 651, 1, 'Peanut Butter and Chocolate Rounds', 'Preheat the oven to 175ºC/350º. Line one or two baking sheets with parchment\r\npaper . Depending on the required amount, you may have to bake in batches. Put the rolled oats in a food processor . Pulse until oat flour is formed. In a large bowl, combine all the ingredients, including the oat flour. Form about 10 cookies per baking sheets then place them on the baking sheet. Lightly press down on the cookies to flatten them a little bit. Bake in the middle of the oven until the cookies turn light brown around the edges, about 15 min. Let the cookies stand 2 min on the sheet, then transfer them to a rack, using a spatula. Let cool down 30 min before serving.', '[\"white flour (all purpose)\",\"rolled oats, ground\",\"peanut butter, natural\",\"egg whites\",\"maple syrup\",\"vanilla extract\",\"coconut oil\",\"Greek yogurt, plain, 2% M.F.\",\"bittersweet chocolate chips\",\"walnuts, chopped\",\"salt\"]', 'https://media.soscuisine.com/images/recettes/3443.jpg', 'https://www.soscuisine.com//recipe/peanut-butter-chocolate-rounds', 'will be very useful to make the oat flour.', '30 min', '250 kcal', '{\"calories\":\"250\",\"fat\":\"10 g\",\"cholesterol\":\"0 mg\",\"protein\":\"9 g\"}', '{\"excellent_source_of\":\"Manganese\",\"good_source_of\":\"Niacin, Selenium, Vitamin B1, Vitamin B2\",\"source_of\":\"Copper, Fibre, Folacin, Iron, Magnesium, Phosphorus, Potassium, Vitamin E, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:21:09'),
(652, 652, 1, 'Pear and Avocado Salad', 'Rinse and spin-dry the lettuce, then arrange the leaves on a plate. Peel the pear, discard the core then cut into thin slices. Peel the avocado, remove the stone, then cut into thin slices. Arrange the pear and avocado slices on top of the lettuce leaves. Add the oil, lime juice, mustard, and syrup to a small bowl, then season with salt and pepper. Add a pinch of cayenne pepper well using a fork until the vinaigrette is emulsified. Pour it over the salad. Add the cranberries and serve immediately.', '[\"Boston lettuce\",\"pears\",\"avocados\",\"extra virgin olive oil\",\"lime juice, freshly squeezed\",\"Dijon mustard\",\"maple syrup\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"cayenne pepper\",\"[optional]\",\"dried cranberries\"]', 'https://media.soscuisine.com/images/recettes/4408.jpg', 'https://www.soscuisine.com//recipe/pear-avocado-salad', '', '20 min', '130 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Vitamin K\",\"good_source_of\":\"Folacin, Vitamin E\",\"source_of\":\"Fibre, Manganese, Pantothenic Acid, Vitamin A\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Cholesterol, Trans Fat\"}', '2021-06-18 14:21:09'),
(653, 653, 1, 'Pepper Sauce for Pasta', 'Prepare the onion and peppers . Finely chop the onion. Cut the peppers into approx. 1 x 5 cm strips. Heat the butter and oil in a pan over low heat. Sauté the onion 4-5 min until translucent. Add the peppers, cover and cook over low heat 15-18 min until fork-tender with occasional stirring Add the cream, mix well and purée in a blender. Add salt and pepper to taste.', '[\"onions, finely chopped\",\"yellow or red sweet peppers, cut into 1 X 5 cm strips\",\"butter, unsalted\",\"olive oil\",\"whipping cream 35%\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/200.jpg', 'https://www.soscuisine.com//recipe/pepper-sauce-for-pasta', 'will be very useful to purée the  sauce.', '30 min', '320 kcal', '', '', '2021-06-18 14:21:10'),
(654, 654, 1, 'Performance Egg Sandwich', 'Preheat the oven to 175°C/350°F. Mix 1 large egg per cup of a muffin pan. Bake in the middle of the oven for about 10-15 min, or until eggs are cooked through. Take the pan out of the oven and let cool a couple of minutes before serving. Assemble the ingredients into a sandwich and serve 2 sandwiches per person.', '[\"English muffins\",\"eggs size large\",\"avocados, sliced\",\"mangoes, sliced\",\"Cheddar cheese, low-fat (4%), thinly sliced\"]', 'https://media.soscuisine.com/images/recettes/3259.jpg', 'https://www.soscuisine.com//recipe/performance-egg-sandwich', 'This recipe yields 2 sandwiches per person.', '15 min', '590 kcal', '{\"calories\":\"590\",\"fat\":\"23 g\",\"cholesterol\":\"450 mg\",\"protein\":\"31 g\"}', '{\"excellent_source_of\":\"Calcium, Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin D, Vitamin E, Zinc\",\"good_source_of\":\"Copper, Vitamin C, Vitamin K\",\"low\":\"Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:21:11'),
(655, 655, 1, 'Performance Quiches', 'Preheat the oven to 175°C/350°F. Spray a muffin pan with a vegetable oil spray. Cook the rice in the broth, about 30 min. In a large bowl, whisk the eggs, milk and milk powder using a fork. Stir in cheese, garlic and herbes de Provence, then mix well. Spoon the cooked rice into the cups of a muffin pan (fill 6 cavities for 3 servings and 12 cavities for 6 servings). Press the rice lightly to the bottom of each cup, so that it forms a crust. Fill the muffin cups with the egg mixture. Bake in the middle of the oven for about 25-30 min, until a tooth-pick inserted into the center of a muffin comes out clean. Take the pan out of the oven, leave to cool for a few minutes. Serve 2 mini-quiches per person.', '[\"vegetable oil spray, for the muffin tin\",\"brown rice\",\"chicken broth, low-sodium\",\"milk, partly skimmed, 2%\",\"evaporated milk powder\",\"Cheddar cheese, shredded\",\"eggs size large\",\"garlic, finely chopped\",\"herbes de Provence\"]', 'https://media.soscuisine.com/images/recettes/3218.jpg', 'https://www.soscuisine.com//recipe/performance-quiches', 'This recipe yields 2 mini-quiches per person.', '50 min', '600 kcal', '{\"calories\":\"600\",\"fat\":\"22 g\",\"cholesterol\":\"480 mg\",\"protein\":\"35 g\"}', '{\"diet-related_health_claims\":\"Bone-healthy\",\"free\":\"Added Sugar\",\"excellent_source_of\":\"Calcium, Folacin, Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Potassium, Selenium, Vitamin A, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin D, Zinc\",\"good_source_of\":\"Iron\",\"source_of\":\"Copper, Fibre, Vitamin E, Vitamin K\",\"low\":\"Sodium\"}', '2021-06-18 14:21:12'),
(656, 656, 1, 'Chicken Sausage Burger', 'Prepare the vegetables : Thinly slice the onion(s); cut the pepper(s) into strips. Remove the skin from the sausage and form the meat into 1,5 cm thick patties. Set aside. Heat the oil in a pan over medium heat. Add the onion and sauté 3 min until it becomes translucent. Add the green pepper and fennel seeds, then season with salt and pepper. Cook over medium-low heat until the vegetables are tender and start to caramelize, about 15 min. Remove the pan from the heat. Meanwhile, preheat the grill. Cook the patties until they are well done, about 4 min per side. Warm up the buns on the grill. Put one patty on each bun, garnish with the onion mixture, then top with a bocconcini slice. If desired, you may put the burger back on the grill until the cheese has melted. Alternatively, you may \r\ncook the patties in a pan on the stovetop. Serve.', '[\"red onions, thinly sliced\",\"green peppers, cut into strips\",\"chicken sausages\",\"olive oil\",\"fennel seeds\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"hamburger buns\",\"bocconcini \\/ fresh mozzarella, sliced\"]', 'https://media.soscuisine.com/images/recettes/989.jpg', 'https://www.soscuisine.com//recipe/chicken-sausage-burger', 'These burgers can be cooked either in a pan on the stovetop or using an outdoor grill.', '30 min', '400 kcal', '{\"calories\":\"400\",\"fat\":\"21 g\",\"cholesterol\":\"80 mg\",\"protein\":\"26 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Niacin, Vitamin B12, Zinc\",\"good_source_of\":\"Calcium, Iron, Phosphorus, Selenium, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin C\",\"source_of\":\"Copper, Magnesium, Manganese, Omega-6, Pantothenic Acid, Potassium, Vitamin A, Vitamin E, Vitamin K\"}', '2021-06-18 14:21:13'),
(657, 657, 1, 'Pesto Sauce', 'Rinse the leaves briefly only if they are very dirty. Otherwise use a wet towel to clean the leaves, then pat them dry between 2 paper towels. Drop the garlic into a food processor and finely chop it. Stop the motor, add the pine nuts and basil, then process until it is chopped. Gradually add the grated cheese and work the mixture into an evenly blended paste. Finally, slowly mix in the olive oil, until a creamy, but thick consistency is achieved. It is preferable to add the salt only later, when pouring the sauce over the pasta, to avoid the darkening of the basil. Transfer the pesto to a small bowl and add olive oil just to cover it to prevent the oxidation (and darkening) of its surface. Cover the bowl with a plastic wrap and chill until ready to use.', '[\"fresh basil, loosely packed\",\"garlic\",\"pine nuts\",\"Parmesan cheese, grated\",\"extra virgin olive oil\",\"salt, to be added when pouring over pasta\"]', 'https://media.soscuisine.com/images/recettes/681.jpg', 'https://www.soscuisine.com//recipe/pesto-sauce', 'will be very useful to make the sauce. A marble mortar and a wooden pestle would be even better, because the metal blades of the blender do affect the taste of the basil, but it will take the cook with traditional utensils too much time to achieve the final result.', '20 min', '600 kcal', '', '', '2021-06-18 14:21:14'),
(658, 658, 1, 'Pesto Sauce with Arugula', 'Rinse the arugula well. Remove and discard any thick stems and the large leaf veins, then coarsely chop the leaves. Drop the garlic and walnuts into a food processor and finely chop them. Stop the motor, add the arugula, then process until it is finely chopped. Gradually add the grated cheese and work the mixture into an evenly blended paste. Finally, slowly mix in the olive oil, until a creamy, but thick consistency is achieved. It is preferable to add the salt only later, when using the sauce, to avoid the darkening. Transfer the pesto to a small bowl, cover with a plastic wrap and chill until ready to use.', '[\"arugula\",\"garlic\",\"walnuts\",\"Parmesan cheese, grated\",\"extra virgin olive oil\",\"salt, to be added at the last minute\"]', 'https://media.soscuisine.com/images/recettes/1084.jpg', 'https://www.soscuisine.com//recipe/pesto-sauce-arugula', 'will be very useful to make the sauce.', '20 min', '600 kcal', '', '', '2021-06-18 14:21:15'),
(659, 659, 1, 'Pesto-flavoured Spelt Salad', 'Put the spelt berries in a pot, cover with water then bring to a boil. Add a little salt, cover, and simmer until the berries are cooked, about 35 min. Drain and set aside. Meanwhile, combine the garlic, pine nuts and basil in a food processor blender and finely chop. Add the grated cheese and olive oil, then mix until a creamy, but thick consistency is achieved. the mixture with the cooked spelt. Adjust the seasoning , then serve hot or at room temperature.', '[\"spelt berries\",\"fresh basil\",\"garlic\",\"pine nuts\",\"Parmesan cheese\",\"extra virgin olive oil\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/2547.jpg', 'https://www.soscuisine.com//recipe/pesto-flavoured-spelt-salad', '', '45 min', '270 kcal', '{\"calories\":\"270\",\"fat\":\"19 g\",\"cholesterol\":\"0 mg\",\"protein\":\"5 g\"}', '{\"free\":\"Sugar\",\"excellent_source_of\":\"Manganese\",\"good_source_of\":\"Magnesium, Vitamin E, Vitamin K\",\"source_of\":\"Copper, Fibre, Folacin, Iron, Niacin, Omega-6, Phosphorus, Selenium, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:21:18'),
(660, 660, 1, 'Poached Figs with Cream', 'Prepare a rather strong tea, pass it through a sieve, and pour it into a saucepan. the figs in the tea for at least 1 h, but preferably overnight. Put the saucepan on the stove, bring the tea to a boil, then reduce the heat, cover, and simmer 10 min. Take the figs out of the saucepan and set them aside (they can be served either cold or luke-warm). Bring the liquid to a boil and reduce for about 10 min, until it reaches a syrupy consistency. In a bowl, the cream using an electric mixer . Add the Mascarpone cheese and fold it into the cream, using a spatula. Add sugar to taste (figs are already rather sweet). Distribute the figs into bowls, alternating the figs with spoonfuls of cream. Drizzle the reduced syrup on top and serve.', '[\"tea (liquid)\",\"dried figs\",\"whipping cream 35%\",\"Mascarpone cheese\",\"sugar to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/407.jpg', 'https://www.soscuisine.com//recipe/poached-figs-cream', '', '30 min', '410 kcal', '{\"calories\":\"410\",\"fat\":\"24 g\",\"cholesterol\":\"80 mg\",\"protein\":\"5 g\"}', '{\"diet-related_health_claims\":\"Bone-healthy\",\"excellent_source_of\":\"Fibre, Manganese, Potassium, Vitamin A\",\"good_source_of\":\"Calcium, Magnesium\",\"source_of\":\"Copper, Folacin, Iron, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin B2, Vitamin D, Vitamin E, Vitamin K, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:21:20'),
(661, 661, 1, 'Chicken Sausage with Grapes and Figs', 'Prick the sausages in several spots using a fork. Put the sausages in a saucepan, cover them with water and bring to a boil. Cover and simmer 5 min. Take the sausages out of the water, pat them dry and cut them into 3 or 4 pieces. Heat the oil in a sauté pan over medium heat. Add the sausages and sauté 4-5 min, until they become golden coloured. Turn them a few times while cooking. Add the grapes (*) and cook 8-10 min, tossing occasionally. Cut the figs into quarters and add them to the pan about 2 min before the end of cooking. Serve.', '[\"chicken sausages\",\"olive oil\",\"grapes, seedless, sweet\",\"dried figs\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/455.jpg', 'https://www.soscuisine.com//recipe/chicken-sausage-grapes-figs', 'Keep the serving dishes in the oven at the lowest setting so they are warm when you serve.', '25 min', '430 kcal', '{\"calories\":\"430\",\"fat\":\"21 g\",\"cholesterol\":\"120 mg\",\"protein\":\"32 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"free\":\"Added Sugar\",\"excellent_source_of\":\"Manganese, Niacin, Phosphorus, Potassium, Vitamin B12, Vitamin B6, Vitamin K, Zinc\",\"good_source_of\":\"Iron, Magnesium, Pantothenic Acid, Vitamin B1, Vitamin B2, Vitamin E\",\"source_of\":\"Calcium, Copper, Fibre, Folacin\",\"low\":\"Saturated Fat\"}', '2021-06-18 14:21:23'),
(662, 662, 1, 'Polenta (Basic)', 'Add the water and salt to a saucepan. Bring the water to a gentle boil (not to a rolling boil in order to avoid lumps). Slowly pour in a continuous stream of cornmeal, stirring constantly. Reduce the heat to low and cook uncovered, stirring occasionally- Have a small pan of boiling water on the side, to dilute the polenta if it is too thick to your taste. The polenta is cooked when it pulls away from the sides of the pan, about 40 min. It may be served right away or kept for later consumption. In the latter cas, spread the mixture into a shallow casserole dish, let set, cover with plastic wrap, then refrigerate at least 2 hours.', '[\"water\",\"salt\",\"cornmeal (polenta)\"]', 'https://media.soscuisine.com/images/recettes/2790.jpg', 'https://www.soscuisine.com//recipe/polenta-basic', 'Use 1 part flour to 4 parts water (or broth or milk), but increase the amount of liquid if the cornmeal contains coarser grains or if you want a softer result (\"all\'onda\", i.e., polenta that has a ripple effect).', '45 min', '180 kcal', '{\"calories\":\"180\",\"fat\":\"2 g\",\"cholesterol\":\"0 mg\",\"protein\":\"3 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Fibre\",\"good_source_of\":\"Magnesium, Selenium\",\"source_of\":\"Copper, Folacin, Iron, Manganese, Niacin, Phosphorus, Vitamin A, Vitamin B1, Vitamin B6, Zinc\",\"low\":\"Fat, Saturated Fat\",\"free\":\"Cholesterol, Sugar, Trans Fat\"}', '2021-06-18 14:21:24'),
(663, 663, 1, 'Polenta with Cheese', 'Add the water and salt to a saucepan. Bring the water to a gentle boil (not to a rolling boil in order to avoid lumps). Slowly pour in a continuous stream of cornmeal, stirring constantly. Reduce the heat to low and cook uncovered, stirring occasionally- Have a small pan of boiling water on the side, to dilute the polenta if it is too thick to your taste. The polenta is cooked when it pulls away from the sides of the pan, about 40 min. in the cheese then serve. If the blue cheese is not creamy enough, you may need to add some butter.', '[\"water\",\"salt\",\"cornmeal (polenta)\",\"Gorgonzola cheese, or another creamy blue cheese\"]', 'https://media.soscuisine.com/images/recettes/2791.jpg', 'https://www.soscuisine.com//recipe/polenta-cheese', 'Use 1 part flour to 4 parts water (or broth or milk), but increase the amount of liquid if the cornmeal contains coarser grains or if you want a softer result (\"all\'onda\", i.e., polenta that has a ripple effect).', '45 min', '290 kcal', '{\"calories\":\"290\",\"fat\":\"11 g\",\"cholesterol\":\"20 mg\",\"protein\":\"10 g\"}', '{\"free\":\"Sugar\",\"excellent_source_of\":\"Fibre\",\"good_source_of\":\"Magnesium, Phosphorus, Selenium, Vitamin B12, Zinc\",\"source_of\":\"Calcium, Copper, Folacin, Iron, Manganese, Niacin, Pantothenic Acid, Potassium, Vitamin A, Vitamin B1, Vitamin B2, Vitamin B6\"}', '2021-06-18 14:21:26'),
(664, 664, 1, 'Polenta with Tomato Sauce', 'Add the water and salt to a saucepan. Bring the water to a gentle boil (not to a rolling boil in order to avoid lumps). Slowly pour in a continuous stream of cornmeal, stirring constantly. Reduce the heat to low and cook uncovered, stirring occasionally- Have a small pan of boiling water on the side, to dilute the polenta if it is too thick to your taste. The polenta is cooked when it pulls away from the sides of the pan, about 40 min. Few minutes before the end of polenta cooking, heat the tomato sauce in a saucepan over low heat. Portion out polenta to the dishes, add the sauce, sprinkle with parmesan, then serve.', '[\"water\",\"salt\",\"cornmeal (polenta)\",\"My Mother\'s Tomato Sauce\",\"Parmesan cheese, grated\"]', 'https://media.soscuisine.com/images/recettes/2792.jpg', 'https://www.soscuisine.com//recipe/polenta-tomato-sauce', 'Use 1 part flour to 4 parts water (or broth or milk), but increase the amount of liquid if the cornmeal contains coarser grains or if you want a softer result (\"all\'onda\", i.e., polenta that has a ripple effect).', '45 min', '210 kcal', '{\"calories\":\"210\",\"fat\":\"4 g\",\"cholesterol\":\"0 mg\",\"protein\":\"5 g\"}', '{\"excellent_source_of\":\"Fibre\",\"good_source_of\":\"Magnesium, Selenium, Vitamin A\",\"source_of\":\"Copper, Folacin, Iron, Manganese, Niacin, Pantothenic Acid, Phosphorus, Potassium, Vitamin B1, Vitamin B6, Vitamin E, Zinc\",\"low\":\"Cholesterol, Saturated Fat\",\"free\":\"Added Sugar, Trans Fat\"}', '2021-06-18 14:21:27'),
(665, 665, 1, 'Portobello Egg on Spinach', 'Preheat the oven to 190°C/375°F. Prepare the vegetables : finely chop the shallot; wash, drain, and trim the spinach; pull off the stems from the mushroom caps then chop just the stems. Set aside. Heat half of the oil in a pan over medium heat. Add the shallot and sauté 2-3 min with stirring , then add the Parsley and Garlic Base and the mushroom stems. Cook 3 min with occasional stirring . Add the diced tomatoes, cook 1 more min, then add salt and pepper. Take the pan off the heat. Heat the remaining oil in a separate pan over high heat. Add the mushroom caps and sauté 2-3 min on both sides. Transfer them to a baking sheet or an ovenproof dish. Portion out the mushroom stem mixture, making a ring around the top inside edge of each cap, leaving space for the egg in the centre. Break the egg and place it in the centre. Add salt and pepper, then cook 10 min in the middle of the oven. Meanwhile, cook the spinach in a pot without adding any water: the water trapped in the leaves after washing and gentle shaking is enough to cook them. Add salt, cover and cook over high heat 3-4 min, without overcooking, until the leaves wilt and turn very deep green. Transfer the spinach to a colander , press to remove excess water, then distribute it among the individual plates. Put the Portobello/egg on top and serve.', '[\"Portobello mushrooms, large, about 10 cm diameter\",\"shallots, finely chopped\",\"spinach\",\"olive oil\",\"Parsley and Garlic Base\",\"canned tomatoes (diced)\",\"eggs size large\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/383.jpg', 'https://www.soscuisine.com//recipe/portobello-egg-on-spinach', 'Keep the serving plates warm on the stove while you\'re preparing the dish.', '30 min', '180 kcal', '{\"calories\":\"180\",\"fat\":\"13 g\",\"cholesterol\":\"220 mg\",\"protein\":\"10 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Iron, Magnesium, Manganese, Potassium, Selenium, Vitamin A, Vitamin B12, Vitamin B2, Vitamin E, Vitamin K\",\"good_source_of\":\"Copper, Niacin, Pantothenic Acid, Phosphorus, Vitamin B6, Vitamin C\",\"source_of\":\"Calcium, Fibre, Vitamin B1, Vitamin D, Zinc\"}', '2021-06-18 14:21:29'),
(666, 666, 1, 'Potato and Celeriac PurÃÂ©e', 'Prepare the vegetables : Peel the celeriac than cut it intl slices. Do not peel the potatoes. Boil or steam until very tender, about 20-25 min. Drain well and peel. Meanwhile, in a microwave-safe bowl, pour in the milk* with butter and microwave on medium-high for a couple tens of seconds until hot. Pass the vegetables through a food mill , then put the purée back into the pot used to cook the vegetables. Pour in the butter-milk mixture, then add salt and pepper to taste. Blend well using a spatula. Reheat and serve warm.', '[\"potatoes, Russet or Idaho type, or Yukon Gold (yellow)\",\"celeriac, sliced\",\"butter, unsalted\",\"milk, partly skimmed, 2%\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/809.jpg', 'https://www.soscuisine.com//recipe/potato-celeriac-puree', 'cannot give the proper texture.', '35 min', '280 kcal', '{\"calories\":\"280\",\"fat\":\"10 g\",\"cholesterol\":\"30 mg\",\"protein\":\"7 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Magnesium, Potassium, Vitamin B6\",\"good_source_of\":\"Fibre, Iron, Manganese, Niacin, Phosphorus, Vitamin C\",\"source_of\":\"Calcium, Copper, Pantothenic Acid, Vitamin A, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin D, Vitamin K, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:21:31'),
(667, 667, 1, 'Potato Patties with Dill', 'the potatoes in their skins until soft, about 15-20 min depending on the potato size. Drain, then peel when\r\nstill warm. Place the potatoes in a bowl and mash. the egg then add it to the potatoes. Finely chop the scallions and then add them to the bowl. Crumble the feta cheese and add it to the mixture. Pour in the lemon juice and season with a little salt and pepper. Chill the mixture a few minutes until firm. Divide the mixture into golfball size balls, then flatten them slightly. Heat the oil in a thick-bottom pan over medium-high heat. When the pan is hot, add the potato patties and cook about 3 min per side, turning once, until\r\ngolden-brown. Serve on the warmed plates.', '[\"potatoes, unpeeled\",\"eggs size large\",\"green onions\\/scallions, finely chopped\",\"fresh dill, finely chopped\",\"feta cheese, crumbled\",\"lemon juice, freshly squeezed\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"canola oil\"]', 'https://media.soscuisine.com/images/recettes/523.jpg', 'https://www.soscuisine.com//recipe/potato-patties-dill', '', '40 min', '320 kcal', '{\"calories\":\"320\",\"fat\":\"14 g\",\"cholesterol\":\"130 mg\",\"protein\":\"13 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Niacin, Pantothenic Acid, Potassium, Selenium, Vitamin B12, Vitamin B2, Vitamin B6, Vitamin C, Vitamin K\",\"good_source_of\":\"Calcium, Copper, Magnesium, Phosphorus, Vitamin B1, Zinc\",\"source_of\":\"Fibre, Iron, Manganese, Vitamin A, Vitamin D, Vitamin E\"}', '2021-06-18 14:21:35'),
(668, 668, 1, 'Chicken Savoury Pie', 'Preheat the oven to 190°C/375°F. Prepare the carrots : peel, dice and blanch them about 5 min in a pot of salted boiling water. Drain and set aside. Cook the small peas, still frozen, by blanching them 5 min in a small pot of salted boiling water (if carrot dices are similar in size as the peas, they may be cooked together). Finely chop the onion and mince the garlic. Melt the butter in a pan over medium heat, add the onion and garlic then sauté about 3-4 min until translucent. Add the flour and cook 2 min with stirring . Slowly add the with stirring and bring to a boil. Add the chicken pieces, carrots, small peas and diced celery. Add salt and pepper. Cook a few minutes, then trasfer the mixture into the individual baking dishes and set them aside. On a lightly floured board, roll out the puff pastry into a 35 x 35 cm square (approx.), using a rolling pin. Cut 4 disks with the same diameter as the dishes and place them on top of each of the 4 dishes. Repeat, if necessary, with other blocks of puff pastry. Bake in the middle of the oven for about 30 min. For a nice golden-brown crust, turn on the top broiler for the last 2 min (but do not let it burn!). Serve.', '[\"carrots, peeled and diced\",\"frozen peas\",\"onions, finely chopped\",\"garlic, minced\",\"butter, unsalted\",\"white flour (all purpose)\",\"Homemade Chicken Broth\",\"Homemade Boiled Chicken\",\"celery, diced\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"puff pastry dough\"]', 'https://media.soscuisine.com/images/recettes/219.jpg', 'https://www.soscuisine.com//recipe/chicken-savoury-pie', '', '60 min', '650 kcal', '{\"calories\":\"650\",\"fat\":\"36 g\",\"cholesterol\":\"70 mg\",\"protein\":\"26 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Folacin, Iron, Manganese, Niacin, Potassium, Selenium, Vitamin A, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin K\",\"good_source_of\":\"Fibre, Magnesium, Phosphorus, Vitamin E, Zinc\",\"source_of\":\"Calcium, Copper, Omega-3, Omega-6, Pantothenic Acid, Vitamin B12, Vitamin C, Vitamin D\"}', '2021-06-18 14:21:37'),
(669, 669, 1, 'Potato Salad with Roasted Red Peppers', 'In a small bowl, soak the finely chopped onion in water with few drops of vinegar for about 30 min, while preparing the salad. You can also leave it overnight in the refrigerator. This makes the raw onion easier to digest and crispier. Prepare the potatoes : leave them unpeeled and cut them into 1 cm slices. Boil or steam them for about 15 min, just until they are tender. Transfer the potatoes to a bowl, drizzle with the lemon juice and vinegar, then gently to coat. Let the potatoes cool down to room \r\ntemperature. Combine the mayonnaise, sour cream, and mustard in a small bowl. to blend, then pour the mixture over the cooled potatoes. Add the onion and the roasted peppers, season with salt and pepper, then toss. Sprinkle with the chopped parsley then serve.', '[\"red onions, finely chopped\",\"new potatoes, unpeeled, cut into 1 cm-thick slices\",\"lemon juice, freshly squeezed\",\"white vinegar\",\"mayonnaise\",\"sour cream\",\"Dijon mustard\",\"Grilled Peppers, coarsely chopped\",\"Italian parsley, fresh, chopped\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/915.jpg', 'https://www.soscuisine.com//recipe/potato-salad-roasted-red-peppers', '', '25 min', '430 kcal', '{\"calories\":\"430\",\"fat\":\"27 g\",\"cholesterol\":\"10 mg\",\"protein\":\"5 g\"}', '{\"free\":\"Added Sugar\",\"excellent_source_of\":\"Potassium, Vitamin B6, Vitamin C, Vitamin E, Vitamin K\",\"good_source_of\":\"Copper, Fibre, Magnesium, Manganese, Niacin, Pantothenic Acid, Vitamin A, Vitamin B1\",\"source_of\":\"Folacin, Iron, Omega-3, Omega-6, Phosphorus, Vitamin B2, Zinc\"}', '2021-06-18 14:21:38'),
(670, 670, 1, 'Potato Salad with Walnuts', 'Gently place all the first five ingredients for the salad in a large salad bowl. Pour the lemon juice into the soy yogurt and mix well. Put all the ingredients for the vinaigrette into a bowl and mix well with a whisk. Season and set aside in the refrigerator. Before serving, douse the salad with creamy yogurt dressing. Toss gently. Serve in individual bowls and garnish each serving with a little grated nutmeg.', '[\"potatoes, peeled, cooked and diced into cubes\",\"apples, peeled and diced into cubes\",\"celery, thinly sliced\",\"lentils (canned), drained\",\"shallots, minced\",\"walnuts, roasted and coarsely crushed\",\"lemon juice, freshly squeezed\",\"soy yogurt\",\"mayonnaise\",\"wine vinegar, white or white balsamic\",\"creamy soy preparation for cooking\",\"whole-grain mustard\",\"salt\",\"[optional]\",\"ground pepper to taste\",\"[optional]\",\"nutmeg\"]', 'https://media.soscuisine.com/images/recettes/2250.jpg', 'https://www.soscuisine.com//recipe/potato-salad-walnuts', '', '45 min', '210 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Folacin\",\"good_source_of\":\"Magnesium, Manganese, Potassium, Vitamin B6\",\"source_of\":\"Calcium, Copper, Fibre, Iron, Niacin, Omega-3, Omega-6, Pantothenic Acid, Phosphorus, Vitamin B1, Vitamin C, Vitamin K, Zinc\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Added Sugar, Cholesterol, Trans Fat\"}', '2021-06-18 14:21:38'),
(671, 671, 1, 'Potato Wedges with Rosemary and Garlic', 'Cut each potato into 4 wedges, blanch them in a pot of salted boiling water for about 5 min, then drain well. Chop the rosemary leaves and mince the garlic. the potatoes with the olive oil, garlic, rosemary, and freshly ground pepper. Arrange the potatoes on an outdoor grill rack or alternatively an oven broiler pan. Cook the potatoes on a hot grill (or in the oven) for about 15 min, turning occasionally, until crisp and golden brown. Season with salt then serve.', '[\"potatoes, unpeeled, cut into 4 wedges\",\"olive oil\",\"garlic, minced\",\"rosemary, fresh, finely chopped\",\"ground pepper to taste\",\"[optional]\",\"salt\",\"[optional]\"]', 'https://media.soscuisine.com/images/recettes/616.jpg', 'https://www.soscuisine.com//recipe/potato-wedges-rosemary-garlic', '', '25 min', '170 kcal', '', '{\"diet_related_health_claims\":\"Artery-healthy, Heart-healthy\",\"excellent_source_of\":\"Potassium, Vitamin B6\",\"good_source_of\":\"Copper, Vitamin C\",\"source_of\":\"Fibre, Folacin, Iron, Magnesium, Manganese, Niacin, Pantothenic Acid, Phosphorus, Vitamin B1, Zinc\",\"low\":\"Saturated Fat, Sodium\",\"free\":\"Cholesterol, Sugar, Trans Fat\"}', '2021-06-18 14:21:40'),
(672, 672, 1, 'Power Cookies', 'In a bowl,crush the graham crackers to make crumbs. Add the rest of the ingredients, except coconut, then mix well. Pat mixture into cookies and press lightly in coconut. Serve 2 power cookies per person.', '[\"Graham crackers, crushed\",\"raisins\",\"peanut butter, natural, or almond butter\",\"honey\",\"water\",\"unsweetened coconut flakes\"]', 'https://media.soscuisine.com/images/recettes/3312.jpg', 'https://www.soscuisine.com//recipe/power-cookies', 'Suggested serving is 2 power cookies per person.', '10 min', '210 kcal', '{\"calories\":\"210\",\"fat\":\"7 g\",\"cholesterol\":\"0 mg\",\"protein\":\"5 g\"}', '{\"source_of\":\"Copper, Folacin, Iron, Magnesium, Manganese, Niacin, Phosphorus, Selenium, Vitamin B1, Vitamin E, Zinc\"}', '2021-06-18 14:21:41'),
(673, 673, 1, 'Pro Pancakes', 'In a bowl, together the eggs, cottage cheese, salt, and sugar. Mix until smooth, without worrying about the lumps of the cottage cheese. In another bowl, mix the flour with the baking powder. Add the milk to the first bowl and until creamy. \r\n  Add the flour mixture and mix just until blended. in half of the canola oil. Preheat a skillet over medium heat. Use 1 teaspoon of canola oil to cook each pancake. Drop batter by ¼ to &frac13; cup onto the skillet and cook until bubbles begin to break the surface and the edges no longer appear wet, about 2 to 3 min. Flip, using a thin spatula, then cook until golden on the other side, about 2 more minutes. Set aside on a plate in a warm oven while you finish the rest. Serve with the syrup and almonds.', '[\"eggs size large\",\"cottage cheese, 1%\",\"salt\",\"sugar\",\"white flour (all purpose)\",\"baking powder\",\"milk, partly skimmed, 2%\",\"canola oil\",\"maple syrup\",\"almonds, chopped\"]', 'https://media.soscuisine.com/images/recettes/3272.jpg', 'https://www.soscuisine.com//recipe/pro-pancakes', '', '15 min', '600 kcal', '{\"calories\":\"600\",\"fat\":\"28 g\",\"cholesterol\":\"230 mg\",\"protein\":\"25 g\"}', '{\"diet-related_health_claims\":\"Heart-healthy\",\"excellent_source_of\":\"Folacin, Iron, Magnesium, Manganese, Niacin, Phosphorus, Selenium, Vitamin B1, Vitamin B12, Vitamin B2, Vitamin E\",\"good_source_of\":\"Calcium, Copper, Pantothenic Acid, Potassium, Vitamin K, Zinc\",\"source_of\":\"Fibre, Omega-3, Omega-6, Vitamin A, Vitamin B6, Vitamin D\",\"low\":\"Saturated Fat\"}', '2021-06-18 14:21:41'),
(674, 674, 1, 'Pudding \"ChÃÂ´meur\"', 'Preheat the oven to 200ºC/400ºF. In a small saucepan, heat the syrup with water. Pour the mixture into a square 9 in. pan. Set aside. In a bowl,  sift together the flour, baking powder, and salt. Set aside. In another bowl, the butter and sugar, using a . Add the egg and 2 min until a smooth consistency is obtained. Incorporate the dry mixture to the egg mixture alternating with the milk. Using an ice cream scoop or a large spoon, spoon the batter into the warm syrup. Put the pan on top of a baking sheet (to collect any drippings). Bake in the middle of the oven about 30 mint. Check with a toothpick or knife to see if it is cooked\r\n  through. Let cool 20 min. Serve warm or cold.', '[\"maple syrup\",\"water\",\"white flour (all purpose)\",\"baking powder\",\"salt\",\"butter, unsalted\",\"sugar\",\"eggs size large\",\"milk, partly skimmed, 2%\"]', 'https://media.soscuisine.com/images/recettes/3474.jpg', 'https://www.soscuisine.com//recipe/pudding-chomeur', '', '40 min', '350 kcal', '{\"calories\":\"350\",\"fat\":\"7 g\",\"cholesterol\":\"50 mg\",\"protein\":\"4 g\"}', '{\"excellent_source_of\":\"Manganese, Vitamin B2\",\"good_source_of\":\"Folacin, Selenium, Vitamin B1\",\"source_of\":\"Calcium, Iron, Magnesium, Niacin, Pantothenic Acid, Phosphorus, Vitamin A, Vitamin B12, Vitamin D, Zinc\",\"low\":\"Sodium\"}', '2021-06-18 14:21:42');
